INSERT INTO `producto` (`id`, `nombre`, `imagen`, `precio`, `especificaciones`, `marca`, `id_categoria`) VALUES
(1, 'PC NEO Gaming Intel i7 14700K RTX 4070Ti SUPER 1TB SSD 32GB', 'https://www.neobyte.es/106780-large_default/pc-neo-gaming-intel-i7-14700k-rtx-4070ti-super-1tb-ssd-32gb.jpg', 2048.99, '', 'Neobyte', 0),
(2, 'PC NEO Office i7-13700F 16GB 1TB WiFi GT 730', 'https://www.neobyte.es/101923-large_default/pc-neo-office-i7-13700f-16gb-1tb-wifi-gt-730.jpg', 779, '', 'Neobyte', 0),
(3, 'PC NEO Aorus Ryzen 9 5900X RTX 4070 SUPER 1TB SSD + 2TB SSD 32GB', 'https://www.neobyte.es/111165-large_default/pc-neo-aorus-ryzen-9-5900x-rtx-4070-super-1tb-ssd-2tb-ssd-32gb.jpg', 1748.99, 'En Neobyte hemos creado este NEO AORUS con la mejor tecnología gaming de Gigabyte para que puedas hacer frente a un amplio abanico de juegos y difrutarlos como siempre habías soñado. Para ello, nuestros técnicos han incluido un placa Gigabyte B550 Aorus Elite,  un procesador AMD Ryzen 9 5900X acompañado de un Ventilador Cooler Master, 32GB de memoria RAM y tarjeta gráfica Gigabyte Nvidia GeForce RTX 4070 Super 12GB. Una combinación ganadora a la que hay que sumar una caja de estética sumamente cuidada y un almacenamiento compuesto por 1TB SSD y 2TB SSD.', 'Neobyte', 0),
(4, 'PC NEO Office i5-13400F 16GB 1TB SSD GT730', 'https://www.neobyte.es/101944-large_default/pc-neo-office-i5-13400f-16gb-1tb-ssd-gt730.jpg', 589, 'Respaldado por componentes de primeras marcas, este PC NEO OFFICE ofrecen un funcionamiento rápido y fiable. No en vano, ha sido provisto de un procesador Intel de treceava generación Intel Core i5-13400F, 16GB de memoria y SSD de 1TB. A todo ello se le añade un tamaño compacto para que quede bien en cualquier parte. No echarás nada en falta en tu día a día con este ordenador económico pero eficiente.', 'Neobyte', 0),
(5, 'PC NEO Aorus Ryzen 7 7700X RTX 4070 Ti 32GB 1TB SSD+2TB SSD', 'https://www.neobyte.es/102063-large_default/pc-neo-aorus-ryzen-7-7700x-rtx-4070-ti-32gb-1tb-ssd2tb-ssd.jpg', 2398.99, 'Las configuraciones NEO Aorus Inside tienen mucho que decir en el universo gaming. Este PC en concreto ha sido provisto de dos de los componentes más destacados de Gigabyte: la placa B650 Gaming X AX  y la gráfica Nvidia RTX 4070Ti 12GB. Además, cuenta con procesador AMD Ryzen 7 7700X, 32GB de RAM, SSD de 1TB y un segundo SSD de 2TB, un elenco de primer nivel cuya combinación garantiza los mejores resultados. Si lo tuyo es el gaming, disfrutarás de lo lindo con este equipo.', 'Neobyte', 0),
(6, 'PC NEO Office Ryzen 5 5500 16GB 1TB GT730', 'https://www.neobyte.es/101941-large_default/pc-neo-office-ryzen-5-5500-16gb-1tb-gt730.jpg', 489, '', 'Neobyte', 0),
(7, 'PC NEO Office i3-13100F 16GB 1TB SSD WIFI', 'https://www.neobyte.es/101957-large_default/pc-neo-office-i3-13100f-16gb-1tb-ssd-wifi.jpg', 499, 'Esta configuración NEO OFFICE ha sido diseñada para todos aquell@s que utilizan el ordenador en tareas no muy exigentes pero que no renuncian a un funcionamiento rápido y estable. Hablamos de un PC equipado con un procesador Intel de treceava generación, el i3-13100F, al que acompañan 16GB de RAM y una unidad SSD de 1TB, una combinación más que aceptable para ofrecer un gran rendimiento en una amplia variedad de tareas.', 'Neobyte', 0),
(8, 'PC NEO Aorus i9-14900K RTX 4080 Super 1TB SSD+2TB SSD 32GB', 'https://www.neobyte.es/102074-large_default/pc-neo-aorus-i9-14900k-rtx-4080-super-1tb-ssd2tb-ssd-32gb.jpg', 2999, '', 'Neobyte', 0),
(9, 'PC NEO Office Ryzen 5 5600G 16GB 2TB SSD', 'https://www.neobyte.es/101954-large_default/pc-neo-office-ryzen-5-5600g-16gb-2tb-ssd.jpg', 448.99, 'Si buscas rendimiento para tu día a día y no quieres complicarte la vida te presentamos un ordenador que se adapta a lo que buscas. Este NEO OFFICE incorpora un potente procesador Ryzen 5 5600G, memoria de 16GB y grabadora DVD, además de un sistema de almacenamiento nada desdeñable: disco SSD de 2TB. Y como siempre en Neobyte, con componentes de primeras marcas. La combinación perfecta entre calidad y precio.', 'Neobyte', 0),
(10, 'PC NEO Powered By Asus i5-13400F RTX 4060 1TB SSD 16GB', 'https://www.neobyte.es/106407-large_default/pc-neo-powered-by-asus-i5-13400f-rtx-4060-1tb-ssd-16gb.jpg', 999, 'Cuando los técnicos de Neobyte y uno de los principales fabricantes de hardware se ponen de acuerdo el resultado no deja indiferente a nadie. Un PC gaming equipado con tecnología ASUS con el que podrás disfrutar de una experiencia de juego única. Cuenta con procesador Intel Core i5 de 13ª generación, 16GB de memoria y una fantástica tarjeta gráfica Nvidia RTX 4060 de 8Gb que te sumergirá en la acción más trepidante a través de un funcionamiento fluido. Además, incluye un SSD de 1TB, conectividad Wifi y fuente de alimentación con certificación 80+ Bronze. Aprovecha al máximo el rendimiento que ofrece este PC NEO Powered by Asus.', 'Neobyte', 0),
(11, 'PC NEO Gaming i7-14700K RTX 4070 SUPER SSD 1TB + SSD 2TB 32GB', 'https://www.neobyte.es/107429-large_default/pc-neo-gaming-i7-14700k-rtx-4070-super-ssd-1tb-ssd-2tb-32gb.jpg', 1999, 'Por menos de lo que piensas puedes hacerte con este potente y elegante NEO GAMING provisto de CPU Intel Core i7-14700K, 32GB de RAM y tarjeta gráfica Nvidia GeForce RTX 4070 SUPER de 12GB, así como almacenamiento compuesto por 1TB SSD + 2TB SSD. Una configuración equilibrada que permite mover con soltura la mayoría de los juegos actuales y que te aporta la fiabilidad que solo los fabricantes de primer nivel puede asegurarte. Busca, compara y vuelve para hacerte con el ordenador gaming que siempre habías soñado.', 'Neobyte', 0),
(12, 'PC NEO Office i3-13100F 32GB SSD 1TB', 'https://www.neobyte.es/101960-large_default/pc-neo-office-i3-13100f-32gb-ssd-1tb.jpg', 499, '', 'Neobyte', 0),
(13, 'PC NEO Powered by Asus PRO Ryzen 7700X RTX 4070 Ti SUPER 2TB SSD 32GB', 'https://www.neobyte.es/108572-large_default/pc-neo-powered-by-asus-pro-ryzen-7700x-rtx-4070-ti-super-2tb-ssd-32gb.jpg', 2049, 'El ordenador NEO Powered By Asus PRO proporciona el rendimiento profesional que tu día a día necesita. Para ello, nuestros técnicos han ensamblado sobre una placa base del reconocido fabricante, un procesador Amd Ryzen 7 7700X, 32GB de RAM y lo último en almacenamiento, como es un SSD M.2 Nvme de 2TB. Con él podrás producir música y ejecutar todo tipo de tareas pesadas con una fluidez asombrosa y disfrutar de la máxima fiabilidad. Además, en Neobyte, tendrás la certeza de que tu máquina será montada por técnicos con más de 15 años de experiencia y sometida a los tests más rigurosos.', 'Neobyte', 0),
(14, 'PC NEO Powered by Asus TUF i7-14700K RTX 4060 1TB SSD 16GB', 'https://www.neobyte.es/106389-large_default/pc-neo-powered-by-asus-tuf-i7-14700k-rtx-4060-1tb-ssd-16gb.jpg', 1399, 'Con una estética que no esconde sus intenciones y un rendimiento impresionante, el NEO Powered By Asus TUF Edition se atreve con los juegos más exigentes del momento y te permite disfrutarlos como siempre habías soñado. Nuestros técnicos han dotado a esta configuración gaming de un potente procesador Intel Core i7-14700K, 16GB de memoria RAM y SSD de 1TB para que disfrutes de la máxima velocidad ejecutando todo tipo de programas y trabajando con grandes cantidades de archivos. El broche de oro lo pone una tarjeta gráfica de última generación Nvidia GeForce RTX 4060 de 8GB, provista de las tecnologías más innovadoras y la conectividad más completa.', 'Neobyte', 0),
(15, 'NEO MINI CELERON N4500 8GB SSD 1TB', 'https://www.neobyte.es/67961-large_default/neo-mini-celeron-n4500-8gb-ssd-1tb.jpg', 248.99, 'Fiabilidad y rendimiento en tamaño mini PC. Mejorando versiones anteriores, este NEO MINI ofrece un funcionamiento estable y fluido en las tareas informáticas cotidianas, incluyendo ofimática, reproducción de contenido multimedia, navegación web, etc. Para ello ha sido provisto de un procesador Intel Celeron N4500, 8GB de memoria y una unidad SSD de 1TB. Además, dispone de conectividad Wifi y Bluetooth, así como diferentes puertos para conectar múltiples dispositivos.', 'Neobyte', 0),
(16, 'PC NEO Powered by Asus PRO i9-14900KF RTX 4070 SUPER 32GB 1TB SSD + 2TB SSD', 'https://www.neobyte.es/101896-large_default/pc-neo-powered-by-asus-pro-i9-14900kf-rtx-4070-super-32gb-1tb-ssd-2tb-ssd.jpg', 2499, 'Si buscas un ordenador de sobremesa con una capacidad de procesamiento insuperable y con la garantía de un gran fabricante como Asus, no te pierdas este NEO Powered By Asus PRO, ideal para tareas profesionales que exijan una CPU de última generación (Intel Core i9-14900KF), gran cantidad de memoria RAM (32GB) y un almacenamiento completo que incorpora la última tecnología en materia de rendimiento (SSD M.2 Nvme de 1TB + SSD M.2 Nvme de 2TB). Todo ello con una caja de diseño sobrio y silencioso y, solo en Neobyte, con las máximas garantías y la confianza de saber que nuestros técnicos cuentan con más de 15 años de experiencia.', 'Neobyte', 0),
(17, 'PC NEO Gaming Ryzen 7 7700X RTX 4080 Super 32GB 1TB SSD + 4TB SSD', 'https://www.neobyte.es/108428-large_default/pc-neo-gaming-ryzen-7-7700x-rtx-4080-super-32gb-1tb-ssd-4tb-ssd.jpg', 2799, 'Desafía los límites con este PC NEO Gaming con procesador AMD Ryzen 7 7700X, una bestia diseñada y ensamblada por nuestros técnicos con más de 15 años de experiencia que te permitirá hacer frente a las tareas y juegos más exigentes. Entre sus características técnicas más importantes, destacar también los 32GB de memoria RAM y, por supuesto, la impresionante tarjeta gráfica Nvidia GeForce RTX 4080 Super de 16GB. Con ella podrás exprimir al máximo las posibilidades de los juegos triple A y ejecutar aplicaciones de diseño, render y edición sin problemas. Por último, indicar que ha sido provisto de SSD de 1TB y SSD 4TB para que almacenes todo lo que necesites.', 'Neobyte', 0),
(18, 'PC NEO Powered By Asus i5-14600K RTX 4060Ti SSD 2TB 32GB', 'https://www.neobyte.es/107280-large_default/pc-neo-powered-by-asus-i5-14600k-rtx-4060ti-ssd-2tb-32gb.jpg', 1499, 'Nuestro nuevo NEO Powered By Asus es tan poderoso como parece. Equipado con un procesador Intel de 14ª generación Intel Core i5-14600K, 32GB de memoria RAM y tarjeta gráfica RTX 4060Ti de 8GB, está preparado para catapultar tus juegos a lo más alto, permitiéndote disfrutarlos con un nivel de detalle sensacional y con una fluidez extraordinaria. Además, hemos incluido un SSD de 2TB que sorprende por la rapidez a la hora de arrancar y ejecutar todo tipo de aplicaciones. Todo ello en una caja de lujo y con la garantía de una gran marca como Asus y la experiencia de Neobyte.', 'Neobyte', 0),
(19, 'PC NEO Powered by Asus PRO Ryzen 7 7700X RTX 4070 SUPER SSD 1TB+ SSD 2TB 32GB', 'https://www.neobyte.es/102975-large_default/pc-neo-powered-by-asus-pro-ryzen-7-7700x-rtx-4070-super-ssd-1tb-ssd-2tb-32gb.jpg', 1989, 'Al nuevo NEO Powered By Asus PRO que hemos configurado no le falta detalle. A su diseño elegante, ideal para integrar en un entorno profesional o doméstico, hay que sumar unas especificaciones técnicas que quitan el hipo, como son la incorporación de un procesador Amd Ryzen 7 7700X, 32GB de memoria RAM y tarjeta gráfica Nvidia Geforce RTX 4070 SUPER 12GB, características que permiten ejecutar de manera solvente y fluida la mayoría de programas y juegos del mercado. Paralelamente, hemos incluido una solución de almacenamiento compuesta por 1TB SSD y 2TB SSD que proporciona la mayor velocidad de arranque y gestión de archivos.', 'Neobyte', 0),
(20, 'PC NEO Gaming i7-13700K RTX 4070Ti SUPER SSD 1TB 32GB', 'https://www.neobyte.es/107268-large_default/pc-neo-gaming-i7-13700k-rtx-4070ti-super-ssd-1tb-32gb.jpg', 1979, '', 'Neobyte', 0),
(21, 'PC NEO Powered By Asus Ryzen 9 7900X RTX 4070 SUPER SSD 1TB+2TB 32GB', 'https://www.neobyte.es/106404-large_default/pc-neo-powered-by-asus-ryzen-9-7900x-rtx-4070-super-ssd-1tb2tb-32gb.jpg', 1899, 'Nuestro ordenador NEO Powered By Asus más poderoso no te dejará indiferente. Provisto de procesador Amd Ryzen 9 7900X y 32GB de memoria RAM, es capaz de desarrollar con una fluidez increíble incluso las tareas informáticas más pesadas. Paralelamente, la tarjeta gráfica Nvidia Geforce RTX 4070 SUPER que hemos incorporado asegura un rendimiento extremo a la hora de jugar. Pero nuestros técnicos son insaciables y querían mejorarlo añadiendo al conjunto un SSD de 1TB y otro SSD de 2TB, todo ello dentro de una caja de diseño único: la Corsair 3000D.', 'Neobyte', 0),
(22, 'PC NEO Powered by Asus PRO Ryzen 7 5800X3D RTX 4060 Ti 1TB SSD + 2TB 32GB', 'https://www.neobyte.es/106461-large_default/pc-neo-powered-by-asus-pro-ryzen-7-5800x3d-rtx-4060-ti-1tb-ssd-2tb-32gb.jpg', 1489, 'En Neobyte conocemos las necesidades de los profesionales más exigentes, por lo que hemos creado esta configuración NEO Powered By Asus PRO con procesador Amd Ryzen 5800X3D, 32 GB de RAM y almacenamiento SSD de 1TB + SSD de 2TB, todos ellos componentes de marcas de primer nivel para que disfrutes de la máxima fiabilidad y rendimiento. Además, para hacer frente a las tareas gráficas y de cálculo más pesadas, hemos incorporado la tarjeta gráfica Nvidia Geforce RTX 4060Ti 8GB, una auténtica bestia que se atreve con todo. Todo ello con la conectividad más completa, 3 años de garantía y envío en tiempo récord.', 'Neobyte', 0),
(23, 'PC NEO Gaming i7-13700K RTX 4070Ti SUPER 1TB SSD+2TB SSD 32GB', 'https://www.neobyte.es/106421-large_default/pc-neo-gaming-i7-13700k-rtx-4070ti-super-1tb-ssd2tb-ssd-32gb.jpg', 2338.99, 'Te presentamos el ordenador NEO GAMING con procesador Intel Core i7-13700K de 13ª generación, 32GB de memoria RAM y tarjeta gráfica RTX 4070Ti SUPER de 16GB, una auténtica apisonadora capaz de mover con increíble soltura los juegos y programas más exigentes. Bajo su apariencia sobria y elegante, encontramos también un almacenamiento combinado de 1TB SSD + 2TB SSD, lo que asegura la máxima velocidad a la hora de arrancar, transferir información, ejecutar aplicaciones... Confía en Neobyte para el montaje de tu equipo de alto rendimiento por experiencia, atención personalizada, garantía y precio.', 'Neobyte', 0),
(24, 'PC NEO Gaming i5-14400F RTX 4070 SUPER SSD 1TB 16GB', 'https://www.neobyte.es/90761-large_default/pc-neo-gaming-i5-14400f-rtx-4070-super-ssd-1tb-16gb.jpg', 1398.99, '', 'Neobyte', 0),
(25, 'PC NEO Powered By Asus Ryzen 5 5600X RTX 4060 SSD 1TB 16GB', 'https://www.neobyte.es/106336-large_default/pc-neo-powered-by-asus-ryzen-5-5600x-rtx-4060-ssd-1tb-16gb.jpg', 939, '', 'Neobyte', 0),
(26, 'PC NEO Office i5-13400 16GB SSD 1TB', 'https://www.neobyte.es/101932-large_default/pc-neo-office-i5-13400-16gb-ssd-1tb.jpg', 538.99, '', 'Neobyte', 0),
(27, 'PC NEO Gaming Intel i5 13500 RTX 4070 SUPER 1TB SSD 16GB', 'https://www.neobyte.es/107264-large_default/pc-neo-gaming-intel-i5-13500-rtx-4070-super-1tb-ssd-16gb.jpg', 1499, '', 'Neobyte', 0),
(28, 'PC NEO Powered By Asus Ryzen 9 7900X3D RTX 4080 Super SSD 1TB+4TB 64GB', 'https://www.neobyte.es/94980-large_default/pc-neo-powered-by-asus-ryzen-9-7900x3d-rtx-4080-super-ssd-1tb4tb-64gb.jpg', 3599, 'Rendimiento extremo y máxima fiabilidad van de la mano en nuestra configuración NEO Powered By Asus con procesador AMD Ryzen 9 de 7ª generación 7900X3D, 64GB de memoria RAM y tarjeta gráfica de 16GB Nvidia Geforce RTX 4080 Super, una combinación perfecta para empezar a disfrutar de tus juegos como siempre habías imaginado, con la máxima fluidez y un nivel de detalles increíble. En lo referente al almacenamiento, hemos incorporado un disco sólido de 1TB que, combinado con otro SSD de 4TB, ofrece una velocidad sensacional a la hora de arrancar, ejecutar aplicaciones... Todo ello dentro de una caja de diseño irresistible diseño y grandes alternativas de configuración.', 'Neobyte', 0),
(29, 'PC NEO Gaming i5-13400F RTX 4060 1TB SSD 16GB', 'https://www.neobyte.es/111650-large_default/pc-neo-gaming-i5-13400f-rtx-4060-1tb-ssd-16gb.jpg', 1039, 'Disfruta de un rendimiento de vanguardia con este NEO Gaming. Equipado con procesador Intel Core i5-13400F de 13ª generación, 16GB de memoria RAM y SSD de 1TB, lo tiene todo para hacerte vibrar en cada juego y experimentar lo último en cuanto a prestaciones. En el apartado gráfico, destacar que nuestros técnicos han incorporado una Nvidia GeForce RTX 4060 de 8GB, un componente en perfecto equilibrio con el resto de hardware. El resultado es un ordenador de sobremesa que se atreve con todo y ofrece una respuesta ágil en las tareas y juegos más variados. Por supuesto, este PC NEO Gaming incluye solo componentes de fabricantes de primer nivel y es concebido y ensamblado por nuestros técnicos con más de 15 años de experiencia.', 'Neobyte', 0),
(30, 'PC NEO Gaming i7-13700K RTX 4070 SUPER SSD 1TB 16GB', 'https://www.neobyte.es/106327-large_default/pc-neo-gaming-i7-13700k-rtx-4070-super-ssd-1tb-16gb.jpg', 1699, 'Si te vuelve loc@ el RGB pero además quieres un PC gamer de garantías, nuestra configuración NEO Gaming es justo lo que buscas. A un diseño irresistiblemente llamativo que incluye multitud de componentes (incluyendo la caja) con iluminación RGB, hay que sumar la incorporación de un potente procesador como es el Intel Core i7-13700K, 16 GB de memoria RAM y tarjeta gráfica RTX 4070 SUPER de 12GB. Además, en cuanto a almacenamiento se refiere, este equipo está provisto de 1Tb SSD. Rendimiento sin contemplaciones y un estética que te dejará sin palabras... todo esto y mucho más cabe en este Neo Gaming.', 'Neobyte', 0),
(31, 'PC NEO Office i3-13100 16GB 1TB SSD Windows 11', 'https://www.neobyte.es/101926-large_default/pc-neo-office-i3-13100-16gb-1tb-ssd-windows-11.jpg', 529, '', 'Neobyte', 0),
(32, 'PC NEO Gaming i5-14600K RTX 4070Ti SSD1TB 32GB', 'https://www.neobyte.es/106675-large_default/pc-neo-gaming-i5-14600k-rtx-4070ti-ssd1tb-32gb.jpg', 1799, '¿Buscas lo último en rendimiento? En Neobyte hemos diseñado este PC gaming incluyendo la tecnología más innovadora para que disfrutes de tus juegos al máximo. En este caso hemos elegido un procesador Intel Core i5-14600K de 14ª generación y memorias RAM DDR5 hasta 5200 Mhz, acompañados de una espectacular tarjeta gráfica Nvidia RTX 4070Ti de 12GB. También dispone de un SSD de 1TB de capacidad y fuente de alimentación con certificacion 80 Plus Gold. Compite con los mejores y vive el gaming más inmersivo con este PC NEO GAMING.', 'Neobyte', 0),
(33, 'PC NEO Gaming Intel i7 14700K RTX 4070Ti SUPER 1TB SSD 32GB', 'https://www.neobyte.es/106780-large_default/pc-neo-gaming-intel-i7-14700k-rtx-4070ti-super-1tb-ssd-32gb.jpg', 2048.99, '', 'Neobyte', 0),
(34, 'Lenovo Legion T5 26IAB7 - Ordenador sobremesa Intel i5 12400F 16GB RTX 3060 512GB', 'https://www.neobyte.es/88868-large_default/lenovo-legion-t5-26iab7-ordenador-sobremesa-intel-i5-12400f-16gb-rtx-3060-512gb.jpg', 1037.9, 'Lenovo Legion T5 26IAB7 - Ordenador sobremesa Intel i5 12400F 16GB RTX 3060 512GB', 'Lenovo', 0),
(35, 'Lenovo IdeaCentre Gaming 5 17ACN7 - Ordenador sobremesa Ryzen 7 5700G 16GB RTX 3050 512GB', 'https://www.neobyte.es/88899-large_default/lenovo-ideacentre-gaming-5-17acn7-ordenador-sobremesa-ryzen-7-5700g-16gb-rtx-3050-512gb.jpg', 953.9, 'Lenovo IdeaCentre Gaming 5 17ACN7 - Ordenador sobremesa Ryzen 7 5700G 16GB RTX 3050 512GB', 'Lenovo', 0),
(36, 'Lenovo IdeaCentre Gaming 5 17IAB7 - Ordenador sobremesa Intel i5 12400F 16GB RTX 3050 512GB Windows 11', 'https://www.neobyte.es/88842-large_default/lenovo-ideacentre-gaming-5-17iab7-ordenador-sobremesa-intel-i5-12400f-16gb-rtx-3050-512gb-windows-11.jpg', 1250.9, 'Lenovo IdeaCentre Gaming 5 17IAB7 - Ordenador sobremesa Intel i5 12400F 16GB RTX 3050 512GB Windows 11', 'Lenovo', 0),
(37, 'Lenovo Legion T5 26IAB7 - Ordenador sobremesa Intel i5 12400F 16GB RTX 3060 1TB', 'https://www.neobyte.es/88873-large_default/lenovo-legion-t5-26iab7-ordenador-sobremesa-intel-i5-12400f-16gb-rtx-3060-1tb.jpg', 1329.9, 'Lenovo Legion T5 26IAB7 - Ordenador sobremesa Intel i5 12400F 16GB RTX 3060 1TB', 'Lenovo', 0),
