(77, 'PC NEO Powered by Asus PRO i9-14900KF RTX 4070 SUPER 32GB 1TB SSD + 2TB SSD', 'https://www.neobyte.es/101896-large_default/pc-neo-powered-by-asus-pro-i9-14900kf-rtx-4070-super-32gb-1tb-ssd-2tb-ssd.jpg', 2499, 'Si buscas un ordenador de sobremesa con una capacidad de procesamiento insuperable y con la garantía de un gran fabricante como Asus, no te pierdas este NEO Powered By Asus PRO, ideal para tareas profesionales que exijan una CPU de última generación (Intel Core i9-14900KF), gran cantidad de memoria RAM (32GB) y un almacenamiento completo que incorpora la última tecnología en materia de rendimiento (SSD M.2 Nvme de 1TB + SSD M.2 Nvme de 2TB). Todo ello con una caja de diseño sobrio y silencioso y, solo en Neobyte, con las máximas garantías y la confianza de saber que nuestros técnicos cuentan con más de 15 años de experiencia.', 'Neobyte', 0),
(78, 'PC NEO Powered by Asus PRO Ryzen 7 7700X RTX 4070 SUPER SSD 1TB+ SSD 2TB 32GB', 'https://www.neobyte.es/102975-large_default/pc-neo-powered-by-asus-pro-ryzen-7-7700x-rtx-4070-super-ssd-1tb-ssd-2tb-32gb.jpg', 1989, 'Al nuevo NEO Powered By Asus PRO que hemos configurado no le falta detalle. A su diseño elegante, ideal para integrar en un entorno profesional o doméstico, hay que sumar unas especificaciones técnicas que quitan el hipo, como son la incorporación de un procesador Amd Ryzen 7 7700X, 32GB de memoria RAM y tarjeta gráfica Nvidia Geforce RTX 4070 SUPER 12GB, características que permiten ejecutar de manera solvente y fluida la mayoría de programas y juegos del mercado. Paralelamente, hemos incluido una solución de almacenamiento compuesta por 1TB SSD y 2TB SSD que proporciona la mayor velocidad de arranque y gestión de archivos.', 'Neobyte', 0),
(79, 'PC NEO Powered by Asus PRO Ryzen 7 5800X3D RTX 4060 Ti 1TB SSD + 2TB 32GB', 'https://www.neobyte.es/106461-large_default/pc-neo-powered-by-asus-pro-ryzen-7-5800x3d-rtx-4060-ti-1tb-ssd-2tb-32gb.jpg', 1489, 'En Neobyte conocemos las necesidades de los profesionales más exigentes, por lo que hemos creado esta configuración NEO Powered By Asus PRO con procesador Amd Ryzen 5800X3D, 32 GB de RAM y almacenamiento SSD de 1TB + SSD de 2TB, todos ellos componentes de marcas de primer nivel para que disfrutes de la máxima fiabilidad y rendimiento. Además, para hacer frente a las tareas gráficas y de cálculo más pesadas, hemos incorporado la tarjeta gráfica Nvidia Geforce RTX 4060Ti 8GB, una auténtica bestia que se atreve con todo. Todo ello con la conectividad más completa, 3 años de garantía y envío en tiempo récord.', 'Neobyte', 0),
(80, 'PC NEO Powered by Asus i9-14900KF RTX 4070Ti SUPER SSD 1TB+2TB 32GB', 'https://www.neobyte.es/101893-large_default/pc-neo-powered-by-asus-i9-14900kf-rtx-4070ti-super-ssd-1tb2tb-32gb.jpg', 2599, 'Toda la fiabilidad y el rendimiento de unos componentes punteros se aúnan en este equipo Powered by Asus. Un PC equipado con procesador Intel Core i9-14900KF, 32GB de memoria, gráfica dedicada Nvidia Geforce RTX 4070Ti SUPER 16GB y SSD de 1TB... todo ello enmarcado en una caja Corsair 3000D  que desborda diseño y posibilidades. El resultado es una máquina que sobresale en rendimiento, concebida para dar lo máximo en todo tipo de juegos y tareas exigentes. Confía en los más de 15 años de experiencia de Neobyte y llévate un PC muy completo, potente y con el precio más ajustado.', 'Neobyte', 0),
(81, 'PC NEO Powered by Asus PRO Ryzen 7700X RTX 4070 Ti SUPER 2TB SSD 32GB', 'https://www.neobyte.es/108572-large_default/pc-neo-powered-by-asus-pro-ryzen-7700x-rtx-4070-ti-super-2tb-ssd-32gb.jpg', 2049, 'El ordenador NEO Powered By Asus PRO proporciona el rendimiento profesional que tu día a día necesita. Para ello, nuestros técnicos han ensamblado sobre una placa base del reconocido fabricante, un procesador Amd Ryzen 7 7700X, 32GB de RAM y lo último en almacenamiento, como es un SSD M.2 Nvme de 2TB. Con él podrás producir música y ejecutar todo tipo de tareas pesadas con una fluidez asombrosa y disfrutar de la máxima fiabilidad. Además, en Neobyte, tendrás la certeza de que tu máquina será montada por técnicos con más de 15 años de experiencia y sometida a los tests más rigurosos.', 'Neobyte', 0),
(82, 'PC NEO Powered by Asus PRO i9-14900KF RTX 4070 SUPER 32GB 1TB SSD + 2TB SSD', 'https://www.neobyte.es/101896-large_default/pc-neo-powered-by-asus-pro-i9-14900kf-rtx-4070-super-32gb-1tb-ssd-2tb-ssd.jpg', 2499, 'Si buscas un ordenador de sobremesa con una capacidad de procesamiento insuperable y con la garantía de un gran fabricante como Asus, no te pierdas este NEO Powered By Asus PRO, ideal para tareas profesionales que exijan una CPU de última generación (Intel Core i9-14900KF), gran cantidad de memoria RAM (32GB) y un almacenamiento completo que incorpora la última tecnología en materia de rendimiento (SSD M.2 Nvme de 1TB + SSD M.2 Nvme de 2TB). Todo ello con una caja de diseño sobrio y silencioso y, solo en Neobyte, con las máximas garantías y la confianza de saber que nuestros técnicos cuentan con más de 15 años de experiencia.', 'Neobyte', 0),
(83, 'PC NEO Powered by Asus PRO Ryzen 7 7700X RTX 4070 SUPER SSD 1TB+ SSD 2TB 32GB', 'https://www.neobyte.es/102975-large_default/pc-neo-powered-by-asus-pro-ryzen-7-7700x-rtx-4070-super-ssd-1tb-ssd-2tb-32gb.jpg', 1989, 'Al nuevo NEO Powered By Asus PRO que hemos configurado no le falta detalle. A su diseño elegante, ideal para integrar en un entorno profesional o doméstico, hay que sumar unas especificaciones técnicas que quitan el hipo, como son la incorporación de un procesador Amd Ryzen 7 7700X, 32GB de memoria RAM y tarjeta gráfica Nvidia Geforce RTX 4070 SUPER 12GB, características que permiten ejecutar de manera solvente y fluida la mayoría de programas y juegos del mercado. Paralelamente, hemos incluido una solución de almacenamiento compuesta por 1TB SSD y 2TB SSD que proporciona la mayor velocidad de arranque y gestión de archivos.', 'Neobyte', 0),
(84, 'PC NEO Powered by Asus PRO Ryzen 7 5800X3D RTX 4060 Ti 1TB SSD + 2TB 32GB', 'https://www.neobyte.es/106461-large_default/pc-neo-powered-by-asus-pro-ryzen-7-5800x3d-rtx-4060-ti-1tb-ssd-2tb-32gb.jpg', 1489, 'En Neobyte conocemos las necesidades de los profesionales más exigentes, por lo que hemos creado esta configuración NEO Powered By Asus PRO con procesador Amd Ryzen 5800X3D, 32 GB de RAM y almacenamiento SSD de 1TB + SSD de 2TB, todos ellos componentes de marcas de primer nivel para que disfrutes de la máxima fiabilidad y rendimiento. Además, para hacer frente a las tareas gráficas y de cálculo más pesadas, hemos incorporado la tarjeta gráfica Nvidia Geforce RTX 4060Ti 8GB, una auténtica bestia que se atreve con todo. Todo ello con la conectividad más completa, 3 años de garantía y envío en tiempo récord.', 'Neobyte', 0),
(85, 'PC NEO Powered by Asus TUF i7-14700K RTX 4060 1TB SSD 16GB', 'https://www.neobyte.es/106389-large_default/pc-neo-powered-by-asus-tuf-i7-14700k-rtx-4060-1tb-ssd-16gb.jpg', 1399, 'Con una estética que no esconde sus intenciones y un rendimiento impresionante, el NEO Powered By Asus TUF Edition se atreve con los juegos más exigentes del momento y te permite disfrutarlos como siempre habías soñado. Nuestros técnicos han dotado a esta configuración gaming de un potente procesador Intel Core i7-14700K, 16GB de memoria RAM y SSD de 1TB para que disfrutes de la máxima velocidad ejecutando todo tipo de programas y trabajando con grandes cantidades de archivos. El broche de oro lo pone una tarjeta gráfica de última generación Nvidia GeForce RTX 4060 de 8GB, provista de las tecnologías más innovadoras y la conectividad más completa.', 'Neobyte', 0);
INSERT INTO `producto` (`id`, `nombre`, `imagen`, `precio`, `especificaciones`, `marca`, `id_categoria`) VALUES
(86, 'PC NEO Powered By Asus i5-14600K RTX 4060Ti SSD 2TB 32GB', 'https://www.neobyte.es/107280-large_default/pc-neo-powered-by-asus-i5-14600k-rtx-4060ti-ssd-2tb-32gb.jpg', 1499, 'Nuestro nuevo NEO Powered By Asus es tan poderoso como parece. Equipado con un procesador Intel de 14ª generación Intel Core i5-14600K, 32GB de memoria RAM y tarjeta gráfica RTX 4060Ti de 8GB, está preparado para catapultar tus juegos a lo más alto, permitiéndote disfrutarlos con un nivel de detalle sensacional y con una fluidez extraordinaria. Además, hemos incluido un SSD de 2TB que sorprende por la rapidez a la hora de arrancar y ejecutar todo tipo de aplicaciones. Todo ello en una caja de lujo y con la garantía de una gran marca como Asus y la experiencia de Neobyte.', 'Neobyte', 0),
(87, 'PC NEO Powered by Asus i5-13400F RTX 4070 SUPER 1TB SSD 32GB', 'https://www.neobyte.es/106410-large_default/pc-neo-powered-by-asus-i5-13400f-rtx-4070-super-1tb-ssd-32gb.jpg', 1598.99, 'Toda la potencia del hardware Asus más top cabe en este NEO Powered by Asus, un PC gaming configurado por nuestros técnicos con más de 15 años de experiencia para hacerte vibrar en cada juego y/o realizar todo tipo de tareas de manera ágil. Provisto de procesador Intel de 13ª generación Intel Core i5-13400F, placa base de alta gama, 32GB de memoria RAM, SSD de 1TB y tarjeta gráfica Nvidia GeForce RTX 4070 SUPER de 12GB, ofrece un rendimiento impresionante a todos los niveles y la máxima fiabilidad. No renuncies a nada con este PC NEO Powered by Asus.', 'Neobyte', 0),
(88, 'PC NEO Powered By Asus Ryzen 9 7900X RTX 4070 SUPER SSD 1TB+2TB 32GB', 'https://www.neobyte.es/106404-large_default/pc-neo-powered-by-asus-ryzen-9-7900x-rtx-4070-super-ssd-1tb2tb-32gb.jpg', 1899, 'Nuestro ordenador NEO Powered By Asus más poderoso no te dejará indiferente. Provisto de procesador Amd Ryzen 9 7900X y 32GB de memoria RAM, es capaz de desarrollar con una fluidez increíble incluso las tareas informáticas más pesadas. Paralelamente, la tarjeta gráfica Nvidia Geforce RTX 4070 SUPER que hemos incorporado asegura un rendimiento extremo a la hora de jugar. Pero nuestros técnicos son insaciables y querían mejorarlo añadiendo al conjunto un SSD de 1TB y otro SSD de 2TB, todo ello dentro de una caja de diseño único: la Corsair 3000D.', 'Neobyte', 0),
(89, 'PC NEO Powered by Asus i5-14600KF RTX 4060 1TB 16GB', 'https://www.neobyte.es/106453-large_default/pc-neo-powered-by-asus-i5-14600kf-rtx-4060-1tb-16gb.jpg', 1199, '', 'Neobyte', 0),
(90, 'PC NEO Powered By Asus Ryzen 5 5600X RTX 4060 SSD 1TB 16GB', 'https://www.neobyte.es/106336-large_default/pc-neo-powered-by-asus-ryzen-5-5600x-rtx-4060-ssd-1tb-16gb.jpg', 939, '', 'Neobyte', 0),
(91, 'PC NEO Powered by Asus i7-13700K RTX 4070 SUPER 1TB SSD 32GB', 'https://www.neobyte.es/106458-large_default/pc-neo-powered-by-asus-i7-13700k-rtx-4070-super-1tb-ssd-32gb.jpg', 1899, 'Neobyte y Asus, mano a mano para crear este NEO Powered by Asus, un PC ensamblado por nuestros técnicos con componentes Asus de primera calidad, lo que garantiza el máximo nivel de fiablidad y garantías. Bajo un chasis de lujo, encontramos un procesador Intel Core i7-13700K de 16 núcleos, 32GB de memoria RAM, un SSD de alta velocidad de 1TB y tarjeta gráfica Asus Nvidia GeForce RTX 4070 SUPER de 12GB. Este hardware asegura un rendimiento espectacular en todo tipo de juegos y aplicaciones profesionales. Echa un vistazo a sus características y verás que a este NEO Powered by Asus no le falta detalle.', 'Neobyte', 0),
(92, 'PC NEO Powered By Asus Ryzen 9 7900X3D RTX 4080 Super SSD 1TB+4TB 64GB', 'https://www.neobyte.es/94980-large_default/pc-neo-powered-by-asus-ryzen-9-7900x3d-rtx-4080-super-ssd-1tb4tb-64gb.jpg', 3599, 'Rendimiento extremo y máxima fiabilidad van de la mano en nuestra configuración NEO Powered By Asus con procesador AMD Ryzen 9 de 7ª generación 7900X3D, 64GB de memoria RAM y tarjeta gráfica de 16GB Nvidia Geforce RTX 4080 Super, una combinación perfecta para empezar a disfrutar de tus juegos como siempre habías imaginado, con la máxima fluidez y un nivel de detalles increíble. En lo referente al almacenamiento, hemos incorporado un disco sólido de 1TB que, combinado con otro SSD de 4TB, ofrece una velocidad sensacional a la hora de arrancar, ejecutar aplicaciones... Todo ello dentro de una caja de diseño irresistible diseño y grandes alternativas de configuración.', 'Neobyte', 0),
(93, 'PC NEO Powered By Asus i5-13400F RTX 4060 1TB SSD 16GB', 'https://www.neobyte.es/106407-large_default/pc-neo-powered-by-asus-i5-13400f-rtx-4060-1tb-ssd-16gb.jpg', 999, 'Cuando los técnicos de Neobyte y uno de los principales fabricantes de hardware se ponen de acuerdo el resultado no deja indiferente a nadie. Un PC gaming equipado con tecnología ASUS con el que podrás disfrutar de una experiencia de juego única. Cuenta con procesador Intel Core i5 de 13ª generación, 16GB de memoria y una fantástica tarjeta gráfica Nvidia RTX 4060 de 8Gb que te sumergirá en la acción más trepidante a través de un funcionamiento fluido. Además, incluye un SSD de 1TB, conectividad Wifi y fuente de alimentación con certificación 80+ Bronze. Aprovecha al máximo el rendimiento que ofrece este PC NEO Powered by Asus.', 'Neobyte', 0),
(94, 'PC NEO Powered by Asus i7-14700KF RTX 4060 Ti SSD 1TB+SSD 2TB 32GB', 'https://www.neobyte.es/109979-large_default/pc-neo-powered-by-asus-i7-14700kf-rtx-4060-ti-ssd-1tbssd-2tb-32gb.jpg', 1939, '', 'Neobyte', 0),
(95, 'PC NEO Aorus Ryzen 9 5900X RTX 4070 SUPER 1TB SSD + 2TB SSD 32GB', 'https://www.neobyte.es/111165-large_default/pc-neo-aorus-ryzen-9-5900x-rtx-4070-super-1tb-ssd-2tb-ssd-32gb.jpg', 1748.99, 'En Neobyte hemos creado este NEO AORUS con la mejor tecnología gaming de Gigabyte para que puedas hacer frente a un amplio abanico de juegos y difrutarlos como siempre habías soñado. Para ello, nuestros técnicos han incluido un placa Gigabyte B550 Aorus Elite,  un procesador AMD Ryzen 9 5900X acompañado de un Ventilador Cooler Master, 32GB de memoria RAM y tarjeta gráfica Gigabyte Nvidia GeForce RTX 4070 Super 12GB. Una combinación ganadora a la que hay que sumar una caja de estética sumamente cuidada y un almacenamiento compuesto por 1TB SSD y 2TB SSD.', 'Neobyte', 0),
(96, 'PC NEO Aorus Ryzen 7 7700X RTX 4070 Ti 32GB 1TB SSD+2TB SSD', 'https://www.neobyte.es/102063-large_default/pc-neo-aorus-ryzen-7-7700x-rtx-4070-ti-32gb-1tb-ssd2tb-ssd.jpg', 2398.99, 'Las configuraciones NEO Aorus Inside tienen mucho que decir en el universo gaming. Este PC en concreto ha sido provisto de dos de los componentes más destacados de Gigabyte: la placa B650 Gaming X AX  y la gráfica Nvidia RTX 4070Ti 12GB. Además, cuenta con procesador AMD Ryzen 7 7700X, 32GB de RAM, SSD de 1TB y un segundo SSD de 2TB, un elenco de primer nivel cuya combinación garantiza los mejores resultados. Si lo tuyo es el gaming, disfrutarás de lo lindo con este equipo.', 'Neobyte', 0),
(97, 'PC NEO Aorus i9-14900K RTX 4080 Super 1TB SSD+2TB SSD 32GB', 'https://www.neobyte.es/102074-large_default/pc-neo-aorus-i9-14900k-rtx-4080-super-1tb-ssd2tb-ssd-32gb.jpg', 2999, '', 'Neobyte', 0),
(98, 'PC NEO NZXT Edition - i7-14700KF RTX 4070Ti 1TB SSD+2TB SSD 32GB', 'https://www.neobyte.es/108431-large_default/pc-neo-nzxt-edition-i7-14700kf-rtx-4070ti-1tb-ssd2tb-ssd-32gb.jpg', 2239, 'Belleza, potencia y exclusividad se unen en nuestro NEO Powered By NZXT. Un equipo desarrollado bajo una de las cajas más representativas de la prestigiosa marca sobre las que nuestros técnicos han ensamblado una placa Gigabyte de última generación, un procesador Intel Core i7-14700KF, 32GB de memoria RAM y una gráfica Nvidia GeForce RTX 4070Ti de 12GB para que vivas tus juegos con la mayor intensidad y todo lujo de detalles. Respecto al almacenamiento, esta configuración incorpora un sólido de 1TB acompañado de otro disco SSD de 2TB. Todo ello con un diseño sobrio y elegante que transmite calidad y confianza desde el primer instante.', 'Neobyte', 0),
(99, 'PC NEO NZXT Edition - Ryzen 7 7700X RTX 4070 SUPER 1TB SSD+2TB SSD 32GB', 'https://www.neobyte.es/108575-large_default/pc-neo-nzxt-edition-ryzen-7-7700x-rtx-4070-super-1tb-ssd2tb-ssd-32gb.jpg', 2099, 'No podrás resistirte al increíble diseño y extraordinarias prestaciones de nuestro NEO Powered By NZXT, un ordenador de acabado minimalista en el que no hemos dejado ningún detalle al azar. Bajo una caja NZXT hemos ensamblado una placa base de última generación desarrollada por el prestigioso fabricante Gigabyte, a la que hemos sumado un procesador Amd Ryzen 7 7700X, refrigeración líquida, 32GB de memoria RAM, gráfica Nvidia GeForce RTX 4070 SUPER de 12GB y almacenamiento compuesto por 1TB SSD y 2TB SSD para que disfrutes de la máxima velocidad y una gran capacidad. Potente, bello y único, así es nuestro PC NEO Powered By NZXT.', 'Neobyte', 0),
(100, 'PC NEO Corsair iCUE BlackFlag i9-13900K RTX 4070Ti SUPER SSD 1TB 32GB', 'https://www.neobyte.es/90484-large_default/pc-neo-corsair-icue-blackflag-i9-13900k-rtx-4070ti-super-ssd-1tb-32gb.jpg', 2499, '¿Buscas un ordenador gaming de garantías? En Neobye hemos creado esta configuración en base a las preferencias de nuestros clientes y a la experiencia de nuestros técnicos. Un PC en el que no faltan la estabilidad y el rendimiento de los procesadores Intel, con un i9-13900K, y la potencia de una gráfica Nvidia de última generación, la RTX 4070Ti SUPER 16GB. Si añadimos la velocidad que aportan la memoria de 32GB y el SSD de 1TB obtenemos un equipo con el que disfrutar de tus juegos al máximo. Y como siempre, con el sello de calidad de los principales fabricantes.', 'Neobyte', 0),
(101, 'PC NEO Corsair iCUE BlackFlag R7-7800X3D RTX 4080 Super SSD 4TB 32GB', 'https://www.neobyte.es/103415-large_default/pc-neo-corsair-icue-blackflag-r7-7800x3d-rtx-4080-super-ssd-4tb-32gb.jpg', 3199, 'Si buscas un ordenador de sobremesa potente, con un diseño sobrio y equipado con todo, échale un vistazo a nuestro NEO GAMING con procesador Amd Ryzen 7 7800X3D, 32GB de memoria RAM y tarjeta gráfica RTX 4080 Super de 16GB. Además, para que no eches en falta de nada, lo hemos equipado con 4TB de almacenamiento SSD, y amplias alternativas de conectividad:  Ethernet, USB 3.0... Todo ello con la garantía de nuestra experiencia y la tranquilidad que da saber que todos nuestros PC\'s solo incorporan componentes de primera calidad.', 'Neobyte', 0),
(102, 'PC NEO Corsair iCUE BlackFlag Ryzen 5 5600X RTX 4060 1TB SSD 16GB', 'https://www.neobyte.es/106503-large_default/pc-neo-corsair-icue-blackflag-ryzen-5-5600x-rtx-4060-1tb-ssd-16gb.jpg', 999, '', 'Neobyte', 0),
(103, 'PC NEO Corsair iCUE BlackFlag i7-14700K RTX 4070Ti SUPER 1TB SSD 32GB', 'https://www.neobyte.es/103016-large_default/pc-neo-corsair-icue-blackflag-i7-14700k-rtx-4070ti-super-1tb-ssd-32gb.jpg', 2299, 'Preparado para todo, este PC NEO Gaming con procesador Intel Core i7-14700K y tarjeta gráfica Nvidia GeForce RTX 4070Ti SUPER de 16GB es el equipo perfecto tanto para jugar a los juegos más exigentes como para incrementar tu productividad ejecutando tareas pesadas. Este ordenador ha sido concebido por nuestros técnicos para alcanzar los más altos niveles de rendimiento, fiabilidad y compatibilidad, por lo que se adaptará a tus necesidades actuales y futuras. Otras de sus especificaciones técnicas más importantes son los 32GB de memoria RAM y el SSD NVMe de 1TB. Ahora puede ser tuyo al precio más competitivo y con la confianza de nuestros montajes de calidad y garantía.', 'Neobyte', 0),
(104, 'PC NEO Corsair iCUE BlackFlag i7-14700K RTX 4070 SUPER 1TB 32GB', 'https://www.neobyte.es/106514-large_default/pc-neo-corsair-icue-blackflag-i7-14700k-rtx-4070-super-1tb-32gb.jpg', 2198.99, 'El PC NEO Gaming que tienes ante ti combina potencia y fiabilidad para que te diviertas y trabajes con todas las garantías. Hablamos de una configuración equilibrada que destaca por su rendimiento y que es capaz de llevar a cabo una amplia variedad de tareas de forma fluida para jugar y trabajar más cómodamente. Integra componentes de primeras marcas, destacando la CPU Intel Core i7-14700K y la tarjeta gráfica Nvidia RTX 4070 SUPER. Dispone de memoria RAM de 32GB, SSD de 1TB, refrigeración líquida, conectividad Wifi... Da el salto de calidad al precio más competitivo.', 'Neobyte', 0),
(105, 'PC NEO Corsair iCUE BlackFlag i9-14900K RTX 4080 Super 1TB 32GB', 'https://www.neobyte.es/90291-large_default/pc-neo-corsair-icue-blackflag-i9-14900k-rtx-4080-super-1tb-32gb.jpg', 2949, '¡Prepárate para cualquier batalla! Hemos diseñado este PC NEO para que no eches nada en falta a la hora de jugar o trabajar, incluyendo componentes de contrastado rendimiento que garantizan un funcionamiento rápido y fluido. Su listado de especificaciones está encabezado por un procesador Intel Core i9-14900K al que acompaña una gráfica Nvidia RTX 4080 Super 16Gb. También cuenta con memoria RAM DDR5 de 32GB y un SSD de 1TB, además de refrigeración líquida Corsair iCUE H100I RGB Elite y conectividad Wifi. Hazte con él y juega sin límites.', 'Neobyte', 0),
(106, 'PC NEO MSI Dragonclaw Ryzen 7 7700X 32GB RTX 4070 Ti Super 1TB SSD', 'https://www.neobyte.es/110165-large_default/pc-neo-msi-dragonclaw-ryzen-7-7700x-32gb-rtx-4070-ti-super-1tb-ssd.jpg', 1949, 'Y para la conectividad, no te preocupes. Este ordenador integra Wifi y Bluetooth, proporcionándote opciones flexibles para conectarte a la red y dispositivos periféricos. Un verdadero arsenal para los amantes de los juegos más actuales. ¡Prepárate para que tus rivales sientan tu verdadera fuerza gaming!', 'Neobyte', 0),
(107, 'PC NEO MSI Dragonclaw i5-14600K 32GB RTX 4070 Super 1TB SSD', 'https://www.neobyte.es/110176-large_default/pc-neo-msi-dragonclaw-i5-14600k-32gb-rtx-4070-super-1tb-ssd.jpg', 1598.99, '¡Ruge con poder con el ordenador gaming PC NEO MSI Dragonclaw! Equipado con un Intel Core i5 14600K, y una tarjeta gráfica NVIDIA GeForce RTX 4070 Super, y placa base MSI B760 Gaming Plus WiFi. Experimenta velocidad con 32GB RAM a 5200MHz, gráficos impresionantes, y almacenamiento ultrarrápido de 1TB SSD. Todo resguardado en la elegante caja MSI MAG Forge 112R y refrigerado por MSI MAG CoreLiquid P240 de 240mm. Con Wifi y Bluetooth integrados en la placa base, ¡prepárate para dominar en cualquier juego con una conexión estable!', 'Neobyte', 0),
(108, 'PC NEO MSI Dragonclaw i7-14700K 32GB RTX 4080 Super 1TB SSD', 'https://www.neobyte.es/110179-large_default/pc-neo-msi-dragonclaw-i7-14700k-32gb-rtx-4080-super-1tb-ssd.jpg', 2599, '¡Conquista el juego con el PC NEO MSI Dragonclaw! Equipado con un Intel Core i7 14700K y una gráfica NVIDIA GeForce RTX 4080 Super, te asegura una sesión de juego y streaming increíble. No sufras por si el aliento ígneo de este dragón daña tus componentes porque viene preparado para ello con su refrigeración líquida MSI MAG CoreLiquid 240R v2, que mantendrá a raya la temperatura interna sin sacrificar rendimiento. Gracias a la placa base MSI Z790 Tomahawk WiFi, tendrás conectividad WIFI 6 y Bluetooth 5.3 para estar al día y disponer de conexión estable. Para mover esta bestia, nada más y nada menos que la fuente MSI MPG A1000G con certificación Intel ATX 3.0 y hasta 1000W. Obtendrás un un rendimiento imparable. ¡Domina el campo de batalla como nunca antes!', 'Neobyte', 0),
