(133, 'Asus M3700WYAK-WA061W - All in One 27 Ryzen 5 5625U 16GB 512GB SSD W11', 'https://www.neobyte.es/100167-large_default/asus-m3700wyak-wa061w-all-in-one-27-ryzen-5-5625u-16gb-512gb-ssd-w11.jpg', 740.9, 'Finalmente, su rendimiento está garantizado por un eficiente procesador AMD Ryzen 5 5625U y 16GB de RAM, asegurando una multitarea fluida y rápida para todo tipo de tareas, desde la navegación web hasta la gestión de correos electrónicos, y posicionándose así como una solución integral para las necesidades informáticas diarias.', 'Asus', 0),
