(139, 'Asus A3402WBAT-WA070W - All in One 23.8 i5-1235U 16GB 512GB SSD', 'https://www.neobyte.es/111665-large_default/asus-a3402wbat-wa070w-all-in-one-238-i5-1235u-16gb-512gb-ssd.jpg', 999, 'Descubre el potente y elegante Asus A3402WBAT-WA070W, un All in One que reúne rendimiento excepcional y diseño innovador. Equipado con una pantalla táctil IPS de 23.8 FHD, este dispositivo ofrece una experiencia visual inmersiva con su tecnología Anti-Glare y una sorprendente relación pantalla-cuerpo de hasta el 88%. Impulsado por un procesador Intel Core i5 1235U y una memoria de 16GB de RAM, este equipo proporciona un rendimiento rápido y fluido en cualquier tarea. Con un almacenamiento SSD de 512GB y gráficos Intel Iris Xe, disfruta de una capacidad de respuesta y calidad visual excepcionales. Además, cuenta con una cámara HD de 720p, altavoces y micrófono integrados para una comunicación clara. Con Windows 11 Home preinstalado y una amplia gama de puertos de conectividad, este dispositivo ofrece versatilidad y conveniencia en un elegante diseño blanco.', 'Asus', 0),
