(145, 'NEO MINI I5 13500H 16GB 1TB ASUS', 'https://www.neobyte.es/111243-large_default/neo-mini-i5-13500h-16gb-1tb-asus.jpg', 799, 'Ideal para comercios, negocios y oficinas en las que el ahorro de espacio sea importante, este mini PC con procesador Intel Core i5-13500H es una fantástica opción para trabajar con solvencia. Cuenta con 16GB de memoria RAM y sistema de almacenamiento SSD de 1TB de capacidad, además de una extensa y variada conectividad para conectar tus dispositivos y periféricos. Hazte con él y disfruta del rendimiento más fiable.', 'Neobyte', 0),
