(153, 'Asus ExpertCenter D500SD_CZ-312100020X - Barebone i3-12100 8GB 256GB SSD W11', 'https://www.neobyte.es/93154-large_default/asus-expertcenter-d500sdcz-312100020x-barebone-i3-12100-8gb-256gb-ssd-w11.jpg', 455.9, 'MINI PC ASUS EXPERTCENTER D500SD_CZ-312100020X', 'Asus', 0),
(154, 'Asus NUC BNUC11TNHI50000 - Barebone i5-1135G7', 'https://www.neobyte.es/108423-large_default/asus-nuc-bnuc11tnhi50000-barebone-i5-1135g7.jpg', 400.9, 'Experimenta un rendimiento sobresaliente con el NUC Asus BNUC11TNHI50000. Este ordenador compacto integra un procesador Intel Core i5 1135G7 que logra una velocidad máxima de 4.20GHz, garantizando una eficacia rápida para tus tareas diarias. Dotado de las tecnologías de conexión más avanzadas, como Wi-Fi 6 y Bluetooth 5.2, gozarás de una conectividad fluida y sencilla. Este ordenador reducido ofrece una gran potencia en un diseño elegante, dándote la opción de escoger la memoria y el almacenamiento que más te convengan.', 'Asus', 0),
(155, 'Asus ExpertCenter PB63-B5028AH - Mini PC i5-13400', 'https://www.neobyte.es/110964-large_default/asus-expertcenter-pb63-b5028ah-mini-pc-i5-13400.jpg', 781.9, 'El Asus ExpertCenter PB63-B5028AH es un mini PC de alto rendimiento y gran durabilidad, que viene equipado con procesador Intel Core i5 13400  y gráficos Intel UHD. Recomendado para empresas, ejecuta Windows 11 Pro para un rendimiento óptimo. Equipado con Wi-Fi 6E de Intel y Bluetooth 5.2, ofrece conectividad inalámbrica rápida y segura. Su diseño compacto y versátil lo hace ideal para oficinas, hospitales o entornos minoristas, con opciones de montaje VESA y una ranura de bloqueo Kensington para seguridad adicional.', 'Asus', 0),
(156, 'Asus Vivo PB63-B5046AH - Barebone i5-13400 16GB 512GB SSD W11', 'https://www.neobyte.es/106576-large_default/asus-vivo-pb63-b5046ah-barebone-i5-13400-16gb-512gb-ssd-w11.jpg', 818.9, 'MINI PC ASUS PB63-B5046AH', 'Asus', 0),
(157, 'Asus NUC BNUC11TNHI50002 - Barebone i5-1135G7', 'https://www.neobyte.es/108419-large_default/asus-nuc-bnuc11tnhi50002-barebone-i5-1135g7.jpg', 403.9, 'Descubre un rendimiento excepcional con el NUC Asus BNUC11TNHI50002 . Este dispositivo está impulsado por un procesador Intel Core i5 1135G7 que alcanza una frecuencia máxima de 4.20GHz, proporcionando un desempeño ágil para tus actividades cotidianas. Equipado con las últimas tecnologías de conexión, como Wi-Fi 6 y Bluetooth 5.2, disfrutarás de una conectividad veloz y sin complicaciones. Este ordenador compacto ofrece un gran poder en un diseño minimalista, brindándote la libertad de elegir la memoria y el almacenamiento según tus necesidades.', 'Asus', 0),
(158, 'Asus ExpertCenter D700SDES-512400145X - Barebone i5-12400 8GB 512GB SSD', 'https://www.neobyte.es/111424-large_default/asus-expertcenter-d700sdes-512400145x-barebone-i5-12400-8gb-512gb-ssd.jpg', 547.9, 'Además, este equipo cuenta con un potente procesador Intel Core i5 12400, 8GB de RAM DDR4 y un rápido almacenamiento de 512GB SSD, preinstalado con Windows 11 Pro, ofreciendo una plataforma segura y eficiente para tus necesidades empresariales.', 'Asus', 0),
(159, 'Intel NUC 11 PRO - Barebone i5-1135G7', 'https://www.neobyte.es/79164-large_default/intel-nuc-11-pro-barebone-i5-1135g7.jpg', 403.9, 'Intel NUC 11 PRO - Barebone i5-1135G7', 'Intel', 0),
(160, 'Asus ExpertCenter D500SD-CZ-512400041X - Barebone i5-12400 8GB 256GB SSD W11', 'https://www.neobyte.es/95847-large_default/asus-expertcenter-d500sd-cz-512400041x-barebone-i5-12400-8gb-256gb-ssd-w11.jpg', 535.9, 'MINI PC ASUS EXPERTCENTER D500SD-CZ-512400041X', 'Asus', 0),
(161, 'Asus ExpertCenter D500SD_CZ-512400054X - Barebone i5-12400 16GB 512GB', 'https://www.neobyte.es/93367-large_default/asus-expertcenter-d500sdcz-512400054x-barebone-i5-12400-16gb-512gb.jpg', 575.9, 'MINI PC ASUS EXPERTCENTER D500SD_CZ-512400054X', 'Asus', 0),
(162, 'MINI PC ASUS CHROMEBOX4-G3006UN', 'https://www.neobyte.es/63065-large_default/mini-pc-asus-chromebox4-g3006un.jpg', 661.89, 'Chromebox4g3006', 'Asus', 0),
(163, 'Asus NUC 11 Essential BNUC11ATKPE0002 - Barebone Intel Pentium N6005', 'https://www.neobyte.es/110757-large_default/asus-nuc-11-essential-bnuc11atkpe0002-barebone-intel-pentium-n6005.jpg', 206.9, 'Estos kits de mini PC están diseñados para proporcionar lo esencial, con un enfoque en calidad y flexibilidad. Presentan un diseño simplificado y numerosas opciones de montaje integradas, así como puertos HDMI y seis puertos USB para una conectividad versátil.', 'Asus', 0),
(164, 'Asus NUC 11 Essential BNUC11ATKC20RA2 - Barebone Celeron N4505', 'https://www.neobyte.es/110949-large_default/asus-nuc-11-essential-bnuc11atkc20ra2-barebone-celeron-n4505-.jpg', 209.9, 'El Asus NUC 11 Essential BNUC11ATKC20RA2 es un dispositivo versátil diseñado para satisfacer las necesidades de quioscos, colaboración, transmisión y señalización digital. Equipado con procesadores Intel Celeron, ofrece un rendimiento confiable respaldado por la calidad reconocida de Intel. Su diseño simplificado y opciones de montaje sencillas lo hacen fácil de instalar en una variedad de entornos, desde quioscos públicos hasta salas de reuniones corporativas. Además, cuenta con una amplia gama de puertos USB y de vídeo, lo que facilita la conexión de periféricos y dispositivos externos para una mayor versatilidad y funcionalidad.', 'Asus', 0),
(165, 'Asus PN41-BBC129MVS1 - Barebone Intel Celeron N4500', 'https://www.neobyte.es/85434-large_default/asus-pn41-bbc129mvs1-barebone-intel-celeron-n4500.jpg', 171.9, 'MINI PC ASUS PN41-BBC129MVS1 N4500 1,1 GHz', 'Asus', 0),
(166, 'Intel NUC 13 Pro Mini PC - Barebone i5-1340P 8GB 512GB SSD W11', 'https://www.neobyte.es/99666-large_default/intel-nuc-13-pro-mini-pc-barebone-i5-1340p-8gb-512gb-ssd-w11.jpg', 796.91, 'Intel NUC 13 Pro Mini PC - Barebone i5-1340P 8GB 512GB SSD W11', 'Intel', 0),
(167, 'Asus ChromeBox CHROMEBOX5-S5007UN - Barebone i5-1240P 8GB 128GB SSD', 'https://www.neobyte.es/101078-large_default/asus-chromebox-chromebox5-s5007un-barebone-i5-1240p-8gb-128gb-ssd.jpg', 794.9, 'MINI PC ASUS CHROMEBOX5-S5007UN', 'Asus', 0),
(168, 'Asus PN41-BC033ZVS1 - Barebone Intel Celeron N5100 4GB 128GB SSD', 'https://www.neobyte.es/80402-large_default/asus-pn41-bc033zvs1-barebone-intel-celeron-n5100-4gb-128gb-ssd.jpg', 331.9, 'Asus PN41-BC033ZVS1 - Barebone Intel Celeron N5100 4GB 128GB SSD', 'Asus', 0),
(169, 'Asus ChromeBox CHROMEBOX5-S3006UN - MiniPC i3-1220P 8GB 128GB SSD', 'https://www.neobyte.es/98026-large_default/asus-chromebox-chromebox5-s3006un-minipc-i3-1220p-8gb-128gb-ssd.jpg', 660.9, 'MINI PC ASUS CHROMEBOX5-S3006UN', 'Asus', 0),
(170, 'Intel NUC NUC11ATKC4 - Barebone Celeron N5105', 'https://www.neobyte.es/71662-large_default/intel-nuc-nuc11atkc4-barebone-celeron-n5105.jpg', 169.9, 'Disfruta de lo esencial al precio más bajo con el Intel NUC NUC11ATKC4, un barebone asequible pero con grandes posibilidades. Por sus características y tamaño compacto, es la base perfecta para configurar un mini PC para recepciones, puntos de venta, restaurantes, hoteles... Cuenta con procesador Intel Celeron N5105 de 4 núcleos, adecuado para tareas básicas, así como con dos ranuras para RAM SODIMM y slots para almacenamiento SSD. Además, el Intel NUC NUC11ATKC4 integra diferentes puertos y opciones de conexión: WiFi, Bluetooth, HDMI, DisplayPort, USB-C...', 'Intel', 0),
(171, 'Asus ExpertCenter D700SDES-712700095X - Barebone i7-12700 16GB 512GB SSD', 'https://www.neobyte.es/111399-large_default/asus-expertcenter-d700sdes-712700095x-barebone-i7-12700-16gb-512gb-ssd.jpg', 837.9, 'Compacto y versátil, este PC se adapta a cualquier entorno laboral, ya sea en posición vertical u horizontal. Su tamaño reducido permite colocarlo fácilmente junto a un monitor o encima de él, proporcionando flexibilidad en la disposición de tu espacio de trabajo.', 'Asus', 0),
(172, 'MSI Cubi 5 12M-025BEU - Barebone i3-1215U 8GB 256GB SSD W11', 'https://www.neobyte.es/99606-large_default/msi-cubi-5-12m-025beu-barebone-i3-1215u-8gb-256gb-ssd-w11.jpg', 518.9, 'MSI Cubi 5 12M-025BEU - Barebone i3-1215U 8GB 256GB SSD W11', 'MSI', 0),
(173, 'PC NEO Powered By Asus i5-13400F RTX 4060 1TB SSD 16GB', 'https://www.neobyte.es/106407-large_default/pc-neo-powered-by-asus-i5-13400f-rtx-4060-1tb-ssd-16gb.jpg', 999, 'Cuando los técnicos de Neobyte y uno de los principales fabricantes de hardware se ponen de acuerdo el resultado no deja indiferente a nadie. Un PC gaming equipado con tecnología ASUS con el que podrás disfrutar de una experiencia de juego única. Cuenta con procesador Intel Core i5 de 13ª generación, 16GB de memoria y una fantástica tarjeta gráfica Nvidia RTX 4060 de 8Gb que te sumergirá en la acción más trepidante a través de un funcionamiento fluido. Además, incluye un SSD de 1TB, conectividad Wifi y fuente de alimentación con certificación 80+ Bronze. Aprovecha al máximo el rendimiento que ofrece este PC NEO Powered by Asus.', 'Neobyte', 0),
(174, 'PC NEO Powered By Asus Ryzen 5 5600X RTX 4060 SSD 1TB 16GB', 'https://www.neobyte.es/106336-large_default/pc-neo-powered-by-asus-ryzen-5-5600x-rtx-4060-ssd-1tb-16gb.jpg', 939, '', 'Neobyte', 0),
(175, 'PC NEO Gaming Ryzen 5 5600G RTX 4060 SSD 1TB 16GB', 'https://www.neobyte.es/110042-large_default/pc-neo-gaming-ryzen-5-5600g-rtx-4060-ssd-1tb-16gb.jpg', 869, 'Nuestro equipo técnico pasa tantas horas jugando como montando ordenadores, por lo que la elección de los componentes de este PC NEO Gaming ha sido pan comido. En este caso hemos apostado por la fiabilidad y la potencia de AMD, con un procesador Ryzen 5 5600G, un habitual de las configuraciones Neobyte. A esta CPU la acompañan 16GB de memoria RAM, gráfica Nvidia RTX 4060 y un sistema de almacenamiento muy completo, con un SSD de 1TB. El resultado es un PC solvente, que ofrece una respuesta rápida y un funcionamiento estable. PC NEO Gaming: componentes de primeras marcas, experiencia de más 15 años montando ordenadores y la garantía de los mejores fabricantes.', 'Neobyte', 0),
(176, 'PC NEO Gaming Ryzen 7 5700X RTX 4060 1TB SSD 16GB', 'https://www.neobyte.es/106506-large_default/pc-neo-gaming-ryzen-7-5700x-rtx-4060-1tb-ssd-16gb.jpg', 998.99, 'Equipado con componentes de primeras marcas y diseñado por técnicos experimentados, este PC NEO Gaming te permitirá disfrutar de un funcionamiento estable y fluido. Un ordenador gaming en el que se ha buscado el equilibrio entre una configuración de garantías y un precio ajustado, siempre pensando en ofrecer un rendimiento óptimo a la hora de jugar y trabajar. Para ello se ha incluido un procesador Amd Ryzen 7 5700X, 16GB de memoria y una potente gráfica Nvidia RTX 4060, además de un SSD de 1TB. ¡Codéate con los mejores!', 'Neobyte', 0),
(177, 'PC NEO Gaming i5-13400F RTX 4060 SSD 1TB 16GB', 'https://www.neobyte.es/110039-large_default/pc-neo-gaming-i5-13400f-rtx-4060-ssd-1tb-16gb.jpg', 959, 'No tengas dudas, los PC NEO son garantía de durabilidad y rendimiento. Ordenadores diseñados y ensamblados por profesionales con más de 15 años de experiencia que conocen a la perfección las necesidades de los usuarios y que han sabido encontrar el equilibrio entre sus componentes para ofrecer la mejor respuesta. Es el caso de este PC NEO Gaming, equipado con procesador Intel Core i5 de 13ª generación y gráfica Nvidia RTX 4060, una combinación letal sinónimo de potencia. Además, ha sido provisto de un sistema de almacenamiento muy completo, con un SSD de 1TB. ¡Apuesta fuerte y destaca entre tus adversarios!', 'Neobyte', 0),
(178, 'PC NEO Gaming Ryzen 5 5500 RTX 4060 SSD 1TB 16GB', 'https://www.neobyte.es/106895-large_default/pc-neo-gaming-ryzen-5-5500-rtx-4060-ssd-1tb-16gb.jpg', 799, '', 'Neobyte', 0),
(179, 'PC NEO Corsair iCUE BlackFlag Ryzen 5 5600X RTX 4060 1TB SSD 16GB', 'https://www.neobyte.es/106503-large_default/pc-neo-corsair-icue-blackflag-ryzen-5-5600x-rtx-4060-1tb-ssd-16gb.jpg', 999, '', 'Neobyte', 0),
(180, 'PC NEO Gaming i5-12400F RTX 4060 SSD 1TB 16GB', 'https://www.neobyte.es/110186-large_default/pc-neo-gaming-i5-12400f-rtx-4060-ssd-1tb-16gb.jpg', 849, 'Te presentamos otra configuración con el sello de identidad de Neobyte: primeras marcas, componentes equilibrados y el precio más ajustado. En esta ocasión, hemos confeccionado un PC que incluye la innovadora gráfica Nvidia RTX 4060, un elemento con el que disfrutar de juegos de forma rápida y fluida. Incluye, por supuesto, un procesador de garantías, el Intel Core i5-12400F, con 16GB de RAM y SSD de 1TB, una apuesta clara por la potencia y la fiabilidad. A todo ello añadimos una caja espectacular con impresionantes efectos de iluminación y ya tenemos un PC Gaming de primer nivel.', 'Neobyte', 0),
(181, 'PC NEO Gaming Ryzen 5 5500 RTX 4060 SSD 1TB 16GB', 'https://www.neobyte.es/106678-large_default/pc-neo-gaming-ryzen-5-5500-rtx-4060-ssd-1tb-16gb.jpg', 849, 'Jugar con todas las garantías, de forma fluida y rápida es la propuesta de este PC NEO Gaming. Un ordenador equipado con procesador AMD Ryzen 5, 16GB de memoria y una potente gráfica RTX 4060 que te permitirá disfrutar de una increíble experiencia gaming, apostando por la fiabilidad de unos componentes ampliamente contrastados y fiables. En cuanto al resto del hardware, este equipo cuenta con un SSD de 1TB, que aporta espacio y velocidad al funcionamiento general del PC, fuente de alimentación de 750W y una caja robusta. Confía en los 15 años de experiencia de Neobyte y hazte ahora con este impresionante ordenador.', 'Neobyte', 0),
(182, 'PC NEO Gaming i5-14400F RTX 4060Ti SSD 1TB 16GB', 'https://www.neobyte.es/110045-large_default/pc-neo-gaming-i5-14400f-rtx-4060ti-ssd-1tb-16gb.jpg', 1098.99, '', 'Neobyte', 0),
(183, 'PC NEO Gaming i5-13400F RTX 4060 1TB SSD 16GB', 'https://www.neobyte.es/111650-large_default/pc-neo-gaming-i5-13400f-rtx-4060-1tb-ssd-16gb.jpg', 1039, 'Disfruta de un rendimiento de vanguardia con este NEO Gaming. Equipado con procesador Intel Core i5-13400F de 13ª generación, 16GB de memoria RAM y SSD de 1TB, lo tiene todo para hacerte vibrar en cada juego y experimentar lo último en cuanto a prestaciones. En el apartado gráfico, destacar que nuestros técnicos han incorporado una Nvidia GeForce RTX 4060 de 8GB, un componente en perfecto equilibrio con el resto de hardware. El resultado es un ordenador de sobremesa que se atreve con todo y ofrece una respuesta ágil en las tareas y juegos más variados. Por supuesto, este PC NEO Gaming incluye solo componentes de fabricantes de primer nivel y es concebido y ensamblado por nuestros técnicos con más de 15 años de experiencia.', 'Neobyte', 0),
(184, 'PC NEO Powered By Asus i5-14600K RTX 4060Ti SSD 2TB 32GB', 'https://www.neobyte.es/107280-large_default/pc-neo-powered-by-asus-i5-14600k-rtx-4060ti-ssd-2tb-32gb.jpg', 1499, 'Nuestro nuevo NEO Powered By Asus es tan poderoso como parece. Equipado con un procesador Intel de 14ª generación Intel Core i5-14600K, 32GB de memoria RAM y tarjeta gráfica RTX 4060Ti de 8GB, está preparado para catapultar tus juegos a lo más alto, permitiéndote disfrutarlos con un nivel de detalle sensacional y con una fluidez extraordinaria. Además, hemos incluido un SSD de 2TB que sorprende por la rapidez a la hora de arrancar y ejecutar todo tipo de aplicaciones. Todo ello en una caja de lujo y con la garantía de una gran marca como Asus y la experiencia de Neobyte.', 'Neobyte', 0),
(185, 'PC NEO Powered by Asus i5-14600KF RTX 4060 1TB 16GB', 'https://www.neobyte.es/106453-large_default/pc-neo-powered-by-asus-i5-14600kf-rtx-4060-1tb-16gb.jpg', 1199, '', 'Neobyte', 0),
(186, 'PC NEO Powered by Asus PRO Ryzen 7 5800X3D RTX 4060 Ti 1TB SSD + 2TB 32GB', 'https://www.neobyte.es/106461-large_default/pc-neo-powered-by-asus-pro-ryzen-7-5800x3d-rtx-4060-ti-1tb-ssd-2tb-32gb.jpg', 1489, 'En Neobyte conocemos las necesidades de los profesionales más exigentes, por lo que hemos creado esta configuración NEO Powered By Asus PRO con procesador Amd Ryzen 5800X3D, 32 GB de RAM y almacenamiento SSD de 1TB + SSD de 2TB, todos ellos componentes de marcas de primer nivel para que disfrutes de la máxima fiabilidad y rendimiento. Además, para hacer frente a las tareas gráficas y de cálculo más pesadas, hemos incorporado la tarjeta gráfica Nvidia Geforce RTX 4060Ti 8GB, una auténtica bestia que se atreve con todo. Todo ello con la conectividad más completa, 3 años de garantía y envío en tiempo récord.', 'Neobyte', 0),
(187, 'PC NEO Gaming Ryzen 7 7700X RTX 4060Ti 1TB 32GB', 'https://www.neobyte.es/105169-large_default/pc-neo-gaming-ryzen-7-7700x-rtx-4060ti-1tb-32gb.jpg', 1499, '¡Prepárate para la batalla! Disfruta de cada juego con un nivel de fluidez excepcional gracias a este espectacular PC NEO GAMING. Sus componentes cuidadosamente seleccionados son una garantía de rendimiento y fiabilidad, eligiendo siempre primeras marcas y productos de los principales fabricantes. Para diseñar su configuración, nuestros técnicos han optado por una potente gráfica RTX 4060Ti de 16Gb, un buen exponente de la nueva generación de gráficas Nvidia. También han incluido un procesador Ryzen 7, 32GB de memoria RAM y un excelente SSD de 1TB. Apuesta por la potencia de este ordenador y no quedarás defraudado.', 'Neobyte', 0),
(188, 'PC NEO Powered by Asus TUF i7-14700K RTX 4060 1TB SSD 16GB', 'https://www.neobyte.es/106389-large_default/pc-neo-powered-by-asus-tuf-i7-14700k-rtx-4060-1tb-ssd-16gb.jpg', 1399, 'Con una estética que no esconde sus intenciones y un rendimiento impresionante, el NEO Powered By Asus TUF Edition se atreve con los juegos más exigentes del momento y te permite disfrutarlos como siempre habías soñado. Nuestros técnicos han dotado a esta configuración gaming de un potente procesador Intel Core i7-14700K, 16GB de memoria RAM y SSD de 1TB para que disfrutes de la máxima velocidad ejecutando todo tipo de programas y trabajando con grandes cantidades de archivos. El broche de oro lo pone una tarjeta gráfica de última generación Nvidia GeForce RTX 4060 de 8GB, provista de las tecnologías más innovadoras y la conectividad más completa.', 'Neobyte', 0),
(189, 'PC NEO Gaming i5-14400F RTX 4070 SUPER SSD 1TB 16GB', 'https://www.neobyte.es/90761-large_default/pc-neo-gaming-i5-14400f-rtx-4070-super-ssd-1tb-16gb.jpg', 1398.99, '', 'Neobyte', 0),
(190, 'PC NEO Gaming Intel i5 13500 RTX 4070 SUPER 1TB SSD 16GB', 'https://www.neobyte.es/107264-large_default/pc-neo-gaming-intel-i5-13500-rtx-4070-super-1tb-ssd-16gb.jpg', 1499, '', 'Neobyte', 0),
(191, 'PC NEO Gaming i5-13400F RTX 4060Ti 1TB SSD 16GB', 'https://www.neobyte.es/110182-large_default/pc-neo-gaming-i5-13400f-rtx-4060ti-1tb-ssd-16gb.jpg', 1049, 'Si combinamos los 20 años de experiencia de Neobyte, componentes de primeras marcas y nuestra pasión por el gaming tiene que dar como resultado un PC de garantías como este. Un equipo que integra la novedosa gráfica Nvidia RTX 4060Ti 8GB, un modelo que implementa la arquitectura Ada Lovelace en la gama RTX para ofrecer un rendimiento espectacular, y que asegura fiabilidad y potencia gracias al procesador Intel Core i5-13400F, a la RAM de 16GB y al SSD de 1TB. Todo ello enmarcado en un envoltorio de lujo, la caja Nfortec Caelum, y redondeado por un precio muy competitivo. Así que si buscas un PC gaming con el que vivir al máximo los eSports, mírate muy de cerca este ordenador.', 'Neobyte', 0),
(192, 'PC NEO Gaming Ryzen 7 5800X3D RTX 4060 Ti 1T BSSD + 2TB SSD 16GB', 'https://www.neobyte.es/101870-large_default/pc-neo-gaming-ryzen-7-5800x3d-rtx-4060-ti-1t-bssd-2tb-ssd-16gb.jpg', 1399, '', 'Neobyte', 0),
(193, 'PC NEO Gaming Ryzen 5 5600X RTX 4060 Ti SSD 1TB 16GB', 'https://www.neobyte.es/108997-large_default/pc-neo-gaming-ryzen-5-5600x-rtx-4060-ti-ssd-1tb-16gb.jpg', 1049, '¿Echas en falta un PC potente para disfrutar al máximo de tus juegos? En Neobyte hemos diseñado este ordenador NEO GAMING buscando un rendimiento equilibrado, potente y completo, instalando componentes de primeras marcas cuya calidad ha sido ampliamente contrastada. Entre sus especificaciones destaca la gráfica RTX 4060 Ti, una GPU con tecnología Nvidia que hará las delicias de los gamers más exigentes. También encontramos un procesador AMD Ryzen 5, 16GB de memoria RAM y un SSD de 1TB de capacidad. Si has decidido comprar un PC gaming de garantías al precio más competitivo, en Neobyte te lo ofrecemos en bandeja.', 'Neobyte', 0);
INSERT INTO `producto` (`id`, `nombre`, `imagen`, `precio`, `especificaciones`, `marca`, `id_categoria`) VALUES
(194, 'PC NEO Gaming i5-14600KF RTX 4060 Ti 1TB SSD 16GB', 'https://www.neobyte.es/106786-large_default/pc-neo-gaming-i5-14600kf-rtx-4060-ti-1tb-ssd-16gb.jpg', 1289, 'El PC NEO Gaming que os presentamos a continuación encuentra el equilibrio perfecto entre diseño, rendimiento y funcionalidad. A partir de un procesador sobradamente consolidado, el Intel Core i5-14600KF, esta configuración apuesta por la potencia de unos componentes de primer nivel cuya puesta en acción no dejará insatisfecho a ningún gamer. A la CPU antes mencionada, se unen 16GB de memoria RAM y una gráfica de garantías, la Nvidia RTX 4060Ti 8Gb. Además, cuenta con un sistema de almacenamiento que combina espacio y velocidad para el sistema, con un SSD de 1TB. En Neobyte, además, ajustamos su precio para que te lo lleves puesto.', 'Neobyte', 0),
(195, 'PC NEO Gaming Ryzen 7 5700X RX 6600 1TB SSD 16GB', 'https://www.neobyte.es/111829-large_default/pc-neo-gaming-ryzen-7-5700x-rx-6600-1tb-ssd-16gb.jpg', 1499, 'Nuestros técnicos han concebido este NEO Gaming para que disfrutes de un rendimiento de vanguardia tanto a la hora de jugar como de trabajar. Equipado con procesador AMD Ryzen 7 5700X, 16GB de memoria RAM y SSD de 1TB, lo tiene todo para hacerte vibrar en cada juego y experimentar lo último en cuanto a prestaciones. En el apartado gráfico, destacar que incorpora una Gigabyte RX 6600 8GB, un componente en perfecto equilibrio con el resto de hardware. El resultado es un ordenador potente y a la última que se atreve con todo y proporciona una respuesta ágil en las tareas y juegos más variados. Por supuesto, este PC NEO Gaming incluye solo componentes de fabricantes de primer nivel y ha sido diseñado y ensamblado por nuestros técnicos con más de 15 años de experiencia.', 'Neobyte', 0),
(196, 'PC NEO Gaming Ryzen 5 5600X RTX 4070 SUPER 1TB SSD 16GB', 'https://www.neobyte.es/105266-large_default/pc-neo-gaming-ryzen-5-5600x-rtx-4070-super-1tb-ssd-16gb.jpg', 1379, '', 'Neobyte', 0),
(197, 'PC NEO Gaming i5-14600K RTX 4060 Ti SSD 1TB 16GB', 'https://www.neobyte.es/107271-large_default/pc-neo-gaming-i5-14600k-rtx-4060-ti-ssd-1tb-16gb.jpg', 1299, 'Nuestro PC NEO GAMING tiene clara sus intenciones: conquistarte por su llamativo y convencerte por su potencia desbocada. Equipado con un i5-14600K, 16GB de RAM y gráfica Nvidia GeForce RTX 4060Ti de 8GB, es capaz de catapultar incluso tus juegos más exigentes a lo más alto. Además, gracias a la incorporación de un SSD de 1TB, disfrutarás de velocidades de arranque y transferencia de datos increíbles. Elige nuestros ordenadores de sobremeda NEO por garantía, servicio, prestaciones y experiencia. ¡No te equivocarás!', 'Neobyte', 0),
(198, 'PC NEO Gaming i5-14600K RTX 4060Ti SSD 1TB 32GB', 'https://www.neobyte.es/105152-large_default/pc-neo-gaming-i5-14600k-rtx-4060ti-ssd-1tb-32gb.jpg', 1458.99, '', 'Neobyte', 0),
(199, 'PC NEO Gaming i5-13400F RTX 4060 Ti SSD 1TB 16GB', 'https://www.neobyte.es/108839-large_default/pc-neo-gaming-i5-13400f-rtx-4060-ti-ssd-1tb-16gb.jpg', 1069, 'En Neobyte hemos diseñado este PC NEO GAMING buscando el equilibrio entre prestaciones y precio. Un ordenador que incorpora tarjeta gráfica Nvidia RTX 4060Ti, una garantía de rendimiento, acompañada de un buen elenco de componentes de primer nivel: procesador Intel Core i5-13400F, 16GB de RAM, SSD de 1TB… Apuesta por este completo PC y disfruta como nunca de tus juegos.', 'Neobyte', 0),
(200, 'PC NEO Gaming Ryzen 7 5700X 4070 SUPER 1TB SSD 32GB', 'https://www.neobyte.es/109991-large_default/pc-neo-gaming-ryzen-7-5700x-4070-super-1tb-ssd-32gb.jpg', 1389, 'Esta configuración NEO Gaming con procesador AMD Ryzen 7 5700X se atreve con todo. Rápido, potente y con la garantía de la incorporación de componentes de primera calidad, así como del montaje a cargo de profesionales con más de 20 años de experiencia, este PC de sobremesa especial para juegos no defraudará a los más exigentes. Completan sus especificaciones más destacadas 32GB de memoria RAM, un SSD de 1TB y, sobre todo, una gráfica de última generación Nvidia RTX 4070 SUPER 12Gb. ¡Potencia sin contemplaciones con la garantía Neobyte!', 'Neobyte', 0),
(201, 'PC NEO Gaming i5-13400F RTX 4060 Ti 1TB SSD 32GB', 'https://www.neobyte.es/110514-large_default/pc-neo-gaming-i5-13400f-rtx-4060-ti-1tb-ssd-32gb.jpg', 1199, 'Esta configuración NEO Gaming es perfecta para los prespuestos más ajustados que no quieren renunciar a disfrutar de sus títulos de eSports preferidos con una fluidez y nivel de detalles sobresalientes. Para ello, nuestros técnicos han incorporado una CPU Intel Core i5-13400F de 13ª generación, 32GB de RAM, y SSD de 1TB. Una combinación que asegura una velocidad increíble tanto a la hora de arrancar como de ejecutar múltiples tareas, así como un gran espacio de almacenamiento. Además, este PC está provisto de tarjeta gráfica Nvidia GeForce RTX 4060Ti de 8GB, un modelo que sorprende por su extraordinaria relación calidad-precio.', 'Neobyte', 0),
(202, 'PC NEO Gaming i5-13600K RTX 4060 1TB SSD+2TB SSD 16GB', 'https://www.neobyte.es/108992-large_default/pc-neo-gaming-i5-13600k-rtx-4060-1tb-ssd2tb-ssd-16gb.jpg', 1349, 'Esta configuración NEO Gaming es, sin duda, una de las más exitosas por su inmejorable relación prestaciones-precio. Por menos de lo que imaginas podrás disfrutar de toda la potencia de un procesador Intel Core i5-13600K de 13ª generación, acompañado de 16GB de memoria RAM y gráfica Nvidia GeForce RTX 4060 de 8GB. Un arsenal de componentes dispuesto a proporcionarte horas y horas de entretenimiento con una fluidez y nivel de detalle sensacional. Además, para que el almacenamiento no te suponga ningún problema, lo hemos dotado de un SSD de 1TB más otro SSD de 2TB. Todo ello con la garantía de nuestra experiencia y de la incorporación de componentes de última generación y solo de fabricantes de primer nivel.', 'Neobyte', 0),
(203, 'PC NEO Gaming Ryzen 5 7600 RTX4060 Ti 1TB 32GB', 'https://www.neobyte.es/106912-large_default/pc-neo-gaming-ryzen-5-7600-rtx4060-ti-1tb-32gb.jpg', 1299, 'Este PC NEO Gaming tiene todo lo que necesitas para empezar en el mundo de los esports y juegos competitivos. Por menos de lo que imaginas puedes hacerte con esta máquina capaz de hacerte disfrutar de tus títulos favoritos a más FPS y con la calidad que siempre habías deseado. Para ello nuestros técnicos expertos han elegido unos componentes perfectamente equilibrados. Entre ellos, destacar el procesador AMD Ryzen 5 7600 de 6 núcleos, los 32GB de memoria RAM, un SSD M.2 de 1TB y, sobre todo, la tarjeta gráfica Nvidia RTX 4060Ti 8GB. Así mismo, destacar su estética actual y llamativa, así como la calidad de los acabados y el montaje que asegura nuestro servicio técnico propio con dilatada experiencia.', 'Neobyte', 0),
(204, 'PC NEO Gaming i5-14600K RTX 4070Ti SSD1TB 32GB', 'https://www.neobyte.es/106675-large_default/pc-neo-gaming-i5-14600k-rtx-4070ti-ssd1tb-32gb.jpg', 1799, '¿Buscas lo último en rendimiento? En Neobyte hemos diseñado este PC gaming incluyendo la tecnología más innovadora para que disfrutes de tus juegos al máximo. En este caso hemos elegido un procesador Intel Core i5-14600K de 14ª generación y memorias RAM DDR5 hasta 5200 Mhz, acompañados de una espectacular tarjeta gráfica Nvidia RTX 4070Ti de 12GB. También dispone de un SSD de 1TB de capacidad y fuente de alimentación con certificacion 80 Plus Gold. Compite con los mejores y vive el gaming más inmersivo con este PC NEO GAMING.', 'Neobyte', 0),
(205, 'PC NEO Gaming Intel i7 14700K RTX 4070Ti SUPER 1TB SSD 32GB', 'https://www.neobyte.es/106780-large_default/pc-neo-gaming-intel-i7-14700k-rtx-4070ti-super-1tb-ssd-32gb.jpg', 2048.99, '', 'Neobyte', 0),
(206, 'PC NEO Powered by Asus PRO i9-14900KF RTX 4070 SUPER 32GB 1TB SSD + 2TB SSD', 'https://www.neobyte.es/101896-large_default/pc-neo-powered-by-asus-pro-i9-14900kf-rtx-4070-super-32gb-1tb-ssd-2tb-ssd.jpg', 2499, 'Si buscas un ordenador de sobremesa con una capacidad de procesamiento insuperable y con la garantía de un gran fabricante como Asus, no te pierdas este NEO Powered By Asus PRO, ideal para tareas profesionales que exijan una CPU de última generación (Intel Core i9-14900KF), gran cantidad de memoria RAM (32GB) y un almacenamiento completo que incorpora la última tecnología en materia de rendimiento (SSD M.2 Nvme de 1TB + SSD M.2 Nvme de 2TB). Todo ello con una caja de diseño sobrio y silencioso y, solo en Neobyte, con las máximas garantías y la confianza de saber que nuestros técnicos cuentan con más de 15 años de experiencia.', 'Neobyte', 0),
(207, 'PC NEO Powered by Asus PRO Ryzen 7 7700X RTX 4070 SUPER SSD 1TB+ SSD 2TB 32GB', 'https://www.neobyte.es/102975-large_default/pc-neo-powered-by-asus-pro-ryzen-7-7700x-rtx-4070-super-ssd-1tb-ssd-2tb-32gb.jpg', 1989, 'Al nuevo NEO Powered By Asus PRO que hemos configurado no le falta detalle. A su diseño elegante, ideal para integrar en un entorno profesional o doméstico, hay que sumar unas especificaciones técnicas que quitan el hipo, como son la incorporación de un procesador Amd Ryzen 7 7700X, 32GB de memoria RAM y tarjeta gráfica Nvidia Geforce RTX 4070 SUPER 12GB, características que permiten ejecutar de manera solvente y fluida la mayoría de programas y juegos del mercado. Paralelamente, hemos incluido una solución de almacenamiento compuesta por 1TB SSD y 2TB SSD que proporciona la mayor velocidad de arranque y gestión de archivos.', 'Neobyte', 0),
(208, 'PC NEO Gaming i7-14700K RTX 4070 SUPER SSD 1TB + SSD 2TB 32GB', 'https://www.neobyte.es/107429-large_default/pc-neo-gaming-i7-14700k-rtx-4070-super-ssd-1tb-ssd-2tb-32gb.jpg', 1999, 'Por menos de lo que piensas puedes hacerte con este potente y elegante NEO GAMING provisto de CPU Intel Core i7-14700K, 32GB de RAM y tarjeta gráfica Nvidia GeForce RTX 4070 SUPER de 12GB, así como almacenamiento compuesto por 1TB SSD + 2TB SSD. Una configuración equilibrada que permite mover con soltura la mayoría de los juegos actuales y que te aporta la fiabilidad que solo los fabricantes de primer nivel puede asegurarte. Busca, compara y vuelve para hacerte con el ordenador gaming que siempre habías soñado.', 'Neobyte', 0),
(209, 'PC NEO Powered By Asus Ryzen 9 7900X RTX 4070 SUPER SSD 1TB+2TB 32GB', 'https://www.neobyte.es/106404-large_default/pc-neo-powered-by-asus-ryzen-9-7900x-rtx-4070-super-ssd-1tb2tb-32gb.jpg', 1899, 'Nuestro ordenador NEO Powered By Asus más poderoso no te dejará indiferente. Provisto de procesador Amd Ryzen 9 7900X y 32GB de memoria RAM, es capaz de desarrollar con una fluidez increíble incluso las tareas informáticas más pesadas. Paralelamente, la tarjeta gráfica Nvidia Geforce RTX 4070 SUPER que hemos incorporado asegura un rendimiento extremo a la hora de jugar. Pero nuestros técnicos son insaciables y querían mejorarlo añadiendo al conjunto un SSD de 1TB y otro SSD de 2TB, todo ello dentro de una caja de diseño único: la Corsair 3000D.', 'Neobyte', 0),
(210, 'PC NEO Gaming i7-13700K RTX 4070 SUPER SSD 1TB 16GB', 'https://www.neobyte.es/106327-large_default/pc-neo-gaming-i7-13700k-rtx-4070-super-ssd-1tb-16gb.jpg', 1699, 'Si te vuelve loc@ el RGB pero además quieres un PC gamer de garantías, nuestra configuración NEO Gaming es justo lo que buscas. A un diseño irresistiblemente llamativo que incluye multitud de componentes (incluyendo la caja) con iluminación RGB, hay que sumar la incorporación de un potente procesador como es el Intel Core i7-13700K, 16 GB de memoria RAM y tarjeta gráfica RTX 4070 SUPER de 12GB. Además, en cuanto a almacenamiento se refiere, este equipo está provisto de 1Tb SSD. Rendimiento sin contemplaciones y un estética que te dejará sin palabras... todo esto y mucho más cabe en este Neo Gaming.', 'Neobyte', 0),
(211, 'PC NEO Powered By Asus Ryzen 9 7900X3D RTX 4080 Super SSD 1TB+4TB 64GB', 'https://www.neobyte.es/94980-large_default/pc-neo-powered-by-asus-ryzen-9-7900x3d-rtx-4080-super-ssd-1tb4tb-64gb.jpg', 3599, 'Rendimiento extremo y máxima fiabilidad van de la mano en nuestra configuración NEO Powered By Asus con procesador AMD Ryzen 9 de 7ª generación 7900X3D, 64GB de memoria RAM y tarjeta gráfica de 16GB Nvidia Geforce RTX 4080 Super, una combinación perfecta para empezar a disfrutar de tus juegos como siempre habías imaginado, con la máxima fluidez y un nivel de detalles increíble. En lo referente al almacenamiento, hemos incorporado un disco sólido de 1TB que, combinado con otro SSD de 4TB, ofrece una velocidad sensacional a la hora de arrancar, ejecutar aplicaciones... Todo ello dentro de una caja de diseño irresistible diseño y grandes alternativas de configuración.', 'Neobyte', 0),
(212, 'PC NEO Corsair iCUE BlackFlag i9-13900K RTX 4070Ti SUPER SSD 1TB 32GB', 'https://www.neobyte.es/90484-large_default/pc-neo-corsair-icue-blackflag-i9-13900k-rtx-4070ti-super-ssd-1tb-32gb.jpg', 2499, '¿Buscas un ordenador gaming de garantías? En Neobye hemos creado esta configuración en base a las preferencias de nuestros clientes y a la experiencia de nuestros técnicos. Un PC en el que no faltan la estabilidad y el rendimiento de los procesadores Intel, con un i9-13900K, y la potencia de una gráfica Nvidia de última generación, la RTX 4070Ti SUPER 16GB. Si añadimos la velocidad que aportan la memoria de 32GB y el SSD de 1TB obtenemos un equipo con el que disfrutar de tus juegos al máximo. Y como siempre, con el sello de calidad de los principales fabricantes.', 'Neobyte', 0),
(213, 'PC NEO Powered by Asus i7-13700K RTX 4070 SUPER 1TB SSD 32GB', 'https://www.neobyte.es/106458-large_default/pc-neo-powered-by-asus-i7-13700k-rtx-4070-super-1tb-ssd-32gb.jpg', 1899, 'Neobyte y Asus, mano a mano para crear este NEO Powered by Asus, un PC ensamblado por nuestros técnicos con componentes Asus de primera calidad, lo que garantiza el máximo nivel de fiablidad y garantías. Bajo un chasis de lujo, encontramos un procesador Intel Core i7-13700K de 16 núcleos, 32GB de memoria RAM, un SSD de alta velocidad de 1TB y tarjeta gráfica Asus Nvidia GeForce RTX 4070 SUPER de 12GB. Este hardware asegura un rendimiento espectacular en todo tipo de juegos y aplicaciones profesionales. Echa un vistazo a sus características y verás que a este NEO Powered by Asus no le falta detalle.', 'Neobyte', 0),
(214, 'PC NEO Powered by Asus i7-14700KF RTX 4060 Ti SSD 1TB+SSD 2TB 32GB', 'https://www.neobyte.es/109979-large_default/pc-neo-powered-by-asus-i7-14700kf-rtx-4060-ti-ssd-1tbssd-2tb-32gb.jpg', 1939, '', 'Neobyte', 0),
(215, 'PC NEO Powered by Asus i9-14900KF RTX 4070Ti SUPER SSD 1TB+2TB 32GB', 'https://www.neobyte.es/101893-large_default/pc-neo-powered-by-asus-i9-14900kf-rtx-4070ti-super-ssd-1tb2tb-32gb.jpg', 2599, 'Toda la fiabilidad y el rendimiento de unos componentes punteros se aúnan en este equipo Powered by Asus. Un PC equipado con procesador Intel Core i9-14900KF, 32GB de memoria, gráfica dedicada Nvidia Geforce RTX 4070Ti SUPER 16GB y SSD de 1TB... todo ello enmarcado en una caja Corsair 3000D  que desborda diseño y posibilidades. El resultado es una máquina que sobresale en rendimiento, concebida para dar lo máximo en todo tipo de juegos y tareas exigentes. Confía en los más de 15 años de experiencia de Neobyte y llévate un PC muy completo, potente y con el precio más ajustado.', 'Neobyte', 0),
(216, 'PC NEO Gaming i7-13700K RTX 4070Ti SUPER 1TB SSD+2TB SSD 32GB', 'https://www.neobyte.es/106421-large_default/pc-neo-gaming-i7-13700k-rtx-4070ti-super-1tb-ssd2tb-ssd-32gb.jpg', 2338.99, 'Te presentamos el ordenador NEO GAMING con procesador Intel Core i7-13700K de 13ª generación, 32GB de memoria RAM y tarjeta gráfica RTX 4070Ti SUPER de 16GB, una auténtica apisonadora capaz de mover con increíble soltura los juegos y programas más exigentes. Bajo su apariencia sobria y elegante, encontramos también un almacenamiento combinado de 1TB SSD + 2TB SSD, lo que asegura la máxima velocidad a la hora de arrancar, transferir información, ejecutar aplicaciones... Confía en Neobyte para el montaje de tu equipo de alto rendimiento por experiencia, atención personalizada, garantía y precio.', 'Neobyte', 0),
(217, 'PC NEO Aorus Ryzen 9 5900X RTX 4070 SUPER 1TB SSD + 2TB SSD 32GB', 'https://www.neobyte.es/111165-large_default/pc-neo-aorus-ryzen-9-5900x-rtx-4070-super-1tb-ssd-2tb-ssd-32gb.jpg', 1748.99, 'En Neobyte hemos creado este NEO AORUS con la mejor tecnología gaming de Gigabyte para que puedas hacer frente a un amplio abanico de juegos y difrutarlos como siempre habías soñado. Para ello, nuestros técnicos han incluido un placa Gigabyte B550 Aorus Elite,  un procesador AMD Ryzen 9 5900X acompañado de un Ventilador Cooler Master, 32GB de memoria RAM y tarjeta gráfica Gigabyte Nvidia GeForce RTX 4070 Super 12GB. Una combinación ganadora a la que hay que sumar una caja de estética sumamente cuidada y un almacenamiento compuesto por 1TB SSD y 2TB SSD.', 'Neobyte', 0),
(218, 'PC NEO Powered by Asus i5-13400F RTX 4070 SUPER 1TB SSD 32GB', 'https://www.neobyte.es/106410-large_default/pc-neo-powered-by-asus-i5-13400f-rtx-4070-super-1tb-ssd-32gb.jpg', 1598.99, 'Toda la potencia del hardware Asus más top cabe en este NEO Powered by Asus, un PC gaming configurado por nuestros técnicos con más de 15 años de experiencia para hacerte vibrar en cada juego y/o realizar todo tipo de tareas de manera ágil. Provisto de procesador Intel de 13ª generación Intel Core i5-13400F, placa base de alta gama, 32GB de memoria RAM, SSD de 1TB y tarjeta gráfica Nvidia GeForce RTX 4070 SUPER de 12GB, ofrece un rendimiento impresionante a todos los niveles y la máxima fiabilidad. No renuncies a nada con este PC NEO Powered by Asus.', 'Neobyte', 0),
(219, 'PC NEO Aorus Ryzen 7 7700X RTX 4070 Ti 32GB 1TB SSD+2TB SSD', 'https://www.neobyte.es/102063-large_default/pc-neo-aorus-ryzen-7-7700x-rtx-4070-ti-32gb-1tb-ssd2tb-ssd.jpg', 2398.99, 'Las configuraciones NEO Aorus Inside tienen mucho que decir en el universo gaming. Este PC en concreto ha sido provisto de dos de los componentes más destacados de Gigabyte: la placa B650 Gaming X AX  y la gráfica Nvidia RTX 4070Ti 12GB. Además, cuenta con procesador AMD Ryzen 7 7700X, 32GB de RAM, SSD de 1TB y un segundo SSD de 2TB, un elenco de primer nivel cuya combinación garantiza los mejores resultados. Si lo tuyo es el gaming, disfrutarás de lo lindo con este equipo.', 'Neobyte', 0),
(220, 'PC NEO Aorus i9-14900K RTX 4080 Super 1TB SSD+2TB SSD 32GB', 'https://www.neobyte.es/102074-large_default/pc-neo-aorus-i9-14900k-rtx-4080-super-1tb-ssd2tb-ssd-32gb.jpg', 2999, '', 'Neobyte', 0),
(221, 'PC NEO Gaming i7-13700K RTX 4070Ti SUPER SSD 1TB 32GB', 'https://www.neobyte.es/107268-large_default/pc-neo-gaming-i7-13700k-rtx-4070ti-super-ssd-1tb-32gb.jpg', 1979, '', 'Neobyte', 0),
(222, 'PC NEO Powered by Asus PRO Ryzen 7700X RTX 4070 Ti SUPER 2TB SSD 32GB', 'https://www.neobyte.es/108572-large_default/pc-neo-powered-by-asus-pro-ryzen-7700x-rtx-4070-ti-super-2tb-ssd-32gb.jpg', 2049, 'El ordenador NEO Powered By Asus PRO proporciona el rendimiento profesional que tu día a día necesita. Para ello, nuestros técnicos han ensamblado sobre una placa base del reconocido fabricante, un procesador Amd Ryzen 7 7700X, 32GB de RAM y lo último en almacenamiento, como es un SSD M.2 Nvme de 2TB. Con él podrás producir música y ejecutar todo tipo de tareas pesadas con una fluidez asombrosa y disfrutar de la máxima fiabilidad. Además, en Neobyte, tendrás la certeza de que tu máquina será montada por técnicos con más de 15 años de experiencia y sometida a los tests más rigurosos.', 'Neobyte', 0),
(223, 'PC NEO Gaming Ryzen 7 7700X RTX 4080 Super 32GB 1TB SSD + 4TB SSD', 'https://www.neobyte.es/108428-large_default/pc-neo-gaming-ryzen-7-7700x-rtx-4080-super-32gb-1tb-ssd-4tb-ssd.jpg', 2799, 'Desafía los límites con este PC NEO Gaming con procesador AMD Ryzen 7 7700X, una bestia diseñada y ensamblada por nuestros técnicos con más de 15 años de experiencia que te permitirá hacer frente a las tareas y juegos más exigentes. Entre sus características técnicas más importantes, destacar también los 32GB de memoria RAM y, por supuesto, la impresionante tarjeta gráfica Nvidia GeForce RTX 4080 Super de 16GB. Con ella podrás exprimir al máximo las posibilidades de los juegos triple A y ejecutar aplicaciones de diseño, render y edición sin problemas. Por último, indicar que ha sido provisto de SSD de 1TB y SSD 4TB para que almacenes todo lo que necesites.', 'Neobyte', 0),
(224, 'PC NEO Gaming R7-7700X RTX 4060 Ti SSD 1TB 32GB', 'https://www.neobyte.es/108578-large_default/pc-neo-gaming-r7-7700x-rtx-4060-ti-ssd-1tb-32gb.jpg', 1599, 'Déjate hipnotizar por este NEO GAMING, un ordenador ensamblado bajo una caja de impresionante diseño que captará la atención de todas las miradas. Pero más allá de su estilo, esta configuración destaca por su potencia desbocada, fruto de la incorporación de un procesador Amd Ryzen 7 7700X, 32GB de memoria RAM, tarjeta gráfica RTX 4060Ti  de 16GB y almacenamiento compuesto por 1TB SSD. Busca, compara y vuelve a Neobyte para equiparte con la tecnología más avanzada al precio más ajustado y con las máximas garantías.', 'Neobyte', 0),
(225, 'PC NEO Gaming Ryzen 7 7800X3D RTX 4070 SUPER 32GB 1TB SSD + 2TB SSD', 'https://www.neobyte.es/102968-large_default/pc-neo-gaming-ryzen-7-7800x3d-rtx-4070-super-32gb-1tb-ssd-2tb-ssd.jpg', 1999, 'Diseñado para que disfrutes al máximo de los juegos más exigentes, este PC NEO GAMING cuenta con una configuración muy potente con la que hacer frente a todo tipo de tareas. A la cabeza de sus especificaciones técnicas encontramos una tarjeta gráfica Nvidia RTX 4070 SUPER de 12GB, un compontente que marca la diferencia en cuanto a fluidez y fiabilidad. Tambien dispone de procesador AMD Ryzen 7 7800X3D, 32GB de memoria RAM y un sistema de almacenamiento amplio y equilibrado, con un SSD de 1TB y otro SSD de 2TB. Ya seas gamer, creador de contenido o profesional del diseño, este equipo te sorprenderá por su espectacular rendimiento.', 'Neobyte', 0),
(226, 'PC NEO Gaming i7-14700K RTX 4070 SUPER SSD 1TB 32GB', 'https://www.neobyte.es/108762-large_default/pc-neo-gaming-i7-14700k-rtx-4070-super-ssd-1tb-32gb.jpg', 1798.99, 'En Neobyte hemos diseñado este PC NEO Gaming para hacer frente a los desafíos más exigentes. No en vano, su equilibrada y potente configuración cuenta con componentes ampliamente contrastados, perfectos para ofrecer un gran rendimiento, así como un funcionamiento fiable. Entre los elementos más destacables encontramos una CPU Intel Core i7-14700K, refrigerada por una líquida Asus TUF Gaming LC240 RGB con radiador de 240 mm, y una tarjeta gráfica Nvidia RTX 4070 SUPER, además de la memoria RAM de 32GB y el SSD de 1TB. Un PC gaming que te situará en la acción de los juegos para vivir una experiencia única. ¡Hazte con el a un precio imbatible!', 'Neobyte', 0),
(227, 'PC NEO Gaming i7-14700K RTX 4070 SUPER 1TB + 2TB 32GB', 'https://www.neobyte.es/106955-large_default/pc-neo-gaming-i7-14700k-rtx-4070-super-1tb-2tb-32gb.jpg', 1899, '', 'Neobyte', 0),
(228, 'PC NEO Gaming Ryzen 7 7800X3D RTX 4080 Super 1TB + 4TB 64GB', 'https://www.neobyte.es/106790-large_default/pc-neo-gaming-ryzen-7-7800x3d-rtx-4080-super-1tb-4tb-64gb.jpg', 2899, 'Juega, trabaja y haz todo lo que imagines con este PC NEO Gaming, una máquina diseñada por nuestros técnicos con la que podrás hacer frente a los juegos y tareas más exigentes. Para ello equipa una gráfica repleta de innovaciones como es la NVIDIA GeForce RTX 4080 Super 16GB, 64GB de memoria RAM y un procesador de garantías: el reconocido AMD Ryzen 7 7800X3D de ocho núcleos. Respecto al almacenamiento, hemos incorporado un SSD Nvme de 1 TB acompañado de otro SSD Nvme de 4TB. Una combinación ganadora que va acompañada de componentes de primera calidad y de los más de 15 años de experiencia de nuestros compañeros.', 'Neobyte', 0),
(229, 'PC NEO Gaming i7-14700KF RTX 4080 Super 32GB 2TB SSD + 1TB SSD', 'https://www.neobyte.es/110195-large_default/pc-neo-gaming-i7-14700kf-rtx-4080-super-32gb-2tb-ssd-1tb-ssd.jpg', 2499, '¿Ganas de jugar? En Neobyte hemos configurado este PC Gaming para que disfrutes al máximo de tu gran pasión. Un equipo provisto de un procesador potente, el Intel Core i7-14700KF, al que acompañan 32GB de RAM y una gráfica nada desdeñable: Nvidia RTX 4080 Super de 16GB. El sistema de almacenamiento también está a la altura, incorporando un SSD de 2TB y otro SSD de 1 TB para un funcionamiento más rápido y fluido en todo tipo de tareas. Prepárate, vas a pasarlo en grande...', 'Neobyte', 0),
(230, 'PC NEO Gaming Ryzen 9 7900X RTX 4080 Super 32GB 1TB SSD + 4TB SSD', 'https://www.neobyte.es/107277-large_default/pc-neo-gaming-ryzen-9-7900x-rtx-4080-super-32gb-1tb-ssd-4tb-ssd.jpg', 2799, 'Equipado con lo último para proporcionarte un rendimiento de vanguardia, este PC NEO Gaming está preparado para ejecutar las tareas y juegos más exigentes de manera ágil, sólida y estable. Nuestros técnicos han seleccionado una serie de componentes que proporcionan una prestaciones de infarto. Entre ellas, sobresalen el todopoderoso procesador AMD Ryzen 9 7900X y la tarjeta gráfica NVIDIA GeForce RTX 4080 Super de 16GB. Paralelamente, los 32GB de RAM y el almacenamiento compuesto por 1TB SSD + 4TB SSD aportan velocidad y capacidad para todo lo que necesites.', 'Neobyte', 0),
(231, 'PC NEO Corsair iCUE BlackFlag i7-14700K RTX 4070Ti SUPER 1TB SSD 32GB', 'https://www.neobyte.es/103016-large_default/pc-neo-corsair-icue-blackflag-i7-14700k-rtx-4070ti-super-1tb-ssd-32gb.jpg', 2299, 'Preparado para todo, este PC NEO Gaming con procesador Intel Core i7-14700K y tarjeta gráfica Nvidia GeForce RTX 4070Ti SUPER de 16GB es el equipo perfecto tanto para jugar a los juegos más exigentes como para incrementar tu productividad ejecutando tareas pesadas. Este ordenador ha sido concebido por nuestros técnicos para alcanzar los más altos niveles de rendimiento, fiabilidad y compatibilidad, por lo que se adaptará a tus necesidades actuales y futuras. Otras de sus especificaciones técnicas más importantes son los 32GB de memoria RAM y el SSD NVMe de 1TB. Ahora puede ser tuyo al precio más competitivo y con la confianza de nuestros montajes de calidad y garantía.', 'Neobyte', 0),
(232, 'PC NEO Gaming Ryzen 7 7700X RTX 4070 SUPER 32GB 1TB+2TB SSD', 'https://www.neobyte.es/106783-large_default/pc-neo-gaming-ryzen-7-7700x-rtx-4070-super-32gb-1tb2tb-ssd.jpg', 1899, 'Si buscas un PC que no escatime en rendimiento, que destaque por su fiabilidad y que deje patente su espíritu gaming, te presentamos una configuración que te irá como anillo al dedo. Este PC NEO Gaming ha sido equipado con componentes de primeras marcas, conformando un listado de especificaciones muy potente. Entre ellas destaca la gráfica Nvidia RTX 4070 SUPER, una impresionante GPU que hace gala de la tecnología más novedosa para proporcionar una experiencia de juego espectacular. En esta misma línea también encontramos un procesador Ryzen 7 7700X y 32GB de memoria RAM, además de un sistema de almacenamiento muy completo, con SSD de 2TB y SSD de 1TB. ¿Alguna duda? Consúltanos y te asesoraremos de forma personalizada.', 'Neobyte', 0),
(233, 'PC NEO Gaming i7-13700K RTX 4060Ti 1TB SSD 32GB', 'https://www.neobyte.es/90394-large_default/pc-neo-gaming-i7-13700k-rtx-4060ti-1tb-ssd-32gb.jpg', 1599, 'Si buscas un PC gaming compacto que no defraude en cuanto a rendimiento te presentamos el modelo perfecto. Diseñado a partir de una caja microATX Asus AP201 en color negro, este ordenador para juegos cuenta con una configuración muy completa que ha cuidado cada detalle. Destacan componentes como el procesador Intel Core i7-13700K, la gráfica RTX 4060Ti 16Gb y los 32GB de memoria RAM, así como la fuente de alimentación con certificación 80+ Gold y la refrigeración líquida integrada. Dispone además de unidad SSD de 1TB, Wifi 6 y una variada conectividad. Hazte ya con este mini PC gaming muy completo al precio más ajustado.', 'Neobyte', 0),
(234, 'PC NEO Gaming i5-13400F RTX 4070 SUPER SSD 1TB+2TB 32GB', 'https://www.neobyte.es/108836-large_default/pc-neo-gaming-i5-13400f-rtx-4070-super-ssd-1tb2tb-32gb.jpg', 1699, 'Este PC NEO Gaming nace fruto de la experiencia de nuestros técnicos en combinación con los componentes más actuales. Una máquina capaz de ejecutar un amplio abanico de juegos con un nivel gráfico sensacional y de llevar a cabo todo tipo de tareas con la máxima fluidez. Para ello, hemos incorporado un procesador potente y de garantías como es el Intel Core i5-13400F, acompañado de 32GB de memoria RAM, SSD de 1TB y SSD de 2TB. Además, incluye tarjeta gráfica Nvidia GeForce RTX 4070 SUPER para un rendimiento gráfico espectacular. ¿Necesitas personalizarlo? Coméntanos qué cambios deseas realizar y te enviaremos un presupuesto a medida sin compromiso.', 'Neobyte', 0),
(235, 'PC NEO Gaming Ryzen 9 7900X3D RTX 4090 2TB SSD 32GB', 'https://www.neobyte.es/107836-large_default/pc-neo-gaming-ryzen-9-7900x3d-rtx-4090-2tb-ssd-32gb.jpg', 3849, 'Diseñado en base a una caja NZXT H9 Elite, este PC NEO Gaming combina estilo y rendimiento en formato ATX. Un modelo en el que nuestros técnicos han sabido integrar un listado de componentes de calidad contrastada para abordar todo tipo de tareas y disfrutar de una óptima experiencia gaming. Además, han tenido muy en cuenta aspectos como la refrigeración, integrando una refrigeración líquida de 360 mm y fuente de alimentación 80+ Gold, que emite menos calor y hace un uso más eficiente de la energía. Cabe destacar, por supuesto, la potencia de su procesador Ryzen 9 7900X3D, los 32GB de memoria RAM y su gráfica Nvidia RTX 4090, además de un sistema de almacenamiento rápido y de gran capacidad, conectividad Wifi y Bluetooth...', 'Neobyte', 0),
(236, 'Asus VivoBook 15 F1504ZA-NJ700 - Portátil 15.6 i5-1235U 16GB 512GB SSD', 'https://www.neobyte.es/109094-large_default/asus-vivobook-15-f1504za-nj700-portatil-156-i5-1235u-16gb-512gb-ssd.jpg', 518.99, 'El ASUS VivoBook 15 F1504ZA-NJ700 es un portátil elegante y eficiente con una pantalla de 15.6 Full HD que ofrece una resolución nítida de 1920 x 1080 píxeles. Equipado con un potente procesador Intel Core i5-1235U y respaldado por 16GB de RAM DDR4, garantiza un rendimiento sólido para tareas variadas. Con una capacidad de almacenamiento de 512 GB en un SSD, proporciona velocidad en el acceso a los datos. Los gráficos Intel Iris Xe Graphics mejoran la experiencia visual. Presenta un diseño en color plata fría y un peso de 1.7 kg, lo que lo hace portátil y estéticamente atractivo.', 'Asus', 0),
(237, 'Gigabyte G5 KF-E3ES313SD - Portátil 15.6 i5-12500H 16GB RTX 4060 512GB SSD', 'https://www.neobyte.es/89183-large_default/gigabyte-g5-kf-e3es313sd-portatil-156-i5-12500h-16gb-rtx-4060-512gb-ssd.jpg', 1148.99, 'En resumen, la este portátil redefine la experiencia de juego con su diseño delgado, potente rendimiento, avanzada tecnología de enfriamiento, conectividad ultrarrápida y sonido envolvente de alta calidad. Crea posibilidades ilimitadas con esta máquina diseñada para satisfacer las demandas de jugadores y creadores por igual.', 'Gigabyte', 0),
(238, 'Asus VivoBook 15 F1504ZA-NJ710 - Portátil 15.6 i7-1255U 16GB 512GB SSD', 'https://www.neobyte.es/109101-large_default/asus-vivobook-15-f1504za-nj710-portatil-156-i7-1255u-16gb-512gb-ssd.jpg', 599, 'El almacenamiento de 512 GB en un SSD asegura una respuesta rápida y accesibilidad ágil a tus datos. Con gráficos Intel Iris Xe, disfrutarás de una calidad visual excepcional. Su diseño en color plata fría le confiere un aspecto elegante. Con un peso de 1.7 kg, es ligero y fácil de transportar. Viene sin sistema operativo preinstalado, brindándote flexibilidad. El teclado QWERTY español completa esta opción versátil y potente para tus necesidades informáticas.', 'Asus', 0),
(239, 'Gigabyte G6 KF-H3ES854SD - Portátil 16 i7-13620H 16GB RTX 4060 1TB SSD', 'https://www.neobyte.es/103080-large_default/gigabyte-g6-kf-h3es854sd-portatil-16-i7-13620h-16gb-rtx-4060-1tb-ssd.jpg', 1359, 'Los portátiles de alto rendimiento suelen contar con una cantidad significativa de memoria RAM, como 16GB, para facilitar la multitarea sin problemas y la ejecución fluida de aplicaciones exigentes. La inclusión de unidades de estado sólido (SSD) con capacidades de almacenamiento amplias, como 1TB, proporciona velocidades de lectura/escritura rápidas para arranques rápidos del sistema operativo y tiempos de carga más rápidos de aplicaciones y juegos.', 'Gigabyte', 0),
