(241, 'Asus VivoBook M1502YA-NJ151 - Portátil 15.6 Ryzen 7 7730U 16GB 512GB SSD', 'https://www.neobyte.es/101760-large_default/asus-vivobook-m1502ya-nj151-portatil-156-ryzen-7-7730u-16gb-512gb-ssd.jpg', 538.99, 'Con un diseño delgado y ligero, el Asus VivoBook es altamente portátil y fácil de llevar a cualquier lugar, sin comprometer su rendimiento. Además, ofrece una variedad de puertos, incluyendo USB, HDMI y lector de tarjetas SD, proporcionando opciones de conectividad versátiles para periféricos, pantallas externas y dispositivos de almacenamiento.', 'Asus', 0),
