(243, 'Asus ZenBook 14 OLED UX3405MA-PP606W - Portátil 14 U7-155H 16GB 512GB W11', 'https://www.neobyte.es/110108-large_default/asus-zenbook-14-oled-ux3405ma-pp606w-portatil-14-u7-155h-16gb-512gb-w11.jpg', 1229, 'Sumérgete en la sofisticación incomparable del ZenBook 14 OLED, un ultraportátil artesanal que redefine la elegancia. Potencia tu productividad y entretenimiento con el rendimiento excepcional del procesador Intel Core Ultra Meteor Lake y los gráficos Intel Arc. Disfruta de una experiencia visual cautivadora en la pantalla ASUS Lumina OLED de 14 pulgadas con una sorprendente resolución WQXGA+ (3K) y una frecuencia de actualización de 120Hz. Experimenta la durabilidad y confiabilidad de este exclusivo portátil, optimizado para la eficiencia y diseñado con materiales sostenibles que buscan reducir el impacto ambiental. Además, goza de una conectividad perfecta a través de los puertos más demandados (Thunderbolt, HDMI...), . Eleva tu jornada con la batería de larga duración y sumérgete en la elegancia ecológica de un diseño amigable con el medio ambiente, reflejando el compromiso con la equidad y la sostenibilidad.', 'Asus', 0),
(244, 'Asus TUF Dash F15 TUF507ZC4-HN040 - Portátil 15.6 i7-12700H 16GB RTX 3050 512GB SSD', 'https://www.neobyte.es/88771-large_default/asus-tuf-dash-f15-tuf507zc4-hn040-portatil-156-i7-12700h-16gb-rtx-3050-512gb-ssd.jpg', 838.99, 'La pantalla de 15.6 pulgadas Full HD con una alta frecuencia de actualización de 144Hz te sumerge en un mundo de imágenes nítidas y fluidas, maximizando tu experiencia gaming y proporcionando una ventaja competitiva en cada partida. Este portátil también se destaca por su conectividad versátil y su teclado retroiluminado con tecnología RGB, ofreciendo un control total sobre la iluminación y el ambiente mientras juegas.', 'Asus', 0),
(245, 'Asus TUF Gaming F17 TUF707VI-HX049 - Portátil 17.3 IPS i7-13620H RTX 4070 32GB SSD', 'https://www.neobyte.es/109125-large_default/asus-tuf-gaming-f17-tuf707vi-hx049-portatil-173-ips-i7-13620h-rtx-4070-32gb-ssd.jpg', 1648.99, 'Sorpréndete con el rendimiento potente y la inmersión visual gracias al portátil ASUS TUF Gaming F17 TUF707VI-HX049. Equipado con un procesador Intel Core i7-13620H y una tarjeta gráfica NVIDIA RTX 4070 de 8GB, este portátil ofrece un rendimiento excepcional para tus sesiones de juego intensivas y tareas multitarea. La pantalla de 17.3 Full HD con una frecuencia de actualización de 144Hz te sumerge en un mundo visual vibrante y fluido. Con 32GB de RAM DDR5 y un SSD de 1TB, disfrutarás de una respuesta rápida y tiempos de carga instantáneos. Además, el diseño robusto y elegante en color Mecha Gray, junto al teclado retroiluminado y de formato completo, complementan la experiencia de juego y productividad. Con el ASUS TUF Gaming F17, lleva tus sesiones de juego y trabajo al siguiente nivel.', 'Asus', 0),
