(247, 'Asus ROG Strix G18 G814JIR-N6002 - Portátil 18 i9-14900HX 32GB RTX 4070 1TB SSD', 'https://www.neobyte.es/109659-large_default/asus-rog-strix-g18-g814jir-n6002-portatil-18-i9-14900hx-32gb-rtx-4070-1tb-ssd.jpg', 2299, 'Para una experiencia de juego verdaderamente inmersiva, ofrece una pantalla de 18 pulgadas con resolución WQXGA de 240 Hz. Estas pantallas no solo proporcionan una calidad de imagen excepcional, sino que también cuentan con una relación pantalla-cuerpo del 89%, asegurando que cada detalle en el juego se muestre con la máxima claridad y vivacidad.', 'Asus', 0),
