(254, 'Asus Vivobook 16X K3605ZC-N1268W - Portátil 16 i5-12450H 16GB 512GB SSD W11', 'https://www.neobyte.es/104786-large_default/asus-vivobook-16x-k3605zc-n1268w-portatil-16-i5-12450h-16gb-512gb-ssd-w11.jpg', 799, 'Con un diseño delgado y elegante, el Asus Vivobook 16X K3605ZC-N1268W es altamente portátil y presenta un aspecto moderno, perfecto para usuarios que valoran el rendimiento y la estética. Con una variedad de puertos USB, HDMI y Wi-Fi 6, este portátil ofrece opciones de conectividad versátiles para periféricos, pantallas externas y una conexión a internet rápida y estable.', 'Asus', 0),
(255, 'Asus Vivobook 16X K3605ZC-N1270W - Portátil 16 i7-12650H 16GB RTX 3050 512GB SSD W11', 'https://www.neobyte.es/104793-large_default/asus-vivobook-16x-k3605zc-n1270w-portatil-16-i7-12650h-16gb-rtx-3050-512gb-ssd-w11.jpg', 898.99, 'Con 16GB de memoria RAM DDR4, este portátil garantiza un rendimiento multitarea sin interrupciones, permitiendo trabajar en varios programas al mismo tiempo sin comprometer la velocidad ni la respuesta del sistema.', 'Asus', 0),
(256, 'Gigabyte AORUS 17H BXF-74ES554SH - Portátil 17.3 i7-13700H 16GB RTX 4080 1TB SSD W11', 'https://www.neobyte.es/88394-large_default/gigabyte-aorus-17h-bxf-74es554sh-portatil-173-i7-13700h-16gb-rtx-4080-1tb-ssd-w11.jpg', 2329, 'Con el poderoso Gigabyte AORUS 17H BXF-74ES554SH experimentarás lo último en material de rendimiento. Este portátil de altísimas prestaciones arroja una potencia descomunal a todos los niveles, destacando el apartado gráfico, para lo que cuenta con la impresionante Nvidia GeForce RTX 4080 de 12GB y pantalla Full HD de 17.3 y 360Hz de tasa de refresco. De este modo, tus creaciones, juegos y contenidos cobrarán vida y subirán a una nueva dimensión. A nivel técnico, está provisto también de procesador Intel Core i7-13700H, 16GB de RAM DDR5 de última generación y SSD de 1TB. Todo ello con un diseño sorprendentemente delgado, una calidad de fabricación excelente y una conectividad de vanguardia.', 'Gigabyte', 0),
(257, 'Lenovo V15 G2 IJL 82QY00PUSP - Portátil 15.6 Celeron N4500 8GB 256GB SSD', 'https://www.neobyte.es/105996-large_default/lenovo-v15-g2-ijl-82qy00pusp-portatil-156-celeron-n4500-8gb-256gb-ssd.jpg', 282.9, 'La presencia de una Webcam HD con cubierta de privacidad asegura comunicaciones seguras y la posibilidad de participar en videoconferencias con confianza. Con un peso de 1.7 kg, el V15 G2 se presenta como una opción portátil para aquellos que necesitan mantenerse productivos en movimiento. La combinación de Wi-Fi 5 y Bluetooth 5.1 permite una conectividad sin complicaciones, ofreciendo una experiencia completa para las necesidades profesionales y personales.', 'Lenovo', 0),
(258, 'Gigabyte AORUS 15 9KF-E3ES383SD Portátil 15.6 i5-12500H 8GB RTX 4060 512GB', 'https://www.neobyte.es/88415-large_default/gigabyte-aorus-15-9kf-e3es383sd-portatil-156-i5-12500h-8gb-rtx-4060-512gb.jpg', 928.99, '', 'Gigabyte', 0),
(259, 'Lenovo V15 G3 IAP 82TT00KCSP - Portátil 15.6 i3-1215U 8GB 256GB SSD W11', 'https://www.neobyte.es/107992-large_default/lenovo-v15-g3-iap-82tt00kcsp-portatil-156-i3-1215u-8gb-256gb-ssd-w11.jpg', 394.9, 'Preinstalado con Windows 11 Home, el Lenovo V15 G3 IAP asegura una experiencia de usuario moderna y actualizada, con acceso a las últimas funciones y seguridad que ofrece Microsoft. El diseño en color negro del portátil no solo añade un aspecto profesional, sino que también lo hace adecuado para una variedad de entornos, desde la oficina hasta el hogar.', 'Lenovo', 0),
(260, 'Gigabyte G5 KF-E3ES313SH - Portátil 15.6 i5-12500H 16GB RTX 4060 512GB SSD W11', 'https://www.neobyte.es/89170-large_default/gigabyte-g5-kf-e3es313sh-portatil-156-i5-12500h-16gb-rtx-4060-512gb-ssd-w11.jpg', 988.99, 'Este modelo cuenta con el sistema de refrigeración WINDFORCE 4, que utiliza dos ventiladores WINDFORCE Blade 3D de 90 mm y un ventilador WINDFORCE Blade 3D de 100 mm. Los ventiladores utilizan un diseño de aspas optimizado para generar un flujo de aire eficiente y silencioso.', 'Gigabyte', 0),
(261, 'Lenovo V15 G4 IAH 83FS002WSP - Portátil 15.6 i5-12500H 8GB 512GB SSD', 'https://www.neobyte.es/107997-large_default/lenovo-v15-g4-iah-83fs002wsp-portatil-156-i5-12500h-8gb-512gb-ssd.jpg', 497.9, 'La integración de la tarjeta gráfica Intel UHD Graphics asegura un rendimiento adecuado para tareas gráficas básicas y reproducción multimedia, satisfaciendo las necesidades de usuarios que no requieren de gráficos de alta intensidad. La movilidad es otro aspecto clave de este modelo, ya que su ligereza y diseño compacto lo hacen un compañero de viaje ideal para profesionales y estudiantes que necesitan una herramienta de trabajo o estudio fiable y fácil de transportar.', 'Lenovo', 0),
(262, 'Gigabyte G5 MF-E2ES333SD - Portátil 15.6 i5-12500H 8GB RTX 4050 512GB SSD', 'https://www.neobyte.es/91025-large_default/gigabyte-g5-mf-e2es333sd-portatil-156-i5-12500h-8gb-rtx-4050-512gb-ssd.jpg', 899.89, 'Este modelo cuenta con el sistema de refrigeración WINDFORCE 4, que utiliza dos ventiladores WINDFORCE Blade 3D de 90 mm y un ventilador WINDFORCE Blade 3D de 100 mm. Los ventiladores utilizan un diseño de aspas optimizado para generar un flujo de aire eficiente y silencioso.', 'Gigabyte', 0),
(263, 'Gigabyte Aero 16 BSF-A3ES964SP - Portátil 16 i9-13900H 32GB RTX 4070 1TB SSD W11', 'https://www.neobyte.es/110899-large_default/gigabyte-aero-16-bsf-a3es964sp-portatil-16-i9-13900h-32gb-rtx-4070-1tb-ssd-w11.jpg', 2259, 'El portátil Gigabyte Aero 16 BSF-A3ES964SP está diseñado para creadores, profesionales y diseñadores que buscan un rendimiento excepcional y una experiencia visual superior. Equipado con una pantalla OLED 4K+ de 16:10 y certificaciones de color X-Rite™ 2.0, Pantone® Validated, TÜV Rheinland de baja luz azul y Eyesafe® 2.0, garantiza una calidad de imagen excepcional y cuidado ocular. Potenciado por procesadores Intel® Core™ i9 de 13ª generación y GPU NVIDIA® GeForce RTX™ 40, ofrece un rendimiento de alta gama. Con un chasis delgado de 0.70 pulgadas y un peso de 1.9 kg, es portátil y potente, ideal para la creatividad en cualquier lugar. Además, con tecnologías como MUX Switch, Wi-Fi 6E, y una batería de 88Wh, proporciona una experiencia inigualable para creadores en movimiento.', 'Gigabyte', 0),
(264, 'Lenovo V15 G4 AMN 82YU00TLSP - Portátil 15.6 Ryzen 3 7320U 8GB 256GB SSD W11', 'https://www.neobyte.es/104674-large_default/lenovo-v15-g4-amn-82yu00tlsp-portatil-156-ryzen-3-7320u-8gb-256gb-ssd-w11.jpg', 390.9, 'En cuanto a las reuniones virtuales, el Lenovo V15 G4 facilita la colaboración con funciones como el desenfoque de fondo, Lenovo Smart Appearance y la integración de Microsoft Teams. Estas características permiten celebrar reuniones sin distracciones, mejorando la privacidad y la apariencia personal durante las videoconferencias. Con opciones intuitivas para compartir contenido y controlar el micrófono, el portátil ofrece una experiencia completa para las necesidades de comunicación actuales.', 'Lenovo', 0),
(265, 'Lenovo V15 G3 IAP 82TT00KBSP - Portátil 15.6 i3-1215U 8GB 256GB SSD', 'https://www.neobyte.es/108004-large_default/lenovo-v15-g3-iap-82tt00kbsp-portatil-156-i3-1215u-8gb-256gb-ssd.jpg', 350.9, 'Con un diseño compacto y ligero en color Business Black y un acabado texturizado, este portátil es tan atractivo como práctico. La pantalla de 15,6 pulgadas Full HD con características antirreflejos y una luminosidad de 250 cd/m² ofrece una experiencia visual confortable, incluso en largas jornadas de trabajo o estudio.', 'Lenovo', 0),
(266, 'Lenovo V15 G4 AMN 82YU00TKSP - Portátil 15.6 Ryzen 3 7320U 8GB 256GB SSD', 'https://www.neobyte.es/107321-large_default/lenovo-v15-g4-amn-82yu00tksp-portatil-156-ryzen-3-7320u-8gb-256gb-ssd.jpg', 350.9, 'Este modelo destaca por su estética cuidada y su utilidad práctica. Además, los altavoces equipados con la tecnología Dolby Audio y los micrófonos incorporados ofrecen una calidad de sonido excepcional, mejorando tanto el disfrute multimedia como las conferencias profesionales.', 'Lenovo', 0),
(267, 'Asus VivoBook F1502ZA-EJ1121 - Portátil 15.6 i5-1235U 8GB 512GB SSD', 'https://www.neobyte.es/110171-large_default/asus-vivobook-f1502za-ej1121-portatil-156-i5-1235u-8gb-512gb-ssd.jpg', 448.99, 'El diseño delgado y ligero del Asus VivoBook lo hace fácil de transportar, siendo ideal para usuarios que necesitan movilidad sin comprometer el rendimiento.', 'Asus', 0);
INSERT INTO `producto` (`id`, `nombre`, `imagen`, `precio`, `especificaciones`, `marca`, `id_categoria`) VALUES
(268, 'Asus VivoBook 15 F1504ZA-NJ700 - Portátil 15.6 i5-1235U 16GB 512GB SSD', 'https://www.neobyte.es/109094-large_default/asus-vivobook-15-f1504za-nj700-portatil-156-i5-1235u-16gb-512gb-ssd.jpg', 518.99, 'El ASUS VivoBook 15 F1504ZA-NJ700 es un portátil elegante y eficiente con una pantalla de 15.6 Full HD que ofrece una resolución nítida de 1920 x 1080 píxeles. Equipado con un potente procesador Intel Core i5-1235U y respaldado por 16GB de RAM DDR4, garantiza un rendimiento sólido para tareas variadas. Con una capacidad de almacenamiento de 512 GB en un SSD, proporciona velocidad en el acceso a los datos. Los gráficos Intel Iris Xe Graphics mejoran la experiencia visual. Presenta un diseño en color plata fría y un peso de 1.7 kg, lo que lo hace portátil y estéticamente atractivo.', 'Asus', 0),
(269, 'Asus VivoBook 15 F1504ZA-NJ710 - Portátil 15.6 i7-1255U 16GB 512GB SSD', 'https://www.neobyte.es/109101-large_default/asus-vivobook-15-f1504za-nj710-portatil-156-i7-1255u-16gb-512gb-ssd.jpg', 599, 'El almacenamiento de 512 GB en un SSD asegura una respuesta rápida y accesibilidad ágil a tus datos. Con gráficos Intel Iris Xe, disfrutarás de una calidad visual excepcional. Su diseño en color plata fría le confiere un aspecto elegante. Con un peso de 1.7 kg, es ligero y fácil de transportar. Viene sin sistema operativo preinstalado, brindándote flexibilidad. El teclado QWERTY español completa esta opción versátil y potente para tus necesidades informáticas.', 'Asus', 0),
(270, 'Asus VivoBook 16X K3605ZC-PL361W - Portátil 16 i5-12500H 16GB RTX 3050 512GB SSD W11', 'https://www.neobyte.es/109108-large_default/asus-vivobook-16x-k3605zc-pl361w-portatil-16-i5-12500h-16gb-rtx-3050-512gb-ssd-w11.jpg', 939, 'Gracias a la combinación de la potencia gráfica NVIDIA GeForce RTX 3050 de 4 GB, este portátil garantiza un rendimiento gráfico excepcional para tus actividades multimedia y juegos. Viene con el sistema operativo Windows 11 Home preinstalado, ofreciendo una experiencia de usuario intuitiva y moderna.', 'Asus', 0),
(271, 'Asus ZenBook 14 OLED UX3405MA-PP606W - Portátil 14 U7-155H 16GB 512GB W11', 'https://www.neobyte.es/110108-large_default/asus-zenbook-14-oled-ux3405ma-pp606w-portatil-14-u7-155h-16gb-512gb-w11.jpg', 1229, 'Sumérgete en la sofisticación incomparable del ZenBook 14 OLED, un ultraportátil artesanal que redefine la elegancia. Potencia tu productividad y entretenimiento con el rendimiento excepcional del procesador Intel Core Ultra Meteor Lake y los gráficos Intel Arc. Disfruta de una experiencia visual cautivadora en la pantalla ASUS Lumina OLED de 14 pulgadas con una sorprendente resolución WQXGA+ (3K) y una frecuencia de actualización de 120Hz. Experimenta la durabilidad y confiabilidad de este exclusivo portátil, optimizado para la eficiencia y diseñado con materiales sostenibles que buscan reducir el impacto ambiental. Además, goza de una conectividad perfecta a través de los puertos más demandados (Thunderbolt, HDMI...), . Eleva tu jornada con la batería de larga duración y sumérgete en la elegancia ecológica de un diseño amigable con el medio ambiente, reflejando el compromiso con la equidad y la sostenibilidad.', 'Asus', 0),
(272, 'Asus VivoBook 15 P1502CZA-EJ1736X - Portátil 15.6 i5-1235U 16GB 512GB SSD W11', 'https://www.neobyte.es/105517-large_default/asus-vivobook-15-p1502cza-ej1736x-portatil-156-i5-1235u-16gb-512gb-ssd-w11.jpg', 589.9, 'Este portátil encarna la elegancia y modernidad en su diseño, destacándose particularmente por su acabado en un tranquilo y sofisticado tono Azul (Quiet Blue). Esta tonalidad no solo aporta un toque de serenidad visual, sino que también refleja una estética contemporánea, haciendo del portátil una pieza distintiva tanto en ambientes profesionales como personales. Su diseño, enfocado en líneas limpias y una estructura minimalista, complementa perfectamente la funcionalidad con un estilo visualmente atractivo y profesional.', 'Asus', 0),
(273, 'Asus ZenBook 14 OLED UX3402VA-KM004W Portátil 14 i5-1340P 16GB 512GB W11', 'https://www.neobyte.es/89950-large_default/asus-zenbook-14-oled-ux3402va-km004w-portatil-14-i5-1340p-16gb-512gb-w11.jpg', 858.99, '', 'Asus', 0),
(274, 'Asus VivoBook S14 Flip TP3402VA-LZ273W - Portátil 14 i5-1335U 16GB 512GB SSD W11', 'https://www.neobyte.es/109512-large_default/asus-vivobook-s14-flip-tp3402va-lz273w-portatil-14-i5-1335u-16gb-512gb-ssd-w11.jpg', 788.99, 'Explora la versatilidad con el ASUS VivoBook S 14 Flip TP3402VA-LZ273W. Este portátil convertible te ofrece un rendimiento excepcional con un procesador Intel Core i5-1335U, 16 GB de RAM y un almacenamiento SSD de 512 GB. La pantalla táctil WUXGA de 14 proporciona una experiencia visual inmersiva con una resolución de 1920 x 1200 píxeles. Diseñado en elegante color plateado, este híbrido combina estilo y funcionalidad. Con teclado en español y Windows 11 Home preinstalado, disfruta de la comodidad y la eficiencia en cualquier modo que elijas. ¡Convierte tus ideas en realidad con este portátil convertible!', 'Asus', 0),
(275, 'Asus ZenBook 15 OLED UM3504DA-MA286W - Portátil 15.6 Ryzen 7 7735U 16GB 512GB SSD W11', 'https://www.neobyte.es/105069-large_default/asus-zenbook-15-oled-um3504da-ma286w-portatil-156-ryzen-7-7735u-16gb-512gb-ssd-w11.jpg', 988.99, 'En resumen, el Asus ZenBook 15 OLED UM3504DA-MA286W, destaca por su combinación de portabilidad, sostenibilidad y rendimiento excepcional. Desde su pantalla OLED a 120 Hz hasta su diseño elegante y su capacidad para conquistar cualquier tarea, este ultraportátil ofrece una experiencia única para aquellos que buscan lo mejor en tecnología.', 'Asus', 0),
(276, 'Asus VivoBook F1502ZA-EJ1121 - Portátil 15.6 i5-1235U 16GB 512GB SSD', 'https://www.neobyte.es/110172-large_default/asus-vivobook-f1502za-ej1121-portatil-156-i5-1235u-16gb-512gb-ssd.jpg', 478.99, 'Este modelo de VivoBook ofrece una variedad de puertos para conectividad, incluyendo puertos USB, HDMI y un lector de tarjetas. Además, su batería de larga duración brinda una autonomía adecuada para un uso diario prolongado, y su teclado ergonómico mejora la experiencia de escritura.', 'Asus', 0),
(277, 'Asus Vivobook 16X K3605ZC-N1268W - Portátil 16 i5-12450H 16GB 512GB SSD W11', 'https://www.neobyte.es/104786-large_default/asus-vivobook-16x-k3605zc-n1268w-portatil-16-i5-12450h-16gb-512gb-ssd-w11.jpg', 799, 'Con un diseño delgado y elegante, el Asus Vivobook 16X K3605ZC-N1268W es altamente portátil y presenta un aspecto moderno, perfecto para usuarios que valoran el rendimiento y la estética. Con una variedad de puertos USB, HDMI y Wi-Fi 6, este portátil ofrece opciones de conectividad versátiles para periféricos, pantallas externas y una conexión a internet rápida y estable.', 'Asus', 0),
(278, 'Asus Vivobook 16X K3605ZC-N1270W - Portátil 16 i7-12650H 16GB RTX 3050 512GB SSD W11', 'https://www.neobyte.es/104793-large_default/asus-vivobook-16x-k3605zc-n1270w-portatil-16-i7-12650h-16gb-rtx-3050-512gb-ssd-w11.jpg', 898.99, 'Con 16GB de memoria RAM DDR4, este portátil garantiza un rendimiento multitarea sin interrupciones, permitiendo trabajar en varios programas al mismo tiempo sin comprometer la velocidad ni la respuesta del sistema.', 'Asus', 0),
(279, 'Lenovo V15 G2 IJL 82QY00PUSP - Portátil 15.6 Celeron N4500 8GB 256GB SSD', 'https://www.neobyte.es/105996-large_default/lenovo-v15-g2-ijl-82qy00pusp-portatil-156-celeron-n4500-8gb-256gb-ssd.jpg', 282.9, 'La presencia de una Webcam HD con cubierta de privacidad asegura comunicaciones seguras y la posibilidad de participar en videoconferencias con confianza. Con un peso de 1.7 kg, el V15 G2 se presenta como una opción portátil para aquellos que necesitan mantenerse productivos en movimiento. La combinación de Wi-Fi 5 y Bluetooth 5.1 permite una conectividad sin complicaciones, ofreciendo una experiencia completa para las necesidades profesionales y personales.', 'Lenovo', 0),
(280, 'Lenovo V15 G3 IAP 82TT00KCSP - Portátil 15.6 i3-1215U 8GB 256GB SSD W11', 'https://www.neobyte.es/107992-large_default/lenovo-v15-g3-iap-82tt00kcsp-portatil-156-i3-1215u-8gb-256gb-ssd-w11.jpg', 394.9, 'Preinstalado con Windows 11 Home, el Lenovo V15 G3 IAP asegura una experiencia de usuario moderna y actualizada, con acceso a las últimas funciones y seguridad que ofrece Microsoft. El diseño en color negro del portátil no solo añade un aspecto profesional, sino que también lo hace adecuado para una variedad de entornos, desde la oficina hasta el hogar.', 'Lenovo', 0),
(281, 'Lenovo V15 G4 IAH 83FS002WSP - Portátil 15.6 i5-12500H 8GB 512GB SSD', 'https://www.neobyte.es/107997-large_default/lenovo-v15-g4-iah-83fs002wsp-portatil-156-i5-12500h-8gb-512gb-ssd.jpg', 497.9, 'La integración de la tarjeta gráfica Intel UHD Graphics asegura un rendimiento adecuado para tareas gráficas básicas y reproducción multimedia, satisfaciendo las necesidades de usuarios que no requieren de gráficos de alta intensidad. La movilidad es otro aspecto clave de este modelo, ya que su ligereza y diseño compacto lo hacen un compañero de viaje ideal para profesionales y estudiantes que necesitan una herramienta de trabajo o estudio fiable y fácil de transportar.', 'Lenovo', 0),
(282, 'Lenovo V15 G4 AMN 82YU00TLSP - Portátil 15.6 Ryzen 3 7320U 8GB 256GB SSD W11', 'https://www.neobyte.es/104674-large_default/lenovo-v15-g4-amn-82yu00tlsp-portatil-156-ryzen-3-7320u-8gb-256gb-ssd-w11.jpg', 390.9, 'En cuanto a las reuniones virtuales, el Lenovo V15 G4 facilita la colaboración con funciones como el desenfoque de fondo, Lenovo Smart Appearance y la integración de Microsoft Teams. Estas características permiten celebrar reuniones sin distracciones, mejorando la privacidad y la apariencia personal durante las videoconferencias. Con opciones intuitivas para compartir contenido y controlar el micrófono, el portátil ofrece una experiencia completa para las necesidades de comunicación actuales.', 'Lenovo', 0),
(283, 'Lenovo V15 G3 IAP 82TT00KBSP - Portátil 15.6 i3-1215U 8GB 256GB SSD', 'https://www.neobyte.es/108004-large_default/lenovo-v15-g3-iap-82tt00kbsp-portatil-156-i3-1215u-8gb-256gb-ssd.jpg', 350.9, 'Con un diseño compacto y ligero en color Business Black y un acabado texturizado, este portátil es tan atractivo como práctico. La pantalla de 15,6 pulgadas Full HD con características antirreflejos y una luminosidad de 250 cd/m² ofrece una experiencia visual confortable, incluso en largas jornadas de trabajo o estudio.', 'Lenovo', 0),
(284, 'Lenovo V15 G4 AMN 82YU00TKSP - Portátil 15.6 Ryzen 3 7320U 8GB 256GB SSD', 'https://www.neobyte.es/107321-large_default/lenovo-v15-g4-amn-82yu00tksp-portatil-156-ryzen-3-7320u-8gb-256gb-ssd.jpg', 350.9, 'Este modelo destaca por su estética cuidada y su utilidad práctica. Además, los altavoces equipados con la tecnología Dolby Audio y los micrófonos incorporados ofrecen una calidad de sonido excepcional, mejorando tanto el disfrute multimedia como las conferencias profesionales.', 'Lenovo', 0),
(285, 'Lenovo V15 G4 AMN 82YU00TSSP - Portátil 15.6 Ryzen 5 7520U 8GB 512GB SSD W11', 'https://www.neobyte.es/107359-large_default/lenovo-v15-g4-amn-82yu00tssp-portatil-156-ryzen-5-7520u-8gb-512gb-ssd-w11.jpg', 474.9, 'La estética no se queda atrás en este equipo. Su diseño ligero y delgado, con un grosor de solo 19,9 mm y un peso de 1,65 kg, lo hace fácilmente transportable. Disponible en un sofisticado color Business Black, y con un acabado elegante, combina estilo y practicidad.', 'Lenovo', 0),
(286, 'Lenovo V15 G3 IAP 82TT00C0SP - Portátil 15.6 i5-1235U 8GB 256GB SSD W11', 'https://www.neobyte.es/107371-large_default/lenovo-v15-g3-iap-82tt00c0sp-portatil-156-i5-1235u-8gb-256gb-ssd-w11.jpg', 497.9, 'Mantente siempre conectado y seguro con este equipo. La webcam HD con cubierta de privacidad garantiza comunicaciones seguras y privadas, mientras que las opciones de conectividad, incluyendo Wi-Fi 5 y Bluetooth 5.1, te mantienen en línea con velocidades y eficiencia superiores. El diseño en negro (Business Black) aporta un toque de profesionalismo y estilo, haciendo de este portátil una elección inteligente para el usuario moderno.', 'Lenovo', 0),
(287, 'Lenovo V15 G3 IAP 82TT00C3SP - Portátil 15.6 i5-1235U 16GB 512GB SSD W11', 'https://www.neobyte.es/104665-large_default/lenovo-v15-g3-iap-82tt00c3sp-portatil-156-i5-1235u-16gb-512gb-ssd-w11.jpg', 592.9, 'El V15 G3 también facilita el trabajo del equipo de IT. Gracias a las funciones de gestión y seguridad de Lenovo, es posible implementar, actualizar y proteger el equipo de forma rápida y sencilla.', 'Lenovo', 0),
