(289, 'Lenovo V15 G3 IAP 82TT00BESP - Portátil 15.6 i7-1255U 8GB 512GB SSD', 'https://www.neobyte.es/107389-large_default/lenovo-v15-g3-iap-82tt00besp-portatil-156-i7-1255u-8gb-512gb-ssd.jpg', 564.9, 'Con seis puertos de E/S estándar, incluido USB tipo C y HDMI, este modelo asegura acceso rápido a periféricos y redes. Además, con funciones avanzadas de seguridad, como el obturador de privacidad de la cámara garantiza la protección de datos confidenciales y la seguridad en línea. La implementación y gestión de IT se simplifican, lo que convierte al V15 en una opción económica y eficaz para empresas.', 'Lenovo', 0),
