(291, 'Lenovo V15 G4 AMN 82YU00TRSP - Portátil 15.6 Ryzen 5 7520U 8GB 256GB SSD W11', 'https://www.neobyte.es/107347-large_default/lenovo-v15-g4-amn-82yu00trsp-portatil-156-ryzen-5-7520u-8gb-256gb-ssd-w11.jpg', 434.9, 'El Lenovo V15 G4 AMN se distingue no solo por su notable desempeño sino también por sus capacidades de conexión de última generación. Este modelo integra Wi-Fi 5 y tecnología Bluetooth para ofrecer una experiencia de conectividad fluida y eficiente. En cuanto a su diseño, destaca por su delgadez de solo 19,9 mm y un ligero peso de 1,63 kg, lo que resalta su portabilidad. Disponible en negro Business Black y con unos acabados finos, presenta un look contemporáneo y profesional.', 'Lenovo', 0),
