(293, 'Acer Extensa 15 EX215-55-58PX - Portátil 15.6 i5-1235U 8GB 512GB SSD W11', 'https://www.neobyte.es/107144-large_default/acer-extensa-15-ex215-55-58px-portatil-156-i5-1235u-8gb-512gb-ssd-w11.jpg', 525.9, 'La pantalla Full HD de 15.6 pulgadas con tecnología ComfyView, ofrece imágenes nítidas y colores vibrantes, lo que mejora significativamente la experiencia visual en cualquier actividad. La conectividad también es una fortaleza clave de este dispositivo, con tres puertos USB 3.2 de 1.ª generación y Wi-Fi 6 para una conexión a Internet rápida y estable. Además, su cámara web HD y micrófonos optimizados elevan la calidad de las videollamadas, haciéndolo ideal para conferencias en línea o charlas con amigos y familiares. Con Windows 11 Home como sistema operativo, el Extensa 15 ofrece una experiencia de usuario intuitiva y accesible.', 'Acer', 0),
