(319, 'Asus TUF Gaming F15 TUF507ZC4-HN231 - Portátil 15.6 i7-12700H 16GB RTX 3050 512GB SSD', 'https://www.neobyte.es/108770-large_default/asus-tuf-gaming-f15-tuf507zc4-hn231-portatil-156-i7-12700h-16gb-rtx-3050-512gb-ssd.jpg', 774.9, 'Descubre el potente ASUS TUF Gaming F15 TUF507ZC4-HN231, un portátil gaming de 15.6 con pantalla Full HD y una tasa de refresco de 144Hz. Impulsado por un Intel Core i5-12500H y equipado con 16GB de RAM y un SSD de 512GB, ofrece un rendimiento excepcional. La combinación de gráficos Intel Iris Xe y NVIDIA GeForce RTX 3050 garantiza una experiencia visual inigualable. Con un diseño atractivo, este portátil gaming de ASUS es una opción ideal para los amantes de los juegos.', 'Asus', 0),
(320, 'MSI Thin GF63 12VE-010XES - Portátil 15.6 i7-12650H 16GB RTX 4050 512GB SSD', 'https://www.neobyte.es/96383-large_default/msi-thin-gf63-12ve-010xes-portatil-156-i7-12650h-16gb-rtx-4050-512gb-ssd.jpg', 1066.91, 'MSI Thin GF63 12VE-010XES - Portátil 15.6 Intel Core i7 12650H 16GB RTX 4050 512GB SSD', 'MSI', 0),
(321, 'HP Victus 16-E0100NS - Portátil 16 Ryzen 5 5600H 8GB 512GB SSD GTX 1650', 'https://www.neobyte.es/79100-large_default/hp-victus-16-e0100ns-portatil-16-ryzen-5-5600h-8gb-512gb-ssd-gtx-1650.jpg', 749.9, 'El HP Victus 16-E0100NS lleva el sello de un fabricante líder. Este portátil diseñado para jugar presenta una configuración equilibrada, destacando el procesador AMD Ryzen 5 5600H de seis núcleos, la tarjeta gráfica Nvidia GTX 1650 y la memoria RAM de 8GB. No pasamos por alto el SSD de 512GB ni la pantalla Full HD de 16,1 pulgadas, así como su completa conectividad.', 'HP', 0),
(322, 'Asus TUF Gaming A16 TUF617NS-N3095 - Portátil 16 Ryzen 7 7735HS 16GB RX 7600S 1TB SSD', 'https://www.neobyte.es/90695-large_default/asus-tuf-gaming-a16-tuf617ns-n3095-portatil-16-ryzen-7-7735hs-16gb-rx-7600s-1tb-ssd.jpg', 1065.9, 'La pantalla IPS con resolución WUXGA y su tasa de refresco de 165 Hz es capaz de proporcionar imágenes claras, vivas y fluidas, ideal para juegos y visualización de contenido multimedia. El teclado tipo chicle, retroiluminado y con disposición en español, brinda comodidad y precisión en cada pulsación. Con una batería de 90Wh, este portátil garantiza una duración prolongada, lo que es esencial para usuarios que buscan movilidad y autonomía.', 'Asus', 0),
(323, 'Asus TUF Gaming TUF507ZU4-LP110 - Portátil 15.6 i7 12700H 16GB RTX 4050 512GB', 'https://www.neobyte.es/90422-large_default/asus-tuf-gaming-tuf507zu4-lp110-portatil-156-i7-12700h-16gb-rtx-4050-512gb.jpg', 1076.9, 'La pantalla de 15.6 pulgadas ofrece una experiencia visual envolvente, perfecta para gaming y trabajo multimedia. Además, el diseño resistente y duradero de la serie TUF Gaming garantiza una durabilidad excepcional, cumpliendo con los estándares militares de durabilidad MIL-STD-810H, ofreciendo una construcción robusta y confiable.', 'Asus', 0),
(324, 'Asus TUF Gaming F15 TUF507ZV4-LP092 - Portátil 15.6 i7-12700H 16GB RTX 4060 1TB SSD', 'https://www.neobyte.es/90661-large_default/asus-tuf-gaming-f15-tuf507zv4-lp092-portatil-156-i7-12700h-16gb-rtx-4060-1tb-ssd.jpg', 1174.9, 'La pantalla Full HD de 15.6 pulgadas ofrece una visualización inmersiva, perfecta para gaming y contenido multimedia. Además, el diseño robusto de la serie TUF Gaming asegura una resistencia extraordinaria, cumpliendo con los estándares militares de durabilidad MIL-STD-810H, ofreciendo una construcción sólida y confiable.', 'Asus', 0),
(325, 'Asus TUF Gaming A15 TUF507XI-LP054 - Portátil 15.6 Ryzen 9 7940HS 32GB RTX 4070 1.5TB SSD', 'https://www.neobyte.es/105553-large_default/asus-tuf-gaming-a15-tuf507xi-lp054-portatil-156-ryzen-9-7940hs-32gb-rtx-4070-15tb-ssd.jpg', 1758.99, 'La pantalla Full HD de 15.6 pulgadas con una tasa de refresco de 144Hz proporciona imágenes nítidas y una experiencia visual suave, ideal para juegos de alta velocidad y contenido multimedia dinámico.', 'Asus', 0),
(326, 'MSI Katana 17 B13VFK-087ES - Portátil 17 i7-13620H 16GB RTX4060 1TB SSD W11', 'https://www.neobyte.es/89652-large_default/msi-katana-17-b13vfk-087es-portatil-17-i7-13620h-16gb-rtx4060-1tb-ssd-w11.jpg', 1354.9, 'Incorpora un teclado RGB de 4 zonas que ilumina las teclas WASD, creando así un ambiente inmersivo para una mejor experiencia de juego. La estética única de este modelo no solo refleja poder, sino que también ilumina tu camino en el mundo del gaming.', 'MSI', 0),
(327, 'Asus TUF Gaming TUF607JV-N3153 - Portátil 16 i7-13650HX 32GB RTX 4060 1TB SSD', 'https://www.neobyte.es/109667-large_default/asus-tuf-gaming-tuf607jv-n3153-portatil-16-i7-13650hx-32gb-rtx-4060-1tb-ssd.jpg', 1515.9, 'Sumérgete en una experiencia de gaming y creación de primer nivel con el portátil ASUS TUF Gaming TUF607JV-N3153. Equipado con un potente procesador Intel® Core™ i7-13650HX y una GPU NVIDIA® GeForce RTX™ 4060, este portátil te brinda un rendimiento excepcional. La memoria RAM DDR5 de alta velocidad a 4800 MHz y las dos ranuras para SSD M.2 PCIe Gen 4x4 aseguran una multitarea eficiente y un almacenamiento expansible para tus juegos y proyectos.', 'Asus', 0),
(328, 'HP Victus 16-E0068NS - Portátil 16 Ryzen 5 5600H 8GB GTX 1650 512GB', 'https://www.neobyte.es/65424-large_default/hp-victus-16-e0068ns-portatil-16-ryzen-5-5600h-8gb-gtx-1650-512gb.jpg', 749.9, 'Con el HP Victus 16-E0068NS podrás jugar a tus juegos competitivos favoritos por mucho menos de lo que esperas. Este portátil gaming cuenta con lo esencial para ofrecer un rendimiento adecuado a un amplio catálogo de títulos. Entre sus especificaciones más importantes, destacar la CPU AMD Ryzen 5 5600H de 6 núcleos, los 8GB de memoria RAM, el SSD de 512GB y la tarjeta gráfica Nvidia GeForce GTX 1650 de 4GB. Así mismo, el HP Victus 16-E0068NS destaca por la amplia variedad de puertos, por su conexión WiFi de alta velocidad y su fantástica pantalla Full HD de 16.1 pulgadas.', 'HP', 0),
(329, 'Asus VivoBook 16X K3605ZU-N1116 - Portátil 16 i5-12450H 16GB RTX 4050 512GB SSD', 'https://www.neobyte.es/107005-large_default/asus-vivobook-16x-k3605zu-n1116-portatil-16-i5-12450h-16gb-rtx-4050-512gb-ssd.jpg', 1065.9, 'La inclusión de la GPU NVIDIA GeForce RTX 4050 eleva el nivel de rendimiento gráfico. Esta tarjeta gráfica, basada en la arquitectura NVIDIA Ada Lovelace, incorpora DLSS 3 y trazado de rayos, entregando una experiencia de juego inmersiva y eficiente. La pantalla del VivoBook 16X, una IPS de 16 pulgadas con una resolución WQXGA+ y una tasa de refresco de 120 Hz, garantiza una experiencia visual superior. Con un brillo de 300 nits, proporciona imágenes vibrantes y claras desde casi cualquier ángulo.', 'Asus', 0),
(330, 'HP Omen 16-B1003NS - Portátil 16 i7-12700H 16GB RTX3060 512GB', 'https://www.neobyte.es/80919-large_default/hp-omen-16-b1003ns-portatil-16-i7-12700h-16gb-rtx3060-512gb.jpg', 1333.9, 'El HP Omen 16-B1003NS es un portátil muy completo, capaz de ofrecer a cada jugador lo que realmente necesita. Su configuración está formada por componentes de calidad, con un procesador Intel Core i7-12700H, una tarjeta gráfica RTX 3060, una RAM de 16GB y un SSD de 512GB que garantizan un juego fluido y un rendimiento impecable. Su pantalla IPS de 16 tampoco va a dejar indiferente a nadie, transmitiendo imágenes impactantes y nítidas en resolución Full HD que mostrará hasta los detalles más pequeños de cada escena.', 'HP', 0),
(331, 'MSI Alpha 17 C7VG-018ES - Portátil 17.3 Ryzen 9 7945HX 32GB RTX 4070 1TB SSD W11', 'https://www.neobyte.es/110724-large_default/msi-alpha-17-c7vg-018es-portatil-173-ryzen-9-7945hx-32gb-rtx-4070-1tb-ssd-w11.jpg', 2074.9, 'El MSI Alpha 17 C7VG-018ES redefine el rendimiento portátil con los potentes procesadores Ryzen 9 7945HX de AMD y la gráfica NVIDIA GeForce RTX Serie 40. Diseñado para gamers y creadores exigentes, este portátil ofrece una experiencia visual asombrosa con la arquitectura Ada Lovelace para trazado de rayos y DLSS 3 basado en IA. Con tecnologías como NVIDIA Max-Q, Wi-Fi 7, y un diseño de refrigeración mejorado con Shared-Pipe y MSI Overboost, experimentarás un rendimiento óptimo y una experiencia de juego inigualable. Además, cuenta con características premium como teclado RGB por tecla de SteelSeries, audio Hi-Resolution, memoria DDR5 de alta velocidad, y una unidad SSD PCIe Gen.4 para acelerar tus tareas. El MSI Alpha 17 C7VG-018ES es la combinación perfecta de potencia, velocidad y estilo, con el exclusivo MSI Center para una personalización completa. Eleva tu juego y creatividad con este portátil de alto rendimiento, diseñado para destacar en todos los aspectos.', 'MSI', 0),
(332, 'Gigabyte G6 KF-H3ES854SD - Portátil 16 i7-13620H 16GB RTX 4060 1TB SSD', 'https://www.neobyte.es/103080-large_default/gigabyte-g6-kf-h3es854sd-portatil-16-i7-13620h-16gb-rtx-4060-1tb-ssd.jpg', 1359, 'Los portátiles de alto rendimiento suelen contar con una cantidad significativa de memoria RAM, como 16GB, para facilitar la multitarea sin problemas y la ejecución fluida de aplicaciones exigentes. La inclusión de unidades de estado sólido (SSD) con capacidades de almacenamiento amplias, como 1TB, proporciona velocidades de lectura/escritura rápidas para arranques rápidos del sistema operativo y tiempos de carga más rápidos de aplicaciones y juegos.', 'Gigabyte', 0),
(333, 'Asus VivoBook 15 F1504ZA-NJ700 - Portátil 15.6 i5-1235U 16GB 512GB SSD', 'https://www.neobyte.es/109094-large_default/asus-vivobook-15-f1504za-nj700-portatil-156-i5-1235u-16gb-512gb-ssd.jpg', 518.99, 'El ASUS VivoBook 15 F1504ZA-NJ700 es un portátil elegante y eficiente con una pantalla de 15.6 Full HD que ofrece una resolución nítida de 1920 x 1080 píxeles. Equipado con un potente procesador Intel Core i5-1235U y respaldado por 16GB de RAM DDR4, garantiza un rendimiento sólido para tareas variadas. Con una capacidad de almacenamiento de 512 GB en un SSD, proporciona velocidad en el acceso a los datos. Los gráficos Intel Iris Xe Graphics mejoran la experiencia visual. Presenta un diseño en color plata fría y un peso de 1.7 kg, lo que lo hace portátil y estéticamente atractivo.', 'Asus', 0),
(334, 'Asus VivoBook 15 F1504ZA-NJ710 - Portátil 15.6 i7-1255U 16GB 512GB SSD', 'https://www.neobyte.es/109101-large_default/asus-vivobook-15-f1504za-nj710-portatil-156-i7-1255u-16gb-512gb-ssd.jpg', 599, 'El almacenamiento de 512 GB en un SSD asegura una respuesta rápida y accesibilidad ágil a tus datos. Con gráficos Intel Iris Xe, disfrutarás de una calidad visual excepcional. Su diseño en color plata fría le confiere un aspecto elegante. Con un peso de 1.7 kg, es ligero y fácil de transportar. Viene sin sistema operativo preinstalado, brindándote flexibilidad. El teclado QWERTY español completa esta opción versátil y potente para tus necesidades informáticas.', 'Asus', 0),
(335, 'Asus VivoBook 16X K3605ZC-PL361W - Portátil 16 i5-12500H 16GB RTX 3050 512GB SSD W11', 'https://www.neobyte.es/109108-large_default/asus-vivobook-16x-k3605zc-pl361w-portatil-16-i5-12500h-16gb-rtx-3050-512gb-ssd-w11.jpg', 939, 'Gracias a la combinación de la potencia gráfica NVIDIA GeForce RTX 3050 de 4 GB, este portátil garantiza un rendimiento gráfico excepcional para tus actividades multimedia y juegos. Viene con el sistema operativo Windows 11 Home preinstalado, ofreciendo una experiencia de usuario intuitiva y moderna.', 'Asus', 0),
(336, 'Asus TUF Gaming F17 TUF707VI-HX049 - Portátil 17.3 IPS i7-13620H RTX 4070 32GB SSD', 'https://www.neobyte.es/109125-large_default/asus-tuf-gaming-f17-tuf707vi-hx049-portatil-173-ips-i7-13620h-rtx-4070-32gb-ssd.jpg', 1648.99, 'Sorpréndete con el rendimiento potente y la inmersión visual gracias al portátil ASUS TUF Gaming F17 TUF707VI-HX049. Equipado con un procesador Intel Core i7-13620H y una tarjeta gráfica NVIDIA RTX 4070 de 8GB, este portátil ofrece un rendimiento excepcional para tus sesiones de juego intensivas y tareas multitarea. La pantalla de 17.3 Full HD con una frecuencia de actualización de 144Hz te sumerge en un mundo visual vibrante y fluido. Con 32GB de RAM DDR5 y un SSD de 1TB, disfrutarás de una respuesta rápida y tiempos de carga instantáneos. Además, el diseño robusto y elegante en color Mecha Gray, junto al teclado retroiluminado y de formato completo, complementan la experiencia de juego y productividad. Con el ASUS TUF Gaming F17, lleva tus sesiones de juego y trabajo al siguiente nivel.', 'Asus', 0),
(337, 'Asus ROG Strix G18 G814JIR-N6002 - Portátil 18 i9-14900HX 32GB RTX 4070 1TB SSD', 'https://www.neobyte.es/109659-large_default/asus-rog-strix-g18-g814jir-n6002-portatil-18-i9-14900hx-32gb-rtx-4070-1tb-ssd.jpg', 2299, 'Para una experiencia de juego verdaderamente inmersiva, ofrece una pantalla de 18 pulgadas con resolución WQXGA de 240 Hz. Estas pantallas no solo proporcionan una calidad de imagen excepcional, sino que también cuentan con una relación pantalla-cuerpo del 89%, asegurando que cada detalle en el juego se muestre con la máxima claridad y vivacidad.', 'Asus', 0),
(338, 'Asus ZenBook 14 OLED UX3405MA-PP606W - Portátil 14 U7-155H 16GB 512GB W11', 'https://www.neobyte.es/110108-large_default/asus-zenbook-14-oled-ux3405ma-pp606w-portatil-14-u7-155h-16gb-512gb-w11.jpg', 1229, 'Sumérgete en la sofisticación incomparable del ZenBook 14 OLED, un ultraportátil artesanal que redefine la elegancia. Potencia tu productividad y entretenimiento con el rendimiento excepcional del procesador Intel Core Ultra Meteor Lake y los gráficos Intel Arc. Disfruta de una experiencia visual cautivadora en la pantalla ASUS Lumina OLED de 14 pulgadas con una sorprendente resolución WQXGA+ (3K) y una frecuencia de actualización de 120Hz. Experimenta la durabilidad y confiabilidad de este exclusivo portátil, optimizado para la eficiencia y diseñado con materiales sostenibles que buscan reducir el impacto ambiental. Además, goza de una conectividad perfecta a través de los puertos más demandados (Thunderbolt, HDMI...), . Eleva tu jornada con la batería de larga duración y sumérgete en la elegancia ecológica de un diseño amigable con el medio ambiente, reflejando el compromiso con la equidad y la sostenibilidad.', 'Asus', 0),
(339, 'Asus VivoBook 15 P1502CZA-EJ1736X - Portátil 15.6 i5-1235U 16GB 512GB SSD W11', 'https://www.neobyte.es/105517-large_default/asus-vivobook-15-p1502cza-ej1736x-portatil-156-i5-1235u-16gb-512gb-ssd-w11.jpg', 589.9, 'Este portátil encarna la elegancia y modernidad en su diseño, destacándose particularmente por su acabado en un tranquilo y sofisticado tono Azul (Quiet Blue). Esta tonalidad no solo aporta un toque de serenidad visual, sino que también refleja una estética contemporánea, haciendo del portátil una pieza distintiva tanto en ambientes profesionales como personales. Su diseño, enfocado en líneas limpias y una estructura minimalista, complementa perfectamente la funcionalidad con un estilo visualmente atractivo y profesional.', 'Asus', 0),
(340, 'Asus VivoBook S14 Flip TP3402VA-LZ273W - Portátil 14 i5-1335U 16GB 512GB SSD W11', 'https://www.neobyte.es/109512-large_default/asus-vivobook-s14-flip-tp3402va-lz273w-portatil-14-i5-1335u-16gb-512gb-ssd-w11.jpg', 788.99, 'Explora la versatilidad con el ASUS VivoBook S 14 Flip TP3402VA-LZ273W. Este portátil convertible te ofrece un rendimiento excepcional con un procesador Intel Core i5-1335U, 16 GB de RAM y un almacenamiento SSD de 512 GB. La pantalla táctil WUXGA de 14 proporciona una experiencia visual inmersiva con una resolución de 1920 x 1200 píxeles. Diseñado en elegante color plateado, este híbrido combina estilo y funcionalidad. Con teclado en español y Windows 11 Home preinstalado, disfruta de la comodidad y la eficiencia en cualquier modo que elijas. ¡Convierte tus ideas en realidad con este portátil convertible!', 'Asus', 0),
(341, 'Asus TUF Gaming F15 TUF507VV-LP193 - Portátil 15.6 i7-13620H 16GB RTX 4060 1TB SSD', 'https://www.neobyte.es/109337-large_default/asus-tuf-gaming-f15-tuf507vv-lp193-portatil-156-i7-13620h-16gb-rtx-4060-1tb-ssd.jpg', 1348.99, 'Experimenta el rendimiento imparable con el ASUS TUF Gaming F15 TUF507VV-LP193. Este portátil gaming de 15.6 Full HD 144Hz presenta un potente Intel Core i7-13620H, 16GB de RAM, y un SSD de 1TB. Ya seas creador de contenido o te guste jugar, te encantará su gráfica NVIDIA GeForce RTX 4060. ¡Da la bienvenida a tu plataforma en gaming!', 'Asus', 0),
(342, 'Asus ZenBook 15 OLED UM3504DA-MA286W - Portátil 15.6 Ryzen 7 7735U 16GB 512GB SSD W11', 'https://www.neobyte.es/105069-large_default/asus-zenbook-15-oled-um3504da-ma286w-portatil-156-ryzen-7-7735u-16gb-512gb-ssd-w11.jpg', 988.99, 'En resumen, el Asus ZenBook 15 OLED UM3504DA-MA286W, destaca por su combinación de portabilidad, sostenibilidad y rendimiento excepcional. Desde su pantalla OLED a 120 Hz hasta su diseño elegante y su capacidad para conquistar cualquier tarea, este ultraportátil ofrece una experiencia única para aquellos que buscan lo mejor en tecnología.', 'Asus', 0),
(343, 'Asus VivoBook F1502ZA-EJ1121 - Portátil 15.6 i5-1235U 16GB 512GB SSD', 'https://www.neobyte.es/110172-large_default/asus-vivobook-f1502za-ej1121-portatil-156-i5-1235u-16gb-512gb-ssd.jpg', 478.99, 'Este modelo de VivoBook ofrece una variedad de puertos para conectividad, incluyendo puertos USB, HDMI y un lector de tarjetas. Además, su batería de larga duración brinda una autonomía adecuada para un uso diario prolongado, y su teclado ergonómico mejora la experiencia de escritura.', 'Asus', 0),
(344, 'Asus Vivobook 16X K3605ZC-N1268W - Portátil 16 i5-12450H 16GB 512GB SSD W11', 'https://www.neobyte.es/104786-large_default/asus-vivobook-16x-k3605zc-n1268w-portatil-16-i5-12450h-16gb-512gb-ssd-w11.jpg', 799, 'Con un diseño delgado y elegante, el Asus Vivobook 16X K3605ZC-N1268W es altamente portátil y presenta un aspecto moderno, perfecto para usuarios que valoran el rendimiento y la estética. Con una variedad de puertos USB, HDMI y Wi-Fi 6, este portátil ofrece opciones de conectividad versátiles para periféricos, pantallas externas y una conexión a internet rápida y estable.', 'Asus', 0);
INSERT INTO `producto` (`id`, `nombre`, `imagen`, `precio`, `especificaciones`, `marca`, `id_categoria`) VALUES
(345, 'Asus Vivobook 16X K3605ZC-N1270W - Portátil 16 i7-12650H 16GB RTX 3050 512GB SSD W11', 'https://www.neobyte.es/104793-large_default/asus-vivobook-16x-k3605zc-n1270w-portatil-16-i7-12650h-16gb-rtx-3050-512gb-ssd-w11.jpg', 898.99, 'Con 16GB de memoria RAM DDR4, este portátil garantiza un rendimiento multitarea sin interrupciones, permitiendo trabajar en varios programas al mismo tiempo sin comprometer la velocidad ni la respuesta del sistema.', 'Asus', 0),
(346, 'Gigabyte G5 MF5-52ES353SD - Portátil 15.6 i5-13500H 16GB RTX 4050 512GB SSD', 'https://www.neobyte.es/106399-large_default/gigabyte-g5-mf5-52es353sd-portatil-156-i5-13500h-16gb-rtx-4050-512gb-ssd.jpg', 999, 'La pantalla de 15,6 pulgadas del Gigabyte G5 MF5-52ES353SD tiene una resolución Full HD (1920 x 1080) y una frecuencia de actualización de 144 Hz. Esto la convierte en una excelente opción para juegos, ya que ofrece imágenes fluidas y sin parpadeos.', 'Gigabyte', 0),
(347, 'Gigabyte Aero 16 BSF-A3ES964SP - Portátil 16 i9-13900H 32GB RTX 4070 1TB SSD W11', 'https://www.neobyte.es/110899-large_default/gigabyte-aero-16-bsf-a3es964sp-portatil-16-i9-13900h-32gb-rtx-4070-1tb-ssd-w11.jpg', 2259, 'El portátil Gigabyte Aero 16 BSF-A3ES964SP está diseñado para creadores, profesionales y diseñadores que buscan un rendimiento excepcional y una experiencia visual superior. Equipado con una pantalla OLED 4K+ de 16:10 y certificaciones de color X-Rite™ 2.0, Pantone® Validated, TÜV Rheinland de baja luz azul y Eyesafe® 2.0, garantiza una calidad de imagen excepcional y cuidado ocular. Potenciado por procesadores Intel® Core™ i9 de 13ª generación y GPU NVIDIA® GeForce RTX™ 40, ofrece un rendimiento de alta gama. Con un chasis delgado de 0.70 pulgadas y un peso de 1.9 kg, es portátil y potente, ideal para la creatividad en cualquier lugar. Además, con tecnologías como MUX Switch, Wi-Fi 6E, y una batería de 88Wh, proporciona una experiencia inigualable para creadores en movimiento.', 'Gigabyte', 0),
(348, 'Lenovo V15 G4 IAH 83FS002WSP - Portátil 15.6 i5-12500H 8GB 512GB SSD', 'https://www.neobyte.es/107997-large_default/lenovo-v15-g4-iah-83fs002wsp-portatil-156-i5-12500h-8gb-512gb-ssd.jpg', 497.9, 'La integración de la tarjeta gráfica Intel UHD Graphics asegura un rendimiento adecuado para tareas gráficas básicas y reproducción multimedia, satisfaciendo las necesidades de usuarios que no requieren de gráficos de alta intensidad. La movilidad es otro aspecto clave de este modelo, ya que su ligereza y diseño compacto lo hacen un compañero de viaje ideal para profesionales y estudiantes que necesitan una herramienta de trabajo o estudio fiable y fácil de transportar.', 'Lenovo', 0),
(349, 'Lenovo V15 G4 AMN 82YU00TLSP - Portátil 15.6 Ryzen 3 7320U 8GB 256GB SSD W11', 'https://www.neobyte.es/104674-large_default/lenovo-v15-g4-amn-82yu00tlsp-portatil-156-ryzen-3-7320u-8gb-256gb-ssd-w11.jpg', 390.9, 'En cuanto a las reuniones virtuales, el Lenovo V15 G4 facilita la colaboración con funciones como el desenfoque de fondo, Lenovo Smart Appearance y la integración de Microsoft Teams. Estas características permiten celebrar reuniones sin distracciones, mejorando la privacidad y la apariencia personal durante las videoconferencias. Con opciones intuitivas para compartir contenido y controlar el micrófono, el portátil ofrece una experiencia completa para las necesidades de comunicación actuales.', 'Lenovo', 0),
(350, 'Asus ExpertBook B1502CBA-EJ0438W - Portátil 15.6 i5-1235U 16GB 512GB SSD W11', 'https://www.neobyte.es/93429-large_default/asus-expertbook-b1502cba-ej0438w-portatil-156-i5-1235u-16gb-512gb-ssd-w11.jpg', 580.9, 'PORTATIL ASUS EXPERTBOOK B1502CBA-EJ0438W', 'Asus', 0),
(351, 'Lenovo V15 G3 IAP 82TT00C3SP - Portátil 15.6 i5-1235U 16GB 512GB SSD W11', 'https://www.neobyte.es/104665-large_default/lenovo-v15-g3-iap-82tt00c3sp-portatil-156-i5-1235u-16gb-512gb-ssd-w11.jpg', 592.9, 'El V15 G3 también facilita el trabajo del equipo de IT. Gracias a las funciones de gestión y seguridad de Lenovo, es posible implementar, actualizar y proteger el equipo de forma rápida y sencilla.', 'Lenovo', 0),
(352, 'Acer Extensa 15 EX215-55-58PX - Portátil 15.6 i5-1235U 8GB 512GB SSD W11', 'https://www.neobyte.es/107144-large_default/acer-extensa-15-ex215-55-58px-portatil-156-i5-1235u-8gb-512gb-ssd-w11.jpg', 525.9, 'La pantalla Full HD de 15.6 pulgadas con tecnología ComfyView, ofrece imágenes nítidas y colores vibrantes, lo que mejora significativamente la experiencia visual en cualquier actividad. La conectividad también es una fortaleza clave de este dispositivo, con tres puertos USB 3.2 de 1.ª generación y Wi-Fi 6 para una conexión a Internet rápida y estable. Además, su cámara web HD y micrófonos optimizados elevan la calidad de las videollamadas, haciéndolo ideal para conferencias en línea o charlas con amigos y familiares. Con Windows 11 Home como sistema operativo, el Extensa 15 ofrece una experiencia de usuario intuitiva y accesible.', 'Acer', 0),
(353, 'HP 250 G9 6S7A9EA - Portátil 15.6 i5-1235U 16GB 512GB SSD W11', 'https://www.neobyte.es/105114-large_default/hp-250-g9-6s7a9ea-portatil-15-6-i5-1235u-16gb-512gb-ssd-w11.jpg', 591.9, 'En términos de conectividad, el equipo se destaca con múltiples puertos que facilitan la conexión de periféricos y dispositivos externos, ofreciendo versatilidad para satisfacer diversas necesidades empresariales. Todo esto se complementa con un precio inigualable, posicionándolo como una elección excepcional para empresas que buscan un portátil confiable y eficiente sin comprometer su presupuesto.', 'HP', 0),
(354, 'Asus VivoBook 15 F1504ZA-NJ694W - Portátil 15.6 i5-1235U 8GB 512GB SSD W11', 'https://www.neobyte.es/109358-large_default/asus-vivobook-15-f1504za-nj694w-portatil-156-i5-1235u-8gb-512gb-ssd-w11.jpg', 530.9, '', 'Asus', 0),
(355, 'Asus VivoBook 15 F1504ZA-NJ698 - Portátil 15.6 i5-1235U 8GB 512GB SSD', 'https://www.neobyte.es/109317-large_default/asus-vivobook-15-f1504za-nj698-portatil-156-i5-1235u-8gb-512gb-ssd.jpg', 484.9, '', 'Asus', 0),
(356, 'Asus Expertbook B9 B9400CBA-KC0686X - Portátil 14 i5-1235U 16GB 512GB SSD W11', 'https://www.neobyte.es/93121-large_default/asus-expertbook-b9-b9400cba-kc0686x-portatil-14-i5-1235u-16gb-512gb-ssd-w11.jpg', 1048.9, 'PORTATIL ASUS EXPERTBOOK B9 B9400CBA-KC0686X', 'Asus', 0),
(357, 'Asus VivoBook 15 F1504ZA-NJ706W - Portátil 15.6 i7-1255U 16GB 512GB SSD W11', 'https://www.neobyte.es/109373-large_default/asus-vivobook-15-f1504za-nj706w-portatil-156-i7-1255u-16gb-512gb-ssd-w11.jpg', 711.9, 'El ASUS VivoBook 15 F1504ZA-NJ706W es como ese amigo o amiga que siempre tiene todo a la mano. Con su pantalla 15.6 con resolución FULL HD (1920x1080), un procesador Intel Core i7-1255U que es puro músculo, 16GB de RAM y 512GB de SSD para que guardes lo que quieras. Viene con Windows 11 Home y un teclado elegante en color plateado. Con tan solo un peso de 1.7 kg, este portátil es como el mejor amigo al que puedes llevarte a todas tus batallas.', 'Asus', 0),
(358, 'Asus Expertbook B1 B1502CBA-NJ1108X - Portátil 15.6 i3-1215U 8GB 256GB SSD W11', 'https://www.neobyte.es/93168-large_default/asus-expertbook-b1-b1502cba-nj1108x-portatil-156-i3-1215u-8gb-256gb-ssd-w11.jpg', 467.89, 'PORTATIL ASUS EXPERTBOOK B1 B1502CBA-NJ1108X', 'Asus', 0),
(359, 'Asus ZenBook Pro Duo 15 OLED X582ZM-H2030W - Portátil 15 i7-12700H 32GB RTX3060 11TB SSD Windows 11', 'https://www.neobyte.es/80574-large_default/asus-zenbook-pro-duo-15-oled-x582zm-h2030w-portatil-15-i7-12700h-32gb-rtx3060-11tb-ssd-windows-11.jpg', 2711.9, 'El Asus ZenBook Pro Duo 15 OLED X582ZM-H2030W es el portátil del futuro y ya puede ser tuyo en Neobyte. Con unas especificaciones técnicas de infarto y la última tecnología en material de productividad y rendimiento, se convertirá en objeto de deseo de diseñadores, editores, creadores y todo tipo de profesionales. Entre sus principales ventajas destacar la espectacular pantalla táctil OLED con resolución 4K y 15.6 de tamaño. Ésta está complementada por un panel secundario que permite acceder a multitud de funcionalidades enfocadas a agilizar el flujo de trabajo y, en definitiva, a brindar una experiencia de uso insuperable. A estas prestaciones hay que añadir una conectividad de vanguardia y un diseño ergonómico.', 'Asus', 0),
(360, 'Asus VivoBook S 14 Flip TP3402ZA-LZ392W - Portátil 14 i5-12500H 16GB 512GB SSD W11', 'https://www.neobyte.es/109574-large_default/asus-vivobook-s-14-flip-tp3402za-lz392w-portatil-14-i5-12500h-16gb-512gb-ssd-w11.jpg', 871.9, 'El ASUS VivoBook S 14 Flip TP3402ZA-LZ392W es un portátil convertible que destaca por su rendimiento rápido y potente. Equipado con un procesador Intel Core i5-12500H de 12.ª Gen, 16GB de RAM y un SSD de 512 GB, este dispositivo te ofrece una experiencia informática fluida y eficiente. Su sistema de refrigeración ASUS IceCool garantiza un rendimiento fresco y silencioso, mientras que la pantalla táctil FHD NanoEdge de 14 con recubrimiento Corning Gorilla Glass NBT™ y una relación pantalla-cuerpo del 85% proporciona un placer visual excepcional. Con un peso ligero y una batería de larga duración de 50 Wh, el VivoBook S 14 Flip es perfecto para la productividad sin limitaciones, ofreciendo comodidad y estilo en cualquier lugar. Viene con Windows 11 Home para una experiencia de usuario completa.', 'Asus', 0),
(361, 'Asus VivoBook Go L1504FA-BQ699X - Portátil 15.6 Ryzen 5 7520U 8GB 512GB W11', 'https://www.neobyte.es/105500-large_default/asus-vivobook-go-l1504fa-bq699x-portatil-156-ryzen-5-7520u-8gb-512gb-w11.jpg', 515.9, 'PORTATIL ASUS VIVOBOOK GO L1504FA-BQ699X', 'Asus', 0),
