(364, 'Dock USB-C multipuerto Startech', 'https://www.neobyte.es/32056-large_default/docking-startech-usb-c-multipuerto-dkt30chvcm.jpg', 69.89, 'Práctico dock USB-C multipuerto Startech (DKT30CHVCM), ideal para incrementar la conectividad de tu ordenador portátil de última generación. Conéctalo a través del puerto USB-C y disfruta sin complicaciones de conexiones adicionales USB 3.0 (tipo A), HDMI, VGA e incluso RJ-45 para conectarte a la red por cable. Gracias a su diseño compacto con cable oculto, es muy fácil y cómodo de transportar.', 'Startech', 0),
(365, 'GORRA - ASUS CH3000 ROG SLASH BASEBALL', 'https://www.neobyte.es/64330-large_default/gorra---asus-ch3000-rog-slash-baseball.jpg', 29.9, 'Gorra - Asus Ch3000 Rog Slash Baseball', 'Asus', 0),
(366, 'MOCHILA SUBBLIM CITY BACKPACK 15,6 GRIS', 'https://www.neobyte.es/58165-large_default/mochila-subblim-city-backpack-156-gris.jpg', 16.9, 'La mochila para portátiles Subblim City Backpack de 15,6” resulta imprescindible en todos tus viajes o desplazamientos. Facilita el transporte de tu ordenador de forma segura gracias al exclusivo compartimento acolchado así como los diferentes bolsillos para los accesorios más utilizados y documentos. Su comodidad en el transporte está asegurada gracias a sus correas para el hombro que distribuyen uniformemente el peso en la espalda así como el asa de mano acolchada. Con un diseño actual y funcional, ha sido fabricada con unos resistentes materiales que repelen el agua. Cuenta con un puerto externo de carga USB para que puedas suministrar energía a tus dispositivos.', 'Subblim', 0),
(367, 'Tacens Mars Gaming 17.3 - Base de refrigeración', 'https://www.neobyte.es/21312-large_default/base-refrigeracion-tacens-mars-gaming-173.jpg', 19.9, 'Una buena refrigeración es importante para obtener el máximo rendimiento de tu portátil y evitar averías. La base de refrigeración Tacens Mars Gaming para ordenadores de 17.3” incorpora 5 ventiladores ultrasilenciosos con tecnología UA5 que te permitirán jugar sin preocuparte de la temperatura. Ha sido fabricada con una estructura muy resistente de acero y plástico y cuenta con iluminación LED en color rojo. Por último, mencionar que ha sido provista de dos puertos USB 2.0 para ampliar la capacidad de conexión del equipo.', 'Tacens', 0),
(368, 'MOCHILA SUBBLIM CITY BACKPACK 15,6 AZUL', 'https://www.neobyte.es/58162-large_default/mochila-subblim-city-backpack-156-azul.jpg', 16.9, 'La mochila para portátiles Subblim City Backpack de 15,6” resulta imprescindible en todos tus viajes o desplazamientos. Facilita el transporte de tu ordenador de forma segura gracias al exclusivo compartimento acolchado así como los diferentes bolsillos para los accesorios más utilizados y documentos. Su comodidad en el transporte está asegurada gracias a sus correas para el hombro que distribuyen uniformemente el peso en la espalda así como el asa de mano acolchada. Con un diseño actual y funcional, ha sido fabricada con unos resistentes materiales que repelen el agua. Cuenta con un puerto externo de carga USB para que puedas suministrar energía a tus dispositivos.', 'Subblim', 0),
