(380, 'MALETIN SUBBLIM AIR PADDING 15,6 - GRIS', 'https://www.neobyte.es/58176-large_default/maletin-subblim-air-padding-156-gris.jpg', 15.9, 'Maletín para portátiles hasta 15,6 Air Padding gris, fabricando con materiales de gran resistencia y con un diseño elegante y actual. Este modelo cuenta con un interior de burbujas acolchado y dos compartimentos separados en el interior, así como con bolsillo exterior de gran capacidad para documentos, bolígrafos y otros accesorios. Tanto las asas como las hebillas ofrecen una excelente seguridad durante su transporte y la cinta trasera es ajustable a Trolley.', 'Subblim', 0),
(381, 'Cargador CoolBoox portátil Universal 65 W', 'https://www.neobyte.es/516-large_default/cargador-coolbox-portatil-universal-65w.jpg', 19.9, 'No importa el portátil que tengas: el cargador universal CoolBox de 65W para portátil se adapta sin problemas. Este práctico alimentador incluye 14 puntas diferentes para conectar a tu ordenador, ya sea Toshiba, Acer, Asus, Lenovo... No te quedes sin energía. Además, incluye un sistema de seguridad para proteger tu equipo frente a subidas de corriente, sobretensiones y cortocircuitos, toda protección es poca.', 'Coolbox', 0),
