(383, 'Cargador universal portátil 90W Nox', 'https://www.neobyte.es/34544-large_default/cargador-nox-universal-portatil-90w.jpg', 18.9, 'Cargador universal para portátil Nox 90W. Un modelo con regulación automática de voltaje provisto de 10 conectores distintos, compatibles con las principales marcas del mercado. Gracias a su diseño compacto y ligero podrás llevarlo a todas partes. Además, cuenta con seguridad integrada contra subidas y picos de tensión. Por último, es importante reseñar que este cargador también dispone de una entrada USB para cargar otros dispositivos.', 'Nox', 0),
(384, 'BASE REFRIGERADORA PARA PORTATIL 17 - 1 VENTILADOR', 'https://www.neobyte.es/48453-large_default/base-refrigeradora-para-portatil-17-1-ventilador.jpg', 12.9, 'Base Refrigeradora Para Portatil 17 - 1 Ventilador', 'Conceptronic', 0),
