(387, 'Nox Power Adaptor (65W) - Adaptador de corriente', 'https://www.neobyte.es/37199-large_default/nox-power-adaptor-65w-adaptador-de-corriente.jpg', 18.9, 'Cargador universal para portátil Nox de 65W. Incluye 10 conectores y es compatible con marcas como Acer, Asus, Compaq, Del,  Fujitsu, Gateway, HP, IBM, Lenovo, Samsung, Sony , Intel NUC y Toshiba. Cuenta con un diseño ligero y con seguridad integrada contra subida y picos de tensión. Es importante mencionar también que este cargador universal también dispone de USB para cargar dispositivos compatibles.', 'Nox', 0),
(388, 'BASE REFRIGERACION MARS GAMING MNBC5', 'https://www.neobyte.es/63387-large_default/base-refrigeracion-mars-gaming-mnbc5.jpg', 29.9, 'BASE REFRIGERACION MARS GAMING MNBC5', 'Mars Gaming', 0),
(389, 'Tacens Abacus - Base de refrigeración', 'https://www.neobyte.es/32579-large_default/base-refrigeracion-tacens-abacus-12db.jpg', 18.9, 'La base de refrigeración Tacens Abacus es tu mejor aliada contra el calor. Compatible con portátiles de hasta 17, su gran ventilador de 18 cm. proporciona un flujo de aire eficaz manteniendo un nivel sonoro mínimo (tan solo 12db). Además, la Tacens Abacus incluye 2 puertos USB 2.0 y puede inclinarse hasta 40 grados en 6 niveles para que siempre disfrutes de la máxima ergonomía.', 'Tacens', 0),
(390, 'Nox 45W NXPWR45NB - Cargador universal 45W para portátil', 'https://www.neobyte.es/38498-large_default/cargador-nox-universal-portatil-45w.jpg', 15.9, 'Cargador universal para portátil Nox NXPWR45NB, con una potencia de 45W y una eficiencia mínima del 90%. Gracias a sus 9 conectores incluidos e intercambiables, es compatible con la mayoría de marcas de portátiles: Asus, Acer, HP, Lenovo, Dell, Toshiba... Además, es muy ligero, compacto y seguro de utilizar, pues incorpora multitud de sistemas de protección.', 'Nox', 0),
