(426, 'MALETIN SUBBLIM ELITE LAPTOP 13.3-14 GRIS', 'https://www.neobyte.es/58168-large_default/maletin-subblim-elite-laptop-133-14-gris.jpg', 13.9, 'Los maletines para portátil de Subblim Elite Laptop te ofrece una buena protección fabricado en poliéster Oxford. Además de duradero y práctico, es muy resistente a la intemperie y repele los líquidos. Las necesidades cotidianas se organizan con facilidad y los accesorios como cargadores, cables, bolígrafos, etc. son accesibles dentro del compartimento frontal. Tu portátil permanecerá protegido en el compartimento dedicado acolchado en el que también podrás transportar otras pertenencias como documentos o carpetas. Su transporte resulta de lo más cómodo gracias a unas resistentes asas, correa de hombro con protección y la cinta trasera que puedes adaptar a tu Trolley.', 'Subblim', 0),
