(428, 'Apple Pencil (2ª gen.) - Lápiz digital', 'https://www.neobyte.es/37908-large_default/apple-pencil-2-gen-lapiz-digital.jpg', 146.89, 'Apple Pencil de 2ª generación (MU8F2ZM/A) es compatible con el iPad Pro de 11 pulgadas y el iPad Pro de 12,9 pulgadas (3.ª y 4.ª generación). Un modelo de gran precisión perfecto para dibujar, tomar notas, mandar e-mails, colorear... Su superficie táctil permite cambiar de herramienta sin tener que soltarlo y cuenta con un lado plano que se acopla magnéticamente para cargarlo y vincularlo de forma automática. ¡Cómpralo en Neobyte con todas las garantías!', 'Apple', 0),
(429, 'Apple Lightning a USB Tipo A (1m) - Cable USB', 'https://www.neobyte.es/88310-large_default/apple-lightning-a-usb-tipo-a-1m-cable-usb.jpg', 22.91, 'Apple Lightning a USB 1m', 'Apple', 0),
