(437, 'Adaptador Apple Lightning a HDMI', 'https://www.neobyte.es/16820-large_default/adaptador-de-conector-apple-md826zm-a.jpg', 49.9, 'Con el adaptador Lightning a AV Digital podrás convertir cualquier salida Lightning en un fabuloso conector HMDI para el TV y una salida USB-C para adaptarlo a todos aquellos dispositivos que no disponen de USB-C. Un adaptador muy útil que no te puede faltar.', 'Apple', 0),
(438, 'Adaptador Apple Lightning a Jack 3.5mm MMX62ZM/A', 'https://www.neobyte.es/16731-large_default/adaptador-lightning-apple-mmx62zm-a.jpg', 10.9, 'Adapta tus auriculares de toma jack 3.5mm con el adaptador Lightning a Jack 3.5mm. Con ello, podrás utilizar tus auriculares favoritos sin depender en exclusiva de los auriculares Apple. Una opción muy viable si ya tienes auriculares con anterioridad.', 'Apple', 0),
(439, 'Adaptador Apple USB-C a USB MJ1M2ZM/A', 'https://www.neobyte.es/16728-large_default/adaptador-apple-usb-c-a-usb-mj1m2zm-a.jpg', 23.9, '¿Cansado de tener un MacBook sin un puerto USB normal? Con el adaptador Apple USB-C a USB podrás conectar cualquier tipo de dispositivo USB convencional a un puerto USB-C, aprovechando la increible velocidad del nuevo conector USB-C. También dispones de la opción de conectarle un cable Lightning y cargar tu iPhone o iPad desde el MacBook. ¡Se te abre un nuevo mundo lleno de posibilidades!', 'Apple', 0),
(440, 'Apple Magic Keyboard - Teclado numérico', 'https://www.neobyte.es/7919-large_default/teclado-apple-magic-keyboard-mq052y-a.jpg', 120.9, 'Estilizado y con un diseño único, el teclado Apple Magic Keyboard con teclas numéricas ha sido fabricado con componentes de primerísima calidad para garantizar una extraordinaria durabilidad y un confort inigualable a la hora de escribir. Además, al integrar batería de larga duración y vincularse por Bluetooth, su utilización resulta sumamente versátil.', 'Apple', 0),
