(442, 'Apple Smart Keyboard Folio - Teclado para iPad Pro', 'https://www.neobyte.es/37920-large_default/apple-smart-keyboard-folio-ipad-pro-1-y-2-gen.jpg', 216.9, 'Apple Smart Keyboard Folio es un teclado de tamaño estándar para iPad Pro 11. Es también una funda que protege el dispositivo y sirve como soporte. Permite ajustar el ángulo de visión. Con acoplarlo al iPad ya es suficiente para empezar a usarlo.', 'Apple', 0),
(443, 'Cargador Apple MagSafe 2 85W', 'https://www.neobyte.es/14173-large_default/cargador-apple-magsafe-2-85w-md506z-a.jpg', 76.9, 'Apuesta por la fiabilidad del cargador Apple MagSafe 2 de 85W (MD506Z/A). Un modelo con conector magnético, que ayuda a establecer una conexión rápida y segura, prolonga la vida útil del cable y evita que el cable tiré del portátil si alguien se tropieza con él. Incluye un indicador LED para mostrar que el dispositivo se está cargando o que ha terminado de cargarse.', 'Apple', 0),
