(456, 'Apple USB Tipo C (140W) - Cargador para MacBook Pro', 'https://www.neobyte.es/88298-large_default/apple-usb-tipo-c-140w-cargador-para-macbook-pro.jpg', 90.9, 'Cargador Apple USB-C 140W para MacBook Pro', 'Apple', 0),
(457, 'Cargador Apple MagSafe 2 45W', 'https://www.neobyte.es/14169-large_default/cargador-apple-magsafe-2-45w-md592z-a.jpg', 76.9, 'El cargador original Apple MagSafe 2 de 45W (MD592Z/A) para MacBook Air ha sido provisto de un conector magnético que elimina la posibilidad de que alguien tropiece con el cable y tire el ordenador, a la vez que favorece una conexión rápida y segura y prolonga la vida útil del cable. Incluye, además, un indicador LED que muestra si el portátil se está cargando o si se ha terminado de cargar.', 'Apple', 0),
(458, 'Apple Superdrive - Grabadora USB', 'https://www.neobyte.es/14152-large_default/apple-usb-superdrive-md564zm-a.jpg', 82.9, 'La grabadora USB Apple SuperDrive (MD564ZM/A) te permitirá reproducir tus CD’s y DVD’s conectándola a tu iMac de una forma fácil. Un modelo que presenta un diseño elegante y compacto, un bajo consumo (por lo que no utiliza cargador externo) y, en Neobyte, un precio fantástico.', 'Apple', 0),
(459, 'Adaptador Lightning a Jack 3.5mm (1.2m) - Cable', 'https://www.neobyte.es/88343-large_default/adaptador-lightning-a-jack-35mm-12m-cable.jpg', 36.91, 'Adaptador Lightning a Jack 3.5mm 1.2m', 'Apple', 0),
(460, 'Asus VivoBook M1502YA-NJ151 - Portátil 15.6 Ryzen 7 7730U 16GB 512GB SSD', 'https://www.neobyte.es/101760-large_default/asus-vivobook-m1502ya-nj151-portatil-156-ryzen-7-7730u-16gb-512gb-ssd.jpg', 538.99, 'Con un diseño delgado y ligero, el Asus VivoBook es altamente portátil y fácil de llevar a cualquier lugar, sin comprometer su rendimiento. Además, ofrece una variedad de puertos, incluyendo USB, HDMI y lector de tarjetas SD, proporcionando opciones de conectividad versátiles para periféricos, pantallas externas y dispositivos de almacenamiento.', 'Asus', 0),
(461, 'Asus ROG Flow Z13 GZ301VV-MU007W - Portátil 13.4 i9 13900H 16GB RTX4060 1TB SSD W11', 'https://www.neobyte.es/89684-large_default/asus-rog-flow-z13-gz301vv-mu007w-portatil-134-i9-13900h-16gb-rtx4060-1tb-ssd-w11.jpg', 2158.99, '', 'Asus', 0),
(462, 'Asus TUF Dash F15 TUF507ZC4-HN040 - Portátil 15.6 i7-12700H 16GB RTX 3050 512GB SSD', 'https://www.neobyte.es/88771-large_default/asus-tuf-dash-f15-tuf507zc4-hn040-portatil-156-i7-12700h-16gb-rtx-3050-512gb-ssd.jpg', 838.99, 'La pantalla de 15.6 pulgadas Full HD con una alta frecuencia de actualización de 144Hz te sumerge en un mundo de imágenes nítidas y fluidas, maximizando tu experiencia gaming y proporcionando una ventaja competitiva en cada partida. Este portátil también se destaca por su conectividad versátil y su teclado retroiluminado con tecnología RGB, ofreciendo un control total sobre la iluminación y el ambiente mientras juegas.', 'Asus', 0),
(463, 'Asus VivoBook 15 F1504ZA-NJ700 - Portátil 15.6 i5-1235U 16GB 512GB SSD', 'https://www.neobyte.es/109094-large_default/asus-vivobook-15-f1504za-nj700-portatil-156-i5-1235u-16gb-512gb-ssd.jpg', 518.99, 'El ASUS VivoBook 15 F1504ZA-NJ700 es un portátil elegante y eficiente con una pantalla de 15.6 Full HD que ofrece una resolución nítida de 1920 x 1080 píxeles. Equipado con un potente procesador Intel Core i5-1235U y respaldado por 16GB de RAM DDR4, garantiza un rendimiento sólido para tareas variadas. Con una capacidad de almacenamiento de 512 GB en un SSD, proporciona velocidad en el acceso a los datos. Los gráficos Intel Iris Xe Graphics mejoran la experiencia visual. Presenta un diseño en color plata fría y un peso de 1.7 kg, lo que lo hace portátil y estéticamente atractivo.', 'Asus', 0),
(464, 'Asus VivoBook 15 F1504ZA-NJ710 - Portátil 15.6 i7-1255U 16GB 512GB SSD', 'https://www.neobyte.es/109101-large_default/asus-vivobook-15-f1504za-nj710-portatil-156-i7-1255u-16gb-512gb-ssd.jpg', 599, 'El almacenamiento de 512 GB en un SSD asegura una respuesta rápida y accesibilidad ágil a tus datos. Con gráficos Intel Iris Xe, disfrutarás de una calidad visual excepcional. Su diseño en color plata fría le confiere un aspecto elegante. Con un peso de 1.7 kg, es ligero y fácil de transportar. Viene sin sistema operativo preinstalado, brindándote flexibilidad. El teclado QWERTY español completa esta opción versátil y potente para tus necesidades informáticas.', 'Asus', 0),
(465, 'Asus VivoBook 16X K3605ZC-PL361W - Portátil 16 i5-12500H 16GB RTX 3050 512GB SSD W11', 'https://www.neobyte.es/109108-large_default/asus-vivobook-16x-k3605zc-pl361w-portatil-16-i5-12500h-16gb-rtx-3050-512gb-ssd-w11.jpg', 939, 'Gracias a la combinación de la potencia gráfica NVIDIA GeForce RTX 3050 de 4 GB, este portátil garantiza un rendimiento gráfico excepcional para tus actividades multimedia y juegos. Viene con el sistema operativo Windows 11 Home preinstalado, ofreciendo una experiencia de usuario intuitiva y moderna.', 'Asus', 0);
INSERT INTO `producto` (`id`, `nombre`, `imagen`, `precio`, `especificaciones`, `marca`, `id_categoria`) VALUES
(466, 'Asus TUF Gaming F17 TUF707VI-HX049 - Portátil 17.3 IPS i7-13620H RTX 4070 32GB SSD', 'https://www.neobyte.es/109125-large_default/asus-tuf-gaming-f17-tuf707vi-hx049-portatil-173-ips-i7-13620h-rtx-4070-32gb-ssd.jpg', 1648.99, 'Sorpréndete con el rendimiento potente y la inmersión visual gracias al portátil ASUS TUF Gaming F17 TUF707VI-HX049. Equipado con un procesador Intel Core i7-13620H y una tarjeta gráfica NVIDIA RTX 4070 de 8GB, este portátil ofrece un rendimiento excepcional para tus sesiones de juego intensivas y tareas multitarea. La pantalla de 17.3 Full HD con una frecuencia de actualización de 144Hz te sumerge en un mundo visual vibrante y fluido. Con 32GB de RAM DDR5 y un SSD de 1TB, disfrutarás de una respuesta rápida y tiempos de carga instantáneos. Además, el diseño robusto y elegante en color Mecha Gray, junto al teclado retroiluminado y de formato completo, complementan la experiencia de juego y productividad. Con el ASUS TUF Gaming F17, lleva tus sesiones de juego y trabajo al siguiente nivel.', 'Asus', 0),
(467, 'Asus ROG Strix G18 G814JIR-N6002 - Portátil 18 i9-14900HX 32GB RTX 4070 1TB SSD', 'https://www.neobyte.es/109659-large_default/asus-rog-strix-g18-g814jir-n6002-portatil-18-i9-14900hx-32gb-rtx-4070-1tb-ssd.jpg', 2299, 'Para una experiencia de juego verdaderamente inmersiva, ofrece una pantalla de 18 pulgadas con resolución WQXGA de 240 Hz. Estas pantallas no solo proporcionan una calidad de imagen excepcional, sino que también cuentan con una relación pantalla-cuerpo del 89%, asegurando que cada detalle en el juego se muestre con la máxima claridad y vivacidad.', 'Asus', 0),
(468, 'Asus ZenBook 14 OLED UX3405MA-PP606W - Portátil 14 U7-155H 16GB 512GB W11', 'https://www.neobyte.es/110108-large_default/asus-zenbook-14-oled-ux3405ma-pp606w-portatil-14-u7-155h-16gb-512gb-w11.jpg', 1229, 'Sumérgete en la sofisticación incomparable del ZenBook 14 OLED, un ultraportátil artesanal que redefine la elegancia. Potencia tu productividad y entretenimiento con el rendimiento excepcional del procesador Intel Core Ultra Meteor Lake y los gráficos Intel Arc. Disfruta de una experiencia visual cautivadora en la pantalla ASUS Lumina OLED de 14 pulgadas con una sorprendente resolución WQXGA+ (3K) y una frecuencia de actualización de 120Hz. Experimenta la durabilidad y confiabilidad de este exclusivo portátil, optimizado para la eficiencia y diseñado con materiales sostenibles que buscan reducir el impacto ambiental. Además, goza de una conectividad perfecta a través de los puertos más demandados (Thunderbolt, HDMI...), . Eleva tu jornada con la batería de larga duración y sumérgete en la elegancia ecológica de un diseño amigable con el medio ambiente, reflejando el compromiso con la equidad y la sostenibilidad.', 'Asus', 0),
(469, 'Asus VivoBook 15 P1502CZA-EJ1736X - Portátil 15.6 i5-1235U 16GB 512GB SSD W11', 'https://www.neobyte.es/105517-large_default/asus-vivobook-15-p1502cza-ej1736x-portatil-156-i5-1235u-16gb-512gb-ssd-w11.jpg', 589.9, 'Este portátil encarna la elegancia y modernidad en su diseño, destacándose particularmente por su acabado en un tranquilo y sofisticado tono Azul (Quiet Blue). Esta tonalidad no solo aporta un toque de serenidad visual, sino que también refleja una estética contemporánea, haciendo del portátil una pieza distintiva tanto en ambientes profesionales como personales. Su diseño, enfocado en líneas limpias y una estructura minimalista, complementa perfectamente la funcionalidad con un estilo visualmente atractivo y profesional.', 'Asus', 0),
(470, 'Asus ZenBook 14 OLED UX3402VA-KM004W Portátil 14 i5-1340P 16GB 512GB W11', 'https://www.neobyte.es/89950-large_default/asus-zenbook-14-oled-ux3402va-km004w-portatil-14-i5-1340p-16gb-512gb-w11.jpg', 858.99, '', 'Asus', 0),
(471, 'Asus VivoBook S14 Flip TP3402VA-LZ273W - Portátil 14 i5-1335U 16GB 512GB SSD W11', 'https://www.neobyte.es/109512-large_default/asus-vivobook-s14-flip-tp3402va-lz273w-portatil-14-i5-1335u-16gb-512gb-ssd-w11.jpg', 788.99, 'Explora la versatilidad con el ASUS VivoBook S 14 Flip TP3402VA-LZ273W. Este portátil convertible te ofrece un rendimiento excepcional con un procesador Intel Core i5-1335U, 16 GB de RAM y un almacenamiento SSD de 512 GB. La pantalla táctil WUXGA de 14 proporciona una experiencia visual inmersiva con una resolución de 1920 x 1200 píxeles. Diseñado en elegante color plateado, este híbrido combina estilo y funcionalidad. Con teclado en español y Windows 11 Home preinstalado, disfruta de la comodidad y la eficiencia en cualquier modo que elijas. ¡Convierte tus ideas en realidad con este portátil convertible!', 'Asus', 0),
(472, 'Asus TUF Gaming F15 TUF507VV-LP193 - Portátil 15.6 i7-13620H 16GB RTX 4060 1TB SSD', 'https://www.neobyte.es/109337-large_default/asus-tuf-gaming-f15-tuf507vv-lp193-portatil-156-i7-13620h-16gb-rtx-4060-1tb-ssd.jpg', 1348.99, 'Experimenta el rendimiento imparable con el ASUS TUF Gaming F15 TUF507VV-LP193. Este portátil gaming de 15.6 Full HD 144Hz presenta un potente Intel Core i7-13620H, 16GB de RAM, y un SSD de 1TB. Ya seas creador de contenido o te guste jugar, te encantará su gráfica NVIDIA GeForce RTX 4060. ¡Da la bienvenida a tu plataforma en gaming!', 'Asus', 0),
(473, 'Asus ZenBook 15 OLED UM3504DA-MA286W - Portátil 15.6 Ryzen 7 7735U 16GB 512GB SSD W11', 'https://www.neobyte.es/105069-large_default/asus-zenbook-15-oled-um3504da-ma286w-portatil-156-ryzen-7-7735u-16gb-512gb-ssd-w11.jpg', 988.99, 'En resumen, el Asus ZenBook 15 OLED UM3504DA-MA286W, destaca por su combinación de portabilidad, sostenibilidad y rendimiento excepcional. Desde su pantalla OLED a 120 Hz hasta su diseño elegante y su capacidad para conquistar cualquier tarea, este ultraportátil ofrece una experiencia única para aquellos que buscan lo mejor en tecnología.', 'Asus', 0),
(474, 'Asus VivoBook F1502ZA-EJ1121 - Portátil 15.6 i5-1235U 8GB 512GB SSD', 'https://www.neobyte.es/110171-large_default/asus-vivobook-f1502za-ej1121-portatil-156-i5-1235u-8gb-512gb-ssd.jpg', 448.99, 'El diseño delgado y ligero del Asus VivoBook lo hace fácil de transportar, siendo ideal para usuarios que necesitan movilidad sin comprometer el rendimiento.', 'Asus', 0),
(475, 'Asus VivoBook F1502ZA-EJ1121 - Portátil 15.6 i5-1235U 16GB 512GB SSD', 'https://www.neobyte.es/110172-large_default/asus-vivobook-f1502za-ej1121-portatil-156-i5-1235u-16gb-512gb-ssd.jpg', 478.99, 'Este modelo de VivoBook ofrece una variedad de puertos para conectividad, incluyendo puertos USB, HDMI y un lector de tarjetas. Además, su batería de larga duración brinda una autonomía adecuada para un uso diario prolongado, y su teclado ergonómico mejora la experiencia de escritura.', 'Asus', 0),
(476, 'Asus VivoBook Go E1504FA-NJ313 - Portátil 15.6 Ryzen 5 7520U 8GB 512GB SSD', 'https://www.neobyte.es/101079-large_default/asus-vivobook-go-e1504fa-nj313-portatil-156-ryzen-5-7520u-8gb-512gb-ssd.jpg', 408.99, 'Con un diseño delgado y ligero, el Asus VivoBook Go E1504FA-NJ313 es altamente portátil, perfecto para usuarios que necesitan llevar su computadora a cualquier lugar con facilidad. Ademas, ofrece una amplia gama de puertos, incluyendo USB, HDMI y Wi-Fi, brindando opciones de conectividad versátiles para periféricos, pantallas externas y una conexión a internet estable.', 'Asus', 0),
(477, 'Asus Vivobook 16X K3605ZC-N1268W - Portátil 16 i5-12450H 16GB 512GB SSD W11', 'https://www.neobyte.es/104786-large_default/asus-vivobook-16x-k3605zc-n1268w-portatil-16-i5-12450h-16gb-512gb-ssd-w11.jpg', 799, 'Con un diseño delgado y elegante, el Asus Vivobook 16X K3605ZC-N1268W es altamente portátil y presenta un aspecto moderno, perfecto para usuarios que valoran el rendimiento y la estética. Con una variedad de puertos USB, HDMI y Wi-Fi 6, este portátil ofrece opciones de conectividad versátiles para periféricos, pantallas externas y una conexión a internet rápida y estable.', 'Asus', 0),
(478, 'Asus Vivobook 16X K3605ZC-N1270W - Portátil 16 i7-12650H 16GB RTX 3050 512GB SSD W11', 'https://www.neobyte.es/104793-large_default/asus-vivobook-16x-k3605zc-n1270w-portatil-16-i7-12650h-16gb-rtx-3050-512gb-ssd-w11.jpg', 898.99, 'Con 16GB de memoria RAM DDR4, este portátil garantiza un rendimiento multitarea sin interrupciones, permitiendo trabajar en varios programas al mismo tiempo sin comprometer la velocidad ni la respuesta del sistema.', 'Asus', 0),
(479, 'Asus ExpertBook B1502CBA-EJ0438W - Portátil 15.6 i5-1235U 16GB 512GB SSD W11', 'https://www.neobyte.es/93429-large_default/asus-expertbook-b1502cba-ej0438w-portatil-156-i5-1235u-16gb-512gb-ssd-w11.jpg', 580.9, 'PORTATIL ASUS EXPERTBOOK B1502CBA-EJ0438W', 'Asus', 0),
(480, 'Asus Laptop E510MA-EJ617 - Portátil 15.6 Celeron N4020 8GB 256GB SSD', 'https://www.neobyte.es/93920-large_default/asus-laptop-e510ma-ej617-portatil-156-celeron-n4020-8gb-256gb-ssd.jpg', 267.89, 'PORTATIL ASUS LAPTOP E510MA-EJ617', 'Asus', 0),
(481, 'Asus ChromeBook Flip CR1 CR1100FKA-BP0568 - Portátil 11.6 Celeron N5100 8GB 64GB eMMC', 'https://www.neobyte.es/111653-large_default/asus-chromebook-flip-cr1-cr1100fka-bp0568-portatil-116-celeron-n5100-8gb-64gb-emmc.jpg', 356.9, 'Descubre el ASUS Chromebook Flip CR1100FKA-BP0568, un portátil diseñado específicamente para estudiantes que buscan rendimiento a un precio asequible. Este Chromebook presenta una construcción robusta que puede soportar el uso diario en entornos educativos, junto con la protección antibacteriana de ASUS para salvaguardar a los estudiantes contra organismos dañinos. Su diseño modular facilita el mantenimiento y la inscripción sin intervención en redes, convirtiéndolo en una opción inteligente para escuelas y aulas. Equipado con funciones como Wi-Fi 6, Buetooth y una batería de larga duración, el ASUS Chromebook Flip CR1 permite un aprendizaje continuo y sin interrupciones. Descubre la combinación perfecta de practicidad y rendimiento para los estudiantes en este portátil convertible que destaca en entornos educativos.', 'Asus', 0),
(482, 'Asus VivoBook 15 F1504ZA-NJ694W - Portátil 15.6 i5-1235U 8GB 512GB SSD W11', 'https://www.neobyte.es/109358-large_default/asus-vivobook-15-f1504za-nj694w-portatil-156-i5-1235u-8gb-512gb-ssd-w11.jpg', 530.9, '', 'Asus', 0),
(483, 'Asus Laptop F1500EA-EJ3095W - Portátil 15.6 i3-1115G4 8GB 256GB SSD W11', 'https://www.neobyte.es/92277-large_default/asus-laptop-f1500ea-ej3095w-portatil-156-i3-1115g4-8gb-256gb-ssd-w11.jpg', 391.89, 'Este portátil facilita la conectividad a través de su puerto USB-C 3.2, puertos USB 3.2 Tipo A y USB 2.0, y salida HDMI, permitiendo la conexión fácil con una variedad de dispositivos y periféricos. Además, cuenta con características de seguridad mejoradas y y un chasis reforzado que asegura la durabilidad del portátil en el uso cotidiano. Estas características combinan una conectividad sin problemas con una robustez confiable, adecuadas tanto para el trabajo como para el ocio.', 'Asus', 0),
(484, 'Asus VivoBook 15 F1504ZA-NJ698 - Portátil 15.6 i5-1235U 8GB 512GB SSD', 'https://www.neobyte.es/109317-large_default/asus-vivobook-15-f1504za-nj698-portatil-156-i5-1235u-8gb-512gb-ssd.jpg', 484.9, '', 'Asus', 0),
(485, 'Asus Vivobook Go E1504FA-NJ158W - Portátil 15.6 Ryzen 5 7520U 8GB 512GB SSD W11', 'https://www.neobyte.es/93906-large_default/asus-vivobook-go-e1504fa-nj158w-portatil-156-ryzen-5-7520u-8gb-512gb-ssd-w11.jpg', 450.89, 'PORTATIL ASUS VIVOBOOK GO E1504FA-NJ158W', 'Asus', 0),
(486, 'Asus Expertbook B9 B9400CBA-KC0686X - Portátil 14 i5-1235U 16GB 512GB SSD W11', 'https://www.neobyte.es/93121-large_default/asus-expertbook-b9-b9400cba-kc0686x-portatil-14-i5-1235u-16gb-512gb-ssd-w11.jpg', 1048.9, 'PORTATIL ASUS EXPERTBOOK B9 B9400CBA-KC0686X', 'Asus', 0),
(487, 'Asus VivoBook 15 F1504ZA-NJ706W - Portátil 15.6 i7-1255U 16GB 512GB SSD W11', 'https://www.neobyte.es/109373-large_default/asus-vivobook-15-f1504za-nj706w-portatil-156-i7-1255u-16gb-512gb-ssd-w11.jpg', 711.9, 'El ASUS VivoBook 15 F1504ZA-NJ706W es como ese amigo o amiga que siempre tiene todo a la mano. Con su pantalla 15.6 con resolución FULL HD (1920x1080), un procesador Intel Core i7-1255U que es puro músculo, 16GB de RAM y 512GB de SSD para que guardes lo que quieras. Viene con Windows 11 Home y un teclado elegante en color plateado. Con tan solo un peso de 1.7 kg, este portátil es como el mejor amigo al que puedes llevarte a todas tus batallas.', 'Asus', 0),
(488, 'Asus Expertbook B1 B1502CBA-NJ1108X - Portátil 15.6 i3-1215U 8GB 256GB SSD W11', 'https://www.neobyte.es/93168-large_default/asus-expertbook-b1-b1502cba-nj1108x-portatil-156-i3-1215u-8gb-256gb-ssd-w11.jpg', 467.89, 'PORTATIL ASUS EXPERTBOOK B1 B1502CBA-NJ1108X', 'Asus', 0),
(489, 'Asus VivoBook 15 F1504ZA-NJ790 - Portátil 15.6 i3-1215U 8GB 512GB SSD', 'https://www.neobyte.es/109344-large_default/asus-vivobook-15-f1504za-nj790-portatil-156-i3-1215u-8gb-512gb-ssd.jpg', 387.9, '', 'Asus', 0),
(490, 'Asus VivoBook 15 F1502ZA-EJ1122 - Portátil 15.6 i7-1255U 16GB 512GB SSD', 'https://www.neobyte.es/105476-large_default/asus-vivobook-15-f1502za-ej1122-portatil-156-i7-1255u-16gb-512gb-ssd.jpg', 613.91, 'Disfruta de una experiencia visual inmersiva con la pantalla de bisel fino de 15,6 pulgadas, resolución Full HD y una luminosidad de 220 nits para una visualización clara y nítida.  Con una tasa de actualización de 60 Hz, la pantalla proporciona transiciones suaves para una experiencia visual más fluida. Además, cuenta con una amplia gama de colores NTSC del 45% para colores vibrantes y precisos.', 'Asus', 0),
(491, 'Asus ZenBook Pro Duo 15 OLED X582ZM-H2030W - Portátil 15 i7-12700H 32GB RTX3060 11TB SSD Windows 11', 'https://www.neobyte.es/80574-large_default/asus-zenbook-pro-duo-15-oled-x582zm-h2030w-portatil-15-i7-12700h-32gb-rtx3060-11tb-ssd-windows-11.jpg', 2711.9, 'El Asus ZenBook Pro Duo 15 OLED X582ZM-H2030W es el portátil del futuro y ya puede ser tuyo en Neobyte. Con unas especificaciones técnicas de infarto y la última tecnología en material de productividad y rendimiento, se convertirá en objeto de deseo de diseñadores, editores, creadores y todo tipo de profesionales. Entre sus principales ventajas destacar la espectacular pantalla táctil OLED con resolución 4K y 15.6 de tamaño. Ésta está complementada por un panel secundario que permite acceder a multitud de funcionalidades enfocadas a agilizar el flujo de trabajo y, en definitiva, a brindar una experiencia de uso insuperable. A estas prestaciones hay que añadir una conectividad de vanguardia y un diseño ergonómico.', 'Asus', 0),
(492, 'Acer Extensa 15 EX215-55-58PX - Portátil 15.6 i5-1235U 8GB 512GB SSD W11', 'https://www.neobyte.es/107144-large_default/acer-extensa-15-ex215-55-58px-portatil-156-i5-1235u-8gb-512gb-ssd-w11.jpg', 525.9, 'La pantalla Full HD de 15.6 pulgadas con tecnología ComfyView, ofrece imágenes nítidas y colores vibrantes, lo que mejora significativamente la experiencia visual en cualquier actividad. La conectividad también es una fortaleza clave de este dispositivo, con tres puertos USB 3.2 de 1.ª generación y Wi-Fi 6 para una conexión a Internet rápida y estable. Además, su cámara web HD y micrófonos optimizados elevan la calidad de las videollamadas, haciéndolo ideal para conferencias en línea o charlas con amigos y familiares. Con Windows 11 Home como sistema operativo, el Extensa 15 ofrece una experiencia de usuario intuitiva y accesible.', 'Acer', 0),
(493, 'Acer Extensa 15 EX215-55-37QA - Portátil 15.6 i3-1215U 8GB 256GB SSD W11', 'https://www.neobyte.es/107108-large_default/acer-extensa-15-ex215-55-37qa-portatil-156-i3-1215u-8gb-256gb-ssd-w11.jpg', 387.9, 'Pensando en el mundo del trabajo remoto y las conferencias en línea, este modelo incluye una cámara web HD y un micrófono optimizado. Los altavoces integrados aseguran una comunicación clara, haciendo de cada videoconferencia una experiencia más envolvente y eficiente. Esta combinación de herramientas de comunicación se convierte en un aliado fundamental para reuniones virtuales y colaboración a distancia, facilitando la conexión con colegas y clientes de manera efectiva.', 'Acer', 0),
