(527, 'Lenovo V15 G3 ABA 82TV006BSP - Portátil 15.6 Ryzen 5825U 16GB 512GB SSD W11', 'https://www.neobyte.es/105036-large_default/lenovo-v15-g3-aba-82tv006bsp-portatil-156-ryzen-5825u-16gb-512gb-ssd-w11.jpg', 601.9, 'Equipado con un procesador AMD Ryzen 7 5825U, gráficos de alta velocidad y 16GB de memoria RAM y almacenamiento SSD de 512GB, ofrece un rendimiento excepcional a un costo competitivo. Los usuarios pueden acceder rápidamente a sus periféricos y redes gracias a la variedad de puertos de E/S estándar, incluido USB tipo C y HDMI. La seguridad de nivel empresarial protege los datos confidenciales con funciones como el obturador de privacidad de la cámara, mientras Windows 11 Home facilita la colaboración.', 'Lenovo', 0),
(528, 'Lenovo V15 G2 ALC 82KD00EJSP - Portátil 15.6 Ryzen 5 5500U 8GB 512GB SSD Windows 11', 'https://www.neobyte.es/84469-large_default/lenovo-v15-g2-alc-82kd00ejsp-portatil-156-ryzen-5-5500u-8gb-512gb-ssd-windows-11.jpg', 472.9, 'Su diseño contemporáneo y su cuerpo fino lo convierten en un portátil de alta calidad perfecto para llevar contigo a cualquier lugar. La pantalla FHD de 39,62 cm (15,6) ofrece imágenes nítidas y colores vibrantes.', 'Lenovo', 0),
(529, 'Lenovo ThinkPad Z13 Gen 1 - Portátil 13.3 AMD Ryzen 7 PRO 6850U 16GB 512GB SSD W11', 'https://www.neobyte.es/79591-large_default/lenovo-thinkpad-z13-gen-1-portatil-133-amd-ryzen-7-pro-6850u-16gb-512gb-ssd-w11.jpg', 1626.91, 'El Lenovo ThinkPad Z13 Gen 1 (21D20014SP) ha sido diseñado para aportar comodidad y eficiencia a las tareas informáticas diarias. Por un precio más que razonable, este portátil de 13.3 ofrece una pantalla Full HD, sistema operativo Windows 11 Pro y una conectividad versátil para fomentar un estilo de vida dinámico. En cuanto a hardware, viene equipado con un procesador AMD Ryzen 7 PRO 6850U y 8GB de RAM que se complementan a la perfección con un SSD de 512GB para garantizar arranques rápidos y un óptimo rendimiento en programas de nivel básico.', 'Lenovo', 0),
(530, 'Lenovo V15 G2 ITL 82KB015XSP - Portátil 15.6 i7-1165G7 16GB 512GB SSD W11', 'https://www.neobyte.es/105991-large_default/lenovo-v15-g2-itl-82kb015xsp-portatil-156-i7-1165g7-16gb-512gb-ssd-w11.jpg', 691.9, 'Diseñado para el lugar de trabajo moderno, este portátil es un compañero versátil tanto en la oficina como en casa. Su diseño compacto y ligero facilita la movilidad diaria. En cuanto a conectividad, ofrece una amplia variedad de puertos, incluyendo HDMI y USB 3.2 Tipo C, proporcionando opciones eficientes para conectar dispositivos externos. Con Wi-Fi 5 y Bluetooth, garantiza una conectividad sin complicaciones en cualquier entorno.', 'Lenovo', 0),
(531, 'Lenovo ThinkPad Z16 Gen 1 - Portátil 16 AMD Ryzen 7 PRO 6850H 16GB 512GB SSD Windows 11 Pro', 'https://www.neobyte.es/79596-large_default/lenovo-thinkpad-z16-gen-1-portatil-16-amd-ryzen-7-pro-6850h-16gb-512gb-ssd-windows-11-pro.jpg', 1741.9, 'Con el Lenovo ThinkPad Z16 Gen 1 (21D40018SP) no habrá quien ponga freno a tu productividad. Elegante y compacto, este portátil cuenta con el tamaño perfecto y las prestaciones adecuadas para que puedas desempeñar tu trabajo desde cualquier lugar. Entre sus características más destacadas se encuentra una pantalla de 16 Full HD con tecnología antirreflejos y una configuración muy completa con procesador AMD Ryzen 7 PRO 6850H, 16GB de RAM y 512GB de SSD. Además, incluye el útil sistema operativo Windows 11 Home.', 'Lenovo', 0),
(532, 'Lenovo V15 G3 ABA 82TV006CSP - Portátil 15.6 Ryzen 7 5825U 16GB 512GB SSD', 'https://www.neobyte.es/105986-large_default/lenovo-v15-g3-aba-82tv006csp-portatil-156-ryzen-7-5825u-16gb-512gb-ssd.jpg', 542.9, 'La seguridad se sitúa en primer plano con funciones de nivel empresarial que incorporan un obturador de privacidad para la cámara. Además, gracias a sus micrófonos eficientes, asegura una experiencia mejorada, contribuyendo a la creación de un entorno centrado y productivo para todos los participantes.', 'Lenovo', 0),
(533, 'Lenovo V15 G3 ABA 82TV006ESP - Portátil 15.6 Ryzen 5625U 8GB 512GB SSD', 'https://www.neobyte.es/89908-large_default/lenovo-v15-g3-aba-82tv006esp-portatil-15-6-ryzen-5625u-8gb-512gb-ssd.jpg', 437.9, 'Lenovo V15 G3 ABA 82TV006ESP - Portátil 15.6 Ryzen 5625U 8GB 512GB SSD', 'Lenovo', 0),
(534, 'Lenovo V15 G3 IAP 82TT00C2SP - Portátil 15.6 i5-1235U 8GB 512GB SSD', 'https://www.neobyte.es/107376-large_default/lenovo-v15-g3-iap-82tt00c2sp-portatil-156-i5-1235u-8gb-512gb-ssd.jpg', 535.9, 'Con un diseño elegante en color Business Black y un acabado texturizado especial, este modelo no solo es atractivo, sino también práctico. La webcam HD con cubierta de privacidad protege la seguridad del usuario en el entorno digital. El sistema de audio, con altavoces de 1.5W y tecnología Dolby Audio, ofrece una experiencia sonora inmersiva. Además, su teclado completo proporciona comodidad y eficiencia en la escritura, y la batería de 38Wh garantiza una duración adecuada para acompañar las jornadas laborales o académicas.', 'Lenovo', 0),
(535, 'Lenovo V15 G3 IAP 82TT008SSP - Portátil 15.6 i5-1235U 8GB 256GB SSD', 'https://www.neobyte.es/101872-large_default/lenovo-v15-g3-iap-82tt008ssp-portatil-156-i5-1235u-8gb-256gb-ssd.jpg', 447.91, 'Este modelo se caracteriza por su diseño compacto y ligero, lo que lo convierte en un portátil ideal para llevarlo contigo a cualquier lugar. Su elegante acabado en negro Business Black con textura especial le da un toque profesional.', 'Lenovo', 0),
(536, 'Lenovo V15 G3 IAP 82TT00FESP - Portátil 15.6 i3-1215U 8GB 256GB SSD', 'https://www.neobyte.es/106001-large_default/lenovo-v15-g3-iap-82tt00fesp-portatil-156-i3-1215u-8gb-256gb-ssd.jpg', 380.9, 'El diseño compacto y ligero de este equipo lo convierte en un compañero ideal para la movilidad diaria. La batería de 38Wh, asegura una buena autonomía, brindando la libertad de trabajar o estudiar en movimiento sin preocupaciones. Este portátil no solo ofrece rendimiento, sino que también se presenta como una opción elegante y funcional para aquellos que buscan un dispositivo versátil y equilibrado.', 'Lenovo', 0),
(537, 'Lenovo V15 IGL 82C3008XSP - Portátil 15.6 N4020 8GB 256GB SSD', 'https://www.neobyte.es/84397-large_default/lenovo-v15-igl-82c3008xsp-portatil-156-n4020-8gb-256gb-ssd.jpg', 258.9, 'El Lenovo V15 IGL 82C3008XSP es un portátil asequible con lo esencial para el día a día. Provisto de procesador Intel Celeron, 8GB de RAM, SSD de 256GB y todos los puertos necesarios para la conexión de tus dispositivos y periféricos, te da mucho más de lo que esperas por menos de lo que imaginas. Por ello, es una opción perfecta para estudiantes y usuarios que busquen una laptop para navegar, consultar información, visualizar fotos y vídeo...', 'Lenovo', 0),
(538, 'Lenovo V15 G2 ALC 82KD00EESP - Portátil 15.6 Ryzen 7 5700U 8GB 512GB SSD Windows 11', 'https://www.neobyte.es/84476-large_default/lenovo-v15-g2-alc-82kd00eesp-portatil-156-ryzen-7-5700u-8gb-512gb-ssd-windows-11.jpg', 497.9, 'El V15 G2 protege tus datos con el firmware TPM 2.0 y un obturador físico para la cámara web. Además, cuenta con múltiples puertos USB y HDMI para que puedas conectar todos tus dispositivos.', 'Lenovo', 0),
(539, 'MSI Modern 15 B7M-059XES - Portátil 15.6 Ryzen 5 7530U 16GB 512GB SSD', 'https://www.neobyte.es/96224-large_default/msi-modern-15-b7m-059xes-portatil-156-ryzen-5-7530u-16gb-512gb-ssd.jpg', 549.9, 'MSI Modern 15 B7M-059XES - Portátil 15.6 Ryzen 5 7530U 16GB 512GB SSD', 'MSI', 0),
(540, 'MSI Thin GF63 12VE-010XES - Portátil 15.6 i7-12650H 16GB RTX 4050 512GB SSD', 'https://www.neobyte.es/96383-large_default/msi-thin-gf63-12ve-010xes-portatil-156-i7-12650h-16gb-rtx-4050-512gb-ssd.jpg', 1066.91, 'MSI Thin GF63 12VE-010XES - Portátil 15.6 Intel Core i7 12650H 16GB RTX 4050 512GB SSD', 'MSI', 0),
(541, 'MSI Modern 14 C7M-044XES - Portátil 14 Ryzen 5 7530U 8GB 512GB SSD', 'https://www.neobyte.es/96228-large_default/msi-modern-14-c7m-044xes-portatil-14-ryzen-5-7530u-8gb-512gb-ssd.jpg', 518.9, 'MSI Modern 14 C7M-044XES - Portátil 14 Ryzen 5 7530U 8GB 512GB SSD', 'MSI', 0),
(542, 'MSI Katana 17 B13VFK-087ES - Portátil 17 i7-13620H 16GB RTX4060 1TB SSD W11', 'https://www.neobyte.es/89652-large_default/msi-katana-17-b13vfk-087es-portatil-17-i7-13620h-16gb-rtx4060-1tb-ssd-w11.jpg', 1354.9, 'Incorpora un teclado RGB de 4 zonas que ilumina las teclas WASD, creando así un ambiente inmersivo para una mejor experiencia de juego. La estética única de este modelo no solo refleja poder, sino que también ilumina tu camino en el mundo del gaming.', 'MSI', 0),
(543, 'MSI Summit E14 Flip EVO A13MT-227ES - Portátil 14 Intel Core i7 1360P 16GB 1TB SSD Windows 11', 'https://www.neobyte.es/96218-large_default/msi-summit-e14-flip-evo-a13mt-227es-portatil-14-intel-core-i7-1360p-16gb-1tb-ssd-windows-11.jpg', 1369.9, 'MSI Summit E14 A13MT-227ES - Portátil 14 Intel Core i7 1360P 16GB 1TB SSD Windows 11', 'MSI', 0),
(544, 'MSI Alpha 17 C7VG-018ES - Portátil 17.3 Ryzen 9 7945HX 32GB RTX 4070 1TB SSD W11', 'https://www.neobyte.es/110724-large_default/msi-alpha-17-c7vg-018es-portatil-173-ryzen-9-7945hx-32gb-rtx-4070-1tb-ssd-w11.jpg', 2074.9, 'El MSI Alpha 17 C7VG-018ES redefine el rendimiento portátil con los potentes procesadores Ryzen 9 7945HX de AMD y la gráfica NVIDIA GeForce RTX Serie 40. Diseñado para gamers y creadores exigentes, este portátil ofrece una experiencia visual asombrosa con la arquitectura Ada Lovelace para trazado de rayos y DLSS 3 basado en IA. Con tecnologías como NVIDIA Max-Q, Wi-Fi 7, y un diseño de refrigeración mejorado con Shared-Pipe y MSI Overboost, experimentarás un rendimiento óptimo y una experiencia de juego inigualable. Además, cuenta con características premium como teclado RGB por tecla de SteelSeries, audio Hi-Resolution, memoria DDR5 de alta velocidad, y una unidad SSD PCIe Gen.4 para acelerar tus tareas. El MSI Alpha 17 C7VG-018ES es la combinación perfecta de potencia, velocidad y estilo, con el exclusivo MSI Center para una personalización completa. Eleva tu juego y creatividad con este portátil de alto rendimiento, diseñado para destacar en todos los aspectos.', 'MSI', 0),
(545, 'MSI Stealth 14 Studio A13VG-047XES - Portátil 14 i7-13620H 32GB RTX 4070 1TB SSD', 'https://www.neobyte.es/101513-large_default/msi-stealth-14-studio-a13vg-047xes-portatil-14-i7-13620h-32gb-rtx-4070-1tb-ssd.jpg', 1875.9, 'MSI Stealth 14 Studio A13VG-047XES - Portátil 14 i7-13620H 32GB RTX 4070 1TB SSD', 'MSI', 0),
(546, 'MSI Modern 15 B13M-280XES - Portátil 15.6 i5-1335U 16GB 512GB SSD', 'https://www.neobyte.es/96773-large_default/msi-modern-15-b13m-280xes-portatil-156-i5-1335u-16gb-512gb-ssd.jpg', 669.9, 'MSI Modern 15 B13M-280XES - Portátil 15.6 Intel Core i5 1335U 16GB 512GB SSD', 'MSI', 0),
(547, 'MSI Creator Pro M16 B13VI-1023ES - Portátil i7-13700H 16GB RTX A1000 1TB SSD W11', 'https://www.neobyte.es/101608-large_default/msi-creator-pro-m16-b13vi-1023es-portatil-i7-13700h-16gb-rtx-a1000-1tb-ssd-w11.jpg', 1498.9, 'MSI Creator Pro M16 B13VI-1023ES - Portátil i7-13700H 16GB RTX A1000 1TB SSD W11', 'MSI', 0),
(548, 'MSI Modern 14 C12M-017XES - Portátil 14 i7 1255U 16GB 512GB SSD', 'https://www.neobyte.es/79335-large_default/msi-modern-14-c12m-017xes-portatil-14-i7-1255u-16gb-512gb-ssd.jpg', 646.9, 'El MSI Modern 14 C12M-017XES presume de una gran portabilidad y un óptimo rendimiento a un precio super competitivo. Diseñado para estudiantes y trabajadores, este portátil de 14 viene con una combinación muy potente de componentes que aseguran un desempeño de tareas fiable. Por ello, en su interior, encontramos un procesador Intel Core i7 1255U, 16GB de RAM y un SSD de 512GB. Asimismo, con su pantalla IPS con resolución Full HD es capaz de transmitir imágenes de calidad con una nitidez y claridad sorprendente.', 'MSI', 0),
(549, 'MSI Modern 14 C7M-055XES - Portátil 14 Ryzen 5 7530U 16GB 512GB SSD', 'https://www.neobyte.es/105857-large_default/msi-modern-14-c7m-055xes-portatil-14-ryzen-5-7530u-16gb-512gb-ssd.jpg', 617.9, 'MSI Modern 14 C7M-055XES - Portátil 14 Ryzen 5 7530U 16GB 512GB SSD', 'MSI', 0),
(550, 'MSI Thin GF63 12VE-092XES - Portátil 15.6 i5-12450H 16GB RTX 4050 1TB SSD', 'https://www.neobyte.es/96388-large_default/msi-thin-gf63-12ve-092xes-portatil-156-i5-12450h-16gb-rtx-4050-1tb-ssd.jpg', 843.9, 'MSI Thin GF63 12VE-092XES - Portátil 15.6 Intel Core i5 12450H 16GB RTX 4050 1TB SSD', 'MSI', 0),
(551, 'MSI Thin GF63 12UC-875XES - Portátil 15.6 i7-12650H 16GB RTX 3050 1TB SSD', 'https://www.neobyte.es/103864-large_default/msi-thin-gf63-12uc-875xes-portatil-15-6-i7-12650h-16gb-rtx-3050-1tb-ssd.jpg', 793.91, 'MSI Thin GF63 12UC-875XES - Portátil 15.6 i7-12650H 16GB RTX 3050 1TB SSD', 'MSI', 0),
(552, 'MSI Prestige 16 Studio A13VE-046XES - Portátil 16 i7-13700H 16GB RTX 4050 1TB SSD', 'https://www.neobyte.es/101646-large_default/msi-prestige-16-studio-a13ve-046xes-portatil-16-i7-13700h-16gb-rtx-4050-1tb-ssd.jpg', 1467.9, 'MSI Prestige 16 Studio A13VE-046XES - Portátil 16 i7-13700H 16GB RTX 4050 1TB SSD', 'MSI', 0),
(553, 'MSI Katana 15 B12VGK-026ES - Portátil 15.6 i7-12620H 16GB RTX 4070 512GB SSD W11', 'https://www.neobyte.es/96856-large_default/msi-katana-15-b12vgk-026es-portatil-156-i7-12620h-16gb-rtx-4070-512gb-ssd-w11.jpg', 1279.9, 'MSI Katana 15 B12VGK-026ES - Portátil 15.6 Intel Core i7 12620H 16GB RTX 4070 512GB SSD', 'MSI', 0),
(554, 'MSI Creator Pro M16 B13VK-1021ES - Portátil i7-13700H 32GB RTX A3000 1TB SSD W11', 'https://www.neobyte.es/102489-large_default/msi-creator-pro-m16-b13vk-1021es-portatil-i7-13700h-32gb-rtx-a3000-1tb-ssd-w11.jpg', 2150.9, 'MSI Creator Pro M16 B13VK-1021ES - Portátil i7-13700H 32GB RTX A3000 1TB SSD W11', 'MSI', 0),
(555, 'MSI Modern 14 C13M-426XES - Portátil 14 Intel Core i7 1355U 16GB 1TB SSD', 'https://www.neobyte.es/96358-large_default/msi-modern-14-c13m-426xes-portatil-14-intel-core-i7-1355u-16gb-1tb-ssd.jpg', 724.9, 'MSI Modern 14 C13M-426XES - Portátil 14 Intel Core i7 1355U 16GB 1TB SSD', 'MSI', 0),
(556, 'MSI Creator Pro Z16 HX Studio B13VKTO-085ES - Portátil 16 i7-13700HX 32GB RTX 3000 1TB SSD W11', 'https://www.neobyte.es/101597-large_default/msi-creator-pro-z16-hx-studio-b13vkto-085es-portatil-16-i7-13700hx-32gb-rtx-3000-1tb-ssd-w11.jpg', 2475.9, 'MSI Creator Pro Z16 HX Studio B13VKTO-085ES - Portátil 16 i7-13700HX 32GB RTX 3000 1TB SSD W11', 'MSI', 0),
(557, 'MSI Modern 15 B12M-025XES - Portátil 15 i5 1235U 8GB 512GB SSD', 'https://www.neobyte.es/79394-large_default/msi-modern-15-b12m-025xes-portatil-15-i5-1235u-8gb-512gb-ssd.jpg', 498.9, 'El MSI Modern 15 B12M-025XES sorprende por su diseño elegante, sus útiles prestaciones y su gran calidad de acabados. Hablamos de un portátil de 15 que sabe combinar una estética sutil con un potente interior, en el que destacan magníficos componentes como un procesador Intel Core i5 1235U, una RAM de 8GB y un sistema de almacenamiento SSD de 512GB. Perfecto para ser transportado a todas partes, este modelo cuenta con una gran capacidad de batería y una amplia conectividad. ¡Disfruta de él estés donde estés!', 'MSI', 0);
INSERT INTO `producto` (`id`, `nombre`, `imagen`, `precio`, `especificaciones`, `marca`, `id_categoria`) VALUES
(558, 'MSI Thin GF63 12VE-009XES - Portátil 15.6 i5-12450H 16GB RTX 4050 512GB SSD', 'https://www.neobyte.es/96404-large_default/msi-thin-gf63-12ve-009xes-portatil-156-i5-12450h-16gb-rtx-4050-512gb-ssd.jpg', 863.9, 'MSI Thin GF63 12VE-009XES - Portátil 15.6 Intel Core i5-12450H 16GB RTX 4050 512GB SSD', 'MSI', 0),
(559, 'MSI Vector 17 HX A14VHG-689ES - Portátil 17 i9-14900HX 32GB RTX 4080 1TB SSD W11', 'https://www.neobyte.es/111264-large_default/msi-vector-17-hx-a14vhg-689es-portatil-17-i9-14900hx-32gb-rtx-4080-1tb-ssd-w11.jpg', 2967.9, '¿Buscas el portátil gaming perfecto para llevar tu experiencia a nuevas alturas? Sumérgete en el rendimiento excepcional del MSI Vector 17 HX A14VHG-689ES, diseñado para entusiastas. Con un potente procesador Intel Core i9 14900HX, gráficos dedicados de la mano de NVIDIA, como la GeForce RTX 4080, y la tecnología MSI OverBoost Ultra, este portátil ofrece una experiencia de juego sin igual. Desde su teclado RGB personalizable hasta su conectividad Wi-Fi 7 y la calidad de audio Hi-Resolution con Nahimic in-game 3D surround, el MSI Vector 17 HX se destaca. Controla tu experiencia con el MSI Center y aprovecha la versatilidad de los puertos I/O completos. Eleva tu juego con esta combinación de potencia y funcionalidad, ¿listo para la próxima aventura gaming?', 'MSI', 0),
(560, 'MSI Raider GE78HX 13VH-413ES - Portátil i9-13980HX 32GB RTX4080 2TB W11', 'https://www.neobyte.es/101679-large_default/msi-raider-ge78hx-13vh-413es-portatil-i9-13980hx-32gb-rtx4080-2tb-w11.jpg', 2945.9, 'MSI Raider GE78HX 13VH-413ES - Portátil i9-13980HX 32GB RTX4080 2TB W11', 'MSI', 0),
(561, 'MSI Summit E16 Flip A13VET-083ES - Portátil 16 i7-1360P 32GB RTX 4050 1TB SSD W11', 'https://www.neobyte.es/96873-large_default/msi-summit-e16-flip-a13vet-083es-portatil-16-i7-1360p-32gb-rtx-4050-1tb-ssd-w11.jpg', 1826.89, 'MSI Summit E16 Flip A13VET-083ES - Portátil 16 Intel Core i7 1360P 32GB RTX 4050 1TB SSD', 'MSI', 0),
(562, 'MSI Raider GE68HX 13VG-043ES - Portátil 16 i7-13700HX 32GB RTX 4070 1TB SSD W11', 'https://www.neobyte.es/96336-large_default/msi-raider-ge68hx-13vg-043es-portatil-16-i7-13700hx-32gb-rtx-4070-1tb-ssd-w11.jpg', 2084.9, 'MSI Raider GE68HX 13VG-043ES - Portátil 16 Intel Core i7 13700HX 32GB RTX 4070 1TB SSD', 'MSI', 0),
(563, 'MSI Creator Pro Z16 HX Studio B13VJTO-200ES - Portátil 16 i7-13700HX 32GB RTX A2000 1TB SSD W11', 'https://www.neobyte.es/102482-large_default/msi-creator-pro-z16-hx-studio-b13vjto-200es-portatil-16-i7-13700hx-32gb-rtx-a2000-1tb-ssd-w11.jpg', 2540.9, 'MSI Creator Pro Z16 HX Studio B13VJTO-200ES - Portátil 16 i7-13700HX 32GB RTX A2000 1TB SSD W11', 'MSI', 0),
(564, 'MSI Creator Pro Z16 HX Studio B13VFTO-034ES - Portátil 16 i7-13700HX 32GB RTX 4060 1TB SSD W11', 'https://www.neobyte.es/101636-large_default/msi-creator-pro-z16-hx-studio-b13vfto-034es-portatil-16-i7-13700hx-32gb-rtx-4060-1tb-ssd-w11.jpg', 2176.9, 'MSI Creator Pro Z16 HX Studio B13VFTO-034ES - Portátil 16 i7-13700HX 32GB RTX 4060 1TB SSD W11', 'MSI', 0),
(565, 'MSI Stealth 16 Studio A13VG-034ES - Portátil 16 i7-13700H 32GB RTX 4070 1TB SSD W11', 'https://www.neobyte.es/108699-large_default/msi-stealth-16-studio-a13vg-034es-portatil-16-i7-13700h-32gb-rtx-4070-1tb-ssd-w11.jpg', 2166.9, 'Experimenta un rendimiento sin límites con 32 GB de memoria DDR5 y una unidad SSD de 1 TB. No es solo un portátil, es un espectáculo gráfico con la fusión perfecta entre los potentes gráficos NVIDIA GeForce RTX 4070. Windows 11, como sistema operativo, añade una capa de modernidad a este elegante dispositivo de color azul. ¡Hazte con la vanguardia de la informática y vive una experiencia que redefine tus estándares!', 'MSI', 0),
(566, 'MSI Modern 14 C12M-078XES - Portátil 14 i5 1235U 8GB 512GB SSD', 'https://www.neobyte.es/79411-large_default/msi-modern-14-c12m-078xes-portatil-14-i5-1235u-8gb-512gb-ssd.jpg', 479.9, 'El MSI Modern 14 C12M-078XES cuenta con un diseño ultracompacto y liviano, perfecto para ser transportado a todas partes y afrontar las tareas del día a día desde cualquier lugar. Este portátil sorprende tanto por su pantalla IPS de 14 capaz de alcanzar una resolución Full HD, como por su calidad de componentes, en los que destacan su procesador Intel Core i5 1235U, sus 8GB de RAM y su SSD de 512GB. En resumidas cuentas, se trata de un modelo ideal para los que buscan una herramienta eficaz a un precio competitivo.', 'MSI', 0),
(567, 'MSI Prestige 13 EVO A13M-032ES - Portátil 13.3 i7-1360P 16GB 1TB SSD', 'https://www.neobyte.es/96239-large_default/msi-prestige-13-evo-a13m-032es-portatil-133-i7-1360p-16gb-1tb-ssd.jpg', 1236.9, 'MSI Prestige 13 Evo A13M-032ES - Portátil 13.3 Intel Core i7 1360P 16GB 1TB SSD', 'MSI', 0),
