(576, 'HP 15S-EQ2133NS - Portátil 15 Ryzen 5 5500U 8GB 256GB SSD Windows 11 Home', 'https://www.neobyte.es/79188-large_default/hp-15s-eq2133ns-portatil-15-ryzen-5-5500u-8gb-256gb-ssd-windows-11-home.jpg', 466.9, 'El portátil HP 15S-EQ2133NS ha sido diseñado para convertirse en una herramienta de trabajo fácil de transportar. Un modelo que sabrán apreciar aquellos que mantienen un estilo de vida activo gracias a útiles características como su ligereza, su pantalla de 15 con calidad Full HD o su amplia suite de conexiones. Asimismo, en su aspecto más técnico, viene equipado con un potente procesador AMD Ryzen 5 5500U, 8GB de RAM y un SSD De 256GB así como sistema operativo Windows 11 Home preinstalado.', 'HP', 0),
(577, 'HP 15S-EQ2134NS - Portátil 15 Ryzen 5 5500U 8GB 512GB SSD Windows 11 Home', 'https://www.neobyte.es/80034-large_default/hp-15s-eq2134ns-portatil-15-ryzen-5-5500u-8gb-512gb-ssd-windows-11-home.jpg', 459.9, 'El HP 15S-EQ2134NS cuenta con avanzadas prestaciones preparadas para dar respuesta a todas tus necesidades informáticas estés donde estés. Hablamos de un portátil que reúne el equilibrio perfecto entre rendimiento y autonomía, con un diseño ligero y un hardware en el cual se encuentran como principales protagonistas un procesador AMD Ryzen 5 5500U, una memoria RAM de 8GB y un sistema de almacenamiento SSD de 512GB. Además, su pantalla de 15 Full HD ofrece una excelente calidad de visualización tanto en interiores como en exteriores.', 'HP', 0),
