(580, 'HP EliteBook 850 G8 - Portátil 15.6 i5 1135G7 8GB 256GB', 'https://www.neobyte.es/79879-large_default/hp-elitebook-850-g8-portatil-156-i5-1135g7-8gb-256gb.jpg', 739.9, 'El HP EliteBook 850 G8 está preparado para maximizar tu productividad sin tener que sacrificar un estilo de vida activo. Con un procesador Intel Core i5-1135G7, una RAM de 8GB y un sistema de almacenamiento SSD de 256GB, este portátil afronta con soltura tareas de exigencia media, proporcionando un entorno multitarea estable para que puedas navegar por internet, revisar emails, editar contenido o disfrutar de tus series favoritas con todas las garantías. Para añadir más utilidades a la lista, este modelo viene con Windows 10 Pro preinstalado y múltiples opciones de conectividad.', 'HP', 0),
(581, 'HP Pavilion 15-EG3007NS - Portátil 15.6 i5-1335U 16GB 512GB SSD W11', 'https://www.neobyte.es/103942-large_default/hp-pavilion-15-eg3007ns-portatil-156-i5-1335u-16gb-512gb-ssd-w11.jpg', 753.9, 'HP Pavilion Laptop 15-EG3007NS Portátil 15.6 Intel Core i5 1335U 16GB 512GB', 'HP', 0),
(582, 'HP 15S-EQ2095NS - Portátil 15 Ryzen 5 5500U 8GB 512GB SSD Windows 11', 'https://www.neobyte.es/68605-large_default/hp-15s-eq2095ns-portatil-15-ryzen-5-5500u-8gb-512gb-ssd-windows-11.jpg', 517.9, 'El HP 15S-EQ2095NS es el portátil todoterreno que necesitas para tu día a día. Gracias a su diseño moderno, múltiples puertos y completa conectividad, es perfecto para utilizarlo en cualquier momento y lugar. Además, cuenta con una relación calidad-precio difícil de superar. En este sentido, señalar que el HP 15S-EQ2095NS ha sido provisto de procesador AMD Ryzen 5 5500U de 6 núcleos, 8GB de RAM y SSD de 512GB. Si a estas especificaciones le sumamos Windows 11 Home, el resultado es un portátil llamado a convertirse en un top ventas.', 'HP', 0),
(583, 'HP 15S-FQ4108NS - Portátil 15 i7-1195G7 8GB 512GB SSD FreeDos', 'https://www.neobyte.es/79224-large_default/hp-15s-fq4108ns-portatil-15-i7-1195g7-8gb-512gb-ssd-freedos.jpg', 580.9, 'El HP 15S-FQ4108NS es perfecto para aquellos que buscan una herramienta de uso intensivo diario a un precio totalmente competitivo. Este portátil de 15 cuenta con una pantalla Full HD de una excelente calidad y un hardware que viene respaldado por un procesador Intel Core i7-1195G7 y una memoria RAM De 8GB, combinación que asegura un rendimiento óptimo en diversas tareas informáticas. Entre sus otras especificaciones encontramos un almacenamiento SSD de 512GB, un peso ligero y una completa conectividad.', 'HP', 0),
(584, 'HP Victus 16-E0100NS - Portátil 16 Ryzen 5 5600H 8GB 512GB SSD GTX 1650', 'https://www.neobyte.es/79100-large_default/hp-victus-16-e0100ns-portatil-16-ryzen-5-5600h-8gb-512gb-ssd-gtx-1650.jpg', 749.9, 'El HP Victus 16-E0100NS lleva el sello de un fabricante líder. Este portátil diseñado para jugar presenta una configuración equilibrada, destacando el procesador AMD Ryzen 5 5600H de seis núcleos, la tarjeta gráfica Nvidia GTX 1650 y la memoria RAM de 8GB. No pasamos por alto el SSD de 512GB ni la pantalla Full HD de 16,1 pulgadas, así como su completa conectividad.', 'HP', 0),
(585, 'HP Laptop 15S-EQ1147NS - Portátil 15.6 AMD Athlon 3050U 8GB 256GB Windows 11', 'https://www.neobyte.es/81012-large_default/hp-laptop-15s-eq1147ns-portatil-156-amd-athlon-3050u-8gb-256gb-windows-11.jpg', 437.9, 'El HP Laptop 15S-EQ1147NS pone a tu disposición lo esencial para un uso diario. El procesador de doble núcleo AMD Athlon 3050U, los 8GB de RAM y el SSD de 256GB, junto a Windows 11 Home, proporcionan una experiencia de uso fluida a la hora de navegar, consultar información, editar documentos, reproducir contenidos... Así mismo, mencionar su pantalla de 15.6 con resolución Full HD y su gran variedad de puertos y conexiones inalámbricas.', 'HP', 0),
(586, 'HP Victus 16-E0068NS - Portátil 16 Ryzen 5 5600H 8GB GTX 1650 512GB', 'https://www.neobyte.es/65424-large_default/hp-victus-16-e0068ns-portatil-16-ryzen-5-5600h-8gb-gtx-1650-512gb.jpg', 749.9, 'Con el HP Victus 16-E0068NS podrás jugar a tus juegos competitivos favoritos por mucho menos de lo que esperas. Este portátil gaming cuenta con lo esencial para ofrecer un rendimiento adecuado a un amplio catálogo de títulos. Entre sus especificaciones más importantes, destacar la CPU AMD Ryzen 5 5600H de 6 núcleos, los 8GB de memoria RAM, el SSD de 512GB y la tarjeta gráfica Nvidia GeForce GTX 1650 de 4GB. Así mismo, el HP Victus 16-E0068NS destaca por la amplia variedad de puertos, por su conexión WiFi de alta velocidad y su fantástica pantalla Full HD de 16.1 pulgadas.', 'HP', 0),
(587, 'HP Omen 16-B1003NS - Portátil 16 i7-12700H 16GB RTX3060 512GB', 'https://www.neobyte.es/80919-large_default/hp-omen-16-b1003ns-portatil-16-i7-12700h-16gb-rtx3060-512gb.jpg', 1333.9, 'El HP Omen 16-B1003NS es un portátil muy completo, capaz de ofrecer a cada jugador lo que realmente necesita. Su configuración está formada por componentes de calidad, con un procesador Intel Core i7-12700H, una tarjeta gráfica RTX 3060, una RAM de 16GB y un SSD de 512GB que garantizan un juego fluido y un rendimiento impecable. Su pantalla IPS de 16 tampoco va a dejar indiferente a nadie, transmitiendo imágenes impactantes y nítidas en resolución Full HD que mostrará hasta los detalles más pequeños de cada escena.', 'HP', 0),
