(591, 'HP 15S-FQ4104NS - Portátil 15 i5-1155G7 8GB 256GB SSD Windows 11 Home', 'https://www.neobyte.es/79207-large_default/hp-15s-fq4104ns-portatil-15-i5-1155g7-8gb-256gb-ssd-windows-11-home.jpg', 458.9, 'El HP 15S-FQ4104NS es la solución definitiva para aquellos que buscan un portátil versátil, ligero y de prolongada autonomía. Diseñado para dar una respuesta eficaz a las tareas informáticas más básicas, este modelo equipa una pantalla Full HD de 15 y un hardware de calidad en el que destaca un procesador Intel Core i5-1155G7, un SSD de 256GB y una RAM de 8GB. Además, incorpora el sistema operativo Windows 11 Home para poder disfrutar de él desde el primer minuto.', 'HP', 0),
(592, 'MSI Creator Z17 HX Studio A13VGT-046ES - Portátil 17 i7-13700HX 32GB RTX 4070 1TB SSD W11', 'https://www.neobyte.es/98006-large_default/msi-creator-z17-hx-studio-a13vgt-046es-portatil-17-i7-13700hx-32gb-rtx-4070-1tb-ssd-w11.jpg', 2467.9, 'MSI Creator Z17 HX Studio A13VGT-046ES - Portátil 17 i7-13700HX 32GB RTX 4070 1TB SSD', 'MSI', 0),
