(594, 'HP ZBook Firefly 16 G9 - Portátil 16 i5 1240P 16GB 512GB', 'https://www.neobyte.es/79776-large_default/hp-zbook-firefly-16-g9-portatil-16-i5-1240p-16gb-512gb.jpg', 1411.9, 'El HP ZBook Firefly 16 G9 proporciona una experiencia única. Diseñado para aquellos usuarios que necesitan una herramienta fiable para llevar a todas partes sin restricciones de movilidad, este portátil de 16 no solo se caracteriza por su gran portabilidad y autonomía, sino que es capaz de satisfacer todas las necesidades informáticas cotidianas gracias a un procesador Intel Core i5 1240P, una RAM de 16GB y un SSD de 512GB. Además, incorpora una pantalla IPS con tecnología antirreflejos y resolución WUXGA, lo que asegura una increíble calidad de visualización desde cualquier lugar.', 'HP', 0),
(595, 'HP 15S-FQ4074NS - Portátil 15.6 Intel Core i5 1155G7 8GB 1TB SSD', 'https://www.neobyte.es/80766-large_default/hp-15s-fq4074ns-portatil-156-intel-core-i5-1155g7-8gb-1tb-ssd.jpg', 611.9, 'El HP 15S-FQ4074NS es el portátil todoterreno que estabas buscando. Equipado con procesador Intel Core i5-1155G7 y 8GB de RAM, incluye también un SSD de gran capacidad (1TB) para que guardes todo lo que necesites y disfrutes de una velocidad de funcionamiento espectacular tanto a la hora de arrancar como de trabajar, estudiar, consultar información, editar documentos... Así mismo, señalar que cuenta con un diseño actual y todas las opciones de conectividad que requieres en tu día a día.', 'HP', 0),
(596, 'HP Laptop 15S-EQ2106NS - Portátil 15.6 Ryzen 7 5700U 12GB 512GB Windows 11', 'https://www.neobyte.es/80813-large_default/hp-laptop-15s-eq2106ns-portatil-156-ryzen-7-5700u-12gb-512gb-windows-11.jpg', 657.9, 'Diseñado para uso profesional y doméstico, el HP Laptop 15S-EQ2106NS ofrece un rendimiento rápido y estable en una amplia variedad de tareas. Gracias al procesador AMD Ryzen 7 5700U y a la memoria de 12GB trabajarás de forma fluida, mientras que la pantalla Full HD proporciona imágenes detalladas y definidas. Cuenta también con un SSD de 512GB, sistema operativo Windows 11 y una variada conectividad, con puertos USB, USB-C, Wifi 6, Bluetooth... Compra el HP Laptop 15S-EQ2106NS en Neobyte con todas las garantías.', 'HP', 0),
(597, 'HP Laptop 15S-EQ2102NS - Portátil 15.6 Ryzen 5 5500U 8GB 256GB Windows 11', 'https://www.neobyte.es/80843-large_default/hp-laptop-15s-eq2102ns-portatil-156-ryzen-5-5500u-8gb-256gb-windows-11.jpg', 544.9, 'El HP Laptop 15S-EQ2102NS es un elegante portátil con el que podrás trabajar, estudiar y divertirte. Un modelo con pantalla de 15 pulgadas equipado con un hardware de garantías entre el que destaca su procesador AMD Ryzen 5 5500U de seis núcleos. Cuenta también con memoria RAM de 8GB y un SSD de 256GB de capacidad, además de panel Full HD para disfrutar de los contenidos con todo lujo de detalles. Es importante mencionar también que el HP Laptop 15S-EQ2102NS dispone de Windows 11 y una amplia conectividad.', 'HP', 0),
(598, 'HP 15S-FQ4100NS - Portátil 15 i5-1155G7 8GB 512GB SSD Windows 11 Home', 'https://www.neobyte.es/79247-large_default/hp-15s-fq4100ns-portatil-15-i5-1155g7-8gb-512gb-ssd-windows-11-home.jpg', 518.9, 'De aspecto elegante y equipado con componentes de calidad, el HP 15S-FQ4100NS permite llevar a cabo cualquier tipo de trabajo de forma solvente. Se trata de un modelo de 15 dotado de procesador Intel Core i5-1155G7, 8GB de RAM y 512GB de SSD, combinación que garantiza una máxima fiabilidad y una excelente calidad de imagen. También dispone de sistema operativo Windows 11 Home, múltiples opciones de conectividad y Webcam HD. ¡No te lo puedes perder!', 'HP', 0),
(599, 'HP 250 G8 - Portátil 15 i3-1115G4 8GB 256GB W11', 'https://www.neobyte.es/65525-large_default/hp-250-g8-portatil-15-i3-1115g4-8gb-256gb-w11.jpg', 675.91, 'Además de presumir de una excelente relación calidad-precio, el HP 250 G8 (4K801EA) promete llevar tu experiencia de usuario a otro nivel ayudándote a realizar con eficiencia tus tareas del día a día y maximizando tu productividad. Este portátil de 15 con resolución Full HD ofrece una gran calidad de imagen, así como unos componentes que aportarán la máxima fluidez a cualquier programa o aplicación, y en los que destacan un procesador Intel Core i3-1115G4, 8GB de RAM y un SSD de 256GB.  En definitiva, el HP 250 G8 (4K801EA) es la opción perfecta si buscas un equipo manejable y polivalente.', 'HP', 0),
(600, 'Samsung Galaxy Chromebook 2 360 - Portátil 12 Celeron N4500 4GB 64GB SSD', 'https://www.neobyte.es/80207-large_default/samsung-galaxy-chromebook-2-360-portatil-12-celeron-n4500-4gb-64gb-ssd.jpg', 310.9, 'Si andas buscando un portátil convertible de calidad y con lo esencial, el Samsung Galaxy Chromebook 2 360 es para ti. Gracias a su diseño convertible 360º y excelente pantalla táctil de 12 pulgadas y resolución WQXGA, podrás visualizar contenidos, navegar, consultar información y editar documento con total libertad estés donde estés. Además, pone a tu disposición opciones de conexión de última generación como USB-C, Bluetooth 5.1, WiFi 6... Todo ello con la agilidad y flexibilidad que brinda el sistema operativo Chrome OS.', 'Samsung', 0),
(601, 'Gigabyte G5 KF-E3ES313SD - Portátil 15.6 i5-12500H 16GB RTX 4060 512GB SSD', 'https://www.neobyte.es/89183-large_default/gigabyte-g5-kf-e3es313sd-portatil-156-i5-12500h-16gb-rtx-4060-512gb-ssd.jpg', 1148.99, 'En resumen, la este portátil redefine la experiencia de juego con su diseño delgado, potente rendimiento, avanzada tecnología de enfriamiento, conectividad ultrarrápida y sonido envolvente de alta calidad. Crea posibilidades ilimitadas con esta máquina diseñada para satisfacer las demandas de jugadores y creadores por igual.', 'Gigabyte', 0),
(602, 'Gigabyte G6 KF-H3ES854SD - Portátil 16 i7-13620H 16GB RTX 4060 1TB SSD', 'https://www.neobyte.es/103080-large_default/gigabyte-g6-kf-h3es854sd-portatil-16-i7-13620h-16gb-rtx-4060-1tb-ssd.jpg', 1359, 'Los portátiles de alto rendimiento suelen contar con una cantidad significativa de memoria RAM, como 16GB, para facilitar la multitarea sin problemas y la ejecución fluida de aplicaciones exigentes. La inclusión de unidades de estado sólido (SSD) con capacidades de almacenamiento amplias, como 1TB, proporciona velocidades de lectura/escritura rápidas para arranques rápidos del sistema operativo y tiempos de carga más rápidos de aplicaciones y juegos.', 'Gigabyte', 0),
(603, 'Gigabyte G5 MF5-52ES353SD - Portátil 15.6 i5-13500H 16GB RTX 4050 512GB SSD', 'https://www.neobyte.es/106399-large_default/gigabyte-g5-mf5-52es353sd-portatil-156-i5-13500h-16gb-rtx-4050-512gb-ssd.jpg', 999, 'La pantalla de 15,6 pulgadas del Gigabyte G5 MF5-52ES353SD tiene una resolución Full HD (1920 x 1080) y una frecuencia de actualización de 144 Hz. Esto la convierte en una excelente opción para juegos, ya que ofrece imágenes fluidas y sin parpadeos.', 'Gigabyte', 0),
(604, 'Gigabyte AORUS 17H BXF-74ES554SH - Portátil 17.3 i7-13700H 16GB RTX 4080 1TB SSD W11', 'https://www.neobyte.es/88394-large_default/gigabyte-aorus-17h-bxf-74es554sh-portatil-173-i7-13700h-16gb-rtx-4080-1tb-ssd-w11.jpg', 2329, 'Con el poderoso Gigabyte AORUS 17H BXF-74ES554SH experimentarás lo último en material de rendimiento. Este portátil de altísimas prestaciones arroja una potencia descomunal a todos los niveles, destacando el apartado gráfico, para lo que cuenta con la impresionante Nvidia GeForce RTX 4080 de 12GB y pantalla Full HD de 17.3 y 360Hz de tasa de refresco. De este modo, tus creaciones, juegos y contenidos cobrarán vida y subirán a una nueva dimensión. A nivel técnico, está provisto también de procesador Intel Core i7-13700H, 16GB de RAM DDR5 de última generación y SSD de 1TB. Todo ello con un diseño sorprendentemente delgado, una calidad de fabricación excelente y una conectividad de vanguardia.', 'Gigabyte', 0),
