(610, 'Gigabyte AORUS 7 9KF-E3ES513SD - Portátil 17.3 i5-12500H 16GB RTX 4060 512GB SSD W11', 'https://www.neobyte.es/110000-large_default/gigabyte-aorus-7-9kf-e3es513sd-portatil-173-i5-12500h-16gb-rtx-4060-512gb-ssd-w11.jpg', 1248.99, 'Descubre el AORUS 7 9KF-E3ES513SD, la combinación perfecta de potente rendimiento y movilidad. Este portátil equipado con un procesador Intel Core i5 de 12ª generación y gráficos NVIDIA GeForce RTX 40 Series, disfrutarás de una experiencia de juego inigualable en su pantalla FULL HD de hasta 17.3 con 360Hz de tasa de refresco. El bisel ultradelgado en los cuatro lados ofrece una inmersión visual sin igual, mientras que la tecnología de refrigeración WINDFORCE Infinity garantiza un rendimiento óptimo durante sesiones intensas. Con GPU de última generación, sistema de audio DTS:X® Ultra y diseño ultradelgado, el AORUS 7 redefine el juego.', 'Gigabyte', 0),
