(613, 'Gigabyte AORUS 7 9MF-E2ES513SD - Portátil 17.3 i5-12500H 16GB RTX 4050 512GB SSD W11', 'https://www.neobyte.es/110010-large_default/gigabyte-aorus-7-9mf-e2es513sd-portatil-173-i5-12500h-16gb-rtx-4050-512gb-ssd-w11.jpg', 1198.99, 'Descubre el AORUS 7, un portátil que combina a la perfección rendimiento y movilidad. Con un potente procesador Intel Core i5 de 12.ª generación y la avanzada GPU NVIDIA GeForce RTX 4050, este dispositivo ofrece un rendimiento excepcional. La pantalla FULL HD de 17.3 y con una tasa de refresco de hasta 360Hz proporciona una experiencia visual fluida, mientras que la tecnología de refrigeración WINDFORCE Infinity mantiene el sistema fresco incluso en las sesiones de juego más intensas.', 'Gigabyte', 0),
(614, 'Gigabyte G5 KF5-53ES354SD - Portátil 15.6 i5-13500H 16GB RTX 4060 1TB SSD', 'https://www.neobyte.es/110020-large_default/gigabyte-g5-kf5-53es354sd-portatil-156-i5-13500h-16gb-rtx-4060-1tb-ssd.jpg', 1029, 'Experimenta el equilibrio perfecto entre rendimiento y estilo con el portátil gaming GIGABYTE G5 KF5-53ES354SD. Con un potente procesador Intel Core i5 de 13.ª generación y gráficos dedicados NVIDIA GeForce RTX 4060, este portátil ofrece un rendimiento excepcional. La pantalla FULL HD de 15.6 con una tasa de refresco de hasta 144Hz brinda una experiencia visual envolvente. Su diseño delgado y ligero, respaldado por la tecnología de refrigeración WINDFORCE, garantiza comodidad en sesiones de juego intensas y tareas diarias. Disfruta de una conectividad avanzada con Wi-Fi 6E y sumérgete en un audio inmersivo con DTS: X™ Ultra.', 'Gigabyte', 0),
(615, 'Gigabyte AORUS 17X AZG-65ES665SH - Portátil 17.3 i9-14900HX 32GB RTX 4090 2TB SSD W11', 'https://www.neobyte.es/111640-large_default/gigabyte-aorus-17x-azg-65es665sh-portatil-173-i9-14900hx-32gb-rtx-4090-2tb-ssd-w11.jpg', 3819, 'Gracias a la tecnología de refrigeración Windforce Infinity, este portátil delgado domina el mundo del gaming con un rendimiento extraordinario. La pantalla de alta resolución y frecuencia de actualización de 240Hz, junto con Dolby Vision Technology, proporciona imágenes nítidas y detalladas. Además, la certificación de luz azul baja y sin parpadeo garantizan una experiencia de visualización cómoda. Con soporte para la memoria 5600MHz y opciones de personalización RGB, este dispositivo ofrece una experiencia de juego incomparable. ¡Prepárate para la revolución con el AORUS 17X!', 'Gigabyte', 0),
(616, 'Gigabyte AORUS 16X ASG-53ESC54SH - Portátil 16 i7-14650HX 16GB RTX 4070 1TB SSD W11', 'https://www.neobyte.es/111630-large_default/gigabyte-aorus-16x-asg-53esc54sh-portatil-16-i7-14650hx-16gb-rtx-4070-1tb-ssd-w11.jpg', 2339, '¿Te atreves a desafiar las reglas y redefinir tu realidad gaming? Sumérgete en una pantalla con resolución 2560x1600 y relación de aspecto de 16:10 con bisel patentado para lograr una inmersión sin igual. La experiencia AI Nexus gestiona eficientemente la energía, mejora el rendimiento gaming y potencia aplicaciones de IA. Además, disfruta de la eficiente y silenciosa refrigeración WINDFORCE Infinity y funciones productivas, mientras el diseño atractivo y el potente sistema de audio Dolby complementan la experiencia. ¿Estás preparado para un portátil que va más allá del gaming, convirtiéndose en una obra maestra AI que desafía las normas?', 'Gigabyte', 0),
(617, 'Gigabyte AORUS 16X ASG-63ESC65SH - Portátil 16 i9-14900HX 32GB RTX 4070 2TB SSD W11', 'https://www.neobyte.es/111620-large_default/gigabyte-aorus-16x-asg-63esc65sh-portatil-16-i9-14900hx-32gb-rtx-4070-2tb-ssd-w11.jpg', 2439, 'El portátil gaming Gigabyte AORUS 16X ASG-63ESC65SH se presenta como una potente máquina de juego con inteligencia artificial (IA). Equipado con el último procesador Intel® Core™ HX y la gráfica NVIDIA GeForce RTX 4070 con aceleración de IA, el AORUS 16X redefine el rendimiento gaming. La experiencia AI Nexus ofrece una gestión de energía, rendimiento gaming y software de generación de IA más avanzados. Con la tecnología de refrigeración WINDFORCE Infinity, este portátil es eficiente y silencioso, manteniendo un rendimiento óptimo. Su pantalla en formato 16:10 y diseño de bisel patentado proporcionan una inmersión excepcional. Además, cuenta con funciones de productividad, un sistema de audio Dolby y un diseño llamativo que refleja su enfoque innovador y vanguardista. El AORUS 16X es más que una máquina de juego; es una obra maestra AI que desafía las reglas y redefine la realidad.', 'Gigabyte', 0),
(618, 'Gigabyte AORUS 15 BKG-13ES754SH - Portátil 15.6 U7-155H 16GB RTX 4060 1TB SSD W11', 'https://www.neobyte.es/111617-large_default/gigabyte-aorus-15-bkg-13es754sh-portatil-156-u7-155h-16gb-rtx-4060-1tb-ssd-w11.jpg', 1838.99, 'Con tecnologías exclusivas como IA Nexus, refrigeración Windforce Infinity y efectos cinematográficos personalizados, el AORUS 15 ofrece un rendimiento premium y una experiencia de juego envolvente. Experimenta una calidad de imagen excepcional, gracias a su pantalla QHD de 165Hz y tecnología Dolby Vision, mientras que la certificación de baja luz azul y sin parpadeo asegura comodidad visual. El diseño delgado y el sistema de enfriamiento innovador hacen del AORUS 15 un portátil gaming líder impulsado por IA.', 'Gigabyte', 0),
(619, 'Gigabyte G6X 9KG-43ES854SD - Portátil 16 i7-13650HX 32GB RTX 4060 1TB SSD', 'https://www.neobyte.es/111589-large_default/gigabyte-g6x-9kg-43es854sd-portatil-16-i7-13650hx-32gb-rtx-4060-1tb-ssd.jpg', 1270.09, 'Los bordes de pantalla finos ofrecen una amplia relación pantalla / base, brindando una vista panorámica del campo de batalla. Con sonido Dolby Atmos, este portátil ofrece una experiencia cinematográfica sensacional. Domina a tus competidores con el GIGABYTE G6X y sus 32GB de RAM, un verdadero centro de juego.', 'Gigabyte', 0),
(620, 'Gigabyte G6X 9KG-43ES854SD - Portátil 16 i7-13650HX 16GB RTX 4060 1TB SSD', 'https://www.neobyte.es/111575-large_default/gigabyte-g6x-9kg-43es854sd-portatil-16-i7-13650hx-16gb-rtx-4060-1tb-ssd.jpg', 1459.01, 'Sumérgete en el universo del juego con el portátil gaming Gigabyte G6X 9KG-43ES854SD y su potente inteligencia artificial. Equipado con un procesador Intel Core 13650HX y una gráfica NVIDIA GeForce RTX 4060, este portátil ofrece un rendimiento inigualable gracias a la inteligencia artificial generativa. El sistema de refrigeración WINDFORCE optimizado garantiza la eficiencia máxima, mientras que los estrechos bordes de pantalla proporcionan un impresionante 90% de relación pantalla-cuerpo, ofreciendo una experiencia de juego inmersiva. Con 16GB de RAM, este centro de inteligencia artificial potencia tus juegos, multitareas y transmisiones. Sumérgete en la victoria con el GIGABYTE G6X.', 'Gigabyte', 0),
(621, 'Gigabyte G6 KF-H3ES854KD - Portátil 16 i7-13620H 16GB RTX 4060 1TB SSD', 'https://www.neobyte.es/111566-large_default/gigabyte-g6-kf-h3es854kd-portatil-16-i7-13620h-16gb-rtx-4060-1tb-ssd.jpg', 1349, 'La pantalla de alta frecuencia de actualización de 165Hz elimina el desenfoque de movimiento, proporcionando una visión clara para alcanzar la victoria en cada juego. Sumérgete en un sonido envolvente con Dolby Atmos y disfruta de una ventaja competitiva con el audio espacial hiperrealista. Con un teclado retroiluminado personalizable y un diseño minimalista de pantalla con borde fino, lel portátil Gigabyte G6 combina estilo y rendimiento para llevar tu experiencia de juego al siguiente nivel.', 'Gigabyte', 0),
(622, 'Gigabyte G5 MF5-H2ES354KD - Portátil 15.6 i7-13620H 16GB RTX 4050 1TB', 'https://www.neobyte.es/111550-large_default/gigabyte-g5-mf5-h2es354kd-portatil-156-i7-13620h-16gb-rtx-4050-1tb.jpg', 1159, '¿Listo para hacer LOGIN en el mundo gaming con la inteligencia artificial a tu favor? El portátil GIGABYTE G5 KF5-H3ES354KD se presenta como una potente arma gamer con procesadores Intel de 13ª generación y tarjeta gráfica NVIDIA GeForce RTX 4050 impulsada por IA. ¿Te atreves a desafiar a tus oponentes con su diseño elegante y patrón Mecha? Equipado con tecnología de refrigeración WINDFORCE, esta máquina ofrece estabilidad incluso en los momentos más intensos. ¿Te imaginas una experiencia de juego impecable con su pantalla de 144Hz y la conexión ultrarrápida de Wi-Fi 6E? Sumérgete en el sonido envolvente Dolby Atmos y elige tu estilo con el teclado retroiluminado. ¿Estás listo para la victoria?', 'Gigabyte', 0),
(623, 'Gigabyte G5 KF5-H3ES354KD - Portátil 15.6 i7-13620H 16GB RTX 4060 1TB', 'https://www.neobyte.es/111541-large_default/gigabyte-g5-kf5-h3es354kd-portatil-156-i7-13620h-16gb-rtx-4060-1tb.jpg', 1218.99, 'Equipado con la exclusiva tecnología de refrigeración WINDFORCE, garantiza eficiencia y estabilidad incluso en sesiones intensivas. La pantalla de alta frecuencia de actualización de 144Hz elimina el desenfoque de movimiento, ofreciendo una experiencia de juego impecable. Además, cuenta con soporte Wi-Fi 6E para una conectividad ultrarrápida y sonido envolvente Dolby Atmos para una inmersión auditiva sin igual. Con teclado retroiluminado y una delgada pantalla de bisel reducido, este portátil gaming G5 es una opción perfecta para jugadores y creadores que buscan rendimiento y estilo.', 'Gigabyte', 0),
(624, 'Gigabyte G6 KF-H3ES853SD - Portátil 16 i7-13620H 16GB RTX 4060 512GB SSD', 'https://www.neobyte.es/103072-large_default/gigabyte-g6-kf-h3es853sd-portatil-16-i7-13620h-16gb-rtx-4060-512gb-ssd.jpg', 1179, 'Este modelo cuenta con el sistema de refrigeración WINDFORCE 4, que utiliza dos ventiladores WINDFORCE Blade 3D de 90 mm y un ventilador WINDFORCE Blade 3D de 100 mm. Los ventiladores utilizan un diseño de aspas optimizado para generar un flujo de aire eficiente y silencioso. Esto permite al portátil poder trabajar a plena potencia sin ninguna preocupación por la temperatura que pueda llegar a alcanzar.', 'Gigabyte', 0),
(625, 'Gigabyte AORUS 15 BKF-73ES754SH - Portátil 15.6 i7-13700H 16GB RTX 4060 1TB SSD W11', 'https://www.neobyte.es/100738-large_default/gigabyte-aorus-15-bkf-73es754sh-portatil-156-i7-13700h-16gb-rtx-4060-1tb-ssd-w11.jpg', 1348.99, 'El almacenamiento no es un problema con este portátil, ya que ofrece una combinación de SSD NVMe y un disco duro adicional, lo que proporciona una amplia capacidad de almacenamiento y tiempos de carga ultra rápidos.', 'Gigabyte', 0),
(626, 'Gigabyte AERO 14 BMF-72ESBB4SH OLED - Portátil 14 i7-13700H 2.8K 16GB RTX 4050 1TB SSD', 'https://www.neobyte.es/93913-large_default/gigabyte-aero-14-bmf-72esbb4sh-oled-portatil-14-i7-13700h-28k-16gb-rtx-4050-1tb-ssd.jpg', 1868.99, 'Este modelo está equipado con una tarjeta gráfica NVIDIA GeForce RTX 4050. La tarjeta gráfica NVIDIA GeForce RTX 4050 es capaz de manejar los juegos más exigentes con una gran fluidez y detalle. Dispone de la tecnología Ray Tracing, que es una tecnología que permite generar imágenes más realistas mediante el trazado de rayos de luz. Tambiçen dispone de la tecnología DLSS (Deep Learning Super Sampling) que es una tecnología que utiliza el aprendizaje automático para aumentar la resolución de las imágenes sin afectar al rendimiento.', 'Gigabyte', 0),
(627, 'Intel Core i9-14900K - Procesador 1700', 'https://www.neobyte.es/104177-large_default/intel-core-i9-14900k-procesador-1700.jpg', 589.9, 'Te presentamos el Intel Core i9-14900K, un procesador con microarquitectura Raptor Lake Refresh y compatible con socket 1700 que te permitirá disfrutar del máximo rendimiento del momento. Equipado con 24 núcleos (8 de rendimiento + 16 de eficiencia) y 32 hilos, ofrece una capacidad asombrosa a la hora de ejecutar múltiples tareas exigentes de forma simultanea. Por estos motivos, así como por sus innumerables tecnologías de última generación, es la opción preferida para gamers, creadores de contenido y entusiastas de la informática que buscan lo mejor.', 'Intel', 0),
(628, 'AMD Ryzen 9 7900X - Procesador AM5', 'https://www.neobyte.es/79807-large_default/amd-ryzen-9-7900x-procesador-am5.jpg', 383.9, 'Con el AMD Ryzen 9 7900X disfrutarás de la máxima potencia ejecutando las tareas más exigentes, retransmitiendo en directo o jugando a los últimos títulos. Este procesador es garantía de éxito y ya puede ser tuyo en Neobyte con totales garantías, envío inmediato y al precio más competitivo. Para ello ha sido provisto de la tecnología más innovadora en materia de rendimiento, así como de 12 núcleos, 24 subprocesos, 64MB caché y una frecuencia de funcionamiento de hasta 5.6Ghz. Sin una una apuesta segura para entusiastas.', 'AMD', 0),
(629, 'AMD Ryzen Threadripper PRO 5975WX - Procesador sWRX8', 'https://www.neobyte.es/76884-large_default/amd-ryzen-threadripper-pro-5975wx-procesador-swrx8.jpg', 3017.9, 'Hazte con el procesador AMD Ryzen Threadripper PRO 5975WX y atrévete con todo. Esta CPU diseñada para estaciones de trabajo cuenta con 32 núcleos y 64 hilos, alcanzando una frecuencia de 3,6 GHz y hasta 4,5 GHz. Es compatible con socket sWRX8 y con memorias DDR4 hasta 3200 Mhz. ¡Cómpralo ya en la tienda online de Neobyte!', 'AMD', 0),
(630, 'AMD Ryzen 5 5600G - Procesador AM4', 'https://www.neobyte.es/53007-large_default/procesador-amd-ryzen-5-5600g-socket-am4.jpg', 122.9, 'El procesador AMD Ryzen 5 5600G con gráficos integrados Radeon es una apuesta segura por la fiabilidad. Esta CPU de 6 núcleos y 12 subproceso ofrece un excelente rendimiento multitarea. Es compatible con placas base con socket AM4 y es capaz de alcanzar frecuencias de hasta 4.4 GHz. Además, cuenta con disipador térmico Wraith Stealth. Compra ya la CPU AMD Ryzen 5 5600G en Neobyte con todas las garantías.', 'AMD', 0),
(631, 'Intel Core i5-11400 con ventilador - Procesador 1200', 'https://www.neobyte.es/46709-large_default/intel-core-i5-11400-con-ventilador-procesador-1200.jpg', 146.89, 'Ya en Neobyte el Intel Core i5-11400, un procesador de garantías llamado a convertirse el rey de la gama media. Gracias a sus 6 núcleos, 12 subprocesos y caché de 12MB, asegura una capacidad multitarea sensacional, atreviéndose con todo tipo de programas y juegos. Entre sus especificaciones técnicas, destacar también el socket 1200, la litografía de 14nm y una frecuencia que oscila entre los 2,60 y los 4,40Ghz. Ponte a la última en nuestra tienda online con el Intel Core i5-11400.', 'Intel', 0),
(632, 'Intel Core i9-10920X - Procesador 2066', 'https://www.neobyte.es/35903-large_default/procesador-intel-core-i9-10920x.jpg', 853.9, 'Equipa tu ordenador con la potencia y la fiabilidad del procesador Intel Core I9-10920X y disfruta de un rendimiento incomparable. Esta CPU de 12 núcleos y 24 subprocesos es una garantía de estabilidad, ofreciendo un funcionamiento excelente en acciones multitarea y procesos de gran exigencia. Alcanza frecuencias de entre 3.50 y 4.60 GHz y ha sido equipado con disipador PCG 2017X. Si has pensando en comprar un procesador para socket 2066, el Intel Core I9-10920X es una opción muy a tener en cuenta.', 'Intel', 0),
(633, 'Intel Core i9-14900KF - Procesador 1700', 'https://www.neobyte.es/104178-large_default/intel-core-i9-14900kf-procesador-1700.jpg', 588.89, 'Basado en la microarquitectura Raptor Lake Refresh, es compatible con el socket 1700 para una compatibilidad sensacional. Por último, destacar que es capaz de alcanzar hasta 6Ghz, lo que se traduce en una velocidad de procesamiento nunca antes vista.', 'Intel', 0),
(634, 'AMD Ryzen 7 7700X - Procesador AM5', 'https://www.neobyte.es/79806-large_default/amd-ryzen-7-7700x-procesador-am5.jpg', 328.9, 'Alcanza la victoria con el AMD Ryzen 7 7700X, el procesador desarrollado para superar todas tus expectativas. Gracias a sus 8 núcleos, 16 subprocesos y una frecuencia máxima de hasta 5.4Ghz, podrás ejecutar todo tipo de tareas y juegos de manera rápida, solvente y estable. Compatible con placas con socket AM5, cuenta con todo lo necesario para exprimir el potencial de las aplicaciones y componentes de última generación. Consíguelo ya en Neobyte con envío inmediato y al mejor precio.', 'AMD', 0),
(635, 'AMD Ryzen 5 5500 - Procesador AM4', 'https://www.neobyte.es/69378-large_default/amd-ryzen-5-5500-procesador-am4.jpg', 95.9, 'El AMD Ryzen 5 5500 lo tiene todo para convertirse en el rey de la gama media. Por menos de lo que imaginas puedes conseguir este procesador con tecnología de última generación que se mueve como pez en el agua tanto en equipos gaming como domésticos y profesionales. El AMD Ryzen 5 5500 cuenta con 6 núcleos y 12 subprocesos, así como con 16MB de caché y una frecuencia de funcionamiento que oscila entre 3.6 y 4.2Ghz. ¡Ya disponible en Neobyte!', 'AMD', 0),
(636, 'Intel Celeron G5905 - Procesador 1200', 'https://www.neobyte.es/48613-large_default/procesador-intel-celeron-g5905-35ghz-socket-1200.jpg', 45.9, 'El procesador Intel Celeron G5905 es perfecto para configuraciones básicas que requieran de una CPU eficiente y fiable a precio económico. Se trata de un modelo de dos núcleos con socket 1200 Comet Lake equipado con disipador PCG 2015C con el que disfrutarás de un funcionamiento estable en tu ordenador. Ha sido provisto de gráficos integrados Intel UHD Graphics 610 y es compatible con memorias DDR4 hasta 128GB. ¡Hazte con la Intel Celeron G5905 en Neobyte al mejor precio!', 'Intel', 0),
(637, 'Intel Core i9-10900X - Procesador 2066', 'https://www.neobyte.es/25414-large_default/procesador-intel-i9-10900x-37ghz-socket-2066.jpg', 730.9, 'Si buscas rendimiento, estabilidad y potencia para tu PC te presentamos el componente que ofrece esto y más. Intel Core i9-10900X es un procesador de décima generación para socket 2066 que cuenta con unas especificaciones de lujo: 10 núcleos, 20 subprocesos, frecuencia base de 3.70 GHz y una frecuencia máxima de 4.5 GHz. Además, es compatible con memorias DDR4-29300 hasta 256GB. Equipa tu ordenador de alto nivel con el Intel Core i9-10900X.', 'Intel', 0),
(638, 'Intel Core i7-14700KF - Procesador 1700', 'https://www.neobyte.es/104180-large_default/intel-core-i7-14700kf-procesador-1700.jpg', 395.9, '', 'Intel', 0),
(639, 'AMD Ryzen 9 7900X3D Procesador AM5', 'https://www.neobyte.es/89914-large_default/amd-ryzen-9-7900x3d-procesador-am5.jpg', 488.9, 'En las pruebas de rendimiento, esta CPU ofrece un aumento de hasta el 15% de rendimiento en comparación con su predecesor. Esto significa que puedes disfrutar de tus juegos favoritos con un nivel de fluidez y detalle nunca antes visto. Si estás buscando el mejor procesador para juegos, el Ryzen 9 7900X3D es la opción perfecta. Ofrece un rendimiento sin precedentes para los juegos más exigentes, y está preparado para el futuro con soporte para la memoria DDR5.', 'AMD', 0),
(640, 'AMD Ryzen 7 5700X - Procesador AM4', 'https://www.neobyte.es/71424-large_default/amd-ryzen-7-5700x-procesador-am4.jpg', 173.9, 'Ya disponible en Neobyte el AMD Ryzen 7 5700X, un procesador de garantías que asegura un rendimiento sólido y una capacidad multitarea espectacular. Gracias a sus 8 núcleos, 16 subprocesos, 32MB caché y una frecuencia máxima de 4.6Ghz, es capaz de ejecutar los programas y juegos más exigente de manera ágil y solvente. Descubre lo último en tecnología prestaciones con el increíble AMD Ryzen 7 5700X.', 'AMD', 0),
(641, 'Intel Core i5-10400 - Procesador 1200', 'https://www.neobyte.es/34012-large_default/procesador-intel-i5-10400-29ghz-socket-1200.jpg', 127.9, 'El nuevo Intel Core i5-10400 ha sido desarrollado para llevar tu productividad y entretenimiento a un nuevo nivel. Este procesador Intel de 10ª generación cuenta con todo lo necesario para convertirse en un auténtico top ventas y ya puede ser tuyo en Neobyte con las máximas garantías y al precio más competitivo. Respecto a sus especificaciones técnicas, destacar los 6 núcleos y 12 subprocesos, así como una frecuencia de hasta 4.30Ghz y los 12MB de caché. Descubre todo lo que el Intel Core i5-10400 puede hacer por ti.', 'Intel', 0),
(642, 'Intel Core i5-14600K - Procesador 1700', 'https://www.neobyte.es/104181-large_default/intel-core-i5-14600k-procesador-1700.jpg', 320.9, '', 'Intel', 0);
INSERT INTO `producto` (`id`, `nombre`, `imagen`, `precio`, `especificaciones`, `marca`, `id_categoria`) VALUES
(643, 'AMD Ryzen 9 7950X - Procesador AM5', 'https://www.neobyte.es/79808-large_default/amd-ryzen-9-7950x-procesador-am5.jpg', 509.89, 'El AMD Ryzen 9 7950X es lo mejor para jugar, crear y trabajar. Sus 16 núcleos y 32 subprocesos proporcionan potencia más que suficiente para ejecutar los juegos y tareas más exigentes: render, cálculo, edición, títulos triple A... Tanto si eres profesional como creador o gamer, este procesador de última generación superará todas tus expectativas. En el apartado técnico, destacar también que cuenta con 64MB de caché y una frecuencia que oscila entre los 4.5 y 5.7Ghz para que, hagas lo que hagas, vayas más rápido.', 'AMD', 0),
(644, 'Intel Core i3-10105 - Procesador 1200', 'https://www.neobyte.es/47746-large_default/procesador-intel-i3-10105-37ghz-socket-1200.jpg', 97.9, 'En Neobyte puedes encontrar el Intel Core i3-10105 al precio más competitivo y con las máximas garantías. Una CPU perteneciente a la 10ª generación de procesadores Intel que proporciona un rendimiento adecuado para el desarrollo de las tareas informáticas más habituales. Las especificaciones técnicas más importantes del Intel Core i3-10105 son los 4 núcleos, los 6MB de caché y una frecuencia de funcionamiento de entre 3.70 y 4.40Ghz.', 'Intel', 0),
(645, 'AMD Ryzen 7 5800X - Procesador AM4', 'https://www.neobyte.es/40650-large_default/procesador-amd-ryzen-7-5800x-socket-am4.jpg', 214.9, 'El AMD Ryzen 7 5800X te permitirá disfrutar de una experiencia de juego impresionante a todos los niveles. Gracias a sus 8 núcleos, 16 subprocesos, 32MB de memoria caché y una frecuencia máxima de hasta 4,7Ghz, logra obtener un rendimiento sensacional en todo tipo de títulos. Además, el AMD Ryzen 7 5800X es perfecto para realizar overclock de forma sencilla y a la vez potente.', 'AMD', 0),
(646, 'Intel Core i7-14700K - Procesador 1700', 'https://www.neobyte.es/104179-large_default/intel-core-i7-14700k-procesador-1700.jpg', 433.91, '', 'Intel', 0),
(647, 'AMD Ryzen 7 7800X3D - Procesador AM5', 'https://www.neobyte.es/91528-large_default/amd-ryzen-7-7800x3d-procesador-am5.jpg', 389.9, 'La innovadora tecnología 3D V-Cache de AMD lleva la capacidad de la caché al siguiente nivel, mejorando la eficiencia y el rendimiento en una amplia variedad de cargas de trabajo. Ya sea que seas un jugador apasionado, un creador de contenido o un profesional que realiza múltiples tareas, el Ryzen 7 7800X3D ofrece la potencia que necesitas. Además, la compatibilidad con la plataforma AM5 garantiza una fácil integración con una amplia variedad de placas base, permitiéndote personalizar tu sistema según tus necesidades específicas.', 'AMD', 0),
(648, 'AMD Ryzen 7 5800X3D - Procesador AM4', 'https://www.neobyte.es/71813-large_default/amd-ryzen-7-5800x3d-procesador-am4.jpg', 279.9, 'El procesador AMD Ryzen 7 5800X3D te permitirá equipar tu PC con un componente de gran fiabilidad y potencia. Esta CPU de ocho núcleos alcanza frecuencias de hasta 4,5 GHz y es compatible con memorias RAM DDR4 hasta 3200 Mhz y con el socket AM4 de AMD. Completa tu ordenador gaming o workstation con el AMD Ryzen 7 5800X3D y haz que vuele.', 'AMD', 0),
(649, 'Intel Core i7-11700 - Procesador 1200', 'https://www.neobyte.es/46723-large_default/procesador-intel-i7-11700-49ghz-socket-1200.jpg', 262.9, '¿Necesitas comprar una CPU para tu PC de alto rendimiento? El Intel Core i7-11700 se ajustará a tus necesidades por su potencia y fiabilidad. Un procesador diseñado para trabajos de alta exigencia capaz de llevar a cabo procesos multarea con solvencia y rapidez. Cuenta con disipador térmico y gráficos integrados Intel UHD. Da el salto a la 11ª generación de procesadores Intel con el Intel Core i7-11700.', 'Intel', 0),
(650, 'AMD Ryzen 5 8500G - Procesador AM5', 'https://www.neobyte.es/110985-large_default/amd-ryzen-5-8500g-procesador-am5.jpg', 180.9, 'El procesador AMD Ryzen 5 8500G marca un hito al incorporar la revolucionaria AMD Ryzen AI. Este procesador con un máximo de hasta 5 GHz ofrece un rendimiento excepcional, con la potencia de una unidad de procesamiento Neural (NPU) dedicada a la inteligencia artificial, una característica que consolida a AMD como líder en innovación.', 'AMD', 0),
(651, 'Intel Core i5-14400F - Procesador 1700', 'https://www.neobyte.es/108201-large_default/intel-core-i5-14400f-procesador-1700.jpg', 221.9, 'La aceleración de la innovación de plataformas es una característica clave, diseñada para la tecnología líder en la industria. La compatibilidad con placas base de las series 600 y 700 permite actualizaciones sin comprometer el rendimiento ni las características. La plataforma también ofrece compatibilidad con DDR5 de hasta 5600 MT/s para un amplio ancho de banda y productividad mejorada, junto con compatibilidad continua con DDR4 de hasta 3200 MT/s. Con hasta 16 carriles PCIe 5.0 para tarjetas adicionales y tecnología Thunderbolt™ 4 con un ancho de banda de hasta 40 Gbps, esta plataforma asegura una comunicación rápida y eficiente entre los componentes. La integración de E/S de nivel superior completa la experiencia, ofreciendo una plataforma avanzada y versátil para satisfacer diversas necesidades.', 'Intel', 0),
(652, 'AMD Ryzen 9 5900X - Procesador AM4', 'https://www.neobyte.es/40652-large_default/procesador-amd-ryzen-9-5900x-socket-am4.jpg', 272.9, 'Con 12 núcleos y una frecuencia de 3,7 hasta 4,8Ghz, el AMD Ryzen 9 5900X potenciará tu experiencia de juego y te permitirá ejecutar las tareas profesionales más exigentes. Provisto de la última tecnología en materia de rendimiento, el AMD Ryzen 9 5900X se convertirá en una opción ganadora para ordenadores gaming de altas prestaciones y estaciones de trabajo. Configura tu equipo en Neobyte con las máximas garantías con la serie 5000 de AMD Ryzen.', 'AMD', 0),
(653, 'Intel Core i3-10100 - Procesador 1200', 'https://www.neobyte.es/81981-large_default/procesador-intel-i3-10100-36ghz-socket-1200.jpg', 97.9, 'Intel Core i3-10100 es la puerta de entrada a los procesadores Intel Core de 10ª generación y constituye una opción perfecta para los presupuestos más ajustados. Provisto de 4 núcleos y 8 hilos, permite ejecutar multitud de tareas informáticas de forma rápida y sin imprevistos. Entre sus especificaciones técnicas, destacar también los 6MB de caché y una frecuencia que oscila entre los 3.6 y los 4.3Ghz. Intel Core i3-10100, ya disponible en Neobyte.', 'Intel', 0),
(654, 'AMD Ryzen 5 8600G - Procesador AM5', 'https://www.neobyte.es/110988-large_default/amd-ryzen-5-8600g-procesador-am5.jpg', 230.9, 'Sumérgete en el futuro de la informática con el AMD Ryzen 5 8600G, un procesador para escritorio que lleva la innovación a un nuevo nivel. Destacando la inclusión de AMD Ryzen AI, la primera unidad de procesamiento neural (NPU) dedicada para inteligencia artificial en procesadores de escritorio, este chipset ofrece un rendimiento excepcional, consolidando la posición de AMD como líder indiscutible en el ámbito de procesadores.', 'AMD', 0),
(655, 'AMD Ryzen 5 5600 - Procesador AM4', 'https://www.neobyte.es/69380-large_default/amd-ryzen-5-5600-procesador-am4.jpg', 124.9, 'Ya en Neobyte el AMD Ryzen 5 5600, un procesador de referencia que cuenta con una tecnología y especificaciones técnicas que lo convierten en una opción ganadora en todo tipo de entornos: gaming, uso profesional... Esta CPU dispone de 6 núcleos, 12 subprocesos y 32MB de caché, lo que se traduce en una capacidad multitarea espectacular. Además, posee una frecuencia de 3.5Ghz hasta 4.4Ghz para una mayor agilidad y fluidez. Disfruta de lo último con el AMD Ryzen 5 5600.', 'AMD', 0),
(656, 'Intel Core i5-12400 - Procesador 1700', 'https://www.neobyte.es/62831-large_default/intel-core-i5-12400-procesador-1700.jpg', 170.9, 'El Intel Core i5-12400 tiene todo lo que esperas de un procesador de última generación y te lo da al mejor precio. Esta CPU con socket 1700 Alder Lake dispone de 6 núcleos, 12 subprocesos, 18MB de caché, una frecuencia máxima de 4.4Ghz y gráficos integrados Intel UHD 730. Esto se traduce en un rendimiento ágil, fluido y estable incluso ejecutando varias tareas a la vez. Por todo ello, el Intel Core i5-12400 es un microprocesador perfecto para equipos domésticos y de oficina, aunque su potencial va mucho más allá.', 'Intel', 0),
(657, 'Intel Core i5-10400F - Procesador 1200', 'https://www.neobyte.es/34785-large_default/intel-core-i5-10400f-procesador-1200.jpg', 97.9, 'Fiabilidad y rendimiento se integran a la perfección en el procesador Intel Core i5-10400F. Esta CPU con socket 1200 Comet Lake es un buen exponente del rendimiento que ofrece la 10ª generación de Intel, incluyendo 6 núcleos para hacer frente a tareas exigentes. Alcanza una frecuencia de 4.30 GHz y es compatible con memorias DDR4-2666 hasta 128GB. Equipa tu PC gaming con el Intel Core i5-10400F y disfruta de un funcionamiento estable y rápido.', 'Intel', 0),
(658, 'AMD Ryzen 7 7700 - Procesador AM5', 'https://www.neobyte.es/88072-large_default/amd-ryzen-7-7700-procesador-am5.jpg', 319.9, 'AMD Ryzen 7 7700 - Procesador AM5', 'AMD', 0),
(659, 'Gigabyte B760 AORUS Elite AX - Placa base 1700 ATX', 'https://www.neobyte.es/87618-large_default/gigabyte-b760-aorus-elite-ax-placa-base-1700-atx.jpg', 169.9, 'El Wi-Fi 6E es la última generación de Wi-Fi y ofrece velocidades de transferencia más rápidas y una menor latencia. Además, el Bluetooth 5.3 es la última generación de Bluetooth y ofrece una mayor velocidad de transferencia y un menor consumo de energía.', 'Gigabyte', 0),
(660, 'Gigabyte B650 AORUS Elite AX - Placa base AM5 ATX', 'https://www.neobyte.es/81942-large_default/gigabyte-b650-aorus-elite-ax-placa-base-am5-atx.jpg', 189.9, 'La conectividad WiFi AX de última generación permite una experiencia de red inalámbrica ultrarrápida y estable. Con velocidades de transferencia significativamente más altas y menor latencia, los usuarios disfrutarán de descargas más rápidas, streaming sin interrupciones y una conexión confiable para juegos en línea.', 'Gigabyte', 0),
(661, 'Gigabyte B550 Aorus Elite V2 - Placa base ATX AM4', 'https://www.neobyte.es/40677-large_default/placa-base-gigabyte-b550-aorus-elite-v2.jpg', 135.9, 'Completa y con una relación calidad precio impresionante, la Gigabyte B550 Aorus Elite V2 es la placa que estabas buscando para configurar tu ordenador con procesador Ryzen de última generación. Dispone de un diseño térmico optimizado, así como de componentes de primera calidad que garantizan un rendimiento sensacional y una durabilidad inmejorable. Para que puedas disfrutar de lo último en almacenamiento, cuenta con dos slots M.2 compatibles con Nvme. Otras de las características más destacadas de la Gigabyte B550 Aorus Elite V2 son la conectividad 2.5G LAN, el audio ALC1200 y la iluminación RGB Fusion 2.0.', 'Gigabyte', 0),
(662, 'Gigabyte B760M DS3H DDR4 - Placa base 1700 Micro-ATX', 'https://www.neobyte.es/86828-large_default/gigabyte-b760m-ds3h-ddr4-placa-base-1700-micro-atx.jpg', 104.89, 'La placa base incorpora un diseño de audio de alta calidad que proporciona una experiencia sonora envolvente. Esto permite una reproducción de audio nítida y detallada, ideal para juegos, reproducción de medios y aplicaciones de entretenimiento.', 'Gigabyte', 0),
(663, 'Gigabyte B550 Gaming X V2 - Placa base AM4 ATX', 'https://www.neobyte.es/43251-large_default/placa-base-gigabyte-b550-gaming-x-v2.jpg', 114.89, 'Con la Gigabyte B550 Gaming X V2 aprovecharás todo el potencial de los componentes más actuales y procesadores Ryzen de última generación. Esta placa base ATX cuenta con chipset AMD B550 y socket AM4, así como con un diseño térmico que incluye múltiples disipadores para un funcionamiento más estable. Destacar también que dispone de  ranuras para memoria RAM y dos slots M.2, siendo compatible con PCIe 4.0. La Gigabyte B550 Gaming X V2 está provista, además, de una variada conectividad, incluyendo USB-C, HDMI, LAN de categoría gaming...', 'Gigabyte', 0),
(664, 'MSI B650 Gaming Plus WiFi - Placa base AM5 ATX', 'https://www.neobyte.es/101023-large_default/msi-b650-gaming-plus-wifi-placa-base-am5-atx.jpg', 183.9, 'MSI B650 Gaming Plus WiFi - Placa base AM5 ATX', 'MSI', 0),
(665, 'Gigabyte Z790 Gaming X AX - Placa base 1700 ATX', 'https://www.neobyte.es/86458-large_default/gigabyte-z790-gaming-x-ax-placa-base-1700-atx.jpg', 249.89, 'El Wi-Fi 6E es la última generación de Wi-Fi y ofrece velocidades de transferencia más rápidas y una menor latencia. La Gigabyte Z790 Gaming X AX incluye un adaptador Wi-Fi 6E que proporciona velocidades de hasta 2.4 Gbps. El Bluetooth 5.3 es la última generación de Bluetooth y ofrece una mayor velocidad de transferencia y un menor consumo de energía. La Gigabyte Z790 Gaming X AX incluye un adaptador Bluetooth 5.3 que proporciona velocidades de hasta 5.3 Mbps.', 'Gigabyte', 0),
(666, 'Asus TUF B550M-Plus - Placa base AM4 micro-ATX', 'https://www.neobyte.es/35739-large_default/placa-base-asus-tuf-gaming-b550m-plus.jpg', 124.9, 'La Asus TUF B550M-Plus destila rendimiento gaming por los cuatro costados. Esta placa base ha sido fabricada a partir de un diseño robusto, sometida a múltiples pruebas para garantizar su durabilidad y resistencia. Un modelo que incluye diferentes funciones gaming y que integra una solución de energía mejorada y un conjunto de opciones de refrigeración para garantizar un funcionamiento estable y potente. Disfruta del gaming más inmersivo a través de experiencia de juego mejorada, con conexiones de red ultra-rápidas, un audio de calidad, iluminación RGB Aura Sync... ¡Hazte con la Asus TUF B550M-Plus en Neobyte!', 'Asus', 0),
(667, 'Asus TUF Gaming X670E-Plus - Placa base AMD AM5', 'https://www.neobyte.es/79979-large_default/asus-tuf-gaming-x670e-plus-placa-base-amd-am5.jpg', 299.9, 'La Asus TUF Gaming X670E-Plus es una placa base con socket AM5 para procesadores Ryzen de la serie 7000 con la que podrás configurar un ordenador potente para jugar y trabajar. A su sólida construcción suma una conectividad avanzada y la última tecnología en almacenamiento, refrigeración, etc. Dispone de cuatro ranuras DDR5 para memoria RAM y cuatros slots M.2 para SSD. ¡Hazte con ella en Neobyte!', 'Asus', 0),
(668, 'Asus TUF Gaming B660M-Plus D4 - Placa base 1700 micro-ATX', 'https://www.neobyte.es/62216-large_default/asus-tuf-gaming-b660m-plus-d4-placa-base-1700-micro-atx.jpg', 171.9, 'Asus TUF Gaming B660M-Plus D4 - Placa base 1700 micro-ATX', 'Asus', 0),
(669, 'Asus Prime B550M-K - Placa base AM4 micro-ATX', 'https://www.neobyte.es/35756-large_default/asus-prime-b550m-k-placa-base-am4-micro-atx.jpg', 96.9, 'Diseñada para desatar todo el potencial de los procesador Ryzen de 3ª generación, la Asus Prime B550M-K se ajustará perfectamente a configuraciones compactas en las que el ahorro de espacio sea importante. Una placa base de construcción sólida que integra tecnología innovadora para maximizar aspectos como la refrigeración, el almacenamiento o la conectividad, y que ha sabido cuidar los pequeños detalles para ofrecer siempre un rendimiento óptimo. Hazte con la placa base Asus Prime B550M-K al precio más competitivo en Neobyte.', 'Asus', 0),
(670, 'Asus Prime B550M-K ARGB - Placa base AM4 Micro-ATX', 'https://www.neobyte.es/102642-large_default/asus-prime-b550m-k-argb-placa-base-am4-micro-atx.jpg', 109.89, 'PLACA BASE ASUS PRIME B550M-K ARGB', 'Asus', 0),
(671, 'Gigabyte Z790 AORUS Elite AX - Placa base 1700 ATX', 'https://www.neobyte.es/85243-large_default/gigabyte-z790-aorus-elite-ax-placa-base-1700-atx.jpg', 258.99, 'La placa base admite hasta un puerto Thunderbolt 4, que ofrece velocidades de transferencia de hasta 40 Gbps. Además, la placa base admite hasta 6 puertos USB 4.0, que ofrecen velocidades de transferencia de hasta 40 Gbps.', 'Gigabyte', 0),
(672, 'Asus TUF Gaming B650-Plus WiFi - Placa base AM5 ATX', 'https://www.neobyte.es/81861-large_default/asus-tuf-gaming-b650-plus-wifi-placa-base-am5-atx.jpg', 249.89, 'La Asus TUF Gaming B650-Plus WiFi te permitirá sacar todo el rendimiento de los procesadores AMD Ryzen serie 7000. Una placa base con prestaciones gaming de primer nivel y componentes de gran calidad que aseguran un funcionamiento duradero. Es compatible con memorias RAM DDR5 y ha sido provista de una conectividad de última generación para que configures un PC acorde a tus necesidades. Cómprala en la tienda online de Neobyte.', 'Asus', 0),
(673, 'Asus TUF Gaming Z790-Plus Wifi - Placa base 1700 ATX', 'https://www.neobyte.es/87513-large_default/asus-tuf-gaming-z790-plus-wifi-placa-base-1700-atx.jpg', 249.89, 'Además de su rendimiento excepcional, la TUF Gaming Z790-Plus Wifi presenta un diseño estético que se puede personalizar. La iluminación RGB integrada permite ajustar la apariencia visual de tu sistema de acuerdo a tus preferencias, añadiendo un toque de estilo a tu configuración.', 'Asus', 0),
(674, 'Asus TUF Gaming B650M-Plus - Placa base AM5 Micro-ATX', 'https://www.neobyte.es/81646-large_default/asus-tuf-gaming-b650m-plus-placa-base-am5-micro-atx.jpg', 220.9, 'Tuf Gaming B650m-plus', 'Asus', 0),
(675, 'Asus TUF Gaming B550-Plus Placa base AM4 ATX', 'https://www.neobyte.es/35729-large_default/asus-tuf-gaming-b550-plus-placa-base-am4-atx.jpg', 108.9, 'Asus TUF Gaming B550-Plus es la placa base en la que puedes confiar y ya está disponible en Neobyte para que configures tu ordenador con procesador AMD Ryzen y disfrutes de lo último al precio más ajustado. Este modelo ha sido fabricado con componentes de grado militar y cuenta con un conjunto de opciones de refrigeración que garantizan una estabilidad superior y un rendimiento excepcional a todos los niveles. Provisto de zócalo AM4, 4 ranuras DIMM, 2 slots M.2 y una completa conectividad (USB-C, HDMI, LAN 2.5G, DisplayPort...), está preparada sacar todo el partido a los componentes más actuales.', 'Asus', 0),
(676, 'Asus TUF Gaming B760-Plus WiFi - Placa base 1700 ATX', 'https://www.neobyte.es/90215-large_default/asus-tuf-gaming-b760-plus-wifi-placa-base-1700-atx.jpg', 198.9, 'El diseño del VRM (Voltage Regulator Module) de 14+2 fases proporciona una entrega de energía estable y eficiente a los componentes críticos del sistema. Esto mejora la capacidad de overclocking y garantiza un funcionamiento estable incluso en condiciones de alta carga.', 'Asus', 0),
(677, 'Gigabyte B650M DS3H - Placa base AM5 Micro-ATX', 'https://www.neobyte.es/84551-large_default/gigabyte-b650m-ds3h-placa-base-am5-micro-atx.jpg', 165.9, 'El audio de alta definición con protección contra interferencias asegura una experiencia de sonido inmersiva y de alta fidelidad, ideal para gaming, entretenimiento multimedia y aplicaciones de audio exigentes.', 'Gigabyte', 0),
(678, 'Asus Prime B760M-K D4 - Placa base 1700 Micro-ATX', 'https://www.neobyte.es/86647-large_default/asus-prime-b760m-k-d4-placa-base-1700-micro-atx.jpg', 94.89, 'El PCIe 4.0 es la generación anterior de PCIe y ofrece velocidades de transferencia más lentas que el PCIe 5.0. Admite dos ranuras PCIe 4.0 para conectar dispositivos PCIe 4.0.', 'Asus', 0),
(679, 'Asus TUF Gaming B650M-Plus WiFi - Placa base AM5 Micro-ATX', 'https://www.neobyte.es/81638-large_default/asus-tuf-gaming-b650m-plus-wifi-placa-base-am5-micro-atx.jpg', 194.89, 'Tuf Gaming B650m-plus Wifi', 'Asus', 0),
