(681, 'MSI Pro B650M-P - Placa base AM5 Micro-ATX', 'https://www.neobyte.es/100907-large_default/msi-pro-b650m-p-placa-base-am5-micro-atx.jpg', 124.9, 'MSI Pro B650M-P - Placa base AM5 Micro-ATX', 'MSI', 0),
(682, 'Asus ROG Strix Z790-F Gaming WiFi II - Placa base 1700 ATX', 'https://www.neobyte.es/104382-large_default/asus-rog-strix-z790-f-gaming-wifi-ii-placa-base-1700-atx.jpg', 457.9, 'Este modelo ofrece conectividad avanzada con múltiples puertos USB, ranuras PCIe y conexiones de almacenamiento ultrarrápidas. Además, integra conectividad WiFi de alta velocidad, proporcionando flexibilidad para redes inalámbricas sin sacrificar la velocidad y la estabilidad.', 'Asus', 0),
(683, 'Asus TUF Gaming B650-Plus - Placa base AM5 ATX', 'https://www.neobyte.es/81866-large_default/asus-tuf-gaming-b650-plus-placa-base-am5-atx.jpg', 200.9, 'Tuf Gaming B650-plus', 'Asus', 0),
(684, 'Asus Prime A520M-K - Placa base AM4 micro-ATX', 'https://www.neobyte.es/38338-large_default/placa-base-asus-prime-a520m-k.jpg', 63.9, 'La placa base micro-ATX Asus Prime A520M-K supone una opción asequible para disfrutar de las ventajas de los procesadores AMD Ryzen de 3ª generación. Su construcción con componentes de durabilidad sensacional la convierten en una alternativa perfecta para un uso diario en entornos poco exigentes. Entre sus características más importante, destacar la ranura para SSD M.2, así como los puertos USB 3.2, lo que simplifica la vinculación con tus periféricos. Configura tu ordenador con la Asus Prime A520M-K en Neobyte.', 'Asus', 0),
