(687, 'MSI A520M-A Pro - Placa base AM4 micro-ATX', 'https://www.neobyte.es/44830-large_default/placa-base-msi-am4-a520m-a-pro.jpg', 65.9, 'MSI A520M-A Pro, una opcion asequible pero de garantías que permite configurar, al mejor precio, tu ordenador doméstico o de oficina. Una placa base ensamblada con componentes de gran calidad para ofrecer un rendimiento sensacional y una durabilidad fantástica. En cuanto a las especificaciones más importantes de la MSI A520M-A Pro, destacar el socket AM4 para procesadores Ryzen, las dos ranuras para memoria RAM, el slot M.2 y los mútliples puertos USB.', 'MSI', 0),
(688, 'Asus Prime A620M-K - Placa base AM5 Micro-ATX', 'https://www.neobyte.es/98195-large_default/asus-prime-a620m-k-placa-base-am5-micro-atx.jpg', 116.9, 'PLACA BASE ASUS PRIME A620M-K', 'Asus', 0),
(689, 'Gigabyte B550M DS3H - Placa base AM4 micro-ATX', 'https://www.neobyte.es/36067-large_default/gigabyte-b550m-ds3h-placa-base-am4-micro-atx.jpg', 95.9, 'Durabilidad, potencia, estabilidad... la placa base Gigabyte B550M DS3H presenta múltiples funcionalidades con las que maximizarás las posibilidades de tu PC. Un modelo con formato micro-ATX que se adaptará sin problema a equipos compactos y que es compatible con procesadores Ryzen de 3ª generación. Cuenta con un diseño de alimentación optimizado, así como con un sistema de refrigeración excelente y una gran conectividad. Además, es compatible con PCIe 4.0 para un mayor ancho de banda y baja impedancia y RGB Fusion. Hazte con la Gigabyte B550M DS3H en Neobyte.', 'Gigabyte', 0),
(690, 'Gigabyte A520M-DS3H v2 - Placa base AM4 Micro-ATX', 'https://www.neobyte.es/104294-large_default/gigabyte-a520m-ds3h-v2-placa-base-am4-micro-atx.jpg', 68.9, 'Gigabyte A520M-DS3H v2 - Placa base AM4 Micro-ATX', 'Gigabyte', 0),
(691, 'Corsair Vengeance 16GB DDR5 5200MHz CL40 - Memoria RAM', 'https://www.neobyte.es/76069-large_default/corsair-vengeance-16gb-ddr5-5200mhz-cl40-memoria-ram.jpg', 53.89, 'La latencia CL40 garantiza una rápida respuesta de la memoria, lo que significa que esta memoria RAM tiene tiempos de acceso ultrarrápidos para un rendimiento fluido y una mayor capacidad de respuesta en todo tipo de aplicaciones, desde juegos hasta procesamiento de datos intensivo.', 'Corsair', 0),
(692, 'Corsair Vengeance LPX 16GB DDR4 3600 Mhz - Memoria RAM', 'https://www.neobyte.es/46535-large_default/memoria-corsair-vengeance-lpx-16gb-ddr4-3600mhz.jpg', 41.89, 'Diseñada para dar el máximo en equipos de alto rendimiento, la memoria Corsair Vengeance LPX 16GB DDR4 3600 Mhz se convertirá en un componente esencial en tu PC. Un modelo con disipador de aluminio puro para una disipación más rápida del calor que ha sido ampliamente probado para asegurar su compatibilidad con prácticamente cualquier placa base del mercado. La Corsair Vengeance LPX 16GB DDR4 3600 Mhz presenta un formato de pequeñas dimensiones que la hacen perfecta para todo tipo de chasis. ¡Hazte con ella en Neobyte!', 'Corsair', 0),
(693, 'Kingston 8GB DDR4 2666 SODIMM KVR26S19S8/8', 'https://www.neobyte.es/39008-large_default/memoria-kingston-8gb-ddr4-2666-kvr26s19s88.jpg', 20.9, 'Equipa tu portátil o mini PC con la memoria RAM Kingston 8GB DDR4 2666 SODIMM KVR26S19S8/8 para disfrutar de un funcionamiento estable y rápido. Un modelo fabricado con componentes de calidad, lo que asegura durabilidad y rendimiento. ¡Hazte con la Kingston 8GB DDR4 2666 SODIMM KVR26S19S8/8 en Neobyte!', 'Kingston', 0),
