(695, 'Kingston Fury Beast 16GB DDR5 5200MHz CL40 - Memoria RAM', 'https://www.neobyte.es/60498-large_default/kingston-fury-beast-16gb-ddr5-5200mhz-cl40-memoria-ram.jpg', 59.9, 'Diseñadas con un disipador térmico eficiente, las memorias Kingston Fury Beast DDR5 ayudan a mantener temperaturas óptimas incluso durante cargas de trabajo prolongadas. Esto contribuye a la estabilidad del sistema y al mantenimiento del rendimiento en niveles óptimos.', 'Kingston', 0),
