(697, 'Kingston Fury Beast 8GB DDR3 1600MHz CL10 - Memoria RAM', 'https://www.neobyte.es/53506-large_default/kingston-fury-beast-8gb-ddr3-1600mhz-cl10-memoria-ram.jpg', 42.89, 'MEMORIA KINGSTON FURY BEAST 8GB DDR3 1600MHz (AZUL)', 'Kingston', 0),
(698, 'Kingston Fury Beast 16GB DDR4 3200MHz CL16- Memoria RAM', 'https://www.neobyte.es/52803-large_default/kingston-fury-beast-16gb-ddr4-3200mhz-cl16-memoria-ram.jpg', 39.91, 'Con la memoria RAM Kingston Fury Beast 16GB DDR4 3200MHz desafiaras los límites del rendimiento. Este componente está diseñado para que puedas jugar, editar o ejecutar cualquier tarea con las máximas garantías, presentando una combinación de especificaciones técnicas en las que destacan su capacidad de 16GB, velocidades de hasta 3200MHz y la incorporación de un disipador de bajo perfil capaz de regular la temperatura a la perfección. ¡Incorpora la Kingston Fury Beast 16GB DDR4 3200MHz en tu equipo y empieza a sentir su potencia!', 'Kingston', 0),
