(703, 'Corsair Vengeance RGB 32GB (2x16GB) 6000MHz DDR5 CL36 - Memoria RAM', 'https://www.neobyte.es/105239-large_default/corsair-vengeance-rgb-32gb-2x16gb-6000mhz-ddr5-cl36-memoria-ram.jpg', 122.9, 'Corsair Vengeance RGB 32GB (2x16GB) DDR5 6000MHz CL36 ofrece un rendimiento superior con frecuencias más altas y mayores capacidades, optimizado para placas base Intel. Ilumina tu PC con diez zonas RGB dinámicas y personalizables por módulo. Experimenta una velocidad sin precedentes con la DDR5, perfecta para multitareas intensivas y tareas complejas. La regulación de voltaje integrada con iCUE proporciona overclocking estable y afinado. Disfruta de perfiles personalizados con Intel XMP 3.0 y amplia compatibilidad con las últimas placas base DDR5 de Intel. Eleva el rendimiento de tu sistema al siguiente nivel.', 'Corsair', 0),
(704, 'Corsair Vengeance LPX 16GB DDR4 3200 MHz - Memoria RAM', 'https://www.neobyte.es/24814-large_default/memoria-corsair-16gb-ddr4-3200-vengeance-lpx.jpg', 37.9, 'La memoria RAM Corsair Vengeance LPX 16GB DDR4 3200 MHz añade más velocidad a tu equipo y proporciona la máxima fiabilidad que buscas. De tamaño compacto y fabricada con materiales de primera calidad, ofrece una estabilidad de funcionamiento sensacional gracias a su disipador de aluminio anodizado. Monta o actualiza tu equipo con este módulo de RAM Corsair Vengeance LPX 16GB DDR4 a 3200 MHz, ahora al precio más ajustado en Neobyte.', 'Corsair', 0),
(705, 'Memoria Kingston 4GB DDR3 1600 KVR16S11S8/4 SODIMM', 'https://www.neobyte.es/5920-large_default/memoria-kingston-4gb-ddr3-1600-kvr16s11s8-4-sodimm.jpg', 23.9, 'Un funcionamiento fluido de tu ordenador pasa por una memoria RAM de garantías. La Kingston KVR16S11S8/4 de 4GB es capaz de afrontar los procesos más exigentes, evitando que el ordenador se vea mermado cuando más lo necesitas y aportando velocidad al realizar las tareas. El componente perfecto lleva el sello Kingston.', 'Kingston', 0),
(706, 'Corsair Vengeance 32GB (2x16GB) DDR5 6000MHz CL36 - Memoria RAM', 'https://www.neobyte.es/105224-large_default/corsair-vengeance-32gb-2x16gb-ddr5-6000mhz-cl36-memoria-ram.jpg', 124.9, 'Corsair Vengeance DDR5 redefine el rendimiento de tu sistema con un kit de memoria de 32GB (2x16GB) a 6000MT/s CL36. Este poderoso componente, optimizado para placas base Intel, ofrece frecuencias rápidas y mayores capacidades en un módulo compacto de alta calidad. La memoria DDR5 te permite superar los límites de tu sistema, brindando velocidades sin precedentes para satisfacer las demandas de CPUs de alto rendimiento en la era de los múltiples núcleos. Con regulación de voltaje integrada y control a través del software iCUE, el overclocking es más fácil y estable que nunca. Además, disfruta de perfiles Intel XMP 3.0 personalizados para optimizar el rendimiento según tus necesidades. Con Corsair Vengeance DDR5, tu sistema está listo para el rendimiento de vanguardia. ¡Sobrepasa las expectativas con facilidad y estilo!', 'Corsair', 0),
(707, 'Corsair Vengeance LPX 16GB (2x8) DDR4 3200 MHz - Kit memoria RAM', 'https://www.neobyte.es/34267-large_default/memoria-corsair-16gb-2x8-ddr4-3200-vengeance-lpx.jpg', 41.89, 'Kit de memoria RAM Corsair Vengeance LPX 16GB (2x8) DDR4 3200 MHz, una opción perfecta para ordenadores gaming y estaciones de trabajo por su extraordinaria relación rendimiento-precio. Un pack formado por dós módulos de 8GB que incluyen disipador de aluminio anodizado de color negro y es capaz de trabajar a 3200Mhz. Hazte ya con la Corsair Vengeance LPX 16GB (2x8) DDR4 3200 MHz en Neobyte.', 'Corsair', 0),
(708, 'Corsair Vengeance 32GB (2x16GB) DDR5 6400MHz CL32 - Memoria RAM', 'https://www.neobyte.es/105230-large_default/corsair-vengeance-32gb-2x16gb-ddr5-6400mhz-cl32-memoria-ram.jpg', 145.9, 'Corsair Vengeance DDR5 lleva el rendimiento de tu sistema al siguiente nivel con un kit de memoria de 32GB (2x16GB) a 6400MT/s CL36. Este componente poderoso está optimizado para placas base Intel ofrece frecuencias ultra rápidas y mayores capacidades en un módulo compacto de alta calidad. La memoria DDR5 te permite superar los límites de tu sistema con velocidades sin precedentes, adecuadas para satisfacer las demandas de CPUs de alto rendimiento en la era de los múltiples núcleos. Con regulación de voltaje integrada y control mediante el software iCUE, el overclocking es más sencillo y estable que nunca. Además, aprovecha los perfiles Intel XMP 3.0 personalizados para optimizar el rendimiento según tus necesidades. Con Corsair Vengeance DDR5 a 6400MHz, tu sistema está preparado para el rendimiento de vanguardia. ¡Supera las expectativas con facilidad y estilo!', 'Corsair', 0),
(709, 'Corsair Vengeance LPX 32GB (2x16) DDR4 3200MHz - Memoria RAM', 'https://www.neobyte.es/42038-large_default/memoria-corsair-vengeance-lpx-32gb-2x16-ddr4-3200mhz.jpg', 69.89, 'La Corsair Vengeance LPX 32GB (2x16) DDR4 3200MHz es la memoria RAM perfecta para tu PC de alto rendimiento. Con ella obtendrás estabilidad, velocidad y fiabilidad para jugar y trabajar. Cuenta con un disipador de aluminio puro, lo que facilita una disipación térmica más rápida, y diseño de perfil bajo que irá como anillo al dedo para las configuraciones más compactas. Es compatible con la mayoría de placas base del mercado y con el perfil XMP 2.0. Hazte ya con la memoria Corsair Vengeance LPX 32GB (2x16) DDR4 3200MHz en Neobyte y disfruta del mejor rendimiento.', 'Corsair', 0),
(710, 'Corsair Vengeance RGB 32GB (2x16GB) 6000MHz DDR5 CL36 AMD Expo - Memoria RAM', 'https://www.neobyte.es/106230-large_default/corsair-vengeance-rgb-32gb-2x16gb-6000mhz-ddr5-cl36-amd-expo-memoria-ram.jpg', 125.89, 'Además, disfruta de la iluminación dinámica RGB en diez zonas, personalizable a través del software iCUE, que brinda un toque vibrante a tu sistema. Con regulación de voltaje integrada y control total mediante iCUE, el overclocking es más sencillo y estable. Olvídate de los ajustes manuales con perfiles AMD Expo personalizados y maximiza la eficiencia de tu sistema. Corsair Vengeance RGB DDR5 ofrece un rendimiento de vanguardia, superando expectativas con facilidad y estilo.', 'Corsair', 0),
(711, 'MEMORIA KINGSTON 16GB DDR4 SODIMM 3200 MHZ', 'https://www.neobyte.es/54852-large_default/memoria-kingston-16gb-ddr4-sodimm-3200-mhz.jpg', 38.9, 'MEMORIA KINGSTON 16GB DDR4 SODIMM 3200 MHZ', 'Kingston', 0),
(712, 'Corsair Vengeance Pro RGB 32GB (2x16GB) DDR4 3200 MHz - Kit memoria RAM', 'https://www.neobyte.es/45195-large_default/corsair-vengeance-pro-rgb-32gb-2x16gb-ddr4-3200-mhz-kit-memoria-ram.jpg', 81.89, 'El kit de memorias Corsair Vengeance Pro RGB 32GB (2x16GB) DDR4 3200 MHz de alto rendimiento incluye iluminación RGB dinámica. Diseñado para placas base Intel y AMD DDR4, garantiza ancho de banda máximo y tiempos de respuesta ajustados. La instalación es fácil, sin cables adicionales, y cuenta con características para overclocking, incluyendo difusores térmicos de aluminio. Compatible con XMP 2.0 para una configuración sencilla y respaldado por una garantía limitada de por vida, es ideal para usuarios que buscan rendimiento y estética en su sistema.', 'Corsair', 0),
(713, 'Corsair Vengeance 64GB (2x32GB) DDR5 5600MHz CL40 - Memoria RAM', 'https://www.neobyte.es/71205-large_default/corsair-vengeance-64gb-2x32gb-ddr5-5600mhz-cl40-memoria-ram.jpg', 199.89, 'Además, con una amplia compatibilidad optimizada para las placas base Intel DDR5 más recientes, la Corsair Vengeance DDR5 es la elección perfecta para impulsar tu sistema al siguiente nivel. ¡Bienvenido al rendimiento excepcional con estilo negro elegante!', 'Corsair', 0),
