(715, 'Corsair Vengeance LPX 32GB (2x16) DDR4 3600MHz - Memoria RAM', 'https://www.neobyte.es/42040-large_default/memoria-corsair-vengeance-lpx-32gb-2x16-ddr4-3600mhz.jpg', 78.89, '¿Buscas una memoria RAM para tu PC de alto rendimiento? Con la Corsair Vengeance LPX 32GB (2x16) DDR4 3600MHz obtendrás estabilidad, velocidad y fiabilidad. Cuenta con un disipador de aluminio puro, lo que facilita una disipación térmica más rápida, y diseño de perfil bajo para adaptarse a las configuraciones más compactas. Es compatible con la mayoría de placas base del mercado y con el perfil XMP 2.0. Compra la Corsair Vengeance LPX 32GB (2x16) DDR4 3600MHz en Neobyte y disfruta del mejor rendimiento en tu PC.', 'Corsair', 0),
(716, 'Corsair Vengeance 64GB (2x32GB) DDR5 6400MHz CL32 - Memoria RAM', 'https://www.neobyte.es/105233-large_default/corsair-vengeance-64gb-2x32gb-ddr5-6400mhz-cl32-memoria-ram.jpg', 249.89, '¡Eleva tu rendimiento con Corsair Vengeance DDR5 de 64GB (2x32GB) a 6400MHz CL32! Diseñada para placas base Intel, esta memoria compacta ofrece frecuencias y capacidades líderes en DDR5, proporcionando un rendimiento excepcional. Conquista tareas intensivas con facilidad a 6400MHz y hazlo todo más rápido. Controla la potencia con regulación de voltaje integrada y iCUE para overclocking sencillo y personalizado. Optimizada para las últimas placas base Intel DDR5, Corsair Vengeance DDR5 es la elección perfecta para un rendimiento supremo. ¡Potencia tu sistema con estilo!', 'Corsair', 0),
(717, 'Corsair Vengeance LPX 16GB (2x8GB) DDR4 3600 MHz - Kit memoria RAM', 'https://www.neobyte.es/34150-large_default/memoria-corsair-16gb-28-ddr4-3600-vengeance-lpx.jpg', 42.89, '¿Buscas estabilidad y rendimiento en tu PC? Las memorias Corsair Vengeance LPX 16GB (2x8GB) DDR4 3600 MHz cuentan con un disipador de calor de aluminio puro, lo que garantiza una disipación térmica más rápida y favorece un funcionamiento más estable. Un modelo que hace gala de una extensa compatibilidad con la mayoría de placas y que cuenta con un formato de pequeñas dimensiones que lo harán adaptarse perfectamente a los chasis más compactos. Hazte con la Corsair Vengeance LPX 16GB (2x8GB) DDR4 3600 MHz en Neobyte y disfruta de todo su potencial.', 'Corsair', 0),
(718, 'Kingston Fury Renegade RGB 32GB (2x16GB) DDR5 6000MHz CL32 - Memoria RAM', 'https://www.neobyte.es/97089-large_default/kingston-fury-renegade-rgb-32gb-2x16gb-ddr5-6000mhz-cl32-memoria-ram.jpg', 153.9, 'Kingston Fury Renegade 32GB (2x16GB) DDR5 RGB 6000MHz CL32 - Memoria RAM', 'Kingston', 0),
(719, 'Corsair Vengeance LPX 16GB (2x8GB) DDR4 3200MHz CL16 - Memoria RAM', 'https://www.neobyte.es/16324-large_default/corsair-vengeance-lpx-16gb-2x8gb-ddr4-3200mhz-cl16-memoria-ram.jpg', 43.9, 'La memoria RAM Corsair Vengeance LPX de 16GB DDR4 a 3200 Mhz está formada por 2 módulos de 8GB que propulsarán tu ordenador de alto rendimiento al siguiente nivel. Con el objetivo de garantizar una temperatura de funcionamiento óptima incluso es los momentos de mayor exigencia, este modelo incorpora disipador de aluminio anodizado que conduce el calor de forma eficiente hacia el exterior. Equípate con lo último al mejor precio en Neobyte.', 'Corsair', 0),
(720, 'G.Skill Ripjaws V 32GB (2x16GB) DDR4 3200MHz CL18 - Memoria RAM', 'https://www.neobyte.es/90966-large_default/gskill-ripjaws-v-32gb-2x16gb-ddr4-3200mhz-cl18-memoria-ram.jpg', 75.89, 'G.Skill Ripjaws V 32GB (2x16GB) DDR4 3200MHz CL18 - Memoria RAM', 'G Skill', 0),
(721, 'Kingston Fury Renegade 16GB DDR5 6000MHz CL32 - Memoria RAM', 'https://www.neobyte.es/88249-large_default/kingston-fury-renegade-16gb-ddr5-6000mhz-cl32-memoria-ram.jpg', 74.9, 'Kingston Fury Renegade 16GB DDR5 6000MHz CL32 - Memoria RAM', 'Kingston', 0),
(722, 'Kingston 32GB DDR4 2666MHz - Memoria RAM SODIMM', 'https://www.neobyte.es/57684-large_default/kingston-32gb-ddr4-2666mhz-memoria-ram-sodimm.jpg', 71.9, 'La Kingston 32GB DDR4 2666MHz (KVR26S19D8/32) es una memoria RAM para portátil y mini PC que destaca por su funcionamiento estable y rápido. Un modelo de gran capacidad que alcanza una frecuencia máxima de 2666 Mhz que aportará a tu equipo gran fluidez en el funcionamiento. Compra ya esta memoria RAM SODIMM al mejor precio en la tienda online de Neobyte.', 'Kingston', 0),
(723, 'NFortec Atria X 240 - Refrigeración líquida 240mm', 'https://www.neobyte.es/99717-large_default/nfortec-atria-x-240-refrigeracion-liquida-240mm.jpg', 89.95, 'Si necesitas una refrigeración líquida con radiador de 240 mm te presentamos la mejor alternativa: NFortec Atria X 240 Negra. Un modelo que incorpora iluminación aRGB para que la integres en tu equipo gaming y disfrutes de espectaculares efectos. Cuenta, además, con dos ventiladores que proporcionan un flujo de aire óptimo para favorecer la disipación del calor. Cómprala ya en nuestra tienda online y recíbela en tiempo récord.', 'Nfortec', 0),
(724, 'Be Quiet! MC1 - Disipador para M.2', 'https://www.neobyte.es/98888-large_default/be-quiet-mc1-disipador-para-m-2.jpg', 11.89, 'Be Quiet! MC1 - Disipador para M.2', 'Bequiet', 0),
(725, 'Corsair AF140 RGB Elite (Pack de 2) - Ventilador caja 140mm', 'https://www.neobyte.es/87444-large_default/corsair-af140-rgb-elite-pack-de-2-ventilador-caja-140mm.jpg', 75.9, 'Corsair AF140 RGB Elite (Pack de 2) - Ventilador caja 140mm', 'Corsair', 0),
(726, 'Be Quiet! Shadow Rock 3 - Refrigeración CPU', 'https://www.neobyte.es/36981-large_default/be-quiet-shadow-rock-3-refrigeracion-cpu.jpg', 54.89, 'A la impresionante capacidad de refrigeración del Be Quiet! Shadow Rock 3 se suma también un funcionamiento silencioso que convencerá por completo a los usuarios más exigentes. Un disipador para CPU diseñado para equipos de alto rendmiento, dotado de construcción asimétrica que hace posible que pueda ser instalado en casi cualquier placa y sin bloquear las ranuras de memoria. Cuenta con ventilador Shadow wings 2 de 120 mm con aletas de alta velocidad, que funciona a 24,4 dB(A) al 100% de velocidad. Hazte con el Be Quiet! Shadow Rock 3 en Neobyte.', 'Bequiet', 0),
(727, 'Corsair AF140 RGB Elite Blanco (Pack de 2) - Ventilador caja 140mm', 'https://www.neobyte.es/87464-large_default/corsair-af140-rgb-elite-blanco-pack-de-2-ventilador-caja-140mm.jpg', 75.9, 'Corsair AF140 RGB Elite Blanco (Pack de 2) - Ventilador caja 140mm', 'Corsair', 0),
(728, 'Corsair iCUE H100i Elite Capellix XT Blanca - Refrigeración líquida 240mm', 'https://www.neobyte.es/87328-large_default/corsair-icue-h100i-elite-capellix-xt-blanca-refrigeracion-liquida-240mm.jpg', 159.9, 'En conclusión, la Corsair iCUE H100i Elite Capellix XT Blanca no solo redefine la refrigeración líquida con su enfoque innovador, sino que también ofrece una combinación de rendimiento y estética. Desde los ventiladores silenciosos hasta el impresionante cabezal de bombeo con LED, este sistema no solo mantiene el calor bajo control, sino que también eleva la apariencia general de cualquier sistema en el que se instale.', 'Corsair', 0),
(729, 'Noctua NH-U12S chromax.black - Refrigeración CPU', 'https://www.neobyte.es/64940-large_default/noctua-nh-u12s-chromaxblack-refrigeracion-cpu.jpg', 86.89, 'Además, para aquellos que desean mejorar aún más el rendimiento, se ofrece la opción de agregar un segundo ventilador NF-F12 PWM chromax.black.swap. El disipador incluye ganchos de ajuste de ventilador y paneles anti-vibración adicionales, diseñados específicamente para permitir la separación del ventilador trasero en 5 mm, mejorando la acústica en configuraciones de dos ventiladores y brindando flexibilidad a los usuarios que buscan una solución de enfriamiento más potente. En resumen, el Noctua NH-U12S chromax.black es la combinación perfecta de rendimiento, estética y versatilidad, respaldada por la calidad y la confiabilidad que ofrece Noctua.', 'Noctua', 0),
(730, 'Corsair iCUE H100i RGB Elite - Refrigeración líquida 240mm', 'https://www.neobyte.es/72223-large_default/corsair-icue-h100i-rgb-elite-refrigeracion-liquida-240mm.jpg', 165.89, 'Corsair iCUE H100i RGB ELITE, el campeón de la refrigeración líquida. Con un refinado diseño que combina estilo e iluminación dinámicos, esta serie ELITE ofrece una refrigeración óptima con un aspecto moderno gracias a sus 16 LED RGB. Personaliza efectos de iluminación sorprendentes con el software CORSAIR iCUE, que te permite ajustar velocidades, controlar la iluminación RGB y monitorear temperaturas desde una interfaz única e intuitiva. Los ventiladores AF ELITE Series y la bomba de alto rendimiento garantizan un rendimiento excepcional. Además, disfruta de modos de refrigeración especializados y una instalación sin esfuerzo gracias al soporte de montaje sin herramientas y la amplia compatibilidad con los últimos zócalos de Intel y AMD. La refrigeración que necesitas con el control que deseas.', 'Corsair', 0),
(731, 'Corsair iCUE SP120 RGB ELITE Blanco - Ventilador caja 120mm', 'https://www.neobyte.es/60159-large_default/corsair-icue-sp120-rgb-elite-blanco-ventilador-caja-120mm.jpg', 21.9, 'VENTILADOR CORSAIR SP120 BLANCO RGB ICUE ELITE', 'Corsair', 0),
(732, 'Noctua NH-D15S - Refrigeración CPU', 'https://www.neobyte.es/80860-large_default/noctua-nh-d15s-refrigeracion-cpu.jpg', 99.9, 'Mejorando la versión anterior, el Noctua NH-D15S cuenta con un diseño inclinado y asimétrico con un solo ventilador, lo que le permite ofrecer un excelente rendimiento manteniendo la compatibilidad con RAM y PCIe. Además, si buscas un mayor rendimiento (y tienes espacio suficiente), puedes añadir un ventilador de 120mm o un ventilador redondo de 140 mm en la parte frontal del conjunto de aletas. Y es que gracias a su sistema de montaje multi-socket SecuFirm2 y al compuesto térmico NT-H1, el Noctua NH-D15S es una solución completa y de gran calidad que combina la eficiencia de la doble torre con una excelente compatibilidad y con opciones de actualización flexibles.', 'Noctua', 0),
(733, 'Corsair iCUE H100i Elite LCD XT - Refrigeración líquida 240mm', 'https://www.neobyte.es/87367-large_default/corsair-icue-h100i-elite-lcd-xt-refrigeracion-liquida-240mm.jpg', 308.9, 'En resumen, el Corsair iCUE H100i Elite LCD XT no solo ofrece una refrigeración potente y eficiente, sino que también añade un toque estético único con su pantalla LCD personalizada. La capacidad de personalización, combinada con el rendimiento sin compromisos, lo convierte en una opción atractiva para aquellos que buscan un equilibrio entre estética y funcionalidad en su sistema de refrigeración.', 'Corsair', 0),
(734, 'Corsair LL120 RGB Negro - Pack 3 ventiladores caja 120mm', 'https://www.neobyte.es/20387-large_default/ventilador-corsair-caja-ll120-rgb-120mm-negro-3.jpg', 109.9, 'Completa tu caja con este pack de 3 ventiladores Corsair LL 120 RGBen negro y personaliza tu PC a tu gusto. Cada ventilador incorpora un doble halo de iluminación RGB, lo que crea increíbles efectos de iluminación, así como una elegante carcasa en negro. Además, al ser compatible con Corsair iCUE podrás personalizar los efectos y sincronizarlos con otros productos también compatibles. Por supuesto, no nos olvidamos de su gran poder de refrigeración, que te permitirá controlar las temperaturas en el interior de tu PC con el mínimo ruido.', 'Corsair', 0),
(735, 'Noctua NH-U12S SE-AM4 - Refrigeración CPU', 'https://www.neobyte.es/80808-large_default/noctua-nh-u12s-se-am4-refrigeracion-cpu.jpg', 78.89, 'El Noctua NH-U12S SE-AM4 es un disipador de una sola torre, grosor reducido y diseñado especialmente para AMD AM4 que te convencerá por su excepcional rendimiento. Incorpora un ventilador NF-F12 PWM de 120 mm que se caracteriza por su funcionamiento silencioso, así como el componente térmico NT-H1, de gran eficiencia. Si estás pensando en una solución de refrigeración óptima para tu CPU AMD, la respuesta es Noctua NH-U12S SE-AM4.', 'Noctua', 0),
(736, 'Corsair iCUE H115i Elite Capellix XT - Refrigeración líquida 280mm', 'https://www.neobyte.es/87335-large_default/corsair-icue-h115i-elite-capellix-xt-refrigeracion-liquida-280mm.jpg', 231.9, 'En conclusión, el Corsair iCUE H115i Elite Capellix XT ofrece una solución completa con una refrigeración eficiente y estética impresionante. Desde el innovador diseño de disipación de calor hasta las características estéticas y de rendimiento, este sistema demuestra ser una opción atractiva para aquellos que buscan un equilibrio entre estilo y funcionalidad en su solución de refrigeración.', 'Corsair', 0),
(737, 'VENTILADOR CAJA CORSAIR ICUE SP120 RGB ELITE - KIT DE 3', 'https://www.neobyte.es/46807-large_default/ventilador-caja-corsair-icue-sp120-rgb-elite-kit.jpg', 75.9, 'Ventilador Caja Corsair Icue Sp120 Rgb Elite Kit', 'Corsair', 0),
(738, 'Be Quiet! Shadow Rock TF 2 - Refrigeración CPU', 'https://www.neobyte.es/80696-large_default/be-quiet-shadow-rock-tf-2-refrigeracion-cpu.jpg', 57.9, '¿Buscas la mejor refrigeración para tu CPU? Be Quiet! Shadow Rock TF 2 es un disipador compacto para CPU, perfecto para configuraciones con poco espacio, que encuentra el equilibrio entre prestaciones y precio. Cuenta con heat pipes de alto rendimiento y ventilador de 135 mm, el cual combina una alta capacidad de refrigeración con un funcionamiento silencioso. El Be Quiet! Shadow Rock TF 2 es la mejor solución para quienes buscan ahorrar espacio sin renunciar a las mejores prestaciones.', 'Bequiet', 0),
(739, 'Cooler Master Hyper 212 Halo White - Disipador CPU', 'https://www.neobyte.es/88796-large_default/cooler-master-hyper-212-halo-white-disipador-cpu.jpg', 39.89, 'El Hyper 212 Halo White presenta una iluminación RGB addressable que permite una personalización completa de la estética. Con múltiples efectos y opciones de color, puedes adaptar la apariencia de tu sistema según tus preferencias o esquema de iluminación existente. Además, ofrece un proceso de instalación sencillo y sin complicaciones. Su diseño de montaje intuitivo y los accesorios incluidos hacen que la instalación sea rápida y fácil, ahorrando tiempo y esfuerzo durante el ensamblaje del sistema.', 'Cooler Master', 0),
(740, 'Corsair AF120 RGB Elite (Pack de 3) - Ventilador caja 120mm', 'https://www.neobyte.es/87403-large_default/corsair-af120-rgb-elite-pack-de-3-ventilador-caja-120mm.jpg', 93.9, 'Corsair AF120 RGB Elite (Pack de 3) - Ventilador caja 120mm', 'Corsair', 0);
INSERT INTO `producto` (`id`, `nombre`, `imagen`, `precio`, `especificaciones`, `marca`, `id_categoria`) VALUES
(741, 'Asus ROG Strix LC II 240 aRGB White Edition - Refrigeración líquida 240mm', 'https://www.neobyte.es/74086-large_default/asus-rog-strix-lc-ii-240-argb-white-edition-refrigeracion-liquida-240mm.jpg', 152.9, 'El Asus ROG Strix LC II 240 aRGB White Edition está equipado con iluminación RGB Aura Sync. La iluminación RGB se puede personalizar con la aplicación Aura Sync de Asus para crear un aspecto personalizado para tu sistema.', 'Asus', 0),
(742, 'Asus ROG Ryuo III 240 aRGB - Refrigeración líquida 240mm', 'https://www.neobyte.es/80887-large_default/asus-rog-ryuo-iii-240-argb-refrigeracion-liquida-240mm.jpg', 214.9, 'El Asus ROG Ryuo III 240 aRGB está equipado con una pantalla AniMe Matrix. La pantalla AniMe Matrix es una pantalla OLED de 1,77 pulgadas que se puede personalizar con imágenes, animaciones o texto.', 'Asus', 0),
(743, 'DeepCool AK400 Blanca - Refrigeración CPU', 'https://www.neobyte.es/71534-large_default/deepcool-ak400-blanca-refrigeracion-cpu.jpg', 34.9, 'El ventilador PWM (modulación de ancho de pulso) ofrece un rendimiento de enfriamiento potente con niveles de ruido mínimos. Esto asegura una operación silenciosa incluso bajo cargas de trabajo intensas, creando un ambiente de trabajo o juego más tranquilo y cómodo.', 'DeepCool', 0),
(744, 'DeepCool AK500S Digital - Disipador CPU', 'https://www.neobyte.es/104062-large_default/deepcool-ak500s-digital-disipador-cpu.jpg', 49.89, 'El diseño del disipador está enfocado en minimizar el ruido, permitiendo un funcionamiento silencioso incluso a altas velocidades. Además, la estructura robusta y los materiales de alta calidad aseguran la estabilidad y durabilidad del cooler.', 'DeepCool', 0),
(745, 'Corsair iCUE H100i Elite Capellix XT - Refrigeración líquida 240mm', 'https://www.neobyte.es/87320-large_default/corsair-icue-h100i-elite-capellix-xt-refrigeracion-liquida-240mm.jpg', 209.9, 'Compra la refrigeración líquida Corsair iCUE H100i Elite Capellix XT en la tienda online de Neobyte y consigue resultados impresionantes. Este sistema todo en uno permite disipar el calor de la CPU de manera eficiente y silenciosa, lo que evita problemas de rendimiento y proporciona una mayor vida útil para los componentes. Incorpora dos ventiladores Corsair AF RGB ELIPTE PWM que, equipados con tecnología AirGuide, ofrecen un flujo de aire uniforme y silencioso para una disipación óptima del calor. Un modelo que no deja de lado la parte estética y que cuenta con iluminación RGB tanto en los ventiladores como en la bomba. ¡Hazte con ella ya y disfruta de un funcionamiento más fiable en tu PC!', 'Corsair', 0),
(746, 'DeepCool LT520 - Refrigeración líquida 240mm', 'https://www.neobyte.es/90577-large_default/deepcool-lt520-refrigeracion-liquida-240mm.jpg', 87.89, 'El LT520 cuenta con iluminación RGB personalizable que permite ajustar los colores y efectos luminosos según tu preferencia. Esta característica añade un toque estético y moderno a tu configuración.', 'DeepCool', 0),
(747, 'DeepCool AK620 Blanca - Refrigeración CPU', 'https://www.neobyte.es/71544-large_default/deepcool-ak620-blanca-refrigeracion-cpu.jpg', 59.9, 'El AK620 Blanco no solo se distingue por su capacidad de refrigeración excepcional, sino también por su funcionamiento silencioso. Equipado con dos ventiladores de 120 PWM con rodamientos fluidodinámicos, logra un equilibrio perfecto entre rendimiento y bajo nivel de ruido. En resumen, este disipador proporciona la combinación ideal de rendimiento avanzado, eficiencia de enfriamiento y funcionamiento silencioso para satisfacer las necesidades de los entusiastas del hardware.', 'DeepCool', 0),
(748, 'DeepCool LE720 - Refrigeración líquida 360mm', 'https://www.neobyte.es/105634-large_default/deepcool-le720-refrigeracion-liquida-360mm.jpg', 82.9, 'El líquida presenta iluminación RGB vibrante que permite una personalización visual. Con efectos de iluminación ajustables, añade un toque estético y moderno a tu sistema, complementando la estética de tu configuración.', 'DeepCool', 0),
(749, 'DeepCool AK500 WH Blanco - Refrigeración CPU', 'https://www.neobyte.es/89516-large_default/deepcool-ak500-wh-blanco-refrigeracion-cpu.jpg', 52.89, 'El AK500 WH destaca por su rendimiento frío, silencioso y potente, gracias al ventilador FK120 incluido que maximiza el flujo de aire y la presión estática cuando es necesario, ajustándose inteligentemente para una eficiencia silenciosa. Se incluyen un adaptador opcional de baja velocidad y pinzas de ventilador adicionales para personalizar y mejorar la refrigeración según las preferencias del usuario. En resumen, el DeepCool AK500 WH Blanco ofrece una solución de refrigeración avanzada con características innovadoras y versatilidad para satisfacer las demandas de sistemas de alto rendimiento.', 'DeepCool', 0),
(750, 'NZXT Kraken Elite 280 Negro - Refrigeración líquida 280mm', 'https://www.neobyte.es/95016-large_default/nzxt-kraken-elite-280-negro-refrigeracion-liquida-280mm.jpg', 179.89, 'NZXT Kraken Elite 280 Negro - Refrigeración líquida', 'NZXT', 0),
(751, 'Noctua NH-U12 S TR4-SP3 - Refrigeración CPU', 'https://www.neobyte.es/80849-large_default/noctua-nh-u12-s-tr4-sp3-refrigeracion-cpu.jpg', 74.9, 'El Noctua NH-U12 S TR4-SP3 se ha ganado su buena fama a base de resultados. Este disipador diseñado específicamente para socket TR4/SP3 permite un flujo de calor óptimo desde la base de la CPU hasta los heatpipes y sobre las aletas de refrigeración. Incorpora un potente ventilador NF-F12, que combina una magnífica presión estática, un excelente rendimiento de disipadores y un funcionamiento sorprendentemente silencioso. Es compatible con PWM para un control de velocidad automático a través de la placa base. No dejes que las altas temperaturas afecten al rendimiento de tu PC con el Noctua NH-U12S.', 'Noctua', 0),
(752, 'NFortec Atria X 360 - Refrigeración líquida 360mm', 'https://www.neobyte.es/99723-large_default/nfortec-atria-x-360-refrigeracion-liquida-360mm.jpg', 109.95, 'La refrigeración líquida NFortec Atria X 360 Negra destaca por su rendimiento y por su funcionamiento silencioso. Un modelo que incluye tres ventiladores de siete aspas con almohadillas anti-vibración que mejoran la eficiencia y reducen el ruido, lo que la hacen perfecta para todo tipo de equipos. No nos olvidamos de su espectacular iluminación aRGB, diseñada para ser sincronizada con el resto de tu ecosistema. Evita problemas de temperatura con la NFortec Atria X 360 Negra.', 'Nfortec', 0),
(753, 'NZXT Kraken Elite 240 - Refrigeración líquida 240mm', 'https://www.neobyte.es/102229-large_default/nzxt-kraken-elite-240-refrigeracion-liquida-240mm.jpg', 199.89, 'NZXT Kraken Elite 240 - Refrigeración líquida 240mm', 'NZXT', 0),
(754, 'Nfortec CAELUM - Ventilador caja 120mm', 'https://www.neobyte.es/85124-large_default/nfortec-caelum-ventilador-caja-120mm.jpg', 9.95, 'Nfortec CAELUM - Ventilador caja 120mm', 'Nfortec', 0),
(755, 'Western Digital Black SN770 1TB - Disco duro SSD M.2 NVMe', 'https://www.neobyte.es/67450-large_default/western-digital-black-sn770-1tb-disco-duro-ssd-m2-nvme.jpg', 79.9, 'Además, este SSD es compatible con la interfaz PCIe 4.0, aprovechando al máximo las últimas plataformas y proporcionando un ancho de banda notablemente mayor en comparación con generaciones anteriores. Esta característica es especialmente valiosa para aplicaciones que requieren una alta tasa de transferencia de datos.', 'Western Digital', 0),
(756, 'Seagate Barracuda 2TB - Disco duro 3.5 SATA', 'https://www.neobyte.es/18027-large_default/seagate-barracuda-2tb-disco-duro-35-sata.jpg', 58.9, 'El disco duro Seagate Barracuda de 2TB (ST2000DM008) es perfecto para ordenadores de sobremesa por su gran versatilidad y precio ajustado. Este HDD SATA de 3.5 posee una capacidad de 2TB, 7200 rpm y una memoria caché de 256MB para que disfrutes no solo de un extraordinario almacenamiento sino también de un rendimiento sensacional. Cómpralo en Neobyte al mejor precio y recíbelo en 24/48h.', 'Seagate', 0),
(757, 'Samsung T9 2TB - Disco duro SSD externo', 'https://www.neobyte.es/103661-large_default/samsung-t9-2tb-disco-duro-ssd-externo.jpg', 235.94, 'El T9 se destaca no solo por su inmensa capacidad y rapidez, sino también por su portabilidad y seguridad excepcionales. Con una capacidad de 2TB, este modelo combina un generoso espacio de almacenamiento con un diseño compacto y liviano, pesando solo 122 gramos. Su superficie rugosa y antideslizante garantiza un transporte cómodo y seguro. Esta combinación de características lo convierte en una opción sobresaliente para aquellos que valoran un dispositivo de almacenamiento rápido, seguro y adaptable, ideal para una variedad de usos y contextos.', 'Samsung', 0),
(758, 'Western Digital Black SN770 2TB - Disco duro SSD M.2 NVMe', 'https://www.neobyte.es/67453-large_default/western-digital-black-sn770-2tb-disco-duro-ssd-m2-nvme.jpg', 138.9, 'Además, este SSD es compatible con la interfaz PCIe 4.0, lo que significa que aprovecha al máximo las últimas plataformas y ofrece un ancho de banda significativamente mayor en comparación con generaciones anteriores. Esta característica es especialmente valiosa para aplicaciones que requieren una alta tasa de transferencia de datos.', 'Western Digital', 0),
