(770, 'Western Digital Purple 8TB - Disco duro 3,5', 'https://www.neobyte.es/46818-large_default/disco-duro-western-digital-purple-8tb-wd84purz.jpg', 214.9, 'Perfecto para sistemas de videovigilancia, el Western Digital Purple 8TB asegura un rendimiento espectacular. Cuenta con un diseño optimizado para funcionar las 24 horas, todos los días, y reproducir vídeos de alta calidad. Puede soportar hasta 64 cámaras, ofreciendo flexibilidad para actualizar y ampliar el sistema de seguridad en el futuro. Además, es compatible con una amplia gama de dispositivos y chipsets. Completa el sistema de seguridad de tu empresa con el Western Digital Purple 8TB.', 'Western Digital', 0),
