(776, 'Samsung 980 Pro 1TB - SSD M.2 NVMe', 'https://www.neobyte.es/41975-large_default/disco-ssd-samsung-1tb-980-pro-mz-v8p1t0bw.jpg', 107.9, '¿Buscas un SSD de garantías para tu ordenador? El Samsung 980 Pro de 1TB ofrece un rendimiento y velocidades espectaculares para que tu equipo vuele. Gracias a la interfaz PCIe 4.0 resulta el doble de rápido que los modelos con PCIe 3.0, incorporando un controlador Elpis personalizado que optimiza su funcionamiento para obtener velocidades de lectura de hasta 7.000 Mb/s. Se trata de un SSD diseñado para gamers y profesionales con el que podrás conseguir un ancho de banda impresionante, perfecto para juegos, tareas gráficas, análisis de datos... Disfruta más y espera menos. Además, es muy compacto y cuenta con una solución térmica inteligente para asegurar siempre máxima estabilidad y rendimiento. ¿Lo tienes claro? Hazte con el Samsung 980 Pro 1TB en Neobyte.', 'Samsung', 0),
(777, 'Western Digital Red Pro 8TB - Disco duro NAS', 'https://www.neobyte.es/38510-large_default/disco-duro-western-digital-red-pro-8tb-wd8003ffbx.jpg', 248.9, 'Western Digital Red Pro 8TB (WD8003FFBX) es el disco duro NAS de rendimiento profesional que tu negocio necesita. A su gran capacidad de almacenamiento hay que sumar su extraordinaria velocidad, fiabilidad y durabilidad. Además, cuenta con 256 mb caché, sistema antivibraciones y multitud de tecnologías que garantizan un funcionamiento estable y la máxima protección de tus datos. Western Digital Red Pro 8TB (WD8003FFBX), ya en Neobyte.', 'Western Digital', 0),
