(781, 'WD Blue SN580 2TB - Unidad SSD M.2 NVMe', 'https://www.neobyte.es/103933-large_default/wd-blue-sn580-2tb-unidad-ssd-m2-nvme.jpg', 108.9, 'Diseñado pensando en los flujos de trabajo creativos, el WD Blue SN580  responde rápidamente a las aplicaciones, esencial en proyectos creativos. Su alto rendimiento permite cargar y publicar proyectos de gran tamaño rápidamente, minimizando los tiempos de espera. Este disco duro es un catalizador de creatividad, permitiendo a los usuarios enfocarse en lo que realmente importa: crear sin barreras.', 'Western Digital', 0),
