(786, 'Western Digital Red 4TB - Disco duro NAS', 'https://www.neobyte.es/31969-large_default/disco-duro-western-digital-red-4tb-wd40efax.jpg', 123.9, 'Diseñado para dar respuesta las necesidades de un sistema NAS, el disco duro Western Digital Red 4TB (WD40EFAX) ofrece rendimiento y fiabilidad para tu hogar o empresa. Un modelo concebido para un uso intensivo, mucho más duradero que los discos convencionales, con el que podrás transmitir archivos, realizar copias de seguridad, compartir contenidos… a gran velocidad y de manera segura. Elige el disco duro Western Digital Red 4TB para entornos de funcionamiento 24/7 y disfruta de el mejor rendimiento.', 'Western Digital', 0),
