(790, 'MSI RTX 4070 Ti Ventus 3X E1 OC 12GB GDDR6X DLSS3 - Tarjeta gráfica', 'https://www.neobyte.es/105021-large_default/msi-rtx-4070-ti-ventus-3x-e1-oc-12gb-gddr6x-dlss3-tarjeta-grafica.jpg', 818.99, 'El diseño de refrigeración Tri Frozr 2 de MSI asegura un rendimiento óptimo bajo cargas intensivas, manteniendo la temperatura controlada para un funcionamiento estable y silencioso. Esto permite a los usuarios disfrutar de largas sesiones de juego o renderizado sin preocupaciones por el sobrecalentamiento.', 'MSI', 0),
(791, 'MSI RTX 4060 Ti Ventus 2X Black 16GB OC GDDR6 DLSS3 - Tarjeta gráfica', 'https://www.neobyte.es/103022-large_default/msi-rtx-4060-ti-ventus-2x-black-16gb-oc-gddr6-dlss3-tarjeta-grafica.jpg', 478.99, 'La gráfica cuenta con el sistema de refrigeración TORX Fan 4.0, que utiliza dos ventiladores TORX Fan 4.0 de 90 mm y un ventilador TORX Fan 4.0 de 100 mm. Los ventiladores utilizan un diseño de aspas optimizado para generar un flujo de aire eficiente y silencioso. El sistema de refrigeración TORX Fan 4.0 permite a la MSI RTX 4060 Gaming X 8GB DLSS3 mantener una temperatura de funcionamiento baja, lo que ayuda a prolongar la vida útil de la tarjeta gráfica.', 'MSI', 0),
(792, 'MSI RTX 4060 Ti Ventus 3X OC 8GB GDDR6 DLSS3 - Tarjeta gráfica', 'https://www.neobyte.es/103027-large_default/msi-rtx-4060-ti-ventus-3x-oc-8gb-gddr6-dlss3-tarjeta-grafica.jpg', 469.89, 'Este modelo cuenta con el sistema de refrigeración MSI TORX Fan 3X, que utiliza tres ventiladores MSI TORX Fan 3X de 90 mm. Los ventiladores utilizan un diseño de aspas optimizado para generar un flujo de aire eficiente y silencioso. El sistema de refrigeración MSI TORX Fan 3X permite a la MSI RTX 4060 Ti Ventus 3X OC 8GB GDDR6 mantener una temperatura de funcionamiento baja, lo que ayuda a prolongar la vida útil de la tarjeta gráfica.', 'MSI', 0),
