(795, 'Zotac GeForce RTX 4070 Super Trinity Black Edition 12GB GDDR6X DLSS 3.5 - Tarjeta gráfica', 'https://www.neobyte.es/108380-large_default/zotac-geforce-rtx-4070-super-trinity-black-edition-12gb-gddr6x-dlss-35-tarjeta-grafica.jpg', 689, 'La tarjeta gráfica ZOTAC RTX 4070 SUPER Trinity Black Edition 12GB ofrece un diseño equilibrado inspirado en la aerodinámica y emplea la innovadora arquitectura de NVIDIA: Ada Lovelace. Con características punteras como DLSS 3.5 y trazado de rayos en tiempo real, junto con un diseño de refrigeración avanzado, esta gráfica proporciona un rendimiento impactante en los juegos más recientes.', 'Zotac', 0),
(796, 'Zotac GeForce RTX 4070 Super Twin Edge 12GB GDDR6X DLSS 3.5 - Tarjeta gráfica', 'https://www.neobyte.es/108386-large_default/zotac-geforce-rtx-4070-super-twin-edge-12gb-gddr6x-dlss-35-tarjeta-grafica.jpg', 649, 'La Zotac GeForce RTX 4070 Super Twin Edge combina la potencia de la tecnología DLSS 3.5 de NVIDIA con la eficiencia de la arquitectura Ada Lovelace y la capacidad de trazado de rayos completa. Equipada con doble ventilador IceStorm 2.0, ofrece un rendimiento térmico óptimo en un tamaño compacto, manteniendo la tarjeta refrigerada incluso en las sesiones de juego más intensas. Además, con características como el control activo de ventiladores y la detención de ventiladores FREEZE, junto con la elegante iluminación RGB SPECTRA y una placa trasera de metal para una durabilidad adicional, esta gráfica ofrece una combinación excepcional de rendimiento y estilo en un diseño compacto.', 'Zotac', 0),
(797, 'Gigabyte RTX 4070 Super WindForce OC 12GB GDDR6X - Tarjeta gráfica', 'https://www.neobyte.es/108366-large_default/gigabyte-rtx-4070-super-windforce-oc-12gb-gddr6x-tarjeta-grafica.jpg', 663.89, 'NVIDIA G-SYNC proporciona una experiencia de juego fluida y sin fragmentaciones, mientras que NVIDIA Ansel convierte capturas de pantalla en obras de arte con modos de foto en juego. Resizable BAR, una característica avanzada de PCI Express, mejora el rendimiento de muchos juegos al permitir que la CPU acceda al búfer completo de la GPU. La Gigabyte RTX 4070 Super WindForce OC de 12GB GDDR6X DLSS3 representa una potente combinación de tecnologías avanzadas y diseño eficiente para usuarios exigentes en el ámbito de los juegos y la creación de contenido.', 'Gigabyte', 0),
(798, 'Gigabyte RTX 4070 Super Eagle OC 12GB DLSS3 - Tarjeta gráfica', 'https://www.neobyte.es/108359-large_default/gigabyte-rtx-4070-super-eagle-oc-12gb-dlss3-tarjeta-grafica.jpg', 698.9, 'Descubre la potencia de juego con la Gigabyte RTX 4070 Super Eagle OC de 12GB. La impresionante tecnología DLSS 3 y la innovadora arquitectura Ada Lovelace te ofrecerán un rendimiento excepcional y gráficos inmersivos. Sus avanzados tensor Cores y núcleos RT mejoran hasta 4 veces el rendimiento de DLSS 3 y duplican la eficiencia en el trazado de rayos, brindando una experiencia de juego sin igual. Cuenta también con un sistema de enfriamiento de triple ventilador WINDFORCE y una resistente placa trasera de metal que garantizan un rendimiento fiable y fresco para largas sesiones de juego.', 'Gigabyte', 0),
(799, 'Gigabyte RTX 4070 Super Gaming OC 12GB GDDR6X DLSS3 - Tarjeta gráfica', 'https://www.neobyte.es/108352-large_default/gigabyte-rtx-4070-super-gaming-oc-12gb-gddr6x-dlss3-tarjeta-grafica.jpg', 698.99, 'Explora la potencia de juego con la Gigabyte RTX 4070 Super Gaming OC. Con la arquitectura Ada Lovelace y DLSS 3, esta tarjeta gráfica te ofrece un rendimiento excepcional. Sus Tensor Cores de 4ta generación y Núcleos RT de 3ra generación proporcionan un aumento de hasta 4 veces en DLSS 3 y el doble de eficiencia en el trazado de rayos. Equipada con un sistema de refrigeración WINDFORCE y una placa trasera de metal, asegura una disipación de calor óptima. Además, su diseño de PCB Ultra Durable garantiza un rendimiento fiable y una durabilidad excepcional para tu sistema.', 'Gigabyte', 0),
(800, 'Gigabyte RTX 4070 Super Aero OC 12GB GDDR6X DLSS3 - Tarjeta gráfica', 'https://www.neobyte.es/108344-large_default/gigabyte-rtx-4070-super-aero-oc-12gb-gddr6x-dlss3-tarjeta-grafica.jpg', 723.89, 'Trazado de rayos: Una tecnología que permite renderizar imágenes realistas con iluminación y reflejos precisos.', 'Gigabyte', 0),
(801, 'Gigabyte RTX 4070 Ti Super WindForce OC 16GB GDDR6X - Tarjeta gráfica', 'https://www.neobyte.es/108327-large_default/gigabyte-rtx-4070-ti-super-windforce-oc-16gb-gddr6x-tarjeta-grafica.jpg', 898.99, 'Resizable BAR: Mejora el rendimiento en muchos juegos.', 'Gigabyte', 0),
(802, 'Gigabyte RTX 4070 Ti Super Eagle OC 16GB GDDR6X DLSS3 - Tarjeta gráfica', 'https://www.neobyte.es/108320-large_default/gigabyte-rtx-4070-ti-super-eagle-oc-16gb-gddr6x-dlss3-tarjeta-grafica.jpg', 928.99, 'Explora un mundo de juegos potentes con la Gigabyte RTX 4070 Ti Super Eagle OC de 16GB. Alucina con la tecnología exclusiva de NVIDIA DLSS 3 y la revolucionaria arquitectura Ada Lovelace. Esta tarjeta gráfica garantiza un rendimiento asombroso y gráficos impresionantes. Sus avanzados Tensor Cores y Núcleos RT mejoran hasta 4 veces el rendimiento de DLSS 3 y duplican la eficiencia en el trazado de rayos, brindando un nivel de realismo único en tus juegos favoritos. Con un sistema de enfriamiento WINDFORCE y una resistente placa trasera de metal, disfruta de un rendimiento estable y fresco para largas sesiones de juego.', 'Gigabyte', 0),
(803, 'Gigabyte RTX 4070 Ti Super Gaming OC 16GB GDDR6X DLSS3 - Tarjeta gráfica', 'https://www.neobyte.es/108313-large_default/gigabyte-rtx-4070-ti-super-gaming-oc-16gb-gddr6x-dlss3-tarjeta-grafica.jpg', 979, 'Experimenta el poder del futuro con la Gigabyte RTX 4070 Ti Super Gaming OC. Equipada con memoria de 16GB GDDR6X, la innovadora arquitectura Ada Lovelace y tecnología DLSS 3, hace que esta tarjeta ofrezca un rendimiento de vanguardia. Con sus Tensor cores de 4ª generación y Cores RT de 3ª, experimentarás hasta 4 veces más rendimiento y el doble de eficiencia en el trazado de rayos. Su sistema de refrigeración WINDFORCE y placa trasera de metal ofrecen una disipación de calor excepcional, mientras que su diseño de PCB Ultra Durable garantiza una vida útil prolongada y un rendimiento superior', 'Gigabyte', 0),
(804, 'MSI RTX 4070 Super Ventus 2X White OC 12GB GDDR6X DLSS3 - Tarjeta gráfica', 'https://www.neobyte.es/108673-large_default/msi-rtx-4070-super-ventus-2x-white-oc-12gb-gddr6x-dlss3-tarjeta-grafica.jpg', 678.99, 'MSI Center: Tu Aliado de Optimización Optimiza tu tarjeta gráfica en tiempo real con el exclusivo software MSI Center. Controla y ajusta para una experiencia gaming personalizada.', 'MSI', 0),
(805, 'MSI RTX 4070 Super Gaming X Slim White 12GB GDDR6X DLSS3 - Tarjeta gráifca', 'https://www.neobyte.es/108659-large_default/msi-rtx-4070-super-gaming-x-slim-white-12gb-gddr6x-dlss3-tarjeta-graifca.jpg', 748.99, '¡No pierdas tiempo, mejora tu setup al siguiente nivel! Descubre la MSI RTX 4070 Super Gaming X Slim White y sé el dueño de la experiencia gaming definitiva. ¡Actúa ahora y haz que tu PC destaque como nunca!', 'MSI', 0),
(806, 'MSI RTX 4070 Super Gaming X Slim 12GB GDDR6X DLSS3 - Tarjeta gráifca', 'https://www.neobyte.es/108666-large_default/msi-rtx-4070-super-gaming-x-slim-12gb-gddr6x-dlss3-tarjeta-graifca.jpg', 739, '¡Potencia tu experiencia gaming con la MSI GeForce RTX 4070 SUPER 12G GAMING X! Esta joya en color negro te sumergerá en gráficos excepcionales con trazado de rayos ultrarrápido y DLSS 3. Con un reloj Boost de 2640 MHz y 12GB GDDR6X de memoria, esta tarjeta gráfica garantiza un rendimiento destacado y temperaturas controladas gracias a su diseño TRI FROZR 3. Con conexiones avanzadas y control total a través de Afterburner y MSI Center, la RTX 4070 Super Gaming X es la elección perfecta para llevar tu experiencia gaming al siguiente nivel. ¡No esperes más, dale a tu PC el impulso que se merece!', 'MSI', 0),
(807, 'MSI RTX 4070 Ti Super Ventus 2X OC 16GB GDDR6X DLSS3 - Tarjeta gráfica', 'https://www.neobyte.es/109205-large_default/msi-rtx-4070-ti-super-ventus-2x-oc-16gb-gddr6x-dlss3-tarjeta-grafica.jpg', 889, 'Disfruta de un rendimiento excepcional con la tarjeta gráfica MSI GeForce RTX 4070 Ti SUPER Ventus 2X OC. Equipada con la arquitectura NVIDIA Ada Lovelace, esta potente tarjeta ofrece nuevas experiencias de juego y creación. Con DLSS 3, experimentarás un trazado de rayos rápido y un rendimiento mejorado por IA. La refrigeración dual-fan con tecnología TORX Fan 4.0 garantiza un funcionamiento silencioso y eficiente. Además, la estructura incorpora Core Pipes para una transferencia de calor efectiva y Zero Frozr para detener los ventiladores en condiciones de poca carga gráfica, eliminando el ruido. La tarjeta también cuenta con una backplate de refuerzo y se integra perfectamente con el software MSI Center para una gestión óptima. Eleva tu experiencia de juego y creación con la MSI RTX 4070 Ti SUPER Ventus 2X OC.', 'MSI', 0),
(808, 'Asus Dual RTX 4070 Super OC Edition White 12GB GDDR6X DLSS3 - Tarjeta gráfica', 'https://www.neobyte.es/108477-large_default/asus-dual-rtx-4070-super-oc-edition-white-12gb-gddr6x-dlss3-tarjeta-grafica.jpg', 689, 'La GPU ASUS Dual GeForce RTX 4070 SUPER White OC Edition brinda una experiencia gaming extraordinaria con sus dos potentes ventiladores Axial-tech. Equipada con tecnologías avanzadas como NVIDIA DLSS3 y la eficiente arquitectura Ada Lovelace, ofrece gráficos realistas y un rendimiento excepcional. La versión OC eleva el rendimiento al máximo con un Boost Clock de 2550 MHz. Su diseño compacto de 2.56 ranuras maximiza la potencia en espacios pequeños. ¡Vive la emoción del gaming con esta GPU de última generación!', 'Asus', 0),
(809, 'Asus Dual RTX 4070 Super OC Edition 12GB GDDR6X DLSS3 - Tarjeta gráfica', 'https://www.neobyte.es/108463-large_default/asus-dual-rtx-4070-super-oc-edition-12gb-gddr6x-dlss3-tarjeta-grafica.jpg', 678.99, 'La ASUS Dual GeForce RTX™ 4070 OC Edition, es una tarjeta gráfica con 12GB GDDR6X de memoria RAM y se destaca por su eficiente refrigeración gracias a los dos potentes ventiladores Axial-tech. Estos ventiladores cuentan con un diseño avanzado que incorpora un núcleo más pequeño, permitiendo aspas más largas y un anillo de barrera que mejora la presión de aire hacia abajo. Experimenta un rendimiento superior sin comprometer la refrigeración en juegos avanzados, y disfruta de la potencia de la tecnología NVIDIA DLSS3 y la arquitectura Ada Lovelace para una experiencia de juego inigualable.', 'Asus', 0),
(810, 'Asus Dual RTX 4070 Super 12GB GDDR6X DLSS3 - Tarjeta gráfica', 'https://www.neobyte.es/108455-large_default/asus-dual-rtx-4070-super-12gb-gddr6x-dlss3-tarjeta-grafica.jpg', 669, 'La tarjeta gráfica Asus Dual RTX 4070 Super de 12GB GDDR6X redefine la eficiencia del gaming con innovadoras características. Equipada con dos ventiladores avanzados y un diseño de 2,56 slots, ofrece máxima compatibilidad y desempeño térmico. Con tecnologías exclusivas como NVIDIA DLSS3 y núcleos tensor de 4.ª generación, experimentarás un rendimiento superior para juegos envolventes y renderizado de alta calidad. El diseño silencioso de 0 dB y rodamientos de bolas dobles garantizan durabilidad y un rendimiento óptimo en cada sesión de juego. Prepárate para la próxima era gaming con ASUS Dual GeForce RTX 4070 Super.', 'Asus', 0),
(811, 'Gigabyte RTX 4080 Super WindForce 16GB GDDR6X DLSS3 - Tarjeta gráfica', 'https://www.neobyte.es/108288-large_default/gigabyte-rtx-4080-super-windforce-16gb-gddr6x-dlss3-tarjeta-grafica.jpg', 1149.9, 'La Gigabyte RTX 4080 Super WindForce 16GB es una tarjeta gráfica potente diseñada para mejorar tu experiencia de juego y creación. ¿Qué la hace diferente? Bueno, en primer lugar, cuenta con un sistema de ventilación WINDFORCE de alta eficiencia para mantener tu gráfica fresca. Además cuenta con tecnologías exclusivas de NVIDIA como DLSS 3 y todo esto junto a la arquitectura Ada Lovelace que hará que tus juegos se vean impresionantes. Los Núcleos RT de 3ª generación ofrecen gráficos más realistas, y los Tensor Cores de 4ª generación aceleran todo el proceso. Con 16GB de memoria GDDR6X, es una opción ideal para aquellos que buscan un rendimiento excepcional en juegos y tareas creativas exigentes.', 'Gigabyte', 0),
(812, 'MSI RTX 4070 Ti Super Ventus 2X White OC 16GB GDDR6X DLSS3 - Tarjeta gráfica', 'https://www.neobyte.es/109546-large_default/msi-rtx-4070-ti-super-ventus-2x-white-oc-16gb-gddr6x-dlss3-tarjeta-grafica.jpg', 919, 'La tarjeta gráfica MSI RTX 4070 Ti SUPER Ventus 2X White OC ofrece una experiencia esencial para aquellos que buscan un rendimiento sólido. Su diseño actualizado con TORX FAN 4.0 y Airflow Control garantiza una ejecución eficiente de cualquier tarea. Basada en la arquitectura NVIDIA Ada Lovelace, cuenta con nuevos multiprocesadores Streaming para un rendimiento y eficiencia energética hasta 2 veces superiores, Tensor Cores de cuarta generación para un rendimiento hasta 4 veces mayor con DLSS 3, y RT Cores de tercera generación para un rendimiento de trazado de rayos hasta 2 veces superior. La solución térmica revolucionaria de doble ventilador en un disipador de calor amplio garantiza una experiencia fresca y silenciosa. Con un Boost Clock de 2640 MHz y 16GB GDDR6X, la GeForce RTX™ 4070 Ti SUPER Ventus 2X White OC es perfecta para juegos y creación avanzados. Además, su PCB personalizado incorpora fusibles adicionales para una mayor protección contra daños eléctricos.', 'MSI', 0),
(813, 'MSI RTX 4070 Ti Super Gaming X Slim White 16GB GDDR6X DLSS3 - Tarjeta gráfica', 'https://www.neobyte.es/109536-large_default/msi-rtx-4070-ti-super-gaming-x-slim-white-16gb-gddr6x-dlss3-tarjeta-grafica.jpg', 959, 'Además, cuenta con características de baja latencia como NVIDIA Reflex, capacidad de streaming con NVIDIA Encoder y mejoras de voz y vídeo mediante NVIDIA Broadcast. El diseño TRI FROZR 3 Thermal de MSI garantiza una eficiente disipación del calor, con características como el sistema Zero Frozr que detiene los ventiladores en condiciones de baja temperatura, y el rodamiento de doble bola para una durabilidad excepcional. Con un impresionante Boost Clock de 2670 MHz y una memoria de 16GB GDDR6X, esta tarjeta gráfica ofrece una experiencia de juego y creación de alto nivel.', 'MSI', 0),
(814, 'MSI RTX 4070 Ti Super Gaming X Slim 16GB GDDR6X DLSS3 - Tarjeta gráfica', 'https://www.neobyte.es/109540-large_default/msi-rtx-4070-ti-super-gaming-x-slim-16gb-gddr6x-dlss3-tarjeta-grafica.jpg', 979, 'La tarjeta gráfica MSI RTX 4070 Ti SUPER Gaming X Slim 16GB GDDR6X DLSS3 destaca por su diseño delgado, manteniendo el rendimiento robusto de la serie GAMING. Perfecta para sistemas con espacio reducido o compacto, ofrece compatibilidad total y un rendimiento excepcional gracias a la plataforma GeForce RTX Serie 40 y DLSS 3 basada en la arquitectura NVIDIA Ada Lovelace. Con gráficos realistas, aceleración por IA y funciones de baja latencia, como NVIDIA Reflex, esta tarjeta garantiza una experiencia de juego y creación superior. Su diseño térmico TRI FROZR 3, con características como Zero Frozr y rodamiento de doble bola, asegura una refrigeración eficiente y duradera. Con un Boost Clock de 2670 MHz y 16GB GDDR6X, es ideal para un rendimiento avanzado.', 'MSI', 0),
(815, 'Asus TUF Gaming RTX 4070 Super OC Edition 12GB GDDR6X DLSS3 - Tarjeta gráfica', 'https://www.neobyte.es/108489-large_default/asus-tuf-gaming-rtx-4070-super-oc-edition-12gb-gddr6x-dlss3-tarjeta-grafica.jpg', 788.99, 'ASUS TUF Gaming RTX 4070 SUPER OC: la opción para los gamers audaces. ¡Potencia sin límites con un Boost Clock a 2595 MHz y 12GB GDDR6X! DLSS3 y ray tracing te sumergen en mundos asombrosos. Ventiladores Axial-tech y rodamientos de bolas dobles mantienen la frescura y resistencia. La estructura ventilada y componentes militares aseguran un rendimiento fiable. Ajusta todo con GPU Tweak III. La TUF Gaming OC no solo ofrece gráficos, sino la entrada al gaming extremo.', 'Asus', 0),
(816, 'Gigabyte RTX 4060 Ti Gaming OC 16GB GDDR6 DLSS3 - Tarjeta gráfica', 'https://www.neobyte.es/100127-large_default/gigabyte-rtx-4060-ti-gaming-oc-16gb-gddr6-dlss3-tarjeta-grafica.jpg', 539.89, 'El diseño de refrigeración avanzado de la RTX 4060 Ti Gaming OC garantiza un rendimiento óptimo bajo cargas intensivas. La tecnología de ventiladores WINDFORCE 3X de Gigabyte, junto con un sistema de disipación térmica eficiente, mantiene la temperatura controlada para un funcionamiento estable y silencioso, incluso en sesiones de juego prolongadas.', 'Gigabyte', 0),
(817, 'MSI RTX 4060 Ventus 2X Black 8GB OC DLSS3 - Tarjeta gráfica', 'https://www.neobyte.es/99294-large_default/msi-rtx-4060-ventus-2x-black-8gb-oc-dlss3-tarjeta-grafica.jpg', 309.89, 'MSI RTX 4060 Ventus 2X Black 8GB OC DLSS3 - Tarjeta gráfica', 'MSI', 0),
(818, 'MSI RTX 3060 Ventus OC 12GB LHR - Tarjeta gráfica', 'https://www.neobyte.es/68987-large_default/msi-rtx-3060-ventus-oc-12gb-lhr-tarjeta-grafica.jpg', 297.89, 'Desata el potencial de tu PC GAMING con la MSI RTX 3060 Ventus OC 12GB LHR. Esta tarjeta gráfica con tecnología de Nvidia te permitirá disfrutar de los últimos juegos del mercado con total fluidez y detalle. Cuenta con 2 ventiladores que proporcionan un flujo de aire óptimo para evitar problemas de temperatura sin dejar de lado un funcionamiento silencioso. ¡Hazte con la MSI RTX 3060 Ventus OC 12GB LHR en la tienda online de Neobyte!', 'MSI', 0),
(819, 'Corsair 3000D RGB Airflow TG - Caja ATX', 'https://www.neobyte.es/98923-large_default/corsair-3000d-rgb-airflow-tg-caja-atx.jpg', 114.9, 'La fusión del panel lateral de vidrio templado con los ventiladores RGB preinstalados convierte a este chasis en un escaparate para la tecnología y el diseño. No solo protege y enfría eficientemente los componentes internos, sino que también los exhibe con una elegancia única, convirtiéndolo en una plataforma de exhibición para la creatividad y la innovación tecnológica.', 'Corsair', 0),
(820, 'Corsair 3000D RGB Airflow TG Blanca - Caja ATX', 'https://www.neobyte.es/98930-large_default/corsair-3000d-rgb-airflow-tg-blanca-caja-atx.jpg', 114.9, 'La combinación del panel lateral de vidrio templado con los ventiladores RGB preinstalados convierte a este chasis en una verdadera obra de arte. No solo protege y mantiene frescos los componentes internos, sino que también los exhibe con una elegancia y estilo incomparables. Este modelo no es solo una caja, sino una plataforma de exhibición para tu tecnología y creatividad.', 'Corsair', 0),
(821, 'Fractal Meshify Blackout Negro - Caja con Ventana Cristal', 'https://www.neobyte.es/14349-large_default/caja-fractal-meshify-blackout-ventana-cristal.jpg', 96.9, 'Fractal ha pensado tanto en el diseño como en la funcionalidad a la hora de crear la caja Meshify Blackout. Un modelo compatible con placas ATX, ITX y Micro-ATX, provisto de 5 bahías de 2.5” y 2 de 3.5” y que ha tenido muy en cuenta la refrigeración del equipo para que no tengas problemas cuando el ordenador esté dando el máximo. Configura el PC a tu gusto de la manera más fácil con esta caja semitorre fabricada con componentes de calidad y aprovecha todas sus posibilidades.', 'Fractal', 0),
(822, 'NOX Hummer Zero Core Negra - Caja Micro-ATX', 'https://www.neobyte.es/46764-large_default/nox-hummer-zero-core-negra-caja-micro-atx.jpg', 82.9, 'Este diseño inteligente no solo optimiza la eficiencia energética sino que también aísla los discos duros, evitando la transmisión de calor al resto de los componentes. En resumen, la NOX Hummer Zero Core ofrece una combinación de estilo, funcionalidad y rendimiento, estableciéndose como una elección destacada para quienes buscan una minitorre de calidad para sus configuraciones.', 'Nox', 0),
(823, 'Corsair 3000D Airflow TG Blanca - Caja ATX', 'https://www.neobyte.es/98917-large_default/corsair-3000d-airflow-tg-blanca-caja-atx.jpg', 89.9, 'La caja Corsair 3000D Airflow TG es compatible con sistemas de refrigeración líquida, ofreciendo opciones avanzadas para mantener temperaturas óptimas. Los soportes para radiadores y la disposición inteligente del espacio permiten la instalación de soluciones de enfriamiento líquido para un rendimiento térmico superior.', 'Corsair', 0),
(824, 'Asus TUF Gaming GT301 - Caja ATX', 'https://www.neobyte.es/90098-large_default/asus-tuf-gaming-gt301-caja-atx.jpg', 79.9, 'La Asus GT301 TUF Gaming es la caja para tu próximo PC gaming. Un modelo en formato ATX que ha primado aspectos como una construcción robusta o la refrigeración, incluyendo un panel perforado en la parte frontal y superior para optimizar el flujo de aire. Dispone a su vez de tres ventiladores RGB en la parte delantera con increíbles efectos de iluminación, compatibles con Aura Sync para crear el ecosistema de iluminación perfecto en tu setup. Se trata de una caja versátil, que ofrece múltiples opciones para diseñar tu configuración, siendo compatible con radiadores de hasta 360 mm en la parte frontal y 120 mm en la trasera, con disipadores de CPU de hasta 160 mm de altura y GPU’s de hasta 320 mm de largo. Apuesta por la Asus GT301 TUF Gaming y apostarás sobre seguro.', 'Asus', 0),
(825, 'Corsair iCUE 4000X RGB Blanca - Caja e-ATX', 'https://www.neobyte.es/45245-large_default/corsair-icue-4000x-rgb-blanca-caja-e-atx.jpg', 150.9, 'La refrigeración es una prioridad en el diseño de esta caja. Además de los tres ventiladores incluidos, la Corsair iCUE 4000X RGB tiene espacio para montar hasta seis ventiladores en total, permitiendo una ventilación óptima para mantener los componentes a temperaturas óptimas incluso durante cargas de trabajo intensivas.', 'Corsair', 0),
(826, 'Corsair 5000D AirFlow Blanca - Caja e-ATX', 'https://www.neobyte.es/41861-large_default/corsair-5000d-airflow-blanca-caja-e-atx.jpg', 191.89, 'El interior de esta caja está pensado para ofrecer una excepcional capacidad de expansión, en particular para sistemas de refrigeración líquida. Esta amplitud de expansión da a los usuarios la libertad de diseñar sistemas personalizados que no solo satisfacen sus necesidades de rendimiento, sino que también se alinean con sus gustos estéticos. La prioridad puesta en la gestión oculta de cables y un panel frontal optimizado para el flujo de aire culmina en una construcción que no solo resalta visualmente el equipo interno, sino que también mantiene los cables organizados y discretos.', 'Corsair', 0),
(827, 'Corsair ICUE 5000x Smart Blanca - Caja ATX RGB', 'https://www.neobyte.es/41848-large_default/corsair-icue-5000x-smart-blanca-caja-atx-rgb.jpg', 231.9, 'El diseño excepcional del 5000X RGB no solo se centra en la estética, sino que también ofrece un notable potencial de expansión, especialmente para sistemas de refrigeración líquida. La flexibilidad de montaje y las ubicaciones independientes para radiadores permiten a los usuarios explorar opciones creativas para personalizar la refrigeración de su PC. En resumen, la Corsair iCUE 5000X Smart va más allá de las expectativas convencionales, proporcionando una plataforma versátil y visualmente impactante para entusiastas de la refrigeración y el diseño de PC.', 'Corsair', 0),
(828, 'Corsair ICUE 5000T Blanco - Caja E-ATX RGB', 'https://www.neobyte.es/68992-large_default/caja-corsair-icue-5000t-rgb-blanco.jpg', 422.9, 'Corsair ICUE 5000T Blanco - Caja E-ATX RGB', 'Corsair', 0),
(829, 'Corsair ICUE 5000T Cristal Templado - Caja E-ATX RGB', 'https://www.neobyte.es/71432-large_default/corsair-icue-5000t-cristal-templado-caja-e-atx-rgb.jpg', 422.9, 'El chasis viene equipado con un moderno panel frontal de E/S que incluye un puerto USB 3.1 tipo C, cuatro puertos USB 3.0 y conexiones de audio. Su sistema de gestión de cables CORSAIR RapidRoute agiliza la organización de cables, manteniendo un interior limpio y ordenado. Además, ofrece amplio espacio de almacenamiento con varias configuraciones posibles para SSD y HDD, gracias a sus bandejas y soportes dedicados. Las puertas laterales con bisagras, tanto de cristal templado como de acero, no solo facilitan el acceso, sino que también permiten exhibir con orgullo los componentes internos y la iluminación del sistema.', 'Corsair', 0);
