(830, 'Corsair ICUE 7000x RGB Blanca - Caja e-ATX', 'https://www.neobyte.es/69121-large_default/corsair-icue-7000x-rgb-blanca-caja-e-atx.jpg', 369.9, 'Corsair ICUE 7000x Blanca - Caja E-ATX RGB', 'Corsair', 0),
(831, 'Corsair ICUE 7000d Airflow Blanca - Caja E-ATX', 'https://www.neobyte.es/69144-large_default/caja-corsair-icue-7000d-airflow-blanca.jpg', 316.9, 'Corsair ICUE 7000d Airflow Blanca - Caja E-ATX', 'Corsair', 0),
(832, 'Corsair iCUE 4000D RGB AirFlow - Caja e-ATX', 'https://www.neobyte.es/91711-large_default/corsair-icue-4000d-rgb-airflow-caja-e-atx.jpg', 189.9, 'El diseño permite la instalación vertical de la GPU, una característica cada vez más valorada por los usuarios que buscan no solo funcionalidad sino también una presentación visual atractiva de sus componentes. El panel lateral deslizante del 4000D RGB AirFlow facilita el acceso y la exhibición de los componentes internos y la iluminación RGB.', 'Corsair', 0),
(833, 'Corsair iCUE 4000D RGB AirFlow True White - Caja e-ATX', 'https://www.neobyte.es/91712-large_default/corsair-icue-4000d-rgb-airflow-true-white-caja-e-atx.jpg', 189.9, 'Corsair iCUE 4000D AirFlow Tempered Glass True White - Caja e-ATX', 'Corsair', 0),
(834, 'Corsair 4000D AirFlow Blanca - Caja e-ATX', 'https://www.neobyte.es/69175-large_default/corsair-4000d-airflow-blanca-caja-e-atx.jpg', 105.9, 'Equipada con un panel frontal que incluye conexiones cruciales y la opción de montaje vertical de la tarjeta gráfica, este chasis no solo facilita el acceso rápido a las conexiones, sino que también permite una impresionante presentación del hardware. El panel lateral deslizable agrega un toque final, proporcionando una vista clara del interior iluminado y personalizado del PC, facilitando al mismo tiempo el mantenimiento y la actualización de los componentes.', 'Corsair', 0),
(835, 'Corsair 3000D Airflow TG - Caja ATX', 'https://www.neobyte.es/98911-large_default/corsair-3000d-airflow-tg-caja-atx.jpg', 89.9, 'La caja Corsair 3000D Airflow TG es compatible con sistemas de refrigeración líquida, ofreciendo opciones avanzadas para mantener temperaturas óptimas. Los soportes para radiadores y la disposición inteligente del espacio permiten la instalación de soluciones de enfriamiento líquido para un rendimiento térmico superior.', 'Corsair', 0),
