(847, 'NZXT H7 Flow Negra - Caja ATX', 'https://www.neobyte.es/72363-large_default/nzxt-h7-flow-negra-caja-atx.jpg', 112.89, 'Con la NZXT H7 Flow Negra disfrutarás del mejor flujo de aire, amplias posibilidades de configuración y un montaje cómodo y limpio. Fabricada con materiales de calidad premium, permite la incorporación de componentes de gran tamaño como gráficas, refrigeraciones líquidas, disipadores... Para optimizar la circulación del aire en su interior, la caja cuenta con frontal totalmente perforado e incluye dos ventiladores con posibilidad de instalar unidades adicionales. Cabe destacar también que integra todos los puertos que necesitas, así su amplia ventana lateral de cristal templado.', 'NZXT', 0),
(848, 'Cooler Master MasterBox TD500 Mesh v2 - Caja e-ATX', 'https://www.neobyte.es/94082-large_default/cooler-master-masterbox-td500-mesh-v2-caja-e-atx.jpg', 95.9, 'Los filtros de polvo desmontables en el TD500 Mesh v2 facilitan el mantenimiento y la limpieza de la torre. Esto ayuda a mantener los componentes internos libres de polvo y prolonga la vida útil del hardware.', 'Cooler Master', 0),
(849, 'Nfortec Nervia Blanca - Caja e-ATX', 'https://www.neobyte.es/104556-large_default/nfortec-nervia-blanca-caja-e-atx.jpg', 79.94, 'Nfortec Nervia Blanca - Caja e-ATX', 'Nfortec', 0),
