(853, 'Corsair RMx SHIFT RM1200x 80+ Gold - Fuente de alimentación 1200W', 'https://www.neobyte.es/87316-large_default/corsair-rmx-shift-rm1200x-80-gold-fuente-de-alimentacion-1200w.jpg', 249.88, 'Corsair RMx SHIFT RM1200x 1200W 80+ Gold - Fuente de alimentación', 'Corsair', 0),
(854, 'Corsair RMx SHIFT RM750x 80+ Gold - Fuente de alimentación 750W', 'https://www.neobyte.es/87317-large_default/corsair-rmx-shift-rm750x-80-gold-fuente-de-alimentacion-750w.jpg', 154.89, 'Con una variedad de conectores SATA, PCIe y ATX, la RM750x ofrece compatibilidad con una amplia gama de configuraciones de hardware. Esto asegura que puedas conectar sin problemas todos los componentes de tu sistema, desde tarjetas gráficas hasta dispositivos de almacenamiento.', 'Corsair', 0),
