(856, 'Gigabyte GP-UD750GM 750W 80 Plus Gold Modular', 'https://www.neobyte.es/72148-large_default/gigabyte-gp-ud750gm-750w-80-plus-gold-modular.jpg', 99.9, 'La certificación 80 Plus Gold no es solo un distintivo de eficiencia, sino una promesa de ahorro a largo plazo. La GP-UD750GM garantiza un uso óptimo de la electricidad, lo que no solo reduce tus costos operativos, sino que también contribuye a un menor impacto ambiental al requerir menos energía para funcionar. Con una potencia robusta de 750W, esta fuente de alimentación es la elección ideal para sistemas de alto rendimiento, desde estaciones de trabajo avanzadas hasta configuraciones de juego intensivo.', 'Gigabyte', 0),
(857, 'Cooler Master MWE Gold 1050 v2 ATX 3.0 - Fuente de alimentación 1050W', 'https://www.neobyte.es/100383-large_default/cooler-master-mwe-gold-1050-v2-atx-30-fuente-de-alimentacion-1050w.jpg', 169.9, 'Compatible con el estándar ATX3.0, la fuente de alimentación CoolerMaster MWE Gold 1050 v2 ATX 3.0 es uno de los modelos destacados de esta prestigiosa marca. Cuenta con certificado 80+ Gold, lo que se traduce en una mayor eficiencia para proporcionar la mejor energía para tu equipo. Dispone, además, de un silencioso ventilador de 140 mm, diseño totalmente modular y componentes de gran calidad para asegurar un uso duradero y estable. Hazte con ella en nuestra tienda online al precio más competitivo.', 'Cooler Master', 0),
(858, 'Corsair RM850e ATX 3.0 (PCIe 5.0) - Fuente de alimentación 850W', 'https://www.neobyte.es/91514-large_default/corsair-rm850e-atx-30-pcie-50-fuente-de-alimentacion-850w.jpg', 143.89, 'La Corsair RM850e es una fuente de alimentación completamente modular y silenciosa certificada para ATX 3.0 y PCIe 5.0. Destaca por su eficiencia 80 PLUS Gold y diseño compacto. Ofrece conexiones universales de 8 pines, cable PCIe 5.0 para GPUs modernas y operación silenciosa con el modo Zero RPM Fan. Incorpora tecnología confiable, cumpliendo con estándares de alta calidad y respaldada por una garantía de 7 años de Corsair, líder en soporte técnico. Ideal para sistemas de PC eficientes y silenciosos.', 'Corsair', 0),
(859, 'FUENTE ALIMENTACION CORSAIR AX1600I - 1600W', 'https://www.neobyte.es/61283-large_default/fuente-alimentacion-corsair-ax1600i-1600w.jpg', 498.99, 'Diseñada con los mejores componentes, la fuente de alimentación Corsair AX1600i ofrece una eficiencia de más de 94% en un formato más pequeño. Cuenta con certificación 80 PLUS Titanium y proporciona una potencia de 1600W, garantizando un funcionamiento estable en todo momento. Además, ha sido provista de un ventilador de 140 mm con modo cero RPM, por lo que funciona casi en silencio con cargas bajas y medias. Corsair AX1600i es la fuente de alimentación definitiva.', 'Corsair', 0),
(860, 'DeepCool PX1000G - Fuente alimentación 1000W 80+ Gold', 'https://www.neobyte.es/90604-large_default/deepcool-px1000g-fuente-alimentacion-1000w-80-gold.jpg', 165.89, 'DeepCool PX1000G - Fuente alimentación 1000W 80+ Gold', 'DeepCool', 0),
(861, 'Gigabyte GP-UD850GM 850W 80 Plus Gold Modular', 'https://www.neobyte.es/72155-large_default/gigabyte-gp-ud850gm-850w-80-plus-gold-modular.jpg', 89.89, 'La GP-UD850GM está equipada con múltiples protecciones de seguridad, como OVP (protección contra sobretensión), UVP (protección contra subvoltaje), OPP (protección contra sobrecarga), SCP (protección contra cortocircuitos) y OTP (protección contra sobrecalentamiento), que salvaguardan los componentes del sistema contra posibles riesgos eléctricos.', 'Gigabyte', 0),
(862, 'Corsair RM750e ATX 3.0 80+ Gold - Fuente de alimentación 750W', 'https://www.neobyte.es/91507-large_default/corsair-rm750e-atx-30-80-gold-fuente-de-alimentacion-750w.jpg', 132.89, 'La tecnología de riel único +12V proporciona una entrega de energía constante a los componentes clave del sistema, como la CPU y la GPU. Esta distribución uniforme asegura un rendimiento estable incluso durante las tareas más exigentes.', 'Corsair', 0),
(863, 'FUENTE ALIMENTACION CORSAIR RM750 BLANCA', 'https://www.neobyte.es/60870-large_default/fuente-alimentacion-corsair-rm750-blanca.jpg', 139.89, 'FUENTE ALIMENTACION CORSAIR RM750 BLANCA', 'Corsair', 0),
(864, 'Corsair CX750 80+ Bronze - Fuente de alimentación 750W', 'https://www.neobyte.es/103191-large_default/corsair-cx750-80-bronze-fuente-de-alimentacion-750w.jpg', 89.89, 'La Corsair CX750 de la serie CX es una fuente de alimentación ATX de 750 W con certificación 80 PLUS Bronze. Destaca por su eficiencia hasta un 88%, garantía de potencia continua, y su diseño compacto con un ventilador silencioso de 120 mm, facilitando la instalación en chasis modernos. Con un rendimiento fiable y eficiente, es una elección sólida para sistemas de PC', 'Corsair', 0),
