(869, 'Asus TUF 650B - Fuente de alimentación 80+ Bronze', 'https://www.neobyte.es/45634-large_default/fuente-alimentacion-asus-tuf-650b-80-bronze.jpg', 82.9, 'La Asus TUF 650B es una fuente de alimentación de garantías para equipar tu PC. Se trata de un modelo que ha superado múltiples pruebas de resistencia para asegurar un funcionamiento estable y duradero. Para ello ha sido fabricado con materiales de gran calidad, incluyendo su ventilador Axial-tech que proporciona una óptima presión de aire, cables trenzados, revestimiento protector de PCB, etc. Dispone también de tecnología 0db, un sistema que detiene automáticamente el ventilador a temperaturas bajas,lo que repercute en un funcionamiento más silencioso. La Asus TUF 650B con certificación 80 Plus Bronze es una gran alternativa para tu ordenador.', 'Asus', 0),
