(931, 'D-Link DWA-182 - Adaptador WiFi USB AC1200 Dual', 'https://www.neobyte.es/13828-large_default/tarjeta-d-link-dwa-182-wifi-usb-ac1200-dual.jpg', 30.9, 'Saca el máximo partido de tu conexión a internet con el adaptador WiFi 5G por USB D-Link DWA-182, un pequeño dispositivo que incluye la última tecnología wireless para que disfrutes de una mayor velocidad en tu ordenador de sobremesa o portátil. Compacto y fácil de configurar, la potente antena integrada proporciona una conexión potente, estable y rápida.', 'D-link', 0),
(932, 'TP-Link Archer T4E AC1200 - Tarjeta WiFi PCIe', 'https://www.neobyte.es/24614-large_default/tarjeta-tp-link-archer-t4e-ac1200-dualband.jpg', 27.9, 'La tarjeta Wifi TP-Link Archer T4E es un adaptador inalámbrico PCIe de fácil instalación que alcanza velocidades de hasta 1200 Mbps. Un modelo de doble banda compatible con el estándar 802.11ac que te permitirá realizar tareas como navegar por internet en la banda de 2.4GHz y aprovechar la velocidad de la banda de 5Ghz para jugar online, hacer streaming o utilizar aplicaciones que requieran de un ancho de banda mayor. Además, gracias a la tecnología Beamforming, el TP-Link Archer T4E centra las señales de forma inteligente en la dirección del dispositivo conectado para una conectividad más estable.', 'Tp-link', 0),
(933, 'TP-Link TL-WN781ND - Tarjeta WiFi PCIe 150Mbps', 'https://www.neobyte.es/33470-large_default/tarjeta-tp-link-tl-wn781nd-wireless-pcie-150mbps.jpg', 9.9, 'La tarjeta WiFi interna TP-Link TL-WN781ND es una opción económica de dotar a tu ordenador de sobremesa de conectividad WiFi. Se instala facilmente a través de PCIe y permite alcanzar hasta 150Mbps, una velocidad adecuada para navegar, disfrutar de contenidos en HD, realizar videollamadas y mucho más. Además, incluye antena para una mayor cobertura y dispone de encriptación WPA/WPA2.', 'Tp-link', 0),
(934, 'TP-Link Archer T4U AC1300 - Adaptador Wifi USB', 'https://www.neobyte.es/25828-large_default/tarjeta-tp-link-archer-t4u-ac1300-mu-mimo-usb.jpg', 25.89, 'Adaptador USB inalámbrico TP-Link Archer T4U de doble banda AC1300 que alcanza velocidades combinadas de hasta 1300 Mbps (867+400) con 802.11ac. Un modelo perfecto tanto para tareas básicas como la navegación web como para streaming de vídeo de alta definición y juegos que cuenta con interfaz puerto USB 3.0. Dispone de cable de extensión USB para un despliegue flexible.', 'Tp-link', 0),
(935, 'TP-Link TL-WN823N Mini USB Wireless 300MB - Tarjeta Wifi', 'https://www.neobyte.es/9397-large_default/tarjeta-tp-link-tl-wn823n-mini-usb-wireless-300mb.jpg', 10.9, 'Mini adaptador USB WiFi TP-Link TL-WN823N, la manera más asequible de añadir a tu equipos de sobremesa o portátil una conexión WiFi de hasta 300 mbps. De tamaño compacto, se instala fácilmente a través de un puerto USB y ofrece una conexión rápida, segura y fiable.', 'Tp-link', 0),
