(961, 'Windows 11 Pro 64 Bits OEM - Sistema operativo', 'https://www.neobyte.es/58058-large_default/windows-11-pro-64-bits-oem-sistema-operativo.jpg', 142.9, 'Compra en Neobyte el sistema operativo Windows 11 Pro 64 Bits OEM. Una nueva versión con la que disfrutar de nuevas herramientas para entornos profesionales con las que optimizarás la productividad y obtendrás el máximo de los recursos compartidos. Descubre nuevas maneras de conectarte, exprime las funciones multitarea y saca el máximo partido al rendimiento de juegos para PC. Windows 11 Pro 64 Bits OEM se adapta a cada tipo de usuario.', 'Microsoft', 0),
(962, 'Windows 11 Home 64 Bits OEM - Sistema operativo', 'https://www.neobyte.es/58059-large_default/windows-11-home-64-bits-oem-sistema-operativo.jpg', 127.9, 'Ya puedes comprar en Neobyte el sistema operativo Windows 11 Home 64 Bits OEM. Una nueva versión con la que disfrutar de nuevas herramientas fáciles de usar y con las que optimizarás el espacio en pantalla para aumentar tu productividad. Descubre nuevas maneras de conectarte, exprime las funciones multitarea y saca el máximo partido al rendimiento de juegos para PC. Windows 11 Home 64 Bits OEM se adapta a ti.', 'Microsoft', 0),
