(983, 'Gigabyte G5 KF-E3ES313SD - Portátil 15.6 i5-12500H 16GB RTX 4060 512GB SSD', 'https://www.neobyte.es/89183-large_default/gigabyte-g5-kf-e3es313sd-portatil-156-i5-12500h-16gb-rtx-4060-512gb-ssd.jpg', 1148.99, 'En resumen, la este portátil redefine la experiencia de juego con su diseño delgado, potente rendimiento, avanzada tecnología de enfriamiento, conectividad ultrarrápida y sonido envolvente de alta calidad. Crea posibilidades ilimitadas con esta máquina diseñada para satisfacer las demandas de jugadores y creadores por igual.', 'Gigabyte', 0),
(984, 'Gigabyte G6 KF-H3ES854SD - Portátil 16 i7-13620H 16GB RTX 4060 1TB SSD', 'https://www.neobyte.es/103080-large_default/gigabyte-g6-kf-h3es854sd-portatil-16-i7-13620h-16gb-rtx-4060-1tb-ssd.jpg', 1359, 'Los portátiles de alto rendimiento suelen contar con una cantidad significativa de memoria RAM, como 16GB, para facilitar la multitarea sin problemas y la ejecución fluida de aplicaciones exigentes. La inclusión de unidades de estado sólido (SSD) con capacidades de almacenamiento amplias, como 1TB, proporciona velocidades de lectura/escritura rápidas para arranques rápidos del sistema operativo y tiempos de carga más rápidos de aplicaciones y juegos.', 'Gigabyte', 0),
(985, 'Asus ROG Flow Z13 GZ301VV-MU007W - Portátil 13.4 i9 13900H 16GB RTX4060 1TB SSD W11', 'https://www.neobyte.es/89684-large_default/asus-rog-flow-z13-gz301vv-mu007w-portatil-134-i9-13900h-16gb-rtx4060-1tb-ssd-w11.jpg', 2158.99, '', 'Asus', 0),
(986, 'Asus TUF Dash F15 TUF507ZC4-HN040 - Portátil 15.6 i7-12700H 16GB RTX 3050 512GB SSD', 'https://www.neobyte.es/88771-large_default/asus-tuf-dash-f15-tuf507zc4-hn040-portatil-156-i7-12700h-16gb-rtx-3050-512gb-ssd.jpg', 838.99, 'La pantalla de 15.6 pulgadas Full HD con una alta frecuencia de actualización de 144Hz te sumerge en un mundo de imágenes nítidas y fluidas, maximizando tu experiencia gaming y proporcionando una ventaja competitiva en cada partida. Este portátil también se destaca por su conectividad versátil y su teclado retroiluminado con tecnología RGB, ofreciendo un control total sobre la iluminación y el ambiente mientras juegas.', 'Asus', 0),
(987, 'Asus TUF Gaming F17 TUF707VI-HX049 - Portátil 17.3 IPS i7-13620H RTX 4070 32GB SSD', 'https://www.neobyte.es/109125-large_default/asus-tuf-gaming-f17-tuf707vi-hx049-portatil-173-ips-i7-13620h-rtx-4070-32gb-ssd.jpg', 1648.99, 'Sorpréndete con el rendimiento potente y la inmersión visual gracias al portátil ASUS TUF Gaming F17 TUF707VI-HX049. Equipado con un procesador Intel Core i7-13620H y una tarjeta gráfica NVIDIA RTX 4070 de 8GB, este portátil ofrece un rendimiento excepcional para tus sesiones de juego intensivas y tareas multitarea. La pantalla de 17.3 Full HD con una frecuencia de actualización de 144Hz te sumerge en un mundo visual vibrante y fluido. Con 32GB de RAM DDR5 y un SSD de 1TB, disfrutarás de una respuesta rápida y tiempos de carga instantáneos. Además, el diseño robusto y elegante en color Mecha Gray, junto al teclado retroiluminado y de formato completo, complementan la experiencia de juego y productividad. Con el ASUS TUF Gaming F17, lleva tus sesiones de juego y trabajo al siguiente nivel.', 'Asus', 0),
(988, 'Asus ROG Strix G18 G814JIR-N6002 - Portátil 18 i9-14900HX 32GB RTX 4070 1TB SSD', 'https://www.neobyte.es/109659-large_default/asus-rog-strix-g18-g814jir-n6002-portatil-18-i9-14900hx-32gb-rtx-4070-1tb-ssd.jpg', 2299, 'Para una experiencia de juego verdaderamente inmersiva, ofrece una pantalla de 18 pulgadas con resolución WQXGA de 240 Hz. Estas pantallas no solo proporcionan una calidad de imagen excepcional, sino que también cuentan con una relación pantalla-cuerpo del 89%, asegurando que cada detalle en el juego se muestre con la máxima claridad y vivacidad.', 'Asus', 0),
(989, 'Asus TUF Gaming F15 TUF507VV-LP193 - Portátil 15.6 i7-13620H 16GB RTX 4060 1TB SSD', 'https://www.neobyte.es/109337-large_default/asus-tuf-gaming-f15-tuf507vv-lp193-portatil-156-i7-13620h-16gb-rtx-4060-1tb-ssd.jpg', 1348.99, 'Experimenta el rendimiento imparable con el ASUS TUF Gaming F15 TUF507VV-LP193. Este portátil gaming de 15.6 Full HD 144Hz presenta un potente Intel Core i7-13620H, 16GB de RAM, y un SSD de 1TB. Ya seas creador de contenido o te guste jugar, te encantará su gráfica NVIDIA GeForce RTX 4060. ¡Da la bienvenida a tu plataforma en gaming!', 'Asus', 0),
(990, 'Asus Vivobook 16X K3605ZC-N1268W - Portátil 16 i5-12450H 16GB 512GB SSD W11', 'https://www.neobyte.es/104786-large_default/asus-vivobook-16x-k3605zc-n1268w-portatil-16-i5-12450h-16gb-512gb-ssd-w11.jpg', 799, 'Con un diseño delgado y elegante, el Asus Vivobook 16X K3605ZC-N1268W es altamente portátil y presenta un aspecto moderno, perfecto para usuarios que valoran el rendimiento y la estética. Con una variedad de puertos USB, HDMI y Wi-Fi 6, este portátil ofrece opciones de conectividad versátiles para periféricos, pantallas externas y una conexión a internet rápida y estable.', 'Asus', 0),
(991, 'Asus Vivobook 16X K3605ZC-N1270W - Portátil 16 i7-12650H 16GB RTX 3050 512GB SSD W11', 'https://www.neobyte.es/104793-large_default/asus-vivobook-16x-k3605zc-n1270w-portatil-16-i7-12650h-16gb-rtx-3050-512gb-ssd-w11.jpg', 898.99, 'Con 16GB de memoria RAM DDR4, este portátil garantiza un rendimiento multitarea sin interrupciones, permitiendo trabajar en varios programas al mismo tiempo sin comprometer la velocidad ni la respuesta del sistema.', 'Asus', 0),
(992, 'Gigabyte G5 MF5-52ES353SD - Portátil 15.6 i5-13500H 16GB RTX 4050 512GB SSD', 'https://www.neobyte.es/106399-large_default/gigabyte-g5-mf5-52es353sd-portatil-156-i5-13500h-16gb-rtx-4050-512gb-ssd.jpg', 999, 'La pantalla de 15,6 pulgadas del Gigabyte G5 MF5-52ES353SD tiene una resolución Full HD (1920 x 1080) y una frecuencia de actualización de 144 Hz. Esto la convierte en una excelente opción para juegos, ya que ofrece imágenes fluidas y sin parpadeos.', 'Gigabyte', 0),
(993, 'Gigabyte AORUS 17H BXF-74ES554SH - Portátil 17.3 i7-13700H 16GB RTX 4080 1TB SSD W11', 'https://www.neobyte.es/88394-large_default/gigabyte-aorus-17h-bxf-74es554sh-portatil-173-i7-13700h-16gb-rtx-4080-1tb-ssd-w11.jpg', 2329, 'Con el poderoso Gigabyte AORUS 17H BXF-74ES554SH experimentarás lo último en material de rendimiento. Este portátil de altísimas prestaciones arroja una potencia descomunal a todos los niveles, destacando el apartado gráfico, para lo que cuenta con la impresionante Nvidia GeForce RTX 4080 de 12GB y pantalla Full HD de 17.3 y 360Hz de tasa de refresco. De este modo, tus creaciones, juegos y contenidos cobrarán vida y subirán a una nueva dimensión. A nivel técnico, está provisto también de procesador Intel Core i7-13700H, 16GB de RAM DDR5 de última generación y SSD de 1TB. Todo ello con un diseño sorprendentemente delgado, una calidad de fabricación excelente y una conectividad de vanguardia.', 'Gigabyte', 0),
(994, 'Gigabyte AORUS 15 9KF-E3ES383SD Portátil 15.6 i5-12500H 8GB RTX 4060 512GB', 'https://www.neobyte.es/88415-large_default/gigabyte-aorus-15-9kf-e3es383sd-portatil-156-i5-12500h-8gb-rtx-4060-512gb.jpg', 928.99, '', 'Gigabyte', 0),
(995, 'Gigabyte G5 KF-E3ES313SH - Portátil 15.6 i5-12500H 16GB RTX 4060 512GB SSD W11', 'https://www.neobyte.es/89170-large_default/gigabyte-g5-kf-e3es313sh-portatil-156-i5-12500h-16gb-rtx-4060-512gb-ssd-w11.jpg', 988.99, 'Este modelo cuenta con el sistema de refrigeración WINDFORCE 4, que utiliza dos ventiladores WINDFORCE Blade 3D de 90 mm y un ventilador WINDFORCE Blade 3D de 100 mm. Los ventiladores utilizan un diseño de aspas optimizado para generar un flujo de aire eficiente y silencioso.', 'Gigabyte', 0),
(996, 'Gigabyte G5 MF-E2ES333SD - Portátil 15.6 i5-12500H 8GB RTX 4050 512GB SSD', 'https://www.neobyte.es/91025-large_default/gigabyte-g5-mf-e2es333sd-portatil-156-i5-12500h-8gb-rtx-4050-512gb-ssd.jpg', 899.89, 'Este modelo cuenta con el sistema de refrigeración WINDFORCE 4, que utiliza dos ventiladores WINDFORCE Blade 3D de 90 mm y un ventilador WINDFORCE Blade 3D de 100 mm. Los ventiladores utilizan un diseño de aspas optimizado para generar un flujo de aire eficiente y silencioso.', 'Gigabyte', 0),
(997, 'Gigabyte Aero 16 BSF-A3ES964SP - Portátil 16 i9-13900H 32GB RTX 4070 1TB SSD W11', 'https://www.neobyte.es/110899-large_default/gigabyte-aero-16-bsf-a3es964sp-portatil-16-i9-13900h-32gb-rtx-4070-1tb-ssd-w11.jpg', 2259, 'El portátil Gigabyte Aero 16 BSF-A3ES964SP está diseñado para creadores, profesionales y diseñadores que buscan un rendimiento excepcional y una experiencia visual superior. Equipado con una pantalla OLED 4K+ de 16:10 y certificaciones de color X-Rite™ 2.0, Pantone® Validated, TÜV Rheinland de baja luz azul y Eyesafe® 2.0, garantiza una calidad de imagen excepcional y cuidado ocular. Potenciado por procesadores Intel® Core™ i9 de 13ª generación y GPU NVIDIA® GeForce RTX™ 40, ofrece un rendimiento de alta gama. Con un chasis delgado de 0.70 pulgadas y un peso de 1.9 kg, es portátil y potente, ideal para la creatividad en cualquier lugar. Además, con tecnologías como MUX Switch, Wi-Fi 6E, y una batería de 88Wh, proporciona una experiencia inigualable para creadores en movimiento.', 'Gigabyte', 0),
(998, 'Asus ZenBook Pro Duo 15 OLED X582ZM-H2030W - Portátil 15 i7-12700H 32GB RTX3060 11TB SSD Windows 11', 'https://www.neobyte.es/80574-large_default/asus-zenbook-pro-duo-15-oled-x582zm-h2030w-portatil-15-i7-12700h-32gb-rtx3060-11tb-ssd-windows-11.jpg', 2711.9, 'El Asus ZenBook Pro Duo 15 OLED X582ZM-H2030W es el portátil del futuro y ya puede ser tuyo en Neobyte. Con unas especificaciones técnicas de infarto y la última tecnología en material de productividad y rendimiento, se convertirá en objeto de deseo de diseñadores, editores, creadores y todo tipo de profesionales. Entre sus principales ventajas destacar la espectacular pantalla táctil OLED con resolución 4K y 15.6 de tamaño. Ésta está complementada por un panel secundario que permite acceder a multitud de funcionalidades enfocadas a agilizar el flujo de trabajo y, en definitiva, a brindar una experiencia de uso insuperable. A estas prestaciones hay que añadir una conectividad de vanguardia y un diseño ergonómico.', 'Asus', 0),
(999, 'Asus TUF Gaming F15 TUF506HF-HN012 - Portátil 15.6 i5-11400H 16GB RTX 2050 512GB SSD', 'https://www.neobyte.es/90525-large_default/asus-tuf-gaming-f15-tuf506hf-hn012-portatil-156-i5-11400h-16gb-rtx-2050-512gb-ssd.jpg', 678.89, 'Con 16GB de memoria RAM DDR4, este portátil garantiza un rendimiento multitarea sin interrupciones, permitiendo ejecutar varios programas simultáneamente y cambiar entre ellos con fluidez.', 'Asus', 0),
(1000, 'Asus TUF Gaming TUF507NU-LP036 - Portátil 15.6 Ryzen 7 7735HS 16GB RTX 4050 512GB', 'https://www.neobyte.es/90405-large_default/asus-tuf-gaming-tuf507nu-lp036-portatil-156-ryzen-7-7735hs-16gb-rtx-4050-512gb.jpg', 968.9, 'La pantalla de 15.6 pulgadas ofrece una experiencia visual inmersiva, perfecta para juegos y contenido multimedia. Además, el diseño resistente de la serie TUF Gaming garantiza una durabilidad excepcional, cumpliendo con los estándares militares de durabilidad MIL-STD-810H, ofreciendo una construcción sólida y fiable.', 'Asus', 0),
(1001, 'Asus TUF A15 TUF507XI-LP054 - Portátil 15.6 Ryzen 9 7940HS 32GB RTX 4070 512GB SSD', 'https://www.neobyte.es/90676-large_default/asus-tuf-a15-tuf507xi-lp054-portatil-156-ryzen-9-7940hs-32gb-rtx-4070-512gb-ssd.jpg', 1370.91, 'La pantalla Full HD de 15.6 pulgadas con una tasa de refresco de 144Hz proporciona imágenes nítidas y una experiencia visual suave, ideal para juegos de alta velocidad y contenido multimedia dinámico.', 'Asus', 0),
