(1010, 'Asus TUF Gaming TUF607JV-N3153 - Portátil 16 i7-13650HX 32GB RTX 4060 1TB SSD', 'https://www.neobyte.es/109667-large_default/asus-tuf-gaming-tuf607jv-n3153-portatil-16-i7-13650hx-32gb-rtx-4060-1tb-ssd.jpg', 1515.9, 'Sumérgete en una experiencia de gaming y creación de primer nivel con el portátil ASUS TUF Gaming TUF607JV-N3153. Equipado con un potente procesador Intel® Core™ i7-13650HX y una GPU NVIDIA® GeForce RTX™ 4060, este portátil te brinda un rendimiento excepcional. La memoria RAM DDR5 de alta velocidad a 4800 MHz y las dos ranuras para SSD M.2 PCIe Gen 4x4 aseguran una multitarea eficiente y un almacenamiento expansible para tus juegos y proyectos.', 'Asus', 0),
(1011, 'HP Victus 16-E0068NS - Portátil 16 Ryzen 5 5600H 8GB GTX 1650 512GB', 'https://www.neobyte.es/65424-large_default/hp-victus-16-e0068ns-portatil-16-ryzen-5-5600h-8gb-gtx-1650-512gb.jpg', 749.9, 'Con el HP Victus 16-E0068NS podrás jugar a tus juegos competitivos favoritos por mucho menos de lo que esperas. Este portátil gaming cuenta con lo esencial para ofrecer un rendimiento adecuado a un amplio catálogo de títulos. Entre sus especificaciones más importantes, destacar la CPU AMD Ryzen 5 5600H de 6 núcleos, los 8GB de memoria RAM, el SSD de 512GB y la tarjeta gráfica Nvidia GeForce GTX 1650 de 4GB. Así mismo, el HP Victus 16-E0068NS destaca por la amplia variedad de puertos, por su conexión WiFi de alta velocidad y su fantástica pantalla Full HD de 16.1 pulgadas.', 'HP', 0),
