(1013, 'HP Omen 16-B1003NS - Portátil 16 i7-12700H 16GB RTX3060 512GB', 'https://www.neobyte.es/80919-large_default/hp-omen-16-b1003ns-portatil-16-i7-12700h-16gb-rtx3060-512gb.jpg', 1333.9, 'El HP Omen 16-B1003NS es un portátil muy completo, capaz de ofrecer a cada jugador lo que realmente necesita. Su configuración está formada por componentes de calidad, con un procesador Intel Core i7-12700H, una tarjeta gráfica RTX 3060, una RAM de 16GB y un SSD de 512GB que garantizan un juego fluido y un rendimiento impecable. Su pantalla IPS de 16 tampoco va a dejar indiferente a nadie, transmitiendo imágenes impactantes y nítidas en resolución Full HD que mostrará hasta los detalles más pequeños de cada escena.', 'HP', 0),
(1014, 'MSI Alpha 17 C7VG-018ES - Portátil 17.3 Ryzen 9 7945HX 32GB RTX 4070 1TB SSD W11', 'https://www.neobyte.es/110724-large_default/msi-alpha-17-c7vg-018es-portatil-173-ryzen-9-7945hx-32gb-rtx-4070-1tb-ssd-w11.jpg', 2074.9, 'El MSI Alpha 17 C7VG-018ES redefine el rendimiento portátil con los potentes procesadores Ryzen 9 7945HX de AMD y la gráfica NVIDIA GeForce RTX Serie 40. Diseñado para gamers y creadores exigentes, este portátil ofrece una experiencia visual asombrosa con la arquitectura Ada Lovelace para trazado de rayos y DLSS 3 basado en IA. Con tecnologías como NVIDIA Max-Q, Wi-Fi 7, y un diseño de refrigeración mejorado con Shared-Pipe y MSI Overboost, experimentarás un rendimiento óptimo y una experiencia de juego inigualable. Además, cuenta con características premium como teclado RGB por tecla de SteelSeries, audio Hi-Resolution, memoria DDR5 de alta velocidad, y una unidad SSD PCIe Gen.4 para acelerar tus tareas. El MSI Alpha 17 C7VG-018ES es la combinación perfecta de potencia, velocidad y estilo, con el exclusivo MSI Center para una personalización completa. Eleva tu juego y creatividad con este portátil de alto rendimiento, diseñado para destacar en todos los aspectos.', 'MSI', 0),
(1015, 'PC NEO Gaming i5-14600K RTX 4070Ti SSD1TB 32GB', 'https://www.neobyte.es/106675-large_default/pc-neo-gaming-i5-14600k-rtx-4070ti-ssd1tb-32gb.jpg', 1799, '¿Buscas lo último en rendimiento? En Neobyte hemos diseñado este PC gaming incluyendo la tecnología más innovadora para que disfrutes de tus juegos al máximo. En este caso hemos elegido un procesador Intel Core i5-14600K de 14ª generación y memorias RAM DDR5 hasta 5200 Mhz, acompañados de una espectacular tarjeta gráfica Nvidia RTX 4070Ti de 12GB. También dispone de un SSD de 1TB de capacidad y fuente de alimentación con certificacion 80 Plus Gold. Compite con los mejores y vive el gaming más inmersivo con este PC NEO GAMING.', 'Neobyte', 0),
