(1033, 'PC NEO Aorus Ryzen 9 5900X RTX 4070 SUPER 1TB SSD + 2TB SSD 32GB', 'https://www.neobyte.es/111165-large_default/pc-neo-aorus-ryzen-9-5900x-rtx-4070-super-1tb-ssd-2tb-ssd-32gb.jpg', 1748.99, 'En Neobyte hemos creado este NEO AORUS con la mejor tecnología gaming de Gigabyte para que puedas hacer frente a un amplio abanico de juegos y difrutarlos como siempre habías soñado. Para ello, nuestros técnicos han incluido un placa Gigabyte B550 Aorus Elite,  un procesador AMD Ryzen 9 5900X acompañado de un Ventilador Cooler Master, 32GB de memoria RAM y tarjeta gráfica Gigabyte Nvidia GeForce RTX 4070 Super 12GB. Una combinación ganadora a la que hay que sumar una caja de estética sumamente cuidada y un almacenamiento compuesto por 1TB SSD y 2TB SSD.', 'Neobyte', 0),
(1034, 'PC NEO Powered By Asus i5-13400F RTX 4060 1TB SSD 16GB', 'https://www.neobyte.es/106407-large_default/pc-neo-powered-by-asus-i5-13400f-rtx-4060-1tb-ssd-16gb.jpg', 999, 'Cuando los técnicos de Neobyte y uno de los principales fabricantes de hardware se ponen de acuerdo el resultado no deja indiferente a nadie. Un PC gaming equipado con tecnología ASUS con el que podrás disfrutar de una experiencia de juego única. Cuenta con procesador Intel Core i5 de 13ª generación, 16GB de memoria y una fantástica tarjeta gráfica Nvidia RTX 4060 de 8Gb que te sumergirá en la acción más trepidante a través de un funcionamiento fluido. Además, incluye un SSD de 1TB, conectividad Wifi y fuente de alimentación con certificación 80+ Bronze. Aprovecha al máximo el rendimiento que ofrece este PC NEO Powered by Asus.', 'Neobyte', 0),
(1035, 'PC NEO Aorus Ryzen 7 7700X RTX 4070 Ti 32GB 1TB SSD+2TB SSD', 'https://www.neobyte.es/102063-large_default/pc-neo-aorus-ryzen-7-7700x-rtx-4070-ti-32gb-1tb-ssd2tb-ssd.jpg', 2398.99, 'Las configuraciones NEO Aorus Inside tienen mucho que decir en el universo gaming. Este PC en concreto ha sido provisto de dos de los componentes más destacados de Gigabyte: la placa B650 Gaming X AX  y la gráfica Nvidia RTX 4070Ti 12GB. Además, cuenta con procesador AMD Ryzen 7 7700X, 32GB de RAM, SSD de 1TB y un segundo SSD de 2TB, un elenco de primer nivel cuya combinación garantiza los mejores resultados. Si lo tuyo es el gaming, disfrutarás de lo lindo con este equipo.', 'Neobyte', 0),
(1036, 'PC NEO Powered by Asus TUF i7-14700K RTX 4060 1TB SSD 16GB', 'https://www.neobyte.es/106389-large_default/pc-neo-powered-by-asus-tuf-i7-14700k-rtx-4060-1tb-ssd-16gb.jpg', 1399, 'Con una estética que no esconde sus intenciones y un rendimiento impresionante, el NEO Powered By Asus TUF Edition se atreve con los juegos más exigentes del momento y te permite disfrutarlos como siempre habías soñado. Nuestros técnicos han dotado a esta configuración gaming de un potente procesador Intel Core i7-14700K, 16GB de memoria RAM y SSD de 1TB para que disfrutes de la máxima velocidad ejecutando todo tipo de programas y trabajando con grandes cantidades de archivos. El broche de oro lo pone una tarjeta gráfica de última generación Nvidia GeForce RTX 4060 de 8GB, provista de las tecnologías más innovadoras y la conectividad más completa.', 'Neobyte', 0),
(1037, 'PC NEO Gaming i7-13700K RTX 4070Ti SUPER 1TB SSD+2TB SSD 32GB', 'https://www.neobyte.es/106421-large_default/pc-neo-gaming-i7-13700k-rtx-4070ti-super-1tb-ssd2tb-ssd-32gb.jpg', 2338.99, 'Te presentamos el ordenador NEO GAMING con procesador Intel Core i7-13700K de 13ª generación, 32GB de memoria RAM y tarjeta gráfica RTX 4070Ti SUPER de 16GB, una auténtica apisonadora capaz de mover con increíble soltura los juegos y programas más exigentes. Bajo su apariencia sobria y elegante, encontramos también un almacenamiento combinado de 1TB SSD + 2TB SSD, lo que asegura la máxima velocidad a la hora de arrancar, transferir información, ejecutar aplicaciones... Confía en Neobyte para el montaje de tu equipo de alto rendimiento por experiencia, atención personalizada, garantía y precio.', 'Neobyte', 0),
(1038, 'PC NEO Gaming i5-14400F RTX 4070 SUPER SSD 1TB 16GB', 'https://www.neobyte.es/90761-large_default/pc-neo-gaming-i5-14400f-rtx-4070-super-ssd-1tb-16gb.jpg', 1398.99, '', 'Neobyte', 0),
(1039, 'PC NEO Aorus i9-14900K RTX 4080 Super 1TB SSD+2TB SSD 32GB', 'https://www.neobyte.es/102074-large_default/pc-neo-aorus-i9-14900k-rtx-4080-super-1tb-ssd2tb-ssd-32gb.jpg', 2999, '', 'Neobyte', 0),
(1040, 'PC NEO Gaming Ryzen 7 7700X RTX 4080 Super 32GB 1TB SSD + 4TB SSD', 'https://www.neobyte.es/108428-large_default/pc-neo-gaming-ryzen-7-7700x-rtx-4080-super-32gb-1tb-ssd-4tb-ssd.jpg', 2799, 'Desafía los límites con este PC NEO Gaming con procesador AMD Ryzen 7 7700X, una bestia diseñada y ensamblada por nuestros técnicos con más de 15 años de experiencia que te permitirá hacer frente a las tareas y juegos más exigentes. Entre sus características técnicas más importantes, destacar también los 32GB de memoria RAM y, por supuesto, la impresionante tarjeta gráfica Nvidia GeForce RTX 4080 Super de 16GB. Con ella podrás exprimir al máximo las posibilidades de los juegos triple A y ejecutar aplicaciones de diseño, render y edición sin problemas. Por último, indicar que ha sido provisto de SSD de 1TB y SSD 4TB para que almacenes todo lo que necesites.', 'Neobyte', 0),
(1041, 'PC NEO Gaming Intel i5 13500 RTX 4070 SUPER 1TB SSD 16GB', 'https://www.neobyte.es/107264-large_default/pc-neo-gaming-intel-i5-13500-rtx-4070-super-1tb-ssd-16gb.jpg', 1499, '', 'Neobyte', 0),
(1042, 'PC NEO Powered by Asus PRO Ryzen 7700X RTX 4070 Ti SUPER 2TB SSD 32GB', 'https://www.neobyte.es/108572-large_default/pc-neo-powered-by-asus-pro-ryzen-7700x-rtx-4070-ti-super-2tb-ssd-32gb.jpg', 2049, 'El ordenador NEO Powered By Asus PRO proporciona el rendimiento profesional que tu día a día necesita. Para ello, nuestros técnicos han ensamblado sobre una placa base del reconocido fabricante, un procesador Amd Ryzen 7 7700X, 32GB de RAM y lo último en almacenamiento, como es un SSD M.2 Nvme de 2TB. Con él podrás producir música y ejecutar todo tipo de tareas pesadas con una fluidez asombrosa y disfrutar de la máxima fiabilidad. Además, en Neobyte, tendrás la certeza de que tu máquina será montada por técnicos con más de 15 años de experiencia y sometida a los tests más rigurosos.', 'Neobyte', 0),
(1043, 'PC NEO Gaming i7-13700K RTX 4070Ti SUPER SSD 1TB 32GB', 'https://www.neobyte.es/107268-large_default/pc-neo-gaming-i7-13700k-rtx-4070ti-super-ssd-1tb-32gb.jpg', 1979, '', 'Neobyte', 0),
(1044, 'PC NEO Gaming i5-14400F RTX 4060Ti SSD 1TB 16GB', 'https://www.neobyte.es/110045-large_default/pc-neo-gaming-i5-14400f-rtx-4060ti-ssd-1tb-16gb.jpg', 1098.99, '', 'Neobyte', 0),
(1045, 'PC NEO Powered by Asus PRO i9-14900KF RTX 4070 SUPER 32GB 1TB SSD + 2TB SSD', 'https://www.neobyte.es/101896-large_default/pc-neo-powered-by-asus-pro-i9-14900kf-rtx-4070-super-32gb-1tb-ssd-2tb-ssd.jpg', 2499, 'Si buscas un ordenador de sobremesa con una capacidad de procesamiento insuperable y con la garantía de un gran fabricante como Asus, no te pierdas este NEO Powered By Asus PRO, ideal para tareas profesionales que exijan una CPU de última generación (Intel Core i9-14900KF), gran cantidad de memoria RAM (32GB) y un almacenamiento completo que incorpora la última tecnología en materia de rendimiento (SSD M.2 Nvme de 1TB + SSD M.2 Nvme de 2TB). Todo ello con una caja de diseño sobrio y silencioso y, solo en Neobyte, con las máximas garantías y la confianza de saber que nuestros técnicos cuentan con más de 15 años de experiencia.', 'Neobyte', 0),
(1046, 'PC NEO Powered By Asus i5-14600K RTX 4060Ti SSD 2TB 32GB', 'https://www.neobyte.es/107280-large_default/pc-neo-powered-by-asus-i5-14600k-rtx-4060ti-ssd-2tb-32gb.jpg', 1499, 'Nuestro nuevo NEO Powered By Asus es tan poderoso como parece. Equipado con un procesador Intel de 14ª generación Intel Core i5-14600K, 32GB de memoria RAM y tarjeta gráfica RTX 4060Ti de 8GB, está preparado para catapultar tus juegos a lo más alto, permitiéndote disfrutarlos con un nivel de detalle sensacional y con una fluidez extraordinaria. Además, hemos incluido un SSD de 2TB que sorprende por la rapidez a la hora de arrancar y ejecutar todo tipo de aplicaciones. Todo ello en una caja de lujo y con la garantía de una gran marca como Asus y la experiencia de Neobyte.', 'Neobyte', 0),
(1047, 'SOPORTE BUNGEE THERMALTAKE ARGENT MB1 RGB', 'https://www.neobyte.es/69599-large_default/soporte-bungee-thermaltake-argent-mb1-rgb.jpg', 22.91, 'SOPORTE THERMALTAKE ARGENT MB1 RGB', 'Thermaltake', 0),
(1048, 'Asus ROG Keris - Ratón gaming', 'https://www.neobyte.es/43235-large_default/raton-asus-rog-keris.jpg', 52.9, 'El Asus ROG Keris es un ratón gaming sin igual, tanto en términos de precio como de rendimiento. Este excelente dispositivo está diseñado para que saques el máximo provecho a tus juegos FPS, con un sensor óptico de 16000 dpi y la posibilidad de realizar diversos ajustes de sensibilidad o configurar los siete botones laterales para adaptarlo totalmente a cualquier estilo de juego. Aunque su estética es sencilla, su diseño ergonómico se adaptará a tu mano para que consigas una sujeción perfecta y sientas la precisión en cada acción que realices. ¡Hazte con el Asus ROG Keris en Neobyte!', 'Asus', 0),
(1049, 'Asus ROG Strix Impact II - Ratón gaming', 'https://www.neobyte.es/27701-large_default/raton-asus-gaming-strix-impact-ii.jpg', 37.9, 'Máxima precisión y comodidad para derrotar a tus contrincantes. El Asus ROG Strix Impact II es un ratón gaming ambidiestro que te permitirá tomar el control absoluto de la partida. Un modelo provisto de botones pivotantes para una respuesta más rápida y sensor de 6200 ppp, con sensibilidad ajustable al vuelo. El cable de goma suave, por otro lado, ofrece menos resistencia y minimiza los tropiezos al usarlo mientras que la iluminación Aura Sync RGB le da un toque de estilo más personal. El Asus ROG Strix Impact II es el arma definitiva para marcar diferencias.', 'Asus', 0),
(1050, 'Corsair Ironclaw Wireless RGB - Ratón gaming inalámbrico 18000dpi', 'https://www.neobyte.es/34963-large_default/raton-corsair-ironclaw-wireless-rgb-18000dpi.jpg', 89.89, 'La victoria está en tus manos con el ratón gaming Corsair Ironclaw Wireless RGB, un modelo que ofrece un agarre de palma increíblemente cómodo y cuenta con unas prestaciones perfectas para FPS y MOBA. Entre ellas, destacar el sensor óptico de hasta 18000dpi, los 10 botones programables y la memoria interna, muy útil para llevar tu perfil de juego siempre contigo y así mostrar tus habilidades. Por otro lado, el Corsair Ironclaw Wireless RGB marca la diferencia por su versatilidad, y es que puede conectarse tanto por cable USB como de manera inalámbrica. En este sentido, indicar que ofrece 2 alternativas de conexión: Bluetooth y Slipstream de 2.4Ghz para una precisión incluso mayor.', 'Corsair', 0),
(1051, 'Newskill Arakne Elite Ivory 16000 dpi - Ratón gaming inalámbrico', 'https://www.neobyte.es/82677-large_default/newskill-arakne-elite-ivory-16000-dpi-raton-gaming-inalambrico.jpg', 48.9, 'Newskill Arakne Elite Ivory 16000 dpi - Ratón gaming inalámbrico', 'Newskill', 0),
(1052, 'Ozone Gaming Neon 3K - Ratón Gaming', 'https://www.neobyte.es/65168-large_default/ozone-gaming-neon-3k-raton-gaming.jpg', 26.9, 'Ozone Gaming Neon 3K - Ratón Gaming', 'Ozone', 0),
(1053, 'Krom Krusher RGB - Kit Teclado + Ratón Gaming', 'https://www.neobyte.es/46745-large_default/krom-krusher-rgb-kit-teclado-raton-gaming.jpg', 24.89, 'Krom Krusher RGB - Kit Teclado + Ratón Gaming', 'Krom', 0),
(1054, 'Mars Gaming MMEX Negro - Ratón Gaming', 'https://www.neobyte.es/61924-large_default/mars-gaming-mmex-negro-raton-gaming.jpg', 24.89, 'Mars Gaming MMEX Negro - Ratón Gaming', 'Mars Gaming', 0),
(1055, 'Newskill Lycan transparente 16000 dpi - Ratón gaming', 'https://www.neobyte.es/82713-large_default/newskill-lycan-transparente-16000-dpi-raton-gaming.jpg', 39.89, 'Newskill Lycan transparente 16000 dpi - Ratón gaming', 'Newskill', 0),
(1056, 'Newskill Helios 10000 dpi - Ratón gaming', 'https://www.neobyte.es/82709-large_default/newskill-helios-10000-dpi-raton-gaming.jpg', 39.95, 'Newskill Helios 10000 dpi - Ratón gaming', 'Newskill', 0),
(1057, 'Krom Keos Gaming RGB - Ratón gaming', 'https://www.neobyte.es/36352-large_default/raton-krom-keos-gaming-rgb.jpg', 13.9, 'Diseño y funcionalidad se integran a la perfección en el Krom Keos Gaming RGB. Este ratón gaming de diseño ergonómico garantiza libertad total de movimientos, así como una respuesta rápida para destacar entre tus rivales. Su tamaño compacto hace que se ajuste perfetamente a la mano y puedas agarrarlo con seguridad, disfrutando de gran comodidad después largas horas de uso. Cuenta con sensor óptico de hasta 6400 DPI con 6 niveles seleccionables en función del juego y tu estilo e iluminación RGB. El Krom Keos Gaming RGB se convertirá en tu mejor arma.', 'Krom', 0),
(1058, 'Newskill Arakne Elite 16000 dpi - Ratón gaming inalámbrico', 'https://www.neobyte.es/82673-large_default/newskill-arakne-elite-16000-dpi-raton-gaming-inalambrico.jpg', 59.96, 'Newskill Arakne Elite 16000 dpi - Ratón gaming', 'Newskill', 0),
(1059, 'Corsair M65 RGB Ultra Blanco - Ratón gaming wireless', 'https://www.neobyte.es/84362-large_default/corsair-m65-rgb-ultra-blanco-raton-gaming-wireless.jpg', 117.9, 'La retroiluminación RGB personalizable en el M65 RGB Ultra ofrece una experiencia visual impresionante. Los usuarios pueden elegir entre una amplia gama de colores y efectos de iluminación para crear una apariencia única que se adapte a su estilo y preferencias.', 'Corsair', 0),
(1060, 'Mars Gaming - Kit Gaming Teclado + Ratón + Alfombrilla', 'https://www.neobyte.es/63460-large_default/mars-gaming-kit-gaming-teclado-raton-alfombrilla.jpg', 20.9, 'Mars Gaming - Kit Gaming Teclado + Ratón + Alfombrilla', 'Mars Gaming', 0),
(1061, 'Corsair M55 RGB PRO - Ratón gaming ambidiestro 12.400 dpi', 'https://www.neobyte.es/22613-large_default/raton-corsair-m55-rgb-pro-ambidiestro.jpg', 39.91, 'El diseño simétrico y la versatilidad del Corsair M55 RGB PRO lo convierten en una opción ganadora para aquellos gamers que busquen un ratón gaming ambidiestro de precio ajustado, construcción duradera y máxima precisión. Y es que este modelo integra un sensor óptico de garantías como es el PMW3327, que alcanza hasta 12.400 dpi, así como switches Omron de primera calidad y 8 botones programables. El Corsair M55 RGB PRO es perfecto para juegos tipo FPS y MOBA y para todo tipo de agarres, contando además, con iluminación RGB configurable mediante iCUE.', 'Corsair', 0),
(1062, 'Corsair Harpoon Pro negro - Ratón gaming', 'https://www.neobyte.es/23945-large_default/raton-corsair-harpoon-pro-gaming-negro.jpg', 27.9, 'Rápido y listo para la batalla. El ratón gaming Corsair Harpoon Pro negro proporciona un cómodo control gracias a sus laterales de goma y su peso ligero. Incorpora un sensor óptico de hasta 12.000 DPI e interruptores Omrom de alto rendimiento, que garantizan una gran durabilidad. Además, cuenta con 6 botones programables e iluminación RGB. El Corsair Harpoon Pro negro es el complemento perfecto para sobresalir entre tus rivales.', 'Corsair', 0),
(1063, 'Corsair Scimitar RGB Elite Negro - Ratón gaming 18000dpi', 'https://www.neobyte.es/28618-large_default/raton-corsair-scimitar-rgb-elite-negro.jpg', 89.89, 'Rápido y listo para la batalla. El ratón gaming Corsair Harpoon Pro negro proporciona un cómodo control gracias a sus laterales de goma y su peso ligero. Incorpora un sensor óptico de hasta 12.000 DPI e interruptores Omrom de alto rendimiento, que garantizan una gran durabilidad. Además, cuenta con 6 botones programables e iluminación RGB. El Corsair Harpoon Pro negro es el complemento perfecto para sobresalir entre tus rivales.', 'Corsair', 0),
(1064, 'Corsair Katar Pro XT - Ratón gaming 18000 dpi', 'https://www.neobyte.es/45516-large_default/corsair-katar-pro-xt-raton-gaming-18000-dpi.jpg', 39.89, 'De la mano de una marca pionera en la fabricación de ratones llega el Corsair Katar Pro XT, un modelo de reducido tamaño con unas prestaciones de elevada calidad. Totalmente personalizable, este ratón gaming te permitirá realizar una configuración de sus 6 botones para adaptarlo a tu propio estilo, y su rueda de desplazamiento contiene una iluminación RGB que podrás modificar con los colores de tu preferencia. Si lo que quieres es velocidad, agilidad de movimiento y comodidad para poder jugar durante horas con las máximas garantías, esta herramienta incorpora un sensor de 18000 dpi y unas reducidas dimensiones que te facilitará su manejo. Con un peso de solo 73 gramos, el Corsair Katar Pro XT hará fluir cada uno de tus movimientos.', 'Corsair', 0),
(1065, 'Ozone Double Tap - Teclado + Ratón Gaming', 'https://www.neobyte.es/65220-large_default/ozone-double-tap-teclado-raton-gaming.jpg', 54.9, 'Ozone Double Tap - Teclado + Ratón Gaming', 'Ozone', 0),
(1066, 'Razer Basilisk V3 - Ratón Gaming', 'https://www.neobyte.es/62187-large_default/razer-basilisk-v3-raton-gaming.jpg', 96.9, 'Razer Basilisk V3 - Ratón Gaming', 'Razer', 0),
(1067, 'Steelseries Rival 3 - Ratón gaming', 'https://www.neobyte.es/75786-large_default/steelseries-rival-3-raton-gaming.jpg', 46.9, 'Steelseries Rival 3 - Ratón gaming', 'Steelseries', 0);
