(1079, 'Corsair K65 Pro Mini 65% RGB - Teclado gaming óptico-mecánico', 'https://www.neobyte.es/99703-large_default/corsair-k65-pro-mini-65-rgb-teclado-gaming-optico-mecanico.jpg', 149.89, 'Corsair K65 Pro Mini 65% RGB - Teclado gaming óptico-mecánico', 'Corsair', 0),
(1080, 'Krom Krusher RGB - Kit Teclado + Ratón Gaming', 'https://www.neobyte.es/46745-large_default/krom-krusher-rgb-kit-teclado-raton-gaming.jpg', 24.89, 'Krom Krusher RGB - Kit Teclado + Ratón Gaming', 'Krom', 0),
(1081, 'Krom Kalyos - Kit teclado + ratón gaming', 'https://www.neobyte.es/40804-large_default/teclado-krom-kalyos-gaming-raton.jpg', 28.89, 'Krom Kalyos es un pack de teclado + ratón gaming con el que mejorarás tu experiencia de juego. Un combo letal formado por un teclado de membrana y un ratón con sensor óptico gracias a los cuales obtendrás la precisión que necesitas para derrotar a tus rivales. Por un lado, el teclado multifuncional con retroiluminación RGB presenta 19 teclas anti-ghosting, modo juego para bloquear la tecla Windows, intercambio de teclas WASD con las teclas de dirección y teclas multimedia dedicadas. Por otro, un ratón con 6 niveles DPI y diseño ergonómico que se ajustará perfectamente a tu mano. Juntos marcarán la diferencia. Hazte con el Kit Krom Kalyos en Neobyte.', 'Krom', 0),
(1082, 'Mars Gaming - Kit Gaming Teclado + Ratón + Alfombrilla', 'https://www.neobyte.es/63460-large_default/mars-gaming-kit-gaming-teclado-raton-alfombrilla.jpg', 20.9, 'Mars Gaming - Kit Gaming Teclado + Ratón + Alfombrilla', 'Mars Gaming', 0),
(1083, 'Krom Kernel - Teclado gaming mecánico RGB', 'https://www.neobyte.es/13474-large_default/teclado-mecanico-krom-kernel-tkl-rgb-numerico.jpg', 38.9, 'El teclado gaming Krom Kernel satisface con creces las necesidades de todo gamer, pues cuenta con una extraordinaria relación calidad-precio y unas especificaciones técnicas más que interesantes. Muestra de ello es que incorpora switches mecánicos Outemu RED, función anti-ghosting y la posibilidad de crear macros al vuelo, cualidades que garantizan la máxima precisión en cada movimiento. Además, el Krom Kernel está provisto de retroiluminación LED con 9 efectos, algo que encantará a los apasionados del RGB.', 'Krom', 0),
