(1088, 'Newskill Pyros Ivory Speed Pro Kailh Speed Bronze - Teclado mecánico gaming inalámbrico', 'https://www.neobyte.es/84291-large_default/newskill-pyros-ivory-speed-pro-kailh-speed-bronze-teclado-mecanico-gaming-inalambrico.jpg', 67.89, 'Newskill Pyros Speed Pro Kailh Speed Bronze - Teclado mecánico gaming inalámbrico', 'Newskill', 0),
(1089, 'Newskill Serike v2 TKL Blanco - Teclado gaming mecánico', 'https://www.neobyte.es/103390-large_default/newskill-serike-v2-tkl-blanco-teclado-gaming-mecanico.jpg', 84.95, 'El Newskill Serike v2 TKL también ofrece características de gaming avanzadas, como la función anti-ghosting y la capacidad de desactivar la tecla Windows para evitar interrupciones accidentales durante el juego. Estas características están diseñadas para mejorar tu experiencia de juego y proporcionar un control preciso en momentos críticos. La construcción robusta y duradera garantiza una vida útil prolongada, incluso en condiciones de uso intensivo. Además, su diseño ergonómico proporciona comodidad durante largas sesiones de juego, lo que significa que puedes concentrarte en el juego sin preocuparte por la fatiga.', 'Newskill', 0),
