(1106, 'Logitech G213 Prodigy - Teclado gaming USB', 'https://www.neobyte.es/23904-large_default/teclado-logitech-g213-prodigy-gaming-usb-rgb.jpg', 82.9, 'El Logitech G213 Prodigy es sinónimo de rendimiento gaming. Este teclado incorpora teclas Logitech G Mech-Dome, que ofrecen una respuesta rápida ante las pulsaciones, e iluminación RGB Lightsync, con 5 zonas de iluminación. Por otro lado, es resistente a salpicaduras, cuenta con reposamanos y patas ajustables y dispone de controles multimedia para reproducir, poner en pausa y silencia música y vídeos al instante. El Logitech G213 Prodigy es, en definitiva, un teclado duradero y funcional con el que disfrutarás de una ventaja frente a tus adversarios.', 'Logitech', 0),
