(1122, 'Asus ROG Delta Core - Auriculares gaming', 'https://www.neobyte.es/20755-large_default/auriculares-asus-rog-delta-core.jpg', 73.89, 'Vive la experiencia más inmersiva con los auriculares gaming Asus ROG Delta Core. Este modelo es compatible con las principales plataformas (PC, PS4, Xbox One, Nintendo Switch) y ha sido equipado con exclusivos drivers Asus Essence para un audio de alta resolución. Su cuidado diseño proporciona un confort extra de la mano de las almohadillas ROG Hybrid en forma de D, las cuales se ajustan perfectamente al pabellón auditivo reduciendo un 20% el área de contacto para reducir la fatiga. No nos olvidamos de su micrófono integrado, con el que disfrutarás de una excelente comunicación con tu equipo.', 'Asus', 0),
(1123, 'Asus ROG Delta - Auriculares gaming RGB', 'https://www.neobyte.es/21951-large_default/auriculares-asus-rog-delta.jpg', 112.89, '¡Disfruta de un sonido espectacular con los auriculares Asus ROG Delta! Es el primer auricular para juegos del mundo con el DAC cuádruple ESS 9218 para que el audio sea espectacular. La conexión es USB-C pero trae adaptador a USB 2.0 para que puedas usar estos auriculares ya sean en PC, móviles o PS4. Los auriculares Asus ROG Delta te pueden dar una seria ventaja ante tus rivales pues puedes escuchar con precisión milimétrica la distancia de tus enemigos, la dirección de los pasos y de los disparos. Y por supuesto, con luces RGB circular tipo arco iris.', 'Asus', 0),
(1124, 'Corsair HS65 Surround Carbon - Auriculares gaming', 'https://www.neobyte.es/71258-large_default/corsair-hs65-surround-carbon-auriculares-gaming.jpg', 89.89, 'Ya en Neobyte los Corsair HS65 Surround Carbon. Estos auriculares gaming han sido desarrollados para que vibres en cada partida y obtengas la ventaja competitiva que tanto deseas. Fabricados con materiales de máxima calidad, brindan una experiencia de uso sumamente satisfactoria. En lo referentes a sus especificaciones técnicas, destacar los transductores de neodimio de 50mm, el micrófono de gran precisión y el sonido envolvente 7.1 mediante adaptador USB incluido. En cuanto a su construcción, los Corsair HS65 Surround Carbon convencen por sus acabados premium y la comodidad sin igual que ofrecen sus almohadillas ajustables de viscoelástica y polipiel, así como su diadema de extraordinaria ligereza.', 'Corsair', 0),
(1125, 'Corsair HS65 Wireless Carbon v2 - Auriculares gaming inalámbricos', 'https://www.neobyte.es/105277-large_default/corsair-hs65-wireless-carbon-v2-auriculares-gaming-inalambricos.jpg', 134.89, 'Corsair HS65 Wireless Carbon v2 - Auriculares gaming inalámbricos', 'Corsair', 0),
(1126, 'Corsair HS80 RGB Wireless Negro - Auriculares gaming', 'https://www.neobyte.es/57959-large_default/corsair-hs80-rgb-wireless-negro-auriculares-gaming.jpg', 149.89, 'Déjate envolver por el sonido de calidad de los Corsair HS80 RGB Wireless Negro. Estos auriculares gaming te transportarán a la acción de cada batalla y de cada historia, rodeándote con un audio rico en matices y realista. Gracias a su diseño de almohadillas de espuma viscoelástica con tela transpirable y diadema flotante sin presión podrás llevarlos durante horas con total comodidad, disfrutando de la libertad de movimientos que ofrece la conectividad sin cables. Además, cuenta con micrófono omnidireccional de manera que tus comunicaciones serán nítidas. No te conformes con menos: Corsair HS80 RGB Wireless Negro.', 'Corsair', 0),
(1127, 'Corsair Void RGB Elite USB Carbon - Auriculares gaming 7.1', 'https://www.neobyte.es/29056-large_default/corsair-void-rgb-elite-usb-carbon-auriculares-gaming-71.jpg', 89.89, 'Corsair Void RGB Elite Carbon 7.1, unos auriculares gaming de primera calidad que superarán tus expectativas y que ahora puedes conseguir en Neobyte al precio más competitivo. Su diseño incluye iluminación RGB que encaja a la perfección en tu setup, así como almohadillas ergonómicas de microfibra y diadema de gran confort para una comodidad espectacular. Además, los Corsair Void RGB Elite Carbon incorporan micrófono ajustable omnidireccional para una comunicación clara con tu equipo.', 'Corsair', 0),
(1128, 'Asus TUF Gaming H3 Rojo - Auriculares', 'https://www.neobyte.es/24718-large_default/auricular-asus-tuf-gaming-h3-rojo.jpg', 45.9, 'Ligeros y de diseño robusto, los auriculares Asus TUF Gaming H3 Rojo han sido concebidos para proporcionar confort y durabilidad a gamers y streamers que pasan mucho tiempo jugando. Un modelo que garantiza un sonido rico e inmersivo gracias a sus drivers de 50 mm y a la cámara hermética, mejorando aún más la experiencia de juego. Además, han sido provistos de un elemento indispensable para una óptima comunicación con tu equipo: un impresionante micrófono unidireccional. Hazte ya con los Asus TUF Gaming H3 Rojo en Neobyte al mejor precio.', 'Asus', 0),
(1129, 'Asus ROG Strix GO 2.4 - Auriculares gaming inalámbricos 2.4Ghz', 'https://www.neobyte.es/30155-large_default/asus-rog-strix-go-24.jpg', 149.94, 'Ligeros y de diseño robusto, los auriculares Asus TUF Gaming H3 Rojo han sido concebidos para proporcionar confort y durabilidad a gamers y streamers que pasan mucho tiempo jugando. Un modelo que garantiza un sonido rico e inmersivo gracias a sus drivers de 50 mm y a la cámara hermética, mejorando aún más la experiencia de juego. Además, han sido provistos de un elemento indispensable para una óptima comunicación con tu equipo: un impresionante micrófono unidireccional. Hazte ya con los Asus TUF Gaming H3 Rojo en Neobyte al mejor precio.', 'Asus', 0),
(1130, 'Asus ROG Theta Electret - Auriculares gaming', 'https://www.neobyte.es/34335-large_default/auriculares-asus-rog-thetea-electret.jpg', 219.89, 'Si te apasiona el sonido, los Asus ROG Theta Electret son para ti. Estos auriculares de grado audiófilo incorporan los últimos avances en material de rendimiento acústico, permitiéndote disfrutar no solo de tus juegos, sino también de tu música y películas con una calidad insuperable. Para ello, los Asus ROG Theta Electret equipan transductores de neodimio y electret en una cámara estanca, lo que se traduce en una experiencia sonora envolvente y realista. Además, son compatibles con todo tipo de plataformas (móviles, ordenadores, consolas...), incluyen micrófono desmontable y proporcionan una ajuste sumamente confortable.', 'Asus', 0),
