(1141, 'Razer Blackshark V2 X - Auriculares gaming', 'https://www.neobyte.es/38133-large_default/auricular-razer-blackshark-v2-x.jpg', 90.9, 'El sonido de los esports tiene nombres y apellidos: Razer Blackshark V2 X. Estos auriculares gaming han sido diseñados para competición más exigente, resultando sumamente ligeros y cómodos incluso en largas maratones de juego. Su estudiada construcción proporciona un aislamiento acústico impresionante, así como una inmersión y calidad de sonido sublime, produciendo un audio brillante, con graves potentes y voces cristalinas. Además, incorporan micrófono flexible con cancelación pasiva de ruido avanzada y certificación Discord, lo que garantiza una comunicación clara y sin error. Por ultimo, indicar que, gracias al conector de 3.5, son compatible con prácticamente la totalidad de las plataformas.', 'Razer', 0),
(1142, 'Razer Blackshark V2 X Verde - Auriculares Gaming', 'https://www.neobyte.es/62173-large_default/razer-blackshark-v2-x-verde-auriculares-gaming.jpg', 90.9, 'Razer Blackshark V2 X Verde - Auriculares Gaming', 'Razer', 0),
(1143, 'Gigabyte M28U - Monitor 28 UHD 144HZ SS IPS', 'https://www.neobyte.es/48591-large_default/monitor-28-gigabyte-m28u-ss-ips-144hz.jpg', 538.99, 'El Gigabyte M28U llega a Neobyte para completar tu setup gaming. Este monitor con panel SS IPS (Super Speed IPS) de 28 cuenta con resolución nativa UHD 4K (3840x2160 px) y una tasa de refresco de 144 Hz, lo que se traduce en una jugabilidad más fluida, imágenes detalladas y una inmersión total en los contenidos. También cuenta con tecnología Flicker-Free para hacer más cómoda la experiencia de visuallización y evitar la vista cansada, modo KVM para controlar dos equipos diferentes con los mismos periféricos y altavoces de 3W de potencia cada uno. Compra el Gigabyte M28U en Neobyte con todas las garantías.', 'Gigabyte', 0),
(1144, 'Gigabyte M28U Arm Edition - Monitor 28 UHD 144Hz SS IPS', 'https://www.neobyte.es/81595-large_default/gigabyte-m28u-arm-edition-monitor-28-uhd-144hz-ss-ips.jpg', 559, 'Gigabyte M28U AE - Monitor 28 4K UHD 144Hz', 'Gigabyte', 0),
(1145, 'Gigabyte G27F 2 - Monitor 27 IPS Full HD FreeSync 170Hz', 'https://www.neobyte.es/76410-large_default/gigabyte-g27f-2-monitor-27-ips-fullhd-freesync-170hz.jpg', 219, 'El Gigabyte G27F 2 es justo lo que necesitas para completar tu setup gaming. Desarrollado teniendo en mente las necesidades de los jugadores más exigentes, cuenta con lo último en rendimiento y lo ofrece sin necesidad de extravagancias. Entre sus características principales, destacar el fantástico panel IPS de 27 pulgadas con resolución Full HD y una tasa de refresco de hasta 170Hz. Esta combinación perfecta entre velocidad, ángulo de visión y calidad de imagen es una apuesta segura. Pero esto no es todo, pues también es compatible con la tecnología AMD FreeSync y cuenta con diferentes funcionalidades especialmente pensados para jugar (OSD, Black Equalizer, Dashboard...). A esto hay que añadir una completa conectividad y varias alternativas de ajuste.', 'Gigabyte', 0),
(1146, 'Gigabyte M27Q-EK rev. 2.0 - Monitor 27 QHD IPS 165Hz', 'https://www.neobyte.es/98508-large_default/gigabyte-m27q-ek-rev-20-monitor-27-qhd-ips-165hz.jpg', 319, 'El monitor Gigabyte M27Q-EK pone a tu disposición un arsenal de características que te permitirán marcar la diferencia en tus juegos. Esta pantalla de 27 está equipada con panel IPS de resolución QHD (2560 x 1440) para que disfrutes de imágenes repletas de vida y con un nivel de detalle espectacular. Mientras tanto, los 165Hz de refresco (170Hz OC), 1 ms de tiempo de respuesta y la tecnología FreeSync se encargan de producir transiciones fluidas, suaves y ultra-precisas. Otra de sus principales ventajas es la certificación Display HDR400, lo que asegura una mayor profundidad de color. Además, el Gigabyte M27Q-EK (rev 2.0) incorpora KVM para una mejor vinculación con todos tus dispositivos.', 'Gigabyte', 0),
(1147, 'MSI Gaming G2712V - Monitor 27 IPS Full HD 100Hz', 'https://www.neobyte.es/105932-large_default/msi-gaming-g2712v-monitor-27-ips-full-hd-100hz.jpg', 178.9, 'MSI Gaming G2712V - Monitor 27 IPS Full HD 100Hz', 'MSI', 0),
(1148, 'AOC Q27G2S/EU - Monitor 27 IPS QHD 165Hz', 'https://www.neobyte.es/77550-large_default/aoc-q27g2seu-monitor-27-ips-qhd-165hz.jpg', 265.9, 'AOC Q27G2S/EU - Monitor 27 IPS QHD 165Hz', 'AOC', 0),
(1149, 'Asus TUF Gaming VG27AQA1A - Monitor gaming 27 2K QHD FreeSync', 'https://www.neobyte.es/87643-large_default/asus-tuf-gaming-vg27aqa1a-monitor-gaming-27-2k-qhd-freesync.jpg', 239, 'El monitor de gaming ASUS TUF Gaming VG27AQA1A ofrece una experiencia inmersiva con su pantalla de 27 WQHD (2560x1440) y frecuencia de actualización overclockeada a 170 Hz. Con un tiempo de respuesta de 1 ms (MPRT) y tecnología ASUS Extreme Low Motion Blur, proporciona un juego fluido y sin desenfoques. Equipado con FreeSync Premium™ para una experiencia libre de tearing, HDR para colores vibrantes y alto contraste, y características como Shadow Boost, el VG27AQA1A es ideal para gamers profesionales. Además, su versatilidad se destaca con ASUS DisplayWidget Lite para ajustes rápidos y una variedad de opciones de conectividad, incluyendo HDMI y DisplayPort. Un monitor potente para una experiencia de gaming excepcional.', 'Asus', 0),
(1150, 'Gigabyte M27U - Monitor gaming 27 UHD 4K 160Hz', 'https://www.neobyte.es/111338-large_default/gigabyte-m27u-monitor-gaming-27-uhd-4k-160hz.jpg', 559.9, 'Su función KVM simplifica el control de múltiples dispositivos, y con resolución UHD 4K a 160Hz, color de 10 bits y un amplio espectro de color del 95% DCI-P3, garantiza calidad visual detallada y una experiencia de juego inmersiva. El diseño elegante y ergonómico se integra a la perfección con la filosofía de diseño de la serie gaming de GIGABYTE. Características como OSD Sidekick permiten ajustes fáciles, mientras que las certificaciones Flicker-Free y Low Blue Light cuidan de tu salud visual. Eleva tu juego con el M27U de GIGABYTE, un monitor que combina rendimiento y diseño compacto.', 'Gigabyte', 0),
(1151, 'Asus ROG Strix XG49VQ - Monitor 49 Ultrapanorámico Full HD 144 Hz', 'https://www.neobyte.es/21842-large_default/asus-rog-strix-xg49vq-monitor-49-ultrapanoramico-full-hd-144-hz.jpg', 769, 'El Asus ROG Strix XG49VQ te dejará sin palabras. Este monitor ultrapanorámico de 49 pulgadas con pantalla curva acentúa la sensación de inmersión en los juegos y multiplica la versatilidad en aplicaciones multitarea. Cuenta con una tasa de refresco de 144 Hz, lo que garantiza una gran fluidez incluso con la configuración gráfica más alta, y tecnología Radeon Freesync 2 para mejorar la respuesta en los juegos. Gracias a sus dimensiones podrás visualizar hasta tres entradas de vídeo simultáneamente, mientras que la tecnología antiparpadeo y el sistema de luz azul de baja intensidad mitiga los efectos perjudiciales de una exposición prolongada. Por todo ello, se ha convertido en la opción preferidas para sim racing y todo tipo de juegos.', 'Asus', 0),
(1152, 'Asus VG289Q - Monitor 28 4K IPS', 'https://www.neobyte.es/31039-large_default/monitor-asus-28-vg289q.jpg', 289, 'Te presentamos el Asus VG289Q TUF Gaming, un monitor gaming 4K de 28 para los que quieren disfrutar de la máxima reslución. Esta pantalla IPS es compatible con el 90% del espacio de color DCI-P3 y cuenta con la tecnología HDR, lo que significa una mayor fidelidad de las imágenes y una riqueza cromática excepcional. Además, el Asus VG289Q TUF Gaming está provisto de FreeSync, un sistema que ayuda a una reproducción suave de las escenas en movimiento, reduciendo así los entrecortes y los problemas de sincronización de FPS. En último lugar, señalar que cuenta con una completa conectividad y está provisto de altavoces.', 'Asus', 0),
(1153, 'Asus XG32VC - Monitor curvo 32 WQHD 170Hz 1ms', 'https://www.neobyte.es/39506-large_default/monitor-asus-32-xg32vc-wqhd-170hz.jpg', 448.99, 'Si estás buscando un monitor curvo que te sumerja en la acción de los juegos, el Asus XG32VC ROG Strix no te defraudará. Un modelo de 32 pulgadas con resolución WQHD en el que las imágenes se muestran detalladas, definidas y realistas. Su tasa de refresco de 170Hz y la tecnología Extreme Low Motion Blur, que alcanza un tiempo de respuesta de 1ms, eliminan el desenfoque de movimiento y ofrece objetos más nítidos y una experiencia gaming más fluida. Cuenta con tecnologías AMD FreeSync Premium Pro, HDR y mejoras in-game para adelantarte a tus rivales. El Asus XG32VC ROG Strix, además, dispone de hub USB-C para que puedas conectar otros dispositivos o cargar tu teléfono móvil compatible.', 'Asus', 0),
(1154, 'Asus XG438QR - Monitor 43 UHD 4K 120Hz', 'https://www.neobyte.es/43006-large_default/monitor-43-asus-rog-strix-xg438qr-uhd-4k-120hz.jpg', 899.01, 'Monitor de gran pulgada Asus XG438QR ROG Strix, con resolución UHD 4K y una tasa de refresco de 120Hz, ideal para disfrutar de tus juegos a lo grande. Este modelo ofrece una combinación perfecta de calidad de imagen, nivel de detalle, velocidad y calidad de fabricación. Entre sus principales ventajas, destacar las 43 de su panel y las tecnologías DisplayHDR 600 y DCI-P3 90% que aseguran colores y contrastes más realistas. Además, el Asus XG438QR ROG Strix incorpora FreeSync Premium Pro para una acción más suave. Por último, indicar que incluye potentes altavoces, multitud de puertos e iluminación Aura Sync.', 'Asus', 0),
(1155, 'Asus VG289Q1A - Monitor 28 IPS UHD 4K FreeSync', 'https://www.neobyte.es/43016-large_default/asus-vg289q1a-monitor-28-ips-uhd-4k-freesync.jpg', 249.01, 'Te presentamos el Asus VG289Q1A TUF Gaming, un monitor IPS de 28 con resolución UHD 4K que te asombrará por su increíble calidad de imagen. Compatible con HDR 10 de alto rango dinámico, cuenta con una saturación de color DCI-P3 del 90%, lo que garantiza una mejor reproducción del color y un contraste sumamnete fiel a la realidad. Además, incorpora diferentes funcionalidades enfocadas a juegos, como Shadow Boost, Ultra-Low Blue Light, Gameplus y FreeSync. En útlimo lugar, indicar que el Asus VG289Q1A TUF Gaming integra altavoces y una completa conectividad.', 'Asus', 0),
(1156, 'Asus VG24VQE - Monitor curvo 24 Full HD 165Hz', 'https://www.neobyte.es/43166-large_default/asus-vg24vqe-monitor-curvo-24-full-hd-165hz.jpg', 179, 'Vive la máxima inmersión con el Asus VG24VQE TUF Gaming, un monitor curvo concebido para exprimir las posibilidades de tus juegos más trepidantes. El panel curvo de 23.6 cuenta con la resolución Full HD y 165Hz de tasa de refresco. Estas especificaciones, junto a las tecnologías ELMB y FreeSync Premium, permiten disfrutar de imágenes de primera calidad con transiciones suaves y sumamente precisas. Ademas, el Asus VG24VQE TUF Gaming Shadow Boost te ayudará a localizar a los enemigos y lograr la ventaja competitiva que necesitas. ¡Ya en Neobyte!', 'Asus', 0),
(1157, 'Asus VG32VQ1BR - Monitor curvo 32 WQHD 165HZ', 'https://www.neobyte.es/44284-large_default/monitor-asus-32-vg32vq1br-wqhd-165hz.jpg', 269, 'Sumérgete de lleno en los juegos con el Asus VG32VQ1BR TUF Gaming, el monitor con pantalla curva de 31,5 pulgadas diseñado para garantizarte una experiencia de juego única. Para hacer frente a tales afirmaciones viene provisto de un tiempo de respuesta de 1ms, frecuencia de actualización de 165Hz y tecnología FreeSync Premium, que te permitirán disfrutar de partidas fluidas sin cortes ni interrupciones. En cuanto a calidad de imagen, podrás deleitarte con escenas en QHD compatibles con HDR-10, para un contraste y brillo inigualable. El Asus VG32VQ1BR TUF Gaming también cuenta con múltiples opciones de conectividad y altavoces integrados, que harán tu experiencia gaming mucho más inmersiva.', 'Asus', 0),
(1158, 'Asus TUF Gaming VG24VQR - Monitor curvo 24 Full HD 165 Hz', 'https://www.neobyte.es/46041-large_default/monitor-curvo-24-asus-tuf-gaming-vg24vqr.jpg', 205.91, 'Asus TUF Gaming VG24VQR es un monitor curvo Full HD provisto de una ultrarrápida tasa de refresco de 165Hz, lo que lo convierte en un modelo perfecto para gamers profesionales y jugadores que busquen la máxima inmersión en los juegos. Disfruta de una experiencia gaming más fluida gracias a tecnologías como Adaptive-Sync (FreeSync Premium™) y Extrem Low Motion Blur, que elimina la distorsión de las escenas de acción más rápidas. Hazte ya con el Asus TUF Gaming VG24VQR en Neobyte al precio más competitivo.', 'Asus', 0),
(1159, 'Asus XG349C - Monitor curvo 34 UWQHD 180Hz IPS G-Sync', 'https://www.neobyte.es/50069-large_default/asus-xg349c-monitor-curvo-34-uwqhd-180hz-ips-g-sync.jpg', 899.01, 'Toma la curva hacia la victoria con el Asus XG349C ROG Strix, un monitor gaming que te permitirá vivir una experiencia ultrapanorámica inigualable. Provisto de panel IPS de 34 y resolución WQHD, produce imágenes repletas de vida y sumamente detalladas. Así mismo, los 180Hz de tasa de refresco (OC) y la compatibilidad con Nvidia G-Sync aseguran una acción fluida y precisa, lo que te otorgará una ventaja competitiva. El Asus XG349C ROG Strix cuenta además con potentes altavoces integrados, certificación DisplayHDR 400 y la conectividad más variada, incluyendo USB-C.', 'Asus', 0),
(1160, 'Asus ROG Strix XG32UQ - Monitor gaming 32 IPS 4K UHD 160Hz', 'https://www.neobyte.es/78869-large_default/asus-rog-strix-xg32uq-monitor-gaming-32-ips-4k-uhd-160hz.jpg', 899.01, 'La experiencia gaming más asombrosa está al alcance de tu mano con el Asus ROG Strix XG32UQ. Este monitor gaming profesional con panel IPS de 32 pulgadas ha sido diseñado para sumergirte en la acción más trepidante sin renunciar a unos gráficas espectaculares y a una definición única. Disfruta de una fluidez fuera de lo común gracias a la frecuencia de actualización de 160 Hz (OC) y al tiempo de respuesta de de 1 ms, consiguiendo imágenes sin desenfoque de movimiento ni manchas que aumentan el realismo y mejoran la jugabilidad. ¡Cómpralo ya en la tienda online de Neobyte!', 'Asus', 0),
