(1165, 'LG 24MP60G-B - Monitor 24 Full HD IPS 75Hz', 'https://www.neobyte.es/57626-large_default/lg-24mp60g-b-monitor-24-full-hd-ips-75hz.jpg', 112.91, 'Con una estética moderna y actual, el LG 24MP60G-B encaja a la perfección en tu escritorio. Por sus características, es idóneo para trabajar, estudiar e incluso para jugar. Y es que el panel IPS Full HD con 75Hz de tasa de refresco brinda imágenes de calidad sensacional y fluidas desde cualquier ángulo. Además, el LG 24MP60G-B dispone de diferentes puertos para conectarlo sin problemas a tu PC, consola...', 'LG', 0),
(1166, 'Asus TUF Gaming VG27VQM - Monitor 27 Full HD 240Hz 1ms', 'https://www.neobyte.es/75955-large_default/asus-tuf-gaming-vg27vqm-monitor-27-full-hd-240hz-1ms.jpg', 254.9, 'Prepárate para la acción más inmersiva con el Asus TUF Gaming VG27VQM, un monitor curvo con pantalla de 27 pulgadas que completará perfectamente tu PC. Gracias a la tasa de refresco de 240 Hz y al tiempo de respuesta de 1ms disfrutarás de una fluidez excelente, eliminando el desenfoque de las escenas rápidas para brindarte la mejor experiencia de juego en carreras, shooters, deportes y juegos de estrategia en tiempo real. Además, incluye varias funcionalidades gaming que te permitirán potenciar las posibilidades de los juegos. ¡Cómpralo ya en Neobyte!', 'Asus', 0),
