(1169, 'Asus VG27VH1B - Monitor curvo 27 Full HD 165Hz 1ms', 'https://www.neobyte.es/39521-large_default/monitor-asus-27-vg27vh1b-165hz.jpg', 197.9, '¿Buscas el compañero perfecto para tu PC Gaming? El monitor Asus VG27VH1B TUF con pantalla curva de 27 pulgadas hará que vivas los juegos a otro nivel. Se trata de un modelo con resolución Full HD y tasa de refresco de 165Hz en el que las imágenes se mostrarán ricas en detalles y definidas, la jugabilidad será más rápida y te olvidarás del desenfoque de las escenas más rápidas. En este sentido, es importante reseñar que cuenta con tecnología Adaptive-Sync (FreeSync Premium) para una experiencia gaming totalmente fluida. La curvatura del panel te permitirá sumergirte de lleno en los juegos, mientras que su diseño ergonómico te facilitará ajustarlo a tu gusto. Si estás pensando en comprar un monitor gaming de garantías, el Asus VG27VH1B TUF es para ti.', 'Asus', 0),
(1170, 'LG 29WP60G-B - Monitor gaming 29 IPS WFHD FreeSync', 'https://www.neobyte.es/85913-large_default/lg-29wp60g-b-monitor-gaming-29-ips-wfhd-freesync.jpg', 192.9, 'LG 29WP60G-B - Monitor gaming 29 IPS WFHD FreeSync', 'LG', 0),
