(1172, 'Asus TUF Gaming VG249QM1A - Monitor gaming 23.8 IPS Full HD 270Hz FreeSync', 'https://www.neobyte.es/78811-large_default/asus-tuf-gaming-vg249qm1a-monitor-gaming-238-ips-full-hd-270hz-freesync.jpg', 227.9, 'Asus TUF Gaming VG249QM1A - Monitor 23.8 IPS Full HD 270Hz FreeSync', 'Asus', 0),
(1173, 'Asus TUF VG279Q1R - Monitor 27 Full HD 144 Hz', 'https://www.neobyte.es/34753-large_default/monitor-27-asus-vg279q1r.jpg', 181.9, 'Diseñado para gamers profesionales y entusiastas del rendimiento, el Asus TUF Gaming VG279Q1R garantiza una respuesta rápida e imágenes definidas para sumergirte de lleno en las partidas. Un monitor de 27 con resolución Full HD, tecnología FreeSync y tasa de refresco de 144 Hz que ofrece la jugabilida más fluida, sin imágenes entrecortadas ni tirones. Disfruta del espacio de visualización más amplio proporcionado por su diseño de marcos ultrafinos y de prácticas mejoras in-game con las que sobresaldrás sobre tus rivales. El Asus TUF Gaming VG279Q1R marcará la diferencia con tu anterior monitor.', 'Asus', 0),
(1174, 'Ozone DSP27 - Monitor 27 IPS 2K QHD 144Hz 1ms G-Sync', 'https://www.neobyte.es/65144-large_default/ozone-dsp27-monitor-27-ips-2k-qhd-144hz-1ms-g-sync-.jpg', 329.9, 'Diseñado para cubrir las necesidades de todo jugador, el Ozone DSP27 destaca por su increíble potencial y su versatilidad. Un monitor IPS de 27 con resolución QHD que permite disfrutar de un contenido nítido y detallado desde cualquier ángulo de visión y que, además, destaca por su increíble tasa de refresco de 144Hz y su tiempo de respuesta de tan solo 1ms. Asimismo, incorpora tecnología de cuidado ocular Flicker Free y compatibilidad G-Sync para garantizar largas sesiones de gaming sin molestias, cortes o desgarros. ¡Y lo mejor es que puedes conseguir el Ozone DSP27 en Neobyte a un precio sorprendente!', 'Ozone', 0),
