(1194, 'Logitech Mouse Pad Studio Rosa - Alfombrilla', 'https://www.neobyte.es/74784-large_default/logitech-mouse-pad-studio-rosa-alfombrilla.jpg', 9.9, 'ALFOMBRILLA LOGITECH MOUSE PAD STUDIO ROSA', 'Logitech', 0),
(1195, 'Razer Goliathus Chroma Extended - Alfombrilla gaming', 'https://www.neobyte.es/25106-large_default/alfombrilla-razer-goliathus-chroma-extended.jpg', 85.9, 'Compite como los mejores con la alfombrilla Razer Goliathus Chroma Extended. Esta alfombrilla de grandes dimensiones incorpora iluminación Razer Chroma, de manera que podrás personalizar los colores de tu victoria. Por otro lado, su superficie texturizada encuentra el equilibrio entre velocidad y precisión para que tu ratón siempre ofrezca una respuesta óptima a la hora de jugar. Compra ahora la alfombrilla Razer Goliathus Chroma Extended y completa tu setup gaming.', 'Razer', 0),
