(1198, 'Corsair MM250 Champions Series - Alfombrilla gaming', 'https://www.neobyte.es/85732-large_default/alfombrilla-corsair-mm250-champions-series.jpg', 19.89, 'La alfombrilla Corsair MM250 Champions Series marca la diferencia. Este mousepad de gran tamaño mejorará tu forma de jugar, haciéndola más cómoda y añadiendo precisión a tus movimientos. Ha sido fabricada con materiales de gran calidad para potenciar la durabilidad y la resistencia, lo que te permitirá tener alfombrilla para rato. Hazte ya con la Corsair MM250 Champions Series y experimenta el éxito de los campeones.', 'Corsair', 0),
