(1216, 'Asus RT-AX82U - Router WiFi AX5400 Dual Band RGB', 'https://www.neobyte.es/38166-large_default/router-asus-rt-ax82u-wifi-6-ax5400.jpg', 199, 'Juega sin límites con el Asus RT-AX82U, un router gaming de alucinante diseño y prestaciones increíbles que te permitirá marcar la diferencia. Provisto de la tecnología WiFi 6 802.11ax de doble banda y capaz de alcanzar velocidades de hasta 5400Mbps, este modelo proporciona una conexión inalámbrica más segura, rápida y eficiente, reduciendo así mismo la latencia y el consumo energético. Además, el Asus RT-AX82U cuenta con un modo dedicado para juegos de móvil para una experiencia más fluida y rápida desde este tipo de dispositivos. Así mismo, con la iluminación RGB integrada podrás completar tu setup gaming y crear una atmósfera de juego única.', 'Asus', 0),
