(1246, 'Drift DR50 Negro - Silla gaming', 'https://www.neobyte.es/48703-large_default/silla-gaming-drift-dr50-negro.jpg', 127.9, 'La silla gaming Drift DR50 Negra cuenta con una estructura robusta recubierta de FOAM y polipiel que proporciona gran comodidad durante largas sesiones de juego. Gracias a sus reposabrazos fijos y acolchados obtendrás un apoyo ergonómico, firme y amplio para conseguir la mejor postura. Dispone de asiento basculante, altura regulable y de pistón de clase 4, además de base en forma de estrella y ruedas que aportan estabilidad y un deslizamiento suave. No lo dudes, el complemento perfecto para tu setup gaming es la Drift DR50 Negra.', 'Drift', 0),
