(1260, 'Asus Charger Dock - Centro de carga para Asus ROG Ally (HDMI)', 'https://www.neobyte.es/94124-large_default/asus-charger-dock-centro-de-carga-para-asus-rog-ally-hdmi.jpg', 63.89, 'Complementa tu videoconsola Asus ROG Ally con el centro de carga todo en uno ROG Gaming Charger Dock. Combina carga, transferencia de datos y salida de pantalla en un único dispositivo. Conecta tu consola ROG Ally al televisor o a tu monitor externo a través de HDMI, teclado y ratón a los conectores USB y ¡voilá! ya tienes un PC Gaming en miniatura.', 'Asus', 0),
(1261, 'Asus ROG Ally (Z1 Extreme) - Videoconsola portátil', 'https://www.neobyte.es/103402-large_default/asus-rog-ally-z1-extreme-videoconsola-portatil.jpg', 649, '¡Que no te aburran los viajes largos o las largas esperas! Ahora puedes aprovechar el tiempo jugando como si estuvieras delante del PC gracias a la videoconsola ASUS ROG ALLY, equipada con procesador AMD Ryzen Z1 Extreme, 16GB de RAM y gráficos AMD con arquitectura RDNA 3. Con su sistema operativo Windows 11, no tendrás limitación alguna para ejecutar juegos o programas estés donde estés.', 'Asus', 0),
(1262, 'Zelda: Tears Of Kingdom - Juego Nintendo Switch', 'https://www.neobyte.es/90943-large_default/zelda-tears-of-kingdom-juego-nintendo-switch.jpg', 60.9, 'Te aguarda un épico viaje en el que recorrerás las tierras y los vastos cielos de Hyrule en The Legend of Zelda: Tears of the Kingdom para Nintendo Switch. . Crea tu propia aventura en este mundo donde el límite es tu imaginación. En la secuela de The Legend of Zelda: Breath of the Wild, tú decidirás qué camino seguir a lo largo de los inmensos paisajes de Hyrule y las misteriosas islas que flotan allá arriba en el cielo. ¿Lograrás dominar el poder de las nuevas habilidades de Link y luchar contra las fuerzas malévolas que amenazan al reino?', 'Nintendo', 0),
(1263, 'Microsoft Xbox Series S 512GB + 3 meses Xbox Game Pass Ultimate - Consola', 'https://www.neobyte.es/105806-large_default/microsoft-xbox-series-s-512gb-3-meses-xbox-game-pass-ultimate-consola.jpg', 300.9, 'Microsoft Xbox Series S 512GB + 3 meses Xbox Game Pass Ultimate - Consola', 'Microsoft', 0),
(1264, 'Asus ROG Ally Travel Case - Estuche de viaje para ROG Ally', 'https://www.neobyte.es/94112-large_default/asus-rog-ally-travel-case-estuche-de-viaje-para-rog-ally.jpg', 38.89, 'FUNDA ASUS ROG ALLY TRAVEL CASE', 'Asus', 0),
(1265, 'Microsoft Xbox Series X Wireless Carbon Black - Mando inalámbrico', 'https://www.neobyte.es/105818-large_default/microsoft-xbox-series-x-wireless-carbon-black-mando-inalambrico.jpg', 52.9, 'Este mando no solo es compatible con la Xbox Series X, sino que también funciona con PC y dispositivos móviles, ampliando tus opciones de juego y entretenimiento. Su versatilidad y rendimiento lo convierten en una adición imprescindible para cualquier jugador que busque un controlador inalámbrico de alta calidad y estilo llamativo.', 'Microsoft', 0),
