(1270, 'MANDO NACON OFICIAL COMPACT PS4 - AZUL TRANSPARENTE', 'https://www.neobyte.es/72606-large_default/mando-nacon-oficial-compact-ps4-azul-transparente.jpg', 37.9, 'MANDO NACON OFICIAL COMPACT PS4 - AZUL CLEAR', 'Nacon', 0),
(1271, 'Nintendo Switch Azul Neon / Rojo Neon - Consola', 'https://www.neobyte.es/85656-large_default/nintendo-switch-azul-neon-rojo-neon-consola.jpg', 304.9, 'Nintendo Switch Neon es la consola de entrenamiento doméstico y portátil que te permitirá disfrutar de horas de diversión. Dispone de 3 modos de juego (modo televisor, modo sobremesa y modo portátil) de manera que podrás adaptar la forma de jugar a cada momento: en casa, con los amigos o de viaje. Cuenta con dos mandos, los Joy-Con, que podrás acoplar al soporte para que funcionen como un mando convencional, aunque podrán utilizarse también como mandos individuales plenamente funcionales. Con la Nintendo Switch Neon, además, podrás conectar hasta 8 consolas para partidas multijugador. ¡Nunca dejes de jugar!', 'Nintendo', 0),
(1272, 'MANDO NACON OFICIAL COMPACT PS4 - ROJO', 'https://www.neobyte.es/72577-large_default/mando-nacon-oficial-compact-ps4-rojo.jpg', 37.9, 'MANDO NACON OFICIAL COMPACT PS4 - ROJO', 'Nacon', 0),
