(1274, 'Nintendo Switch Lite Amarillo - Consola portátil', 'https://www.neobyte.es/40551-large_default/videoconsola-nintendo-switch-lite-amarillo.jpg', 232.9, 'Diseñada para los que no paran quietos, la Nintendo Switch Lite Amarillo es una consola portátil que te permitirá llevar la diversión siempre contigo. Se trata de un modelo compacto y ligero, fácil de transportar y almacenar, provista de controles integrados. Pásatelo en grande con los juegos compatibles con el modo portátil y conecta hasta 8 consolas en las partidas multijugador. Nintendo Switch Lite Amarillo es sinónimo de entretenimiento sin límites.', 'Nintendo', 0),
