(1283, 'Thrustmaster T80 Ferrari 488 GTB - Volante + pedales PS4 / PS5 / PC', 'https://www.neobyte.es/13094-large_default/thrustmaster-t80-ferrari-488-gtb-volante-pedales-ps4-ps5-pc.jpg', 118.89, 'Vive tus juegos de conducción de forma más realista con el conjunto de volante + pedales Thrustmaster T80 Ferrari 488 GTB Edition, un modelo de acabado exclusivo que encantará a los amantes del motor y de los simuladores de carreras. El volante es compatible con PC, PS4 / PS5 y dispone de los botones PlayStation para una navegación más sencilla por los menús. Además, su diseño ergonómico garantiza una sujeción y manejo de gran confort. Llévatelo en Neobyte a un precio sensacional y recíbelo en tiempo récord.', 'Thrustmaster', 0),
