(1285, 'Thrustmaster Ferrari F1 - Volante Add-On', 'https://www.neobyte.es/14016-large_default/volante-thrustmaster-ferrari-f1.jpg', 172.9, 'No te lo pienses más y hazte ya con este Add-On para usar con T500 RS, T300RS, T300 Ferrari GTE, TX Racing Wheel Ferrari 458 Italia Edition. El volante Thrustmaster Ferrari F1 es una réplica a tamaño completo del volante de carreras Ferrari 2011 que incorpora frontal reforzado de metal cepillado para una mayor solidez e inercia, ruedas giratorias, interruptores y botones de acción. Además, cuenta con cambio de marchas “Push & Pull” y sistema “Thrustmaster Quick Release” para desmontar rápidamente el volante.', 'Thrustmaster', 0),
