(1289, 'Thrustmaster T.Flight Hotas X - Joystick PC/PS3', 'https://www.neobyte.es/13863-large_default/joystick-thrustmaster-t-flight-hotas-x-pc-ps3.jpg', 73.89, 'Lleva tus simuladores de vuelo al siguiente nivel con el joystick Thrustmaster T.Flight Hotas X para PC y PS3, con el que podrás controlar tu avión de la forma más realista posible. Este modelo incorpora memoria interna y múltiples configuraciones precargadas para que baste con conectar y empezar a jugar. Su robusta construcción incluye componentes de gran calidad que aseguran un comportamiento totalmente fiel y la máxima durabilidad.', 'Thrustmaster', 0),
