(1318, 'Logitech MS Zone Wireless Negro - Auriculares', 'https://www.neobyte.es/57223-large_default/logitech-ms-zone-wireless-negro-auriculares.jpg', 189.9, 'Trabaja de forma eficiente con los Logitech MS Zone Wireless Negro, los auriculares con supresión activa de ruido que te aportarán la tranquilidad que necesitas para mantener la concentración. Todas sus funcionalidades están enfocadas a brindar comodidad y eficiencia, con controles sencillos de ajuste de volumen, receptor Unifying para conexiones fiables y micrófono integrado para la realización de videollamadas. Además, su diadema acolchada de silicona y sus almohadillas transpirables harán que puedas llevarlos puestos durante tus largas jornadas laborales de forma confortable. Los Logitech MS Zone Wireless Negro son los auriculares que necesitas para tu estudio u oficina.', 'Logitech', 0),
(1319, 'Trust 21665 Primo Chat - Auriculares', 'https://www.neobyte.es/58177-large_default/trust-21665-primo-chat-auriculares.jpg', 9.9, 'Los Trust 21665 Primo Chat son unos auriculares sencillos y funcionales, perfectos para disfrutar de tus ratos libres escuchando música o realizar videollamadas de forma efectiva. Estos dispositivos disponen de sonido estéreo y cuentan con una diadema ajustable acolchada que te permitirá llevarlos durante horas cómodamente y hablar a través de su micrófono flexible durante largos ratos. ¡Conecta los Trust 21665 Primo Chat a tu PC o portátil y empieza a disfrutar de sus ventajas!', 'Trust', 0),
