(1324, 'PC NEO Gaming i5-13400F RTX 4060 SSD 1TB 16GB', 'https://www.neobyte.es/110039-large_default/pc-neo-gaming-i5-13400f-rtx-4060-ssd-1tb-16gb.jpg', 959, 'No tengas dudas, los PC NEO son garantía de durabilidad y rendimiento. Ordenadores diseñados y ensamblados por profesionales con más de 15 años de experiencia que conocen a la perfección las necesidades de los usuarios y que han sabido encontrar el equilibrio entre sus componentes para ofrecer la mejor respuesta. Es el caso de este PC NEO Gaming, equipado con procesador Intel Core i5 de 13ª generación y gráfica Nvidia RTX 4060, una combinación letal sinónimo de potencia. Además, ha sido provisto de un sistema de almacenamiento muy completo, con un SSD de 1TB. ¡Apuesta fuerte y destaca entre tus adversarios!', 'Neobyte', 0),
