(1326, 'PC NEO Gaming Ryzen 7 5700X RTX 4060 1TB SSD 16GB', 'https://www.neobyte.es/106506-large_default/pc-neo-gaming-ryzen-7-5700x-rtx-4060-1tb-ssd-16gb.jpg', 998.99, 'Equipado con componentes de primeras marcas y diseñado por técnicos experimentados, este PC NEO Gaming te permitirá disfrutar de un funcionamiento estable y fluido. Un ordenador gaming en el que se ha buscado el equilibrio entre una configuración de garantías y un precio ajustado, siempre pensando en ofrecer un rendimiento óptimo a la hora de jugar y trabajar. Para ello se ha incluido un procesador Amd Ryzen 7 5700X, 16GB de memoria y una potente gráfica Nvidia RTX 4060, además de un SSD de 1TB. ¡Codéate con los mejores!', 'Neobyte', 0),
(1327, 'PC NEO Gaming i5-13400F RTX 4070 SUPER SSD 1TB+2TB 32GB', 'https://www.neobyte.es/108836-large_default/pc-neo-gaming-i5-13400f-rtx-4070-super-ssd-1tb2tb-32gb.jpg', 1699, 'Este PC NEO Gaming nace fruto de la experiencia de nuestros técnicos en combinación con los componentes más actuales. Una máquina capaz de ejecutar un amplio abanico de juegos con un nivel gráfico sensacional y de llevar a cabo todo tipo de tareas con la máxima fluidez. Para ello, hemos incorporado un procesador potente y de garantías como es el Intel Core i5-13400F, acompañado de 32GB de memoria RAM, SSD de 1TB y SSD de 2TB. Además, incluye tarjeta gráfica Nvidia GeForce RTX 4070 SUPER para un rendimiento gráfico espectacular. ¿Necesitas personalizarlo? Coméntanos qué cambios deseas realizar y te enviaremos un presupuesto a medida sin compromiso.', 'Neobyte', 0),
