(1329, 'PC NEO Gaming i7-13700K RTX 4070 SUPER SSD 1TB 16GB', 'https://www.neobyte.es/106327-large_default/pc-neo-gaming-i7-13700k-rtx-4070-super-ssd-1tb-16gb.jpg', 1699, 'Si te vuelve loc@ el RGB pero además quieres un PC gamer de garantías, nuestra configuración NEO Gaming es justo lo que buscas. A un diseño irresistiblemente llamativo que incluye multitud de componentes (incluyendo la caja) con iluminación RGB, hay que sumar la incorporación de un potente procesador como es el Intel Core i7-13700K, 16 GB de memoria RAM y tarjeta gráfica RTX 4070 SUPER de 12GB. Además, en cuanto a almacenamiento se refiere, este equipo está provisto de 1Tb SSD. Rendimiento sin contemplaciones y un estética que te dejará sin palabras... todo esto y mucho más cabe en este Neo Gaming.', 'Neobyte', 0),
(1330, 'PC NEO Gaming i7-14700KF RTX 4080 Super 32GB 2TB SSD + 1TB SSD', 'https://www.neobyte.es/110195-large_default/pc-neo-gaming-i7-14700kf-rtx-4080-super-32gb-2tb-ssd-1tb-ssd.jpg', 2499, '¿Ganas de jugar? En Neobyte hemos configurado este PC Gaming para que disfrutes al máximo de tu gran pasión. Un equipo provisto de un procesador potente, el Intel Core i7-14700KF, al que acompañan 32GB de RAM y una gráfica nada desdeñable: Nvidia RTX 4080 Super de 16GB. El sistema de almacenamiento también está a la altura, incorporando un SSD de 2TB y otro SSD de 1 TB para un funcionamiento más rápido y fluido en todo tipo de tareas. Prepárate, vas a pasarlo en grande...', 'Neobyte', 0),
