(1351, 'PC NEO Gaming i5-12400F RTX 4060 SSD 1TB 16GB', 'https://www.neobyte.es/110186-large_default/pc-neo-gaming-i5-12400f-rtx-4060-ssd-1tb-16gb.jpg', 849, 'Te presentamos otra configuración con el sello de identidad de Neobyte: primeras marcas, componentes equilibrados y el precio más ajustado. En esta ocasión, hemos confeccionado un PC que incluye la innovadora gráfica Nvidia RTX 4060, un elemento con el que disfrutar de juegos de forma rápida y fluida. Incluye, por supuesto, un procesador de garantías, el Intel Core i5-12400F, con 16GB de RAM y SSD de 1TB, una apuesta clara por la potencia y la fiabilidad. A todo ello añadimos una caja espectacular con impresionantes efectos de iluminación y ya tenemos un PC Gaming de primer nivel.', 'Neobyte', 0),
(1352, 'PC NEO Gaming Ryzen 5 5500 RTX 4060 SSD 1TB 16GB', 'https://www.neobyte.es/106678-large_default/pc-neo-gaming-ryzen-5-5500-rtx-4060-ssd-1tb-16gb.jpg', 849, 'Jugar con todas las garantías, de forma fluida y rápida es la propuesta de este PC NEO Gaming. Un ordenador equipado con procesador AMD Ryzen 5, 16GB de memoria y una potente gráfica RTX 4060 que te permitirá disfrutar de una increíble experiencia gaming, apostando por la fiabilidad de unos componentes ampliamente contrastados y fiables. En cuanto al resto del hardware, este equipo cuenta con un SSD de 1TB, que aporta espacio y velocidad al funcionamiento general del PC, fuente de alimentación de 750W y una caja robusta. Confía en los 15 años de experiencia de Neobyte y hazte ahora con este impresionante ordenador.', 'Neobyte', 0),
(1353, 'PC NEO Gaming Intel i7 14700K RTX 4070Ti SUPER 1TB SSD 32GB', 'https://www.neobyte.es/106780-large_default/pc-neo-gaming-intel-i7-14700k-rtx-4070ti-super-1tb-ssd-32gb.jpg', 2048.99, '', 'Neobyte', 0),
(1354, 'Krom Krusher RGB - Kit Teclado + Ratón Gaming', 'https://www.neobyte.es/46745-large_default/krom-krusher-rgb-kit-teclado-raton-gaming.jpg', 24.89, 'Krom Krusher RGB - Kit Teclado + Ratón Gaming', 'Krom', 0),
(1355, 'Krom Kalyos - Kit teclado + ratón gaming', 'https://www.neobyte.es/40804-large_default/teclado-krom-kalyos-gaming-raton.jpg', 28.89, 'Krom Kalyos es un pack de teclado + ratón gaming con el que mejorarás tu experiencia de juego. Un combo letal formado por un teclado de membrana y un ratón con sensor óptico gracias a los cuales obtendrás la precisión que necesitas para derrotar a tus rivales. Por un lado, el teclado multifuncional con retroiluminación RGB presenta 19 teclas anti-ghosting, modo juego para bloquear la tecla Windows, intercambio de teclas WASD con las teclas de dirección y teclas multimedia dedicadas. Por otro, un ratón con 6 niveles DPI y diseño ergonómico que se ajustará perfectamente a tu mano. Juntos marcarán la diferencia. Hazte con el Kit Krom Kalyos en Neobyte.', 'Krom', 0),
(1356, 'Krom Kernel - Teclado gaming mecánico RGB', 'https://www.neobyte.es/13474-large_default/teclado-mecanico-krom-kernel-tkl-rgb-numerico.jpg', 38.9, 'El teclado gaming Krom Kernel satisface con creces las necesidades de todo gamer, pues cuenta con una extraordinaria relación calidad-precio y unas especificaciones técnicas más que interesantes. Muestra de ello es que incorpora switches mecánicos Outemu RED, función anti-ghosting y la posibilidad de crear macros al vuelo, cualidades que garantizan la máxima precisión en cada movimiento. Además, el Krom Kernel está provisto de retroiluminación LED con 9 efectos, algo que encantará a los apasionados del RGB.', 'Krom', 0),
(1357, 'Newskill Pyros Speed Pro Ivory Kailh Copper - Teclado mecánico gaming inalámbrico', 'https://www.neobyte.es/84296-large_default/newskill-pyros-speed-pro-ivory-kailh-copper-teclado-mecanico-gaming-inalambrico.jpg', 67.89, 'Newskill Pyros Ivory Speed Pro Kailh Speed Copper - Teclado mecánico gaming inalámbrico', 'Newskill', 0),
