(1362, 'Newskill Serike v2 TKL Blanco - Teclado gaming mecánico', 'https://www.neobyte.es/103390-large_default/newskill-serike-v2-tkl-blanco-teclado-gaming-mecanico.jpg', 84.95, 'El Newskill Serike v2 TKL también ofrece características de gaming avanzadas, como la función anti-ghosting y la capacidad de desactivar la tecla Windows para evitar interrupciones accidentales durante el juego. Estas características están diseñadas para mejorar tu experiencia de juego y proporcionar un control preciso en momentos críticos. La construcción robusta y duradera garantiza una vida útil prolongada, incluso en condiciones de uso intensivo. Además, su diseño ergonómico proporciona comodidad durante largas sesiones de juego, lo que significa que puedes concentrarte en el juego sin preocuparte por la fatiga.', 'Newskill', 0),
(1363, 'Ozone Battle Royale - Teclado Gaming', 'https://www.neobyte.es/65243-large_default/ozone-battle-royale-teclado-gaming.jpg', 69.89, 'Ozone Battle Royale - Teclado Gaming', 'Ozone', 0),
