(1366, 'Logitech MK295 negro - Combo teclado + ratón inalámbricos', 'https://www.neobyte.es/40381-large_default/teclado-logitech-mk295-wireless-combo-negro.jpg', 36.91, 'El combo de teclado + ratón inalámbricos Logitech MK295 negro destaca por la tecnología exclusiva SilentTouch, que elimina más del 90% del ruido producido manteniendo la misma sensación de clic y escritura. Esta característica lo convierte en una opción perfecta para entornos de trabajo o en los que requieras una gran concentración. Además, el Logitech MK295 negro dispone de teclas multimedia en la parte superior, conexión inalámbrica de alta precisión y una larga autonomía.', 'Logitech', 0),
(1367, 'Logitech MK270 Wireless Combo', 'https://www.neobyte.es/9708-large_default/teclado-logitech-mk270-wireless-combo.jpg', 30.9, 'Logitech MK270 es un combo de teclado + ratón inalámbrico que presume de precio y funcionalidad. Tan sencillo como práctico, libera tu escritorio de engorrosos cables y cuenta con una autonomía extraordinaria. Así mismo, en la parte superior incorpora teclas multimedia que simplifican la reproducción de música y vídeo.', 'Logitech', 0),
(1368, 'Logitech MK120 - Combo teclado + ratón USB', 'https://www.neobyte.es/33234-large_default/teclado-logitech-mk120-usb-combo.jpg', 22.91, 'Logitech MK270 es un combo de teclado + ratón inalámbrico que presume de precio y funcionalidad. Tan sencillo como práctico, libera tu escritorio de engorrosos cables y cuenta con una autonomía extraordinaria. Así mismo, en la parte superior incorpora teclas multimedia que simplifican la reproducción de música y vídeo.', 'Logitech', 0),
