(1370, 'Teclado Logitech MK220 Wireless Combo', 'https://www.neobyte.es/9347-large_default/teclado-logitech-mk220-wireless-combo.jpg', 23.9, 'Combo: teclado + ratón inalámbrico / Tamaño compacto / Larga duración de pilas / Cifrado AES de 128 bits / Teclas silenciosas', 'Logitech', 0),
(1371, 'Logitech MK710 Wireless Combo Teclado + Ratón', 'https://www.neobyte.es/9700-large_default/teclado-logitech-mk710-wireless-combo.jpg', 88.9, 'El teclado Logitech MK710 cuenta con un reposamanos blando para que tus manos se relajen. Su sistema de bajo consumo y ahorro de energía permite que las pilas duren hasta 3 años. Su nano receptor USB con tecnología Unifying permite que en caso de pérdida del receptor puedas usar cualquier otro con la misma tecnología.', 'Logitech', 0),
(1372, 'Logitech MK470 - Combo teclado + ratón inalámbrico', 'https://www.neobyte.es/40309-large_default/teclado-logitech-mk470-wireless-combo.jpg', 46.9, 'Crea tu propio espacio con Logitech MK470, un combo de teclado + ratón inalámbricos que cuenta con un diseño minimalista, compacto y delgado que destaca por su versatilidad de uso. Este modelo proporciona tanto una escritura como un manejo del ratón confortables y sumamente silenciosos. Además, la tecnología inalámbrica de 2,4Ghz brinda una conexión estable, fluida y sin retardos. Sencillo, fiable y moderno, el Logitech MK470 es para ti.', 'Logitech', 0),
