(1376, 'Asus ROG Strix Flare II - Teclado gaming mecánico', 'https://www.neobyte.es/69909-large_default/asus-rog-strix-flare-ii-teclado-gaming-mecanico.jpg', 143.91, 'La tecnología anti-ghosting con N-key rollover asegura que cada pulsación de tecla se registre de manera precisa y simultánea, evitando conflictos de comandos y garantizando una respuesta precisa en situaciones intensas de juego.', 'Asus', 0),
(1377, 'Logitech MK235 Wireless combo', 'https://www.neobyte.es/9306-large_default/teclado-logitech-mk235-wireless-combo.jpg', 29.9, 'No te compliques, si necesitas un teclado y ratón inalámbricos de precio ajustado, el combo Logitech MK235 es tu mejor opción. Un modelo que demuestra que simplicidad, calidad y fiabilidad pueden ir de la mano. Puede usarse a una distancia de hasta 10 metros y regularse en altura para un uso más confortable.', 'Logitech', 0),
(1378, 'Logitech K400 Plus TV Wireless', 'https://www.neobyte.es/9153-large_default/teclado-logitech-k400-plus-tv-wireless-negro.jpg', 36.91, 'Tenlo todo en uno con el teclado Logitech K400 Plus, un modelo de tamaño compacto que, en la parte derecha, integra un práctico touchpad como el de los portátiles para que puedas teclear y mover el cursor desde un único dispositivo. Además, incopora teclas multimedia y es compatible con un amplio abanico de equipos Windows, Android, Chrome OS... Todo ello con la ventaja de contar con conectividad inalámbrica. ¡Di adiós a los cables!', 'Logitech', 0),
(1379, 'Logitech MK295 blanco - Combo teclado + ratón inalámbricos', 'https://www.neobyte.es/40376-large_default/teclado-logitech-mk295-wireless-combo-blanco.jpg', 39.91, 'El combo de teclado + ratón inalámbricos Logitech MK295 blanco destaca por la tecnología exclusiva SilentTouch, que elimina más del 90% del ruido producido manteniendo la misma sensación de clic y escritura. Esta característica lo convierte en una opción perfecta para entornos de trabajo o en los que requieras una gran concentración. Además, el Logitech MK295 blanco dispone de teclas multimedia en la parte superior, conexión inalámbrica de alta precisión y una larga autonomía.', 'Logitech', 0),
(1380, 'Teclado Cherry KC 1000 + lector DNIe negro', 'https://www.neobyte.es/6216-large_default/teclado-cherry-kc-1000-negro-lector-dnie.jpg', 31.9, 'Robusto, seguro y versátil, el teclado Cherry KC 1000 con lector DNIe integrado es una solución especialmente concebida para organismos públicos, empresas y particulares que trabajan con información sensible. Además, es muy agradable al tacto y cómodo de utilizar, características apropiadas para el personal de oficina que pasa largas horas frente al ordenador.', 'Cherry', 0),
(1381, 'Logitech MK540 Advanced - Combo teclado + ratón inalámbrico', 'https://www.neobyte.es/20434-large_default/teclado-logitech-mk540-wireless-combo.jpg', 56.89, 'Logitech MK540 Advanced es un combo de teclado + ratón inalámbrico que sorprende desde el primer momento por su extraordinaria comodidad de uso. Preciso y fiable, el teclado proporciona una escritura natural y silenciosa, contando además con teclas multimedia y permitiendo la inclinación en 3 niveles para que te resulte más sencillo encontrar la postura más confortable. Por otro lado, el ratón brinda una sujeción magnífica tanto para usuarios diestros como zurdos, así como una precisión sensacional. En último lugar, destacar la fantástica autonomía del Logitech MK540 Advanced. ¡Consíguelo ya en Neobyte!', 'Logitech', 0),
(1382, 'Razer Ornata v3 X - Teclado gaming', 'https://www.neobyte.es/81667-large_default/razer-ornata-v3-x-teclado-gaming.jpg', 57.9, 'Razer Ornata V3 X - Teclado gaming RGB', 'Razer', 0),
(1383, 'Logitech G213 Prodigy - Teclado gaming USB', 'https://www.neobyte.es/23904-large_default/teclado-logitech-g213-prodigy-gaming-usb-rgb.jpg', 82.9, 'El Logitech G213 Prodigy es sinónimo de rendimiento gaming. Este teclado incorpora teclas Logitech G Mech-Dome, que ofrecen una respuesta rápida ante las pulsaciones, e iluminación RGB Lightsync, con 5 zonas de iluminación. Por otro lado, es resistente a salpicaduras, cuenta con reposamanos y patas ajustables y dispone de controles multimedia para reproducir, poner en pausa y silencia música y vídeos al instante. El Logitech G213 Prodigy es, en definitiva, un teclado duradero y funcional con el que disfrutarás de una ventaja frente a tus adversarios.', 'Logitech', 0),
