(1386, 'Logitech Speaker System Z313', 'https://www.neobyte.es/35307-large_default/altavoces-logitech-z313-2-1.jpg', 45.9, 'Los altavoces Logitech Z313 ofrece una acústica equilibrada y proporciona graves mejorados con un compacto subwoofer. Su conexión Jack 3.5mm y el mando con control de volumen hace que sea cómodo de manejar. Su potencia de 50W hace que puedas disfrutar de tu audio con una experiencia completa.', 'Logitech', 0),
(1387, 'ALTAVOCES CREATIVE PEBBLE 2.0 V2 USB-C NEGRO', 'https://www.neobyte.es/43969-large_default/altavoces-creative-pebble-20-v2-usb-c-negro.jpg', 27.9, 'Altavoces Creative Pebble 2.0 V2 Usb-c Negro', 'Creative', 0),
(1388, 'Creative Pebble - Altavoces 2.0 USB', 'https://www.neobyte.es/21381-large_default/altavoces-creative-pebble-20-usb-blanco.jpg', 23.9, 'Los altavoces 2.0 Creative Pebble, con un diseño inspirado en los jardines japoneses, se integran a la perfección en tu espacio de estudio y trabajo tanto por sus reducidas dimensiones como por su sorprendente calidad de audio. Los Creative Pebble incorporan radiadores pasivos y altavoces elevados 45º para una proyección de audio optimizada, lo que se traduce en un sonido detallado y poderoso. Otra gran ventaja es que se alimentan a través de un único puerto USB y se conectan mediante jack de 3.5 mm a prácticamente cualquier dispositivo. Compactos, elegantes, prácticos y, en Neobyte, con envío inmediato y las máximas garantías.', 'Creative', 0),
