(1402, 'Logitech Z207 Negro - Altavoces Bluetooth', 'https://www.neobyte.es/38514-large_default/altavoces-logitech-z207-bluetooth-negros.jpg', 52.9, 'Con los altavoces Bluetooth para ordenador Logitech Z207 Negro obtendrás un sonido detallado y sin cables al precio más ajustado. Su tamaño compacto y diseño inalámbrico hacen que su integración en tu escritorio resulte discreta y realmente cómoda. Además, dispone de control de volumen y entrada de 3.5 mm para cona vinculación más versátil con tus dispositivos: PC de sobremesa, portátil, smartphone, tablet... Además, los Logitech Z207 Negro arrojan un audio de calidad y potencia gracias a sus 5W RMS y radiador pasivo para graves mejorados.', 'Logitech', 0),
