(1405, 'Logitech G560 Lightsync RGB Bluetooth - Altavoces', 'https://www.neobyte.es/74441-large_default/logitech-g560-lightsync-rgb-bluetooth-altavoces.jpg', 242.9, 'ALTAVOCES LOGITECH G560 LIGHTSYNC', 'Logitech', 0),
(1406, 'Creative Pebble - Altavoces 2.0 USB', 'https://www.neobyte.es/21374-large_default/altavoces-creative-pebble-20-usb-negro.jpg', 23.9, 'Con un diseño inspirado en los jardines zen, los altavoces Creative Pebble son perfectos para su integración en espacios de estudio y trabajo tanto por su tamaño compacto como por su sorprendente calidad de sonido. Su robusta construcción incluye radiadores pasivos y altavoces elevados 45º para una proyección de audio mejorada. Otra gran ventaja de los Creative Pebble es que se alimentan a través de un único puerto USB y se conectan mediante jack de 3.5 mm a prácticamente cualquier dispositivo. Consíguelos ya en Neobyte al mejor precio y con envío inmediato.', 'Creative', 0),
