(1417, 'Jabra Speak 710 - Altavoz portátil Bluetooth', 'https://www.neobyte.es/75992-large_default/jabra-speak-710-altavoz-portatil-bluetooth.jpg', 227.9, 'Jabra Speak 710 MS - Altavoz portátil Bluetooth', 'Jabra', 0),
(1418, 'Asus ROG Keris - Ratón gaming', 'https://www.neobyte.es/43235-large_default/raton-asus-rog-keris.jpg', 52.9, 'El Asus ROG Keris es un ratón gaming sin igual, tanto en términos de precio como de rendimiento. Este excelente dispositivo está diseñado para que saques el máximo provecho a tus juegos FPS, con un sensor óptico de 16000 dpi y la posibilidad de realizar diversos ajustes de sensibilidad o configurar los siete botones laterales para adaptarlo totalmente a cualquier estilo de juego. Aunque su estética es sencilla, su diseño ergonómico se adaptará a tu mano para que consigas una sujeción perfecta y sientas la precisión en cada acción que realices. ¡Hazte con el Asus ROG Keris en Neobyte!', 'Asus', 0),
(1419, 'Asus ROG Strix Impact II - Ratón gaming', 'https://www.neobyte.es/27701-large_default/raton-asus-gaming-strix-impact-ii.jpg', 37.9, 'Máxima precisión y comodidad para derrotar a tus contrincantes. El Asus ROG Strix Impact II es un ratón gaming ambidiestro que te permitirá tomar el control absoluto de la partida. Un modelo provisto de botones pivotantes para una respuesta más rápida y sensor de 6200 ppp, con sensibilidad ajustable al vuelo. El cable de goma suave, por otro lado, ofrece menos resistencia y minimiza los tropiezos al usarlo mientras que la iluminación Aura Sync RGB le da un toque de estilo más personal. El Asus ROG Strix Impact II es el arma definitiva para marcar diferencias.', 'Asus', 0),
(1420, 'Corsair Ironclaw Wireless RGB - Ratón gaming inalámbrico 18000dpi', 'https://www.neobyte.es/34963-large_default/raton-corsair-ironclaw-wireless-rgb-18000dpi.jpg', 89.89, 'La victoria está en tus manos con el ratón gaming Corsair Ironclaw Wireless RGB, un modelo que ofrece un agarre de palma increíblemente cómodo y cuenta con unas prestaciones perfectas para FPS y MOBA. Entre ellas, destacar el sensor óptico de hasta 18000dpi, los 10 botones programables y la memoria interna, muy útil para llevar tu perfil de juego siempre contigo y así mostrar tus habilidades. Por otro lado, el Corsair Ironclaw Wireless RGB marca la diferencia por su versatilidad, y es que puede conectarse tanto por cable USB como de manera inalámbrica. En este sentido, indicar que ofrece 2 alternativas de conexión: Bluetooth y Slipstream de 2.4Ghz para una precisión incluso mayor.', 'Corsair', 0),
(1421, 'Newskill Arakne Elite Ivory 16000 dpi - Ratón gaming inalámbrico', 'https://www.neobyte.es/82677-large_default/newskill-arakne-elite-ivory-16000-dpi-raton-gaming-inalambrico.jpg', 48.9, 'Newskill Arakne Elite Ivory 16000 dpi - Ratón gaming inalámbrico', 'Newskill', 0),
(1422, 'Ozone Gaming Neon 3K - Ratón Gaming', 'https://www.neobyte.es/65168-large_default/ozone-gaming-neon-3k-raton-gaming.jpg', 26.9, 'Ozone Gaming Neon 3K - Ratón Gaming', 'Ozone', 0),
(1423, 'Krom Krusher RGB - Kit Teclado + Ratón Gaming', 'https://www.neobyte.es/46745-large_default/krom-krusher-rgb-kit-teclado-raton-gaming.jpg', 24.89, 'Krom Krusher RGB - Kit Teclado + Ratón Gaming', 'Krom', 0),
(1424, 'Mars Gaming MMEX Negro - Ratón Gaming', 'https://www.neobyte.es/61924-large_default/mars-gaming-mmex-negro-raton-gaming.jpg', 24.89, 'Mars Gaming MMEX Negro - Ratón Gaming', 'Mars Gaming', 0),
(1425, 'Newskill Lycan transparente 16000 dpi - Ratón gaming', 'https://www.neobyte.es/82713-large_default/newskill-lycan-transparente-16000-dpi-raton-gaming.jpg', 39.89, 'Newskill Lycan transparente 16000 dpi - Ratón gaming', 'Newskill', 0),
(1426, 'Newskill Helios 10000 dpi - Ratón gaming', 'https://www.neobyte.es/82709-large_default/newskill-helios-10000-dpi-raton-gaming.jpg', 39.95, 'Newskill Helios 10000 dpi - Ratón gaming', 'Newskill', 0),
(1427, 'Krom Keos Gaming RGB - Ratón gaming', 'https://www.neobyte.es/36352-large_default/raton-krom-keos-gaming-rgb.jpg', 13.9, 'Diseño y funcionalidad se integran a la perfección en el Krom Keos Gaming RGB. Este ratón gaming de diseño ergonómico garantiza libertad total de movimientos, así como una respuesta rápida para destacar entre tus rivales. Su tamaño compacto hace que se ajuste perfetamente a la mano y puedas agarrarlo con seguridad, disfrutando de gran comodidad después largas horas de uso. Cuenta con sensor óptico de hasta 6400 DPI con 6 niveles seleccionables en función del juego y tu estilo e iluminación RGB. El Krom Keos Gaming RGB se convertirá en tu mejor arma.', 'Krom', 0),
(1428, 'Newskill Arakne Elite 16000 dpi - Ratón gaming inalámbrico', 'https://www.neobyte.es/82673-large_default/newskill-arakne-elite-16000-dpi-raton-gaming-inalambrico.jpg', 59.96, 'Newskill Arakne Elite 16000 dpi - Ratón gaming', 'Newskill', 0),
(1429, 'Corsair M65 RGB Ultra Blanco - Ratón gaming wireless', 'https://www.neobyte.es/84362-large_default/corsair-m65-rgb-ultra-blanco-raton-gaming-wireless.jpg', 117.9, 'La retroiluminación RGB personalizable en el M65 RGB Ultra ofrece una experiencia visual impresionante. Los usuarios pueden elegir entre una amplia gama de colores y efectos de iluminación para crear una apariencia única que se adapte a su estilo y preferencias.', 'Corsair', 0),
(1430, 'Corsair M55 RGB PRO - Ratón gaming ambidiestro 12.400 dpi', 'https://www.neobyte.es/22613-large_default/raton-corsair-m55-rgb-pro-ambidiestro.jpg', 39.91, 'El diseño simétrico y la versatilidad del Corsair M55 RGB PRO lo convierten en una opción ganadora para aquellos gamers que busquen un ratón gaming ambidiestro de precio ajustado, construcción duradera y máxima precisión. Y es que este modelo integra un sensor óptico de garantías como es el PMW3327, que alcanza hasta 12.400 dpi, así como switches Omron de primera calidad y 8 botones programables. El Corsair M55 RGB PRO es perfecto para juegos tipo FPS y MOBA y para todo tipo de agarres, contando además, con iluminación RGB configurable mediante iCUE.', 'Corsair', 0),
(1431, 'Corsair Harpoon Pro negro - Ratón gaming', 'https://www.neobyte.es/23945-large_default/raton-corsair-harpoon-pro-gaming-negro.jpg', 27.9, 'Rápido y listo para la batalla. El ratón gaming Corsair Harpoon Pro negro proporciona un cómodo control gracias a sus laterales de goma y su peso ligero. Incorpora un sensor óptico de hasta 12.000 DPI e interruptores Omrom de alto rendimiento, que garantizan una gran durabilidad. Además, cuenta con 6 botones programables e iluminación RGB. El Corsair Harpoon Pro negro es el complemento perfecto para sobresalir entre tus rivales.', 'Corsair', 0),
(1432, 'Corsair Scimitar RGB Elite Negro - Ratón gaming 18000dpi', 'https://www.neobyte.es/28618-large_default/raton-corsair-scimitar-rgb-elite-negro.jpg', 89.89, 'Rápido y listo para la batalla. El ratón gaming Corsair Harpoon Pro negro proporciona un cómodo control gracias a sus laterales de goma y su peso ligero. Incorpora un sensor óptico de hasta 12.000 DPI e interruptores Omrom de alto rendimiento, que garantizan una gran durabilidad. Además, cuenta con 6 botones programables e iluminación RGB. El Corsair Harpoon Pro negro es el complemento perfecto para sobresalir entre tus rivales.', 'Corsair', 0),
(1433, 'Ratón Logitech B100 negro', 'https://www.neobyte.es/8814-large_default/raton-logitech-b100-oem-negro.jpg', 6.5, 'Este ratón viene con la calidad y el diseño que hemos construido en más de mil millones de ratones, más que cualquier otro fabricante.', 'Logitech', 0),
(1434, 'Logitech M185 Negro / Azul - Ratón inalámbrico', 'https://www.neobyte.es/84695-large_default/logitech-m185-negro-azul-raton-inalambrico.jpg', 13.9, 'Con el Logitech M185 Azul sentirás los auténticos beneficios de un ratón inalámbrico. Diseñado para ser transportado a cualquier parte, este periférico dispone del tamaño perfecto para encajar en cualquier bolsa o mochila. Además, su estructura se adapta a la palma de tu mano para que trabajes de forma cómoda, y su sensor óptico proporciona un desplazamiento controlado para el desarrollo de tareas precisas. Con el Logitech M185 Azul obtendrás una conexión fiable estés donde estés.', 'Logitech', 0),
(1435, 'Logitech M90 Negro - Ratón Óptico', 'https://www.neobyte.es/72513-large_default/logitech-m90-negro-raton-optico.jpg', 5.9, 'Logitech M90 Negro - Ratón Óptico', 'Logitech', 0),
(1436, 'Logitech M220 negro - Ratón inalámbrico', 'https://www.neobyte.es/13624-large_default/raton-logitech-m220-wireless-negro.jpg', 17.9, 'Inalámbrico, cómodo, ambidiestro... ¡y muy silencioso! El ratón Logitech M220 Silent ha perfeccionado su diseño para reducir el sonido del clic, de la rueda o del desplazamiento hasta en un 90% (certificación Quiet Mark). Disfruta de una totalidad de libertad de movimientos con un radio de acción de 10 metros y de una comodidad extra para trabajar en tu día a día.', 'Logitech', 0),
(1437, 'Logitech M185 Wireless Negro / Rojo', 'https://www.neobyte.es/9373-large_default/raton-logitech-m185-negro-rojo-wireless-910-002237.jpg', 13.9, 'El Logitech M185 es un ratón inalámbrico con un mini receptor USB fácil de llevar y ergonómico. Su increíble precio y su fiabilidad lo hacen ideal para todos los portátiles. Además, la duración de las pilas puede durar hasta 12 meses, entre el bajo consumo de energía y la suspensión automática cuando no tiene uso. Su conectividad inalámbrica avanzada de 2.4GHz hacen que no pierda cobertura y haya retrasos en la conexión.', 'Logitech', 0),
(1438, 'Logitech M185 Wireless Negro / Gris', 'https://www.neobyte.es/9218-large_default/raton-logitech-m185-negro-gris-wireless.jpg', 12.9, 'El Logitech M185 es un ratón inalámbrico con un mini receptor USB fácil de llevar y ergonómico. Su increíble precio y su fiabilidad lo hacen ideal para todos los portátiles. Además, la duración de las pilas puede durar hasta 12 meses, entre el bajo consumo de energía y la suspensión automática cuando no tiene uso. Su conectividad inalámbrica avanzada de 2.4GHz hacen que no pierda cobertura y haya retrasos en la conexión.', 'Logitech', 0),
(1439, 'Xiaomi MI Dual Mode Silent Edition Blanco - Ratón Inalámbrico', 'https://www.neobyte.es/61794-large_default/xiaomi-mi-dual-mode-silent-edition-blanco-raton-inalambrico.jpg', 12.9, 'Xiaomi MI Dual Mode Silent Edition Blanco - Ratón Inalámbrico', 'Xiaomi', 0),
(1440, 'Logitech M705 Wireless 910-001949', 'https://www.neobyte.es/35350-large_default/raton-logitech-m705-wireless-910-001949.jpg', 37.9, 'Tecnología láser / Scrolling hiper-rápido click-to-click / Diseño ergonómico / Larga autonomía de las pilas', 'Logitech', 0),
(1441, 'Logitech Wireless Presenter R400 - Presentador inalámbrico', 'https://www.neobyte.es/21802-large_default/presentador-logitech-r400-laser.jpg', 26.9, 'Haz que tus presentaciones se conviertan en algo extraordinario con Logitech Wireless Presenter R400. Este pequeño puntero de diseño ergonómico y controles intuitivos cuenta con la tecnología inalámbrica más avanzada para que puedas dirigirte a tu audiencia sin contratiempos. Además, incluye puntero láser, inficador del estado de las pilas y su configuración es verdaderamente sencilla, pues no requiere software adicional. Consigue ya tu Logitech Wireless Presenter R400 en Neobyte.', 'Logitech', 0),
(1442, 'Logitech M170 negro-gris - Ratón inalámbrico', 'https://www.neobyte.es/34873-large_default/raton-logitech-m170-negro-gris-wireless.jpg', 11.89, 'El Logitech M170 Negro-Gris Wireless es un ratón inalámbrico con el que trabajar cómodamente. Por un lado, ofrece una conexion estable a distancias de hasta 10 metros, sin retrasos ni interferencias. Por otro, cuenta con diseño ambidiestro y la posibilidad de reasignar funciones de botones derecho e izquierdo, lo que lo hace idóneo para adaptarse a todo tipo de usuarios. Disfruta de una libertad total de movimientos y de la sencillez de un ratón que podrás usar durante horas con total comodidad. Equípate con el Logitech M170 Negro-Gris al mejor precio en Neobyte.', 'Logitech', 0),
(1443, 'Logitech M190 Gris - Ratón inalámbrico', 'https://www.neobyte.es/40289-large_default/raton-logitech-m190-full-size-wireless-gris.jpg', 13.9, 'El ratón inalámbrico Logitech M190 Gris presenta un diseño contorneado que permite un agarre más natural y, por tanto, una mayor comodidad a la hora de usarlo. A ello también contribuye la conectividad inalámbrica, que facilita la libertad total de movimientos sin perder precisión. Está dotado de un sensor óptico de 1000 DPI para proporcionar exactitud a los movientos del ratón. El Logitech M190 Gris es un excelente compañero de trabajo que auna versatilidad, comodidad y precisión.', 'Logitech', 0),
(1444, 'Logitech B100 Blanco - Ratón óptico', 'https://www.neobyte.es/76091-large_default/raton-logitech-b100-oem-blanco-910-003360.jpg', 9.9, 'El Logitech B100 es un ratón óptico barato que te sorprenderá por su precisión y su comodidad. Un modelo de perfil bajo que te resultará confortable incluso después de horas de uso y que ha sido fabricado con materiales de calidad para que tengas ratón para rato.', 'Logitech', 0),
(1445, 'Logitech M171 Negro-Azul - Ratón inalámbrico', 'https://www.neobyte.es/10835-large_default/raton-logitech-m171-negro-azul-wireless.jpg', 11.89, 'Te presentamos un ratón inalámbrico cómodo y compacto con el que trabajar con total libertad. El Logitech M171 en color azul (910-004640) presenta un diseño ergonómico que te permitirá usarlo durante horas. Disfruta de la conectividad sin cables y de una durabilidad extra.', 'Logitech', 0),
(1446, 'Logitech Silent Plus M330 negro - Ratón inalámbrico', 'https://www.neobyte.es/13609-large_default/raton-logitech-m330-negro-wireless-910-004909.jpg', 29.9, 'El Logitech M330 Silent Plus (910-004909) hace honor a su nombre. Este ratón inalámbrico elimina el exceso de ruido para que tú y tu equipo trabajéis en el mejor entorno posible. Haz clic, deslízalo o utiliza la rueda de goma de una manera un 90% más silenciosa. Un modelo que incorpora laterales de goma blanda contorneados, lo que favorece su comodidad durante su uso, y modo de ahorro de energía, entrando automáticamente en suspensión cuando no se está usando. Disfruta de una mayor precisión y de una conexión inalámbrica estable hasta 10 metros. ¡Notarás la diferencia!', 'Logitech', 0),
(1447, 'Logitech MK540 Advanced - Combo teclado + ratón inalámbrico', 'https://www.neobyte.es/20434-large_default/teclado-logitech-mk540-wireless-combo.jpg', 56.89, 'Logitech MK540 Advanced es un combo de teclado + ratón inalámbrico que sorprende desde el primer momento por su extraordinaria comodidad de uso. Preciso y fiable, el teclado proporciona una escritura natural y silenciosa, contando además con teclas multimedia y permitiendo la inclinación en 3 niveles para que te resulte más sencillo encontrar la postura más confortable. Por otro lado, el ratón brinda una sujeción magnífica tanto para usuarios diestros como zurdos, así como una precisión sensacional. En último lugar, destacar la fantástica autonomía del Logitech MK540 Advanced. ¡Consíguelo ya en Neobyte!', 'Logitech', 0),
(1448, 'Cherry MC 1000 - Ratón USB', 'https://www.neobyte.es/76088-large_default/cherry-mc-1000-raton-usb.jpg', 5.89, 'Cherry MC 1000 - Ratón USB', 'Cherry', 0),
(1449, 'Logitech M171 - Ratón inalámbrico', 'https://www.neobyte.es/10831-large_default/raton-logitech-m171-negro-wireless-910-004424.jpg', 11.89, 'Compacto, fiable y muy cómodo. El ratón inalámbrico Logitech M171 (910-004424) en color negro se convertirá en una herramienta fundamental en tu trabajo, pudiéndolo llevar contigo siempre que quieras. Disfruta de la conectividad sin cables y de una durabilidad extra.', 'Logitech', 0),
(1450, 'Philips B Line 243B1JH/00 - Monitor 24 Full HD con webcam', 'https://www.neobyte.es/77454-large_default/philips-b-line-243b1jh00-monitor-24-full-hd-con-webcam.jpg', 413.9, 'Philips B Line 243B1JH/00 - Monitor 24 Full HD con webcam', 'Philips', 0),
(1451, 'Gigabyte M28U - Monitor 28 UHD 144HZ SS IPS', 'https://www.neobyte.es/48591-large_default/monitor-28-gigabyte-m28u-ss-ips-144hz.jpg', 538.99, 'El Gigabyte M28U llega a Neobyte para completar tu setup gaming. Este monitor con panel SS IPS (Super Speed IPS) de 28 cuenta con resolución nativa UHD 4K (3840x2160 px) y una tasa de refresco de 144 Hz, lo que se traduce en una jugabilidad más fluida, imágenes detalladas y una inmersión total en los contenidos. También cuenta con tecnología Flicker-Free para hacer más cómoda la experiencia de visuallización y evitar la vista cansada, modo KVM para controlar dos equipos diferentes con los mismos periféricos y altavoces de 3W de potencia cada uno. Compra el Gigabyte M28U en Neobyte con todas las garantías.', 'Gigabyte', 0),
(1452, 'Gigabyte M28U Arm Edition - Monitor 28 UHD 144Hz SS IPS', 'https://www.neobyte.es/81595-large_default/gigabyte-m28u-arm-edition-monitor-28-uhd-144hz-ss-ips.jpg', 559, 'Gigabyte M28U AE - Monitor 28 4K UHD 144Hz', 'Gigabyte', 0),
(1453, 'FILTRO DE PRIVACIDAD STARTECH PARA MONITOR 24', 'https://www.neobyte.es/73461-large_default/filtro-de-privacidad-startech-para-monitor-24.jpg', 106.9, 'FILTRO STARTECH DE PRIVACIDAD PARA MONITOR 24', 'Startech', 0),
(1454, 'Ozone DSP24 240 - Monitor 24 Full HD 240Hz G-Sync', 'https://www.neobyte.es/65119-large_default/ozone-dsp24-240-monitor-24-full-hd-240hz-g-sync.jpg', 299.9, 'Ozone DSP24 240 es el monitor gaming que estabas buscando. Gracias a su diseño compacto y ergonómico se integra a la perfección en tu escritorio, permitiéndote disfrutar de sus increíbles prestaciones al precio más ajustado. Este monitor cuenta con panel TN de 24.5 y una tasa de refresco de 240Hz, cumpliendo así con los deseos de los gamers competitivos más exigentes. Además, es compatible con las tecnologías FreeSync y G-Sync, lo que asegura una perfecta sincronización de FPS para una acción más rápida, fluida y precisa. Por último, indicar que el Ozone DSP24 240 incluye diferentes puertos de conexión para una compatibilidad total con tu PC y periféricos.', 'Ozone', 0),
(1455, 'Gigabyte G27F 2 - Monitor 27 IPS Full HD FreeSync 170Hz', 'https://www.neobyte.es/76410-large_default/gigabyte-g27f-2-monitor-27-ips-fullhd-freesync-170hz.jpg', 219, 'El Gigabyte G27F 2 es justo lo que necesitas para completar tu setup gaming. Desarrollado teniendo en mente las necesidades de los jugadores más exigentes, cuenta con lo último en rendimiento y lo ofrece sin necesidad de extravagancias. Entre sus características principales, destacar el fantástico panel IPS de 27 pulgadas con resolución Full HD y una tasa de refresco de hasta 170Hz. Esta combinación perfecta entre velocidad, ángulo de visión y calidad de imagen es una apuesta segura. Pero esto no es todo, pues también es compatible con la tecnología AMD FreeSync y cuenta con diferentes funcionalidades especialmente pensados para jugar (OSD, Black Equalizer, Dashboard...). A esto hay que añadir una completa conectividad y varias alternativas de ajuste.', 'Gigabyte', 0),
(1456, 'BenQ PD3205U - Monitor 32 IPS UHD 4K', 'https://www.neobyte.es/68718-large_default/benq-pd3205u-monitor-32-ips-uhd-4k-.jpg', 599.99, 'Con el BenQ PD3205U obtendrás un nivel superior de profesionalidad. Diseñado para que puedas exprimir al máximo tu talento, este monitor de 32 pulgadas cuenta con una precisión de color increíble y la posibilidad de alternar entre diferentes modos que permiten adaptar la gama cromática al tipo de trabajo que realices, ya sea animación, fotografía, dibujo técnico... Además, su panel IPS es capaz de alcanzar una resolución UHD 4K y viene equipado con tecnología HDR10 para un contraste único, así como tecnología Flicker Free para no sentir fatiga ocular durante tus largas jornadas. El BenQ PD3205U va a convertirse en un imprescindible en tu día a día.', 'Benq', 0),
(1457, 'Gigabyte M27Q-EK rev. 2.0 - Monitor 27 QHD IPS 165Hz', 'https://www.neobyte.es/98508-large_default/gigabyte-m27q-ek-rev-20-monitor-27-qhd-ips-165hz.jpg', 319, 'El monitor Gigabyte M27Q-EK pone a tu disposición un arsenal de características que te permitirán marcar la diferencia en tus juegos. Esta pantalla de 27 está equipada con panel IPS de resolución QHD (2560 x 1440) para que disfrutes de imágenes repletas de vida y con un nivel de detalle espectacular. Mientras tanto, los 165Hz de refresco (170Hz OC), 1 ms de tiempo de respuesta y la tecnología FreeSync se encargan de producir transiciones fluidas, suaves y ultra-precisas. Otra de sus principales ventajas es la certificación Display HDR400, lo que asegura una mayor profundidad de color. Además, el Gigabyte M27Q-EK (rev 2.0) incorpora KVM para una mejor vinculación con todos tus dispositivos.', 'Gigabyte', 0),
(1458, 'MSI Gaming G2712V - Monitor 27 IPS Full HD 100Hz', 'https://www.neobyte.es/105932-large_default/msi-gaming-g2712v-monitor-27-ips-full-hd-100hz.jpg', 178.9, 'MSI Gaming G2712V - Monitor 27 IPS Full HD 100Hz', 'MSI', 0),
(1459, 'Philips 27M1N5500ZA/00 - Monitor gaming 27 QHD IPS FreeSync 170Hz', 'https://www.neobyte.es/77599-large_default/philips-27m1n5500za00-monitor-gaming-27-qhd-ips-freesync-170hz.jpg', 302.9, 'Philips 27M1N5500ZA/00 - Monitor gaming 27 QHD IPS FreeSync 170Hz', 'Philips', 0),
(1460, 'AOC 27B2DA - Monitor 27 IPS Full HD', 'https://www.neobyte.es/76838-large_default/aoc-27b2da-monitor-27-ips-full-hd.jpg', 114.9, 'AOC 27B2DA - Monitor 27 IPS Full HD', 'AOC', 0),
(1461, 'Iiyama ProLite XU2792QSU-B1 - Monitor 27 IPS WQHD 70Hz', 'https://www.neobyte.es/67033-large_default/iiyama-prolite-xu2792qsu-b1-monitor-27-ips-wqhd-70hz.jpg', 170.9, 'Ya sea en la oficina o en el estudio, el Iiyama ProLite XU2792QSU-B1 transformará tu espacio de trabajo y maximizará tu productividad. Hablamos de un monitor de bisel estrecho que equipa un panel IPS de 27 para una calidad de imagen excelente y altos valores de contraste y brillo, lo que lo hace perfecto para tareas de diseño web, edición de fotografía o actividades creativas. Adecuado también para el juego, incorpora prestaciones que llevarán un nivel más allá tu entretenimiento, como compatibilidad AMD FreeSync o tecnología Flicker Free para largas jornadas frente a la pantalla. El Iiyama ProLite XU2792QSU-B1 dejará satisfechos hasta a los usuarios más exigentes.', 'IIYAMA', 0);
INSERT INTO `producto` (`id`, `nombre`, `imagen`, `precio`, `especificaciones`, `marca`, `id_categoria`) VALUES
(1462, 'Benq PD2705U - Monitor 27 IPS 4K UHD', 'https://www.neobyte.es/65549-large_default/benq-pd2705u-monitor-27-ips-4k-uhd.jpg', 399.99, 'Los profesionales del diseño, la ilustración, la fotografía o la animación encontrarán en el Benq PD2705U la herramienta perfecta para trabajar. Este monitor de 27 pulgadas ha sido dotado de tecnología de primer nivel que permite mostrar colores precisos e imágenes detalladas, obteniendo los resultados deseados en todo tipo de tareas. Dispone también de diferentes modos de trabajo para optimizar el flujo de trabajo y aumentar la productividad en función de las aplicaciones empleadas, así como diferentes tecnologías concebidas para el cuidado ocular. Apuesta por el Benq PD2705U en la tienda online de Neobyte.', 'Benq', 0),
(1463, 'AOC Q27G2S/EU - Monitor 27 IPS QHD 165Hz', 'https://www.neobyte.es/77550-large_default/aoc-q27g2seu-monitor-27-ips-qhd-165hz.jpg', 265.9, 'AOC Q27G2S/EU - Monitor 27 IPS QHD 165Hz', 'AOC', 0),
(1464, 'Iiyama ProLite T2454MSC-B1AG - Monitor 24 IPS Full HD', 'https://www.neobyte.es/68688-large_default/iiyama-prolite-t2454msc-b1ag-monitor-24-ips-full-hd-.jpg', 343.89, 'El Iiyama ProLite T2454MSC-B1AG cuenta con soporte ajustable, tecnología para el cuidado ocular y una pantalla táctil IPS que funciona tanto con los dedos, como con lápiz óptico o guantes de látex. Un monitor que pone especial cuidado a tu comodidad, proporcionando a su vez una calidad de imagen excepcional con una resolución Full HD para que disfrutes de contenido favorito como nunca. Asimismo, el Iiyama ProLite T2454MSC-B1AG incorpora altavoces estéreo y múltiples conexiones que lo dotan de una gran conectividad.', 'IIYAMA', 0),
(1465, 'Asus TUF Gaming VG27AQA1A - Monitor gaming 27 2K QHD FreeSync', 'https://www.neobyte.es/87643-large_default/asus-tuf-gaming-vg27aqa1a-monitor-gaming-27-2k-qhd-freesync.jpg', 239, 'El monitor de gaming ASUS TUF Gaming VG27AQA1A ofrece una experiencia inmersiva con su pantalla de 27 WQHD (2560x1440) y frecuencia de actualización overclockeada a 170 Hz. Con un tiempo de respuesta de 1 ms (MPRT) y tecnología ASUS Extreme Low Motion Blur, proporciona un juego fluido y sin desenfoques. Equipado con FreeSync Premium™ para una experiencia libre de tearing, HDR para colores vibrantes y alto contraste, y características como Shadow Boost, el VG27AQA1A es ideal para gamers profesionales. Además, su versatilidad se destaca con ASUS DisplayWidget Lite para ajustes rápidos y una variedad de opciones de conectividad, incluyendo HDMI y DisplayPort. Un monitor potente para una experiencia de gaming excepcional.', 'Asus', 0),
(1466, 'Philips B Line 276B1JH/00 - Monitor 27 QHD con webcam', 'https://www.neobyte.es/77492-large_default/philips-b-line-276b1jh00-monitor-27-qhd-con-webcam.jpg', 527.9, 'Philips B Line 276B1JH/00 - Monitor 27 QHD con webcam', 'Philips', 0),
(1467, 'Gigabyte M27U - Monitor gaming 27 UHD 4K 160Hz', 'https://www.neobyte.es/111338-large_default/gigabyte-m27u-monitor-gaming-27-uhd-4k-160hz.jpg', 559.9, 'Su función KVM simplifica el control de múltiples dispositivos, y con resolución UHD 4K a 160Hz, color de 10 bits y un amplio espectro de color del 95% DCI-P3, garantiza calidad visual detallada y una experiencia de juego inmersiva. El diseño elegante y ergonómico se integra a la perfección con la filosofía de diseño de la serie gaming de GIGABYTE. Características como OSD Sidekick permiten ajustes fáciles, mientras que las certificaciones Flicker-Free y Low Blue Light cuidan de tu salud visual. Eleva tu juego con el M27U de GIGABYTE, un monitor que combina rendimiento y diseño compacto.', 'Gigabyte', 0),
(1468, 'Iiyama ProLite X4373UHSU-B1 - Monitor 43 4K UHD', 'https://www.neobyte.es/67155-large_default/iiyama-prolite-x4373uhsu-b1-monitor-43-4k-uhd.jpg', 549.9, 'Seas trabajador o estudiante, el Iiyama ProLite X4373UHSU-B1 es perfecto para ocupar un espacio en tu lugar de trabajo. Hablamos de un monitor de 43 con tecnología PbP que  te ofrece la posibilidad de dividir su pantalla en cuatro para una visualización simultánea de diferentes contenidos, opción muy útil si eres de los que está acostumbrado a tener diversos programas o ventanas abiertas. Este periférico cuenta con una resolución de pantalla 4K UHD para unas imágenes nítidas y claras, así como diferentes opciones de conectividad para una conexión rápida con otros dispositivos. Con el Iiyama ProLite X4373UHSU-B1 aumentarás tu productividad de la forma más cómoda.', 'IIYAMA', 0),
(1469, 'Philips Serie 5000 24E1N5300HE/00 - Monitor 24 Full HD con webcam', 'https://www.neobyte.es/77265-large_default/philips-serie-5000-24e1n5300he00-monitor-24-full-hd-con-webcam.jpg', 233.91, 'Philips Serie 5000 24E1N5300HE/00 - Monitor 24 Full HD con webcam', 'Philips', 0),
