(1471, 'Asus ROG Strix XG49VQ - Monitor 49 Ultrapanorámico Full HD 144 Hz', 'https://www.neobyte.es/21842-large_default/asus-rog-strix-xg49vq-monitor-49-ultrapanoramico-full-hd-144-hz.jpg', 769, 'El Asus ROG Strix XG49VQ te dejará sin palabras. Este monitor ultrapanorámico de 49 pulgadas con pantalla curva acentúa la sensación de inmersión en los juegos y multiplica la versatilidad en aplicaciones multitarea. Cuenta con una tasa de refresco de 144 Hz, lo que garantiza una gran fluidez incluso con la configuración gráfica más alta, y tecnología Radeon Freesync 2 para mejorar la respuesta en los juegos. Gracias a sus dimensiones podrás visualizar hasta tres entradas de vídeo simultáneamente, mientras que la tecnología antiparpadeo y el sistema de luz azul de baja intensidad mitiga los efectos perjudiciales de una exposición prolongada. Por todo ello, se ha convertido en la opción preferidas para sim racing y todo tipo de juegos.', 'Asus', 0),
(1472, 'AOC C24G2AE/BK - Monitor curvo 24 Full HD FreeSync 165Hz', 'https://www.neobyte.es/76631-large_default/aoc-c24g2aebk-monitor-curvo-24-full-hd-freesync-165hz.jpg', 164.9, 'AOC C24G2AE/BK - Monitor curvo 24 Full HD FreeSync 165Hz', 'AOC', 0),
(1473, 'Asus VG289Q - Monitor 28 4K IPS', 'https://www.neobyte.es/31039-large_default/monitor-asus-28-vg289q.jpg', 289, 'Te presentamos el Asus VG289Q TUF Gaming, un monitor gaming 4K de 28 para los que quieren disfrutar de la máxima reslución. Esta pantalla IPS es compatible con el 90% del espacio de color DCI-P3 y cuenta con la tecnología HDR, lo que significa una mayor fidelidad de las imágenes y una riqueza cromática excepcional. Además, el Asus VG289Q TUF Gaming está provisto de FreeSync, un sistema que ayuda a una reproducción suave de las escenas en movimiento, reduciendo así los entrecortes y los problemas de sincronización de FPS. En último lugar, señalar que cuenta con una completa conectividad y está provisto de altavoces.', 'Asus', 0),
(1474, 'Philips 27M1N5200PA/00 - Monitor gaming 27 Full HD IPS FreeSync 240Hz', 'https://www.neobyte.es/77593-large_default/philips-27m1n5200pa00-monitor-gaming-27-full-hd-ips-freesync-240hz.jpg', 381.9, 'Philips 27M1N5200PA/00 - Monitor gaming 27 Full HD IPS FreeSync 240Hz', 'Philips', 0),
