(1476, 'Iiyama G-Master G2766HSU-B1 - Monitor 27 Full HD 1ms 165Hz', 'https://www.neobyte.es/67888-large_default/iiyama-g-master-g2766hsu-b1-monitor-27-full-hd-1ms-165hz.jpg', 170.9, 'El Iiyama G-Master G2766HSU-B1 Red Eagle es el monitor perfecto si eres un jugador al que le gusta competir y los eSports. Con sus 165Hz de tasa de refresco, este monitor de 27 promete imágenes dinámicas para que no te pierdas ni un momento de la acción, así como tiempos rápidos de respuesta de 1ms para reaccionar de forma rápida a cualquier ataque. Con su resolución Full HD y su compatibilidad con AMD FreeSync podrás disfrutar de la mejor calidad de imagen sin desfragmentación, desenfoques o borrosidades. El Iiyama G-Master G2766HSU-B1 Red Eagle es el monitor definitivo.', 'IIYAMA', 0),
(1477, 'LG Ultragear 32MP60G-B - Monitor 32 Full HD IPS 75Hz', 'https://www.neobyte.es/54786-large_default/monitor-gaming-lg-ultragear-32-32mp60g-b-fhd-ips.jpg', 191.91, 'El LG Ultragear 32MP60G-B es el monitor de 31,5” con resolución Full HD que te ofrecerá una experiencia sin igual a la hora de disfrutar de tus juegos, ofreciéndote una mayor comodidad para tus ojos y una gran nitidez de imágenes.  Este periférico presenta un panel IPS con ángulos de visión ultra amplios en los que visualizarás cada escena de forma clara y no te perderás ni el más mínimo detalle de tus partidas.  Además, viene cargado con múltiples características específicas para los juegos que optimizarán tu experiencia gamer, como compatibilidad con AMD FreeSync, 1ms Motion Blur Reduction o estabilizador de negros para unos tonos oscuros más diferenciados. ¡No pierdas la oportunidad de hacerte con el LG Ultragear 32MP60G-B en Neobyte!', 'LG', 0),
(1478, 'Asus XG32VC - Monitor curvo 32 WQHD 170Hz 1ms', 'https://www.neobyte.es/39506-large_default/monitor-asus-32-xg32vc-wqhd-170hz.jpg', 448.99, 'Si estás buscando un monitor curvo que te sumerja en la acción de los juegos, el Asus XG32VC ROG Strix no te defraudará. Un modelo de 32 pulgadas con resolución WQHD en el que las imágenes se muestran detalladas, definidas y realistas. Su tasa de refresco de 170Hz y la tecnología Extreme Low Motion Blur, que alcanza un tiempo de respuesta de 1ms, eliminan el desenfoque de movimiento y ofrece objetos más nítidos y una experiencia gaming más fluida. Cuenta con tecnologías AMD FreeSync Premium Pro, HDR y mejoras in-game para adelantarte a tus rivales. El Asus XG32VC ROG Strix, además, dispone de hub USB-C para que puedas conectar otros dispositivos o cargar tu teléfono móvil compatible.', 'Asus', 0),
