(1481, 'Asus VA229QSB - Monitor 22 Full HD IPS 75Hz', 'https://www.neobyte.es/39556-large_default/monitor-asus-22-va229qsb.jpg', 134.89, 'El Asus VA229QSB se adapta la perfección a tu espacio de trabajo y ya puede ser tuyo en Neobyte. Este monitor de 21.5 cuenta con panel IPS, resolución Full HD y 75Hz de tasa de refresco, lo que garantiza una calidad de imagen sensacional y una fidelidad de color extraordinaria desde cualquier ángulo. Paralelamente, destacar que el Asus VA229QSB incorpora una variadísima conectividad y peana ergonómica para que puedas ajustarlo tanto en altura como orientación, inclinación...', 'Asus', 0),
