(1493, 'Asus ROG Delta Core - Auriculares gaming', 'https://www.neobyte.es/20755-large_default/auriculares-asus-rog-delta-core.jpg', 73.89, 'Vive la experiencia más inmersiva con los auriculares gaming Asus ROG Delta Core. Este modelo es compatible con las principales plataformas (PC, PS4, Xbox One, Nintendo Switch) y ha sido equipado con exclusivos drivers Asus Essence para un audio de alta resolución. Su cuidado diseño proporciona un confort extra de la mano de las almohadillas ROG Hybrid en forma de D, las cuales se ajustan perfectamente al pabellón auditivo reduciendo un 20% el área de contacto para reducir la fatiga. No nos olvidamos de su micrófono integrado, con el que disfrutarás de una excelente comunicación con tu equipo.', 'Asus', 0),
(1494, 'Asus ROG Delta - Auriculares gaming RGB', 'https://www.neobyte.es/21951-large_default/auriculares-asus-rog-delta.jpg', 112.89, '¡Disfruta de un sonido espectacular con los auriculares Asus ROG Delta! Es el primer auricular para juegos del mundo con el DAC cuádruple ESS 9218 para que el audio sea espectacular. La conexión es USB-C pero trae adaptador a USB 2.0 para que puedas usar estos auriculares ya sean en PC, móviles o PS4. Los auriculares Asus ROG Delta te pueden dar una seria ventaja ante tus rivales pues puedes escuchar con precisión milimétrica la distancia de tus enemigos, la dirección de los pasos y de los disparos. Y por supuesto, con luces RGB circular tipo arco iris.', 'Asus', 0),
(1495, 'Corsair HS65 Surround Carbon - Auriculares gaming', 'https://www.neobyte.es/71258-large_default/corsair-hs65-surround-carbon-auriculares-gaming.jpg', 89.89, 'Ya en Neobyte los Corsair HS65 Surround Carbon. Estos auriculares gaming han sido desarrollados para que vibres en cada partida y obtengas la ventaja competitiva que tanto deseas. Fabricados con materiales de máxima calidad, brindan una experiencia de uso sumamente satisfactoria. En lo referentes a sus especificaciones técnicas, destacar los transductores de neodimio de 50mm, el micrófono de gran precisión y el sonido envolvente 7.1 mediante adaptador USB incluido. En cuanto a su construcción, los Corsair HS65 Surround Carbon convencen por sus acabados premium y la comodidad sin igual que ofrecen sus almohadillas ajustables de viscoelástica y polipiel, así como su diadema de extraordinaria ligereza.', 'Corsair', 0),
(1496, 'Corsair HS80 RGB Wireless Negro - Auriculares gaming', 'https://www.neobyte.es/57959-large_default/corsair-hs80-rgb-wireless-negro-auriculares-gaming.jpg', 149.89, 'Déjate envolver por el sonido de calidad de los Corsair HS80 RGB Wireless Negro. Estos auriculares gaming te transportarán a la acción de cada batalla y de cada historia, rodeándote con un audio rico en matices y realista. Gracias a su diseño de almohadillas de espuma viscoelástica con tela transpirable y diadema flotante sin presión podrás llevarlos durante horas con total comodidad, disfrutando de la libertad de movimientos que ofrece la conectividad sin cables. Además, cuenta con micrófono omnidireccional de manera que tus comunicaciones serán nítidas. No te conformes con menos: Corsair HS80 RGB Wireless Negro.', 'Corsair', 0),
(1497, 'Corsair Void RGB Elite USB Carbon - Auriculares gaming 7.1', 'https://www.neobyte.es/29056-large_default/corsair-void-rgb-elite-usb-carbon-auriculares-gaming-71.jpg', 89.89, 'Corsair Void RGB Elite Carbon 7.1, unos auriculares gaming de primera calidad que superarán tus expectativas y que ahora puedes conseguir en Neobyte al precio más competitivo. Su diseño incluye iluminación RGB que encaja a la perfección en tu setup, así como almohadillas ergonómicas de microfibra y diadema de gran confort para una comodidad espectacular. Además, los Corsair Void RGB Elite Carbon incorporan micrófono ajustable omnidireccional para una comunicación clara con tu equipo.', 'Corsair', 0),
(1498, 'Asus TUF Gaming H3 Rojo - Auriculares', 'https://www.neobyte.es/24718-large_default/auricular-asus-tuf-gaming-h3-rojo.jpg', 45.9, 'Ligeros y de diseño robusto, los auriculares Asus TUF Gaming H3 Rojo han sido concebidos para proporcionar confort y durabilidad a gamers y streamers que pasan mucho tiempo jugando. Un modelo que garantiza un sonido rico e inmersivo gracias a sus drivers de 50 mm y a la cámara hermética, mejorando aún más la experiencia de juego. Además, han sido provistos de un elemento indispensable para una óptima comunicación con tu equipo: un impresionante micrófono unidireccional. Hazte ya con los Asus TUF Gaming H3 Rojo en Neobyte al mejor precio.', 'Asus', 0),
(1499, 'Asus ROG Strix GO 2.4 - Auriculares gaming inalámbricos 2.4Ghz', 'https://www.neobyte.es/30155-large_default/asus-rog-strix-go-24.jpg', 149.94, 'Ligeros y de diseño robusto, los auriculares Asus TUF Gaming H3 Rojo han sido concebidos para proporcionar confort y durabilidad a gamers y streamers que pasan mucho tiempo jugando. Un modelo que garantiza un sonido rico e inmersivo gracias a sus drivers de 50 mm y a la cámara hermética, mejorando aún más la experiencia de juego. Además, han sido provistos de un elemento indispensable para una óptima comunicación con tu equipo: un impresionante micrófono unidireccional. Hazte ya con los Asus TUF Gaming H3 Rojo en Neobyte al mejor precio.', 'Asus', 0),
(1500, 'Asus ROG Theta Electret - Auriculares gaming', 'https://www.neobyte.es/34335-large_default/auriculares-asus-rog-thetea-electret.jpg', 219.89, 'Si te apasiona el sonido, los Asus ROG Theta Electret son para ti. Estos auriculares de grado audiófilo incorporan los últimos avances en material de rendimiento acústico, permitiéndote disfrutar no solo de tus juegos, sino también de tu música y películas con una calidad insuperable. Para ello, los Asus ROG Theta Electret equipan transductores de neodimio y electret en una cámara estanca, lo que se traduce en una experiencia sonora envolvente y realista. Además, son compatibles con todo tipo de plataformas (móviles, ordenadores, consolas...), incluyen micrófono desmontable y proporcionan una ajuste sumamente confortable.', 'Asus', 0),
(1501, 'Newskill Anuki TWS Real ANC Blancos - Auriculares in-ear', 'https://www.neobyte.es/82723-large_default/newskill-anuki-tws-real-anc-blancos-auriculares-in-ear.jpg', 32.9, 'Newskill Anuki TWS Real ANC Blancos - Auriculares in-ear', 'Newskill', 0),
(1502, 'Logitech H340 Negro - Auriculares', 'https://www.neobyte.es/51195-large_default/logitech-h340-negro-auriculares.jpg', 27.9, 'De aspecto sencillo y estética elegante, los Logitech H340 son los auriculares para uso cotidiano que querrás usar en todo momento, tanto si estás en casa como en la oficina. Despliega el micrófono que lleva incorporado para efectuar tus llamadas y habla con tranquilidad gracias a su tecnología de cancelación de ruido. Para una máxima comodidad, su diadema es ajustable y sus almohadillas están recubiertas de espuma, por lo que ni siquiera notarás que los llevas puestos mientras escuchas música durante horas.  Para finalizar, los Logitech H340 te permitirán una libertad total de movimientos gracias a su largo cable de 180cm.', 'Logitech', 0),
(1503, 'Xiaomi Mi In-Ear Negro Básico - Auriculares', 'https://www.neobyte.es/16936-large_default/auricular-xiaomi-mi-in-ear-negro-basico.jpg', 5.9, 'Con los Xiaomi Mi In-Ear negro notarás la diferencia. Su sonido cristalino y el diseño elegante en aluminio caracterizan estos auriculares de Xiaomi. Por un lado, cuenta con una membrana que utiliza una combinación de metal aeroespacial y PET para crear un audio balanceado y sólido, optimizado para todo tipo de música. Por otro, no podemos dejar de mencionar su cámara de aluminio anodizado, ligera y resistente a rayones. Además, dispone de cable plano de gran resistencia, a prueba de torsiones y enredos, y botón para utilizarlo como manos libres.', 'Xiaomi', 0),
(1504, 'Xiaomi Mi In-Ear Básico Plata - Auriculares', 'https://www.neobyte.es/18884-large_default/auricular-xiaomi-mi-in-ear-plata.jpg', 5.9, '¿Buscas unos auriculares económicos? Con los Xiaomi Mi In-Ear Básico no solo tendrás un precio ajustado sino que también ofrece de una calidad de sonido óptima. Este modelo ha sido fabricado con una membrana que utiliza una combinación de metal aeroespacial y PET para crear un audio balanceado y sólido, perfecto para disfrutar de tu música con todos sus matices. Por último, comentar que cuenta con cámara de aluminio anodizado, ligera y resistente, y cable plano de gran resistencia.', 'Xiaomi', 0),
(1505, 'Newskill Drakain - Auriculares gaming', 'https://www.neobyte.es/82745-large_default/newskill-drakain-auriculares-gaming.jpg', 39.95, 'Newskill Drakain - Auriculares gaming', 'Newskill', 0),
(1506, 'Logitech H390 - Auriculares', 'https://www.neobyte.es/51845-large_default/auriculares-logitech-h390.jpg', 32.9, 'Los Logitech H390 son unos auriculares con micrófono integrado, ideales tanto para realizar llamadas en el trabajo sin percibir ruido de fondo como para disfrutar de tu tiempo de ocio escuchando música o comunicándote con tu equipo de juego. Están diseñados para garantizar la mejor experiencia auditiva, con almohadillas acolchadas para un uso cómodo durante horas y control integrado con atajos de modificación de volumen y finalización de llamada. Además, su conexión USB permite el uso Plug and Play, así que sólo necesitaras conectar los Logitech H390 al ordenador para empezar a apreciar la potencia de sonido de estos increíbles auriculares.', 'Logitech', 0),
(1507, 'Xiaomi Redmi Buds 4 Lite - Auriculares inalámbricos', 'https://www.neobyte.es/103297-large_default/xiaomi-redmi-buds-4-lite-auriculares-inalambricos.jpg', 17.9, 'Xiaomi Redmi Buds 4 Lite - Auriculares inalámbricos', 'Xiaomi', 0),
(1508, 'Logitech H151 Negro - Auriculares', 'https://www.neobyte.es/51191-large_default/auriculares-logitech-h151-negro.jpg', 21.9, 'Sonido preciso e impecable. Los Logitech H151 han llegado a Neobyte dispuestos a ofrecer mucho a un precio sorprendente. Su diadema está fabricada con materiales duraderos y confortables, con almohadillas de espuma blanda para que puedas sentir una sujeción suave y delicada. Entre sus comodidades encontramos la incorporación de un micrófono que se puede posicionar tanto a derecha o izquierda, a gusto de cada usuario, y un control integrado en el cable con el que poder realizar ajustes de forma rápida. ¡Pero lo mejor es que, con el conector de audio de 3,5 mm del Logitech H151, podrás disfrutar del mejor sonido a través de diferentes dispositivos!', 'Logitech', 0),
(1509, 'Apple EarPods Lightning - Auriculares con micrófono', 'https://www.neobyte.es/7915-large_default/auricular-apple-earpord-lighting-con-mando-y-micro.jpg', 17.9, 'Disfruta de una comodidad y una calidad de sonido superior con los auriculares Apple EarPods con conector Lightning. Éstos incorporan un mando integrado en el cable con el que podrás subir o bajar el volumen, controlar la reproducción de música y responder llamadas. Están fabricados con materiales de calidad, incluyendo una mayor protección contra el sudor y el agua. Calidad Apple para apreciar la música al máximo.', 'Apple', 0),
(1510, 'Newskill Sobek Ivory - Auriculares gaming', 'https://www.neobyte.es/82776-large_default/newskill-sobek-ivory-auriculares-gaming.jpg', 44.95, 'Newskill Sobek Ivory - Auriculares gaming', 'Newskill', 0),
(1511, 'Logitech H111 - Auriculares', 'https://www.neobyte.es/51179-large_default/auriculares-logitech-h111-con-micro.jpg', 15.9, 'Los Logitech H111 son la prueba definitiva de que la marca Logitech nunca defrauda.  Estos auriculares de diseño sencillo destacan por su funcionalidad, aportando un listado de especificaciones que te serán de utilidad en tu día a día. Para garantizarte una buena comunicación, el micrófono logra una captura de voz más precisa y cuenta con un cable de 235 cm de longitud, perfecto par aquellas personas que necesitan moverse libremente mientras hablan. Úsalos cuando quieras y cómo quieras, solo necesitaras conectar la toma de audio de 3,5 mm a cualquier dispositivo para empezar a disfrutar de una amplia variedad de matices y unos tonos intensos con los Logitech H111.', 'Logitech', 0),
