(1514, 'Krom Kam - Webcam Full HD micrófono', 'https://www.neobyte.es/40646-large_default/webcam-krom-kam-full-hd-microfono.jpg', 32.9, 'Perfecta para reuniones virtuales y streaming, la webcam Krom Kam es una fantástica herramienta que proporciona una excelente calidad de imagen y comunicaciones claras. Dispone de resolución Full HD, lo que agradecerán todos aquellos usuarios que quieren mejorar sus sesiones en directo, y micrófono integrado para que oigan tu voz de forma natural. Gracias a su trípode de metal regulable en altura podrás conseguir la posición que mejor se adapte a tus necesidades, mientras que la base de sujeción permite adaptarla al monitor o pantalla de portátil. Por último, es importante mencionar que la Krom Kam cuenta con una tapa de privacidad que se abre y se cierra sin apenas esfuerzo. ¡Cómprala ya en Neobyte!', 'Krom', 0),
