(1516, 'Logitech HD C270 Webcam', 'https://www.neobyte.es/9890-large_default/webcam-logitech-c270-hd-3mp.jpg', 35.9, 'La Logitech C270 dispone de la tecnología Logitech Fluid Crystal para hacer mejores las webcams Logitech. Con ella obtienes un vídeo más fluido, imágenes más nítidas y colores más vivos, además de un sonido más claro en condiciones reales. También podrás realizar las videoconferencias en HD 720p en pantalla panorámica. Gracias a su micrófono integrado, le escucharan alto y claro eliminando el ruido de fondo.', 'Logitech', 0),
(1517, 'Conceptronic AMDIS04R - Webcam Full HD', 'https://www.neobyte.es/47948-large_default/webcam-conceptronic-amdis-1080p-full-hd.jpg', 23.9, 'La webcam Conceptronic AMDIS04R con resolución Full HD es perfecta para realizar videoconferencias, clases online y streamings con una calidad excelente. Un modelo compatible con la mayoría de aplicaciones de videoconferencia que cuenta con micrófono integrado con sistema de reducción de ruido. Dispone también de cubierta de privacidad y su instalación es muy sencilla. Si buscas una cámara web Full HD a precio asequible la Conceptronic AMDIS04R se ajustará a lo que necesitas.', 'Conceptronic', 0),
(1518, 'Logitech C925e - Webcam Full HD', 'https://www.neobyte.es/16214-large_default/webcam-logitech-c925-960-001076.jpg', 82.9, 'Vídeo en alta definición Full HD para tus conferencias con la webcam Logitech C925e (960-001076). Un modelo asequible que presenta una funcionalidad perfecta para cualquier entorno, tanto doméstico como empresarial, y que incorpora un clip ajustable que permite colocarlo en múltiples ubicaciones. Además, cuenta con tapa deslizante para garantizar la privacidad. Es importante reseñar que incorpora tecnología RightLight 2, una tecnología que se ajusta de forma inteligente para mejorar la calidad de imagen en situaciones de poca luz.', 'Logitech', 0),
