(1541, 'Asus C3 - Webcam Full HD', 'https://www.neobyte.es/45566-large_default/webcam-asus-c3.jpg', 68.9, 'Mejora tus streamings y videoconferencias con la webcam Asus C3. Esta cámara web con conexión USB ofrece gran fluidez con resolución Full HD, reduciendo además el ruido ambiental para una comunicación más clara. Dispone de un clip ajustable hasta 90º para acomplarse a una amplia variedad de monitores y pantallas de portátil, con mecanismo de rotación de la cámara de 360º. Es compatible con aplicaciones como Skype, Zoom o Teams y asegura una amplio ángulo de visualización. ¡Hazte con la Asus C3!', 'Asus', 0),
