(1560, 'Brohter MFC-L2750DW - Impresora multifunción láser monocromo', 'https://www.neobyte.es/36458-large_default/impresora-multifun-laser-monocromo-mfc-l2750dw.jpg', 315.89, 'La Brohter MFC-L2750DW ha pensado en todo para que obtengas las mejores prestaciones ahorrando tiempo y recursos. Esta impresora láser multifunción monocromo es capaz de imprimir hasta 34 páginas por minuto e incorpora impresión a doble cara automática y alimentador automático de documentos. Cuenta con conectividad avanzada, con red cableada, WiFi, Wi-Fi Direct y NFC, lo que permite imprimir desde dispositivos móviles y facilita su utilización. En este sentido, es importante reseñar que también ha sido provista de pantalla táctil a color, par un uso más intuitivo. No eches nada en falta con la Brohter MFC-L2750DW.', 'Brother', 0),
(1561, 'HP OfficeJet Pro 9010e WIFI - Impresora multifunción tinta', 'https://www.neobyte.es/86786-large_default/hp-officejet-pro-9010e-wifi-impresora-multifuncion-tinta.jpg', 159.9, 'HP OfficeJet Pro 9010e WIFI - Impresora multifunción tinta', 'HP', 0),
