(1581, 'Logitech F710 - Gamepad inalámbrico', 'https://www.neobyte.es/36319-large_default/gamepad-logitech-f710-wireless.jpg', 41.9, 'El gampepad inalámbrico Logitech F710 cuenta con un diseño clásico y unas características que te permitirán jugar cómodamente a todo tipo de juegos. Equipado con conectividad wireless RF 2.4Ghz, ofrece una transmisión rápida, precisa y sin interferencias. Además, la distribución de los botones, así como su construcción, garantiza una sujeción confortable y un acceso facil a todos los comandos. Por último, indicar que es compatible con PC e incluye vibración. Consigue ya el Logitech F710 en Neobyte.', 'Logitech', 0),
(1582, 'Krom Kayros - Mando Bluetooth', 'https://www.neobyte.es/80248-large_default/krom-kayros-mando-bluetooth.jpg', 36.91, 'Krom Kayros - Mando Bluetooth', 'Krom', 0),
