(1594, 'MSI Force GC30 v2 Blanco - Gamepad inalámbrico', 'https://www.neobyte.es/75510-large_default/msi-force-gc30-v2-blanco-gamepad-inalambrico.jpg', 41.9, 'GAMEPAD MSI FORCE GC30 V2 WHITE', 'MSI', 0),
(1595, 'Wacom Intuos S Negra - Tableta gráfica', 'https://www.neobyte.es/15515-large_default/wacom-intuos-s-negra-tableta-grafica.jpg', 82.9, 'La manera más asequible y divertida de desarrollar tu creatividad se llama Wacom Intuos S y en Neobyte la puedes conseguir a un precio sensacional en un sobrio y elegante color negro. Dibuja, diseña, retoca y mucho más de forma fácil y cómoda gracias a esta tableta gráfica de tamaño compacto líder en ventas. Su gran área activa, unida al lápiz 4K incluido y a las teclas de acceso rápido ExpressKey integradas, hacen que su utilización resulte intuitiva y confortable en todo momento. Conecta tu Wacom Intuos S y no pares de crear.', 'Wacom', 0),
(1596, 'One by Wacom Mediana - Tableta digitalizadora', 'https://www.neobyte.es/34625-large_default/one-by-wacom-mediana-tableta-digitalizadora.jpg', 63.9, 'La table digitalizadora One by Wacom Mediana es una forma fácil, asequible e intuitiva de desarrollar tu creatividad en formato digital. Dibuja, edita, haz bocetos y mucho más de manera natural gracias a su formato de gran comodiad y lápiz incluido que, además, no necesitas pilas. Conéctala por USB a tu ordenador Windows o Mac y da rienda suelta a tu creatividad.', 'Wacom', 0),
(1597, 'Wacom Intuos S Bluetooth Negra - Tableta gráfica', 'https://www.neobyte.es/15500-large_default/wacom-intuos-s-bluetooth-negra-tableta-grafica.jpg', 102.9, 'Wacom Intuos S Bluetooth Negra es la creatividad que se lleva a cualquier parte gracias a su tamaño compacto, conectividad inalámbrica y comodidad de utilización. Gracias a la tecnología Bluetooth, podrás vincularla fácilmente sin cables con solo pulsar un botón. Además, este modelo incluye lápiz digital y teclas de acceso rápido ExpressKey, lo que simplifica y agiliza enormemente el control de la tableta gráfica para que tú solo tengas que preocuparte por expresar tus ideas. Hazte ya con la Wacom Intuos S BT y no pares de crear.', 'Wacom', 0),
(1598, 'Wacom Intuos S Bluetooth Pistacho - Tableta gráfica', 'https://www.neobyte.es/15510-large_default/wacom-intuos-s-bluetooth-pistacho-tableta-grafica.jpg', 102.9, 'La tableta gráfica inalámbrica Wacom Intuos S Bluetooth de color pistacho tiene todo lo que necesitas para dar rienda suelta a tu creatividad de la manera más cómoda, divertida y asequible. Provista de conectividad Bluetooth, incluye además lápiz 4K, teclas de acceso rápido ExpressKey y un área activa mejorada, lo que se traduce en una utilización más sencilla, ágil y confortable. Explora nuevas formas de crear al mejor precio con Wacom Intuos S Bluetooth, ya disponible para envío inmediato en Neobyte.', 'Wacom', 0),
(1599, 'Wacom Intuos M Bluetooth Negra - Tableta digitalizadora', 'https://www.neobyte.es/15495-large_default/wacom-intuos-m-bluetooth-negra-tableta-digitalizadora.jpg', 203.9, 'Descubre la forma más divertida de expresar tu creatividad con Wacom Intuos M Bluetooth Negra, una tableta digitalizadora diseñada para dar vida a tus ideas. Gracias su tamaño compacto con una gran área activa y al lápiz incluido ultraperciso, resulta verdaderamente cómoda y fácil de utilizar. Además, la Wacom Intuos M Bluetooth incorpora teclas de acceso rápido ExpressKey y conectividad inalámbrica para una vinculación más rápida con tu ordenador.', 'Wacom', 0),
(1600, 'Wacom Intuos Pro S - Tableta digitalizadora', 'https://www.neobyte.es/33616-large_default/wacom-intuos-pro-s-tableta-digitalizadora.jpg', 232.9, 'Descubre la forma más divertida de expresar tu creatividad con Wacom Intuos M Bluetooth Negra, una tableta digitalizadora diseñada para dar vida a tus ideas. Gracias su tamaño compacto con una gran área activa y al lápiz incluido ultraperciso, resulta verdaderamente cómoda y fácil de utilizar. Además, la Wacom Intuos M Bluetooth incorpora teclas de acceso rápido ExpressKey y conectividad inalámbrica para una vinculación más rápida con tu ordenador.', 'Wacom', 0),
(1601, 'Wacom Intuos M Bluetooth Pistacho - Tableta digitalizadora', 'https://www.neobyte.es/15646-large_default/wacom-intuos-m-bluetooth-pistacho-tableta-digitalizadora.jpg', 203.9, 'Explora nuevas maneras de dar rienda suelta a tu creatividad con Wacom Intuos M Bluetooth de color pistacho, una tableta gráfica que ofrece una gran superficie activa para que dibujar, diseñar, retocar y, en definitiva, CREAR, te resulte más cómodo y fácil que nunca. Además, este modelo incluye lápiz 4K ultrapreciso y teclas ExpressKey que agilizan la utilización de las diferentes herramientas. Por último, destacar que gracias a la conectividad Bluetooth podrás vincularla con tu ordenador sin necesidad de cables. Wacom Intuos M Bluetooth, tan libre como tú.', 'Wacom', 0),
(1602, 'Wacom Intuos Pro M - Tableta digitalizadora', 'https://www.neobyte.es/11810-large_default/wacom-intuos-pro-m-tableta-digitalizadora.jpg', 383.9, 'La Wacom Intuos Pro M es una tableta digitalizadora sumamente elegante creada para profesionales que buscan una herramienta sólida, fiable, precisa y versátil para su día a día. Fácil de configurar y de vincular con tu ordenador a través de USB o Bluetooth, este modelo de prestaciones avanzadas incluye un buen número de ventajas para usuarios avanzados, como las teclas de acceso rápido o el stylus Pro Pen 2, un lápiz que interpreta a la perfección todos los gestos a la hora de dibujar. Tenlo todo con Intuos Pro M de Wacom y libera tu creatividad.', 'Wacom', 0),
(1603, 'Wacom Cintiq 16 - Tableta digitalizadora Full HD 15.6', 'https://www.neobyte.es/29412-large_default/wacom-cintiq-16-tableta-digitalizadora-full-hd-156.jpg', 913.9, 'La Wacom Intuos Pro M es una tableta digitalizadora sumamente elegante creada para profesionales que buscan una herramienta sólida, fiable, precisa y versátil para su día a día. Fácil de configurar y de vincular con tu ordenador a través de USB o Bluetooth, este modelo de prestaciones avanzadas incluye un buen número de ventajas para usuarios avanzados, como las teclas de acceso rápido o el stylus Pro Pen 2, un lápiz que interpreta a la perfección todos los gestos a la hora de dibujar. Tenlo todo con Intuos Pro M de Wacom y libera tu creatividad.', 'Wacom', 0),
(1604, 'Bamboo Ink Plus Negro - Lápiz para tableta', 'https://www.neobyte.es/41961-large_default/bamboo-ink-plus-negro-lapiz-para-tableta.jpg', 104.89, 'Lapiz Para Tableta Dig. Stylus Bamboo Ink Plus Black', 'Wacom', 0),
(1605, 'Wacom Cintiq 22 - Tableta digitalizadora', 'https://www.neobyte.es/29429-large_default/wacom-cintiq-22-tableta-digitalizadora.jpg', 1420.9, 'Lapiz Para Tableta Dig. Stylus Bamboo Ink Plus Black', 'Wacom', 0),
(1606, 'Wacom Bamboo Slate Large - SmartPad', 'https://www.neobyte.es/7600-large_default/wacom-bamboo-slate-large-smartpad.jpg', 145.9, 'Wacom Bamboo Slate Large permite transformar tus notas y bosquejos escritos a mano en archivos digitales listos para retocar, compartir y seguir creando. Basta con escribir en cualquier papel sobre la superficie de la tableta gráfica, pulsar un botón y listo, ya lo tendrás en tu tablet, smartphone u ordenador compatible. Por su tecnología de digitalización y tamaño manejable es perfecta para utilizar en tu día a día, seas estudiante, creativo o simplemente aficionado. Consíguela en Neobyte más barata y recíbela en 24/48 horas.', 'Wacom', 0),
(1607, 'Logitech Crayon Naranja - Lápiz para iPad', 'https://www.neobyte.es/89627-large_default/logitech-crayon-naranja-lapiz-para-ipad.jpg', 59.9, 'Logitech Crayon Naranja - Lápiz para iPad', 'Logitech', 0),
(1608, 'Wacom Cintiq Pro 24 - Tableta digitalizadora 24 UHD', 'https://www.neobyte.es/29452-large_default/wacom-cintiq-pro-24-tableta-digitalizadora-24-uhd.jpg', 2434.9, 'Logitech Crayon Naranja - Lápiz para iPad', 'Wacom', 0),
(1609, 'Salicru SPS One 900VA SAI', 'https://www.neobyte.es/40171-large_default/sai-salicru-sps-900-one-900va.jpg', 74.9, '¿Se va la luz en el peor momento? Con el SAI de Salicru SPS 900VA te aseguras poder guardar todos tus documentos antes que se vaya la luz. ¡Todo un respiro para guardar esa información tan importante!', 'Salicru', 0),
(1610, 'Salicru SPS Safe 7 - Regleta de 7 tomas', 'https://www.neobyte.es/68248-large_default/salicru-sps-safe-7-regleta-de-7-tomas.jpg', 24.9, 'La solución perfecta contra sobretensiones, las sobrecargas, los parásitos eléctricos y los efectos indirectos de los rayos se llama Salicru SPS.SAFE 7. Esta completa regleta incorporan tomas orientadas para una fácil conexión, incorporando obturador para protección infantil. Protege todos tus dispositivos, en tu oficina o casa, con Salicru SPS.SAFE 7.', 'Salicru', 0),
(1611, 'Salicru SPS Safe 6 - Regleta 6 tomas', 'https://www.neobyte.es/68243-large_default/regleta-salicru-sps-safe-6-tomas.jpg', 12.9, 'La solución perfecta contra sobretensiones, las sobrecargas, los parásitos eléctricos y los efectos indirectos de los rayos se llama Salicru SPS.SAFE 7. Esta completa regleta incorporan tomas orientadas para una fácil conexión, incorporando obturador para protección infantil. Protege todos tus dispositivos, en tu oficina o casa, con Salicru SPS.SAFE 7.', 'Salicru', 0),
(1612, 'Salicru SPS One 700VA SAI', 'https://www.neobyte.es/9645-large_default/sai-salicru-sps-700-one-700va.jpg', 63.9, '¿Se va la luz en el peor momento? Con el SAI de Salicru SPS 700VA te aseguras poder guardar todos tus documentos antes que se vaya la luz. Su conexión USB te permite poder monitorizar el sistema y cerrar los archivos abiertos en caso de irse la corriente. ¡Todo un respiro para guardar esa información tan importante!', 'Salicru', 0),
(1613, 'Salicru SPS 500 One - SAI 500VA', 'https://www.neobyte.es/29896-large_default/sai-salicru-sps-500-one.jpg', 55.9, '¿Se va la luz en el peor momento? Con el SAI de Salicru SPS 700VA te aseguras poder guardar todos tus documentos antes que se vaya la luz. Su conexión USB te permite poder monitorizar el sistema y cerrar los archivos abiertos en caso de irse la corriente. ¡Todo un respiro para guardar esa información tan importante!', 'Salicru', 0),
(1614, 'SAI EATON ELLIPSE ECO 800 USB DIN 800VA 500W', 'https://www.neobyte.es/57696-large_default/sai-eaton-ellipse-eco-800-usb-din-800va-500w.jpg', 166.9, 'SAI EATON ELLIPSE ECO 800 USB DIN 800VA 500W', 'Eaton', 0),
(1615, 'Salicru SPS 850 SOHO+ - SAI', 'https://www.neobyte.es/29961-large_default/sai-salicru-sps-850-soho.jpg', 131.9, 'SAI EATON ELLIPSE ECO 800 USB DIN 800VA 500W', 'Salicru', 0),
(1616, 'Salicru SPS-650 Home - SAI Off-Line', 'https://www.neobyte.es/14978-large_default/sai-salicru-sps-650-home-sai-off.jpg', 79.9, 'El SAI Salicru SPS-650 Home ofrece una protección eficiente contra cortes, microcortes, sobretensiones, picos de tensión, etc., que puedan afectar a tu ordenador y a tu trabajo. Un modelo de base múltiple con 6 tomas schuko perfecto para conectar tu equipo y diferentes periféricos asociados, desde monitores a un NAS o un router. Además, es compatible con equipos electrónicos con corrector del factor de potencia, que minimiza la distorsión provocada por la línea eléctrica.', 'Salicru', 0),
(1617, 'SAI SALICRU SPS NET', 'https://www.neobyte.es/45504-large_default/sai-salicru-sps-net.jpg', 49.9, 'Sai Salicru Sps Net', 'Salicru', 0),
(1618, 'Salicru SPS-850 Home - SAI Off-line 850VA / 490W', 'https://www.neobyte.es/24618-large_default/sai-salicru-sps-850-home-sai-off-line-850va-490w.jpg', 94.9, 'Tanto para entornos de oficina como domésticos, el SAI Salicru SPS-850 Home cuenta con 6 tomas y capacidad para proteger cargas con corrector del factor de potencia. Dispone, a su vez, de protección contra sobretensiones, con back-up de autonomía para situaciones de fallo del suministro eléctrico en 4 de las tomas. Para la configuración de parámetros y cierre/hibernación del PC, ha sido provisto de USB con protocolo HID. El Salicru SPS-850 Home es tu mejor opción para evitar problemas con cortes eléctricos, sobretensiones, picos de tensión, etc. Cómpralo ya en Neobyte al mejor precio.', 'Salicru', 0),
