(1665, 'Ewent EW3400 - Lector de códigos de barras 1D USB', 'https://www.neobyte.es/40575-large_default/lector-codigo-de-barras-ewent-ew3400-1d-usb.jpg', 49.9, '¿Buscas un lector de código de barras para tu tienda o almacén? El Ewent EW3400 te irá como anillo al dedo para trabajar de forma más productiva y cómoda. Se trata de modelo de fabricación robusta con protección ante polvo y agua, lo que lo hace ideal para trabajar tanto en interior como en exterior. También ha sido diseñado para asegurar una gran durabilidad, resistiendo los contratiempos del trabajo diario. El Ewent EW3400 es compatible con códigos de barras unidimensionales 1D. ¡Hazte con él en Neobyte!', 'Eminent- ewent', 0),
(1666, 'Honeywell Metrologic MS3580 QuantumT - Lector código de barras', 'https://www.neobyte.es/36357-large_default/lector-codigo-de-barras-metrologic-ms3580-quantumt.jpg', 202.9, 'Equipa tu negocio con el Honeywell Metrologic MS3580 QuantumT. Este lector de código de barras compacto con modo lectura omnidireccional para una lectura más rápida, hasta 1650 scans por segundo. Ha sido fabricado con materiles de gran calidad, lo que se refleja en una durabilidad extra. ¡Hazte con él en Neobyte!', 'Metrologic', 0),
(1667, 'Lector de códigos de barras Honeywell 1202G', 'https://www.neobyte.es/2858-large_default/lector-codigo-de-barras-honeywell-1202g-usb.jpg', 157.91, 'Disfruta de una libertad de movimientos total con el lector de códigos de barras Honeywell Voyager 1202G. Un dispositivo muy práctico que usa baterías de litio que proporcionan más de 12 horas de funcionamiento (dependiendo del volumen de lectura) y que son fácilmente reemplazables sin herramientas. Incorpora un sistema de detección y configuración automática y es capaz de leer códigos de barras de baja calidad.', 'Honeywell', 0),
(1668, 'Honeywell Voyager XP 1472G2D - Lector de códigos de barras Bluetooth', 'https://www.neobyte.es/40572-large_default/lector-codigo-de-barras-honeywell-1472g2d.jpg', 217.9, 'El Honeywell Voyager XP 1472G2D es un lector de códigos bidimensional (2D) que ofrece una solución de escaneo de alta precisión, capturando con facilidad los códigos de barras tradicionales y digitales, incluso los difíciles de leer o dañados. Ha sido fabricado con materiales de calidad para asegurar una durabilidad óptima y cuentan con un diseño ergonómico que hace más cómodo su uso. El Honeywell Voyager XP 1472G2D se convertirá en una herramienta de trabajo fundamental en tu negocio.', 'Honeywell', 0),
(1669, 'Approx appPOS80AM3 USB RS-232 Ethernet - Impresora de tickets', 'https://www.neobyte.es/81822-large_default/approx-apppos80am3-usb-rs-232-ethernet-impresora-de-tickets.jpg', 92.9, 'Approx APPPOS80AM USB RS-232 Ethernet - Impresora de tickets', 'Approx', 0),
(1670, 'Asus VT229H - Monitor 21,5 Full HD Táctil', 'https://www.neobyte.es/21151-large_default/asus-vt229h-monitor-215-full-hd-tactil.jpg', 236.91, 'El monitor táctil Full HD Asus VT229H es perfecto para su integración en comercios y todo tipo de negocios. Su diseño elegante da cabida a una pantalla multitáctil de 10 puntos que posee un tamaño de 21.5. Totalmente compatible con Windows 10, simplifica y agiliza el acceso a las diferentes aplicaciones y funcionalidades. Además, el Asus VT229H cuenta con una completa conectividad, altavoces incorporados y múltiples tecnologías de mejora de imagen como sistema anti-parpadeos, reducción de luz azul, VividPixel...', 'Asus', 0),
(1671, 'Epson LQ-350 - Impresora matricial', 'https://www.neobyte.es/36387-large_default/impresora-epson-lq-350-matricial.jpg', 295.91, 'Impresora matricial Epson LQ-350, un modelo ideal para aplicaciones internas y de cara al público en las que se requiera de impresiones en papel continuo o documentos de varias hojas. Provista de 24 agujas y 80 columnas, ofrece una gran fiabilidad y resulta muy económica a largo plazo. Además, gracias a su tamaño compacto y variedad de puertos su integración en el puesto de trabajo resulta muy sencilla.', 'Epson', 0),
(1672, 'Honeywell Orbit 7190 2D - Lector de códigos de barras 2D', 'https://www.neobyte.es/6886-large_default/lector-codigo-de-barras-honeywell-orbit-7190-2d.jpg', 219.91, 'Lector de códigos de barras Honeywell Orbit 7190 con tecnología 2D, lo que significa que permite escanear tanto códigos de producto como digitales desde una pantalla de smartphone, por ejemplo. Fácil de instalar, su diseño simplifica su manejo y adaptación a diferentes espacios como farmacias, taquillas y cualquier tipo de negocio.', 'Metrologic', 0),
(1673, 'ESCANER BROTHER DOCUMENTAL ADS-1200', 'https://www.neobyte.es/72190-large_default/escaner-brother-documental-ads-1200.jpg', 202.9, 'ESCANER BROTHER DOCUMENTAL ADS-1200', 'Brother', 0),
(1674, 'Epson WorkForce DS-410 - Escáner profesional automático', 'https://www.neobyte.es/19084-large_default/scanner-epson-workforce-ds-410.jpg', 324.9, 'Te presentamos el Epson WorkForce DS-410, un escáner profesional con alimentador automático y diversas tecnologías de mejora de imagen que ofrece funcionalidades para incrementar la productividad manteniendo un precio muy ajustado. Por ello, es una solución perfecta para profesionales autónomos, pequeñas oficinas o usuarios domésticos que requieran de un scanner capaz de asumir una importante carga de trabajo. Entre las tecnologías que incorpora, destacar la alimentación automática de hasta 50 hojas, el escaneado dúplex o la detección de problemas en la carga de las hojas. Así mismo, señalar que el Epson WorkForce DS-410 hace gala de un diseño compacto y resistente, así como de una velocidad de escaneo de hasta 26 ppm.', 'Epson', 0),
(1675, 'Brother ADS-4100 - Escáner documental', 'https://www.neobyte.es/74792-large_default/brother-ads-4100-escaner-documental.jpg', 269.9, 'Brother ADS-4100 - Escáner documental de sobremesa', 'Brother', 0),
(1676, 'Roseta de superficie red Cat5E(H) RJ45', 'https://www.neobyte.es/9024-large_default/roseta-de-superficie-red-cat5e-h-rj45.jpg', 3.75, 'Caja para montaje en superficie de redes CAT5e de puerto único Iggual, con módulo Keystone medio blindado CAT5e.', 'Iggual', 0),
(1677, 'DESTORNILLADOR DE TRINQUETE XIAOMI 16 EN 1', 'https://www.neobyte.es/53856-large_default/destornillador-de-trinquete-xiaomi-16-en-1.jpg', 22.91, 'Destornillador De Trinquete Xiaomi 16 En 1', 'Xiaomi', 0),
(1678, 'JUEGO DESTORNILLADORES XIAOMI MI PRECISION', 'https://www.neobyte.es/45818-large_default/juego-destornilladores-xiaomi-mi-precision.jpg', 20.9, 'Juego Destornilladores Xiaomi Mi Precision', 'Xiaomi', 0),
(1679, 'Krom Kimu Pro - Micrófono con trípode', 'https://www.neobyte.es/21246-large_default/microfono-krom-kimu-pro-tripode-negro.jpg', 36.89, 'El micrófono profesional Krom Kimu Pro es una clara apuesta por un sonido de calidad que proporcionará a tus grabaciones y retransmisiones una nitidez excelente. Su tecnología trabaja para realizar una captación localizada del audio, lo que permite ofrecer un sonido más detallado y cristalino que marcará la diferencia con tus anteriores vídeos. Además, cuenta con trípode extraíble con patas plegables y rejilla metálica para protegerlo de golpes y caídas. Pide ahora tu Krom Kimu Pro en Neobyte y recíbelo en tiempo récord.', 'Krom', 0),
(1680, 'MICROFONO OZONE GAMING REC X50', 'https://www.neobyte.es/65297-large_default/microfono-ozone-gaming-rec-x50.jpg', 49.9, 'MICROFONO OZONE GAMING REC X50', 'Ozone', 0),
(1681, 'Newskill Kaliope RGB - Micrófono para streaming', 'https://www.neobyte.es/82658-large_default/newskill-kaliope-rgb-microfono-para-streaming.jpg', 74.95, 'Newskill Kaliope RGB - Micrófono para streaming', 'Newskill', 0),
