(1683, 'Newskill Agni Professional RGB Gaming - Micrófono para streaming', 'https://www.neobyte.es/82647-large_default/newskill-agni-professional-rgb-gaming-microfono-para-streaming.jpg', 59.96, 'Newskill Agni Professional RGB Gaming - Micrófono para streaming', 'Newskill', 0),
