(1688, 'Newskill Apholos Pro RGB - Micrófono para streaming', 'https://www.neobyte.es/82651-large_default/newskill-apholos-pro-rgb-microfono-para-streaming.jpg', 99.95, 'Newskill Apholos Pro - Micrófono para streaming', 'Newskill', 0),
(1689, 'Trust Starzz - Micrófono con trípode', 'https://www.neobyte.es/26420-large_default/microfono-trust-starzz-con-tripode.jpg', 6.9, 'Micrófono de alto rendimiento Trust Starzz para PC de sobremesa y portátil. Por su gran calidad de grabación, es ideal para jugar online, chatear, hacer videollamadas, grabaciones de voz... Cuenta con botón silenciador, conector dorado de 3.5 mm y trípode para una colocación estable en el escritorio. Además, el cable extralargo de 250 cm. del Trust Starzz permite una mayor libertad de movimientos.', 'Trust', 0),
(1690, 'MICROFONO MARS GAMING MMIC', 'https://www.neobyte.es/61867-large_default/microfono-mars-gaming-mmic.jpg', 7.9, 'MICROFONO MARS GAMING MMIC', 'Mars Gaming', 0),
(1691, 'Elgato Wave 3 - Micrófono para streaming', 'https://www.neobyte.es/101267-large_default/elgato-wave-3-microfono-para-streaming.jpg', 175.9, 'Elgato Wave 3 - Micrófono para streaming', 'El Gato', 0),
