(1702, 'Rode Lavalier Go Negro - Micrófono de solapa profesional', 'https://www.neobyte.es/90822-large_default/rode-lavalier-go-negro-microfono-de-solapa-profesional.jpg', 62.9, 'Rode Lavalier Go Negro - Micrófono de solapa profesional', 'Rode', 0),
(1703, 'Maxhub BM11 para conferencias - Altavoz + Micrófono Bluetooth', 'https://www.neobyte.es/78905-large_default/maxhub-bm11-para-conferencias-altavoz-microfono-bluetooth.jpg', 98.91, 'Maxhub BM11 para conferencias - Altavoz + Micrófono Bluetooth', 'Maxhub', 0),
(1704, 'Apple Pencil (2ª gen.) - Lápiz digital', 'https://www.neobyte.es/37908-large_default/apple-pencil-2-gen-lapiz-digital.jpg', 146.89, 'Apple Pencil de 2ª generación (MU8F2ZM/A) es compatible con el iPad Pro de 11 pulgadas y el iPad Pro de 12,9 pulgadas (3.ª y 4.ª generación). Un modelo de gran precisión perfecto para dibujar, tomar notas, mandar e-mails, colorear... Su superficie táctil permite cambiar de herramienta sin tener que soltarlo y cuenta con un lado plano que se acopla magnéticamente para cargarlo y vincularlo de forma automática. ¡Cómpralo en Neobyte con todas las garantías!', 'Apple', 0),
(1705, 'Apple Lightning a USB Tipo A (1m) - Cable USB', 'https://www.neobyte.es/88310-large_default/apple-lightning-a-usb-tipo-a-1m-cable-usb.jpg', 22.91, 'Apple Lightning a USB 1m', 'Apple', 0),
(1706, 'Apple EarPods Lightning - Auriculares con micrófono', 'https://www.neobyte.es/7915-large_default/auricular-apple-earpord-lighting-con-mando-y-micro.jpg', 17.9, 'Disfruta de una comodidad y una calidad de sonido superior con los auriculares Apple EarPods con conector Lightning. Éstos incorporan un mando integrado en el cable con el que podrás subir o bajar el volumen, controlar la reproducción de música y responder llamadas. Están fabricados con materiales de calidad, incluyendo una mayor protección contra el sudor y el agua. Calidad Apple para apreciar la música al máximo.', 'Apple', 0),
(1707, 'Apple Lightning a USB Tipo C (1m) - Cable', 'https://www.neobyte.es/88323-large_default/apple-lightning-a-usb-tipo-c-1m-cable.jpg', 22.91, 'Apple Lightning a USB-C 1m', 'Apple', 0),
(1708, 'Apple MacBook Air 2020 Gris espacial - Portátil 13.3 M1 8GB 256GB SSD MacOS', 'https://www.neobyte.es/88645-large_default/apple-macbook-air-2020-gris-espacial-portatil-133-m1-8gb-256gb-ssd-macos.jpg', 1026.9, 'Apple MacBook Air 2020 Gris espacial - Portátil 13.3 M1 8GB 256GB SSD MacOS', 'Apple', 0),
(1709, 'Cable Apple Lightning a USB 2m MD819ZM/A', 'https://www.neobyte.es/14209-large_default/cable-apple-lightning-a-usb-2m-md819zm-a.jpg', 30.9, 'Cable Apple Lightning a USB de 2 metros (MD819ZM/A) con el que podrás transferir datos desde tu iPhone, iPad y iPod a tu ordenador o simplemente cargar el dispositivo.', 'Apple', 0),
(1710, 'Apple 2xUSB Tipo C (35W) - Cargador de pared', 'https://www.neobyte.es/88292-large_default/apple-2xusb-tipo-c-35w-cargador-de-pared.jpg', 58.9, 'Cargador de pared Apple Doble USB-C 35W', 'Apple', 0),
(1711, 'Adaptador Apple multipuerto de USB-C a AV digital (MUF82ZM)', 'https://www.neobyte.es/37963-large_default/adaptador-apple-usb-c-digital-multiport-muf82zm.jpg', 71.9, 'En Neobyte podrás comprar el adaptador Apple multipuerto de USB-C a AV digital (MUF82ZM) gracias al cual podrás conectar un monitor HDMI a tu Mac o iPad Pro con USB-C, además de un accesorio USB estándar y un cable USB-C para cargar un dispositivo compatible.', 'Apple', 0),
(1712, 'APPLE PUNTAS APPLE PENCIL 4 UDS MLUN2ZM/A', 'https://www.neobyte.es/37909-large_default/apple-puntas-apple-pencil-4-uds-mlun2zma.jpg', 26.9, 'Apple Puntas Apple Pencil 4 Uds Mlun2zm/a', 'Apple', 0),
(1713, 'Adaptador Apple Lightning a HDMI', 'https://www.neobyte.es/16820-large_default/adaptador-de-conector-apple-md826zm-a.jpg', 49.9, 'Con el adaptador Lightning a AV Digital podrás convertir cualquier salida Lightning en un fabuloso conector HMDI para el TV y una salida USB-C para adaptarlo a todos aquellos dispositivos que no disponen de USB-C. Un adaptador muy útil que no te puede faltar.', 'Apple', 0),
(1714, 'Adaptador Apple Lightning a Jack 3.5mm MMX62ZM/A', 'https://www.neobyte.es/16731-large_default/adaptador-lightning-apple-mmx62zm-a.jpg', 10.9, 'Adapta tus auriculares de toma jack 3.5mm con el adaptador Lightning a Jack 3.5mm. Con ello, podrás utilizar tus auriculares favoritos sin depender en exclusiva de los auriculares Apple. Una opción muy viable si ya tienes auriculares con anterioridad.', 'Apple', 0);
INSERT INTO `producto` (`id`, `nombre`, `imagen`, `precio`, `especificaciones`, `marca`, `id_categoria`) VALUES
(1715, 'Adaptador Apple USB-C a USB MJ1M2ZM/A', 'https://www.neobyte.es/16728-large_default/adaptador-apple-usb-c-a-usb-mj1m2zm-a.jpg', 23.9, '¿Cansado de tener un MacBook sin un puerto USB normal? Con el adaptador Apple USB-C a USB podrás conectar cualquier tipo de dispositivo USB convencional a un puerto USB-C, aprovechando la increible velocidad del nuevo conector USB-C. También dispones de la opción de conectarle un cable Lightning y cargar tu iPhone o iPad desde el MacBook. ¡Se te abre un nuevo mundo lleno de posibilidades!', 'Apple', 0),
(1716, 'Apple Magic Keyboard - Teclado numérico', 'https://www.neobyte.es/7919-large_default/teclado-apple-magic-keyboard-mq052y-a.jpg', 120.9, 'Estilizado y con un diseño único, el teclado Apple Magic Keyboard con teclas numéricas ha sido fabricado con componentes de primerísima calidad para garantizar una extraordinaria durabilidad y un confort inigualable a la hora de escribir. Además, al integrar batería de larga duración y vincularse por Bluetooth, su utilización resulta sumamente versátil.', 'Apple', 0),
(1717, 'CABLE APPLE CARGA APPLE WATCH 1M MX2E2ZM/A', 'https://www.neobyte.es/37983-large_default/cable-apple-carga-apple-watch-1m-mx2e2zma.jpg', 28.89, 'Cable Apple Carga Apple Watch 1m Mx2e2zm/a', 'Apple', 0),
(1718, 'Apple Smart Keyboard Folio - Teclado para iPad Pro', 'https://www.neobyte.es/37920-large_default/apple-smart-keyboard-folio-ipad-pro-1-y-2-gen.jpg', 216.9, 'Apple Smart Keyboard Folio es un teclado de tamaño estándar para iPad Pro 11. Es también una funda que protege el dispositivo y sirve como soporte. Permite ajustar el ángulo de visión. Con acoplarlo al iPad ya es suficiente para empezar a usarlo.', 'Apple', 0),
(1719, 'Cargador Apple MagSafe 2 85W', 'https://www.neobyte.es/14173-large_default/cargador-apple-magsafe-2-85w-md506z-a.jpg', 76.9, 'Apuesta por la fiabilidad del cargador Apple MagSafe 2 de 85W (MD506Z/A). Un modelo con conector magnético, que ayuda a establecer una conexión rápida y segura, prolonga la vida útil del cable y evita que el cable tiré del portátil si alguien se tropieza con él. Incluye un indicador LED para mostrar que el dispositivo se está cargando o que ha terminado de cargarse.', 'Apple', 0),
(1720, 'ADAPTADOR APPLE USB-C JACK 3.5MM MU7E2ZM/A', 'https://www.neobyte.es/37968-large_default/adaptador-apple-usb-c-jack-35mm-mu7e2zma.jpg', 9.9, 'Adaptador Apple Usb-c Jack 3.5mm Mu7e2zm/a', 'Apple', 0),
(1721, 'Apple Magic Keyboard con Touch ID (Blanco / Plata) - Teclado inalámbrico', 'https://www.neobyte.es/90220-large_default/apple-magic-keyboard-con-touch-id-blanco-plata-teclado-inalambrico.jpg', 164.9, 'Apple Magic Keyboard Negro con Touch ID para Mac M1/M2', 'Apple', 0),
(1722, 'Apple Lightning a USB Tipo C (2m) - Cable', 'https://www.neobyte.es/88332-large_default/apple-lightning-a-usb-tipo-c-2m-cable.jpg', 30.9, 'Apple Lightning a USB-C 2m', 'Apple', 0),
(1723, 'Apple Smart Keyboard Folio Ipad Pro 3 Y 4 Gen', 'https://www.neobyte.es/37925-large_default/apple-smart-keyboard-folio-ipad-pro-3-y-4-gen.jpg', 251.9, 'Apple Smart Keyboard Folio Ipad Pro 3 Y 4 Gen', 'Apple', 0),
(1724, 'Apple EarPods 3.5 mm - Auriculares', 'https://www.neobyte.es/14189-large_default/auricular-apple-earpods-con-clavija-35-mnhf2zm-a.jpg', 17.9, 'Diseñados por Apple, los auriculares EarPods con clavija de 3,5 mm se adaptan perfectamente a la fisonomía del oído para que puedas llevarlos con toda comodidad, reduciendo al mínimo la pérdida de sonido y dando como resultado un sonido excelente y detallado. Además, incluye un mando integrado en el cable con el cual ajustar el volumen, controlar la reproducción e incluso contestar llamadas.', 'Apple', 0),
(1725, 'Apple Watch carga rápida magnética (1m) - Cable USB C', 'https://www.neobyte.es/88339-large_default/apple-watch-carga-rapida-magnetica-1m-cable-usb-c.jpg', 29.9, 'Cable Apple carga mágnetica Apple Watch 1m', 'Apple', 0),
(1726, 'ADAPTADOR APPLE LIGHTNING USB 3.0 CAMERA MK0W2ZM/A', 'https://www.neobyte.es/41755-large_default/adaptador-apple-lightning-usb-30-camera-mk0w2zma.jpg', 53.91, 'Adaptador Apple Lightning Usb 3.0 Camera Mk0w2zm/a', 'Apple', 0),
(1727, 'Adaptador Apple Lightning a lector tarjetas SD', 'https://www.neobyte.es/16710-large_default/adaptador-apple-lightning-a-lector-tarjetas-sd.jpg', 42.89, 'Transfiere tus imágenes y videos de tu tarjeta SD con el adaptador Apple Lightning a memorias SD. Con él, podrás transferir fácilmente las imágenes de tu cámara de fotografías al momento, así poder verlas al momento en una calidad espectacular con la pantalla retina de tu dispositivo. Además, es compatible con una gran cantidad de formatos diferentes de imagen y vídeo, pudiendo traspasar los datos hasta velocidades de USB 3.0.', 'Apple', 0),
(1728, 'Apple Magic Keyboard con Touch ID (Blanco) - Teclado inalámbrico compacto', 'https://www.neobyte.es/88347-large_default/apple-magic-keyboard-con-touch-id-blanco-teclado-inalambrico-compacto.jpg', 141.9, 'Apple Magic Keyboard con Touch ID', 'Apple', 0),
(1729, 'Adaptador Apple USB-C a VGA multipuerto MJ1L2ZM/A', 'https://www.neobyte.es/14202-large_default/adaptador-apple-usb-c-a-vga-multiport-mj1l2zm-a.jpg', 71.9, 'Adaptador Apple de USB-C a VGA/USB/USB-C. Conecta tu viejo monitor a tu MacBook con este práctico complemento y aprovecha la impresionante velocidad del USB-C o el Thunderbolt 3.', 'Apple', 0),
(1730, 'Apple Magic Keyboard (2021) - Teclado inalámbrico compacto', 'https://www.neobyte.es/106181-large_default/apple-magic-keyboard-2021-teclado-inalambrico-compacto.jpg', 97.9, 'Apple Magic Keyboard 2021', 'Apple', 0),
(1731, 'Approx APPUAAPT - Cargador Macbook tipo T', 'https://www.neobyte.es/18038-large_default/cargador-approx-appuaapt-mcbook-typ-t.jpg', 34.9, 'Cargador para Macbook con conector tipo T Approx APPUAAPT. Cuenta con botón de selección de potencia, sistema de protección contra sobrecargas, cortocircuitos y temperatura, así como con luz LED azul, que indica la potencia seleccionada, puerto USB para cargar tu smartphone o tablet y conector europeo.', 'Approx', 0),
(1732, 'Apple USB Tipo C (140W) - Cargador para MacBook Pro', 'https://www.neobyte.es/88298-large_default/apple-usb-tipo-c-140w-cargador-para-macbook-pro.jpg', 90.9, 'Cargador Apple USB-C 140W para MacBook Pro', 'Apple', 0),
(1733, 'Cargador Apple MagSafe 2 45W', 'https://www.neobyte.es/14169-large_default/cargador-apple-magsafe-2-45w-md592z-a.jpg', 76.9, 'El cargador original Apple MagSafe 2 de 45W (MD592Z/A) para MacBook Air ha sido provisto de un conector magnético que elimina la posibilidad de que alguien tropiece con el cable y tire el ordenador, a la vez que favorece una conexión rápida y segura y prolonga la vida útil del cable. Incluye, además, un indicador LED que muestra si el portátil se está cargando o si se ha terminado de cargar.', 'Apple', 0),
(1734, 'Apple Superdrive - Grabadora USB', 'https://www.neobyte.es/14152-large_default/apple-usb-superdrive-md564zm-a.jpg', 82.9, 'La grabadora USB Apple SuperDrive (MD564ZM/A) te permitirá reproducir tus CD’s y DVD’s conectándola a tu iMac de una forma fácil. Un modelo que presenta un diseño elegante y compacto, un bajo consumo (por lo que no utiliza cargador externo) y, en Neobyte, un precio fantástico.', 'Apple', 0),
