(1759, 'AOC U32E2N - Monitor 32 UHD', 'https://www.neobyte.es/76724-large_default/aoc-u32e2n-monitor-32-uhd.jpg', 347.9, 'El AOC U32E2N es un monitor para uso profesional y doméstico equipado con un panel VA de 31,5 mm con el que disfrutarás de imágenes detalladas y nítidas. Cuenta con un elegante diseño sin marco en tres de los lados, lo que permite configuraciones integrales de varios monitores, y con altavoces integrados para vivir un audio inmersivo sin necesidad de auriculares. Además, incluye tecnología dirigida a reducir los efectos de la luz azul y permitir así un uso más cómodo y seguro. ¡Cómpralo ya en Neobyte!', 'AOC', 0),
