(1766, 'AOC Agon AG493UCX2 - Monitor curvo 49 DQHD FreeSync 165Hz', 'https://www.neobyte.es/76733-large_default/aoc-agon-ag493ucx2-monitor-curvo-49-dqhd-freesync-165hz.jpg', 1094.9, 'El monitor ultra panorámico de 49 AOC Agon AG493UCX2 hará que vibres en cada partida. Gracias a su pantalla curva con formato 32:9 podrás sumergirte de lleno en la acción de los juegos, disfrutando además de una calidad de imagen espectacular y gran fluidez. Un modelo provisto de una tasa de refresco de 165 Hz, tiempo de respuesta de 1ms y resolución DQHD, además de diversas funcionalidades gaming que mejorarán la experiencia de juego. ¡Sube de nivel con el AOC Agon AG493UCX2!', 'AOC', 0),
(1767, 'AOC U27P2 - Monitor 27 IPS UHD', 'https://www.neobyte.es/77357-large_default/aoc-u27p2-monitor-27-ips-uhd.jpg', 295.91, 'AOC U27P2 - Monitor 27 IPS UHD', 'AOC', 0),
(1768, 'Asus TUF Gaming VG27AQA1A - Monitor gaming 27 2K QHD FreeSync', 'https://www.neobyte.es/87643-large_default/asus-tuf-gaming-vg27aqa1a-monitor-gaming-27-2k-qhd-freesync.jpg', 239, 'El monitor de gaming ASUS TUF Gaming VG27AQA1A ofrece una experiencia inmersiva con su pantalla de 27 WQHD (2560x1440) y frecuencia de actualización overclockeada a 170 Hz. Con un tiempo de respuesta de 1 ms (MPRT) y tecnología ASUS Extreme Low Motion Blur, proporciona un juego fluido y sin desenfoques. Equipado con FreeSync Premium™ para una experiencia libre de tearing, HDR para colores vibrantes y alto contraste, y características como Shadow Boost, el VG27AQA1A es ideal para gamers profesionales. Además, su versatilidad se destaca con ASUS DisplayWidget Lite para ajustes rápidos y una variedad de opciones de conectividad, incluyendo HDMI y DisplayPort. Un monitor potente para una experiencia de gaming excepcional.', 'Asus', 0),
(1769, 'Asus VG289Q - Monitor 28 4K IPS', 'https://www.neobyte.es/31039-large_default/monitor-asus-28-vg289q.jpg', 289, 'Te presentamos el Asus VG289Q TUF Gaming, un monitor gaming 4K de 28 para los que quieren disfrutar de la máxima reslución. Esta pantalla IPS es compatible con el 90% del espacio de color DCI-P3 y cuenta con la tecnología HDR, lo que significa una mayor fidelidad de las imágenes y una riqueza cromática excepcional. Además, el Asus VG289Q TUF Gaming está provisto de FreeSync, un sistema que ayuda a una reproducción suave de las escenas en movimiento, reduciendo así los entrecortes y los problemas de sincronización de FPS. En último lugar, señalar que cuenta con una completa conectividad y está provisto de altavoces.', 'Asus', 0),
(1770, 'Asus XG32VC - Monitor curvo 32 WQHD 170Hz 1ms', 'https://www.neobyte.es/39506-large_default/monitor-asus-32-xg32vc-wqhd-170hz.jpg', 448.99, 'Si estás buscando un monitor curvo que te sumerja en la acción de los juegos, el Asus XG32VC ROG Strix no te defraudará. Un modelo de 32 pulgadas con resolución WQHD en el que las imágenes se muestran detalladas, definidas y realistas. Su tasa de refresco de 170Hz y la tecnología Extreme Low Motion Blur, que alcanza un tiempo de respuesta de 1ms, eliminan el desenfoque de movimiento y ofrece objetos más nítidos y una experiencia gaming más fluida. Cuenta con tecnologías AMD FreeSync Premium Pro, HDR y mejoras in-game para adelantarte a tus rivales. El Asus XG32VC ROG Strix, además, dispone de hub USB-C para que puedas conectar otros dispositivos o cargar tu teléfono móvil compatible.', 'Asus', 0),
(1771, 'Asus XG438QR - Monitor 43 UHD 4K 120Hz', 'https://www.neobyte.es/43006-large_default/monitor-43-asus-rog-strix-xg438qr-uhd-4k-120hz.jpg', 899.01, 'Monitor de gran pulgada Asus XG438QR ROG Strix, con resolución UHD 4K y una tasa de refresco de 120Hz, ideal para disfrutar de tus juegos a lo grande. Este modelo ofrece una combinación perfecta de calidad de imagen, nivel de detalle, velocidad y calidad de fabricación. Entre sus principales ventajas, destacar las 43 de su panel y las tecnologías DisplayHDR 600 y DCI-P3 90% que aseguran colores y contrastes más realistas. Además, el Asus XG438QR ROG Strix incorpora FreeSync Premium Pro para una acción más suave. Por último, indicar que incluye potentes altavoces, multitud de puertos e iluminación Aura Sync.', 'Asus', 0),
(1772, 'Asus VG289Q1A - Monitor 28 IPS UHD 4K FreeSync', 'https://www.neobyte.es/43016-large_default/asus-vg289q1a-monitor-28-ips-uhd-4k-freesync.jpg', 249.01, 'Te presentamos el Asus VG289Q1A TUF Gaming, un monitor IPS de 28 con resolución UHD 4K que te asombrará por su increíble calidad de imagen. Compatible con HDR 10 de alto rango dinámico, cuenta con una saturación de color DCI-P3 del 90%, lo que garantiza una mejor reproducción del color y un contraste sumamnete fiel a la realidad. Además, incorpora diferentes funcionalidades enfocadas a juegos, como Shadow Boost, Ultra-Low Blue Light, Gameplus y FreeSync. En útlimo lugar, indicar que el Asus VG289Q1A TUF Gaming integra altavoces y una completa conectividad.', 'Asus', 0),
(1773, 'Asus VG24VQE - Monitor curvo 24 Full HD 165Hz', 'https://www.neobyte.es/43166-large_default/asus-vg24vqe-monitor-curvo-24-full-hd-165hz.jpg', 179, 'Vive la máxima inmersión con el Asus VG24VQE TUF Gaming, un monitor curvo concebido para exprimir las posibilidades de tus juegos más trepidantes. El panel curvo de 23.6 cuenta con la resolución Full HD y 165Hz de tasa de refresco. Estas especificaciones, junto a las tecnologías ELMB y FreeSync Premium, permiten disfrutar de imágenes de primera calidad con transiciones suaves y sumamente precisas. Ademas, el Asus VG24VQE TUF Gaming Shadow Boost te ayudará a localizar a los enemigos y lograr la ventaja competitiva que necesitas. ¡Ya en Neobyte!', 'Asus', 0),
(1774, 'Asus VG32VQ1BR - Monitor curvo 32 WQHD 165HZ', 'https://www.neobyte.es/44284-large_default/monitor-asus-32-vg32vq1br-wqhd-165hz.jpg', 269, 'Sumérgete de lleno en los juegos con el Asus VG32VQ1BR TUF Gaming, el monitor con pantalla curva de 31,5 pulgadas diseñado para garantizarte una experiencia de juego única. Para hacer frente a tales afirmaciones viene provisto de un tiempo de respuesta de 1ms, frecuencia de actualización de 165Hz y tecnología FreeSync Premium, que te permitirán disfrutar de partidas fluidas sin cortes ni interrupciones. En cuanto a calidad de imagen, podrás deleitarte con escenas en QHD compatibles con HDR-10, para un contraste y brillo inigualable. El Asus VG32VQ1BR TUF Gaming también cuenta con múltiples opciones de conectividad y altavoces integrados, que harán tu experiencia gaming mucho más inmersiva.', 'Asus', 0),
(1775, 'Asus TUF Gaming VG24VQR - Monitor curvo 24 Full HD 165 Hz', 'https://www.neobyte.es/46041-large_default/monitor-curvo-24-asus-tuf-gaming-vg24vqr.jpg', 205.91, 'Asus TUF Gaming VG24VQR es un monitor curvo Full HD provisto de una ultrarrápida tasa de refresco de 165Hz, lo que lo convierte en un modelo perfecto para gamers profesionales y jugadores que busquen la máxima inmersión en los juegos. Disfruta de una experiencia gaming más fluida gracias a tecnologías como Adaptive-Sync (FreeSync Premium™) y Extrem Low Motion Blur, que elimina la distorsión de las escenas de acción más rápidas. Hazte ya con el Asus TUF Gaming VG24VQR en Neobyte al precio más competitivo.', 'Asus', 0),
(1776, 'Asus XG349C - Monitor curvo 34 UWQHD 180Hz IPS G-Sync', 'https://www.neobyte.es/50069-large_default/asus-xg349c-monitor-curvo-34-uwqhd-180hz-ips-g-sync.jpg', 899.01, 'Toma la curva hacia la victoria con el Asus XG349C ROG Strix, un monitor gaming que te permitirá vivir una experiencia ultrapanorámica inigualable. Provisto de panel IPS de 34 y resolución WQHD, produce imágenes repletas de vida y sumamente detalladas. Así mismo, los 180Hz de tasa de refresco (OC) y la compatibilidad con Nvidia G-Sync aseguran una acción fluida y precisa, lo que te otorgará una ventaja competitiva. El Asus XG349C ROG Strix cuenta además con potentes altavoces integrados, certificación DisplayHDR 400 y la conectividad más variada, incluyendo USB-C.', 'Asus', 0),
(1777, 'Asus ROG Strix XG32UQ - Monitor gaming 32 IPS 4K UHD 160Hz', 'https://www.neobyte.es/78869-large_default/asus-rog-strix-xg32uq-monitor-gaming-32-ips-4k-uhd-160hz.jpg', 899.01, 'La experiencia gaming más asombrosa está al alcance de tu mano con el Asus ROG Strix XG32UQ. Este monitor gaming profesional con panel IPS de 32 pulgadas ha sido diseñado para sumergirte en la acción más trepidante sin renunciar a unos gráficas espectaculares y a una definición única. Disfruta de una fluidez fuera de lo común gracias a la frecuencia de actualización de 160 Hz (OC) y al tiempo de respuesta de de 1 ms, consiguiendo imágenes sin desenfoque de movimiento ni manchas que aumentan el realismo y mejoran la jugabilidad. ¡Cómpralo ya en la tienda online de Neobyte!', 'Asus', 0),
(1778, 'Asus VZ239HE-W - Monitor 23 Full HD IPS', 'https://www.neobyte.es/20270-large_default/monitor-asus-23-led-vz239he-w-full-hd-hdmi-vga.jpg', 97.9, 'A su diseño ultrafino sin marco, el Asus VZ239HE-W añade unas características de imagen realmente exquisitas. Cuenta con un panel IPS de alto rendimiento capaz de reproducir una relación de contraste de 80 000 000:1, manteniendo los colores naturales en ángulos de visión de 178º y ofreciendo una imagen más realista. Un modelo que protege tu vista ya que incorpora tecnologías como el filtro de luz azul o FlickerFree, que reduce el parpadeo de la imagen para mitigar la fatiga ocular. Trabaja y juega de forma más cómoda con el monitor Asus VZ239HE-W.', 'Asus', 0),
(1779, 'Asus VZ239HE - Monitor 23 Full HD', 'https://www.neobyte.es/17685-large_default/monitor-asus-23-led-vz239he-full-hd-hdmi-vga.jpg', 99.9, 'El Asus VZ239HE ha sido diseñado a partir de un marco exquisitamente fino, con un perfil de solo 7 mm, que ahorra espacio a la vez que te sumerge por completo en el contenido y lo hace perfecto para configuraciones de varias pantallas. Un monitor que ha pensado en todo, también en la salud de tus ojos. El Asus VZ239HE incluye tecnología Asus Eye care, ¿que qué es esto? Pues una tecnología que reduce los efectos perjudiciales de la luz azul (con 4 niveles de filtro) y el parpadeo de la pantalla, para que disfrutes de exposición más cómoda. Por último, mencionar que hablamos de un modelo con resolución Full HD, con panel IPS, que ofrece una calidad de imagen impresionante para que todo lo que veas esté bien definido y realista.', 'Asus', 0),
(1780, 'Asus VY249HGE - Monitor 24 Full HD FreeSync Premium', 'https://www.neobyte.es/93449-large_default/asus-vy249hge-monitor-24-full-hd-freesync-premium.jpg', 147.9, 'MONITOR ASUS VY249HGE', 'Asus', 0),
