(1787, 'Asus Eye Care VY279HE-W - Monitor 27 IPS Full HD 75Hz', 'https://www.neobyte.es/65627-large_default/asus-eye-care-vy279he-w-monitor-27-ips-full-hd-75hz.jpg', 172.9, 'El Asus Eye Care VY279HE-W ha sido diseñado para poner especial cuidado en tu salud ocular y en tu bienestar. Hablamos de un monitor de 27 muy versátil, capaz de transmitir las mejores imágenes tanto si estás trabajando, estudiando, viendo películas o jugando. Su punto fuerte radica en la incorporación de diversas tecnologías dedicadas al cuidado de tus ojos, en las que se encuentran los modos Flicker-free y Low Blue Light para la disminución de la fatiga ocular o la innovadora Eye Care plus. Asimismo, este periférico cuenta con compatibilidad AMD FreeSync y 75Hz de tasa de refresco para que puedas disfrutar con todas las garantías de tus ratos de entretenimiento.', 'Asus', 0),
