(1789, 'Asus TUF Gaming VG27VQM - Monitor 27 Full HD 240Hz 1ms', 'https://www.neobyte.es/75955-large_default/asus-tuf-gaming-vg27vqm-monitor-27-full-hd-240hz-1ms.jpg', 254.9, 'Prepárate para la acción más inmersiva con el Asus TUF Gaming VG27VQM, un monitor curvo con pantalla de 27 pulgadas que completará perfectamente tu PC. Gracias a la tasa de refresco de 240 Hz y al tiempo de respuesta de 1ms disfrutarás de una fluidez excelente, eliminando el desenfoque de las escenas rápidas para brindarte la mejor experiencia de juego en carreras, shooters, deportes y juegos de estrategia en tiempo real. Además, incluye varias funcionalidades gaming que te permitirán potenciar las posibilidades de los juegos. ¡Cómpralo ya en Neobyte!', 'Asus', 0),
(1790, 'Asus VA24DQF - Monitor 23.8 IPS Full HD 100Hz', 'https://www.neobyte.es/103113-large_default/asus-va24dqf-monitor-238-ips-full-hd-100hz.jpg', 112.91, 'MONITOR ASUS VA24DQF', 'Asus', 0),
(1791, 'Asus VA24DCP - Monitor 24 Full HD IPS', 'https://www.neobyte.es/51716-large_default/monitor-24-asus-va24dcp.jpg', 136.9, 'El Asus VA24DCP viene equipado con un panel IPS de 24” que harán que puedas visualizar el contenido a una resolución Full HD y desde cualquier ángulo sin perder nitidez. Diseñado tanto para dar soporte a tus funciones laborales como para que disfrutes de tu tiempo de ocio, este monitor cuenta con compatibilidad AMD FreeSync, múltiples opciones de conectividad con puertos USB-C y HDMI para conexiones cómodas y rápidas y tecnologías para el cuidado ocular como el modo Low blue o sin parpadeos. Disfruta de una calidad de imagen excelente con el Asus VA24DCP, un monitor económico con una relación calidad-precio increíble.', 'Asus', 0),
(1792, 'Asus VA24EQSB - Monitor 23.8 Full HD IPS', 'https://www.neobyte.es/70935-large_default/asus-va24eqsb-monitor-238-full-hd-ips.jpg', 153.9, 'Asus VA24EQSB - Monitor 23.8 Full HD IPS', 'Asus', 0),
(1793, 'Asus VG27AQ - Monitor 27 WQHD IPS 165 Hz', 'https://www.neobyte.es/24595-large_default/asus-vg27aq-monitor-27-wqhd-ips-165-hz.jpg', 299.9, 'El Asus VG27AQ se encuadra dentro de la gama TUF Gaming, una serie de productos sometidos a infinidad de pruebas para mejorar la estabilidad, fiabilidad y durabilidad del producto. Cuenta con resolución WQHD, lo que garantiza una calidad de imagen impresionante, panel IPS para disfrutar de colores más naturales desde todos los ángulos, y tasa de refresco de 165 Hz, para vivir tus juegos de la manera más fluida. Además, has sido provisto de un buen puñado de prestaciones gaming que te ayudarán a tener una ventaja competitiva frente a tus adversarios. El Asus VG27AQ TUF Gaming es el monitor gamer de 27 pulgadas que estabas buscando.', 'Asus', 0),
(1794, 'Asus VA24DQSB - Monitor 23,8 IPS Full HD', 'https://www.neobyte.es/60390-large_default/asus-va24dqsb-monitor-238-ips-full-hd-.jpg', 153.9, 'El Asus VA24DQSB combina calidad de imagen con un estilo moderno y elegante. Este monitor de 23.8 presenta un diseño sin marco para una configuración óptima con otras pantallas, así como panel IPS con resolución Full HD para una experiencia de visualización única y una representación de color realista.  Entre sus otras características también encontramos que incluye tecnología Flicker Free para evitar la fatiga ocular, diferentes opciones de conectividad y altavoces integrados. Disfruta de tu contenido favorito con el Asus VA24DQSB.', 'Asus', 0),
(1795, 'Asus MB165B Zenscreen - Monitor portátil 15.6 HD', 'https://www.neobyte.es/60520-large_default/asus-mb165b-zenscreen-monitor-portatil-156-hd.jpg', 127.9, 'El Asus MB165B Zenscreen destaca por ser ligero y versátil. Con un peso de 0,78Kg se convierte en el monitor portátil perfecto para transportar en cualquier mochila y ser productivo allí donde estés. Su pantalla de 15.6 alcanza una resolución HD y puede detectar de forma automática su orientación, por lo que podrás visualizar un contenido de calidad siempre de la forma más confortable. Pero lo que realmente sorprende de este dispositivo es su capacidad por conectar una gran variedad de dispositivos a través de su cable USB. Para mayor comodidad, El Asus MB165B Zenscreen cuenta con funda plegable y un trípode integrado.', 'Asus', 0),
(1796, 'Asus TUF Gaming VG249QM1A - Monitor gaming 23.8 IPS Full HD 270Hz FreeSync', 'https://www.neobyte.es/78811-large_default/asus-tuf-gaming-vg249qm1a-monitor-gaming-238-ips-full-hd-270hz-freesync.jpg', 227.9, 'Asus TUF Gaming VG249QM1A - Monitor 23.8 IPS Full HD 270Hz FreeSync', 'Asus', 0),
(1797, 'Asus TUF VG279Q1R - Monitor 27 Full HD 144 Hz', 'https://www.neobyte.es/34753-large_default/monitor-27-asus-vg279q1r.jpg', 181.9, 'Diseñado para gamers profesionales y entusiastas del rendimiento, el Asus TUF Gaming VG279Q1R garantiza una respuesta rápida e imágenes definidas para sumergirte de lleno en las partidas. Un monitor de 27 con resolución Full HD, tecnología FreeSync y tasa de refresco de 144 Hz que ofrece la jugabilida más fluida, sin imágenes entrecortadas ni tirones. Disfruta del espacio de visualización más amplio proporcionado por su diseño de marcos ultrafinos y de prácticas mejoras in-game con las que sobresaldrás sobre tus rivales. El Asus TUF Gaming VG279Q1R marcará la diferencia con tu anterior monitor.', 'Asus', 0),
(1798, 'Asus Business Docking VA24ECPSN - Monitor 23.8 IPS Full HD', 'https://www.neobyte.es/78804-large_default/asus-business-docking-va24ecpsn-monitor-238-ips-full-hd.jpg', 171.9, 'Asus Business Docking VA24ECPSN - Monitor 23.8 IPS Full HD', 'Asus', 0),
(1799, 'Asus ProArt PA278QV - Monitor 27 IPS WQHD', 'https://www.neobyte.es/34733-large_default/monitor-27-asus-pa278qv.jpg', 272.9, 'El Asus ProArt Display PA278QV ha sido diseñado para satisfacer las necesidades de profesionales de la fotografía, la edición de vídeo y el diseño gráfico. Un modelo con panel IPS de 27 calibrado de fábrica y con verificación Calman que ofrece una impresionante precisión de color. Cuenta con características exclusivas de Asus, como ProArt Preset y ProArt Palette, así como ajustes del nivel de negros y brillo, que facilitan conseguir el resultado deseado de forma rápida, sencila y precisa. Además, dispone de una rica conectividad, incluyendo puertos HDMI, DisplayPort, mini DisplayPort, DVI-D y un hub USB integrado, y tecnología Ultra-Low Blue Light, que protege tus ojos de los efectos perjudiciales de una exposición prolongada. Haz del Asus ProArt Display PA278QV tu mejor herramienta de trabajo.', 'Asus', 0),
(1800, 'BenQ GW2780E - Monitor 27 IPS Full HD', 'https://www.neobyte.es/81397-large_default/benq-gw2780e-monitor-27-ips-full-hd.jpg', 129.99, 'MONITOR BENQ GW2780E 27 FHD', 'Benq', 0),
(1801, 'BenQ GW2475H - Monitor 23.8 Full HD IPS', 'https://www.neobyte.es/36876-large_default/benq-gw2475h-238-full-hd-ips.jpg', 99.99, '¿Buscas un monitor económico y funcional para tu día a día? El BenQ GW2475H es un modelo de diseño minimalista que se adaptará a cualquier espacio, priorizando una experiencia de visualización más cómoda y una mayor protección para tus ojos. La calidad de imagen es también uno de sus puntos fuertes ya que ha sido equipado con panel IPS con resolución Full HD, lo que asegura gran definición y precisión de color desde cualquier ángulo. La tecnología de reducción de luz azul ha sido diseñada para filtrarla de forma efectiva, haciendo que disminuya la fatiga ocular y la irritación. El BenQ GW2475H es un monitor de 24 sencillo para trabajar y disfrutar de tu tiempo de entretenimiento.', 'Benq', 0),
(1802, 'BenQ GW2480 - Monitor 24 Full HD IPS', 'https://www.neobyte.es/21356-large_default/monitor-benq-24-gw2480.jpg', 129.99, 'El BenQ GW2480 te enamorará por su diseño elegante y te convencerá al descubrir sus prestaciones. Este monitor de 23.8 combina biseles ultradelgados con una gestión de cables oculta para ofrecer una estética sobria y sofisticada. A su vez, ha primado el cuidado de la salud ocular de los usuarios, incorporando tecnologías como el sistema de baja luz azul, el funcionamiento sin parpadeos o el brillo inteligente, destinadas a combatir la fatiga ocular y a minimizar los efectos de una exposición prolongada, algo que redundará en una mayor productividad y una comodidad óptima a la hora de trabajar. En esta misma línea encontramos su apuesta por una excelente calidad de imagen, la cual radica en su panel IPS. Colores más reales e intensos desde diferentes ángulos, optimización de los contenidos, cuidado de los detalles, etc. Con el BenQ GW2480 obtendrás todo lo que necesitas en un monitor al precio más competitivo.', 'Benq', 0),
(1803, 'BenQ PD3205U - Monitor 32 IPS UHD 4K', 'https://www.neobyte.es/68718-large_default/benq-pd3205u-monitor-32-ips-uhd-4k-.jpg', 599.99, 'Con el BenQ PD3205U obtendrás un nivel superior de profesionalidad. Diseñado para que puedas exprimir al máximo tu talento, este monitor de 32 pulgadas cuenta con una precisión de color increíble y la posibilidad de alternar entre diferentes modos que permiten adaptar la gama cromática al tipo de trabajo que realices, ya sea animación, fotografía, dibujo técnico... Además, su panel IPS es capaz de alcanzar una resolución UHD 4K y viene equipado con tecnología HDR10 para un contraste único, así como tecnología Flicker Free para no sentir fatiga ocular durante tus largas jornadas. El BenQ PD3205U va a convertirse en un imprescindible en tu día a día.', 'Benq', 0),
(1804, 'Benq PD2705U - Monitor 27 IPS 4K UHD', 'https://www.neobyte.es/65549-large_default/benq-pd2705u-monitor-27-ips-4k-uhd.jpg', 399.99, 'Los profesionales del diseño, la ilustración, la fotografía o la animación encontrarán en el Benq PD2705U la herramienta perfecta para trabajar. Este monitor de 27 pulgadas ha sido dotado de tecnología de primer nivel que permite mostrar colores precisos e imágenes detalladas, obteniendo los resultados deseados en todo tipo de tareas. Dispone también de diferentes modos de trabajo para optimizar el flujo de trabajo y aumentar la productividad en función de las aplicaciones empleadas, así como diferentes tecnologías concebidas para el cuidado ocular. Apuesta por el Benq PD2705U en la tienda online de Neobyte.', 'Benq', 0),
