(1807, 'BenQ SW240 Photo Value - Monitor 24 Full HD IPS', 'https://www.neobyte.es/26759-large_default/benq-sw240-photo-value-monitor-24-full-hd-ips.jpg', 499.98, 'El Benq SW240 Photo Value es un monitor de 24 pulgadas dirigido a aficionados y profesionales de la fotografía que abarca 99% de espacio de color Adobe RGB y con el que disfrutarás de los auténticos colores de la naturaleza. Cuenta con pantalla en formato 16:00 y resolución 1920 x 1200, un espacio extra que permite visualizar dos documentos A4 en paralelo y facilita la comparativa de imágenes de un solo vistazo. Además, gracias al acceso rápido al modo de color, es posible cambiar rápidamente entre los 3 modos preestablecidos, o elegir entre diferentes valores de blanco y negro con el modo Blanco y Negro. Tu mejor herramienta para trabajar fotografías es el Benq SW240 Photo Value.', 'Benq', 0),
