(1814, 'BenQ EW2880U - Monitor 28 IPS UltraHD 4K', 'https://www.neobyte.es/60415-large_default/benq-ew2880u-monitor-28-ips-ultrahd-4k.jpg', 382, 'El BenQ EW2880U destaca por ser un monitor de 28 con tecnología IPS capaz de alcanzar una resolución Ultra HD 4K, con lo que es capaz de transmitir imágenes llenas de colores realistas y de ofrecer un gran equilibrio entre brillos y contrastes. Con este periférico podrás trabajar, jugar o ver series de forma prolongada y sin preocuparte por síntomas como la fatiga ocular gracias a su tecnología Flicker Free. Además, incorpora útiles prestaciones como altavoces y conexiones HDMI, USB-C y compatibilidad AMD FreeSync. ¡No pierdas la oportunidad de descubrir el BenQ EW2880U al completo en Neobyte!', 'Benq', 0),
(1815, 'BenQ Mobiuz EX480UZ - Monitor 48 OLED UHD 4K 120Hz', 'https://www.neobyte.es/87003-large_default/benq-mobiuz-ex480uz-monitor-48-oled-uhd-4k-120hz.jpg', 1799, 'El BenQ Mobiuz EX480UZ es mucho más que un monitor, es un portal a una nueva dimensión de juego. Con su tecnología de vanguardia, su diseño elegante y su facilidad de uso, este monitor te ofrece una experiencia de juego sin precedentes que te dejará sin aliento.', 'Benq', 0),
(1816, 'BenQ EW3880R - Monitor curvo 38 IPS WQHD+', 'https://www.neobyte.es/55674-large_default/benq-ew3880r-monitor-curvo-38-ips-wqhd.jpg', 899.99, 'El BenQ EW3880R es un monitor de 38 diseñado específicamente para un rendimiento óptimo en los juegos. Dispone de un panel curvo IPS con resolución WQHD+ para una experiencia envolvente, y sus altavoces con sonido TreVolo proporcionarán el toque definitivo para que te sumerjas de lleno en la acción y disfrutes de tus sesiones de jugo al máximo. En cuanto a sus otras especificaciones, cuenta con un diseño ergonómico que permite modificar la posición de la pantalla y acomodarla a cada situación y también dispone de diferentes opciones de conexión con puertos USB-C, HDMI y Dipslay Port para que puedas conectar diversos dispositivos o periféricos. ¡Hazte con el BenQ EW3880R y completa tu equipo!', 'Benq', 0),
(1817, 'BenQ GL2480 - Monitor 24 Full HD 75 Hz 1ms', 'https://www.neobyte.es/26904-large_default/monitor-benq-24-gl2480.jpg', 149.89, 'Si estás pensando en comprar un monitor gaming el BenQ GL2480 tiene mucho que ofrecerte. Un modelo concebido para ofrecer una experiencia de juego excelente y que ha sido provisto de un panel TN de 24 pulgadas con resolución Full HD, un tiempo de respuesta de 1ms y una tasa de refresco de 75 Hz. Cuenta a su vez con tecnologías dirigidas al cuidado de la salud ocular, como el filtro de luz azul o la tecnología Flicker-Free, que reducen significativamente la fatiga ocular después de largas horas de exposición. No podemos pasar por alto su elegante diseño, que encajará a la perfección en cualquier ambiente, ni las diferentes opciones de conectividad que presenta, como los puertos HDMI, DVI y VGA. Apuesta por el BenQ GL2480 en Neobyte y saldrás ganando.', 'Benq', 0),
(1818, 'Corsair Xeneon 32UHD144-A - Monitor 32 IPS UHD 4K 144Hz', 'https://www.neobyte.es/98796-large_default/corsair-xeneon-32uhd144-a-monitor-32-ips-uhd-4k-144hz.jpg', 998.89, 'El Corsair Xeneon 32UHD144-A no es solo un monitor para jugar. Con su tecnología HDR, precisión de color y rendimiento excepcional, este monitor es ideal para todo tipo de tareas, desde ver películas hasta realizar trabajos de producción profesional. Sin duda, la mejor opción para los gamers y profesionales que buscan una experiencia visual inmersiva, fluida y con colores vibrantes. Con su diseño elegante, tecnología de vanguardia y funciones personalizables, este monitor te permite disfrutar al máximo de todo lo que haces.', 'Corsair', 0),
(1819, 'Gigabyte M28U - Monitor 28 UHD 144HZ SS IPS', 'https://www.neobyte.es/48591-large_default/monitor-28-gigabyte-m28u-ss-ips-144hz.jpg', 538.99, 'El Gigabyte M28U llega a Neobyte para completar tu setup gaming. Este monitor con panel SS IPS (Super Speed IPS) de 28 cuenta con resolución nativa UHD 4K (3840x2160 px) y una tasa de refresco de 144 Hz, lo que se traduce en una jugabilidad más fluida, imágenes detalladas y una inmersión total en los contenidos. También cuenta con tecnología Flicker-Free para hacer más cómoda la experiencia de visuallización y evitar la vista cansada, modo KVM para controlar dos equipos diferentes con los mismos periféricos y altavoces de 3W de potencia cada uno. Compra el Gigabyte M28U en Neobyte con todas las garantías.', 'Gigabyte', 0),
(1820, 'Gigabyte M28U Arm Edition - Monitor 28 UHD 144Hz SS IPS', 'https://www.neobyte.es/81595-large_default/gigabyte-m28u-arm-edition-monitor-28-uhd-144hz-ss-ips.jpg', 559, 'Gigabyte M28U AE - Monitor 28 4K UHD 144Hz', 'Gigabyte', 0),
(1821, 'Gigabyte G27F 2 - Monitor 27 IPS Full HD FreeSync 170Hz', 'https://www.neobyte.es/76410-large_default/gigabyte-g27f-2-monitor-27-ips-fullhd-freesync-170hz.jpg', 219, 'El Gigabyte G27F 2 es justo lo que necesitas para completar tu setup gaming. Desarrollado teniendo en mente las necesidades de los jugadores más exigentes, cuenta con lo último en rendimiento y lo ofrece sin necesidad de extravagancias. Entre sus características principales, destacar el fantástico panel IPS de 27 pulgadas con resolución Full HD y una tasa de refresco de hasta 170Hz. Esta combinación perfecta entre velocidad, ángulo de visión y calidad de imagen es una apuesta segura. Pero esto no es todo, pues también es compatible con la tecnología AMD FreeSync y cuenta con diferentes funcionalidades especialmente pensados para jugar (OSD, Black Equalizer, Dashboard...). A esto hay que añadir una completa conectividad y varias alternativas de ajuste.', 'Gigabyte', 0),
(1822, 'Gigabyte M27Q-EK rev. 2.0 - Monitor 27 QHD IPS 165Hz', 'https://www.neobyte.es/98508-large_default/gigabyte-m27q-ek-rev-20-monitor-27-qhd-ips-165hz.jpg', 319, 'El monitor Gigabyte M27Q-EK pone a tu disposición un arsenal de características que te permitirán marcar la diferencia en tus juegos. Esta pantalla de 27 está equipada con panel IPS de resolución QHD (2560 x 1440) para que disfrutes de imágenes repletas de vida y con un nivel de detalle espectacular. Mientras tanto, los 165Hz de refresco (170Hz OC), 1 ms de tiempo de respuesta y la tecnología FreeSync se encargan de producir transiciones fluidas, suaves y ultra-precisas. Otra de sus principales ventajas es la certificación Display HDR400, lo que asegura una mayor profundidad de color. Además, el Gigabyte M27Q-EK (rev 2.0) incorpora KVM para una mejor vinculación con todos tus dispositivos.', 'Gigabyte', 0),
(1823, 'Gigabyte M27U - Monitor gaming 27 UHD 4K 160Hz', 'https://www.neobyte.es/111338-large_default/gigabyte-m27u-monitor-gaming-27-uhd-4k-160hz.jpg', 559.9, 'Su función KVM simplifica el control de múltiples dispositivos, y con resolución UHD 4K a 160Hz, color de 10 bits y un amplio espectro de color del 95% DCI-P3, garantiza calidad visual detallada y una experiencia de juego inmersiva. El diseño elegante y ergonómico se integra a la perfección con la filosofía de diseño de la serie gaming de GIGABYTE. Características como OSD Sidekick permiten ajustes fáciles, mientras que las certificaciones Flicker-Free y Low Blue Light cuidan de tu salud visual. Eleva tu juego con el M27U de GIGABYTE, un monitor que combina rendimiento y diseño compacto.', 'Gigabyte', 0),
(1824, 'Gigabyte G27Q - Monitor 27 QHD IPS 144Hz', 'https://www.neobyte.es/39349-large_default/gigabyte-g27q-monitor-27-qhd-ips-144hz.jpg', 289, 'Ya en Neobyte el monitor gaming Gigabyte G27Q, el arma definitiva para obtener una ventaja competitivo y superar a tus rivales. Provista de panel IPS de 27, alcanza la resolución QHD (2560 x 1440) y ofrece imágenes de calidad extraordinaria a todos los niveles desde cualquier ángulo. Así mismo, los 144hz de tasa de refresco y la tecnología FreeSync garantizan transiciones fluidas incluso en las escenas más trepidantes. Entre sus innumerables ventajas, mencionar también sus diferentes alternativas de ajuste, los altavoces integrados y su variada conectividad.', 'Gigabyte', 0),
(1825, 'Gigabyte G27FC A - Monitor curvo 27 Full HD 170Hz', 'https://www.neobyte.es/42055-large_default/gigabyte-g27fc-a-monitor-curvo-27-full-hd-170hz.jpg', 199, 'El Gigabyte G27FC A, es un monitor con diseño aerodinámico y pantalla de 27 pulgadas, cuenta con las prestaciones imprescindibles para destacar en el mundo de los videojuegos. Las características de su panel VA con curvatura 1500R te dejarán realmente sorprendido, con resolución Full HD y una representación del 127% del espacio de color sRGB para una calidad de imagen óptima. Si eres de los que se toma en serio el juego, sentirás los beneficios de una tasa de refresco de 165Hz y 1ms de tiempo de respuesta, que te proporcionarán movimientos rápidos y agilidad en las acciones. En definitiva, el Gigabyte G27FC A ha llegado a Neobyte pisando fuerte.', 'Gigabyte', 0),
(1826, 'Gigabyte G32QCA - Monitor 32 curvo QHD 165Hz', 'https://www.neobyte.es/42063-large_default/gigabyte-g32qca-monitor-32-curvo-qhd-165hz.jpg', 338.99, 'Vive tus juegos de la manera más inmersiva con el Gigabyte G32QCA, un monitor curvo de 31.5 equipado con un arsenal de mejoras que te permitirán marcan la diferencia. Entre ellas, destacar la resolución QHD (2560 x 1440) y los 165Hz de tasa de refresco. Estas características, sumadas a las tecnología FreeSync Premium y DisplayHDR, aseguran una experiencia de juego suave y con una calidad de imagen espectacular. Así mismo indicar que el Gigabyte G32QCA incluye multitud de puertos para una compatibilidad total, así como un diseño efectivo y sin estridencias.', 'Gigabyte', 0),
(1827, 'Gigabyte G24F 2 - Monitor 24 IPS FullHD FreeSync 180Hz', 'https://www.neobyte.es/76415-large_default/gigabyte-g24f-2-monitor-24-ips-fullhd-freesync-180hz.jpg', 179, 'Gigabyte G24F 2 - Monitor 24 IPS FullHD FreeSync 180Hz', 'Gigabyte', 0);
INSERT INTO `producto` (`id`, `nombre`, `imagen`, `precio`, `especificaciones`, `marca`, `id_categoria`) VALUES
(1828, 'Gigabyte GS32QC - Monitor curvo 32 QHD 170Hz', 'https://www.neobyte.es/110886-large_default/gigabyte-gs32qc-monitor-curvo-32-qhd-170hz.jpg', 309, 'Conquista tus juegos con el monitor curvo GIGABYTE GS32QC, la pieza final para llevar tu sistema de juego al máximo rendimiento. Este monitor de 32 presenta un panel VA de 1500R para una inmersión excepcional, respaldado por tecnología Adaptive-Sync. Su diseño elegante y minimalista, junto con un resistente soporte y acabado mate, reflejan la esencia de la serie gaming de GIGABYTE. Ajusta el ángulo perfecto con su soporte versátil y disfruta de funciones como Eyesafe 2.0, Flicker-Free y protección ocular certificada por TÜV Rheinland para una experiencia de juego envolvente y cómoda.', 'Gigabyte', 0),
(1829, 'Gigabyte GS34WQC - Monitor curvo 34 UWQHD 135Hz', 'https://www.neobyte.es/110893-large_default/gigabyte-gs34wqc-monitor-curvo-34-uwqhd-135hz.jpg', 358.99, 'Prepárate para la batalla con el monitor GIGABYTE GS34WQC, la pieza esencial para llevar tu sistema de juego al siguiente nivel. Con su pantalla curva de 34 y tecnología Adaptive-Sync, este monitor ofrece una experiencia inmersiva con un panel VA de 1500R. La serie gaming de GIGABYTE se destaca en su diseño simple pero elegante, con un sólido soporte y un acabado mate. El soporte exclusivo no solo aporta un toque estilizado, sino que también permite ajustes ergonómicos de altura e inclinación para una visualización perfecta. Con funciones como Flicker-Free y protección ocular certificada por TÜV Rheinland, disfruta de largas sesiones de juego sin fatiga visual.', 'Gigabyte', 0),
(1830, 'Gigabyte GS27QC - Monitor curvo 27 QHD 165Hz', 'https://www.neobyte.es/110204-large_default/gigabyte-gs27qc-monitor-curvo-27-qhd-165hz.jpg', 269, '¡Prepárate para una experiencia de juego envolvente con el GS27QC!', 'Gigabyte', 0),
(1831, 'Gigabyte GS27F - Monitor gaming 27 Full HD 170Hz', 'https://www.neobyte.es/110874-large_default/gigabyte-gs27f-monitor-gaming-27-full-hd-170hz.jpg', 199, 'Únete a la batalla con el monitor GIGABYTE GS27F, tu compañero perfecto para el sistema de juego definitivo. Este monitor gaming va más allá de lo común, ofreciendo especificaciones y calidad premium para una experiencia de juego de alto nivel sin la necesidad de gastar en exceso. Su diseño sencillo pero elegante, con un soporte robusto y un acabado mate, refleja la filosofía de diseño de la serie gaming de GIGABYTE, aportando funcionalidad y estilo. Además, con características tecnológicas como Flicker-Free y protección ocular certificada por TÜV Rheinland, este monitor garantiza tu comodidad visual durante largas sesiones de juego.', 'Gigabyte', 0),
(1832, 'Gigabyte G34WQC A - Monitor curvo 34 UWQHD 144Hz', 'https://www.neobyte.es/63828-large_default/gigabyte-g34wqc-a-monitor-curvo-34-uwqhd-144hz.jpg', 388.99, 'Con el Gigabyte G34WQC A vivirás la experiencia gaming más inmersiva. Gracias a su fabuloso panel curvo de 34 y resolución UWQHD (3440 x 1440), te trasladarás al centro de la acción, disfrutando así de cada escena de tus juegos y películas como siempre habías soñado. Además, el Gigabyte G34WQC A destaca por su tasa de refresco de 144Hz, lo que se traduce en transiciones suaves, fluidas y precisas. Por último, indicar que incorpora altavoces y peana con múltiples alternativas de ajuste.', 'Gigabyte', 0),
(1833, 'Gigabyte GS27Q - Monitor gaming 27 QHD 170Hz', 'https://www.neobyte.es/110880-large_default/gigabyte-gs27q-monitor-gaming-27-qhd-170hz.jpg', 278.99, 'Descubre una nueva dimensión de juego con el monitor GIGABYTE GS27Q, tu aliado esencial para llevar tu sistema de juego al siguiente nivel. Con tecnología Adaptive-Sync, este monitor proporciona una experiencia visual fluida y sin interrupciones. Su diseño simple pero con estilo, respaldado por un soporte robusto y un acabado mate, encarna la filosofía de diseño de la serie gaming de GIGABYTE, agregando funcionalidad y atractivo estético a tu configuración. Además, con características como Flicker-Free y protección ocular certificada por TÜV Rheinland, este monitor cuida de tu bienestar visual mientras disfrutas de tus juegos favoritos.', 'Gigabyte', 0),
(1834, 'Gigabyte Aorus FI32Q - Monitor 32 QHD IPS 165Hz HDR', 'https://www.neobyte.es/46682-large_default/gigabyte-aorus-fi32q-monitor-32-qhd-ips-165hz-hdr.jpg', 559, 'El Gigabyte Aorus FI32Q es el monitor que todo gamer estaba esperando. Agudiza todos los sentidos con un juego más fluido gracias a sus tiempos de respuesta de 1ms, sus 165Hz (170Hz OC) de frecuencia de refresco y su tecnología FreeSync, que te permitirá vivir una experiencia sin cortes ni tirones en las imágenes. Todas estas especificaciones, vienen acompañadas de una pantalla de 32 pulgadas QHD con la que podrás visualizar hasta el más mínimo detalle de tu contenido, garantizándote colores brillantes y una amplia gama de matices. Si eres de los que siempre lo da todo en los juegos, este monitor es para ti.', 'Gigabyte', 0),
(1835, 'Gigabyte M34WQ - Monitor 34 UWQHD IPS 144Hz 1ms', 'https://www.neobyte.es/58545-large_default/gigabyte-m34wq-monitor-34-uwqhd-ips-144hz-1ms.jpg', 498.99, 'Sumérgete de lleno en la acción con el Gigabyte M34WQ, el monitor de 34 perfecto para completar tu equipo gaming. Su panel IPS ofrece una resolución UWQHD con la que vislumbrar a tus enemigos con nitidez y visualizar los escenarios más detallados y realistas. A su vez, podrás disfrutar de un juego totalmente fluido gracias a sus 144Hz de tasa de refresco y su bajo tiempo de respuesta de 1ms. Certificación DisplayHDR400, compatibilidad AMD FreeSync Premium, altavoces integrados y más, el Gigabyte M34WQ ha llegado a Neobyte para ofrecerte la mejor experiencia de juego al mejor precio.', 'Gigabyte', 0),
(1836, 'Gigabyte G27QC - Monitor curvo 27 QHD 165Hz', 'https://www.neobyte.es/42059-large_default/monitor-27-gigabyte-g27qc.jpg', 278.99, 'Monitor 27 Gigabyte G27qc', 'Gigabyte', 0),
(1837, 'Aorus M32UC - Monitor curvo 31.5 4K UHD FreeSync 160Hz', 'https://www.neobyte.es/76361-large_default/aorus-m32uc-monitor-curvo-31-5-4k-uhd-freesync-160hz.jpg', 649, 'Aorus M32UC - Monitor curvo 31.5 4K UHD FreeSync 160Hz', 'Gigabyte', 0),
(1838, 'Gigabyte M32QC - Monitor curvo 32 QHD 170Hz 1ms', 'https://www.neobyte.es/58550-large_default/gigabyte-m32qc-monitor-curvo-32-qhd-170hz-1ms.jpg', 348.99, 'El Gigabyte M32QC te ofrece infinidad de posibilidades. Con una resolución QHD, este monitor de 32 te permitirá explorar los juegos con un nivel de detalle superior, y su frecuencia de actualización de 170Hz y tiempo de respuesta de 1ms te proporcionarán una experiencia gaming fluida y sin distorsiones. Entre sus otras características, también encontramos que incorpora tecnología AMD FreeSync para una perfecta sincronización de imagen, tecnología antiparpadeo y conexiones con puertos USB-C y HDMI. Además, el Gigabyte M32QC permite ajustar su ángulo de visión para que puedas jugar de la forma más cómoda en cada partida.', 'Gigabyte', 0),
(1839, 'Gigabyte Aorus FI32U - Monitor 32 IPS UHD 4K 144Hz 1ms', 'https://www.neobyte.es/55711-large_default/gigabyte-aorus-fi32u-monitor-32-ips-uhd-4k-144hz-1ms.jpg', 728.99, 'Con el Gigabyte Aorus FI32U disfrutarás de tus juegos con la máxima emoción. Este monitor dispone de una tasa de refresco de 144Hz y un tiempo de respuesta bajo de 1ms que te permitirá detectar a tus enemigos con rapidez y reaccionar con agilidad. Gráficamente, su pantalla de 32 con panel IPS proporciona unos colores increíblemente realistas que, junto a su resolución UHD, harán que cada escena se muestre llena de detalles y nitidez. Además, el Gigabyte Aorus FI32U cuenta con iluminación RGB para un ambiente totalmente gaming.', 'Gigabyte', 0),
(1840, 'Gigabyte Aorus FI32Q X - Monitor 32 IPS QHD 270Hz 1ms', 'https://www.neobyte.es/58539-large_default/gigabyte-aorus-fi32q-x-monitor-32-ips-qhd-270hz-1ms.jpg', 728.99, 'El Gigabyte Aorus FI32Q es un monitor gaming de 32 que fusiona comodidad y eficiencia en su diseño. Para un juego lleno de acción y fluidez, este dispositivo cuenta con una tasa de refresco de hasta 270Hz y tecnología AMD FreesSync Premium Pro para una mayor velocidad y estabilidad de imagen. Además, su bajo tiempo de respuesta de 1ms te permitirá reaccionar siempre a tiempo ante cualquier ataque enemigo. En cuanto a calidad gráfica, destacar que el Gigabyte Aorus FI32Q cuenta con resolución QHD y panel IPS con HDR600 para que te sientas totalmente envuelto en los colores y detalles de cada escena.', 'Gigabyte', 0),
(1841, 'Gigabyte GS27FC - Monitor curvo 27 Full HD 180Hz', 'https://www.neobyte.es/111327-large_default/gigabyte-gs27fc-monitor-curvo-27-full-hd-180hz.jpg', 179, 'Prepárate para una experiencia de juego inmersiva y cómoda con el monitor gaming GS27FC de GIGABYTE. ¡Es hora de conquistar la última milla de tu sistema gaming!', 'Gigabyte', 0),
(1842, 'Aorus M32U Arm Edition Gaming Monitor - Monitor 32 4K UHD FreeSync 144Hz', 'https://www.neobyte.es/81599-large_default/aorus-m32u-arm-edition-gaming-monitor-monitor-32-4k-uhd-freesync-144hz.jpg', 748.99, 'Gigabyte M32U AE - Monitor 32 4K 144Hz', 'Gigabyte', 0),
(1843, 'Iiyama G-Master G2470HSU-B1 - Monitor 24 IPS Full HD 0.8ms 165Hz', 'https://www.neobyte.es/67517-large_default/iiyama-g-master-g2470hsu-b1-monitor-24-ips-full-hd-08ms-165hz.jpg', 149.89, 'El Iiyama G-Master G2470HSU-B1 Red Eagle cuenta con todo lo necesario para vivir tus juegos como un profesional de los esports. El panel IPS de 23.8 Full HD alcanza una tasa de refresco de 165Hz y un tiempo de respuesta de tan solo 0.8ms. Estas especificaciones, unidas a la tecnología AMD FreeSync, aseguran una acción fluida e imágenes precisas incluso en los momentos críticos. Además, este monitor integra altavoces y multitud de puertos para una compatibilidad total con tu ordenador. Salte del camino marcado con el  Iiyama G-Master G2470HSU-B1 Red Eagle.', 'IIYAMA', 0),
(1844, 'Iiyama G-Master G2770QSU-B1 - Monitor 27 WQHD 165Hz FreeSync', 'https://www.neobyte.es/81589-large_default/iiyama-g-master-g2770qsu-b1-monitor-27-wqhd-165hz-freesync.jpg', 259.9, 'Iiyama G-Master G2770QSU-B1 - Monitor 27 WQHD 165Hz FreeSync', 'IIYAMA', 0),
(1845, 'Iiyama G-Master GB3271QSU-B1 - Monitor 32 IPS WQHD 1ms 165Hz', 'https://www.neobyte.es/67903-large_default/iiyama-g-master-gb3271qsu-b1-monitor-32-ips-wqhd-1ms-165hz.jpg', 349.9, 'El Iiyama G-Master GB3271QSU-B1 Red Eagle es la solución definitiva para tus ratos de entretenimiento. Se trata de un monitor IPS de 32 que presume de ofrecer una resolución WQHD para que puedas disfrutar de los títulos más novedosos bajo una calidad de imagen fascinante, tasas de refresco de 165Hz y bajos tiempos de respuesta de 1ms. Entre sus otras características, este modelo también incluye compatibilidad FreeSync para garantizar partidas libres cortes y tecnología para el cuidado ocular Flicker Free que harán tus sesiones de juego mucho más confortables. Pasa al siguiente nivel con el Iiyama G-Master GB3271QSU-B1 Red Eagle, en Neobyte al mejor precio.', 'IIYAMA', 0),
(1846, 'Iiyama ProLite XU2792HSU-B1 - Monitor 27 IPS Full HD', 'https://www.neobyte.es/66953-large_default/iiyama-prolite-xu2792hsu-b1-monitor-27-ips-full-hd.jpg', 152.9, 'El Iiyama ProLite XU2792HSU-B1 es el monitor adecuado para tener en cualquier escritorio. Su diseño sin bordes lo hacen perfecto para crear un entorno de trabajo multi-pantalla, sin perder ningún detalle de contenido y mostrando siempre una calidad de imagen espectacular en Full HD. Este monitor de 27 ofrece un trato de color realista y una gamma cromática brillante y clara gracias a la tecnología de panel IPS que incorpora. Asimismo, el Iiyama ProLite XU2792HSU-B1 viene con una completa conectividad y tecnología anti-parpadeo para el cuidado ocular.', 'IIYAMA', 0),
(1847, 'Iiyama ProLite XU2792QSU-B1 - Monitor 27 IPS WQHD 70Hz', 'https://www.neobyte.es/67033-large_default/iiyama-prolite-xu2792qsu-b1-monitor-27-ips-wqhd-70hz.jpg', 170.9, 'Ya sea en la oficina o en el estudio, el Iiyama ProLite XU2792QSU-B1 transformará tu espacio de trabajo y maximizará tu productividad. Hablamos de un monitor de bisel estrecho que equipa un panel IPS de 27 para una calidad de imagen excelente y altos valores de contraste y brillo, lo que lo hace perfecto para tareas de diseño web, edición de fotografía o actividades creativas. Adecuado también para el juego, incorpora prestaciones que llevarán un nivel más allá tu entretenimiento, como compatibilidad AMD FreeSync o tecnología Flicker Free para largas jornadas frente a la pantalla. El Iiyama ProLite XU2792QSU-B1 dejará satisfechos hasta a los usuarios más exigentes.', 'IIYAMA', 0),
(1848, 'Iiyama ProLite T2454MSC-B1AG - Monitor 24 IPS Full HD', 'https://www.neobyte.es/68688-large_default/iiyama-prolite-t2454msc-b1ag-monitor-24-ips-full-hd-.jpg', 343.89, 'El Iiyama ProLite T2454MSC-B1AG cuenta con soporte ajustable, tecnología para el cuidado ocular y una pantalla táctil IPS que funciona tanto con los dedos, como con lápiz óptico o guantes de látex. Un monitor que pone especial cuidado a tu comodidad, proporcionando a su vez una calidad de imagen excepcional con una resolución Full HD para que disfrutes de contenido favorito como nunca. Asimismo, el Iiyama ProLite T2454MSC-B1AG incorpora altavoces estéreo y múltiples conexiones que lo dotan de una gran conectividad.', 'IIYAMA', 0),
(1849, 'Iiyama ProLite E1980D-B1 - Monitor 19 SXGA', 'https://www.neobyte.es/66565-large_default/iiyama-prolite-e1980d-b1-monitor-19-sxga-.jpg', 139.9, 'El Iiyama ProLite E1980D-B1 es un monitor elegante destinado a uso profesional. Su pantalla de 19 tiene las medidas perfectas para caber sin esfuerzo en cualquier oficina o estudio y su panel TN retroiluminado por LED ofrece la calidad de imagen perfecta para llevar a cabo tus tareas del día a día. Además, cuenta con puertos VGA y DVI, lo que añade funcionalidad y comodidad a este periférico. Con el Iiyama ProLite E1980D-B1 obtendrás una herramienta fiable y un contenido en resolución SXGA.', 'IIYAMA', 0),
(1850, 'Iiyama ProLite X4373UHSU-B1 - Monitor 43 4K UHD', 'https://www.neobyte.es/67155-large_default/iiyama-prolite-x4373uhsu-b1-monitor-43-4k-uhd.jpg', 549.9, 'Seas trabajador o estudiante, el Iiyama ProLite X4373UHSU-B1 es perfecto para ocupar un espacio en tu lugar de trabajo. Hablamos de un monitor de 43 con tecnología PbP que  te ofrece la posibilidad de dividir su pantalla en cuatro para una visualización simultánea de diferentes contenidos, opción muy útil si eres de los que está acostumbrado a tener diversos programas o ventanas abiertas. Este periférico cuenta con una resolución de pantalla 4K UHD para unas imágenes nítidas y claras, así como diferentes opciones de conectividad para una conexión rápida con otros dispositivos. Con el Iiyama ProLite X4373UHSU-B1 aumentarás tu productividad de la forma más cómoda.', 'IIYAMA', 0),
(1851, 'Iiyama G-Master G2770HSU-B1 - Monitor 27 Full HD IPS 165Hz', 'https://www.neobyte.es/67866-large_default/iiyama-g-master-g2770hsu-b1-monitor-27-full-hd-ips-165hz.jpg', 190.9, 'El Iiyama G-Master G2770HSU-B1 Red Eagle tiene todas las cualidades que un gamer podrías soñar. Provisto de panel IPS de 27 pulgadas con resolución Full HD, ofrece imágenes detalladas y vivas desde cualquier ángulo. Así mismo, los 165Hz de tasa de refresco y la tecnología FreeSync aseguran una precisión total en transiciones y escenas de acción. Paralelamente, destacar que este monitor marca la diferencia por su conectividad integral, incluyendo HDMI, DisplayPort, USB y jack de 3.5 mm.', 'IIYAMA', 0),
(1852, 'Iiyama G-Master GB2790QSU-B1 - Monitor 27 WQHD IPS 240Hz', 'https://www.neobyte.es/76188-large_default/iiyama-g-master-gb2790qsu-b1-monitor-27-wqhd-ips-240hz.jpg', 449.9, 'Iiyama G-Master GB2790QSU-B1 - Monitor 27 WQHD IPS 240Hz', 'IIYAMA', 0),
(1853, 'Iiyama G-Master G2766HSU-B1 - Monitor 27 Full HD 1ms 165Hz', 'https://www.neobyte.es/67888-large_default/iiyama-g-master-g2766hsu-b1-monitor-27-full-hd-1ms-165hz.jpg', 170.9, 'El Iiyama G-Master G2766HSU-B1 Red Eagle es el monitor perfecto si eres un jugador al que le gusta competir y los eSports. Con sus 165Hz de tasa de refresco, este monitor de 27 promete imágenes dinámicas para que no te pierdas ni un momento de la acción, así como tiempos rápidos de respuesta de 1ms para reaccionar de forma rápida a cualquier ataque. Con su resolución Full HD y su compatibilidad con AMD FreeSync podrás disfrutar de la mejor calidad de imagen sin desfragmentación, desenfoques o borrosidades. El Iiyama G-Master G2766HSU-B1 Red Eagle es el monitor definitivo.', 'IIYAMA', 0),
(1854, 'Iiyama ProLite XU2792UHSU-B1 - Monitor 27 IPS 4K UHD', 'https://www.neobyte.es/67100-large_default/iiyama-prolite-xu2792uhsu-b1-monitor-27-ips-4k-uhd.jpg', 280.9, 'El Iiyama ProLite XU2792UHSU-B1 cuenta con un diseño de pantalla ultra delgado, ideal para mesas de oficina u estudio. Un monitor de 27 que garantiza calidad y funcionalidad, ofreciendo una resolución 4K UHD y un panel IPS para que puedas disfrutar de tu contenido favorito desde cualquier ángulo de visión. Asimismo viene equipado con tecnología Flicker free para el cuidado de los ojos y una gran diversidad de puertos para establecer conexiones de forma fácil con otros dispositivos. Aumenta tu productividad o disfruta de tu tiempo de ocio, con el Iiyama ProLite XU2792UHSU-B1 no habrá quien te pare.', 'IIYAMA', 0),
(1855, 'Iiyama G-Master G2740QSU-B1 - Monitor 27 IPS WQHD 1ms 75Hz', 'https://www.neobyte.es/67859-large_default/iiyama-g-master-g2740qsu-b1-monitor-27-ips-wqhd-1ms-75hz.jpg', 214.9, 'El Iiyama Black Hawk G-Master G2740QSU-B1 presenta el equilibrio perfecto entre calidad de imagen y fluidez. Hablamos de un monitor de 27 con resolución WQHD que incorpora la tecnología de panel IPS para una visualización perfecta, nítida y desde todos los ángulos. Además, gracias a sus 75Hz de tasa de refresco y su bajo tiempo de respuesta de 1ms obtendrás una experiencia de juego mucho más inmersiva, dejando de lado los molestos efectos de desenfoque o ghosting. El Iiyama G-Master G2740QSU-B1 Black Hawk también incorpora altavoces y tecnologías antiparpadeo y AMD FreeSync.', 'IIYAMA', 0),
(1856, 'Iiyama ProLite T2754MSC-B1AG - Monitor táctil 27 Full HD IPS', 'https://www.neobyte.es/68698-large_default/iiyama-prolite-t2754msc-b1ag-monitor-tactil-27-full-hd-ips.jpg', 460.9, 'Por su calidad de imagen y fabricación, así como por su fantástica versatilidad, el Iiyama ProLite T2754MSC-B1AG es el monitor táctil perfecto para comercios, restaurantes, TPV y presentaciones interactivas. Esta pantalla incorpora panel IPS de 27 y resolución Full HD para ofrecer imágenes vivas y realistas desde cualquier ángulo. Además, la tecnología capacitiva de 10 puntos garantiza una interacción ágil que incrementará tu productividad. Por último, destacar que el Iiyama ProLite T2754MSC-B1AG integra altavoces, peana con ajuste en diferentes ángulos y gran variedad de puertos.', 'IIYAMA', 0),
