(1882, 'Ozone DSP27 - Monitor 27 IPS 2K QHD 144Hz 1ms G-Sync', 'https://www.neobyte.es/65144-large_default/ozone-dsp27-monitor-27-ips-2k-qhd-144hz-1ms-g-sync-.jpg', 329.9, 'Diseñado para cubrir las necesidades de todo jugador, el Ozone DSP27 destaca por su increíble potencial y su versatilidad. Un monitor IPS de 27 con resolución QHD que permite disfrutar de un contenido nítido y detallado desde cualquier ángulo de visión y que, además, destaca por su increíble tasa de refresco de 144Hz y su tiempo de respuesta de tan solo 1ms. Asimismo, incorpora tecnología de cuidado ocular Flicker Free y compatibilidad G-Sync para garantizar largas sesiones de gaming sin molestias, cortes o desgarros. ¡Y lo mejor es que puedes conseguir el Ozone DSP27 en Neobyte a un precio sorprendente!', 'Ozone', 0),
(1883, 'Ozone DSP24 240 - Monitor 24 Full HD 240Hz G-Sync', 'https://www.neobyte.es/65119-large_default/ozone-dsp24-240-monitor-24-full-hd-240hz-g-sync.jpg', 299.9, 'Ozone DSP24 240 es el monitor gaming que estabas buscando. Gracias a su diseño compacto y ergonómico se integra a la perfección en tu escritorio, permitiéndote disfrutar de sus increíbles prestaciones al precio más ajustado. Este monitor cuenta con panel TN de 24.5 y una tasa de refresco de 240Hz, cumpliendo así con los deseos de los gamers competitivos más exigentes. Además, es compatible con las tecnologías FreeSync y G-Sync, lo que asegura una perfecta sincronización de FPS para una acción más rápida, fluida y precisa. Por último, indicar que el Ozone DSP24 240 incluye diferentes puertos de conexión para una compatibilidad total con tu PC y periféricos.', 'Ozone', 0),
(1884, 'Ozone DSP25 PRO - Monitor 25 Full HD 144Hz G-Sync', 'https://www.neobyte.es/65126-large_default/ozone-dsp25-pro-monitor-25-full-hd-144hz-g-sync.jpg', 229.9, 'El Ozone DSP25 PRO es una gran alternativa si buscas un monitor gaming de 24.5 con AMD FreeSync y Nvidia G-Sync. Estas tecnologías, junto a la resolución Full HD de su panel y una tasa de refresco de 144Hz, aseguran imágenes detalladas, fluidas, suaves y precisas. Además, el Ozone DSP25 PRO integra una amplia variedad de puertos incluyendo HDMI, DisplayPort y USB. Así mismo, indicar que equipa peana con diferentes ajustes para una óptima adaptación a tu espacio. Si a esto le sumamos un precio verdaderamente competitivo, el resultado es un monitor que dará mucho que hablar.', 'Ozone', 0),
