(1886, 'Philips V Line 241V8L/00 - Monitor 24 Full HD 75Hz', 'https://www.neobyte.es/44354-large_default/monitor-24-philips-v-line-241v8l00.jpg', 86.9, 'Vive las imágenes más dinámicas de la mano del Philips V Line 241V8L/00, el monitor que incluye tecnologías como SmartContrast y SmartImage para garantizarte una calidad inigualable. Este modelo de 24 pulgadas presenta un panel LED VA y un ángulo de 178º para una visión panorámica, perfecto tanto si pretendes usarlo para manejar aplicaciones de oficina como para entretenerte durante tu tiempo libre. Disfruta de tus juegos de forma ininterrumpida gracias a su sincronización adaptable y su tecnología sin parpadeo, que reduce los síntomas de la vista cansada. Además, cuenta con puerto HDMi para garantizar una conectividad digital universal. No lo pienses más, el Philips V Line 241V8L/00 es el monitor Full HD que necesitas en tu día a día.', 'Philips', 0),
(1887, 'Philips 271V8L/00 - Monitor 27 Full HD', 'https://www.neobyte.es/47222-large_default/monitor-philips-27-271v8l00.jpg', 110.9, 'El Philips 271V8L/00 es un monitor de 27 pulgadas con resolución Full HD diseñado para ofrecer una gran calidad de imagen, tanto para trabajar como para disfrutar de tu tiempo de entretenimiento. Cuenta con diferentes tecnologías que optimizan la configuración de la imagen, ofreciendo distintos modos para adaptarse a la aplicación en uso y mejorar aspectos como el contraste, la saturación del color y la nitidez. También es importante reseñar que el Philips 271V8L/00 dispone de sistema Flicker Free, que reduce el parpadeo de la pantalla para evitar la vista cansada y Modo LowBlue para minimizar los daños de una exposición prolongada.', 'Philips', 0),
