(1912, 'Samsung Odyssey G6 - Monitor 27 QHD FreeSync 240Hz', 'https://www.neobyte.es/96961-large_default/samsung-odyssey-g6-monitor-27-qhd-freesync-240hz.jpg', 398.9, 'Samsung Odyssey G6 - Monitor 27 QHD 240Hz', 'Samsung', 0),
(1913, 'Samsung LS27A600UUUXEN - Monitor 27 QHD IPS', 'https://www.neobyte.es/54135-large_default/monitor-samsung-27-ls27a600uuuxen-ips-qhd.jpg', 355.9, 'El monitor Samsung LS27A600UUUXEN está diseñado para que puedas sacar el máximo partido a todas sus funcionalidades. Equipado con un panel IPS de resolución QHD, este monitor de 27 pulgadas presenta una calidad sorprendente en la transmisión de sus imágenes, con una reproducción de colores totalmente fiel a la realidad. Gira o inclina su pantalla para adaptarla a tus necesidades de cada momento, y juega con las máximas garantías gracias a su compatibilidad con AMD FreeSync y su modo de juego, que te otorgará la fluidez necesaria en todo tipo de videojuegos. Ya sea para trabajar o para disfrutar de un rato de entretenimiento, el Samsung LS27A600UUUXEN va a superar con creces todas las expectativas.', 'Samsung', 0),
(1914, 'Samsung LF24T450FQRXEN - Monitor 24 IPS FULL HD FreeSync', 'https://www.neobyte.es/85951-large_default/samsung-lf24t450fqrxen-monitor-24-ips-full-hd-freesync.jpg', 128.9, 'Samsung LF24T450FQRXEN - Monitor 24 IPS FULL HD FreeSync', 'Samsung', 0),
