(1920, 'Samsung M5C LS27CM500EUXE - Monitor 27 Full HD Smart TV', 'https://www.neobyte.es/102172-large_default/samsung-m5c-ls27cm500euxe-monitor-27-full-hd-smart-tv.jpg', 214.9, 'Samsung M5C LS27CM500EUXE - Monitor 27 Full HD Smart TV', 'Samsung', 0),
(1921, 'Samsung Essential S3 LS27C330GAUXEN - Monitor 27 Full HD FreeSync', 'https://www.neobyte.es/107228-large_default/samsung-essential-s3-ls27c330gauxen-monitor-27-full-hd-freesync.jpg', 130.9, 'Samsung Essential S3 LS27C330GAUXEN - Monitor 27 Full HD FreeSync', 'Samsung', 0),
(1922, 'Samsung Essential S3 LS24C330GAUXEN - Monitor 24 Full HD FreeSync', 'https://www.neobyte.es/107224-large_default/samsung-essential-s3-ls24c330gauxen-monitor-24-full-hd-freesync.jpg', 110.9, 'Samsung Essential S3 LS24C330GAUXEN - Monitor 24 Full HD FreeSync', 'Samsung', 0),
(1923, 'Samsung Odyssey G9 S49CG934SU - Monitor curvo 49 Dual QHD 5K', 'https://www.neobyte.es/107239-large_default/samsung-odyssey-g9-s49cg934su-monitor-curvo-49-dual-qhd-5k.jpg', 1182.9, 'El Samsung Odyssey G9 S49CG934SU es más que un monitor, es una puerta a un mundo de juego inmersivo y competitivo. Con su tecnología de vanguardia, diseño elegante y funciones personalizables, este monitor te permite disfrutar al máximo de tus juegos favoritos.', 'Samsung', 0),
(1924, 'Samsung SA600UCU - Monitor 24 QHD IPS USB-C', 'https://www.neobyte.es/54150-large_default/monitor-samsung-24-sa600ucu-ips-qhd-usb-c.jpg', 307.9, 'El Samsung SA600UCU es el monitor de 24 pulgadas con el que no te perderás ningún detalle. Su pantalla con resolución QHD está perfectamente equipada para hacer que visualices el contenido con la mejor calidad, y su panel con tecnología IPS hará que sus imágenes sean visibles desde cualquier ángulo. En cuanto a reproducción de color, es capaz de transmitir una gama cromática amplia, llena de matices y tonos contrastados gracias al estándar HDR10. Aprovecha sus 75Hz de tasa de refresco y su compatibilidad con AMD FreeSync y disfruta de tu tiempo de ocio, sacándole un rendimiento óptimo a todos tus juegos. Además, con el Samsung SA600UCU podrás conectar de forma fácil tu portátil y beneficiarte de una transmisión de datos rápida gracias a su puerto USB-C y sus múltiples opciones de conectividad.', 'Samsung', 0),
(1925, 'Samsung Odyssey G5 - Monitor curvo 27 WQHD FreeSync 144Hz', 'https://www.neobyte.es/96784-large_default/samsung-odyssey-g5-monitor-curvo-27-wqhd-freesync-144hz.jpg', 279.9, 'Samsung Odyssey G5 - Monitor curvo 27 WQHD FreeSync 144Hz', 'Samsung', 0),
(1926, 'Samsung Odyssey G6 - Monitor 32 QHD FreeSync 240Hz', 'https://www.neobyte.es/97016-large_default/samsung-odyssey-g6-monitor-32-qhd-freesync-240hz.jpg', 427.9, 'Samsung Odyssey G6 - Monitor 32 QHD FreeSync 240Hz', 'Samsung', 0),
(1927, 'Samsung Odyssey G7 - Monitor 28 UHD 144Hz', 'https://www.neobyte.es/96899-large_default/samsung-odyssey-g7-monitor-28-uhd-144hz.jpg', 508.9, 'Samsung Odyssey G7 - Monitor 28 UHD 144Hz', 'Samsung', 0),
(1928, 'Samsung Odyssey G8 LS34BG850SUXEN - Monitor 34 UWHD 165Hz', 'https://www.neobyte.es/102189-large_default/samsung-odyssey-g8-ls34bg850suxen-monitor-34-uwhd-165hz.jpg', 956.9, 'Samsung Odyssey G8 LS34BG850SUXEN Monitor 34 UWHD 165Hz', 'Samsung', 0),
(1929, 'Samsung Odyssey G5 - Monitor curvo 34 WQHD FreeSync 165Hz', 'https://www.neobyte.es/96828-large_default/samsung-odyssey-g5-monitor-curvo-34-wqhd-freesync-165hz.jpg', 391.89, 'Samsung Odyssey G5 - Monitor curvo 34 WQHD FreeSync 165Hz', 'Samsung', 0),
(1930, 'Samsung S32A600UUU - Monitor 32 QHD USB-C', 'https://www.neobyte.es/54155-large_default/monitor-samsung-32-s32a600uuu-qhd-va-usb-c.jpg', 432.9, 'La espectacular pantalla de 32 pulgadas del Samsung S32A600UUU dejará sin aliento hasta a los más exigentes. Su panel con resolución QHD conseguirá que vivas una experiencia totalmente novedosa a la hora de visualizar contenido multimedia, trabajar o jugar a tus videojuegos favoritos.  Déjate llevar por unas imágenes llenas de color y disfruta durante largos periodos de tiempo frente a la pantalla sin preocuparte por dolores de cabeza o cansancio ocular gracias a su tecnología Flicker Free. Además, Samsung S32A600UUU incorpora diferentes opciones de conectividad, con puerto USB-C para facilitarte la conexión con otros dispositivos.', 'Samsung', 0),
(1931, 'Samsung M5 LS27BM500EUXEN - Monitor 27 FULL HD Smart TV', 'https://www.neobyte.es/85959-large_default/samsung-m5-ls27bm500euxen-monitor-27-full-hd-smart-tv.jpg', 195.9, 'Samsung M5 LS27BM500EUXEN - Monitor 27 FULL HD Smart TV', 'Samsung', 0),
(1932, 'Samsung S49A950UIU - Monitor 49 Dual QHD USB C LAN', 'https://www.neobyte.es/85991-large_default/samsung-s49a950uiu-monitor-49-dual-qhd-usb-c-lan.jpg', 935.9, 'Samsung S49A950UIU - Monitor 49 Dual QHD', 'Samsung', 0),
(1933, 'Samsung M5 S32BM500EU - Monitor 32 FULL HD Smart TV', 'https://www.neobyte.es/85975-large_default/samsung-m5-s32bm500eu-monitor-32-full-hd-smart-tv.jpg', 254.9, 'Samsung M5 S32BM500EU - Monitor 32 FULL HD Smart TV', 'Samsung', 0),
(1934, 'MONITOR 55 SAMSUNG DIGITAL SIGNAGE QE55T 4K', 'https://www.neobyte.es/72555-large_default/monitor-55-samsung-digital-signage-qe55t-4k.jpg', 776.9, 'MONITOR 55 SAMSUNG DIGITAL SIGNAGE QE55T 4K', 'Samsung', 0),
(1935, 'Samsung Odyssey G3 LS27AG320NUXEN - Monitor 27 Full HD 165Hz', 'https://www.neobyte.es/107232-large_default/samsung-odyssey-g3-ls27ag320nuxen-monitor-27-full-hd-165hz.jpg', 250.91, 'Samsung Odyssey G3 LS27AG320NUXEN - Monitor 27 Full HD 165Hz', 'Samsung', 0),
(1936, 'Samsung Odyssey Neo G8 - Monitor 32 UHD 240Hz', 'https://www.neobyte.es/97253-large_default/samsung-odyssey-neo-g8-monitor-32-uhd-240hz.jpg', 1496.9, 'Samsung Odyssey Neo G8 - Monitor 32 UHD 240Hz', 'Samsung', 0),
(1937, 'Samsung Odyssey Neo G9 - Monitor curvo 49 QHD FreeSync 240Hz', 'https://www.neobyte.es/96865-large_default/samsung-odyssey-neo-g9-monitor-curvo-49-qhd-freesync-240hz.jpg', 1522.91, 'El Samsung Odyssey Neo G9 es más que un monitor, es una puerta a un nuevo universo de posibilidades. Redefine la realidad del gaming y prepárate para vivir una experiencia que te dejará sin aliento.', 'Samsung', 0),
(1938, 'Samsung Viewfinity S9 LS27C902PAUXEN - Monitor 27 5K Smart TV', 'https://www.neobyte.es/107295-large_default/samsung-viewfinity-s9-ls27c902pauxen-monitor-27-5k-smart-tv.jpg', 1583.9, 'Samsung Viewfinity S9 LS27C902PAUXEN - Monitor 27 5K Smart TV', 'Samsung', 0),
(1939, 'BenQ Zowie XL2411K - Monitor 24 Full HD 144Hz', 'https://www.neobyte.es/42153-large_default/monitor-zowie-benq-24-xl2411k.jpg', 230.9, 'Monitor BenQ Zowie XL2411K especial para esports, ahora en Neobyte con envío inmediato y las máximas garantías. Se trata de una pantalla gaming de 24 que destaca por sus opciones de flexibilidad y ajuste, así como por su peana compacta que permite disfrutar de una superficie de juego mayor. A nivel técnico, el BenQ Zowie XL2411K sobresale por su resolución Full HD y una tasa de refresco de 144Hz que, junto a la tecnología DyAc, consigue que las imágenes se vean más claras incluso en barridos y escenas de acción.', 'Zowie benq', 0),
(1940, 'Benq Zowie XL2546K - Monitor 24.5 Full HD 240Hz', 'https://www.neobyte.es/40274-large_default/monitor-zowie-benq-zl2546k.jpg', 499.98, 'El Benq Zowie XL2546K es una referencia para los jugadores de eSports. Este monitor de 24.5 ha sido diseñado para ofrecer una excelente calidad de imagen, proporcionando la acción más fluida y nítida. Esto es debido a la incorporación de un panel TN con resolución Full HD y una tasa de refresco de 240Hz. En este misma línea actua la tecnología DyAc+, evitando qu elos barridos se vean menos borrosos y, por tanto, aportando una ventaja competitiva al usuario. También es importante mencionar que el Benq Zowie XL2546K dispone de funciones como Black eQualizer, para aumentar la visibilidad en escenas oscuras, Color Vibrance, para ajustar colores y tonos, diferentes modos de juego... Completa tu setup gaming con este increíble monitor.', 'Zowie benq', 0),
(1941, 'BenQ Zowie XL2566K - Monitor 24.5 Full HD 360Hz', 'https://www.neobyte.es/81379-large_default/benq-zowie-xl2566k-monitor-245-full-hd-360hz.jpg', 699.99, 'BenQ Zowie XL2566K - Monitor 24.5 Full HD 360Hz', 'Zowie benq', 0),
(1942, 'CAJA EXTERNA CONCEPTRONIC PARA HDD / SSD 2.5 - MINI USB 2.0 - BLANCA', 'https://www.neobyte.es/48375-large_default/caja-externa-conceptronic-para-hdd-ssd-25-mini-usb-20-blanco.jpg', 8.91, 'Caja Externa Conceptronic Para Hdd / Ssd 2.5 - Mini Usb 2.0', 'Conceptronic', 0);
INSERT INTO `producto` (`id`, `nombre`, `imagen`, `precio`, `especificaciones`, `marca`, `id_categoria`) VALUES
(1943, 'Iggual USB 3.0 / SATA III - Caja externa 2.5', 'https://www.neobyte.es/95489-large_default/iggual-usb-30-sata-iii-caja-externa-25.jpg', 8.91, 'Iggual USB 3.0 2.5 SATA III - Caja externa', 'Iggual', 0),
(1944, 'Coolbox SCG2543 Caja externa 2.5 USB 3.0 Azul Claro', 'https://www.neobyte.es/10048-large_default/caja-externa-coolbox-scg2543-azulclaro-2-5-usb-3-0.jpg', 10.9, 'La caja externa CoolBox te permite poder sacar un disco duro interno de un portátil defectuoso y aprovecharlo para sacar los datos y mantenerlo como disco duro externo. Su conexión USB 3.0 te facilita el poder conectarlo a cualquier dispositivo.', 'Coolbox', 0),
(1945, 'Asus ROG Strix Arion - Caja externa SSD M.2 USB-C', 'https://www.neobyte.es/29840-large_default/caja-externa-asus-rog-strix-arion-m2-usb-c.jpg', 54.95, 'Asus ROG Strix Arion no solo es una caja externa para SSD M.2 de impresionante diseño, también es una solución de almacenamiento de alto rendimiento. Fabricada en aleación de aluminio de primera calidad, la carcasa cuenta también con almohadillas térmicas para una óptima disipación del calor. En cuanto a sus acabados, destacar el logo ROG con la increíble iluminación Aura Sync RGB. Asus ROG Strix Arion es compatible con SSD M.2 PCIe NVMe de hasta 2TB y cuenta con conexión USB-C 3.2 de alta velocidad.', 'Asus', 0),
(1946, 'Conceptronic Dante Transparente para SSD o HDD - Caja externa 2.5', 'https://www.neobyte.es/78726-large_default/conceptronic-dante-transparente-para-ssd-o-hdd-caja-externa-25.jpg', 11.89, 'Conceptronic Dante Transparente para SSD o HDD - Caja externa 2.5', 'Conceptronic', 0),
(1947, 'Iggual USB-C 3.1 M.2 NVMe SATA - Caja externa para SSD', 'https://www.neobyte.es/95060-large_default/iggual-usb-c-3-1-m-2-nvme-sata-caja-externa-para-ssd.jpg', 22.91, 'Iggual USB-C 3.1 M.2 NVMe SATA - Caja externa para SSD', 'Iggual', 0),
(1948, 'CAJA EXTERNA TOOQ TQE-2527B 2.5 USB 3.0', 'https://www.neobyte.es/40366-large_default/caja-externa-tooq-tqe-2527b-25-usb-30.jpg', 7.9, 'Caja Externa Tooq Tqe-2527b 2.5 Usb 3.0', 'Tooq', 0),
(1949, 'Coolbox SCG2543 Caja externa 2.5 USB 3.0 Azul Oscuro', 'https://www.neobyte.es/10049-large_default/caja-externa-coolbox-scg2543-azul-oscu-2-5-usb-3-0.jpg', 9.9, 'La caja externa CoolBox te permite poder sacar un disco duro interno de un portátil defectuoso y aprovecharlo para sacar los datos y mantenerlo como disco duro externo. Su conexión USB 3.0 te facilita el poder conectarlo a cualquier dispositivo.', 'Coolbox', 0),
(1950, 'Asus TUF Gaming A1 ESD-T1A - Caja externa SSD M.2 NVMe', 'https://www.neobyte.es/79298-large_default/asus-tuf-gaming-a1-esd-t1a-caja-externa-ssd-m2-nvme.jpg', 43.9, 'Asus TUF Gaming A1 ESD-T1A - Caja externa SSD M.2 NVMe', 'Asus', 0),
(1951, 'CAJA EXTERNA CONCEPTRONIC PARA SSD M.2 SATA - USB 3.0', 'https://www.neobyte.es/48072-large_default/caja-externa-conceptronic-dde03g-ssd-m2-sata-usb.jpg', 19.9, 'Caja Externa Conceptronic Para Ssd M.2 Sata - Usb 3.0', 'Conceptronic', 0),
(1952, 'Coolbox SCG2543 Caja externa 2.5 USB 3.0 Gris', 'https://www.neobyte.es/2319-large_default/caja-externa-coolbox-scg2543-gris-2-5-usb-3-0.jpg', 10.9, 'La caja externa CoolBox te permite poder sacar un disco duro interno de un portátil defectuoso y aprovecharlo para sacar los datos y mantenerlo como disco duro externo. Su conexión USB 3.0 te facilita el poder conectarlo a cualquier dispositivo.', 'Coolbox', 0),
(1953, 'Tooq TQE-2280B - Caja externa M.2 NVMe', 'https://www.neobyte.es/75144-large_default/tooq-tqe-2280b-caja-externa-m2-nvme.jpg', 18.9, 'Tooq TQE-2280B M.2 NVMe USB 3.1 Gen 2 - Caja externa', 'Tooq', 0),
(1954, 'CAJA EXTERNA TOOQ TQE-2527G 2.5 USB 3.0', 'https://www.neobyte.es/52651-large_default/caja-externa-tooq-tqe-2527g-25-usb-30.jpg', 6.95, 'Caja Externa Tooq Tqe-2527g 2.5 Usb 3.0', 'Tooq', 0),
(1955, 'CAJA EXTERNA TOOQ TQE-2527R 2.5 USB 3.1', 'https://www.neobyte.es/52655-large_default/caja-externa-tooq-tqe-2527r-25-usb-31.jpg', 7.9, 'Caja Externa Tooq Tqe-2527r 2.5 Usb 3.1', 'Tooq', 0),
(1956, 'Coolbox SlimCase S-2533 - Caja externa USB 3.0 2.5', 'https://www.neobyte.es/23832-large_default/caja-externa-coolbox-scs-2533-usb-30-slot-in.jpg', 8.91, 'Caja externa Coolbox SlimCase S-2533 (SCS-2533) para unidades SSD y discos duros de 2.5 con conexión USB 3.0 con la que conseguirás velocidades de transferencia de hasta 5 Gbps. Una carcasa externa con montaje sencillo slot-in, compatible con SSD de hasta 1TB y discos duros de hasta 2TB. ¡Hazte con la Coolbox SlimCase S-2533 en Neobyte!', 'Coolbox', 0),
(1957, 'Tooq TQE-2221G - Caja externa M.2 NVMe', 'https://www.neobyte.es/75128-large_default/tooq-tqe-2221g-caja-externa-m2-nvme.jpg', 21.9, 'Tooq TQE-2221G M.2 NVMe USB 3.1 Gen 2 - Caja externa', 'Tooq', 0),
(1958, 'Coolbox SCA2513 - Caja externa USB 3.0 2.5 Plata', 'https://www.neobyte.es/8466-large_default/caja-externa-coolbox-sca2513-plata-usb-30-25.jpg', 11.89, 'Con un diseño a la última y la fiabilidad de una gran marca, la caja externa para SSD/HDD SATA de 2.5 Coolbox SCA2513 te permitirá sacar un mayor partido a tus unidades de almacenamiento. Este modelo soporta discos de hasta 2 TB y cuenta con conectividad USB 3.0 de alta velocidad.', 'Coolbox', 0),
(1959, 'Tooq TQE-2222B - Caja externa M.2 NVMe', 'https://www.neobyte.es/75139-large_default/tooq-tqe-2222b-caja-externa-m2-nvme.jpg', 22.91, 'Tooq TQE-2222B M.2 NVMe USB 3.1 Gen 2 - Caja externa', 'Tooq', 0),
(1960, 'Tooq TQE-2527BL - Caja externa 2.5 USB 3.0', 'https://www.neobyte.es/34895-large_default/caja-externa-tooq-tqe-2527bl-25-usb-31.jpg', 7.9, 'Caja externa TooQ TQE-2527BL para discos duros de 2.5 SATA de hasta 9.5 mm de alto. Cuenta con carcasa de aluminio, lo que permite una óptima disipación del calor, y conexión a través de USB 3.0 con velocidades de transferencia de hasta 5.0 Gbps. También incluye indicador LED.', 'Tooq', 0),
(1961, 'Coolbox SCA2523C - Caja externa USB-C 3.0 2.5 Negro', 'https://www.neobyte.es/8464-large_default/caja-externa-coolbox-sca2523tc-negro-usb-c-30-25.jpg', 14.9, 'La caja externa Coolbox SCA2523C está a la última, y es que incorpora conectividad USB 3.0 tipo C para una mayor compatibilidad con los dispositivos más actuales. Fabricada en aluminio y plástico ABS, soporta unidades SSD y discos SATA de 2.5 de hasta 2 TB. Un accesorio práctico, asequible y fiable que en Neobyte te traemos a un precio realmente competitivo.', 'Coolbox', 0),
(1962, 'Startech M2-USB-C-NVME-SATA - Caja externa M.2', 'https://www.neobyte.es/76121-large_default/startech-m2-usb-c-nvme-sata-caja-externa-m-2.jpg', 75.9, 'Startech M2-USB-C-NVME-SATA - Caja externa M.2', 'Startech', 0),
(1963, 'CAJA EXTERNA CONCEPTRONIC PARA SSD M.2 SATA - USB 3.2', 'https://www.neobyte.es/48372-large_default/caja-externa-conceptronic-para-ssd-m2-sata-usb-32.jpg', 25.89, 'Caja Externa Conceptronic Hde01g Ssd M.2 Usb-c 3.2', 'Conceptronic', 0),
(1964, 'CAJA EXTERNA TOOQ TQE-2281G M.2 SATA', 'https://www.neobyte.es/64029-large_default/caja-externa-tooq-tqe-2281g-m2-sata.jpg', 11.89, 'CAJA EXTERNA TOOQ TQE-2281G M.2 SATA', 'Tooq', 0),
(1965, 'Coolbox COO-MCM-NVME - Caja externa SSD M.2 USB 3.1', 'https://www.neobyte.es/35620-large_default/caja-externa-coolbox-coo-mcm-nvme-m2-usb-31.jpg', 25.89, 'Caja externa para SSD M.2 Coolbox COO-MCM-NVME, un accesorio de tamaño compacto y diseño elegante y resistente que te permitirá convertir tu M.2 en una unidad de almacenamiento externo de alta velocidad. Este modelo ofrece una extraordinaria compatibilidad y cuenta con puerto USB-C para una transferencia de datos más rápida y sencilla.', 'Coolbox', 0),
(1966, 'CAJA EXTERNA CONCEPTRONIC PARA HDD / SSD 2.5 - USB 3.1', 'https://www.neobyte.es/48074-large_default/caja-externa-conceptronic-para-hdd-ssd-25-usb-31.jpg', 19.9, 'Caja Externa Conceptronic Para Hdd / Ssd 2.5 - Usb 3.1', 'Conceptronic', 0),
(1967, 'Coolbox SCA2523 - Caja externa USB 3.0 2.5 Negro', 'https://www.neobyte.es/8462-large_default/caja-externa-coolbox-sca2523-negro-usb-30-25.jpg', 11.89, 'Saca más partido a tus discos HDD/SSD de 2.5 con la caja externa Coolbox SCA2523 de color negro, fabricada con materiales de primera calidad para proporcionarte la durabilidad y estilo que exige tu día a día. Además, es muy fácil de montar e integra conectividad USB 3.0, lo que se traduce en una transferencia de archivos mucho más veloz.', 'Coolbox', 0),
(1968, 'Caja externa para SSD M.2 Ewent EW7023 USB 3.1', 'https://www.neobyte.es/6300-large_default/caja-externa-ewent-para-ssd-m2-usb-3-1.jpg', 12.9, 'Compra en Neobyte esta caja externa Ewent EW7023 y protege tu unidad de almacenamiento SSD M.2 a la par que le añades interesantes funciones como la transferencia ultrarrápida de datos a través del puerto USB que incorpora. Tan simple como introducir tu SSD en la carcasa y conectar a tu dispositivo compatible. Además, su sólida fabricación en aluminio lo mantendrá a salvo de golpes, vibraciones, suciedad...', 'Eminent- ewent', 0),
(1969, 'Coolbox M2503 - Caja externa USB 3.0 2.5 Blanca', 'https://www.neobyte.es/8455-large_default/caja-externa-coolbox-m2503-blanca-usb-30-25.jpg', 11.89, 'Compacta y asequible carcasa externa para discos HDD y SSD SATA de 2.5 Coolbox M2503, fabricada en acero y plástico de gran calidad para ofrecer una resistencia fantástica. Este modelo cuenta con conectividad USB 3.0 de alta velocidad y soporta unidades de hasta 2 TB.', 'Coolbox', 0),
(1970, 'Funda de silicona para disco duro 2.5', 'https://www.neobyte.es/11640-large_default/funda-de-silicona-disco-duro-2-5.jpg', 4.5, 'Protege tu disco duro de 2.5 pulgadas de golpes accidentales con esta práctica y económica funda de silicona StarTech HDDSLEV25.', 'Startech', 0),
(1971, 'Nox Lite35 - Caja externa 3.5 USB 3.0', 'https://www.neobyte.es/32614-large_default/caja-externa-nox-hdd-ssd-35-nxlitehdd35-30.jpg', 20.9, 'Convierte cualquier disco duro SATA de 3,5” en un disco duro externo con la caja Nox Lite35. Un modelo fabricado en aluminio para una disipación más eficiente del calor y de fácil instalación (plug&play). Presenta un diseño ligero y compacto para guardar y transportar tus datos y archivos multimedia. Funciona mediante adaptador de corriente y cuenta con conexión USB 3.0 para obtener velocidades de transferencia de hasta 5 GB/s.', 'Nox', 0),
(1972, 'Tooq TQE-2527PB Azul Micro USB 3.1 - Caja externa 2.5', 'https://www.neobyte.es/109923-large_default/tooq-tqe-2527pb-azul-micro-usb-31-caja-externa-25.jpg', 8.91, 'Asegura la integridad de tus datos con la caja externa Tooq TQE-2527PB para discos duros o unidades SSD de 2.5. Fabricada en aluminio y diseñada para admitir unidades con conectividad SATA III, este dispositivo asegura una buena tasa de transferencia de datos gracias a su conector USB 3.1. Dispone también de un indicador LED de lectura y escritura para que sepas cuando está en medio de algún proceso y no lo desconectes por error. Convierte tus discos duros o SSD 2.5 en unidades externas con un toque de elegancia y tranquilidad.', 'Tooq', 0),
(1973, 'Synology DiskStation DS224+ (2 bahías) - Servidor NAS', 'https://www.neobyte.es/101825-large_default/synology-diskstation-ds224-2-bahias-servidor-nas.jpg', 366.9, '', 'Synology', 0),
(1974, 'Synology DiskStation DS923+ - Servidor NAS', 'https://www.neobyte.es/89586-large_default/synology-diskstation-ds923-servidor-nas.jpg', 646.9, 'En conclusión, el Synology DiskStation DS923+ se presenta como una solución integral para el manejo eficiente de datos y la protección de activos digitales. Su rendimiento excepcional, capacidad de adaptación del almacenamiento, funciones avanzadas de gestión de datos y seguridad multicapa lo posicionan como un dispositivo líder en el ámbito de soluciones NAS.', 'Synology', 0),
