(1976, 'Qnap TS-233 Quad Core 2GB - Servidor NAS 2 bahías', 'https://www.neobyte.es/71685-large_default/qnap-ts-233-quad-core-2gb-servidor-nas-2-bahias.jpg', 224.9, 'Qnap TS-233 Quad Core 2GB - Servidor NAS 2 bahías', 'Qnap', 0),
(1977, 'Synology DiskStation DS723+ - Servidor NAS', 'https://www.neobyte.es/89580-large_default/synology-diskstation-ds723-servidor-nas.jpg', 524.9, 'En resumen, Synology DiskStation DS723+ no solo redefine la administración de datos, sino que también brinda un rendimiento excepcional, almacenamiento flexible y versátil, y una sólida estrategia de copia de seguridad multicapa. Este dispositivo se presenta como una solución integral para las crecientes demandas de almacenamiento y gestión de datos en entornos digitales dinámicos.', 'Synology', 0),
(1978, 'Qnap TS-431K - Servidor NAS 4 bahías', 'https://www.neobyte.es/40821-large_default/servidor-nas-qnap-ts-431k.jpg', 327.9, 'Te presentamos el Qnap TS-431K, un NAS de tamaño compacto y diseño minimalista que ha nacido para su integración en el ámbito doméstico. Dispone de capacidad para hasta 4 unidades de almacenamiento y, gracias a su configuración sencilla te pemitirá crear una nube personal sin complicaciones. Entre sus especificaciones técnicas más importantes, destacar el procesador de 4 núcleos y la memoria RAM de 1GB. Ya en Neobyte el Qnap TS-431K.', 'Qnap', 0),
(1979, 'Synology DS620slim - Servidor NAS', 'https://www.neobyte.es/38310-large_default/servidor-nas-synology-ds620-slim.jpg', 507.9, 'Compacto, elegante y versátil, el NAS Synology DS620slim es la conjunción perfecta entre rendimiento y estilo. Este modelo permite albergar hasta 6 unidades HDD/SSD de 2.5, convirtiéndose en una opción idónea para todo tipo de aplicaciones: multimedia, profesional... Para un acceso más rápido a la información contenida, está provisto de procesador Intel Celeron J3355 de dos núcleos y 2GB de memoria RAM. Además, el Synology DS620slim cuenta con diferentes alternativas de configuración, gestión y seguridad.', 'Synology', 0),
(1980, 'Synology DS120J - Servidor NAS', 'https://www.neobyte.es/26212-large_default/synology-ds120j-servidor-nas.jpg', 106.9, 'El Synology DS120J es una solución de almacenamiento centralizada con la que podrás compartir fotos, vídeos, etc. con todos los dispositivos domésticos, ordenadores y smartphones, realizar copias de seguridad y mantener todos tus archivos guardados con total seguridad. Un primer NAS perfecto para toda la familia gracias al cual dispondrás de una solución de nube personal que permite gestionar los datos de manera más cómoda e integrarse a la perfección con tu tablet, teléfono móvil, etc. ¡Hazte ya con el Synology DS120J!', 'Synology', 0),
