(1986, 'Asustor Drivestor 4 Pro Gen 2 AS3304T v2 (4 bahías) - Servidor NAS', 'https://www.neobyte.es/111179-large_default/asustor-drivestor-4-pro-gen-2-as3304t-v2-4-bahias-servidor-nas.jpg', 399.91, 'Con 2 GB de RAM DDR4, el Drivestor Pro Gen 2 gestiona multitareas con facilidad, asegurando un funcionamiento sin problemas para cualquier tarea. Su eficiencia y potencia se destacan al transcodificar multimedia 4K H.265 de 10 bits con decodificación por hardware, brindando una reproducción de vídeo increíblemente fluida en LooksGood. Este NAS representa una solución asequible y de alto rendimiento para individuos y familias que buscan una nube personal accesible con altas velocidades.', 'Asustor', 0),
(1987, 'Qnap TS-431XEU-2G - Servidor NAS', 'https://www.neobyte.es/33197-large_default/servidor-nas-qnap-ts-431xeu-2g.jpg', 648.9, 'El Qnap TS-431XEU-2G es perfecto para instarlo en un rack compacto o lugares con una gran cantidad de cableado gracias a su poca profundidad. Un servidor NAS multifuncional que se ajustará a las necesidades de empresas que buscan realizar copias de seguridad, restauración, nube privada, almacenamiento para virtualización y preparar para el futuro su infraestructura de TI para redes 10GbE. El Qnap TS-431XEU-2G cuenta con procesador de cuatro núcleos y un puerto 10GbE SFP+ para dar soporte completo a las redes de alta velocidad. Hazte ya con él en nuestra tienda online.', 'Qnap', 0),
