(2005, 'Samsung T7 Shield 1TB - Disco duro SSD externo', 'https://www.neobyte.es/82535-large_default/samsung-t7-shield-1tb-disco-duro-ssd-externo.jpg', 108.9, 'Este dispositivo cuenta con software exclusivo de Samsung para una gestión eficiente. Permite la configuración de contraseñas y la actualización del firmware, siendo compatible con una amplia gama de dispositivos, incluyendo PC, Mac y smartphones y tablets Android. Este software no solo facilita el monitoreo del estado del SSD, sino que también mejora su rendimiento, asegurando su funcionamiento de manera óptima.', 'Samsung', 0),
(2006, 'Samsung T9 2TB - Disco duro SSD externo', 'https://www.neobyte.es/103661-large_default/samsung-t9-2tb-disco-duro-ssd-externo.jpg', 235.94, 'El T9 se destaca no solo por su inmensa capacidad y rapidez, sino también por su portabilidad y seguridad excepcionales. Con una capacidad de 2TB, este modelo combina un generoso espacio de almacenamiento con un diseño compacto y liviano, pesando solo 122 gramos. Su superficie rugosa y antideslizante garantiza un transporte cómodo y seguro. Esta combinación de características lo convierte en una opción sobresaliente para aquellos que valoran un dispositivo de almacenamiento rápido, seguro y adaptable, ideal para una variedad de usos y contextos.', 'Samsung', 0),
(2007, 'Samsung T5 EVO 2TB - Unidad SSD externa', 'https://www.neobyte.es/108242-large_default/samsung-t5-evo-2tb-unidad-ssd-externa.jpg', 186.9, 'También destaca por su avanzada gestión térmica, que garantiza un rendimiento óptimo sin sobrecalentamientos. Además, su amplia compatibilidad lo convierte en un dispositivo extremadamente versátil, capaz de conectarse con una variedad de plataformas, desde Windows y MacOS hasta Android.', 'Samsung', 0),
(2008, 'Samsung T7 Shield 2TB - Disco duro SSD externo', 'https://www.neobyte.es/82539-large_default/samsung-t7-shield-2tb-disco-duro-ssd-externo.jpg', 189.9, 'Este modelo viene con el software exclusivo de Samsung, que facilita una administración integral del dispositivo. Compatible con PC, Mac y dispositivos Android, este software permite desde la configuración de contraseñas hasta la actualización de firmware, mejorando así el rendimiento general. Además, proporciona herramientas para monitorizar el estado del SSD, optimizando su funcionamiento y asegurando una experiencia de usuario superior.', 'Samsung', 0),
