(2086, 'Ewent EW1052 - Lector de tarjetas USB 2.0', 'https://www.neobyte.es/16151-large_default/lector-dni-ewent-ew1052-usb-20.jpg', 6.9, 'Fácil de instalar y usar, el lector de tarjetas Ewent EW1052 es perfecto para la lectura de DNI y tarjetas inteligentes formato ID-1, estando aprobado por la CAC y siendo compatible con PC / SC, así como WHQL. Un modelo con interfaz USB 2.0, compatible con USB 1.1, que no necesita adaptadores de corriente ni cables adicionales. Cómodo y seguro.', 'Eminent- ewent', 0),
