(2092, 'Kingston CANVAS Select Plus 64GB - Tarjeta MicroSD + Adaptador', 'https://www.neobyte.es/109967-large_default/kingston-canvas-select-plus-64gb-tarjeta-microsd-adaptador.jpg', 6.9, 'Explora un rendimiento superior con la microSD Kingston CANVAS Select Plus 64GB. Diseñada para dispositivos Android y con un destacado rendimiento de nivel A1, esta tarjeta microSD acelera la carga de aplicaciones y permite capturar imágenes y videos con mayor rapidez. Además, gracias a sus velocidades de UHS-I Clase 10 de hasta 100 MB/s, es ideal para la grabación de videos en alta definición y la toma de fotografías de alta calidad. La durabilidad y confiabilidad son características clave, respaldadas por exhaustivas pruebas en diversos entornos.', 'Kingston', 0),
(2093, 'Kingston CANVAS Select Plus 128GB CL10 - Tarjeta MicroSD + Adaptador', 'https://www.neobyte.es/64384-large_default/kingston-canvas-select-plus-128gb-cl10-tarjeta-microsd.jpg', 10.9, 'TARJETA MICRO SD KINGSTON SELECT 128GB CL10', 'Kingston', 0),
