(2104, 'Kingston CANVAS Select Plus 128GB CL10 - Tarjeta MicroSD', 'https://www.neobyte.es/64358-large_default/kingston-canvas-select-plus-128gb-cl10-tarjeta-microsd.jpg', 11.89, 'TARJETA MICRO SD KINGSTON SELECT 128GB CL10', 'Kingston', 0),
(2105, 'Samsung PRO Endurance 256GB - Tarjeta MicroSD + Adaptador', 'https://www.neobyte.es/91558-large_default/samsung-pro-endurance-256gb-tarjeta-microsd-adaptador.jpg', 35.9, 'Samsung PRO Endurance 256GB - Tarjeta MicroSD', 'Samsung', 0),
(2106, 'Kingston CANVAS Go! Plus 64GB CL10 - Tarjeta MicroSD + Adaptador', 'https://www.neobyte.es/64292-large_default/-kingston-canvas-go-plus-64gb-cl10-tarjeta-microsd-adaptador.jpg', 9.9, 'TARJETA MICRO SD KINGSTON CANVAS 64GB CL10', 'Kingston', 0),
(2107, 'Kingston CANVAS Select Plus 256GB CL10 - Tarjeta SD', 'https://www.neobyte.es/109976-large_default/kingston-canvas-select-plus-256gb-cl10-tarjeta-sd.jpg', 19.9, 'Experimenta un rendimiento excepcional con la tarjeta Kingston CANVAS Select Plus 256GB. Diseñada para videocámaras Full HD en 1080p, esta tarjeta ofrece un excelente rendimiento, velocidad y durabilidad. Con velocidades UHS-I Clase 10 de hasta 100 MB/s, facilita el almacenamiento y agiliza las transferencias, brindándote la capacidad de capturar y desarrollar fotos de alta resolución o grabar vídeos Full HD de calidad cinematográfica. Construida para enfrentar cargas de trabajo de alta densidad, esta tarjeta te acompaña en entornos difíciles, asegurando la protección de tus archivos, fotos y vídeos. Disfruta de una experiencia de grabación sin preocupaciones con esta tarjeta Canvas Select Plus.', 'Kingston', 0),
(2108, 'Kingston DataTraveler Micro 64GB - Pendrive USB 3.2', 'https://www.neobyte.es/81376-large_default/kingston-datatraveler-micro-64gb-pendrive-usb-3-2.jpg', 8.91, 'Kingston DataTraveler Micro 64GB - Pendrive USB 3.2', 'Kingston', 0),
(2109, 'SanDisk Extreme Pro 64GB - Tarjeta SDXC', 'https://www.neobyte.es/94580-large_default/sandisk-extreme-pro-64gb-tarjeta-sdxc.jpg', 15.9, 'SanDisk Extreme Pro 64GB - Tarjeta SDXC', 'Sandisk', 0),
(2110, 'Samsung Pro Ultimate 128GB - Tarjeta MicroSD + Adaptador', 'https://www.neobyte.es/108218-large_default/samsung-pro-ultimate-128gb-tarjeta-microsd-adaptador.jpg', 23.9, 'Samsung Pro Ultimate 128GB - Tarjeta MicroSD + Adaptador', 'Samsung', 0),
(2111, 'Kingston CANVAS Select Plus 128GB CL10 - Tarjeta SD', 'https://www.neobyte.es/64371-large_default/kingston-canvas-select-plus-128gb-cl10-tarjeta-sd.jpg', 11.89, 'TARJETA SD KINGSTON SELECT 128GB CL10', 'Kingston', 0),
