(2116, 'Kingston CANVAS Go! Plus 64GB CL10 - Tarjeta SD', 'https://www.neobyte.es/94446-large_default/kingston-canvas-go-plus-64gb-cl10-tarjeta-sd.jpg', 9.9, 'Kingston CANVAS Go! Plus 64GB CL10 - Tarjeta SD', 'Kingston', 0),
(2117, 'Kingston CANVAS Go! Plus 128GB CL10 - Tarjeta SD', 'https://www.neobyte.es/94440-large_default/kingston-canvas-go-plus-128gb-cl10-tarjeta-sd.jpg', 14.9, 'Kingston CANVAS Go! Plus 128GB CL10 - Tarjeta SD', 'Kingston', 0),
(2118, 'Samsung Pro Ultimate 256GB - Tarjeta MicroSD + Adaptador', 'https://www.neobyte.es/108222-large_default/samsung-pro-ultimate-256gb-tarjeta-microsd-adaptador.jpg', 38.9, 'Samsung Pro Ultimate 256GB - Tarjeta MicroSD + Adaptador', 'Samsung', 0),
(2119, 'Asus SDRW-08D2S-U - Grabadora DVD externa', 'https://www.neobyte.es/11424-large_default/grabadora-asus-dvd-sdrw-08d2s-u-usb-negra.jpg', 30.9, 'Buscas una grabadora DVD externa de garantías y aquí la tienes. Esta Asus SDRW-08D2S-U posee un diseño elegante que encaja a la perfección en tu escritorio. Además, ofrece un funcionamiento sencillo y seguro para empezar a utilizarla cómodamente desde el minuto uno. Consíguela a un precio fantástico en Neobyte.', 'Asus', 0),
(2120, 'Asus SDRW-08D2S-U Blanco - Grabadora externa', 'https://www.neobyte.es/16676-large_default/grabadora-asus-dvd-sdrw-08d2s-u-usb-blanco.jpg', 31.9, 'La grabadora externa Asus SDRW-08D2S-U en blanco combina un diseño elegante y ultrafino con unos materiales de calidad que garantizan un funcionamiento estable y duradero. Integra conectividad USB 2.0, es compatible tanto con Windows como con Mac y cuenta con cifrado de datos, que dobla la seguridad mediante las funcionalidades de control de contraseña y ocultación de archivos. Ya puedes hacerte con la Asus SDRW-08D2S-U a un precio excepcional en Neobyte, con entrega en 24/48 horas.', 'Asus', 0),
(2121, 'GRABADORA EXTERNA ASUS SDRW-08D2S-U LITE BLANCA', 'https://www.neobyte.es/64032-large_default/grabadora-externa-asus-sdrw-08d2s-u-lite-blanca.jpg', 30.9, 'Grabadora Dvd Slim Externa Asus Sdrw-08d2s-u Lite Blanca', 'Asus', 0),
(2122, 'Hitachi Super Multi Blade DVD Slim - Grabadora externa', 'https://www.neobyte.es/61219-large_default/hitachi-super-multi-blade-dvd-slim-grabadora-externa.jpg', 46.9, 'GRABADORA EXTERNA HITACHI DVD M-DISC 8X', 'HITACHI', 0),
(2123, 'Hitachi DVD Slim Blanca - Grabadora externa', 'https://www.neobyte.es/61889-large_default/hitachi-dvd-slim-blanca-grabadora-externa.jpg', 25.89, 'GRABADORA EXTERNA HITACHI GP57EW40 - DVD SUPER MU', 'HITACHI', 0),
(2124, 'Asus TurboDrive BW-16D1H-U Pro - Grabadora Blu-ray externa', 'https://www.neobyte.es/27654-large_default/grabadora-asus-bw-16d1h-u-pro-bluray-externa-usb-3.jpg', 159.9, 'GRABADORA EXTERNA HITACHI GP57EW40 - DVD SUPER MU', 'Asus', 0),
(2125, 'Apple Superdrive - Grabadora USB', 'https://www.neobyte.es/14152-large_default/apple-usb-superdrive-md564zm-a.jpg', 82.9, 'La grabadora USB Apple SuperDrive (MD564ZM/A) te permitirá reproducir tus CD’s y DVD’s conectándola a tu iMac de una forma fácil. Un modelo que presenta un diseño elegante y compacto, un bajo consumo (por lo que no utiliza cargador externo) y, en Neobyte, un precio fantástico.', 'Apple', 0),
(2126, 'Asus ZenDrive U9M SDRW-08U9M-U Oro - Grabadora CD/DVD externa USB / USB-C', 'https://www.neobyte.es/22046-large_default/grabadora-asus-zendrive-u9m-oro-sdrw-08u9m-u.jpg', 39.91, 'Por su diseño elegante y ultra-delgado, la grabadora externa Asus ZenDrive U9M (SDRW-08U9M-U) de color dorado es perfecta para llevar cómodamente a cualquier parte o utilizar junto a tu ordenador de altas prestaciones. Compatible con CD y DVD, proporciona una versatilidad extraordinaria gracias a su conectividad USB y USB-C de última generación. Consigue ya tu Asus ZenDrive U9M (SDRW-08U9M-U) en Neobyte.', 'Asus', 0),
(2127, 'Asus SBW-06D5H-U - Grabadora Blu-ray portátil', 'https://www.neobyte.es/27520-large_default/grabadora-asus-blu-ray-sbw-06d5h-externa-31.jpg', 120.9, 'La ASUS SBW-06D5H-U es una grabadora Blu-ray portátil compatible con interfaz USB-C y USB-A que podrás transportar fácilmente por su peso ligero y diseño ultradelgado. Un modelo que garantiza un gran rendimiento gracias al estándar USB 3.1, diez veces más rápido que el USB 2.0, y que es compatible con M-DISC, una solución de almacenamiento muy resistente que hace gala de una gran durabilidad, diseñada para proteger los archivos más importantes. ASUS SBW-06D5H-U es compatible tanto con Windows como con Mac y puedes hacerte con ella en Neobyte a un precio irrestible.', 'Asus', 0),
(2128, 'Asus ZenDrive U7M SDRW-08U7M-U Plata - Grabadora CD/DVD externa USB', 'https://www.neobyte.es/21997-large_default/grabadora-asus-zendrive-u7m-plata-sdrw-08u7m-u.jpg', 37.9, 'Asus ZenDrive U7M (SDRW-08U7M-U) de color plata es una grabadora de DVD/CD externa ultrafina que ofrece una compatibilidad sensacional (Windows y Mac) y cuenta con un diseño de inspiración Zen sumamente elegante. Compatible con la tecnología M-Disc, proporciona una grabación rápida, segura y fiable. Ya puedes comprar la Asus ZenDrive U7M (SDRW-08U7M-U) en Neobyte con las máximas garantías y envío en tiempo récord.', 'Asus', 0),
(2129, 'GRABADORA ASUS ZENDRIVE U9M ROSA SDRW-08U5S-U', 'https://www.neobyte.es/44030-large_default/grabadora-asus-zendrive-u9m-rosa-sdrw-08u5s-u.jpg', 41.85, 'Grabadora Asus Zendrive U9m Rosa Sdrw-08u5s-u', 'Asus', 0),
(2130, 'Asus Zendrive U9M - Grabadora DVD externa', 'https://www.neobyte.es/15008-large_default/grabadora-asus-zendrive-u9m-negra-sdrw-08u9m-u.jpg', 40.9, 'La grabadora externa Asus ZenDrive U9M (SDRW-08U9M-U) es pura versatilidad y rendimiento. Ha sido equipada con cables USB-C y USB-A, lo que posibilita su utilización con ordenadores Windows y Mac OS y permite una conexión más sencilla y rápida. Un modelo compatible con M-DISC, una solución de archivo diseñada para proteger datos, manteniéndolos a salvo durante un milenio. Además, la Asus ZenDrive U9M es la mejor opción para realizar copias de seguridad de forma sencilla. Gracias al software Cyberlink Power2go 8 el proceso de grabación se simplifica, protegiendo tus archivos con funciones de cifrado opcionales, mientras que con Nero BackItUp podrás hacer copias de seguridad de dispositivos Android sin cables. Por último, mencionar su diseño elegante, con un perfil ultrafino de 13 mm.', 'Asus', 0),
(2131, 'LG - Hitachi DVD Slim Negra - Grabadora externa', 'https://www.neobyte.es/85438-large_default/lg-hitachi-dvd-slim-negra-grabadora-externa.jpg', 34.9, 'LG - Hitachi DVD Slim Negra - Grabadora externa', 'LG', 0),
(2132, 'Bobina Verbatim DVD-R 4.7GB 16X 10UD P/N 43523', 'https://www.neobyte.es/7175-large_default/bobina-verbatim-dvd-r-4-7gb-16x-10ud-p-n-43523.jpg', 5.9, 'Pack Verbatim de 10 DVD con superficie imprimible. Un producto de gran calidad, ideal para almacenar fotos, vídeos y todo de tipo de archivos de forma segura y con una extraordinaria compatibilidad.', 'Verbatim', 0),
(2133, 'Bobina Verbatim DVD-R 4.7GB 16X 25UD P/N 43538', 'https://www.neobyte.es/7179-large_default/bobina-verbatim-dvd-r-4-7gb-16x-25ud-p-n-43538.jpg', 10.9, 'Pack Verbatim de 25 DVD con superficie imprimible. Un producto de gran calidad, ideal para almacenar fotos, vídeos y todo de tipo de archivos de forma segura y con una extraordinaria compatibilidad.', 'Verbatim', 0),
(2134, 'Bobina Verbatim DVD+R 4.7GB 16x 10 UD P/N 43498', 'https://www.neobyte.es/7181-large_default/bobina-verbatim-dvd-r-4-7gb-16x-10-ud-p-n43498.jpg', 5.9, 'Tarrina Verbatim de 10 DVD+R con una capacidad de 4.7 GB. Una solución perfecta para almacenar copias de seguridad, fotos, vídeos, documentos y todo tipo de archivos.', 'Verbatim', 0),
(2135, 'Bobina Verbatim DVD+R 4.7GB 16X TUBO 25UD P/N 43500', 'https://www.neobyte.es/7177-large_default/bobina-verbatim-dvd-r-4-7gb-16x-tubo-25ud-p-n43500.jpg', 8.91, 'Bobina Verbatim de 25 DVD+R con una capacidad de 4.7 GB. Una solución perfecta para almacenar copias de seguridad, fotos, vídeos, documentos y todo tipo de archivos.', 'Verbatim', 0),
(2136, 'TP-Link TL-PA4220KIT AV500 2 puertos WiFi 300 mb/s', 'https://www.neobyte.es/2986-large_default/plc-tp-link-tl-pa4220kit-av500-2-port-wifi-300mbs.jpg', 60.9, 'Pack compuesto por: TL-WPA4220 (WiFi) y TL-PA4010 (Ethernet) / Velocidad máxima wireless: hasta 300 mbps / Velocidad máxima Ethernet: 500 mbps / Fácil configuración', 'Tp-link', 0),
(2137, 'PLC TP-LINK TL-PA7017P KIT GIGABIT - PASSTHROUGH', 'https://www.neobyte.es/58145-large_default/plc-tp-link-tl-pa7017p-kit-gigabit-passthrough.jpg', 54.9, 'PLC TP-LINK TL-PA7017P KIT GIGABIT PASSTHROUGH', 'Tp-link', 0),
(2138, 'TP-Link TL-WPA4221 Kit - PLC AV600', 'https://www.neobyte.es/36559-large_default/plc-tp-link-tl-wpa4221-kit-av600.jpg', 60.9, 'Disfruta de transmisión de datos de alta velocidad con el TP-Link TL-WPA4221 Kit utilizando el cableado eléctrico existente en casa. Un sistema perfecto para streaming de vídeo y juegos online que no requiere de configuración: simplemente enchufa el TL-PA4010 a la pared y conéctalo al router con un cable Ethernet. Luego enchufa el TL-WPA4220 en la toma de corriente que quieras y ¡ya lo tienes! Intenet en cada rincón de tu casa con el kit TP-Link TL-WPA4221.', 'Tp-link', 0),
(2139, 'PLC TP-LINK TL-WPA7517 KIT WIFI AC750', 'https://www.neobyte.es/58136-large_default/plc-tp-link-tl-wpa7517-kit-wifi-ac750.jpg', 68.9, 'PLC TP-LINK TL-WPA7517 KIT WIFI', 'Tp-link', 0),
(2140, 'TP-Link TL-PA7017 - Kit PLC AV1000 Powerline', 'https://www.neobyte.es/25942-large_default/plc-tp-link-tl-pa7017-kit-av1000-1-puerto-gigabit.jpg', 46.9, 'El TP-Link TL-PA7017 te permitirá extender tu red Gigabit a través del cableado eléctrico. Este Kit AV1000 Powerline es compatible con el estándar HomePlug AV2, lo que se traduce en velocidades de transferencia de datos de alta velocidad y una conexión estable. Cuenta con un puerto Gigabit para conectar dispositivos de ancho de banda intensivo, no requiere de configuración y dispone de modo ahorro de energía para un menor consumo. ¡Hazte con el PLC TP-Link TL-PA7017 al mejor precio en Neobyte!.', 'Tp-link', 0),
(2141, 'TP-Link TL-PA4010KIT AV500 Nano Powerline', 'https://www.neobyte.es/35127-large_default/plc-tp-link-tl-pa4010kit-av500-nano-powerline.jpg', 40.9, 'Pack de 2 unidades / Diseño muy compacto / Convierte el cableado eléctrico en red de alta velocidad / Velocidad máxima: 500 mbps / Encriptación: 128-bit AES', 'Tp-link', 0),
(2142, 'TP-Link TL-PA4010P KIT - Kit PLC', 'https://www.neobyte.es/31086-large_default/plc-tp-link-tl-pa4010p-kit-pn0162500133.jpg', 48.9, 'Pack de 2 unidades / Diseño muy compacto / Convierte el cableado eléctrico en red de alta velocidad / Velocidad máxima: 500 mbps / Encriptación: 128-bit AES', 'Tp-link', 0),
(2143, 'TP-Link TL-WPA4226KIT Wifi AV500 - Adaptador PLC', 'https://www.neobyte.es/9784-large_default/plc-tp-link-tl-wpa4226kit-wifi-av500.jpg', 71.9, 'Pack compuesto por: 1 x TL-WPA4220 y 1 x TL-PA4020P / Fácil configuración / Hasta 500 mbps por red eléctrica y 300 mbps WiFi', 'Tp-link', 0),
(2144, 'PLC TP-LINK TL-WPA4220T KIT', 'https://www.neobyte.es/42721-large_default/plc-tp-link-tl-wpa4220t-kit.jpg', 106.9, 'Plc Tp-link Tl-wpa4220t Kit', 'Tp-link', 0),
(2145, 'PLC TP-LINK TL-WPA7617 KIT WIFI AC1200 - PASSTHROUGH', 'https://www.neobyte.es/58139-large_default/plc-tp-link-tl-wpa7617-kit-wifi-ac1200-passthrough.jpg', 81.9, 'PLC TP-LINK TL-WPA7617 KIT WIFI', 'Tp-link', 0),
(2146, 'TP-Link TL-WPA4220 - PLC AV500', 'https://www.neobyte.es/25949-large_default/plc-tp-link-tl-wpa4220-wireless.jpg', 42.89, 'Ampliar la cobertura Wifi de tu casa es tan simple como hacerte con el TP-Link TL-WPA4220. Este PLC cuenta con un botón de clonado Wifi que permite una super extensión de cobertura y facilita la movilidad sin cortes dentro de la red doméstica. Podrás ampliar sin esfuerzo tu red Wifi a través del Powerline existente y retransmitir una señal inalámbrica para compartir con todos sus dispositivos en otras zonas de su casa u oficina.', 'Tp-link', 0),
(2147, 'PLC TP-LINK TL-WPA8631P PASSTHROUGH WIFI AC1300', 'https://www.neobyte.es/58491-large_default/plc-tp-link-tl-wpa8631p-passthrough-wifi-ac1300.jpg', 99.9, 'PLC TP-LINK TL-WPA8631P PASSTHROUGH WIFI AC1300', 'Tp-link', 0),
(2148, 'Devolo Magic 1 Wifi Starter Kit - Kit Adaptador PLC', 'https://www.neobyte.es/40507-large_default/plc-devolo-magic-1-wifi-starter-kit-8365.jpg', 90.9, 'Devolo Magic 1 Wifi Starter Kit es una solución sencilla y efectiva para conseguir una conexión a internet estable y rápida en toda tu casa. Este sistema utiliza la red eléctrica doméstica para transmitir datos a alta velocidad, incorporando una innovadora tecnología que se combina perfectamente con un amplificador Wifi de alto nivel para olvidarte de las conexiones lentas y entrecortadas. ¡Hazte con el Devolo Magic 1 Wifi Starter Kit al mejor precio en Neobyte!', 'Devolo', 0),
