(2157, 'Ubiquiti Nanostation Loco M5 5GHz Indoor/Outdoor', 'https://www.neobyte.es/9721-large_default/antena-ubiquiti-nanostation-loco-m5-5ghz-indoor.jpg', 66.9, '¿Buscas un crear una red punto a punto? Con la Ubiquiti Nanostation Loco M5 es ideal para esta tarea. Te permite unir dos redes físicas en una de sola, de manera que podrás compartir todos los datos entre dos oficinas o proporcionar Internet a otra de ellas. Su frecuencia de trabajo de 5Ghz estará libre de interferencias con otras Wi-Fi de 2.4GHz. Además, su reducido tamaño permite que sea más fácil de colocar y más versátil.', 'Ubiquiti', 0),
(2158, 'Ubiquiti Nanostation M2 Indoor/Outdoor', 'https://www.neobyte.es/9725-large_default/antena-ubiquiti-nanostation-m2-2-4ghz-11dbi.jpg', 87.89, '¿Buscas un crear una red punto a punto? Con la Ubiquiti Nanostation M2 es ideal para esta tarea. Te permite unir dos redes físicas en una de sola, de manera que podrás compartir todos los datos entre dos oficinas o proporcionar Internet a otra de ellas. Su banda de 2.4Ghz te proporciona la máxima compatibilidad entre todos los dispositivos. Su alimentación POE te permite tener únicamente un cable de red conectado en su base. Está preparada para ser colocada tanto en interiores como en exteriores.', 'Ubiquiti', 0),
(2159, 'Ubiquiti Nanostation M5 5GHz Indoor/Outdoor', 'https://www.neobyte.es/9723-large_default/antena-ubiquiti-nanostation-m5-5ghz-indoor.jpg', 87.89, '¿Buscas un crear una red punto a punto? Con la Ubiquiti Nanostation M5 es ideal para esta tarea. Te permite unir dos redes físicas en una de sola, de manera que podrás compartir todos los datos entre dos oficinas o proporcionar Internet a otra de ellas. Su frecuencia de trabajo de 5Ghz estará libre de interferencias con otras Wi-Fi de 2.4GHz.', 'Ubiquiti', 0),
