(2161, 'Asus USB-BT400 - Adaptador USB Bluetooth 4.0 Mini', 'https://www.neobyte.es/13158-large_default/asus-usb-bt400-adaptador-usb-bluetooth-40-mini.jpg', 8.89, 'Discreto y potente adaptador de USB a Bluetooth 4.0 Asus USB-BT400, un pequeño dispositivo que te permitirá disfrutar de la conectividad inalámbrica más versátil. Basta con conectarlo a un puerto USB de tu PC o portátil y podrás vincularlo en cuestión de segundos con tu smartphone, altavoces wireless, auriculares e impresoras compatibles.', 'Asus', 0),
(2162, 'Asus USB-BT500 - Adaptador Bluetooth 5.0', 'https://www.neobyte.es/81509-large_default/asus-usb-bt500-adaptador-bluetooth-50.jpg', 10.89, 'Dota a tu ordenador, auriculares, impresora, altavoz, etc. de conectividad Bluetooth con el Asus USB-BT500 y disfruta de conexiones inalámbricas estables y rápidas. Un modelo ultra compacto que podrás llevar contigo cómodamente y que ha sido optimizado para reducir el consumo energético. ¡Hazte ya con él en Neobyte!', 'Asus', 0),
(2163, 'Asus PCE-AXE5400 - Adaptador WiFi 6E + Bluetooth 5.2', 'https://www.neobyte.es/85248-large_default/asus-pce-axe5400-adaptador-wifi-6e-bluetooth-52.jpg', 29.9, 'Software intuitivo: El software ASUS proporciona una configuración sencilla y te permite monitorizar el estado de tu conexión inalámbrica.', 'Asus', 0),
(2164, 'ADAPTADOR TP-LINK BLUETOOTH 4.0 NANO UB4A', 'https://www.neobyte.es/53116-large_default/adaptador-tp-link-bluetooth-40-nano-ub4a.jpg', 9.9, 'Adaptador Tp-link Bluetooth 4.0 Nano Ub4a', 'Tp-link', 0),
(2165, 'TP-Link HA100 - Receptor audio Bluetooth', 'https://www.neobyte.es/36532-large_default/receptor-audio-bluetooth-tp-link-ha100.jpg', 21.9, 'Con el TP-Link HA100 podrás vincular un altavoz con tu smartphone/tablet de forma inalámbrica para reproducir música y disfrutar de un audio más potente. Se trata de un receptor Bluetooth compatible con altavoces con jacks 3.5 mm o RCA que tiene un rango de alcance de 20 metros. Su emparejamiento es muy sencillo, pudiéndolo hacer de manera manual o utilizando la funcionalidad NFC de tu dispositivo para conectarlo automáticamente con solo colocarlo en el TP-Link HA100.', 'Tp-link', 0),
(2166, 'TP-Link Archer T5E - Tarjeta WiFi AC1200 + Bluetooth', 'https://www.neobyte.es/36550-large_default/tarjeta-tp-link-archer-t5e-ac1200-bluetooth.jpg', 30.9, 'Actualiza la conectividad de tu ordenador de sobremesa con la tarjeta PCIe TP-Link Archer T5E con WiFi de alta velocidad y Bluetooth 4.2. Un componente de gran calidad que te permitirá conectarte a la red sin cables, vincular tus periféricos y transferir información de manera fácil, rápida, estable y segura. Además, la tecnología de doble banda de la TP-Link Archer T5E supone una gestión óptima de la señal, siendo perfecta para juegos, reproducción de contenidos en streaming...', 'Tp-link', 0),
