(2203, 'TP-Link RE200 Repetidor de señal Dual Band', 'https://www.neobyte.es/35147-large_default/range-extender-tp-link-re200-750mbs.jpg', 26.9, '¿El Wi-Fi está en tu lista negra? Con esto ya lo puedes borrar de ahí... El repetidor TP-Link RE200 podrás repetir la señal Wi-Fi de tu router hasta la parte de la casa que no te llegue. Además, al ser Dual Band, tu señal podrá ser repetida con más velocidad, hasta 750 Mbps.', 'Tp-link', 0),
(2204, 'TP-Link TL-WA854RE - Extensor de cobertura WiFi', 'https://www.neobyte.es/20953-large_default/range-extender-tp-link-tl-wa854re.jpg', 16.9, 'Asequible pero eficaz, el extensor de cobertura WiFi TP-Link TL-WA854RE es una alternativa ideal para presupuestos ajustados y hogares de pequeño tamaño. Una forma fácil y económica de mejorar la cobertura WiFi y decir adiós a las zonas muertas. De tamaño muy compacto, se instala y configura fácilmente pulsando un solo botón, alcanzando velocidades de hasta 300 Mbps. Consigue al mejor precio el TP-Link TL-WA854RE en nuestra tienda online y recíbelo en tiempo récord.', 'Tp-link', 0),
(2205, 'PUNTO DE ACCESO D-LINK DAP-2610 AC1300 POE', 'https://www.neobyte.es/53829-large_default/punto-de-acceso-d-link-dap-2610-ac1300-poe.jpg', 127.9, 'Punto de acceso D-Link DAP-2610 AC 1300 POE', 'D-link', 0),
(2206, 'RANGE EXTENDER TP-LINK RE505X WIFI AX1500', 'https://www.neobyte.es/53199-large_default/range-extender-tp-link-re505x-wifi-ax1500.jpg', 50.9, 'Range Extender Tp-link Re505x Wifi Ax1500', 'Tp-link', 0),
(2207, 'TP-Link TL-WA855RE WiFi 300 mbs', 'https://www.neobyte.es/35133-large_default/range-extender-tp-link-tl-wa855re-wifi-300mbs.jpg', 22.91, 'Compacto y potente, el extensor de cobertura WiFi TP-Link TL-WA855RE llevará tu señal inalámbrica hasta el último rincón de la tu casa. Su elegante diseño y reducidas dimensiones hacen que pase prácticamente desapercibido, integrándose a la perfección en tu hogar. El TL-WA855RE es muy fácil de configurar y es capaz de alcanzar velocidades de hasta 300 mbps, ideal para ver vídeo en streaming, navegar... Además, si descargas la aplicación móvil Tether, podrás controlar multitud de funciones desde tu smartphone o tablet. ¿Problemas de cobertura WiFi? No con TP-Link.', 'Tp-link', 0),
(2208, 'TP-Link RE450 - Extensor de red WiFi', 'https://www.neobyte.es/20938-large_default/range-extender-tp-link-re450-450mbs.jpg', 60.9, 'Di adiós a las zonas muertas Wi-Fi con TP-Link RE450, un extensor de cobertura inalámbrica que, conectándolo a tu router de siempre, fortalece y amplía la señal para hacerla llegar hasta el último rincón de tu hogar u oficina. Dotado de tecnología Dual Band y tres potentes antenas, alcanza una velocidad máxima de 1750 Mbps. Además, el TP-Link RE450 incorpora luz inteligente que te guiará para su intalación en el lugar óptimo. Se acabaron los cortes y la señal débil.', 'Tp-link', 0),
(2209, 'TP-Link RE300 - Extensor WiFi AC1200 Dual Band', 'https://www.neobyte.es/33080-large_default/range-extender-tp-link-re300-ac1200.jpg', 33.9, 'Extiende la cobertura WiFi de tu hogar con el TP-Link RE300 y elimina las zonas muertas para disfrutar de una conexión adecuada en cualquier estancia. Este extensor WiFi cuenta con tecnología Dual Band y es capaz de alcanzar hasta 1200 Mbps, lo que se traduce en una señal más potente y estable. Además, incorpora OneMesh, un sistema que unifica la señal de los dispositivos TP-Link compatibles para una conexión sin interrupciones.', 'Tp-link', 0),
(2210, 'PUNTO DE ACCESO TP-LINK TL-WA1201 AC1200', 'https://www.neobyte.es/53235-large_default/punto-de-acceso-tp-link-tl-wa1201-ac1200.jpg', 50.9, 'Punto De Acceso Tp-link Tl-wa1201 Ac1200', 'Tp-link', 0),
(2211, 'TP-Link Deco E4 (pack 2) - Punto de acceso', 'https://www.neobyte.es/82024-large_default/punto-de-acceso-tp-link-deco-e4-pack-2.jpg', 74.9, 'Extiende la cobertura Wifi de casa con TP-Link Deco E4 (pack de 2). Este punto de acceso es una forma sencilla de asegurar una fuerte señal en cada rincón de tu hogar y velocidades de red aún más rápidas. Las unidades Deco trabajan juntas para formar una red unificada, de manera que los dispositivos como smarthpones o tablets se conectarán automáticamente al módulo más rápido mientras te desplazas por las habitaciones. TP-Link Deco E4 es fácil de configurar desde la aplicación, se puede combinar con Alexa y podrás disfrutar de control parental.', 'Tp-link', 0),
(2212, 'D-Link DAP-1610 - Repetidor Wifi AC1200', 'https://www.neobyte.es/18825-large_default/range-extender-d-link-dap-1610-ac1200.jpg', 36.91, 'Amplía tu red Wifi fácilmente con el extensor de alcance D-Link DAP-1610. Conecta el dispositivo a una toma de corriente para aumentar el alcance de la rede Wifi y disfruta de velocidades combinadas de hasta 1200 Mbps gracias a la tecnología Wireless Wifi AC y a la conectividad de doble banda. Esta evita interferencias y proporciona compatibilidad con dispositivos inalámbricos más antiguos. Por otro lado, incorpora un puerto LAN para conectarlo al router y crear un punto de acceso Wifi o para conectarse al amplificador con dispositivos sin Wifi. Fácil de configurar y de usar, el D-Link DAP-1610 presenta un diseño compacto y práctico.', 'D-link', 0),
(2213, 'D-Link DAP-1325 - Extensor de cobertura WiFi N300', 'https://www.neobyte.es/13903-large_default/range-extender-d-link-dap-1325-wifi-n300.jpg', 24.9, 'Hazte en Neobyte con el extensor de cobertura WiFi D-Link DAP-1325, un amplificador con una relación/calidad precio sensacional. Basta con conectarlo a la red eléctrica, pulsar un botón y listo, disfrutarás de una conexión inalámbrica de hasta 300 mbps para navegar, jugar y visualizar contenidos en red sin problemas. Paralelamente, las dos antenas aseguran una excelente cobertura WiFi. Además, dispone de puerto Ethernet para usarlo como punto de acceso o conectar dispositivos por cable, si lo prefieres.', 'D-link', 0),
(2214, 'Punto de acceso Ubiquiti UAP-AC-LITE', 'https://www.neobyte.es/35470-large_default/punto-de-acceso-ubiquiti-uap-ac-lite.jpg', 90.9, 'El punto de acceso Ubiquiti UAP-AC-LITE ha sabido incorporar lo mejor de modelos anteriores añadiendo una buena dosis de innovación. Un modelo con una fantástica relación calidad-precio que ha reducido su tamaño un 25% y que ha incrementado su rendimiento hasta 5 veces más que la primera generación de Unifi AP. Incorpora, por otro lado, software UniFi Controller v4, perfecto para implementaciones de alta densidad para clientes que requieren baja latencia y alto rendimiento, permitiendo una escalabilidad ilimitada bajo un controlador único con acceso remoto.', 'Ubiquiti', 0),
(2215, 'TP-Link EAP245 - Punto de acceso AC1750', 'https://www.neobyte.es/33636-large_default/punto-de-acceso-tp-link-eap245-omada.jpg', 95.9, 'El punto de acceso Ubiquiti UAP-AC-LITE ha sabido incorporar lo mejor de modelos anteriores añadiendo una buena dosis de innovación. Un modelo con una fantástica relación calidad-precio que ha reducido su tamaño un 25% y que ha incrementado su rendimiento hasta 5 veces más que la primera generación de Unifi AP. Incorpora, por otro lado, software UniFi Controller v4, perfecto para implementaciones de alta densidad para clientes que requieren baja latencia y alto rendimiento, permitiendo una escalabilidad ilimitada bajo un controlador único con acceso remoto.', 'Tp-link', 0),
(2216, 'TP-Link EAP225 Outdoor - Punto de acceso AC1200', 'https://www.neobyte.es/33641-large_default/punto-de-acceso-tp-link-eap225-outdoor-omada.jpg', 89.9, 'El punto de acceso Ubiquiti UAP-AC-LITE ha sabido incorporar lo mejor de modelos anteriores añadiendo una buena dosis de innovación. Un modelo con una fantástica relación calidad-precio que ha reducido su tamaño un 25% y que ha incrementado su rendimiento hasta 5 veces más que la primera generación de Unifi AP. Incorpora, por otro lado, software UniFi Controller v4, perfecto para implementaciones de alta densidad para clientes que requieren baja latencia y alto rendimiento, permitiendo una escalabilidad ilimitada bajo un controlador único con acceso remoto.', 'Tp-link', 0),
(2217, 'TP-Link Deco M4 (Pack x2) - Punto de acceso WiFi Mesh', 'https://www.neobyte.es/33337-large_default/punto-de-acceso-tp-link-deco-m4-pack-2.jpg', 95.9, 'El punto de acceso Ubiquiti UAP-AC-LITE ha sabido incorporar lo mejor de modelos anteriores añadiendo una buena dosis de innovación. Un modelo con una fantástica relación calidad-precio que ha reducido su tamaño un 25% y que ha incrementado su rendimiento hasta 5 veces más que la primera generación de Unifi AP. Incorpora, por otro lado, software UniFi Controller v4, perfecto para implementaciones de alta densidad para clientes que requieren baja latencia y alto rendimiento, permitiendo una escalabilidad ilimitada bajo un controlador único con acceso remoto.', 'Tp-link', 0),
(2218, 'TP-Link TL-WA850RE - Extensor cobertura Wifi', 'https://www.neobyte.es/20947-large_default/range-extender-tp-link-tl-wa850re-300mbps.jpg', 17.9, 'El TP-Link TL-WA850RE amplifica la señal inalámbrica hasta zonas sin cobertura o difíciles de cablear de la forma más fácil. Cuenta con un diseño muy pequeño que hace más fácil su emplazamiento, así como un puerto ethernet que permite al extensor funcionar como adaptador inalámbrico para conectar dispositivos cableados. Su configuración es tan sencilla como pulsar el botón WPS en el router y el botón extensor de cobertura en el 850RE para conectarlo fácilmente a la red. Elimina las zonas sin cobertura Wifi en casa con el TP-Link TL-WA850RE.', 'Tp-link', 0),
(2219, 'TP-Link EAP110 Omada - Punto de acceso exterior', 'https://www.neobyte.es/36412-large_default/punto-de-acceso-tp-link-eap110-outdoor-omada.jpg', 50.9, 'Punto de acceso TP-Link EAP110 Omada, un modelo que ofrece una cobertura de largo alcance y está preparado para soportar velocidades de hasta 300Mbps gracias a la tecnología WiFi N. Además, es compatible con PoE para una instalación más cómoda y limpia. En cuanto a su diseño, destacar que es resistente a la intemperie y su carcasa resulta compacta y discreta, por lo que es ideal para exteriores. Por último, indicar que el TP-Link EAP110 Omada permite una gestión centralizada a través de app.', 'Tp-link', 0),
(2220, 'TP-Link EAP115 Omada - Punto de acceso WiFi N300', 'https://www.neobyte.es/31528-large_default/punto-de-acceso-tp-link-eap115-omada.jpg', 38.9, 'Punto de acceso TP-Link EAP110 Omada, un modelo que ofrece una cobertura de largo alcance y está preparado para soportar velocidades de hasta 300Mbps gracias a la tecnología WiFi N. Además, es compatible con PoE para una instalación más cómoda y limpia. En cuanto a su diseño, destacar que es resistente a la intemperie y su carcasa resulta compacta y discreta, por lo que es ideal para exteriores. Por último, indicar que el TP-Link EAP110 Omada permite una gestión centralizada a través de app.', 'Tp-link', 0),
(2221, 'Iggual Wifi N 300Mbps - Repetidor de señal', 'https://www.neobyte.es/95407-large_default/iggual-wifi-n-300mbps-repetidor-de-senal.jpg', 11.89, 'Iggual Wifi N 300Mbps - Repetidor de señal', 'Iggual', 0),
(2222, 'TP-Link TL-WA860RE - Extensor de cobertura Wifi', 'https://www.neobyte.es/20958-large_default/range-extender-tp-link-tl-wa860re-300mbps.jpg', 23.9, 'Olvídate de las zonas sin cobertura Wifi con el extensor de señal TP-Link TL-WA860RE. Este modelo amplifica la señal inalámbrica emplazándolo fácilmente en una toma de corriente y dejando libre el enchufe extra que incorpora para conectar cualquier otro dispositivo. No requiere de una configuración especial, simplemente enchufar, pulsar el botón WPS en el router y después el botón Range Extender en el TP-Link TL-WA860RE. Así de fácil es ampliar la cobertura Wifi de tu casa.', 'Tp-link', 0),
(2223, 'D-Link DAP-1620 AC1200 - Extensor de cobertura Dual Band', 'https://www.neobyte.es/13831-large_default/range-extender-d-link-dap-1620-ac1200.jpg', 55.9, 'El amplificador Wifi D-Link DP-1620 es una forma fácil de extender la cobertura Wifi en toda tu casa u oficina doméstica. Simplemente encuentra un buen lugar donde colocarlo, enchúfalo en una toma eléctrica y a disfrutar de velocidades de hasta 1200 Mbps. Gracias a la tecnología Dual Band conseguirás un mayor ancho de banda y menos interferencias, a la vez que una amplia compatibilidad con dispositivos antiguos. Además, cuenta con puerto Gigabit.', 'D-link', 0),
(2224, 'TP-Link EAP225 Omada - Punto de acceso WiFi 1350Mbps', 'https://www.neobyte.es/33609-large_default/punto-de-acceso-tp-link-eap225-omada.jpg', 83.9, 'El amplificador Wifi D-Link DP-1620 es una forma fácil de extender la cobertura Wifi en toda tu casa u oficina doméstica. Simplemente encuentra un buen lugar donde colocarlo, enchúfalo en una toma eléctrica y a disfrutar de velocidades de hasta 1200 Mbps. Gracias a la tecnología Dual Band conseguirás un mayor ancho de banda y menos interferencias, a la vez que una amplia compatibilidad con dispositivos antiguos. Además, cuenta con puerto Gigabit.', 'Tp-link', 0),
(2225, 'TP-Link CPE210 - Punto de acceso exterior 300Mbps', 'https://www.neobyte.es/33746-large_default/punto-de-acceso-tp-link-cpe210-outdoor.jpg', 39.91, 'El amplificador Wifi D-Link DP-1620 es una forma fácil de extender la cobertura Wifi en toda tu casa u oficina doméstica. Simplemente encuentra un buen lugar donde colocarlo, enchúfalo en una toma eléctrica y a disfrutar de velocidades de hasta 1200 Mbps. Gracias a la tecnología Dual Band conseguirás un mayor ancho de banda y menos interferencias, a la vez que una amplia compatibilidad con dispositivos antiguos. Además, cuenta con puerto Gigabit.', 'Tp-link', 0),
(2226, 'TP-Link EAP115-Wall - Punto de acceso', 'https://www.neobyte.es/31018-large_default/punto-de-acceo-t-tp-link-eap115-wall-omada.jpg', 33.9, 'El amplificador Wifi D-Link DP-1620 es una forma fácil de extender la cobertura Wifi en toda tu casa u oficina doméstica. Simplemente encuentra un buen lugar donde colocarlo, enchúfalo en una toma eléctrica y a disfrutar de velocidades de hasta 1200 Mbps. Gracias a la tecnología Dual Band conseguirás un mayor ancho de banda y menos interferencias, a la vez que una amplia compatibilidad con dispositivos antiguos. Además, cuenta con puerto Gigabit.', 'Tp-link', 0),
(2227, 'PUNTO DE ACCESO D-LINK DAP-2680 AC1750 WAVE2', 'https://www.neobyte.es/56350-large_default/punto-de-acceso-d-link-dap-2680-ac1750-wave2.jpg', 137.9, 'PUNTO DE ACCESO D-LINK DAP-2680 AC1750 WAVE2', 'D-link', 0),
(2228, 'Ubiquiti UAP-AC-M - Punto de acceso', 'https://www.neobyte.es/13920-large_default/punto-de-acceso-ubiquiti-uap-ac-m.jpg', 101.89, 'El punto de acceso Ubiquiti UAP-AC-M combina rendimiento, escalabilidad ilimitada y control centralizado en un sistema Wireless fiable y fácil de instalar. El software UniFi, por otra parte, ha sido especialmente diseñado para entornos de alta densidad de clientes, en donde es muy importante una baja latencia y total fiabilidad, pudiendo configurar y administrar una red empresarial Wifi al instante. Gracias a él podrás disfrutar de funciones como la detección automática de dispositivos, visualización del estado en tiempo real, opciones avanzadas de encriptación…', 'Ubiquiti', 0),
(2229, 'PUNTO DE ACCESO D-LINK DAP-2682 AC2300 POE', 'https://www.neobyte.es/53849-large_default/punto-de-acceso-d-link-dap-2682-ac2300-poe.jpg', 129.91, 'El punto de acceso Ubiquiti UAP-AC-M combina rendimiento, escalabilidad ilimitada y control centralizado en un sistema Wireless fiable y fácil de instalar. El software UniFi, por otra parte, ha sido especialmente diseñado para entornos de alta densidad de clientes, en donde es muy importante una baja latencia y total fiabilidad, pudiendo configurar y administrar una red empresarial Wifi al instante. Gracias a él podrás disfrutar de funciones como la detección automática de dispositivos, visualización del estado en tiempo real, opciones avanzadas de encriptación…', 'D-link', 0);
