(2235, 'Asus ZenWifi XD4 Plus (Pack de 2) Blanco - Punto de acceso WiFi Mesh AX1700', 'https://www.neobyte.es/90449-large_default/asus-zenwifi-xd4-plus-pack-de-2-blanco-punto-de-acceso-wifi-mesh-ax1700.jpg', 119.9, 'ROUTER ASUS ZENWIFI XD4 PLUS (W-2-PK) WHITE', 'Asus', 0),
