(2241, 'Xiaomi MI Router 4A - Router', 'https://www.neobyte.es/63284-large_default/xiaomi-mi-router-4a-router.jpg', 19.9, 'Xiaomi MI Router 4A - Router', 'Xiaomi', 0),
(2242, 'TP-Link Archer MR600 - Router AC1200', 'https://www.neobyte.es/35969-large_default/router-tp-link-mr600-ac1200.jpg', 128.9, 'Con el TP-Link Archer MR600 podrás disfrutar de velocidad 4G+ compartida en cualquier lugar. Este router soporta 4G+ Cat6, que integra tecnología Carrier Aggregation para potencia la velocidad de transmisión. Podrás insertar tu tarjeta SIM para usar un Wifi rápido y estable, navegar por internet, descargar ficheros y visualizar vídeos en streaming sin interrupciones. También cuenta con puertos Ethernet Gigabit para obtener velocidades asombrosas y conectar dispositivos como smart TV, consolas o NAS. Además, el TP-Link Archer MR600 presenta una configuración fácil y un mantenimiento sin complicaciones.', 'Tp-link', 0),
(2243, 'TP-Link TL-WR841N 300 mbps', 'https://www.neobyte.es/35207-large_default/router-tp-link-tl-wr841n-300mbs.jpg', 19.9, 'Máxima velocidad: 300 mbps / Botón de configuración rápida / 4 puertos LAN, 1 puerto WAN', 'Tp-link', 0),
(2244, 'TP-Link Archer MR200 - Router 4G LTE AC750', 'https://www.neobyte.es/35806-large_default/router-tp-link-archer-mr200-4g-ac750.jpg', 80.9, 'Máxima velocidad: 300 mbps / Botón de configuración rápida / 4 puertos LAN, 1 puerto WAN', 'Tp-link', 0),
(2245, 'TP-Link TL-WE850N - Router WiFi N 300Mbps', 'https://www.neobyte.es/33247-large_default/router-tp-link-tl-we850n-300mbps.jpg', 17.9, 'Máxima velocidad: 300 mbps / Botón de configuración rápida / 4 puertos LAN, 1 puerto WAN', 'Tp-link', 0),
(2246, 'TP-Link TL-MR3020 - Router 3G/4G portátil', 'https://www.neobyte.es/36118-large_default/router-tp-link-tl-mr3020-3g4g.jpg', 24.9, 'Compacto y realmente práctico, el router TP-Link TL-MR3020 es una solución perfecta para acompañarte en tus viajes. Compatible con la gran mayoría de módem USB 3G/4G, este pequeño dispositivo permite compartir la conectividad inalámbrica para acceder a Internet estés donde estés. Además, resulta muy fácil de utilizar y es capaz de alcanzar hasta 150Mbps. TP-Link TL-MR3020, el router 4G que va contigo.', 'Tp-link', 0),
(2247, 'TP-Link Archer C20 - Router WiFi Dual Band AC750', 'https://www.neobyte.es/33196-large_default/router-tp-link-archer-c20.jpg', 29.9, 'Hazte en Neobyte con el TP-Link Archer C20, un router WiFi que soporta el estándar 802.11ac para que navegues a toda velocidad, pues es capaz de alcanzar hasta 750Mbps. Por menos de lo que imaginas podrás disfrutar de la extraordinaria cobertura que proporcionan sus tres potentes antenas, así como de la estabilidad que aporta la doble banda. Además, el TP-Link Archer C20 posee un diseño moderno y es muy fácil de configurar.', 'Tp-link', 0),
(2248, 'TP-Link Archer C80 AC1900 WiFi 5 Dual Band - Router Gaming', 'https://www.neobyte.es/53224-large_default/tp-link-archer-c80-ac1900-wifi-5-dual-band-router-gaming.jpg', 51.9, 'TP-Link Archer C80 AC1900 WiFi 5 Dual Band - Router Gaming', 'Tp-link', 0),
(2249, 'Tp-Link Archer AX10 WiFi 6 AX1500 Dual Band - Router Gaming', 'https://www.neobyte.es/55938-large_default/router-tp-link-archer-ax10-wifi-6-ax1500.jpg', 61.9, 'Tp-Link Archer AX10 WiFi 6 AX1500 Dual Band - Router Gaming', 'Tp-link', 0),
(2250, 'Router WiFi TP-Link M7350 3G/4G', 'https://www.neobyte.es/36891-large_default/router-wifi-tp-link-m7350-3g4g.jpg', 83.9, 'Fácil de configurar, en menos de lo que imaginas estarás sacando todo el partido a su alta velocidad de conexión. Otras características destacables son la batería de gran autonomía, la pantalla de control y una práctica ranura microSD, perfecta para compartir tus contenidos sin cables. Ingenioso, ¿verdad?', 'Tp-link', 0),
(2251, 'D-Link DWR-920 4G - Router', 'https://www.neobyte.es/63268-large_default/d-link-dwr-920-4g-router.jpg', 70.91, 'D-Link DWR-920 4G - Router', 'D-link', 0),
