(2254, 'Cudy LT700 (AC1200) - Router Dual Band 4G y Wi-Fi 5', 'https://www.neobyte.es/107810-large_default/cudy-lt700-ac1200-router-dual-band-4g-y-wi-fi-5.jpg', 118.89, 'Cudy LT700 (AC1200) - Router Dual Band 4G y Wi-Fi 5', 'Cudy', 0),
