(2305, 'Adaptador de red TP-Link UE300 USB 3.0', 'https://www.neobyte.es/11348-large_default/tp-link-ue300-adaptador-de-red-usb-3-0-a-ethernet.jpg', 14.9, '¿Te has comprado un portátil sin conexión RJ45? Con la tarjeta de red TP-Link UE300 podrás añadir una conexión LAN a tu portátil. Además, con su conexión USB 3.0 podrás tener una velocidad de 1Gbps, que no es poca cosa... Es pequeño, compacto y a la vez portátil, que te permite llevarlo a todos lados sin molestarte.', 'Tp-link', 0),
(2306, 'TP-Link TG-3468 10/100/1000 PCIe', 'https://www.neobyte.es/9344-large_default/tarjeta-tp-link-tg-3468-10-100-1000-pcie.jpg', 12.9, 'Interfaz: PCI Express de 32 bits; 1 puerto RJ45 a 10/100/1000 Mbps / Estándares y Protocolos: IEEE 802.3, 802.3u, 802.3ab, 802.3x, 802.1Q, 802.1p CSMA / CD, TCP / IP', 'Tp-link', 0),
(2307, 'TP-Link TL-WN725N - Adaptador Wifi USB 150', 'https://www.neobyte.es/31216-large_default/tarjeta-tp-link-tl-wn725n-usb.jpg', 8.91, 'Interfaz: PCI Express de 32 bits; 1 puerto RJ45 a 10/100/1000 Mbps / Estándares y Protocolos: IEEE 802.3, 802.3u, 802.3ab, 802.3x, 802.1Q, 802.1p CSMA / CD, TCP / IP', 'Tp-link', 0),
(2308, 'TP-Link TL-WN821N - Adaptador WiFi USB 300Mb', 'https://www.neobyte.es/33250-large_default/tarjeta-tp-link-tl-wn821n-usb-wireless-300mb.jpg', 10.9, 'Interfaz: PCI Express de 32 bits; 1 puerto RJ45 a 10/100/1000 Mbps / Estándares y Protocolos: IEEE 802.3, 802.3u, 802.3ab, 802.3x, 802.1Q, 802.1p CSMA / CD, TCP / IP', 'Tp-link', 0),
(2309, 'D-Link DWA-182 - Adaptador WiFi USB AC1200 Dual', 'https://www.neobyte.es/13828-large_default/tarjeta-d-link-dwa-182-wifi-usb-ac1200-dual.jpg', 30.9, 'Saca el máximo partido de tu conexión a internet con el adaptador WiFi 5G por USB D-Link DWA-182, un pequeño dispositivo que incluye la última tecnología wireless para que disfrutes de una mayor velocidad en tu ordenador de sobremesa o portátil. Compacto y fácil de configurar, la potente antena integrada proporciona una conexión potente, estable y rápida.', 'D-link', 0),
(2310, 'TP-Link Archer T4E AC1200 - Tarjeta WiFi PCIe', 'https://www.neobyte.es/24614-large_default/tarjeta-tp-link-archer-t4e-ac1200-dualband.jpg', 27.9, 'La tarjeta Wifi TP-Link Archer T4E es un adaptador inalámbrico PCIe de fácil instalación que alcanza velocidades de hasta 1200 Mbps. Un modelo de doble banda compatible con el estándar 802.11ac que te permitirá realizar tareas como navegar por internet en la banda de 2.4GHz y aprovechar la velocidad de la banda de 5Ghz para jugar online, hacer streaming o utilizar aplicaciones que requieran de un ancho de banda mayor. Además, gracias a la tecnología Beamforming, el TP-Link Archer T4E centra las señales de forma inteligente en la dirección del dispositivo conectado para una conectividad más estable.', 'Tp-link', 0),
(2311, 'TP-Link TL-WN781ND - Tarjeta WiFi PCIe 150Mbps', 'https://www.neobyte.es/33470-large_default/tarjeta-tp-link-tl-wn781nd-wireless-pcie-150mbps.jpg', 9.9, 'La tarjeta WiFi interna TP-Link TL-WN781ND es una opción económica de dotar a tu ordenador de sobremesa de conectividad WiFi. Se instala facilmente a través de PCIe y permite alcanzar hasta 150Mbps, una velocidad adecuada para navegar, disfrutar de contenidos en HD, realizar videollamadas y mucho más. Además, incluye antena para una mayor cobertura y dispone de encriptación WPA/WPA2.', 'Tp-link', 0),
(2312, 'TARJETA TP-LINK ARCHER TX50E AX3000 WIFI 6 BLUETOOTH', 'https://www.neobyte.es/52752-large_default/tarjeta-tp-link-archer-tx50e-ax3000-wifi-6-bluetooth.jpg', 44.9, 'Tarjeta Tp-link Archer Tx50e Ax3000 Wifi 6 Bluetooth', 'Tp-link', 0),
(2313, 'TP-Link Archer T4U AC1300 - Adaptador Wifi USB', 'https://www.neobyte.es/25828-large_default/tarjeta-tp-link-archer-t4u-ac1300-mu-mimo-usb.jpg', 25.89, 'Adaptador USB inalámbrico TP-Link Archer T4U de doble banda AC1300 que alcanza velocidades combinadas de hasta 1300 Mbps (867+400) con 802.11ac. Un modelo perfecto tanto para tareas básicas como la navegación web como para streaming de vídeo de alta definición y juegos que cuenta con interfaz puerto USB 3.0. Dispone de cable de extensión USB para un despliegue flexible.', 'Tp-link', 0),
(2314, 'TP-Link TL-WN823N Mini USB Wireless 300MB - Tarjeta Wifi', 'https://www.neobyte.es/9397-large_default/tarjeta-tp-link-tl-wn823n-mini-usb-wireless-300mb.jpg', 10.9, 'Mini adaptador USB WiFi TP-Link TL-WN823N, la manera más asequible de añadir a tu equipos de sobremesa o portátil una conexión WiFi de hasta 300 mbps. De tamaño compacto, se instala fácilmente a través de un puerto USB y ofrece una conexión rápida, segura y fiable.', 'Tp-link', 0),
(2315, 'TARJETA D-LINK DWA-582 AC1200 WIFI PCI-E AC1200', 'https://www.neobyte.es/55929-large_default/tarjeta-d-link-dwa-582-ac1200-wifi-pci-e-ac1200.jpg', 36.91, 'TARJETA D-LINK DWA-582 AC1200 WIFI PCI-E AC1200', 'D-link', 0),
(2316, 'ADAPTADOR USB WIFI TP-LINK ARCHER T4U PLUS AC1300', 'https://www.neobyte.es/55933-large_default/adaptador-usb-wifi-tp-link-archer-t4u-plus-ac1300.jpg', 28.89, 'TARJETA TP-LINK ARCHER T4U PLUS AC1300', 'Tp-link', 0),
