(2320, 'TP-Link Archer T2U 600 mbps', 'https://www.neobyte.es/4767-large_default/tarjeta-tp-link-archer-t2u-600mbs-433-150-usb-20.jpg', 16.9, 'Interfaz: USB / Estándares Inalámbricos: IEEE 802.11n, IEEE 802.11g, IEEE 802.11b, IEEE 802.11ac, IEEE 802.11a / Frecuencia: 2.4 - 5 GHz', 'Tp-link', 0),
(2321, 'TP-Link TL-WN822N - Adaptador WiFi USB', 'https://www.neobyte.es/32846-large_default/tarjeta-tp-link-tl-wn822n-usb.jpg', 14.9, 'Adaptador USB WiFi TP-Link TL-WN822N con doble antena plegable para una mayor cobertura y prestaciones de transmisión. Gracias al estándar de velocidad 11N es capaz de alcanzar hasta 300 mbps, ofreciendo una experiencia de conexión estable a la hora de navegar, reproducir vídeo en streaming, realizar videollamadas...', 'Tp-link', 0),
(2322, 'TARJETA D-LINK DWA-181 WIFI USB', 'https://www.neobyte.es/53870-large_default/tarjeta-d-link-dwa-181-wifi-usb.jpg', 27.9, 'Adaptador USB WiFi TP-Link TL-WN822N con doble antena plegable para una mayor cobertura y prestaciones de transmisión. Gracias al estándar de velocidad 11N es capaz de alcanzar hasta 300 mbps, ofreciendo una experiencia de conexión estable a la hora de navegar, reproducir vídeo en streaming, realizar videollamadas...', 'D-link', 0),
(2323, 'Asus USB-AC53 Nano WiFi', 'https://www.neobyte.es/81512-large_default/asus-usb-ac53-nano-wifi.jpg', 33.49, 'Conéctalo y disfruta de Wifi de alta velocidad en todos tus dispositivos. El adaptador Asus USB-AC53 Nano incluye tecnología MIMO, que ofrece conexiones más rápidas incluso con varios usuarios conectados a la vez, así como sistema Dual Band, perfecto para adaptar el ancho de banda a las necesidades de cada momento. Además, su diminuto tamaño te permitirá llevarlo siempre conectado.', 'Asus', 0),
(2324, 'TARJETA RED STARTECH PCI-E 2xLAN GIGABIT', 'https://www.neobyte.es/71143-large_default/tarjeta-red-startech-pci-e-2xlan-gigabit.jpg', 112.91, 'TARJETA RED STARTECH PCI-E 2xLAN GIGABIT', 'Startech', 0),
(2325, 'Asus USB-AX56 - Adaptador Wi-Fi USB', 'https://www.neobyte.es/74927-large_default/asus-usb-ax56-adaptador-wi-fi-usb.jpg', 66.9, 'Asus Usb-ax56 Adaptador Wi-fi', 'Asus', 0),
(2326, 'TP-Link Archer T5E - Tarjeta WiFi AC1200 + Bluetooth', 'https://www.neobyte.es/36550-large_default/tarjeta-tp-link-archer-t5e-ac1200-bluetooth.jpg', 30.9, 'Actualiza la conectividad de tu ordenador de sobremesa con la tarjeta PCIe TP-Link Archer T5E con WiFi de alta velocidad y Bluetooth 4.2. Un componente de gran calidad que te permitirá conectarte a la red sin cables, vincular tus periféricos y transferir información de manera fácil, rápida, estable y segura. Además, la tecnología de doble banda de la TP-Link Archer T5E supone una gestión óptima de la señal, siendo perfecta para juegos, reproducción de contenidos en streaming...', 'Tp-link', 0),
(2327, 'Asus XG-C100F - Tarjeta de red', 'https://www.neobyte.es/31944-large_default/tarjeta-red-asus-xg-c100f-10gbps-sfp.jpg', 106.9, 'Actualiza la conectividad de tu ordenador de sobremesa con la tarjeta PCIe TP-Link Archer T5E con WiFi de alta velocidad y Bluetooth 4.2. Un componente de gran calidad que te permitirá conectarte a la red sin cables, vincular tus periféricos y transferir información de manera fácil, rápida, estable y segura. Además, la tecnología de doble banda de la TP-Link Archer T5E supone una gestión óptima de la señal, siendo perfecta para juegos, reproducción de contenidos en streaming...', 'Asus', 0),
(2328, 'Asus PCE-AX58BT - Tarjeta Wifi Dual Band + Bluetooth', 'https://www.neobyte.es/23812-large_default/tarjeta-asus-pce-ax58bt-wireless-dual-band.jpg', 58.9, 'La tarjeta ASUS PCE-AX58BT incorpora el nuevo estándar Wifi 6 (802.11ax), que rinde más y consume menos energía, alcanzando velocidades inalámbricas de hasta 2,7 veces más rápidas que los dispositivos Wifi 802.11ac. Un modelo que cuenta con la funcionalidad MU-MIMO, que permite la conexión de todos los clientes a máxima velocidad y el envío de paquetes de datos de manera simultánea a todos los dispositivos, sin esperas. Por otro lado, cuenta con la última generación Bluetooth, el doble de rápido y con un rango 4 veces mayor. Además, podrás reducir las interferencias o eliminar las zonas sin cobertura inalámbrica gracias a la antena externa del PCE-AC58BT.', 'Asus', 0),
(2329, 'TP-Link Archer T4U 1200Mbps - Adaptador USB', 'https://www.neobyte.es/2335-large_default/tp-link-archer-t4u-1200mbps-adaptador-usb.jpg', 26.9, 'TP-Link Archer T4U 1200Mbps - Adaptador USB', 'Tp-link', 0),
