(2347, 'Asus ExpertWifi EBM68 WiFi 6 Triple Band (Pack de 2) - Router extensible', 'https://www.neobyte.es/98125-large_default/asus-expertwifi-ebm68-wifi-6-triple-band-pack-de-2-router-extensible.jpg', 489.89, 'ROUTER ASUS EXPERTWIFI EBM68 (2PK)', 'Asus', 0),
(2348, 'TP-Link Deco E4 (pack 2) - Punto de acceso', 'https://www.neobyte.es/82024-large_default/punto-de-acceso-tp-link-deco-e4-pack-2.jpg', 74.9, 'Extiende la cobertura Wifi de casa con TP-Link Deco E4 (pack de 2). Este punto de acceso es una forma sencilla de asegurar una fuerte señal en cada rincón de tu hogar y velocidades de red aún más rápidas. Las unidades Deco trabajan juntas para formar una red unificada, de manera que los dispositivos como smarthpones o tablets se conectarán automáticamente al módulo más rápido mientras te desplazas por las habitaciones. TP-Link Deco E4 es fácil de configurar desde la aplicación, se puede combinar con Alexa y podrás disfrutar de control parental.', 'Tp-link', 0),
(2349, 'TP-Link Deco M4 (Pack x2) - Punto de acceso WiFi Mesh', 'https://www.neobyte.es/33337-large_default/punto-de-acceso-tp-link-deco-m4-pack-2.jpg', 95.9, 'Extiende la cobertura Wifi de casa con TP-Link Deco E4 (pack de 2). Este punto de acceso es una forma sencilla de asegurar una fuerte señal en cada rincón de tu hogar y velocidades de red aún más rápidas. Las unidades Deco trabajan juntas para formar una red unificada, de manera que los dispositivos como smarthpones o tablets se conectarán automáticamente al módulo más rápido mientras te desplazas por las habitaciones. TP-Link Deco E4 es fácil de configurar desde la aplicación, se puede combinar con Alexa y podrás disfrutar de control parental.', 'Tp-link', 0),
(2350, 'PUNTO DE ACCESO TP-LINK DECO E4 PACK 3', 'https://www.neobyte.es/56883-large_default/punto-de-acceso-tp-link-deco-e4-pack-3.jpg', 108.9, 'PUNTO DE ACCESO TP-LINK DECO E4 PACK 3', 'Tp-link', 0),
