(2352, 'Cudy WR1300 (AC1200) - Router Dual Band Wi-Fi 5', 'https://www.neobyte.es/107798-large_default/cudy-wr1300-ac1200-router-dual-band-wi-fi-5.jpg', 34.9, 'Cudy WR1300 (AC1200) - Router Dual Band Wi-Fi 5', 'Cudy', 0),
