(2354, 'Cudy LT700 (AC1200) - Router Dual Band 4G y Wi-Fi 5', 'https://www.neobyte.es/107810-large_default/cudy-lt700-ac1200-router-dual-band-4g-y-wi-fi-5.jpg', 118.89, 'Cudy LT700 (AC1200) - Router Dual Band 4G y Wi-Fi 5', 'Cudy', 0),
(2355, 'TP-Link Deco P9 (Pack x3) - Punto de acceso WiFi', 'https://www.neobyte.es/36505-large_default/punto-de-acceso-tp-link-deco-p9-pack-3.jpg', 229.9, 'Rápido, estable y versátil, TP-Link Deco P9 (Pack x3) es el sistema WiFi Mesh híbrido perfecto para hogares de hasta 560 m2. Una solución que combina lo mejor de la conexión inalámbrica de doble banda con las ventajas de los adaptadores PLC, creando así una red fuerte y reduciendo el impacto de las paredes y otros obstáculos en la señal. Además, la tecnología Mesh proporciona conexiones sin interrupciones. Así mismo, destacar que el TP-Link Deco P9 (Pack x3) posee un diseño muy discreto y resulta muy fácil de configurar y utilizar a través de app móvil. En definitiva, un pack de puntos de acceso de características avanzadas desarrollado para los hogares interconectados.', 'Tp-link', 0),
(2356, 'PUNTO DE ACCESO TP-LINK DECO M4 PACK 3', 'https://www.neobyte.es/56949-large_default/punto-de-acceso-tp-link-deco-m4-pack-3.jpg', 121.9, 'PUNTO DE ACCESO TP-LINK DECO M4 PACK 3', 'Tp-link', 0),
(2357, 'Cudy WR3000 (AX3000) - Router Dual Band Wi-Fi 6', 'https://www.neobyte.es/107806-large_default/cudy-wr3000-ax3000-router-dual-band-wi-fi-6.jpg', 46.9, 'Cudy WR3000 (AX3000) - Router Dual Band Wi-Fi 6', 'Cudy', 0),
(2358, 'Asus ZenWifi XD4 Plus Blanco - Punto de acceso WiFi Mesh AX1700', 'https://www.neobyte.es/90470-large_default/asus-zenwifi-xd4-plus-blanco-punto-de-acceso-wifi-mesh-ax1700.jpg', 95.9, 'ROUTER ASUS ZENWIFI XD4 PLUS (W-1-PK) WHITE', 'Asus', 0),
