(2362, 'Asus ZenWifi AX XT8 Blanco - Punto de acceso WiFi mesh AX6600 Tri-band', 'https://www.neobyte.es/38188-large_default/zenwifi-ax-xt8-ax6600-blanco.jpg', 188.91, 'Te presentamos el punto de acceso Asus ZenWifi AX XT8 Blanco, una solución avanzada, segura, discreta e inteligente con la que disfrutarás de la mejor conexión WiFi en tu hogar. Gracias a sus tecnologías de vanguardia (WiFi 6 ax, triple banda, 6 antenas...) ofrece una cobertura extraordinaria en cualquier rincón, siendo capaz de alcanzar hasta 6600Mbps de velocidad. Además, el procesador de 4 núcleos trabaja de forma efectiva para proporcionar la señal óptima a acada dispositivo. Por último, indicar que el Asus ZenWifi AX XT8 Blanco es muy fácil de configurar y cuenta con numerosas opciones de seguridad y control parental.', 'Asus', 0),
(2363, 'Asus ZenWifi AX Mini XD6S Blanco (Pack 2) - Router/Repetidor', 'https://www.neobyte.es/66840-large_default/asus-zenwifi-ax-mini-xd6s-blanco-pack-2-routerrepetidor.jpg', 303.9, 'Asus ZenWifi AX Mini XD6S Blanco (Pack 2) - Router/Repetidor', 'Asus', 0),
(2364, 'Asus DSL-AX82U WiFi 6 Dual Band - Router Gaming', 'https://www.neobyte.es/46065-large_default/asus-dsl-ax82u-wifi-6-dual-band-router-gaming.jpg', 213.9, 'Asus DSL-AX82U WiFi 6 Dual Band - Router Gaming', 'Asus', 0),
(2365, 'Asus ZenWifi AX XT8 - Punto de acceso WiFi mesh AX6600 Tri-band', 'https://www.neobyte.es/38187-large_default/zenwifi-ax-xt8-ax6600.jpg', 189.9, 'El punto de acceso Asus ZenWifi AX XT8 constituye la solución más avanzada, segura, discreta e inteligente para mejorar la conexión WiFi de tu hogar. Disfruta de una cobertura sensacional en cualquier rincón y de una velocidad máxima de hasta 6600Mbps gracias a la tecnología WiFi 6 ax de triple banda y a sus 6 potentes antenas integradas. Además, la CPU de 4 núcleos es capaz de procesar la señal adecuadamente para que, utilices el dispositivo que utilices, experimentes una conexión de vanguardia. Además, por su seguridad avanzada y numerosas opciones de control parental el Asus ZenWifi AX XT8 es perfecto para familias.', 'Asus', 0),
(2366, 'Asus ZenWifi XD4 Plus (Pack de 3) Blanco - Punto de acceso WiFi Mesh AX1700', 'https://www.neobyte.es/90460-large_default/asus-zenwifi-xd4-plus-pack-de-3-blanco-punto-de-acceso-wifi-mesh-ax1700.jpg', 241.9, 'ROUTER ASUS ZENWIFI XD4 PLUS (W-3-PK) WHITE', 'Asus', 0),
(2367, 'TP-Link HX220 AX1800 Mesh Pack 2 - Punto de acceso', 'https://www.neobyte.es/75501-large_default/tp-link-hx220-ax1800-mesh-pack-2-punto-de-acceso.jpg', 162.9, 'TP-Link HX220 AX1800 Mesh Pack 2 - Punto de acceso', 'Tp-link', 0),
(2368, 'Asus ExpertWifi EBM68 WiFi 6 Triple Band - Router extensible', 'https://www.neobyte.es/98129-large_default/asus-expertwifi-ebm68-wifi-6-triple-band-router-extensible.jpg', 303.9, 'ROUTER ASUS EXPERTWIFI EBM68 (1PK)', 'Asus', 0),
(2369, 'Asus ZenWifi AX XT8 (pack de 2) - Punto de acceso WiFi mesh AX6600 Tri-band', 'https://www.neobyte.es/26630-large_default/punto-de-acceso-asus-ac6600-triband-xt8-b-2-pk.jpg', 361.9, 'Con el sistema Wi-Fi Asus ZenWifi AX XT8 (pack de 2) disfrutarás de la tecnología inalámbrica más avanzada y de un rendimiento extremadamente rápido y estable. Equipado con Wi-Fi 6 AX6600, tres bandas y potentes antenas integradas, proporciona una cobertura inmejorable en espacios de hasta 510 m2 (y en diferentes alturas), alcanzando velocidades nunca antes vistas. Además, su potente procesador, junto a una óptima disipación del calor, brindan un rendimiento increíble incluso en los entornos más exigentes (streaming 8K, juegos online, descargas...). Así mismo, destacar que el Asus ZenWifi AX XT8 incluye la tecnología AiMesh, que simplifica la configuración de la red y ofrece funcionalidades avanzadas de monitorización y de control parental. Todo ello con un diseño elegante, moderno y discreto que encaja a la perfección en cualquier entorno. ¡Hazte ya en Neobyte con el pack de 2 Asus ZenWifi AX XT8, la solución Wi-Fi más avanzada.', 'Asus', 0),
(2370, 'Asus ZenWiFi AX XD4 Blanco - Punto de acceso', 'https://www.neobyte.es/41073-large_default/asus-zenwifi-ax-xd4-blanco.jpg', 102.9, 'Asus ZenWiFi AX XD4 Blanco es el punto de acceso de última generación que cubre las necesidades de las familias interconectadas. Con un diseño compacto, discreto y minimalista, se configura fácilmente a través de app móvil y dispone de controles parentales y de seguridad avanzados. En lo referente a sus especificaciones técnicas, Asus ZenWiFi AX XD4 Blanco está preparado para alcanzar hasta 1800Mbps de velocidad y brinda una conexión estable, segura y rápida gracias a las tecnologías WiFi 6 y AiMesh.', 'Asus', 0),
(2371, 'D-LINK COVR-X1862 SISTEMA WIFI MESH AX1800 WIFI 6 - PACK DE 2', 'https://www.neobyte.es/56316-large_default/d-link-covr-x1862-sistema-wifi-mesh-ax1800-wifi-6-pack-de-2.jpg', 154.9, 'D-LINK COVR-X1862 SISTEMA WIFI MESH AX1800 WIFI 6', 'D-link', 0),
