(2373, 'D-LINK COVR-X1863 SISTEMA WIFI MESH AX1800 WIFI 6 - PACK DE 3', 'https://www.neobyte.es/56309-large_default/d-link-covr-x1863-sistema-wifi-mesh-ax1800-wifi-6-pack-de-3.jpg', 240.9, 'D-LINK COVR-X1863 SISTEMA WIFI MESH AX1800 WIFI 6', 'D-link', 0),
