(2376, 'Alcatel 2057D 4MB 4MB Blanco puro - Smartphone 2.4 2G', 'https://www.neobyte.es/66299-large_default/alcatel-2057d-4mb-4mb-blanco-puro-smartphone-24-2g.jpg', 39.91, 'Alcatel 2057D Blanco Puro - Smartphone 2.4 4MB 4MB 2G', 'Alcatel', 0),
(2377, 'Xiaomi Mi True EarBuds Basic 2S - Auriculares Inalámbricos', 'https://www.neobyte.es/48466-large_default/xiaomi-mi-true-earbuds-basic-2s-auriculares-inalambricos.jpg', 25.89, 'Xiaomi Mi True EarBuds Basic 2S - Auriculares Inalámbricos', 'Xiaomi', 0),
(2378, 'Alcatel 2057D 4MB 4MB Negro volcán - Smartphone 2.4 2G', 'https://www.neobyte.es/66294-large_default/alcatel-2057d-4mb-4mb-negro-volcan-smartphone-24-2g.jpg', 39.91, 'Alcatel 2057D Negro Volcán - Smartphone 2.4 4MB 4MB 2G', 'Alcatel', 0),
(2379, 'Xiaomi MI True Wireless 2S - Auriculares inalámbricos', 'https://www.neobyte.es/48478-large_default/auriculares-xiaomi-mi-true-wireless-2s.jpg', 37.9, 'Los Xiaomi Mi True Wireless 2S son los auriculares inalámbricos que querrás llevar a todas partes. Equipados con la tecnología más novedosa, utilizan la transmisión síncrona biaural para lograr que sus dos auriculares se conecten de forma simultánea, consiguiendo así una emisión de audio estable y sin cortes. Además, realizar llamadas desde cualquier lugar ya no va a suponer ningún problema gracias a su micrófono con cancelación de ruido, que te garantizará una comunicación de calidad. Dispone de control táctil para que puedas activar funciones cómo llamar, reproducir o pausar música golpeando suavemente con los dedos cada auricular, y su sensor de infrarrojos es capaz de detectar cuándo no los llevas puestos y detener la música en consecuencia. Autonomía de hasta 4 horas, activación por voz inteligente y carga rápida son solo algunas de las características con las que cuentan los Xiaomi Mi True Wireless 2S. Hazte con ellos en Neobyte para acabar de descubrirlas todas.', 'Xiaomi', 0),
(2380, 'Alcatel 3082x 64MB 128MB Plata Metálico - Smartphone 2.4 4G', 'https://www.neobyte.es/66309-large_default/alcatel-3082x-64mb-128mb-plata-metalico-smartphone-24-4g.jpg', 58.9, 'Alcatel 3082 Plata Metálico - Smartphone 2.4 64MB 128MB 3G', 'Alcatel', 0),
(2381, 'Xiaomi Redmi Note 12S 6GB 128GB Negro ónix - Smartphone 6.43 4G', 'https://www.neobyte.es/99264-large_default/xiaomi-redmi-note-12s-6gb-128gb-negro-onix-smartphone-643-4g.jpg', 177.89, 'Xiaomi Redmi Note 12S 6GB 128GB Negro Ónix - Smartphone', 'Xiaomi', 0),
(2382, 'Xiaomi Mi True Wireless Earbuds Basic 2', 'https://www.neobyte.es/48463-large_default/auriculares-xiaomi-mi-true-wireless-earbuds-basic-2.jpg', 16.9, 'Los Xiaomi Mi True Wireless Earbuds Basic 2 son los auriculares inalámbricos que siempre querrás tener en tu mochila. Fabricados con materiales de calidad y equipados con la mejor tecnología, estos dispositivos están listos para ser usados tan pronto como se sacan de su estuche de carga. Emparejamiento rápido, sincronización perfecta y Bluetooth 5.0 para una transmisión ágil de datos y una calidad de sonido como nunca antes habías experimentado. En cuanto a su autonomía, podrás usarlo de manera ininterrumpida durante 4 horas y disfrutar de tu música o realizar llamadas en cualquier parte gracias a su ligero peso, que lo convierten en un dispositivo perfecto para transportar. No lo dudes, en cuanto pruebes los Xiaomi Mi True Wireless Earbuds Basic 2 se convertirán en un imprescindible en tu día a día.', 'Xiaomi', 0),
