(2417, 'Lenovo TAB M10 (3GEN) 4GB+64GB WIFI GREY - Tablet', 'https://www.neobyte.es/100050-large_default/lenovo-tab-m10-3gen-4gb64gb-wifi-grey-tablet.jpg', 131.9, 'La Tab M10 (3GEN) 4GB+64GB WIFI GREY ZAAE0049ES es una combinación perfecta de calidad de imagen, sonido envolvente y rendimiento potente. Su pantalla LCD FHD y altavoces con Dolby Atmos brindan una experiencia de transmisión inmersiva, mientras que la certificación TÜV Rheinland Low Blue Light cuida la salud visual durante sesiones prolongadas. Con potencia y autonomía suficientes para múltiples tareas, esta tablet se destaca como una opción versátil para diversas actividades digitales.', 'Lenovo', 0),
(2418, 'Samsung Super Fast Charging para tablet (15W) - Cargador de pared USB C', 'https://www.neobyte.es/89220-large_default/samsung-super-fast-charging-para-tablet-15w-cargador-de-pared-usb-c.jpg', 20.9, 'Samsung Carga rápida USB-C para tablet (15W) Blanco - Cargador de pared', 'Samsung', 0),
(2419, 'Lenovo Tab M10 (3ª Gen.) 3GB 32GB Wi-Fi Gris Tormenta - Tablet 10.1', 'https://www.neobyte.es/104026-large_default/lenovo-tab-m10-3-gen-3gb-32gb-wi-fi-gris-tormenta-tablet-101.jpg', 105.9, 'Un procesador veloz de ocho núcleos,  3GB de RAM y una amplia batería te permiten disfrutar de tus aplicaciones y juegos favoritos durante horas. Su diseño moderno y ligero la hace ideal para llevarla contigo a donde vayas.', 'Lenovo', 0),
(2420, 'Samsung Galaxy Tab S6 Lite 4GB 64GB Wi-Fi Gris (2022) - Tablet 10.4', 'https://www.neobyte.es/102799-large_default/samsung-galaxy-tab-s6-lite-4gb-64gb-wi-fi-gris-2022-tablet-104.jpg', 289.9, 'Samsung Galaxy Tab S6 Lite 4GB 64GB Wi-Fi Gris (2022) - Tablet 10.4', 'Samsung', 0),
(2421, 'Lenovo Tab M10 (3ª Gen.) 4GB 128GB 4G Gris Tormenta - Tablet 10.6', 'https://www.neobyte.es/104034-large_default/lenovo-tab-m10-3-gen-4gb-128gb-4g-gris-tormenta-tablet-106.jpg', 193.9, 'El Lenovo Tab M10 (3ª Gen.) también cuenta con una batería de larga duración que te permite utilizarla durante horas sin tener que preocuparte por quedarte sin energía. Esto es especialmente útil para viajes largos o para aquellos que necesitan una tablet confiable durante todo el día. Además de su rendimiento, esta tablet presenta un diseño elegante y moderno que se adapta perfectamente a cualquier entorno. Su peso ligero y su perfil delgado la hacen fácil de transportar y cómoda de sostener durante largos períodos de tiempo.', 'Lenovo', 0),
(2422, 'Logitech 920-008336 - Funda tablet con teclado integrado', 'https://www.neobyte.es/34557-large_default/funda-tablet-logitech-920-008336.jpg', 68.9, 'Funda para tablet 9”-10“ con teclado integrado Logitech 920-008336, compatible con dispositivos Android, Windows y Apple. Gracias a ella podrás utilizar la tablet cómodamente, usando el teclado para ahorrar tiempo y aumentar tu productividad. Cuenta con sujeción en cuatro puntos, correa para cierre y tecnología Bluetooth para una conexión fiable. Con la funda Universal Folio Logitech protegerás tu dispositivo a la vez que incorporas una herramienta para trabajar cómodamente en cualquier lado.', 'Logitech', 0),
(2423, 'Lenovo TAB M10 (3GEN) 4GB+64GB WIFI LTE GREY - Tablet', 'https://www.neobyte.es/100056-large_default/lenovo-tab-m10-3gen-4gb64gb-wifi-lte-grey-tablet.jpg', 166.9, 'La Tab M10 de 3ª generación se adapta a diversos intereses y necesidades. Google Play ofrece una amplia variedad de aplicaciones, desde fotografía hasta astronomía, permitiendo a los usuarios explorar nuevas formas de estar conectados con amigos y mantenerse actualizados. Además, Google Play Protect contribuye a mantener el dispositivo limpio y los datos seguros, analizando diariamente más de 100,000 aplicaciones, incluso aquellas que aún no han sido instaladas, para proteger contra posibles amenazas de aplicaciones maliciosas.', 'Lenovo', 0),
