(2477, 'Correa para Smartwatch Asus VivoWatch ASUS HC-S01 - Naranja', 'https://www.neobyte.es/73518-large_default/correa-para-smartwatch-asus-vivowatch-asus-hc-s01-naranja.jpg', 27, 'Hc-s01 Vivowatch Band Orange Leather', 'Asus', 0),
(2478, 'Asus VivoWatch BP (HC-A04) - Smartwatch', 'https://www.neobyte.es/19190-large_default/asus-vivowatch-bp-hc-a04-smartwatch.jpg', 92.89, 'Asus VivoWatch BP (HC-A04) ha sido diseñado para mejorar tu salud cardiovascular. Este preciso Smartwatch incorpora tecnología Asus Health AI, que emplea un sensor óptico para realizar un seguimiento continuo y seguro de la frecuencia cardíaca y la presión arterial. Estos datos, junto con los de edad y género, aportan la información necesaria para medir la intensidad del ejercicio y establecer pautas que mejoren la salud de nuestro corazón. Además, podrás realizar un seguimiento del sueño y llevar un control global de tu salud basado en la actividad física y la calidad del descanso. Comienza a cuidarte con el Asus VivoWatch BP.', 'Asus', 0),
(2479, 'Correa para Smartwatch Asus VivoWatch ASUS HC-S02 - Blanca', 'https://www.neobyte.es/73523-large_default/correa-para-smartwatch-asus-vivowatch-asus-hc-s02-blanca.jpg', 27, 'Hc-s02 Vivowatch Band White Leather', 'Asus', 0),
(2480, 'Asus VivoWatch SP (HC-A05) - Smartwatch', 'https://www.neobyte.es/38129-large_default/reloj-asus-vivowatch-sp.jpg', 179.89, 'Asus VivoWatch SP (HC-A05) es el reloj inteligente que tiene todo lo que necesitas para una monitorización exhaustiva tanto de la salud como de tu actividad diaria. Con un diseño actual y discreto, así como con un manejo sencillo, este smartwatch te ayudará a llevar un control de aspectos tan importantes como la presión arterial, la frecuencia cardíaca, la calidad del sueño, calorías quemadas, nivel de oxígeno en sangre... convirtiéndose así es tu aliado perfecto para una vida saludable. Además, es capaz de contrar pasos e integra altímetro y GPS, lo que permite un análisis pormenorizado de cualquier actividad física. Por último, destacar su larga autonomía, la resistencia al agua y notificaciones integradas tanto de llamada como de texto. Por todo ello el Asus VivoWatch SP (HC-A05) es mucho más que un smartwatch. ¡Cómpralo ya en Neobyte con las máximas garantías!', 'Asus', 0),
(2481, 'Asus VivoWatch HC-S03 Gris - Correa para Smartwatch', 'https://www.neobyte.es/77757-large_default/asus-vivowatch-hc-s03-gris-correa-para-smartwatch.jpg', 26.02, 'Asus VivoWatch HC-S03 Gris - Correa para Smartwatch', 'Asus', 0),
(2482, 'RELOJ ASUS VIVOWATCH BP CERAMIC HC-A04A', 'https://www.neobyte.es/55818-large_default/reloj-asus-vivowatch-bp-ceramic-hc-a04a.jpg', 119.9, 'Reloj ASUS VivoWatch BP (HC-A04A)', 'Asus', 0),
(2483, 'Xiaomi Smart Band 8 Active Black - Pulsera de actividad', 'https://www.neobyte.es/106006-large_default/xiaomi-smart-band-8-active-black-pulsera-de-actividad.jpg', 25.89, 'Xiaomi Smart Band 8 Active Black - Pulsera de actividad', 'Xiaomi', 0),
(2484, 'Asus VivoWatch HC-S04 Rosa - Correa para Smartwatch', 'https://www.neobyte.es/77758-large_default/asus-vivowatch-hc-s04-rosa-correa-para-smartwatch.jpg', 26.02, 'Asus VivoWatch HC-S04 Rosa - Correa para Smartwatch', 'Asus', 0),
(2485, 'Xiaomi Mi Band 7 Pro Negra - Pulsera de actividad', 'https://www.neobyte.es/97462-large_default/xiaomi-mi-band-7-pro-negra-pulsera-de-actividad.jpg', 55.9, 'Xiaomi Mi Band 7 Pro Negra - Pulsera de actividad', 'Xiaomi', 0),
(2486, 'Xiaomi Mi Smart Band 6 Negra - Pulsera de actividad', 'https://www.neobyte.es/48512-large_default/pulsera-actividad-xiaomi-mi-band-6-negra.jpg', 35.9, 'Más información de un solo vistazo. La pulsera de actividad Xiaomi Mi Smart Band 6 Negra presenta una 50% más de área de visualización que modelos anteriores, lo que te permitirá consultar más fácilmente las notificaciones. Cuenta con una pantalla AMOLED en la que los contenidos se muestran delladados y llenos de vida, pudiendo personliazar el estilo de pantalla entre más de 60 opciones. Por otro lado, se trata de un dispositivo con el que podrás escuchar a tu cuerpo para llevar una vida más saludable. Y es que gracias a la Xiaomi Mi Smart Band 6 Negra no perderás la sintonía con tu cuerpo: mide la saturación de oxígeno, monitoriza el sueño, registra la frecuencia cardiaca, supervisa el nivel de estrés... Además, dispone de 30 modos deportivos que lo convierten en el entrenador personal más completo. ¿Quieres más? Lo tiene: alertas de inactvidad, reproducción de música, recordatorios del calendario, pronóstico del tiempo...', 'Xiaomi', 0),
(2487, 'Xiaomi Mi Band 7 Pro Blanca - Pulsera de actividad', 'https://www.neobyte.es/97467-large_default/xiaomi-mi-band-7-pro-blanca-pulsera-de-actividad.jpg', 55.9, 'Xiaomi Mi Band 7 Pro Blanca - Pulsera de actividad', 'Xiaomi', 0),
(2488, 'Asus VivoWatch 5 Aero HC-C05 - Smartwatch', 'https://www.neobyte.es/97109-large_default/asus-vivowatch-5-aero-hc-c05-smartwatch.jpg', 115.89, 'PULSERA ASUS VIVOWATCH 5 AERO HC-C05', 'Asus', 0),
(2489, 'RELOJ ASUS VIVOWATCH 5 HC-B05', 'https://www.neobyte.es/62887-large_default/reloj-asus-vivowatch--5-hc-b05.jpg', 293.99, 'Reloj Asus Vivowatch 5 Hc-b05', 'Asus', 0),
(2490, 'Xiaomi Amazfit GTS Naranja - Smartwatch', 'https://www.neobyte.es/38357-large_default/smartwatch-amazfit-gts-naranja.jpg', 61.9, 'El smartwatch Xiaomi Amazfit GTS Naranja es tan elegante como completo, adaptándose así perfectamente a tu estilo de vida. Este reloj inteligente cuenta con una fabulosa pantalla AMOLED táctil de gran resolución y 1.65 con Corning Gorilla Glass 3 desde la que visualizar cómodamente multitud de aspectos relacionados con tu actividad, así como notificaciones y demás widgets personalizables. Ligero y cómodo de llevar, está listo para soportar los rigores del día a día, pues ofrece una gran resistencia, es sumergible... En lo referente a las prestaciones del Xiaomi Amazfit GTS Naranja, destacar el sensor de frecuencia cardíaca, la batería de larga duración y los 12 modos de ejercicio (correr, caminar, ciclismo, natación, escalada, gimnasio...', 'Xiaomi', 0),
(2491, 'Asus VivoWatch 5 HC-B05 + Correa Cuero Blanca - Smartwatch', 'https://www.neobyte.es/88136-large_default/asus-vivowatch-5-hc-b05-correa-cuero-blanca-smartwatch.jpg', 358.99, 'Reloj Asus Vivowatch 5 Hc-b05', 'Asus', 0),
(2492, 'Garmin Venu SQ2 Aluminio verde - Smartwatch para deporte y salud', 'https://www.neobyte.es/93868-large_default/garmin-venu-sq2-aluminio-verde-smartwatch-para-deporte-y-salud.jpg', 249.9, 'Garmin Venu SQ2 Aluminio verde - Smartwatch para deporte y salud', 'Garmin', 0),
(2493, 'SMARTWATCH XIAOMI AMAZFIT T-REX PRO GRIS DESIERTO', 'https://www.neobyte.es/50808-large_default/smartwatch-xiaomi-amazfit-t-rex-pro-gris-desierto.jpg', 122.9, 'Smartwatch Xiaomi Amazfit T-rex Pro Gris Desierto', 'Xiaomi', 0),
(2494, 'Amazfit GTR 3 Pro Marrón - Smartwatch', 'https://www.neobyte.es/74537-large_default/amazfit-gtr-3-pro-marron-smartwatch.jpg', 150.9, 'SMARTWATCH HUAMI AMAZFIT GTR 3 PRO MARRON', 'Xiaomi', 0),
(2495, 'Garmin Forerunner 255 Azul oscuro - Smartwatch para carrera', 'https://www.neobyte.es/93742-large_default/garmin-forerunner-255-azul-oscuro-smartwatch-para-carrera.jpg', 321.9, 'Garmin Forerunner 255 Azul oscuro - Smartwatch para carrera', 'Garmin', 0),
(2496, 'Xiaomi Amazfit GTS Steel Blue - Smartwatch', 'https://www.neobyte.es/40192-large_default/smartwatch-xiaomi-gts-steel-blue.jpg', 67.91, 'El Xiaomi Amazfit GTS Steel Blue destaca entre los smartwatch por su inmejorable relación calidad-precio. Un reloj elegante y cómodo dotado de pantalla táctil AMOLED con cristal templado Corning Gorilla 3 y revestimiento antihuellas que, además, propone un funcionamiento sencillo. Dicha pantalla presenta colores vivos, es brillante y nítida, lo que se agradece en un dispositivo pequeño. Cuenta con diferentes sensores y funciones y es compatible con la aplicación para tu móvil. Por último, es importante mencionar que es resistente al agua y que dispone de una batería con gran autonomía. Ya puedes comprar el Xiaomi Amazfit GTS Steel Blue en nuestra tienda online.', 'Xiaomi', 0),
(2497, 'SMARTWATCH XIAOMI AMAZFIT GTS 2 GRIS URBANO', 'https://www.neobyte.es/53791-large_default/smartwatch-xiaomi-amazfit-gts-2-gris-urbano.jpg', 103.9, 'SMARTWATCH XIAOMI AMAZFIT GTS 2 GRIS URBANO', 'Xiaomi', 0),
