(2525, 'Logitech Z207 Negro - Altavoces Bluetooth', 'https://www.neobyte.es/38514-large_default/altavoces-logitech-z207-bluetooth-negros.jpg', 52.9, 'Con los altavoces Bluetooth para ordenador Logitech Z207 Negro obtendrás un sonido detallado y sin cables al precio más ajustado. Su tamaño compacto y diseño inalámbrico hacen que su integración en tu escritorio resulte discreta y realmente cómoda. Además, dispone de control de volumen y entrada de 3.5 mm para cona vinculación más versátil con tus dispositivos: PC de sobremesa, portátil, smartphone, tablet... Además, los Logitech Z207 Negro arrojan un audio de calidad y potencia gracias a sus 5W RMS y radiador pasivo para graves mejorados.', 'Logitech', 0),
(2526, 'ALTAVOZ BLUETOOTH XIAOMI MI COMPACT SPEAKER 2', 'https://www.neobyte.es/63316-large_default/altavoz-bluetooth-xiaomi-mi-compact-speaker-2.jpg', 10.9, 'ALTAVOZ BLUETOOTH XIAOMI MI COMPACT SPEAKER 2', 'Xiaomi', 0),
(2527, 'ALTAVOZ XIAOMI MI PORTABLE BLUETOOTH MINI GRIS', 'https://www.neobyte.es/44391-large_default/altavoz-xiaomi-mi-portable-bluetooth-mini-gris.jpg', 18.9, 'Altavoz Xiaomi Mi Portable Bluetooth Mini Gris', 'Xiaomi', 0),
(2528, 'Logitech G560 Lightsync RGB Bluetooth - Altavoces', 'https://www.neobyte.es/74441-large_default/logitech-g560-lightsync-rgb-bluetooth-altavoces.jpg', 242.9, 'ALTAVOCES LOGITECH G560 LIGHTSYNC', 'Logitech', 0),
(2529, 'Creative Pebble - Altavoces 2.0 USB', 'https://www.neobyte.es/21374-large_default/altavoces-creative-pebble-20-usb-negro.jpg', 23.9, 'Con un diseño inspirado en los jardines zen, los altavoces Creative Pebble son perfectos para su integración en espacios de estudio y trabajo tanto por su tamaño compacto como por su sorprendente calidad de sonido. Su robusta construcción incluye radiadores pasivos y altavoces elevados 45º para una proyección de audio mejorada. Otra gran ventaja de los Creative Pebble es que se alimentan a través de un único puerto USB y se conectan mediante jack de 3.5 mm a prácticamente cualquier dispositivo. Consíguelos ya en Neobyte al mejor precio y con envío inmediato.', 'Creative', 0),
