(2533, 'Creative Muvo Go! Verde - Altavoz Bluetooth', 'https://www.neobyte.es/101453-large_default/creative-muvo-go-verde-altavoz-bluetooth.jpg', 63.9, 'Creative Muvo Go! Verde - Altavoz Bluetooth', 'Creative', 0),
(2534, 'Logitech Z906 500W 5.1 THX Digital Home Cinema', 'https://www.neobyte.es/9844-large_default/altavoces-logitech-z906.jpg', 326.91, 'Los altavoces Logitech Z906 te proporcionan una experiencia de audio con calidad de cine. Con este sistema de altavoces 5.1 de 1000W de potencia de pico te ofrecen un potente sonido, certificado THX y proporcionan una experiencia de audio excepcional.', 'Logitech', 0),
