(2573, 'CHiQ U50G7LX - Televisor 50 4K UHD Smart TV', 'https://www.neobyte.es/105798-large_default/chiq-u50g7lx-televisor-50-4k-uhd-smart-tv.jpg', 248.99, 'Consigue a un precio sin competencia la CHiQ U50G7LX en Neobyte. Este espectacular smart TV de 50 pulgadas te permitirá disfrutar del cine, los eventos deportivos y todo lo que desees a lo grande por mucho menos de lo que imaginas. Gracias a la increíble resolución Ultra HD 4K, a la tecnología HDR10 y al sistema Dolby Audio, vivirás una experiencia totalmente inmersiva y de indiscutible calidad. Pero esto no es todo, ya que la U50G7LX integra todas las ventajas de Android TV: asistente inteligente, contenido a la carta, redes sociales, navegador web...', 'CHiQ', 0),
