(2604, 'Xiaomi MI TV P1E ELA4740EU Smart TV 32 HD Android', 'https://www.neobyte.es/89226-large_default/xiaomi-mi-tv-p1e-ela4740eu-smart-tv-32-hd-android.jpg', 168.9, 'Consigue el mejor precio el smart TV Xiaomi MI TV P1E ELA4740EU, un televisor de 32 pulgadas con Android TV y todo lo que necesitas para disfrutar del entretenimiento en casa. Por su tamaño y características, es una alternativa sensacional para dormitorios y segundas viviendas. Entre sus especificaciones más importantes, destacar el procesador de 4 núcleos, la conectividad WiFi, Bluetooth, USB... ¡Justo lo que necesitas sin pagar un euro de más!', 'Xiaomi', 0),
