(2622, 'Pantalla de proyección Approx Trípode 180 x 180', 'https://www.neobyte.es/11513-large_default/pantalla-proyeccion-approx-tripode-180x180.jpg', 49.9, 'Una pantalla para proyectores de 180 x 180, ideal para colocar en cualquier sitio que te haga falta, además, fácil de transportar y almacenar. Un accesorio imprescindible para tu proyector', 'Approx', 0),
(2623, 'Iggual PSIES200 - Pantalla mural 200x200 eléctrica', 'https://www.neobyte.es/40312-large_default/pantalla-iggual-mural-200x200-psies200-electrica.jpg', 79.9, 'Pantalla mural de proyección Iggual PSIES200, con una tamaño de 200 x 200 cm. y mecanismo eléctrico accionable mediante mando a distancia o interruptor de pared. Cuenta con carcasa blanca protectora a prueba de polvo y bordes negros de 3 cm. de ancho.', 'Iggual', 0),
(2624, 'Iggual IGG314562 - Soporte de Televisor 32 a 55', 'https://www.neobyte.es/95395-large_default/iggual-igg314562-soporte-de-televisor-32-a-55.jpg', 14.9, 'Iggual IGG314562 - Soporte de Televisor 32 a 55', 'Iggual', 0),
(2625, 'Iggual IGG314494 - Soporte de Televisor 37 a 70', 'https://www.neobyte.es/95406-large_default/iggual-igg314494-soporte-de-televisor-37-a-70.jpg', 6.9, 'Iggual IGG314494 - Soporte de Televisor 37 a 70', 'Iggual', 0),
(2626, 'Optoma X381 3900 lúmenes - Proyector DLP', 'https://www.neobyte.es/75414-large_default/optoma-x381-3900-lumenes-proyector-dlp.jpg', 415.9, 'Optoma X381 3900 lúmenes - Proyector DLP', 'Optoma', 0),
(2627, 'Iggual PSIMS200 - Pantalla mural 200x200 manual', 'https://www.neobyte.es/40315-large_default/pantalla-iggual-mural-200x200-psims200-manual.jpg', 51.9, 'Pantalla mural de proyección Iggual PSIMS200, con una tamaño de 200 x 200 cm. Cuenta con bordes de color negro y es compatible con los formatos 1:1, 4:3 y 16:9. Dispone de frontal de tela blanco mate y posterior negro opaco.', 'Iggual', 0),
(2628, 'Optoma X309ST - Proyector DLP Short Throw 3700 lúmenes', 'https://www.neobyte.es/75351-large_default/optoma-x309st-proyector-dlp-short-throw-3700-lumenes.jpg', 511.9, 'Optoma X309ST 3700 lúmenes - Proyector DLP de tiro corto', 'Optoma', 0),
(2629, 'Optoma W400LVe 4000 lúmenes - Proyector DLP', 'https://www.neobyte.es/75430-large_default/optoma-w400lve-4000-lumenes-proyector-dlp.jpg', 536.9, 'Optoma W400LVe 4000 lúmenes - Proyector DLP', 'Optoma', 0),
(2630, 'Optoma H185X - Proyector DLP 3700 lúmenes', 'https://www.neobyte.es/75426-large_default/optoma-h185x-proyector-dlp-3700-lumenes.jpg', 524.9, 'Optoma H185X 3700 lúmenes - Proyector DLP', 'Optoma', 0),
(2631, 'Soporte de pizarra con ruedas Iggual IGG314364', 'https://www.neobyte.es/40325-large_default/soporte-pizarra-ruedas-igg314364.jpg', 109.9, 'Soporte Igg314364 con ruedas para pizarra. Incluye 4 ruedas de goma con freno manual y ofrece una compatibilidad universal.', 'Iggual', 0),
(2632, 'BenQ LU930 - Proyector WUXGA 5000 lumens', 'https://www.neobyte.es/34979-large_default/proyector-benq-avpro-lu930.jpg', 2965.9, 'Perfecto para salas de conferencias, el BenQ LU930 proporciona imágenes de gran calidad, definidas y nítidas, con las que aportar valor a las reuniones de empresa. Este proyector cuenta con una cobertura de color Rec.709 del 92%, lente de alta precisión y certificado IP5X a prueba de polvo para garantizar proyecciones óptimas y reducir los costes de mantenimiento. Dispone, además, de una extensa conectividad y tecnología láser BlueColor. Compra el BenQ LU930 al precio más competitivo en Neobyte.', 'Benq', 0),
(2633, 'Iggual Iris 86 - Pizarra interactiva', 'https://www.neobyte.es/40326-large_default/pizarra-interactiva-iggual-iris-86.jpg', 425.9, 'Pizarra interactiva Iggual Iris 86, ideal para entornos educativos, empresariales y organismos oficiales. Entre sus principales ventajas, destacan la posibilidad de interacción de hasta 10 personas al mismo tiempo y los accesorios incluidos (lápices, puntero extensible...). Conéctala a tu ordenador Windows y un proyector y lleva tus presentaciones a un nuevo nivel.', 'Iggual', 0),
(2634, 'Optoma W340UST - Proyector DLP 4000 lúmenes', 'https://www.neobyte.es/75362-large_default/optoma-w340ust-proyector-dlp-4000-lumenes.jpg', 1227.9, 'Optoma W340UST 4000 lúmenes - Proyector', 'Optoma', 0),
(2635, 'Pantalla de proyección Iggual 203x114cm Eléctrica', 'https://www.neobyte.es/95379-large_default/pantalla-de-proyeccion-iggual-203x114cm-electrica.jpg', 72.9, 'Pantalla de proyección Iggual 203x114cm Eléctrica', 'Iggual', 0),
(2636, 'Pantalla de proyección Iggual 184x104cm Eléctrica', 'https://www.neobyte.es/95375-large_default/pantalla-de-proyeccion-iggual-184x104cm-electrica.jpg', 63.9, 'Pantalla de proyección Iggual 184x104cm Eléctrica', 'Iggual', 0),
(2637, 'Asus VivoWatch BP (HC-A04) - Smartwatch', 'https://www.neobyte.es/19190-large_default/asus-vivowatch-bp-hc-a04-smartwatch.jpg', 92.89, 'Asus VivoWatch BP (HC-A04) ha sido diseñado para mejorar tu salud cardiovascular. Este preciso Smartwatch incorpora tecnología Asus Health AI, que emplea un sensor óptico para realizar un seguimiento continuo y seguro de la frecuencia cardíaca y la presión arterial. Estos datos, junto con los de edad y género, aportan la información necesaria para medir la intensidad del ejercicio y establecer pautas que mejoren la salud de nuestro corazón. Además, podrás realizar un seguimiento del sueño y llevar un control global de tu salud basado en la actividad física y la calidad del descanso. Comienza a cuidarte con el Asus VivoWatch BP.', 'Asus', 0),
(2638, 'Asus VivoWatch SP (HC-A05) - Smartwatch', 'https://www.neobyte.es/38129-large_default/reloj-asus-vivowatch-sp.jpg', 179.89, 'Asus VivoWatch SP (HC-A05) es el reloj inteligente que tiene todo lo que necesitas para una monitorización exhaustiva tanto de la salud como de tu actividad diaria. Con un diseño actual y discreto, así como con un manejo sencillo, este smartwatch te ayudará a llevar un control de aspectos tan importantes como la presión arterial, la frecuencia cardíaca, la calidad del sueño, calorías quemadas, nivel de oxígeno en sangre... convirtiéndose así es tu aliado perfecto para una vida saludable. Además, es capaz de contrar pasos e integra altímetro y GPS, lo que permite un análisis pormenorizado de cualquier actividad física. Por último, destacar su larga autonomía, la resistencia al agua y notificaciones integradas tanto de llamada como de texto. Por todo ello el Asus VivoWatch SP (HC-A05) es mucho más que un smartwatch. ¡Cómpralo ya en Neobyte con las máximas garantías!', 'Asus', 0),
(2639, 'Regleta PowerCube Azul 4 tomas + 2 USB', 'https://www.neobyte.es/8830-large_default/regleta-power-cube-azul-4-tomas-2-usb.jpg', 17.9, '¿Por qué conformarte con una clásica regleta cuando en Neobyte puedes tener este PowerCube Azul a un precio irresistible? Este original accesorio permite conectar hasta 4 aparatos electrónicos vía entrada de corriente y, además, integra dos prácticos puertos USB, ideales para cargar el móvil, la cámara de fotos...', 'Power cube', 0),
(2640, 'Iggual SOP 1 (IGG316115) - Soporte con ruedas para PC', 'https://www.neobyte.es/26839-large_default/soporte-iggual-de-cpu-con-ruedas-igg316115.jpg', 8.91, 'Soporte para PC con ruedas Iggual SOP 1 (IGG316115) permite transportar la torre fácilmente de un lado a otro y puede ajustar el ancho en función del ordenador, desde los 15 cm hasta los 26 cm. Fabricado en plástico.', 'Iggual', 0),
(2641, 'Navee V40 Pro - Patinete eléctrico', 'https://www.neobyte.es/106258-large_default/navee-v40-pro-patinete-electrico.jpg', 579.9, 'Navee V40 Pro - Patinete eléctrico', 'Navee', 0),
(2642, 'PowerCube Gris 4 tomas + 2 USB + cable', 'https://www.neobyte.es/8832-large_default/regleta-power-cube-gris-4-tomas-2-usb-cable.jpg', 22.91, 'Descubre PowerCube Gris, una ingeniosa regleta con 4 tomas de corriente diferente a todo lo que has visto hasta ahora. Su diseño sólido y compacto permite ahorrar espacio y, además, da cabida a dos prácticos puertos USB, perfectos para cargar tu móvil o tablet. Este modelo incluye también un cable de 1.5 metros de primera calidad, muy útil para colocar el PowerCube allá donde desees.', 'Power cube', 0),
(2643, 'Xiaomi Commuter Helmet - Casco de seguiridad', 'https://www.neobyte.es/90123-large_default/xiaomi-commuter-helmet-casco-de-seguiridad.jpg', 14.9, 'Xiaomi Commuter Helmet - Casco de seguiridad', 'Xiaomi', 0),
(2644, 'Control de presencia biométrico Approx', 'https://www.neobyte.es/22552-large_default/control-de-presencia-biometrico-approx-tft-24.jpg', 35.9, 'Te presentamos el sistema de control de presencia biómetro Approx APPATTENDACE01, una manera fácil de contolar y gestionar la jornada laboral y los turnos de los trabajadores de tu empresa. Este modelo incorpora pantalla de 2.4, teclado y sensor de huella dactilar para una identificación precisa de cada trabajador. Además, permite descargar los informes generados en a través de un pendrive para la visualización en un ordenador.', 'Approx', 0),
(2645, 'Xiaomi Amazfit GTS Naranja - Smartwatch', 'https://www.neobyte.es/38357-large_default/smartwatch-amazfit-gts-naranja.jpg', 61.9, 'El smartwatch Xiaomi Amazfit GTS Naranja es tan elegante como completo, adaptándose así perfectamente a tu estilo de vida. Este reloj inteligente cuenta con una fabulosa pantalla AMOLED táctil de gran resolución y 1.65 con Corning Gorilla Glass 3 desde la que visualizar cómodamente multitud de aspectos relacionados con tu actividad, así como notificaciones y demás widgets personalizables. Ligero y cómodo de llevar, está listo para soportar los rigores del día a día, pues ofrece una gran resistencia, es sumergible... En lo referente a las prestaciones del Xiaomi Amazfit GTS Naranja, destacar el sensor de frecuencia cardíaca, la batería de larga duración y los 12 modos de ejercicio (correr, caminar, ciclismo, natación, escalada, gimnasio...', 'Xiaomi', 0),
(2646, 'Xiaomi Portable Electric Air Compressor 1S - Inflador de neumáticos', 'https://www.neobyte.es/90121-large_default/xiaomi-portable-electric-air-compressor-1s-inflador-de-neumaticos.jpg', 41.9, 'Xiaomi Portable Electric Air Compressor 1S - Inflador de neumáticos', 'Xiaomi', 0),
(2647, 'Navee V40 - Patinete eléctrico', 'https://www.neobyte.es/106251-large_default/navee-v40-patinete-electrico.jpg', 569.9, 'Navee V40 - Patinete eléctrico', 'Navee', 0),
(2648, 'Regleta PowerCube Naranja 4 tomas + cable + mando', 'https://www.neobyte.es/8892-large_default/regleta-power-cube-naranja-4-tomas-cable-1-5-c-r.jpg', 18.89, 'PowerCube Naranja es mucho más que una simple regleta. Su ingenioso diseño en forma de cubo da cabida a 4 tomas de corriente dispuestas para aprovechar al máximo el espacio. Además, este modelo incluye cable alargador de 1,5 metros, sistema de anclaje y un práctico mando de control remoto para encender/apagar los dispositivos conectados.', 'Power cube', 0),
(2649, 'Navee N20 - Patinete eléctrico', 'https://www.neobyte.es/106254-large_default/navee-n20-patinete-electrico.jpg', 449.9, 'Navee N20 - Patinete eléctrico', 'Navee', 0),
(2650, 'Filtro LED de colores para grifo Unotec', 'https://www.neobyte.es/35442-large_default/filtro-led-colores-para-grifo-unotec.jpg', 9.95, 'Dale un toque original a tu baño con el filtro LED para grifo Unotec, muy fácil de instalar (no requiere pilas) y con iluminación en 3 colores que cambian en función de la temperatura del agua, evitando así que esté demasiado fría o que te quemes accidentalmente.', 'Unotec', 0),
(2651, 'Navee V50 - Patinete eléctrico', 'https://www.neobyte.es/106265-large_default/navee-v50-patinete-electrico.jpg', 699.9, 'Navee V50 - Patinete eléctrico', 'Navee', 0),
(2652, 'PowerCube rojo 5 tomas + cable 1.5 m', 'https://www.neobyte.es/8836-large_default/powercube-rojo-5-tomas-cable-15-m.jpg', 13.9, 'Ideal para llevar de viaje y/o colocar en tu escritorio, PowerCube Rojo es una regleta eléctrica que se sale de la norma, pues cuenta con un diseño único que permite aprovechar el espacio al máximo. Además, cuenta con altos estándares de seguridad e incluye cable alargador de 1.5 metros. ¡Todo ello a un precio fabuloso!', 'Power cube', 0),
(2653, 'Xiaomi Mi Smart Air Fryer 1500W - Freidora de aire', 'https://www.neobyte.es/106274-large_default/xiaomi-mi-smart-air-fryer-1500w-freidora-de-aire.jpg', 74.9, 'Xiaomi Mi Smart Air Fryer 1500W - Freidora de aire', 'Xiaomi', 0),
(2654, 'Orbegozo MN 3800 - Espumador de leche', 'https://www.neobyte.es/74918-large_default/orbegozo-mn-3800-espumador-de-leche.jpg', 8.91, 'Orbegozo MN 3800 - Espumador de leche', 'Orbegozo', 0),
(2655, 'Batidora Amasadora - Orbegozo AM8000 (1800W)', 'https://www.neobyte.es/74217-large_default/batidora-amasadora-orbegozo-am8000-1800w.jpg', 120.9, 'AMASADORA ORBEGOZO AM 8000 1800W', 'Orbegozo', 0),
(2656, 'ROBOT COCINA CECOTEC MAMBO 9590', 'https://www.neobyte.es/73140-large_default/robot-cocina-cecotec-mambo-9590.jpg', 194.89, 'ROBOT COCINA CECOTEC MAMBO 9590', 'CECOTEC', 0),
(2657, 'TOSTADOR ORBEGOZO TO 1010 600W BLANCO', 'https://www.neobyte.es/73075-large_default/tostador-orbegozo-to-1010-600w-blanco.jpg', 19.9, 'TOSTADOR ORBEGOZO TO 1010 600W BLANCO', 'Orbegozo', 0),
(2658, 'SANDWICHERA TRISTAR SA-3050 750W', 'https://www.neobyte.es/73066-large_default/sandwichera-tristar-sa-3050-750w.jpg', 16.9, 'SANDWICHERA TRISTAR SA-3050 750W', 'TRISTAR', 0),
(2659, 'FREIDORA XIAOMI MI SMART AIR FRYER 1500W 3.5L', 'https://www.neobyte.es/61773-large_default/freidora-xiaomi-mi-smart-air-fryer-1500w-35l.jpg', 69.9, 'FREIDORA XIAOMI MI SMART AIR FRYER 1500W 3.5L', 'Xiaomi', 0);
