(2660, 'Exprimidor Taurus TC-350 25W 0,35L', 'https://www.neobyte.es/11528-large_default/exprimidor-taurus-tc-350-25w-0-35l.jpg', 14.9, '¿Eres de l@s que pasan cada mañana sin su zumo? El exprimidor Taurus TC-350 es una práctica herramienta, de diseño moderno y compacto, con la que podrás disfrutar de todas las propiedades del zumo de naranja cómodamente, pudiendo seleccionar la cantidad de pulpa mediante un simple giro de la jarra. Se puede desmontar para su limpieza y es apto para lavavajillas.', 'Taurus', 0),
