(2769, 'AENO RC3S - Robot aspirador', 'https://www.neobyte.es/111353-large_default/aeno-rc3s-robot-aspirador.jpg', 379.9, 'El robot aspirador AENO RC3S te permite controlar y programar la limpieza desde cualquier lugar a través de la aplicación AENO. Con una potencia excepcional de 2500 Pa, realiza una limpieza eficiente en mojado y se adapta a todo tipo de superficies. Con hasta 130 minutos de autonomía, supera desniveles de 18 mm y ofrece opciones como control por voz y paredes virtuales para una limpieza conveniente y personalizada.', 'Aeno', 0),
(2770, 'AENO RC2S - Robot aspirador', 'https://www.neobyte.es/111354-large_default/aeno-rc2s-robot-aspirador.jpg', 379.9, 'Con potencia de 2500 Pa, puede limpiar diversas superficies, incluyendo alfombras de pelo largo, y ofrece una eficaz limpieza diaria del pelo de mascotas. Con un motor japonés Nidec confiable y una autonomía de hasta 130 minutos, este robot supera desniveles de hasta 18 mm y cuenta con un amplio rango de formas de control, incluyendo el control por voz. Además, su mapeo preciso de habitaciones, paredes virtuales, programación de limpieza y capacidad de limpieza regular en lugares de difícil acceso hacen que la experiencia de limpieza sea completa y conveniente.', 'Aeno', 0),
(2771, 'AENO SC1 - Aspiradora inalámbrica', 'https://www.neobyte.es/111211-large_default/aeno-sc1-aspiradora-inalambrica.jpg', 159.9, 'La aspiradora inalámbrica AENO SC1 ofrece un rendimiento de limpieza excepcional en todas las superficies, con potencia de succión constante y alta autonomía de hasta 45 minutos. Su diseño multifuncional permite la limpieza de muebles, lugares de difícil acceso, diversos tipos de suelos y techos gracias a los accesorios incluidos. Con dos modos de limpieza, es perfecta para toda la casa y también ideal para la limpieza del coche sin necesidad de conexión a la red eléctrica. Con un peso ultraligero de 1.54 kg, cepillo eléctrico turbo motorizado, iluminación LED, contenedor de fácil limpieza y filtro MIF lavable, esta aspiradora ofrece comodidad y eficacia. Además, cuenta con un soporte de pared que ahorra espacio y almacena accesorios convenientemente.', 'Aeno', 0),
(2772, 'AENO RC4S - Robot aspirador', 'https://www.neobyte.es/111352-large_default/aeno-rc4s-robot-aspirador.jpg', 538.99, 'La aplicación móvil AENO es fácil de usar y permite programar la limpieza, establecer modos, utilizar paredes virtuales y monitorear la carga de la batería desde cualquier lugar del mundo. Con mapeo preciso de habitaciones, programación de limpieza y capacidad de superar desniveles de hasta 20 mm, el AENO RC4S es una solución completa para mantener tu hogar limpio y fresco.', 'Aeno', 0),
(2773, 'ASPIRADOR ESCOBA BOSCH FLEXXO SERIE 4', 'https://www.neobyte.es/73112-large_default/aspirador-escoba-bosch-flexxo-serie-4.jpg', 187.9, 'ASPIRADOR ESCOBA BOSCH FLEXXO SERIE 4', 'BOSCH', 0),
(2774, 'ASPIRADOR BOSCH SERIE 2 700W', 'https://www.neobyte.es/73123-large_default/aspirador-bosch-serie-2-700w.jpg', 105.9, 'ASPIRADOR BOSCH SERIE 2 700W', 'BOSCH', 0),
(2775, 'AENO SC3 - Aspiradora inalámbrica', 'https://www.neobyte.es/111208-large_default/aeno-sc3-aspiradora-inalambrica.jpg', 219.91, 'Con tres modos de limpieza para adaptarse a todo tipo de superficies, es perfecta para toda la casa y también es ideal para la limpieza de coches sin necesidad de conexión a la corriente. Su diseño funcional permite cambiar fácilmente el ángulo de limpieza de 90 a 180° con un esfuerzo mínimo, y cuenta con un cepillo turbo motorizado, iluminación LED, pantalla digital, sistema anti-enredos de cabello, filtro MIF lavable y un cargador de pared que ahorra espacio y facilita la carga automática durante el almacenamiento. Con un peso ultra ligero de 1.4 kg, esta aspiradora proporciona una limpieza eficiente y sin esfuerzo.', 'Aeno', 0),
(2776, 'Xiaomi Mi Vacuum Cleaner G9 - Aspirador sin cable', 'https://www.neobyte.es/63312-large_default/xiaomi-mi-vacuum-cleaner-g9-aspirador-sin-cable.jpg', 183.9, 'Xiaomi Mi Vacuum Cleaner G9 es la mejor solución de limpieza para tu hogar. Se trata de un aspirador sin cable con batería de larga duración que incorpora lo último para la eliminación cómoda y eficaz de la suciedad en todo tipo de suelos. Gracias a su motor digital de alta velocidad absorbe incluso el polvo más oculto. Paralelamente, el cepillo de gran diámetro incluye sistema de antienrollamiento, por lo que podrás utilizarlo incluso en alfombras y superficies irregulares. Así mismo, la tecnología multiciclónica y el filtrado de 5 capas garantiza una circulación fluida del aire para una mejor recogida de polvo. En último lugar, destacar su manejo realmente cómodo.', 'Xiaomi', 0),
(2777, 'PC NEO Gaming i5-14600K RTX 4070Ti SSD1TB 32GB', 'https://www.neobyte.es/106675-large_default/pc-neo-gaming-i5-14600k-rtx-4070ti-ssd1tb-32gb.jpg', 1799, '¿Buscas lo último en rendimiento? En Neobyte hemos diseñado este PC gaming incluyendo la tecnología más innovadora para que disfrutes de tus juegos al máximo. En este caso hemos elegido un procesador Intel Core i5-14600K de 14ª generación y memorias RAM DDR5 hasta 5200 Mhz, acompañados de una espectacular tarjeta gráfica Nvidia RTX 4070Ti de 12GB. También dispone de un SSD de 1TB de capacidad y fuente de alimentación con certificacion 80 Plus Gold. Compite con los mejores y vive el gaming más inmersivo con este PC NEO GAMING.', 'Neobyte', 0),
