(2783, 'PC NEO Powered By Asus Ryzen 9 7900X RTX 4070 SUPER SSD 1TB+2TB 32GB', 'https://www.neobyte.es/106404-large_default/pc-neo-powered-by-asus-ryzen-9-7900x-rtx-4070-super-ssd-1tb2tb-32gb.jpg', 1899, 'Nuestro ordenador NEO Powered By Asus más poderoso no te dejará indiferente. Provisto de procesador Amd Ryzen 9 7900X y 32GB de memoria RAM, es capaz de desarrollar con una fluidez increíble incluso las tareas informáticas más pesadas. Paralelamente, la tarjeta gráfica Nvidia Geforce RTX 4070 SUPER que hemos incorporado asegura un rendimiento extremo a la hora de jugar. Pero nuestros técnicos son insaciables y querían mejorarlo añadiendo al conjunto un SSD de 1TB y otro SSD de 2TB, todo ello dentro de una caja de diseño único: la Corsair 3000D.', 'Neobyte', 0),
(2784, 'PC NEO Gaming i5-13400F RTX 4060 1TB SSD 16GB', 'https://www.neobyte.es/111650-large_default/pc-neo-gaming-i5-13400f-rtx-4060-1tb-ssd-16gb.jpg', 1039, 'Disfruta de un rendimiento de vanguardia con este NEO Gaming. Equipado con procesador Intel Core i5-13400F de 13ª generación, 16GB de memoria RAM y SSD de 1TB, lo tiene todo para hacerte vibrar en cada juego y experimentar lo último en cuanto a prestaciones. En el apartado gráfico, destacar que nuestros técnicos han incorporado una Nvidia GeForce RTX 4060 de 8GB, un componente en perfecto equilibrio con el resto de hardware. El resultado es un ordenador de sobremesa que se atreve con todo y ofrece una respuesta ágil en las tareas y juegos más variados. Por supuesto, este PC NEO Gaming incluye solo componentes de fabricantes de primer nivel y es concebido y ensamblado por nuestros técnicos con más de 15 años de experiencia.', 'Neobyte', 0),
(2785, 'PC NEO Powered By Asus Ryzen 5 5600X RTX 4060 SSD 1TB 16GB', 'https://www.neobyte.es/106336-large_default/pc-neo-powered-by-asus-ryzen-5-5600x-rtx-4060-ssd-1tb-16gb.jpg', 939, '', 'Neobyte', 0),
(2786, 'PC NEO Powered by Asus i5-13400F RTX 4070 SUPER 1TB SSD 32GB', 'https://www.neobyte.es/106410-large_default/pc-neo-powered-by-asus-i5-13400f-rtx-4070-super-1tb-ssd-32gb.jpg', 1598.99, 'Toda la potencia del hardware Asus más top cabe en este NEO Powered by Asus, un PC gaming configurado por nuestros técnicos con más de 15 años de experiencia para hacerte vibrar en cada juego y/o realizar todo tipo de tareas de manera ágil. Provisto de procesador Intel de 13ª generación Intel Core i5-13400F, placa base de alta gama, 32GB de memoria RAM, SSD de 1TB y tarjeta gráfica Nvidia GeForce RTX 4070 SUPER de 12GB, ofrece un rendimiento impresionante a todos los niveles y la máxima fiabilidad. No renuncies a nada con este PC NEO Powered by Asus.', 'Neobyte', 0),
(2787, 'PC NEO Gaming i7-13700K RTX 4070 SUPER SSD 1TB 16GB', 'https://www.neobyte.es/106327-large_default/pc-neo-gaming-i7-13700k-rtx-4070-super-ssd-1tb-16gb.jpg', 1699, 'Si te vuelve loc@ el RGB pero además quieres un PC gamer de garantías, nuestra configuración NEO Gaming es justo lo que buscas. A un diseño irresistiblemente llamativo que incluye multitud de componentes (incluyendo la caja) con iluminación RGB, hay que sumar la incorporación de un potente procesador como es el Intel Core i7-13700K, 16 GB de memoria RAM y tarjeta gráfica RTX 4070 SUPER de 12GB. Además, en cuanto a almacenamiento se refiere, este equipo está provisto de 1Tb SSD. Rendimiento sin contemplaciones y un estética que te dejará sin palabras... todo esto y mucho más cabe en este Neo Gaming.', 'Neobyte', 0),
(2788, 'PC NEO Corsair iCUE BlackFlag i9-13900K RTX 4070Ti SUPER SSD 1TB 32GB', 'https://www.neobyte.es/90484-large_default/pc-neo-corsair-icue-blackflag-i9-13900k-rtx-4070ti-super-ssd-1tb-32gb.jpg', 2499, '¿Buscas un ordenador gaming de garantías? En Neobye hemos creado esta configuración en base a las preferencias de nuestros clientes y a la experiencia de nuestros técnicos. Un PC en el que no faltan la estabilidad y el rendimiento de los procesadores Intel, con un i9-13900K, y la potencia de una gráfica Nvidia de última generación, la RTX 4070Ti SUPER 16GB. Si añadimos la velocidad que aportan la memoria de 32GB y el SSD de 1TB obtenemos un equipo con el que disfrutar de tus juegos al máximo. Y como siempre, con el sello de calidad de los principales fabricantes.', 'Neobyte', 0),
(2789, 'PC NEO Powered By Asus Ryzen 9 7900X3D RTX 4080 Super SSD 1TB+4TB 64GB', 'https://www.neobyte.es/94980-large_default/pc-neo-powered-by-asus-ryzen-9-7900x3d-rtx-4080-super-ssd-1tb4tb-64gb.jpg', 3599, 'Rendimiento extremo y máxima fiabilidad van de la mano en nuestra configuración NEO Powered By Asus con procesador AMD Ryzen 9 de 7ª generación 7900X3D, 64GB de memoria RAM y tarjeta gráfica de 16GB Nvidia Geforce RTX 4080 Super, una combinación perfecta para empezar a disfrutar de tus juegos como siempre habías imaginado, con la máxima fluidez y un nivel de detalles increíble. En lo referente al almacenamiento, hemos incorporado un disco sólido de 1TB que, combinado con otro SSD de 4TB, ofrece una velocidad sensacional a la hora de arrancar, ejecutar aplicaciones... Todo ello dentro de una caja de diseño irresistible diseño y grandes alternativas de configuración.', 'Neobyte', 0),
(2790, 'PC NEO Powered by Asus i5-14600KF RTX 4060 1TB 16GB', 'https://www.neobyte.es/106453-large_default/pc-neo-powered-by-asus-i5-14600kf-rtx-4060-1tb-16gb.jpg', 1199, '', 'Neobyte', 0),
(2791, 'PC NEO Powered by Asus i7-13700K RTX 4070 SUPER 1TB SSD 32GB', 'https://www.neobyte.es/106458-large_default/pc-neo-powered-by-asus-i7-13700k-rtx-4070-super-1tb-ssd-32gb.jpg', 1899, 'Neobyte y Asus, mano a mano para crear este NEO Powered by Asus, un PC ensamblado por nuestros técnicos con componentes Asus de primera calidad, lo que garantiza el máximo nivel de fiablidad y garantías. Bajo un chasis de lujo, encontramos un procesador Intel Core i7-13700K de 16 núcleos, 32GB de memoria RAM, un SSD de alta velocidad de 1TB y tarjeta gráfica Asus Nvidia GeForce RTX 4070 SUPER de 12GB. Este hardware asegura un rendimiento espectacular en todo tipo de juegos y aplicaciones profesionales. Echa un vistazo a sus características y verás que a este NEO Powered by Asus no le falta detalle.', 'Neobyte', 0),
(2792, 'PC NEO Gaming i7-14700K RTX 4070 SUPER SSD 1TB + SSD 2TB 32GB', 'https://www.neobyte.es/107429-large_default/pc-neo-gaming-i7-14700k-rtx-4070-super-ssd-1tb-ssd-2tb-32gb.jpg', 1999, 'Por menos de lo que piensas puedes hacerte con este potente y elegante NEO GAMING provisto de CPU Intel Core i7-14700K, 32GB de RAM y tarjeta gráfica Nvidia GeForce RTX 4070 SUPER de 12GB, así como almacenamiento compuesto por 1TB SSD + 2TB SSD. Una configuración equilibrada que permite mover con soltura la mayoría de los juegos actuales y que te aporta la fiabilidad que solo los fabricantes de primer nivel puede asegurarte. Busca, compara y vuelve para hacerte con el ordenador gaming que siempre habías soñado.', 'Neobyte', 0),
(2793, 'PC NEO Powered by Asus i7-14700KF RTX 4060 Ti SSD 1TB+SSD 2TB 32GB', 'https://www.neobyte.es/109979-large_default/pc-neo-powered-by-asus-i7-14700kf-rtx-4060-ti-ssd-1tbssd-2tb-32gb.jpg', 1939, '', 'Neobyte', 0),
(2794, 'PC NEO Powered by Asus i9-14900KF RTX 4070Ti SUPER SSD 1TB+2TB 32GB', 'https://www.neobyte.es/101893-large_default/pc-neo-powered-by-asus-i9-14900kf-rtx-4070ti-super-ssd-1tb2tb-32gb.jpg', 2599, 'Toda la fiabilidad y el rendimiento de unos componentes punteros se aúnan en este equipo Powered by Asus. Un PC equipado con procesador Intel Core i9-14900KF, 32GB de memoria, gráfica dedicada Nvidia Geforce RTX 4070Ti SUPER 16GB y SSD de 1TB... todo ello enmarcado en una caja Corsair 3000D  que desborda diseño y posibilidades. El resultado es una máquina que sobresale en rendimiento, concebida para dar lo máximo en todo tipo de juegos y tareas exigentes. Confía en los más de 15 años de experiencia de Neobyte y llévate un PC muy completo, potente y con el precio más ajustado.', 'Neobyte', 0),
(2795, 'PC NEO Aorus Ryzen 9 5900X RTX 4070 SUPER 1TB SSD + 2TB SSD 32GB', 'https://www.neobyte.es/111165-large_default/pc-neo-aorus-ryzen-9-5900x-rtx-4070-super-1tb-ssd-2tb-ssd-32gb.jpg', 1748.99, 'En Neobyte hemos creado este NEO AORUS con la mejor tecnología gaming de Gigabyte para que puedas hacer frente a un amplio abanico de juegos y difrutarlos como siempre habías soñado. Para ello, nuestros técnicos han incluido un placa Gigabyte B550 Aorus Elite,  un procesador AMD Ryzen 9 5900X acompañado de un Ventilador Cooler Master, 32GB de memoria RAM y tarjeta gráfica Gigabyte Nvidia GeForce RTX 4070 Super 12GB. Una combinación ganadora a la que hay que sumar una caja de estética sumamente cuidada y un almacenamiento compuesto por 1TB SSD y 2TB SSD.', 'Neobyte', 0),
(2796, 'PC NEO Powered By Asus i5-13400F RTX 4060 1TB SSD 16GB', 'https://www.neobyte.es/106407-large_default/pc-neo-powered-by-asus-i5-13400f-rtx-4060-1tb-ssd-16gb.jpg', 999, 'Cuando los técnicos de Neobyte y uno de los principales fabricantes de hardware se ponen de acuerdo el resultado no deja indiferente a nadie. Un PC gaming equipado con tecnología ASUS con el que podrás disfrutar de una experiencia de juego única. Cuenta con procesador Intel Core i5 de 13ª generación, 16GB de memoria y una fantástica tarjeta gráfica Nvidia RTX 4060 de 8Gb que te sumergirá en la acción más trepidante a través de un funcionamiento fluido. Además, incluye un SSD de 1TB, conectividad Wifi y fuente de alimentación con certificación 80+ Bronze. Aprovecha al máximo el rendimiento que ofrece este PC NEO Powered by Asus.', 'Neobyte', 0),
(2797, 'PC NEO Aorus Ryzen 7 7700X RTX 4070 Ti 32GB 1TB SSD+2TB SSD', 'https://www.neobyte.es/102063-large_default/pc-neo-aorus-ryzen-7-7700x-rtx-4070-ti-32gb-1tb-ssd2tb-ssd.jpg', 2398.99, 'Las configuraciones NEO Aorus Inside tienen mucho que decir en el universo gaming. Este PC en concreto ha sido provisto de dos de los componentes más destacados de Gigabyte: la placa B650 Gaming X AX  y la gráfica Nvidia RTX 4070Ti 12GB. Además, cuenta con procesador AMD Ryzen 7 7700X, 32GB de RAM, SSD de 1TB y un segundo SSD de 2TB, un elenco de primer nivel cuya combinación garantiza los mejores resultados. Si lo tuyo es el gaming, disfrutarás de lo lindo con este equipo.', 'Neobyte', 0),
(2798, 'PC NEO Powered by Asus TUF i7-14700K RTX 4060 1TB SSD 16GB', 'https://www.neobyte.es/106389-large_default/pc-neo-powered-by-asus-tuf-i7-14700k-rtx-4060-1tb-ssd-16gb.jpg', 1399, 'Con una estética que no esconde sus intenciones y un rendimiento impresionante, el NEO Powered By Asus TUF Edition se atreve con los juegos más exigentes del momento y te permite disfrutarlos como siempre habías soñado. Nuestros técnicos han dotado a esta configuración gaming de un potente procesador Intel Core i7-14700K, 16GB de memoria RAM y SSD de 1TB para que disfrutes de la máxima velocidad ejecutando todo tipo de programas y trabajando con grandes cantidades de archivos. El broche de oro lo pone una tarjeta gráfica de última generación Nvidia GeForce RTX 4060 de 8GB, provista de las tecnologías más innovadoras y la conectividad más completa.', 'Neobyte', 0),
(2799, 'PC NEO Gaming i7-13700K RTX 4070Ti SUPER 1TB SSD+2TB SSD 32GB', 'https://www.neobyte.es/106421-large_default/pc-neo-gaming-i7-13700k-rtx-4070ti-super-1tb-ssd2tb-ssd-32gb.jpg', 2338.99, 'Te presentamos el ordenador NEO GAMING con procesador Intel Core i7-13700K de 13ª generación, 32GB de memoria RAM y tarjeta gráfica RTX 4070Ti SUPER de 16GB, una auténtica apisonadora capaz de mover con increíble soltura los juegos y programas más exigentes. Bajo su apariencia sobria y elegante, encontramos también un almacenamiento combinado de 1TB SSD + 2TB SSD, lo que asegura la máxima velocidad a la hora de arrancar, transferir información, ejecutar aplicaciones... Confía en Neobyte para el montaje de tu equipo de alto rendimiento por experiencia, atención personalizada, garantía y precio.', 'Neobyte', 0),
(2800, 'PC NEO Gaming i5-14400F RTX 4070 SUPER SSD 1TB 16GB', 'https://www.neobyte.es/90761-large_default/pc-neo-gaming-i5-14400f-rtx-4070-super-ssd-1tb-16gb.jpg', 1398.99, '', 'Neobyte', 0),
(2801, 'PC NEO Aorus i9-14900K RTX 4080 Super 1TB SSD+2TB SSD 32GB', 'https://www.neobyte.es/102074-large_default/pc-neo-aorus-i9-14900k-rtx-4080-super-1tb-ssd2tb-ssd-32gb.jpg', 2999, '', 'Neobyte', 0),
(2802, 'PC NEO Gaming Ryzen 7 7700X RTX 4080 Super 32GB 1TB SSD + 4TB SSD', 'https://www.neobyte.es/108428-large_default/pc-neo-gaming-ryzen-7-7700x-rtx-4080-super-32gb-1tb-ssd-4tb-ssd.jpg', 2799, 'Desafía los límites con este PC NEO Gaming con procesador AMD Ryzen 7 7700X, una bestia diseñada y ensamblada por nuestros técnicos con más de 15 años de experiencia que te permitirá hacer frente a las tareas y juegos más exigentes. Entre sus características técnicas más importantes, destacar también los 32GB de memoria RAM y, por supuesto, la impresionante tarjeta gráfica Nvidia GeForce RTX 4080 Super de 16GB. Con ella podrás exprimir al máximo las posibilidades de los juegos triple A y ejecutar aplicaciones de diseño, render y edición sin problemas. Por último, indicar que ha sido provisto de SSD de 1TB y SSD 4TB para que almacenes todo lo que necesites.', 'Neobyte', 0),
(2803, 'PC NEO Gaming Intel i5 13500 RTX 4070 SUPER 1TB SSD 16GB', 'https://www.neobyte.es/107264-large_default/pc-neo-gaming-intel-i5-13500-rtx-4070-super-1tb-ssd-16gb.jpg', 1499, '', 'Neobyte', 0),
(2804, 'PC NEO Powered by Asus PRO Ryzen 7700X RTX 4070 Ti SUPER 2TB SSD 32GB', 'https://www.neobyte.es/108572-large_default/pc-neo-powered-by-asus-pro-ryzen-7700x-rtx-4070-ti-super-2tb-ssd-32gb.jpg', 2049, 'El ordenador NEO Powered By Asus PRO proporciona el rendimiento profesional que tu día a día necesita. Para ello, nuestros técnicos han ensamblado sobre una placa base del reconocido fabricante, un procesador Amd Ryzen 7 7700X, 32GB de RAM y lo último en almacenamiento, como es un SSD M.2 Nvme de 2TB. Con él podrás producir música y ejecutar todo tipo de tareas pesadas con una fluidez asombrosa y disfrutar de la máxima fiabilidad. Además, en Neobyte, tendrás la certeza de que tu máquina será montada por técnicos con más de 15 años de experiencia y sometida a los tests más rigurosos.', 'Neobyte', 0),
(2805, 'PC NEO Gaming i7-13700K RTX 4070Ti SUPER SSD 1TB 32GB', 'https://www.neobyte.es/111866-large_default/pc-neo-gaming-i7-13700k-rtx-4070ti-super-ssd-1tb-32gb.jpg', 1979, '', 'Neobyte', 0),
