(2807, 'PC NEO Powered by Asus PRO i9-14900KF RTX 4070 SUPER 32GB 1TB SSD + 2TB SSD', 'https://www.neobyte.es/101896-large_default/pc-neo-powered-by-asus-pro-i9-14900kf-rtx-4070-super-32gb-1tb-ssd-2tb-ssd.jpg', 2499, 'Si buscas un ordenador de sobremesa con una capacidad de procesamiento insuperable y con la garantía de un gran fabricante como Asus, no te pierdas este NEO Powered By Asus PRO, ideal para tareas profesionales que exijan una CPU de última generación (Intel Core i9-14900KF), gran cantidad de memoria RAM (32GB) y un almacenamiento completo que incorpora la última tecnología en materia de rendimiento (SSD M.2 Nvme de 1TB + SSD M.2 Nvme de 2TB). Todo ello con una caja de diseño sobrio y silencioso y, solo en Neobyte, con las máximas garantías y la confianza de saber que nuestros técnicos cuentan con más de 15 años de experiencia.', 'Neobyte', 0);
