(2808, 'PC NEO Powered By Asus i5-14600K RTX 4060Ti SSD 2TB 32GB', 'https://www.neobyte.es/107280-large_default/pc-neo-powered-by-asus-i5-14600k-rtx-4060ti-ssd-2tb-32gb.jpg', 1499, 'Nuestro nuevo NEO Powered By Asus es tan poderoso como parece. Equipado con un procesador Intel de 14ª generación Intel Core i5-14600K, 32GB de memoria RAM y tarjeta gráfica RTX 4060Ti de 8GB, está preparado para catapultar tus juegos a lo más alto, permitiéndote disfrutarlos con un nivel de detalle sensacional y con una fluidez extraordinaria. Además, hemos incluido un SSD de 2TB que sorprende por la rapidez a la hora de arrancar y ejecutar todo tipo de aplicaciones. Todo ello en una caja de lujo y con la garantía de una gran marca como Asus y la experiencia de Neobyte.', 'Neobyte', 0),
(2809, 'PC NEO Gaming i5-14600K RTX 4070Ti SSD1TB 32GB', 'https://www.neobyte.es/106675-large_default/pc-neo-gaming-i5-14600k-rtx-4070ti-ssd1tb-32gb.jpg', 1799, '¿Buscas lo último en rendimiento? En Neobyte hemos diseñado este PC gaming incluyendo la tecnología más innovadora para que disfrutes de tus juegos al máximo. En este caso hemos elegido un procesador Intel Core i5-14600K de 14ª generación y memorias RAM DDR5 hasta 5200 Mhz, acompañados de una espectacular tarjeta gráfica Nvidia RTX 4070Ti de 12GB. También dispone de un SSD de 1TB de capacidad y fuente de alimentación con certificacion 80 Plus Gold. Compite con los mejores y vive el gaming más inmersivo con este PC NEO GAMING.', 'Neobyte', 0),
(2810, 'PC NEO Powered by Asus PRO Ryzen 7700X RTX 4070 Ti SUPER 2TB SSD 32GB', 'https://www.neobyte.es/108572-large_default/pc-neo-powered-by-asus-pro-ryzen-7700x-rtx-4070-ti-super-2tb-ssd-32gb.jpg', 2049, 'El ordenador NEO Powered By Asus PRO proporciona el rendimiento profesional que tu día a día necesita. Para ello, nuestros técnicos han ensamblado sobre una placa base del reconocido fabricante, un procesador Amd Ryzen 7 7700X, 32GB de RAM y lo último en almacenamiento, como es un SSD M.2 Nvme de 2TB. Con él podrás producir música y ejecutar todo tipo de tareas pesadas con una fluidez asombrosa y disfrutar de la máxima fiabilidad. Además, en Neobyte, tendrás la certeza de que tu máquina será montada por técnicos con más de 15 años de experiencia y sometida a los tests más rigurosos.', 'Neobyte', 0),
(2811, 'PC NEO Powered by Asus i9-14900KF RTX 4070Ti SUPER SSD 1TB+2TB 32GB', 'https://www.neobyte.es/101893-large_default/pc-neo-powered-by-asus-i9-14900kf-rtx-4070ti-super-ssd-1tb2tb-32gb.jpg', 2599, 'Toda la fiabilidad y el rendimiento de unos componentes punteros se aúnan en este equipo Powered by Asus. Un PC equipado con procesador Intel Core i9-14900KF, 32GB de memoria, gráfica dedicada Nvidia Geforce RTX 4070Ti SUPER 16GB y SSD de 1TB... todo ello enmarcado en una caja Corsair 3000D  que desborda diseño y posibilidades. El resultado es una máquina que sobresale en rendimiento, concebida para dar lo máximo en todo tipo de juegos y tareas exigentes. Confía en los más de 15 años de experiencia de Neobyte y llévate un PC muy completo, potente y con el precio más ajustado.', 'Neobyte', 0),
(2812, 'NEO MINI CELERON N4500 8GB SSD 1TB', 'https://www.neobyte.es/67961-large_default/neo-mini-celeron-n4500-8gb-ssd-1tb.jpg', 248.99, 'Fiabilidad y rendimiento en tamaño mini PC. Mejorando versiones anteriores, este NEO MINI ofrece un funcionamiento estable y fluido en las tareas informáticas cotidianas, incluyendo ofimática, reproducción de contenido multimedia, navegación web, etc. Para ello ha sido provisto de un procesador Intel Celeron N4500, 8GB de memoria y una unidad SSD de 1TB. Además, dispone de conectividad Wifi y Bluetooth, así como diferentes puertos para conectar múltiples dispositivos.', 'Neobyte', 0),
(2813, 'PC NEO Gaming Intel i7 14700K RTX 4070Ti SUPER 1TB SSD 32GB', 'https://www.neobyte.es/106780-large_default/pc-neo-gaming-intel-i7-14700k-rtx-4070ti-super-1tb-ssd-32gb.jpg', 2048.99, '', 'Neobyte', 0),
(2814, 'PC NEO Office Ryzen 5 5500 16GB 1TB GT730', 'https://www.neobyte.es/101941-large_default/pc-neo-office-ryzen-5-5500-16gb-1tb-gt730.jpg', 489, '', 'Neobyte', 0),
(2815, 'PC NEO Powered by Asus PRO i9-14900KF RTX 4070 SUPER 32GB 1TB SSD + 2TB SSD', 'https://www.neobyte.es/101896-large_default/pc-neo-powered-by-asus-pro-i9-14900kf-rtx-4070-super-32gb-1tb-ssd-2tb-ssd.jpg', 2499, 'Si buscas un ordenador de sobremesa con una capacidad de procesamiento insuperable y con la garantía de un gran fabricante como Asus, no te pierdas este NEO Powered By Asus PRO, ideal para tareas profesionales que exijan una CPU de última generación (Intel Core i9-14900KF), gran cantidad de memoria RAM (32GB) y un almacenamiento completo que incorpora la última tecnología en materia de rendimiento (SSD M.2 Nvme de 1TB + SSD M.2 Nvme de 2TB). Todo ello con una caja de diseño sobrio y silencioso y, solo en Neobyte, con las máximas garantías y la confianza de saber que nuestros técnicos cuentan con más de 15 años de experiencia.', 'Neobyte', 0),
(2816, 'PC NEO Office Ryzen 5 5600G 16GB 2TB SSD', 'https://www.neobyte.es/101954-large_default/pc-neo-office-ryzen-5-5600g-16gb-2tb-ssd.jpg', 448.99, 'Si buscas rendimiento para tu día a día y no quieres complicarte la vida te presentamos un ordenador que se adapta a lo que buscas. Este NEO OFFICE incorpora un potente procesador Ryzen 5 5600G, memoria de 16GB y grabadora DVD, además de un sistema de almacenamiento nada desdeñable: disco SSD de 2TB. Y como siempre en Neobyte, con componentes de primeras marcas. La combinación perfecta entre calidad y precio.', 'Neobyte', 0),
(2817, 'PC NEO Powered by Asus PRO Ryzen 7 7700X RTX 4070 SUPER SSD 1TB+ SSD 2TB 32GB', 'https://www.neobyte.es/102975-large_default/pc-neo-powered-by-asus-pro-ryzen-7-7700x-rtx-4070-super-ssd-1tb-ssd-2tb-32gb.jpg', 1989, 'Al nuevo NEO Powered By Asus PRO que hemos configurado no le falta detalle. A su diseño elegante, ideal para integrar en un entorno profesional o doméstico, hay que sumar unas especificaciones técnicas que quitan el hipo, como son la incorporación de un procesador Amd Ryzen 7 7700X, 32GB de memoria RAM y tarjeta gráfica Nvidia Geforce RTX 4070 SUPER 12GB, características que permiten ejecutar de manera solvente y fluida la mayoría de programas y juegos del mercado. Paralelamente, hemos incluido una solución de almacenamiento compuesta por 1TB SSD y 2TB SSD que proporciona la mayor velocidad de arranque y gestión de archivos.', 'Neobyte', 0),
(2818, 'PC NEO Aorus Ryzen 9 5900X RTX 4070 SUPER 1TB SSD + 2TB SSD 32GB', 'https://www.neobyte.es/111165-large_default/pc-neo-aorus-ryzen-9-5900x-rtx-4070-super-1tb-ssd-2tb-ssd-32gb.jpg', 1748.99, 'En Neobyte hemos creado este NEO AORUS con la mejor tecnología gaming de Gigabyte para que puedas hacer frente a un amplio abanico de juegos y difrutarlos como siempre habías soñado. Para ello, nuestros técnicos han incluido un placa Gigabyte B550 Aorus Elite,  un procesador AMD Ryzen 9 5900X acompañado de un Ventilador Cooler Master, 32GB de memoria RAM y tarjeta gráfica Gigabyte Nvidia GeForce RTX 4070 Super 12GB. Una combinación ganadora a la que hay que sumar una caja de estética sumamente cuidada y un almacenamiento compuesto por 1TB SSD y 2TB SSD.', 'Neobyte', 0),
(2819, 'PC NEO Office Ryzen 5 5600G 16GB 1TB SSD', 'https://www.neobyte.es/101929-large_default/pc-neo-office-ryzen-5-5600g-16gb-1tb-ssd.jpg', 428.99, 'Por menos de lo que imaginas puedes conseguir este PC NEO OFFICE en tiempo récord y con las máximas garantías. Un ordenador de sobremesa que pone a tu disposición lo esencial para realizar las tareas informáticas más habituales tales como editar documentos, navegar, visualizar contenidos, consultar información... Entre sus especificaciones técnicas, destacar el procesador Amd Ryzen 5 5600G, los 16GB de RAM y el SSD de 1TB, lo que le aporta velocidad de arranque y un comportamiento general mejorado. Por supuesto, no podemos olvidar su amplia conectividad, que incluye Wifi y Bluetooth.', 'Neobyte', 0),
(2820, 'PC NEO Powered by Asus PRO Ryzen 7 5800X3D RTX 4060 Ti 1TB SSD + 2TB 32GB', 'https://www.neobyte.es/106461-large_default/pc-neo-powered-by-asus-pro-ryzen-7-5800x3d-rtx-4060-ti-1tb-ssd-2tb-32gb.jpg', 1489, 'En Neobyte conocemos las necesidades de los profesionales más exigentes, por lo que hemos creado esta configuración NEO Powered By Asus PRO con procesador Amd Ryzen 5800X3D, 32 GB de RAM y almacenamiento SSD de 1TB + SSD de 2TB, todos ellos componentes de marcas de primer nivel para que disfrutes de la máxima fiabilidad y rendimiento. Además, para hacer frente a las tareas gráficas y de cálculo más pesadas, hemos incorporado la tarjeta gráfica Nvidia Geforce RTX 4060Ti 8GB, una auténtica bestia que se atreve con todo. Todo ello con la conectividad más completa, 3 años de garantía y envío en tiempo récord.', 'Neobyte', 0),
(2821, 'PC NEO Aorus Ryzen 7 7700X RTX 4070 Ti 32GB 1TB SSD+2TB SSD', 'https://www.neobyte.es/102063-large_default/pc-neo-aorus-ryzen-7-7700x-rtx-4070-ti-32gb-1tb-ssd2tb-ssd.jpg', 2398.99, 'Las configuraciones NEO Aorus Inside tienen mucho que decir en el universo gaming. Este PC en concreto ha sido provisto de dos de los componentes más destacados de Gigabyte: la placa B650 Gaming X AX  y la gráfica Nvidia RTX 4070Ti 12GB. Además, cuenta con procesador AMD Ryzen 7 7700X, 32GB de RAM, SSD de 1TB y un segundo SSD de 2TB, un elenco de primer nivel cuya combinación garantiza los mejores resultados. Si lo tuyo es el gaming, disfrutarás de lo lindo con este equipo.', 'Neobyte', 0),
(2822, 'PC NEO Corsair iCUE BlackFlag i7-14700K RTX 4070 SUPER 1TB 32GB', 'https://www.neobyte.es/106514-large_default/pc-neo-corsair-icue-blackflag-i7-14700k-rtx-4070-super-1tb-32gb.jpg', 2198.99, 'El PC NEO Gaming que tienes ante ti combina potencia y fiabilidad para que te diviertas y trabajes con todas las garantías. Hablamos de una configuración equilibrada que destaca por su rendimiento y que es capaz de llevar a cabo una amplia variedad de tareas de forma fluida para jugar y trabajar más cómodamente. Integra componentes de primeras marcas, destacando la CPU Intel Core i7-14700K y la tarjeta gráfica Nvidia RTX 4070 SUPER. Dispone de memoria RAM de 32GB, SSD de 1TB, refrigeración líquida, conectividad Wifi... Da el salto de calidad al precio más competitivo.', 'Neobyte', 0),
(2823, 'PC NEO Office i5-13400 16GB SSD 1TB', 'https://www.neobyte.es/101932-large_default/pc-neo-office-i5-13400-16gb-ssd-1tb.jpg', 538.99, '', 'Neobyte', 0),
