(2860, 'PC NEO Powered by Asus TUF i7-14700K RTX 4060 1TB SSD 16GB', 'https://www.neobyte.es/106389-large_default/pc-neo-powered-by-asus-tuf-i7-14700k-rtx-4060-1tb-ssd-16gb.jpg', 1399, 'Con una estética que no esconde sus intenciones y un rendimiento impresionante, el NEO Powered By Asus TUF Edition se atreve con los juegos más exigentes del momento y te permite disfrutarlos como siempre habías soñado. Nuestros técnicos han dotado a esta configuración gaming de un potente procesador Intel Core i7-14700K, 16GB de memoria RAM y SSD de 1TB para que disfrutes de la máxima velocidad ejecutando todo tipo de programas y trabajando con grandes cantidades de archivos. El broche de oro lo pone una tarjeta gráfica de última generación Nvidia GeForce RTX 4060 de 8GB, provista de las tecnologías más innovadoras y la conectividad más completa.', 'Neobyte', 0),
(2861, 'PC NEO Gaming i7-13700K RTX 4070 SUPER SSD 1TB 16GB', 'https://www.neobyte.es/106327-large_default/pc-neo-gaming-i7-13700k-rtx-4070-super-ssd-1tb-16gb.jpg', 1699, 'Si te vuelve loc@ el RGB pero además quieres un PC gamer de garantías, nuestra configuración NEO Gaming es justo lo que buscas. A un diseño irresistiblemente llamativo que incluye multitud de componentes (incluyendo la caja) con iluminación RGB, hay que sumar la incorporación de un potente procesador como es el Intel Core i7-13700K, 16 GB de memoria RAM y tarjeta gráfica RTX 4070 SUPER de 12GB. Además, en cuanto a almacenamiento se refiere, este equipo está provisto de 1Tb SSD. Rendimiento sin contemplaciones y un estética que te dejará sin palabras... todo esto y mucho más cabe en este Neo Gaming.', 'Neobyte', 0),
(2862, 'PC NEO Gaming i5-12400F RTX 4060 SSD 1TB 16GB', 'https://www.neobyte.es/110186-large_default/pc-neo-gaming-i5-12400f-rtx-4060-ssd-1tb-16gb.jpg', 849, 'Te presentamos otra configuración con el sello de identidad de Neobyte: primeras marcas, componentes equilibrados y el precio más ajustado. En esta ocasión, hemos confeccionado un PC que incluye la innovadora gráfica Nvidia RTX 4060, un elemento con el que disfrutar de juegos de forma rápida y fluida. Incluye, por supuesto, un procesador de garantías, el Intel Core i5-12400F, con 16GB de RAM y SSD de 1TB, una apuesta clara por la potencia y la fiabilidad. A todo ello añadimos una caja espectacular con impresionantes efectos de iluminación y ya tenemos un PC Gaming de primer nivel.', 'Neobyte', 0),
(2863, 'PC NEO Powered By Asus Ryzen 9 7900X3D RTX 4080 Super SSD 1TB+4TB 64GB', 'https://www.neobyte.es/94980-large_default/pc-neo-powered-by-asus-ryzen-9-7900x3d-rtx-4080-super-ssd-1tb4tb-64gb.jpg', 3599, 'Rendimiento extremo y máxima fiabilidad van de la mano en nuestra configuración NEO Powered By Asus con procesador AMD Ryzen 9 de 7ª generación 7900X3D, 64GB de memoria RAM y tarjeta gráfica de 16GB Nvidia Geforce RTX 4080 Super, una combinación perfecta para empezar a disfrutar de tus juegos como siempre habías imaginado, con la máxima fluidez y un nivel de detalles increíble. En lo referente al almacenamiento, hemos incorporado un disco sólido de 1TB que, combinado con otro SSD de 4TB, ofrece una velocidad sensacional a la hora de arrancar, ejecutar aplicaciones... Todo ello dentro de una caja de diseño irresistible diseño y grandes alternativas de configuración.', 'Neobyte', 0),
(2864, 'PC NEO Gaming i5-14400F RTX 4070 SUPER SSD 1TB 16GB', 'https://www.neobyte.es/90761-large_default/pc-neo-gaming-i5-14400f-rtx-4070-super-ssd-1tb-16gb.jpg', 1398.99, '', 'Neobyte', 0),
(2865, 'PC NEO Gaming Ryzen 5 5500 RTX 4060 SSD 1TB 16GB', 'https://www.neobyte.es/106678-large_default/pc-neo-gaming-ryzen-5-5500-rtx-4060-ssd-1tb-16gb.jpg', 849, 'Jugar con todas las garantías, de forma fluida y rápida es la propuesta de este PC NEO Gaming. Un ordenador equipado con procesador AMD Ryzen 5, 16GB de memoria y una potente gráfica RTX 4060 que te permitirá disfrutar de una increíble experiencia gaming, apostando por la fiabilidad de unos componentes ampliamente contrastados y fiables. En cuanto al resto del hardware, este equipo cuenta con un SSD de 1TB, que aporta espacio y velocidad al funcionamiento general del PC, fuente de alimentación de 750W y una caja robusta. Confía en los 15 años de experiencia de Neobyte y hazte ahora con este impresionante ordenador.', 'Neobyte', 0),
(2866, 'PC NEO Corsair iCUE BlackFlag i9-13900K RTX 4070Ti SUPER SSD 1TB 32GB', 'https://www.neobyte.es/90484-large_default/pc-neo-corsair-icue-blackflag-i9-13900k-rtx-4070ti-super-ssd-1tb-32gb.jpg', 2499, '¿Buscas un ordenador gaming de garantías? En Neobye hemos creado esta configuración en base a las preferencias de nuestros clientes y a la experiencia de nuestros técnicos. Un PC en el que no faltan la estabilidad y el rendimiento de los procesadores Intel, con un i9-13900K, y la potencia de una gráfica Nvidia de última generación, la RTX 4070Ti SUPER 16GB. Si añadimos la velocidad que aportan la memoria de 32GB y el SSD de 1TB obtenemos un equipo con el que disfrutar de tus juegos al máximo. Y como siempre, con el sello de calidad de los principales fabricantes.', 'Neobyte', 0),
(2867, 'PC NEO Gaming Intel i5 13500 RTX 4070 SUPER 1TB SSD 16GB', 'https://www.neobyte.es/107264-large_default/pc-neo-gaming-intel-i5-13500-rtx-4070-super-1tb-ssd-16gb.jpg', 1499, '', 'Neobyte', 0),
(2868, 'PC NEO Powered by Asus i7-13700K RTX 4070 SUPER 1TB SSD 32GB', 'https://www.neobyte.es/106458-large_default/pc-neo-powered-by-asus-i7-13700k-rtx-4070-super-1tb-ssd-32gb.jpg', 1899, 'Neobyte y Asus, mano a mano para crear este NEO Powered by Asus, un PC ensamblado por nuestros técnicos con componentes Asus de primera calidad, lo que garantiza el máximo nivel de fiablidad y garantías. Bajo un chasis de lujo, encontramos un procesador Intel Core i7-13700K de 16 núcleos, 32GB de memoria RAM, un SSD de alta velocidad de 1TB y tarjeta gráfica Asus Nvidia GeForce RTX 4070 SUPER de 12GB. Este hardware asegura un rendimiento espectacular en todo tipo de juegos y aplicaciones profesionales. Echa un vistazo a sus características y verás que a este NEO Powered by Asus no le falta detalle.', 'Neobyte', 0),
(2869, 'PC NEO Gaming i5-13400F RTX 4060Ti 1TB SSD 16GB', 'https://www.neobyte.es/110182-large_default/pc-neo-gaming-i5-13400f-rtx-4060ti-1tb-ssd-16gb.jpg', 1049, 'Si combinamos los 20 años de experiencia de Neobyte, componentes de primeras marcas y nuestra pasión por el gaming tiene que dar como resultado un PC de garantías como este. Un equipo que integra la novedosa gráfica Nvidia RTX 4060Ti 8GB, un modelo que implementa la arquitectura Ada Lovelace en la gama RTX para ofrecer un rendimiento espectacular, y que asegura fiabilidad y potencia gracias al procesador Intel Core i5-13400F, a la RAM de 16GB y al SSD de 1TB. Todo ello enmarcado en un envoltorio de lujo, la caja Nfortec Caelum, y redondeado por un precio muy competitivo. Así que si buscas un PC gaming con el que vivir al máximo los eSports, mírate muy de cerca este ordenador.', 'Neobyte', 0),
(2870, 'PC NEO Gaming Ryzen 7 5800X3D RTX 4060 Ti 1T BSSD + 2TB SSD 16GB', 'https://www.neobyte.es/101870-large_default/pc-neo-gaming-ryzen-7-5800x3d-rtx-4060-ti-1t-bssd-2tb-ssd-16gb.jpg', 1399, '', 'Neobyte', 0),
(2871, 'PC NEO Powered by Asus i7-14700KF RTX 4060 Ti SSD 1TB+SSD 2TB 32GB', 'https://www.neobyte.es/109979-large_default/pc-neo-powered-by-asus-i7-14700kf-rtx-4060-ti-ssd-1tbssd-2tb-32gb.jpg', 1939, '', 'Neobyte', 0),
(2872, 'PC NEO Gaming Ryzen 5 5600X RTX 4060 Ti SSD 1TB 16GB', 'https://www.neobyte.es/108997-large_default/pc-neo-gaming-ryzen-5-5600x-rtx-4060-ti-ssd-1tb-16gb.jpg', 1049, '¿Echas en falta un PC potente para disfrutar al máximo de tus juegos? En Neobyte hemos diseñado este ordenador NEO GAMING buscando un rendimiento equilibrado, potente y completo, instalando componentes de primeras marcas cuya calidad ha sido ampliamente contrastada. Entre sus especificaciones destaca la gráfica RTX 4060 Ti, una GPU con tecnología Nvidia que hará las delicias de los gamers más exigentes. También encontramos un procesador AMD Ryzen 5, 16GB de memoria RAM y un SSD de 1TB de capacidad. Si has decidido comprar un PC gaming de garantías al precio más competitivo, en Neobyte te lo ofrecemos en bandeja.', 'Neobyte', 0),
(2873, 'Asus VivoBook 15 F1504ZA-NJ700 - Portátil 15.6 i5-1235U 16GB 512GB SSD', 'https://www.neobyte.es/109094-large_default/asus-vivobook-15-f1504za-nj700-portatil-156-i5-1235u-16gb-512gb-ssd.jpg', 518.99, 'El ASUS VivoBook 15 F1504ZA-NJ700 es un portátil elegante y eficiente con una pantalla de 15.6 Full HD que ofrece una resolución nítida de 1920 x 1080 píxeles. Equipado con un potente procesador Intel Core i5-1235U y respaldado por 16GB de RAM DDR4, garantiza un rendimiento sólido para tareas variadas. Con una capacidad de almacenamiento de 512 GB en un SSD, proporciona velocidad en el acceso a los datos. Los gráficos Intel Iris Xe Graphics mejoran la experiencia visual. Presenta un diseño en color plata fría y un peso de 1.7 kg, lo que lo hace portátil y estéticamente atractivo.', 'Asus', 0),
(2874, 'Gigabyte G5 KF-E3ES313SD - Portátil 15.6 i5-12500H 16GB RTX 4060 512GB SSD', 'https://www.neobyte.es/89183-large_default/gigabyte-g5-kf-e3es313sd-portatil-156-i5-12500h-16gb-rtx-4060-512gb-ssd.jpg', 1148.99, 'En resumen, la este portátil redefine la experiencia de juego con su diseño delgado, potente rendimiento, avanzada tecnología de enfriamiento, conectividad ultrarrápida y sonido envolvente de alta calidad. Crea posibilidades ilimitadas con esta máquina diseñada para satisfacer las demandas de jugadores y creadores por igual.', 'Gigabyte', 0),
(2875, 'Asus VivoBook 15 F1504ZA-NJ710 - Portátil 15.6 i7-1255U 16GB 512GB SSD', 'https://www.neobyte.es/109101-large_default/asus-vivobook-15-f1504za-nj710-portatil-156-i7-1255u-16gb-512gb-ssd.jpg', 599, 'El almacenamiento de 512 GB en un SSD asegura una respuesta rápida y accesibilidad ágil a tus datos. Con gráficos Intel Iris Xe, disfrutarás de una calidad visual excepcional. Su diseño en color plata fría le confiere un aspecto elegante. Con un peso de 1.7 kg, es ligero y fácil de transportar. Viene sin sistema operativo preinstalado, brindándote flexibilidad. El teclado QWERTY español completa esta opción versátil y potente para tus necesidades informáticas.', 'Asus', 0),
(2876, 'Gigabyte G6 KF-H3ES854SD - Portátil 16 i7-13620H 16GB RTX 4060 1TB SSD', 'https://www.neobyte.es/103080-large_default/gigabyte-g6-kf-h3es854sd-portatil-16-i7-13620h-16gb-rtx-4060-1tb-ssd.jpg', 1359, 'Los portátiles de alto rendimiento suelen contar con una cantidad significativa de memoria RAM, como 16GB, para facilitar la multitarea sin problemas y la ejecución fluida de aplicaciones exigentes. La inclusión de unidades de estado sólido (SSD) con capacidades de almacenamiento amplias, como 1TB, proporciona velocidades de lectura/escritura rápidas para arranques rápidos del sistema operativo y tiempos de carga más rápidos de aplicaciones y juegos.', 'Gigabyte', 0),
(2877, 'Asus VivoBook 16X K3605ZC-PL361W - Portátil 16 i5-12500H 16GB RTX 3050 512GB SSD W11', 'https://www.neobyte.es/109108-large_default/asus-vivobook-16x-k3605zc-pl361w-portatil-16-i5-12500h-16gb-rtx-3050-512gb-ssd-w11.jpg', 939, 'Gracias a la combinación de la potencia gráfica NVIDIA GeForce RTX 3050 de 4 GB, este portátil garantiza un rendimiento gráfico excepcional para tus actividades multimedia y juegos. Viene con el sistema operativo Windows 11 Home preinstalado, ofreciendo una experiencia de usuario intuitiva y moderna.', 'Asus', 0),
(2878, 'Asus VivoBook M1502YA-NJ151 - Portátil 15.6 Ryzen 7 7730U 16GB 512GB SSD', 'https://www.neobyte.es/101760-large_default/asus-vivobook-m1502ya-nj151-portatil-156-ryzen-7-7730u-16gb-512gb-ssd.jpg', 538.99, 'Con un diseño delgado y ligero, el Asus VivoBook es altamente portátil y fácil de llevar a cualquier lugar, sin comprometer su rendimiento. Además, ofrece una variedad de puertos, incluyendo USB, HDMI y lector de tarjetas SD, proporcionando opciones de conectividad versátiles para periféricos, pantallas externas y dispositivos de almacenamiento.', 'Asus', 0),
(2879, 'Asus ROG Flow Z13 GZ301VV-MU007W - Portátil 13.4 i9 13900H 16GB RTX4060 1TB SSD W11', 'https://www.neobyte.es/89684-large_default/asus-rog-flow-z13-gz301vv-mu007w-portatil-134-i9-13900h-16gb-rtx4060-1tb-ssd-w11.jpg', 2158.99, '', 'Asus', 0),
(2880, 'Asus ZenBook 14 OLED UX3405MA-PP606W - Portátil 14 U7-155H 16GB 512GB W11', 'https://www.neobyte.es/110108-large_default/asus-zenbook-14-oled-ux3405ma-pp606w-portatil-14-u7-155h-16gb-512gb-w11.jpg', 1229, 'Sumérgete en la sofisticación incomparable del ZenBook 14 OLED, un ultraportátil artesanal que redefine la elegancia. Potencia tu productividad y entretenimiento con el rendimiento excepcional del procesador Intel Core Ultra Meteor Lake y los gráficos Intel Arc. Disfruta de una experiencia visual cautivadora en la pantalla ASUS Lumina OLED de 14 pulgadas con una sorprendente resolución WQXGA+ (3K) y una frecuencia de actualización de 120Hz. Experimenta la durabilidad y confiabilidad de este exclusivo portátil, optimizado para la eficiencia y diseñado con materiales sostenibles que buscan reducir el impacto ambiental. Además, goza de una conectividad perfecta a través de los puertos más demandados (Thunderbolt, HDMI...), . Eleva tu jornada con la batería de larga duración y sumérgete en la elegancia ecológica de un diseño amigable con el medio ambiente, reflejando el compromiso con la equidad y la sostenibilidad.', 'Asus', 0),
(2881, 'Asus TUF Dash F15 TUF507ZC4-HN040 - Portátil 15.6 i7-12700H 16GB RTX 3050 512GB SSD', 'https://www.neobyte.es/88771-large_default/asus-tuf-dash-f15-tuf507zc4-hn040-portatil-156-i7-12700h-16gb-rtx-3050-512gb-ssd.jpg', 838.99, 'La pantalla de 15.6 pulgadas Full HD con una alta frecuencia de actualización de 144Hz te sumerge en un mundo de imágenes nítidas y fluidas, maximizando tu experiencia gaming y proporcionando una ventaja competitiva en cada partida. Este portátil también se destaca por su conectividad versátil y su teclado retroiluminado con tecnología RGB, ofreciendo un control total sobre la iluminación y el ambiente mientras juegas.', 'Asus', 0),
(2882, 'Asus TUF Gaming F17 TUF707VI-HX049 - Portátil 17.3 IPS i7-13620H RTX 4070 32GB SSD', 'https://www.neobyte.es/109125-large_default/asus-tuf-gaming-f17-tuf707vi-hx049-portatil-173-ips-i7-13620h-rtx-4070-32gb-ssd.jpg', 1648.99, 'Sorpréndete con el rendimiento potente y la inmersión visual gracias al portátil ASUS TUF Gaming F17 TUF707VI-HX049. Equipado con un procesador Intel Core i7-13620H y una tarjeta gráfica NVIDIA RTX 4070 de 8GB, este portátil ofrece un rendimiento excepcional para tus sesiones de juego intensivas y tareas multitarea. La pantalla de 17.3 Full HD con una frecuencia de actualización de 144Hz te sumerge en un mundo visual vibrante y fluido. Con 32GB de RAM DDR5 y un SSD de 1TB, disfrutarás de una respuesta rápida y tiempos de carga instantáneos. Además, el diseño robusto y elegante en color Mecha Gray, junto al teclado retroiluminado y de formato completo, complementan la experiencia de juego y productividad. Con el ASUS TUF Gaming F17, lleva tus sesiones de juego y trabajo al siguiente nivel.', 'Asus', 0),
(2883, 'Asus VivoBook 15 P1502CZA-EJ1736X - Portátil 15.6 i5-1235U 16GB 512GB SSD W11', 'https://www.neobyte.es/105517-large_default/asus-vivobook-15-p1502cza-ej1736x-portatil-156-i5-1235u-16gb-512gb-ssd-w11.jpg', 589.9, 'Este portátil encarna la elegancia y modernidad en su diseño, destacándose particularmente por su acabado en un tranquilo y sofisticado tono Azul (Quiet Blue). Esta tonalidad no solo aporta un toque de serenidad visual, sino que también refleja una estética contemporánea, haciendo del portátil una pieza distintiva tanto en ambientes profesionales como personales. Su diseño, enfocado en líneas limpias y una estructura minimalista, complementa perfectamente la funcionalidad con un estilo visualmente atractivo y profesional.', 'Asus', 0),
(2884, 'Asus ROG Strix G18 G814JIR-N6002 - Portátil 18 i9-14900HX 32GB RTX 4070 1TB SSD', 'https://www.neobyte.es/109659-large_default/asus-rog-strix-g18-g814jir-n6002-portatil-18-i9-14900hx-32gb-rtx-4070-1tb-ssd.jpg', 2299, 'Para una experiencia de juego verdaderamente inmersiva, ofrece una pantalla de 18 pulgadas con resolución WQXGA de 240 Hz. Estas pantallas no solo proporcionan una calidad de imagen excepcional, sino que también cuentan con una relación pantalla-cuerpo del 89%, asegurando que cada detalle en el juego se muestre con la máxima claridad y vivacidad.', 'Asus', 0),
(2885, 'Asus ZenBook 14 OLED UX3402VA-KM004W Portátil 14 i5-1340P 16GB 512GB W11', 'https://www.neobyte.es/89950-large_default/asus-zenbook-14-oled-ux3402va-km004w-portatil-14-i5-1340p-16gb-512gb-w11.jpg', 858.99, '', 'Asus', 0),
(2886, 'Asus VivoBook S14 Flip TP3402VA-LZ273W - Portátil 14 i5-1335U 16GB 512GB SSD W11', 'https://www.neobyte.es/109512-large_default/asus-vivobook-s14-flip-tp3402va-lz273w-portatil-14-i5-1335u-16gb-512gb-ssd-w11.jpg', 788.99, 'Explora la versatilidad con el ASUS VivoBook S 14 Flip TP3402VA-LZ273W. Este portátil convertible te ofrece un rendimiento excepcional con un procesador Intel Core i5-1335U, 16 GB de RAM y un almacenamiento SSD de 512 GB. La pantalla táctil WUXGA de 14 proporciona una experiencia visual inmersiva con una resolución de 1920 x 1200 píxeles. Diseñado en elegante color plateado, este híbrido combina estilo y funcionalidad. Con teclado en español y Windows 11 Home preinstalado, disfruta de la comodidad y la eficiencia en cualquier modo que elijas. ¡Convierte tus ideas en realidad con este portátil convertible!', 'Asus', 0);
INSERT INTO `producto` (`id`, `nombre`, `imagen`, `precio`, `especificaciones`, `marca`, `id_categoria`) VALUES
(2887, 'Asus TUF Gaming F15 TUF507VV-LP193 - Portátil 15.6 i7-13620H 16GB RTX 4060 1TB SSD', 'https://www.neobyte.es/109337-large_default/asus-tuf-gaming-f15-tuf507vv-lp193-portatil-156-i7-13620h-16gb-rtx-4060-1tb-ssd.jpg', 1348.99, 'Experimenta el rendimiento imparable con el ASUS TUF Gaming F15 TUF507VV-LP193. Este portátil gaming de 15.6 Full HD 144Hz presenta un potente Intel Core i7-13620H, 16GB de RAM, y un SSD de 1TB. Ya seas creador de contenido o te guste jugar, te encantará su gráfica NVIDIA GeForce RTX 4060. ¡Da la bienvenida a tu plataforma en gaming!', 'Asus', 0),
(2888, 'Asus ZenBook 15 OLED UM3504DA-MA286W - Portátil 15.6 Ryzen 7 7735U 16GB 512GB SSD W11', 'https://www.neobyte.es/105069-large_default/asus-zenbook-15-oled-um3504da-ma286w-portatil-156-ryzen-7-7735u-16gb-512gb-ssd-w11.jpg', 988.99, 'En resumen, el Asus ZenBook 15 OLED UM3504DA-MA286W, destaca por su combinación de portabilidad, sostenibilidad y rendimiento excepcional. Desde su pantalla OLED a 120 Hz hasta su diseño elegante y su capacidad para conquistar cualquier tarea, este ultraportátil ofrece una experiencia única para aquellos que buscan lo mejor en tecnología.', 'Asus', 0),
(2889, 'Asus VivoBook F1502ZA-EJ1121 - Portátil 15.6 i5-1235U 16GB 512GB SSD', 'https://www.neobyte.es/110172-large_default/asus-vivobook-f1502za-ej1121-portatil-156-i5-1235u-16gb-512gb-ssd.jpg', 478.99, 'Este modelo de VivoBook ofrece una variedad de puertos para conectividad, incluyendo puertos USB, HDMI y un lector de tarjetas. Además, su batería de larga duración brinda una autonomía adecuada para un uso diario prolongado, y su teclado ergonómico mejora la experiencia de escritura.', 'Asus', 0),
(2890, 'Gigabyte G5 MF5-52ES353SD - Portátil 15.6 i5-13500H 16GB RTX 4050 512GB SSD', 'https://www.neobyte.es/106399-large_default/gigabyte-g5-mf5-52es353sd-portatil-156-i5-13500h-16gb-rtx-4050-512gb-ssd.jpg', 999, 'La pantalla de 15,6 pulgadas del Gigabyte G5 MF5-52ES353SD tiene una resolución Full HD (1920 x 1080) y una frecuencia de actualización de 144 Hz. Esto la convierte en una excelente opción para juegos, ya que ofrece imágenes fluidas y sin parpadeos.', 'Gigabyte', 0),
(2891, 'Asus Vivobook 16X K3605ZC-N1268W - Portátil 16 i5-12450H 16GB 512GB SSD W11', 'https://www.neobyte.es/104786-large_default/asus-vivobook-16x-k3605zc-n1268w-portatil-16-i5-12450h-16gb-512gb-ssd-w11.jpg', 799, 'Con un diseño delgado y elegante, el Asus Vivobook 16X K3605ZC-N1268W es altamente portátil y presenta un aspecto moderno, perfecto para usuarios que valoran el rendimiento y la estética. Con una variedad de puertos USB, HDMI y Wi-Fi 6, este portátil ofrece opciones de conectividad versátiles para periféricos, pantallas externas y una conexión a internet rápida y estable.', 'Asus', 0),
(2892, 'Asus Vivobook 16X K3605ZC-N1270W - Portátil 16 i7-12650H 16GB RTX 3050 512GB SSD W11', 'https://www.neobyte.es/104793-large_default/asus-vivobook-16x-k3605zc-n1270w-portatil-16-i7-12650h-16gb-rtx-3050-512gb-ssd-w11.jpg', 898.99, 'Con 16GB de memoria RAM DDR4, este portátil garantiza un rendimiento multitarea sin interrupciones, permitiendo trabajar en varios programas al mismo tiempo sin comprometer la velocidad ni la respuesta del sistema.', 'Asus', 0),
