(2894, 'Lenovo V15 G2 IJL 82QY00PUSP - Portátil 15.6 Celeron N4500 8GB 256GB SSD', 'https://www.neobyte.es/105996-large_default/lenovo-v15-g2-ijl-82qy00pusp-portatil-156-celeron-n4500-8gb-256gb-ssd.jpg', 282.9, 'La presencia de una Webcam HD con cubierta de privacidad asegura comunicaciones seguras y la posibilidad de participar en videoconferencias con confianza. Con un peso de 1.7 kg, el V15 G2 se presenta como una opción portátil para aquellos que necesitan mantenerse productivos en movimiento. La combinación de Wi-Fi 5 y Bluetooth 5.1 permite una conectividad sin complicaciones, ofreciendo una experiencia completa para las necesidades profesionales y personales.', 'Lenovo', 0),
