(2898, 'Lenovo V15 G4 IAH 83FS002WSP - Portátil 15.6 i5-12500H 8GB 512GB SSD', 'https://www.neobyte.es/107997-large_default/lenovo-v15-g4-iah-83fs002wsp-portatil-156-i5-12500h-8gb-512gb-ssd.jpg', 497.9, 'La integración de la tarjeta gráfica Intel UHD Graphics asegura un rendimiento adecuado para tareas gráficas básicas y reproducción multimedia, satisfaciendo las necesidades de usuarios que no requieren de gráficos de alta intensidad. La movilidad es otro aspecto clave de este modelo, ya que su ligereza y diseño compacto lo hacen un compañero de viaje ideal para profesionales y estudiantes que necesitan una herramienta de trabajo o estudio fiable y fácil de transportar.', 'Lenovo', 0),
