(2900, 'Gigabyte Aero 16 BSF-A3ES964SP - Portátil 16 i9-13900H 32GB RTX 4070 1TB SSD W11', 'https://www.neobyte.es/110899-large_default/gigabyte-aero-16-bsf-a3es964sp-portatil-16-i9-13900h-32gb-rtx-4070-1tb-ssd-w11.jpg', 2259, 'El portátil Gigabyte Aero 16 BSF-A3ES964SP está diseñado para creadores, profesionales y diseñadores que buscan un rendimiento excepcional y una experiencia visual superior. Equipado con una pantalla OLED 4K+ de 16:10 y certificaciones de color X-Rite™ 2.0, Pantone® Validated, TÜV Rheinland de baja luz azul y Eyesafe® 2.0, garantiza una calidad de imagen excepcional y cuidado ocular. Potenciado por procesadores Intel® Core™ i9 de 13ª generación y GPU NVIDIA® GeForce RTX™ 40, ofrece un rendimiento de alta gama. Con un chasis delgado de 0.70 pulgadas y un peso de 1.9 kg, es portátil y potente, ideal para la creatividad en cualquier lugar. Además, con tecnologías como MUX Switch, Wi-Fi 6E, y una batería de 88Wh, proporciona una experiencia inigualable para creadores en movimiento.', 'Gigabyte', 0),
(2901, 'Lenovo V15 G4 AMN 82YU00TLSP - Portátil 15.6 Ryzen 3 7320U 8GB 256GB SSD W11', 'https://www.neobyte.es/104674-large_default/lenovo-v15-g4-amn-82yu00tlsp-portatil-156-ryzen-3-7320u-8gb-256gb-ssd-w11.jpg', 390.9, 'En cuanto a las reuniones virtuales, el Lenovo V15 G4 facilita la colaboración con funciones como el desenfoque de fondo, Lenovo Smart Appearance y la integración de Microsoft Teams. Estas características permiten celebrar reuniones sin distracciones, mejorando la privacidad y la apariencia personal durante las videoconferencias. Con opciones intuitivas para compartir contenido y controlar el micrófono, el portátil ofrece una experiencia completa para las necesidades de comunicación actuales.', 'Lenovo', 0),
(2902, 'Lenovo V15 G3 IAP 82TT00KBSP - Portátil 15.6 i3-1215U 8GB 256GB SSD', 'https://www.neobyte.es/108004-large_default/lenovo-v15-g3-iap-82tt00kbsp-portatil-156-i3-1215u-8gb-256gb-ssd.jpg', 350.9, 'Con un diseño compacto y ligero en color Business Black y un acabado texturizado, este portátil es tan atractivo como práctico. La pantalla de 15,6 pulgadas Full HD con características antirreflejos y una luminosidad de 250 cd/m² ofrece una experiencia visual confortable, incluso en largas jornadas de trabajo o estudio.', 'Lenovo', 0),
