(2930, 'Asus VivoBook 15 F1504ZA-NJ710 - Portátil 15.6 i7-1255U 16GB 512GB SSD', 'https://www.neobyte.es/109101-large_default/asus-vivobook-15-f1504za-nj710-portatil-156-i7-1255u-16gb-512gb-ssd.jpg', 599, 'El almacenamiento de 512 GB en un SSD asegura una respuesta rápida y accesibilidad ágil a tus datos. Con gráficos Intel Iris Xe, disfrutarás de una calidad visual excepcional. Su diseño en color plata fría le confiere un aspecto elegante. Con un peso de 1.7 kg, es ligero y fácil de transportar. Viene sin sistema operativo preinstalado, brindándote flexibilidad. El teclado QWERTY español completa esta opción versátil y potente para tus necesidades informáticas.', 'Asus', 0),
