(2936, 'MSI Alpha 17 C7VG-018ES - Portátil 17.3 Ryzen 9 7945HX 32GB RTX 4070 1TB SSD W11', 'https://www.neobyte.es/110724-large_default/msi-alpha-17-c7vg-018es-portatil-173-ryzen-9-7945hx-32gb-rtx-4070-1tb-ssd-w11.jpg', 2074.9, 'El MSI Alpha 17 C7VG-018ES redefine el rendimiento portátil con los potentes procesadores Ryzen 9 7945HX de AMD y la gráfica NVIDIA GeForce RTX Serie 40. Diseñado para gamers y creadores exigentes, este portátil ofrece una experiencia visual asombrosa con la arquitectura Ada Lovelace para trazado de rayos y DLSS 3 basado en IA. Con tecnologías como NVIDIA Max-Q, Wi-Fi 7, y un diseño de refrigeración mejorado con Shared-Pipe y MSI Overboost, experimentarás un rendimiento óptimo y una experiencia de juego inigualable. Además, cuenta con características premium como teclado RGB por tecla de SteelSeries, audio Hi-Resolution, memoria DDR5 de alta velocidad, y una unidad SSD PCIe Gen.4 para acelerar tus tareas. El MSI Alpha 17 C7VG-018ES es la combinación perfecta de potencia, velocidad y estilo, con el exclusivo MSI Center para una personalización completa. Eleva tu juego y creatividad con este portátil de alto rendimiento, diseñado para destacar en todos los aspectos.', 'MSI', 0),
