(2948, 'PC NEO Gaming i7-14700K RTX 4070 SUPER SSD 1TB + SSD 2TB 32GB', 'https://www.neobyte.es/107429-large_default/pc-neo-gaming-i7-14700k-rtx-4070-super-ssd-1tb-ssd-2tb-32gb.jpg', 1999, 'Por menos de lo que piensas puedes hacerte con este potente y elegante NEO GAMING provisto de CPU Intel Core i7-14700K, 32GB de RAM y tarjeta gráfica Nvidia GeForce RTX 4070 SUPER de 12GB, así como almacenamiento compuesto por 1TB SSD + 2TB SSD. Una configuración equilibrada que permite mover con soltura la mayoría de los juegos actuales y que te aporta la fiabilidad que solo los fabricantes de primer nivel puede asegurarte. Busca, compara y vuelve para hacerte con el ordenador gaming que siempre habías soñado.', 'Neobyte', 0),
