(2965, 'PC NEO Powered By Asus Ryzen 9 7900X3D RTX 4080 Super SSD 1TB+4TB 64GB', 'https://www.neobyte.es/94980-large_default/pc-neo-powered-by-asus-ryzen-9-7900x3d-rtx-4080-super-ssd-1tb4tb-64gb.jpg', 3599, 'Rendimiento extremo y máxima fiabilidad van de la mano en nuestra configuración NEO Powered By Asus con procesador AMD Ryzen 9 de 7ª generación 7900X3D, 64GB de memoria RAM y tarjeta gráfica de 16GB Nvidia Geforce RTX 4080 Super, una combinación perfecta para empezar a disfrutar de tus juegos como siempre habías imaginado, con la máxima fluidez y un nivel de detalles increíble. En lo referente al almacenamiento, hemos incorporado un disco sólido de 1TB que, combinado con otro SSD de 4TB, ofrece una velocidad sensacional a la hora de arrancar, ejecutar aplicaciones... Todo ello dentro de una caja de diseño irresistible diseño y grandes alternativas de configuración.', 'Neobyte', 0),
(2966, 'PC NEO Gaming i5-13400F RTX 4060 1TB SSD 16GB', 'https://www.neobyte.es/111650-large_default/pc-neo-gaming-i5-13400f-rtx-4060-1tb-ssd-16gb.jpg', 1039, 'Disfruta de un rendimiento de vanguardia con este NEO Gaming. Equipado con procesador Intel Core i5-13400F de 13ª generación, 16GB de memoria RAM y SSD de 1TB, lo tiene todo para hacerte vibrar en cada juego y experimentar lo último en cuanto a prestaciones. En el apartado gráfico, destacar que nuestros técnicos han incorporado una Nvidia GeForce RTX 4060 de 8GB, un componente en perfecto equilibrio con el resto de hardware. El resultado es un ordenador de sobremesa que se atreve con todo y ofrece una respuesta ágil en las tareas y juegos más variados. Por supuesto, este PC NEO Gaming incluye solo componentes de fabricantes de primer nivel y es concebido y ensamblado por nuestros técnicos con más de 15 años de experiencia.', 'Neobyte', 0),
(2967, 'PC NEO Gaming i7-13700K RTX 4070 SUPER SSD 1TB 16GB', 'https://www.neobyte.es/106327-large_default/pc-neo-gaming-i7-13700k-rtx-4070-super-ssd-1tb-16gb.jpg', 1699, 'Si te vuelve loc@ el RGB pero además quieres un PC gamer de garantías, nuestra configuración NEO Gaming es justo lo que buscas. A un diseño irresistiblemente llamativo que incluye multitud de componentes (incluyendo la caja) con iluminación RGB, hay que sumar la incorporación de un potente procesador como es el Intel Core i7-13700K, 16 GB de memoria RAM y tarjeta gráfica RTX 4070 SUPER de 12GB. Además, en cuanto a almacenamiento se refiere, este equipo está provisto de 1Tb SSD. Rendimiento sin contemplaciones y un estética que te dejará sin palabras... todo esto y mucho más cabe en este Neo Gaming.', 'Neobyte', 0),
(2968, 'PC NEO Office i3-13100 16GB 1TB SSD Windows 11', 'https://www.neobyte.es/101926-large_default/pc-neo-office-i3-13100-16gb-1tb-ssd-windows-11.jpg', 529, '', 'Neobyte', 0),
(2969, 'DeepCool PX1300-P ATX 3.0 (PCIe 5.0) - Fuente de alimentación 1300W', 'https://www.neobyte.es/107692-large_default/deepcool-px1300-p-atx-30-pcie-50-fuente-de-alimentacion-1300w.jpg', 307.9, 'DeepCool PX1300-P ATX 3.0 (PCIe 5.0) - Fuente de alimentación 1300W', 'DeepCool', 0),
(2970, 'DeepCool PX1000-P ATX 3.0 (PCIe 5.0) - Fuente de alimentación 1000W', 'https://www.neobyte.es/107685-large_default/deepcool-px1000-p-atx-30-pcie-50-fuente-de-alimentacion-1000w.jpg', 245.9, 'DeepCool PX1000-P ATX 3.0 (PCIe 5.0) - Fuente de alimentación 1000W', 'DeepCool', 0),
(2971, 'Kingston Fury Renegade 16GB DDR4 4000MHz CL19 - Memoria RAM', 'https://www.neobyte.es/107682-large_default/kingston-fury-renegade-16gb-ddr4-4000mhz-cl19-memoria-ram.jpg', 62.9, 'Kingston Fury Renegade 16GB DDR4 4000MHz CL19 - Memoria RAM', 'Kingston', 0),
(2972, 'Kingston Fury Renegade 16GB DDR4 3600MHz CL16 - Memoria RAM', 'https://www.neobyte.es/107679-large_default/kingston-fury-renegade-16gb-ddr4-3600mhz-cl16-memoria-ram.jpg', 52.9, 'Kingston Fury Renegade 16GB DDR4 3600MHz CL16 - Memoria RAM', 'Kingston', 0),
(2973, 'Kingston Fury Renegade 32GB (2x16GB) DDR4 3600MHz CL16 - Memoria RAM', 'https://www.neobyte.es/107674-large_default/kingston-fury-renegade-32gb-2x16gb-ddr4-3600mhz-cl16-memoria-ram.jpg', 102.9, 'Kingston Fury Renegade 32GB (2x16GB) DDR4 3600MHz CL16 - Memoria RAM', 'Kingston', 0),
(2974, 'Kingston Fury Renegade 32GB (2x16GB) DDR4 3200MHz CL16 - Memoria RAM', 'https://www.neobyte.es/107671-large_default/kingston-fury-renegade-32gb-2x16gb-ddr4-3200mhz-cl16-memoria-ram.jpg', 95.9, 'Kingston Fury Renegade 32GB (2x16GB) DDR4 3200MHz CL16 - Memoria RAM', 'Kingston', 0),
(2975, 'DeepCool Z5 (3g) - Pasta térmica', 'https://www.neobyte.es/107664-large_default/deepcool-z5-3g-pasta-termica.jpg', 2.9, 'DeepCool Z5 (3g) - Pasta térmica', 'DeepCool', 0),
(2976, 'DeepCool Z10 (5g) - Pasta térmica', 'https://www.neobyte.es/107660-large_default/deepcool-z10-5g-pasta-termica.jpg', 3.9, 'DeepCool Z10 (5g) - Pasta térmica', 'DeepCool', 0),
(2977, 'Kaspersky Standard - Antivirus (10 dispositivos / 1 año)', 'https://www.neobyte.es/96471-large_default/kaspersky-standard-antivirus-10-dispositivos-1-ano.jpg', 26.9, 'Kaspersky Standard - Antivirus (10 dispositivos / 1 año)', 'Kaspersky', 0),
(2978, 'Kingston Fury Beast 16GB (2x8GB) DDR4 3200 MHz CL16 - Memoria RAM', 'https://www.neobyte.es/53495-large_default/kingston-fury-beast-16gb-2x8gb-ddr4-3200-mhz-cl16-memoria-ram.jpg', 39.89, 'Kingston Fury Beast 16GB (2x8GB) DDR4 3200 MHz - Kit memoria RAM', 'Kingston', 0),
(2979, 'Western Digital Black SN770 1TB - Disco duro SSD M.2 NVMe', 'https://www.neobyte.es/67450-large_default/western-digital-black-sn770-1tb-disco-duro-ssd-m2-nvme.jpg', 79.9, 'Además, este SSD es compatible con la interfaz PCIe 4.0, aprovechando al máximo las últimas plataformas y proporcionando un ancho de banda notablemente mayor en comparación con generaciones anteriores. Esta característica es especialmente valiosa para aplicaciones que requieren una alta tasa de transferencia de datos.', 'Western Digital', 0),
(2980, 'Gigabyte H510M H v2 - Placa base 1200 Micro-ATX', 'https://www.neobyte.es/100860-large_default/gigabyte-h510m-h-v2-placa-base-1200-micro-atx.jpg', 69.9, 'Gigabyte H510M H v2 - Placa base 1200 Micro-ATX', 'Gigabyte', 0);
INSERT INTO `producto` (`id`, `nombre`, `imagen`, `precio`, `especificaciones`, `marca`, `id_categoria`) VALUES
(2981, 'Gigabyte GP-UD750GM 750W 80 Plus Gold Modular', 'https://www.neobyte.es/72148-large_default/gigabyte-gp-ud750gm-750w-80-plus-gold-modular.jpg', 99.9, 'La certificación 80 Plus Gold no es solo un distintivo de eficiencia, sino una promesa de ahorro a largo plazo. La GP-UD750GM garantiza un uso óptimo de la electricidad, lo que no solo reduce tus costos operativos, sino que también contribuye a un menor impacto ambiental al requerir menos energía para funcionar. Con una potencia robusta de 750W, esta fuente de alimentación es la elección ideal para sistemas de alto rendimiento, desde estaciones de trabajo avanzadas hasta configuraciones de juego intensivo.', 'Gigabyte', 0),
(2982, 'DISCO DURO SEAGATE BARRACUDA 2TB 2.5 ST2000LM015', 'https://www.neobyte.es/62797-large_default/disco-duro-seagate-barracuda-2tb-25-st2000lm015.jpg', 80.9, 'DISCO DURO SEAGATE BARRACUDA 2TB 2.5 ST2000LM015', 'Seagate', 0),
(2983, 'Asus Prime H610M-A D4 [CSM] - Placa base 1700 micro-ATX', 'https://www.neobyte.es/63895-large_default/asus-prime-h610m-a-d4-csm-placa-base-1700-micro-atx.jpg', 96.9, 'Asequible y fiable, la placa base Asus Prime H610M-A D4-CSM es perfecta para corporaciones gracias a sus interesantes funcionalidades empresariales. Entre ellas, destacar su amplísima variedad de puertos y la fiabilidad probada pero, sobre todo, el software de monitorización Asus Control Center Express, que simplifica el mantenimiento y la configuración de las diferentes opciones de seguridad. La Asus Prime H610M-A D4-CSM te aporta, además, la flexibilidad que necesitas para el montaje de tu ordenador con procesador Intel con socket 1700.', 'Asus', 0),
(2984, 'TeamGroup Cardea A440 2TB NVME - Disco Duro SSD', 'https://www.neobyte.es/69631-large_default/teamgroup-cardea-a440-2tb-nvme-disco-duro-ssd.jpg', 205.91, 'TeamGroup Cardea A440 2TB NVME - Disco Duro SSD', 'TeamGroup', 0),
(2985, 'AMD Ryzen 5 5600G - Procesador AM4', 'https://www.neobyte.es/53007-large_default/procesador-amd-ryzen-5-5600g-socket-am4.jpg', 122.9, 'El procesador AMD Ryzen 5 5600G con gráficos integrados Radeon es una apuesta segura por la fiabilidad. Esta CPU de 6 núcleos y 12 subproceso ofrece un excelente rendimiento multitarea. Es compatible con placas base con socket AM4 y es capaz de alcanzar frecuencias de hasta 4.4 GHz. Además, cuenta con disipador térmico Wraith Stealth. Compra ya la CPU AMD Ryzen 5 5600G en Neobyte con todas las garantías.', 'AMD', 0),
(2986, 'G.Skill Trident Z5 Neo RGB 32GB (2x16GB) DDR5 6000MHz CL32 - Memoria RAM', 'https://www.neobyte.es/84595-large_default/gskill-trident-z5-neo-rgb-32gb-2x16gb-ddr5-6000mhz-cl32-memoria-ram.jpg', 169.9, 'El atractivo distintivo de este kit de memoria Trident Z5 Neo radica en su iluminación RGB. Personaliza tu sistema con efectos de iluminación vibrantes y sincroniza el esquema de colores con el resto de tu configuración para una experiencia visual impactante. Además, el diseño elegante y la construcción de alta calidad hacen que este kit de memoria no solo sea un componente esencial para el rendimiento, sino también una adición estética atractiva a tu plataforma.', 'G Skill', 0),
(2987, 'Western Digital Black SN850X 2TB Disipador - SSD M.2 NVMe', 'https://www.neobyte.es/99844-large_default/western-digital-black-sn850x-2tb-disipador-ssd-m2-nvme.jpg', 164.9, 'El WD Black SN850X es compatible con la interfaz PCIe 4.0, lo que significa que aprovecha al máximo las últimas plataformas y ofrece un ancho de banda significativamente mayor en comparación con generaciones anteriores. Esta característica es especialmente valiosa para aplicaciones que requieren una alta tasa de transferencia de datos', 'Western Digital', 0),
(2988, 'AMD Ryzen 7 5800X3D - Procesador AM4', 'https://www.neobyte.es/71813-large_default/amd-ryzen-7-5800x3d-procesador-am4.jpg', 279.9, 'El procesador AMD Ryzen 7 5800X3D te permitirá equipar tu PC con un componente de gran fiabilidad y potencia. Esta CPU de ocho núcleos alcanza frecuencias de hasta 4,5 GHz y es compatible con memorias RAM DDR4 hasta 3200 Mhz y con el socket AM4 de AMD. Completa tu ordenador gaming o workstation con el AMD Ryzen 7 5800X3D y haz que vuele.', 'AMD', 0),
(2989, 'Samsung 990 Pro 4TB - Unidad SSD M.2 PCIe 4.0', 'https://www.neobyte.es/103421-large_default/samsung-990-pro-4tb-unidad-ssd-m2-pcie-40.jpg', 378.9, 'La tecnología Intelligent TurboWrite utiliza un búfer de caché para almacenar datos a altas velocidades. Esto ayuda a reducir la latencia de escritura y a mejorar el rendimiento general del SSD.', 'Samsung', 0),
(2990, 'AMD Ryzen 7 7800X3D - Procesador AM5', 'https://www.neobyte.es/91528-large_default/amd-ryzen-7-7800x3d-procesador-am5.jpg', 389.9, 'La innovadora tecnología 3D V-Cache de AMD lleva la capacidad de la caché al siguiente nivel, mejorando la eficiencia y el rendimiento en una amplia variedad de cargas de trabajo. Ya sea que seas un jugador apasionado, un creador de contenido o un profesional que realiza múltiples tareas, el Ryzen 7 7800X3D ofrece la potencia que necesitas. Además, la compatibilidad con la plataforma AM5 garantiza una fácil integración con una amplia variedad de placas base, permitiéndote personalizar tu sistema según tus necesidades específicas.', 'AMD', 0),
(2991, 'Gigabyte RTX 4070 Ti Eagle OC 12GB GDDR6 (rev2.0) DLSS3 - Tarjeta gráfica', 'https://www.neobyte.es/102696-large_default/gigabyte-rtx-4070-ti-eagle-oc-12gb-gddr6-rev20-dlss3-tarjeta-grafica.jpg', 856.9, 'El sistema de refrigeración WINDFORCE 3X de Gigabyte ofrece un enfriamiento eficiente para mantener la temperatura bajo control durante largas sesiones de juego. Con tres ventiladores únicos, este sistema garantiza una disipación de calor efectiva manteniendo niveles de ruido mínimos. La versión OC (Overclocked) de la tarjeta gráfica viene con velocidades de reloj optimizadas de fábrica para ofrecer un rendimiento aún más potente. Esto proporciona un margen adicional para el rendimiento gráfico, ideal para aquellos que buscan el máximo rendimiento en sus juegos y aplicaciones.', 'Gigabyte', 0),
(2992, 'BenQ Zowie XL2566K - Monitor 24.5 Full HD 360Hz Reacondicionado', 'https://www.neobyte.es/107781-large_default/benq-zowie-xl2566k-monitor-245-full-hd-360hz-reacondicionado.jpg', 599, 'Producto procedente de devolución: Abierto. En perfectas condiciones. 1 año de garantía.', 'Zowie benq', 0),
(2993, 'BenQ Mobiuz EX2710Q - Monitor 27 IPS WQHD 165Hz Reacondicionado', 'https://www.neobyte.es/107769-large_default/benq-mobiuz-ex2710q-monitor-27-ips-wqhd-165hz-reacondicionado.jpg', 298.99, 'Producto procedente de devolución: Abierto. En perfectas condiciones. 1 año de garantía.', 'Benq', 0),
(2994, 'DeepCool RGB 350 - Kit de iluminación para PC', 'https://www.neobyte.es/107644-large_default/deepcool-rgb-350-kit-de-iluminacion-para-pc.jpg', 15.9, 'DeepCool RGB 350 - Kit de iluminación para PC', 'DeepCool', 0),
(2995, 'Samsung Smart Monitor M7 LS32BM701UPXEN Blanco - Monitor 32 4K Smart TV', 'https://www.neobyte.es/107284-large_default/samsung-smart-monitor-m7-ls32bm701upxen-blanco-monitor-32-4k-smart-tv.jpg', 328.9, 'Samsung Smart Monitor M7 LS32BM701UPXEN Blanco - Monitor 32 4K Smart TV', 'Samsung', 0),
(2996, 'Samsung Smart Monitor M7 LS32BM700UPXEN - Monitor 32 4K Smart TV', 'https://www.neobyte.es/107250-large_default/samsung-smart-monitor-m7-ls32bm700upxen-monitor-32-4k-smart-tv.jpg', 302.9, 'Samsung Smart Monitor M7 LS32BM700UPXEN - Monitor 32 4K Smart TV', 'Samsung', 0),
(2997, 'Samsung Odyssey G9 S49CG934SU - Monitor curvo 49 Dual QHD 5K', 'https://www.neobyte.es/107239-large_default/samsung-odyssey-g9-s49cg934su-monitor-curvo-49-dual-qhd-5k.jpg', 1182.9, 'El Samsung Odyssey G9 S49CG934SU es más que un monitor, es una puerta a un mundo de juego inmersivo y competitivo. Con su tecnología de vanguardia, diseño elegante y funciones personalizables, este monitor te permite disfrutar al máximo de tus juegos favoritos.', 'Samsung', 0),
(2998, 'Astro Gaming A10 (Gen 2) - Auriculares gaming', 'https://www.neobyte.es/106798-large_default/astro-gaming-a10-gen-2-auriculares-gaming.jpg', 40.9, 'Astro Gaming A10 (Gen 2) - Auriculares gaming', 'ASTRO', 0),
(2999, 'Thermaltake Argent H5 RGB 7.1 - Auriculares gaming', 'https://www.neobyte.es/106509-large_default/thermaltake-argent-h5-rgb-71-auriculares-gaming.jpg', 119.9, 'Thermaltake Argent H5 RGB 7.1 - Auriculares gaming', 'Thermaltake', 0),
(3000, 'Krom Kernel - Teclado gaming mecánico RGB', 'https://www.neobyte.es/13474-large_default/teclado-mecanico-krom-kernel-tkl-rgb-numerico.jpg', 38.9, 'El teclado gaming Krom Kernel satisface con creces las necesidades de todo gamer, pues cuenta con una extraordinaria relación calidad-precio y unas especificaciones técnicas más que interesantes. Muestra de ello es que incorpora switches mecánicos Outemu RED, función anti-ghosting y la posibilidad de crear macros al vuelo, cualidades que garantizan la máxima precisión en cada movimiento. Además, el Krom Kernel está provisto de retroiluminación LED con 9 efectos, algo que encantará a los apasionados del RGB.', 'Krom', 0),
(3001, 'AOC 24B2XH/EU - Monitor 24 Full HD IPS 75Hz', 'https://www.neobyte.es/76446-large_default/aoc-24b2xheu-monitor-24-full-hd-ips-75hz.jpg', 89.9, 'MONITOR 23.8 AOC 24B2XH/EU IPS FULL HD VGA HDMI', 'AOC', 0),
(3002, 'MSI Gaming G2712V - Monitor 27 IPS Full HD 100Hz', 'https://www.neobyte.es/105932-large_default/msi-gaming-g2712v-monitor-27-ips-full-hd-100hz.jpg', 178.9, 'MSI Gaming G2712V - Monitor 27 IPS Full HD 100Hz', 'MSI', 0),
(3003, 'Corsair TC100 RELAXED Leatherette Negra - Silla gaming', 'https://www.neobyte.es/88083-large_default/corsair-tc100-relaxed-leatherette-negra-silla-gaming.jpg', 219.9, 'Corsair TC100 RELAXED Leatherette Negra - Silla gaming', 'Corsair', 0),
(3004, 'Gigabyte G34WQC A - Monitor curvo 34 UWQHD 144Hz', 'https://www.neobyte.es/63828-large_default/gigabyte-g34wqc-a-monitor-curvo-34-uwqhd-144hz.jpg', 388.99, 'Con el Gigabyte G34WQC A vivirás la experiencia gaming más inmersiva. Gracias a su fabuloso panel curvo de 34 y resolución UWQHD (3440 x 1440), te trasladarás al centro de la acción, disfrutando así de cada escena de tus juegos y películas como siempre habías soñado. Además, el Gigabyte G34WQC A destaca por su tasa de refresco de 144Hz, lo que se traduce en transiciones suaves, fluidas y precisas. Por último, indicar que incorpora altavoces y peana con múltiples alternativas de ajuste.', 'Gigabyte', 0),
(3005, 'PC NEO Gaming i5-12400F RTX 4060 SSD 1TB 16GB', 'https://www.neobyte.es/110186-large_default/pc-neo-gaming-i5-12400f-rtx-4060-ssd-1tb-16gb.jpg', 849, 'Te presentamos otra configuración con el sello de identidad de Neobyte: primeras marcas, componentes equilibrados y el precio más ajustado. En esta ocasión, hemos confeccionado un PC que incluye la innovadora gráfica Nvidia RTX 4060, un elemento con el que disfrutar de juegos de forma rápida y fluida. Incluye, por supuesto, un procesador de garantías, el Intel Core i5-12400F, con 16GB de RAM y SSD de 1TB, una apuesta clara por la potencia y la fiabilidad. A todo ello añadimos una caja espectacular con impresionantes efectos de iluminación y ya tenemos un PC Gaming de primer nivel.', 'Neobyte', 0),
(3006, 'PC NEO Gaming Ryzen 5 5500 RTX 4060 SSD 1TB 16GB', 'https://www.neobyte.es/106678-large_default/pc-neo-gaming-ryzen-5-5500-rtx-4060-ssd-1tb-16gb.jpg', 849, 'Jugar con todas las garantías, de forma fluida y rápida es la propuesta de este PC NEO Gaming. Un ordenador equipado con procesador AMD Ryzen 5, 16GB de memoria y una potente gráfica RTX 4060 que te permitirá disfrutar de una increíble experiencia gaming, apostando por la fiabilidad de unos componentes ampliamente contrastados y fiables. En cuanto al resto del hardware, este equipo cuenta con un SSD de 1TB, que aporta espacio y velocidad al funcionamiento general del PC, fuente de alimentación de 750W y una caja robusta. Confía en los 15 años de experiencia de Neobyte y hazte ahora con este impresionante ordenador.', 'Neobyte', 0),
(3007, 'PC NEO Gaming Ryzen 7 5700X RTX 4060 1TB SSD 16GB', 'https://www.neobyte.es/106506-large_default/pc-neo-gaming-ryzen-7-5700x-rtx-4060-1tb-ssd-16gb.jpg', 998.99, 'Equipado con componentes de primeras marcas y diseñado por técnicos experimentados, este PC NEO Gaming te permitirá disfrutar de un funcionamiento estable y fluido. Un ordenador gaming en el que se ha buscado el equilibrio entre una configuración de garantías y un precio ajustado, siempre pensando en ofrecer un rendimiento óptimo a la hora de jugar y trabajar. Para ello se ha incluido un procesador Amd Ryzen 7 5700X, 16GB de memoria y una potente gráfica Nvidia RTX 4060, además de un SSD de 1TB. ¡Codéate con los mejores!', 'Neobyte', 0),
(3008, 'PC NEO Gaming i7-14700K RTX 4070 SUPER SSD 1TB 32GB', 'https://www.neobyte.es/108762-large_default/pc-neo-gaming-i7-14700k-rtx-4070-super-ssd-1tb-32gb.jpg', 1798.99, 'En Neobyte hemos diseñado este PC NEO Gaming para hacer frente a los desafíos más exigentes. No en vano, su equilibrada y potente configuración cuenta con componentes ampliamente contrastados, perfectos para ofrecer un gran rendimiento, así como un funcionamiento fiable. Entre los elementos más destacables encontramos una CPU Intel Core i7-14700K, refrigerada por una líquida Asus TUF Gaming LC240 RGB con radiador de 240 mm, y una tarjeta gráfica Nvidia RTX 4070 SUPER, además de la memoria RAM de 32GB y el SSD de 1TB. Un PC gaming que te situará en la acción de los juegos para vivir una experiencia única. ¡Hazte con el a un precio imbatible!', 'Neobyte', 0),
(3009, 'PC NEO Lord Sith i7-14700K RTX 4080 Super 32GB 2TB SSD', 'https://www.neobyte.es/110566-large_default/pc-neo-lord-sith-i7-14700k-rtx-4080-super-32gb-2tb-ssd.jpg', 2599, 'Si has sucumbido al lado oscuro... ¡estás de enhorabuena! Todo Lord Sith debe tener en sus aposentos un PC NEO LORD SITH, bien sea para sus momentos de descanso, de ocio o para mandar algunos emails a sus tropas de asalto. Este PC cuenta con un procesador Intel Core i7 14700K de última generación de 20 núcleos (fabricado en el planeta Tierra), 32GB de RAM a velocidad DDR5 (sí, casi tan rápidas como esas naves que llevan hiperimpulsor), almacenamiento de 2TB para guardar tus vídeos de conquista en HD y como no, una gráfica NVIDIA GeForce RTX 4080 Super 16GB que es lo único verde que tendrá un Sith.', 'Neobyte', 0),
(3010, 'Cudy LT700 (AC1200) - Router Dual Band 4G y Wi-Fi 5', 'https://www.neobyte.es/107810-large_default/cudy-lt700-ac1200-router-dual-band-4g-y-wi-fi-5.jpg', 118.89, 'Cudy LT700 (AC1200) - Router Dual Band 4G y Wi-Fi 5', 'Cudy', 0),
