(3020, 'Krom Kernel - Teclado gaming mecánico RGB', 'https://www.neobyte.es/13474-large_default/teclado-mecanico-krom-kernel-tkl-rgb-numerico.jpg', 38.9, 'El teclado gaming Krom Kernel satisface con creces las necesidades de todo gamer, pues cuenta con una extraordinaria relación calidad-precio y unas especificaciones técnicas más que interesantes. Muestra de ello es que incorpora switches mecánicos Outemu RED, función anti-ghosting y la posibilidad de crear macros al vuelo, cualidades que garantizan la máxima precisión en cada movimiento. Además, el Krom Kernel está provisto de retroiluminación LED con 9 efectos, algo que encantará a los apasionados del RGB.', 'Krom', 0),
