(3022, 'CHiQ L32G7LX - Televisor 32 HD Smart TV', 'https://www.neobyte.es/89807-large_default/chiq-l32g7lx-televisor-32-hd-smart-tv.jpg', 189.99, 'Si buscas un smart TV barato pero con todas las posibilidades de Android TV, el CHiQ L32G7LX es para ti. Este modelo cuenta con multitud de puertos y alternativas de conexión (HDMI, WiFi, Bluetooth, S/pdif) para garantizarte una compatibilidad total. Además, gracias al procesador de cuatro núcleos podrás navegar por todas tus aplicaciones y contenidos de manera intuitiva y fluida. En cuanto a sus características de imagen y sonido, indicar que dispone de panel HD y altavoces con tecnología dbx-tv, convirtiéndola así en una opción perfecta para segundas viviendas, dormitorios...', 'CHiQ', 0),
