(3026, 'Gigabyte G34WQC A - Monitor curvo 34 UWQHD 144Hz', 'https://www.neobyte.es/63828-large_default/gigabyte-g34wqc-a-monitor-curvo-34-uwqhd-144hz.jpg', 388.99, 'Con el Gigabyte G34WQC A vivirás la experiencia gaming más inmersiva. Gracias a su fabuloso panel curvo de 34 y resolución UWQHD (3440 x 1440), te trasladarás al centro de la acción, disfrutando así de cada escena de tus juegos y películas como siempre habías soñado. Además, el Gigabyte G34WQC A destaca por su tasa de refresco de 144Hz, lo que se traduce en transiciones suaves, fluidas y precisas. Por último, indicar que incorpora altavoces y peana con múltiples alternativas de ajuste.', 'Gigabyte', 0),
