(3049, 'Ubiquiti Nanostation Loco M5 5GHz Indoor/Outdoor', 'https://www.neobyte.es/9721-large_default/antena-ubiquiti-nanostation-loco-m5-5ghz-indoor.jpg', 66.9, '¿Buscas un crear una red punto a punto? Con la Ubiquiti Nanostation Loco M5 es ideal para esta tarea. Te permite unir dos redes físicas en una de sola, de manera que podrás compartir todos los datos entre dos oficinas o proporcionar Internet a otra de ellas. Su frecuencia de trabajo de 5Ghz estará libre de interferencias con otras Wi-Fi de 2.4GHz. Además, su reducido tamaño permite que sea más fácil de colocar y más versátil.', 'Ubiquiti', 0),
