(3055, 'Ubiquiti Nanostation M2 Indoor/Outdoor', 'https://www.neobyte.es/9725-large_default/antena-ubiquiti-nanostation-m2-2-4ghz-11dbi.jpg', 87.89, '¿Buscas un crear una red punto a punto? Con la Ubiquiti Nanostation M2 es ideal para esta tarea. Te permite unir dos redes físicas en una de sola, de manera que podrás compartir todos los datos entre dos oficinas o proporcionar Internet a otra de ellas. Su banda de 2.4Ghz te proporciona la máxima compatibilidad entre todos los dispositivos. Su alimentación POE te permite tener únicamente un cable de red conectado en su base. Está preparada para ser colocada tanto en interiores como en exteriores.', 'Ubiquiti', 0),
