(3060, 'Lenovo TAB M10 PLUS (3GEN) 4GB+128GB WiFi - Tablet', 'https://www.neobyte.es/100061-large_default/lenovo-tab-m10-plus-3gen-4gb128gb-wifi-tablet.jpg', 157.91, 'En resumen, la Lenovo Tab M10 Plus de 3.ª generación ofrece no solo un rendimiento potente y una experiencia visual excepcional, sino también funcionalidades diseñadas para satisfacer las necesidades de toda la familia.', 'Lenovo', 0),
