(3063, 'Asus VivoWatch BP (HC-A04) - Smartwatch', 'https://www.neobyte.es/19190-large_default/asus-vivowatch-bp-hc-a04-smartwatch.jpg', 92.89, 'Asus VivoWatch BP (HC-A04) ha sido diseñado para mejorar tu salud cardiovascular. Este preciso Smartwatch incorpora tecnología Asus Health AI, que emplea un sensor óptico para realizar un seguimiento continuo y seguro de la frecuencia cardíaca y la presión arterial. Estos datos, junto con los de edad y género, aportan la información necesaria para medir la intensidad del ejercicio y establecer pautas que mejoren la salud de nuestro corazón. Además, podrás realizar un seguimiento del sueño y llevar un control global de tu salud basado en la actividad física y la calidad del descanso. Comienza a cuidarte con el Asus VivoWatch BP.', 'Asus', 0),
(3064, 'Lenovo TAB M10 (3GEN) 4GB+64GB WIFI GREY - Tablet', 'https://www.neobyte.es/100050-large_default/lenovo-tab-m10-3gen-4gb64gb-wifi-grey-tablet.jpg', 131.9, 'La Tab M10 (3GEN) 4GB+64GB WIFI GREY ZAAE0049ES es una combinación perfecta de calidad de imagen, sonido envolvente y rendimiento potente. Su pantalla LCD FHD y altavoces con Dolby Atmos brindan una experiencia de transmisión inmersiva, mientras que la certificación TÜV Rheinland Low Blue Light cuida la salud visual durante sesiones prolongadas. Con potencia y autonomía suficientes para múltiples tareas, esta tablet se destaca como una opción versátil para diversas actividades digitales.', 'Lenovo', 0),
(3065, 'Correa para Smartwatch Asus VivoWatch ASUS HC-S02 - Blanca', 'https://www.neobyte.es/73523-large_default/correa-para-smartwatch-asus-vivowatch-asus-hc-s02-blanca.jpg', 27, 'Hc-s02 Vivowatch Band White Leather', 'Asus', 0),
(3066, 'Xiaomi MI True Wireless 2S - Auriculares inalámbricos', 'https://www.neobyte.es/48478-large_default/auriculares-xiaomi-mi-true-wireless-2s.jpg', 37.9, 'Los Xiaomi Mi True Wireless 2S son los auriculares inalámbricos que querrás llevar a todas partes. Equipados con la tecnología más novedosa, utilizan la transmisión síncrona biaural para lograr que sus dos auriculares se conecten de forma simultánea, consiguiendo así una emisión de audio estable y sin cortes. Además, realizar llamadas desde cualquier lugar ya no va a suponer ningún problema gracias a su micrófono con cancelación de ruido, que te garantizará una comunicación de calidad. Dispone de control táctil para que puedas activar funciones cómo llamar, reproducir o pausar música golpeando suavemente con los dedos cada auricular, y su sensor de infrarrojos es capaz de detectar cuándo no los llevas puestos y detener la música en consecuencia. Autonomía de hasta 4 horas, activación por voz inteligente y carga rápida son solo algunas de las características con las que cuentan los Xiaomi Mi True Wireless 2S. Hazte con ellos en Neobyte para acabar de descubrirlas todas.', 'Xiaomi', 0),
(3067, 'Asus VivoWatch SP (HC-A05) - Smartwatch', 'https://www.neobyte.es/38129-large_default/reloj-asus-vivowatch-sp.jpg', 179.89, 'Asus VivoWatch SP (HC-A05) es el reloj inteligente que tiene todo lo que necesitas para una monitorización exhaustiva tanto de la salud como de tu actividad diaria. Con un diseño actual y discreto, así como con un manejo sencillo, este smartwatch te ayudará a llevar un control de aspectos tan importantes como la presión arterial, la frecuencia cardíaca, la calidad del sueño, calorías quemadas, nivel de oxígeno en sangre... convirtiéndose así es tu aliado perfecto para una vida saludable. Además, es capaz de contrar pasos e integra altímetro y GPS, lo que permite un análisis pormenorizado de cualquier actividad física. Por último, destacar su larga autonomía, la resistencia al agua y notificaciones integradas tanto de llamada como de texto. Por todo ello el Asus VivoWatch SP (HC-A05) es mucho más que un smartwatch. ¡Cómpralo ya en Neobyte con las máximas garantías!', 'Asus', 0),
(3068, 'Xiaomi Smart Band 8 Active Black - Pulsera de actividad', 'https://www.neobyte.es/106006-large_default/xiaomi-smart-band-8-active-black-pulsera-de-actividad.jpg', 25.89, 'Xiaomi Smart Band 8 Active Black - Pulsera de actividad', 'Xiaomi', 0),
(3069, 'Asus VivoWatch HC-S03 Gris - Correa para Smartwatch', 'https://www.neobyte.es/77757-large_default/asus-vivowatch-hc-s03-gris-correa-para-smartwatch.jpg', 26.02, 'Asus VivoWatch HC-S03 Gris - Correa para Smartwatch', 'Asus', 0),
