(3073, 'Alcatel 2057D 4MB 4MB Blanco puro - Smartphone 2.4 2G', 'https://www.neobyte.es/66299-large_default/alcatel-2057d-4mb-4mb-blanco-puro-smartphone-24-2g.jpg', 39.91, 'Alcatel 2057D Blanco Puro - Smartphone 2.4 4MB 4MB 2G', 'Alcatel', 0),
(3074, 'Xiaomi Mi True Wireless Earbuds Basic 2', 'https://www.neobyte.es/48463-large_default/auriculares-xiaomi-mi-true-wireless-earbuds-basic-2.jpg', 16.9, 'Los Xiaomi Mi True Wireless Earbuds Basic 2 son los auriculares inalámbricos que siempre querrás tener en tu mochila. Fabricados con materiales de calidad y equipados con la mejor tecnología, estos dispositivos están listos para ser usados tan pronto como se sacan de su estuche de carga. Emparejamiento rápido, sincronización perfecta y Bluetooth 5.0 para una transmisión ágil de datos y una calidad de sonido como nunca antes habías experimentado. En cuanto a su autonomía, podrás usarlo de manera ininterrumpida durante 4 horas y disfrutar de tu música o realizar llamadas en cualquier parte gracias a su ligero peso, que lo convierten en un dispositivo perfecto para transportar. No lo dudes, en cuanto pruebes los Xiaomi Mi True Wireless Earbuds Basic 2 se convertirán en un imprescindible en tu día a día.', 'Xiaomi', 0),
(3075, 'Lenovo Tab M10 (3ª Gen.) 3GB 32GB Wi-Fi Gris Tormenta - Tablet 10.1', 'https://www.neobyte.es/104026-large_default/lenovo-tab-m10-3-gen-3gb-32gb-wi-fi-gris-tormenta-tablet-101.jpg', 105.9, 'Un procesador veloz de ocho núcleos,  3GB de RAM y una amplia batería te permiten disfrutar de tus aplicaciones y juegos favoritos durante horas. Su diseño moderno y ligero la hace ideal para llevarla contigo a donde vayas.', 'Lenovo', 0),
