(3078, 'Samsung Galaxy Tab S6 Lite 4GB 64GB Wi-Fi Gris (2022) - Tablet 10.4', 'https://www.neobyte.es/102799-large_default/samsung-galaxy-tab-s6-lite-4gb-64gb-wi-fi-gris-2022-tablet-104.jpg', 289.9, 'Samsung Galaxy Tab S6 Lite 4GB 64GB Wi-Fi Gris (2022) - Tablet 10.4', 'Samsung', 0),
(3079, 'Lenovo TAB M10 (3GEN) 4GB+64GB WIFI LTE GREY - Tablet', 'https://www.neobyte.es/100056-large_default/lenovo-tab-m10-3gen-4gb64gb-wifi-lte-grey-tablet.jpg', 166.9, 'La Tab M10 de 3ª generación se adapta a diversos intereses y necesidades. Google Play ofrece una amplia variedad de aplicaciones, desde fotografía hasta astronomía, permitiendo a los usuarios explorar nuevas formas de estar conectados con amigos y mantenerse actualizados. Además, Google Play Protect contribuye a mantener el dispositivo limpio y los datos seguros, analizando diariamente más de 100,000 aplicaciones, incluso aquellas que aún no han sido instaladas, para proteger contra posibles amenazas de aplicaciones maliciosas.', 'Lenovo', 0),
(3080, 'Belkin RockStar - Adaptador audio 3.5 mm + carga Lightning Reacondicionado', 'https://www.neobyte.es/70396-large_default/belkin-rockstar-adaptador-audio-35-mm-carga-lightning-reacondicionado.jpg', 29.95, 'Producto proveniente de devolución: Producto sin desprecintar, como nuevo', 'Belkin', 0),
