(3099, 'LG 32LT340C - Televisor 32 HD', 'https://www.neobyte.es/49380-large_default/televisor-lg-32-32lt340c.jpg', 344.9, 'El LG 32LT340C es un televisor de 32 pulgadas diseñado para entornos empresariales. Cuenta con resolución HD, lo que asegura una calidad de imagen óptima, y una amplia conectividad, con puertos HDMI, puerto USB, salida de altavoz externo... Además, es compatible con el montaje en pard VESA 200 x 200, lo que amplía las posibilidades de instalación en oficinas o centros de negocios. Compra ya la LG 32LT340C en Neobyte al mejor precio.', 'LG', 0),
