(3123, 'Xiaomi MI TV P1E ELA4740EU Smart TV 32 HD Android', 'https://www.neobyte.es/89226-large_default/xiaomi-mi-tv-p1e-ela4740eu-smart-tv-32-hd-android.jpg', 168.9, 'Consigue el mejor precio el smart TV Xiaomi MI TV P1E ELA4740EU, un televisor de 32 pulgadas con Android TV y todo lo que necesitas para disfrutar del entretenimiento en casa. Por su tamaño y características, es una alternativa sensacional para dormitorios y segundas viviendas. Entre sus especificaciones más importantes, destacar el procesador de 4 núcleos, la conectividad WiFi, Bluetooth, USB... ¡Justo lo que necesitas sin pagar un euro de más!', 'Xiaomi', 0),
(3124, 'AENO GH1S Ecológico Premium Inteligente - Calefactor por infrarrojos', 'https://www.neobyte.es/111355-large_default/aeno-gh1s-ecologico-premium-inteligente-calefactor-por-infrarrojos.jpg', 249.9, 'El calefactor ecológico premium inteligente de AENO ofrece una tecnología de calefacción única que ahorra energía y es respetuosa con el medio ambiente. Con un diseño elegante y materiales de primera calidad, este calefactor combina calentamiento rápido y eficiencia energética, siendo dos veces más eficiente que los calentadores clásicos. Su tecnología de infrarrojos calienta objetos y aire sin secarlos, proporcionando una distribución uniforme del calor en la habitación. Además, su aplicación móvil permite ajustar la temperatura y controlar el consumo de energía de forma remota, ofreciendo una climatización inteligente y económica. Con características de seguridad adicionales como protección contra caídas y bloqueo para niños, este calefactor garantiza un ambiente cálido y seguro en cualquier momento.', 'Aeno', 0),
